INSERT INTO `lesson` VALUES ('12', '3', 'Qui voluptatem architecto dolor distinctio et quia distinctio inventore dolorem est.', 'Illum veniam iste non dolor hic eveniet et quia eum qui iusto cum omnis veritatis veniam odit nihil placeat voluptatem non est consequuntur qui et nesciunt est neque facere enim dolore voluptatem iste autem minima tempore ea ullam accusantium minus cupiditate veritatis maxime explicabo quia est rerum id enim accusantium earum nisi tempora enim qui doloremque cum qui corrupti est ad sunt qui occaecati aut et iusto perspiciatis perferendis repudiandae nostrum et temporibus illum nulla et voluptatem assumenda illo maxime et aliquam voluptatem facilis laboriosam omnis aliquid ducimus ea maiores perspiciatis vero quos dicta est hic voluptas delectus dolorem architecto voluptatum est reiciendis exercitationem explicabo odio enim placeat ex unde aut qui nostrum occaecati tenetur.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '28', null, '0', '1', '2017-05-16', '2017-05-14 04:17:00', '2017-05-14 04:17:00');
INSERT INTO `lesson` VALUES ('13', '28', 'Nisi quo commodi nulla eius dolorem et.', 'Aut ut et ut nostrum quae dolores soluta voluptas voluptate natus porro ab sit veritatis harum dolores eveniet omnis saepe et quidem amet numquam aspernatur dolor ut saepe aperiam corrupti veniam labore sed voluptatem nostrum laborum quibusdam quia doloribus non id ut et sunt quibusdam unde qui rerum et libero vel modi quas nemo nostrum placeat praesentium aut quae quidem voluptatem amet vel ad rerum nihil perspiciatis ab inventore velit eligendi nihil sed minus tenetur fugit pariatur magnam inventore officia officia illo voluptatum non aut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '42', null, '0', '1', '2017-05-14', '2017-05-14 04:17:00', '2017-05-14 04:17:00');
INSERT INTO `lesson` VALUES ('14', '3', 'Voluptas ut nesciunt et magnam dolor quis soluta accusamus.', 'Incidunt perspiciatis molestiae possimus sit reiciendis ut et iusto porro facilis nostrum esse fugiat architecto veniam modi labore natus omnis unde quidem quaerat sint quidem quos expedita temporibus error nulla molestias soluta laborum similique ipsum occaecati laborum nostrum neque suscipit est quaerat quia quisquam minus temporibus perferendis unde recusandae est laboriosam sed sit sunt molestiae soluta et et libero aspernatur voluptatem non voluptatibus eaque quasi quia aliquam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '28', null, '0', '1', '2017-05-16', '2017-05-14 04:17:00', '2017-05-14 04:17:00');
INSERT INTO `lesson` VALUES ('15', '1', 'Repellendus cum facere et debitis facere recusandae ea qui velit et.', 'Nulla ut ex ipsum aut quos qui autem et tenetur modi eaque molestiae suscipit aperiam autem delectus at harum quaerat atque ut odit dolorem ut rerum veniam ullam quas et voluptatem recusandae et laudantium quaerat quod ex vel accusantium assumenda alias et quis facere rem amet earum nobis corporis doloremque eos libero voluptatem provident delectus odit fugit excepturi aut aut incidunt sunt optio molestiae assumenda iure sed ut blanditiis doloribus saepe ex harum velit neque.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-19', '2017-05-14 04:17:00', '2017-05-14 04:17:00');
INSERT INTO `lesson` VALUES ('16', '13', 'Quia similique sint qui voluptatem earum earum.', 'Facilis non doloremque a sed modi eum corporis aliquam explicabo excepturi ratione omnis voluptatem delectus esse voluptatem distinctio eum nisi id et doloribus velit error beatae ut sequi voluptate doloremque libero quam esse reiciendis repudiandae voluptatem ex et velit deleniti quaerat quo sunt odit doloribus impedit ut eos dolorem aut natus qui modi exercitationem et dolorum est et voluptate culpa beatae error hic omnis qui quam autem ea consequatur fuga aut voluptates corporis iusto in minima distinctio assumenda et molestias consequatur deleniti amet rerum quaerat qui est voluptas nihil sint nobis dolorum molestias necessitatibus harum harum architecto qui aut odit quidem quis sit ipsum officia veritatis maxime.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '42', null, '0', '1', '2017-05-19', '2017-05-14 04:17:00', '2017-05-14 04:17:00');
INSERT INTO `lesson` VALUES ('17', '19', 'Ipsam consequatur non veniam minus provident mollitia sunt consectetur nobis.', 'Magnam sint impedit blanditiis in dolore sapiente adipisci vitae voluptatem eos rem harum quidem dolore animi tenetur itaque voluptate nostrum autem aut laudantium perspiciatis voluptatem reprehenderit iste voluptas nesciunt fugit sunt dolore nemo voluptatibus deserunt quia pariatur aut vero vel non veniam ad itaque magnam et aut voluptatum alias maxime itaque aspernatur assumenda est nostrum molestiae impedit dolorum quasi et commodi quia voluptates nemo labore aut nesciunt modi eligendi in dolorem quae aut doloremque in consequatur est voluptatum laboriosam sed rerum quasi nihil aperiam assumenda id minima tempore doloremque cum dolorem consectetur ratione exercitationem est ipsum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-14', '2017-05-14 04:17:00', '2017-05-14 04:17:00');
INSERT INTO `lesson` VALUES ('18', '19', 'Sunt et minima nihil quas quia qui quae quam alias quia.', 'Delectus quo repudiandae eum consectetur enim ut fugiat rerum qui est impedit qui laudantium aspernatur expedita fuga dolorem laudantium ex quos aut facere quis accusantium rerum enim ratione distinctio autem doloremque magni aperiam ad adipisci hic voluptates voluptatem explicabo eos nihil ut molestias commodi animi quisquam quia dolorum unde mollitia ut ut hic aut vel consequatur voluptate ut est vitae voluptate autem quo accusantium provident illum neque fuga quo consectetur id ipsa perferendis labore earum porro nam perspiciatis sit ut autem voluptatum porro consequatur facilis nisi ut facere ratione sapiente omnis veniam soluta fugiat recusandae odio qui dolorum non et deleniti ipsa qui dolor.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '45', null, '0', '1', '2017-05-14', '2017-05-14 04:17:00', '2017-05-14 04:17:00');
INSERT INTO `lesson` VALUES ('19', '30', 'Itaque illum fuga ad laboriosam nihil quibusdam adipisci asperiores.', 'Labore placeat rerum praesentium fuga quis necessitatibus numquam provident iure aut nisi est quas unde velit rerum velit in blanditiis ab dolor ipsam dolores aliquid beatae voluptate commodi repellat nihil voluptas et voluptatem itaque id iure quos ratione consequatur possimus fugit ea reprehenderit et id aut quia autem nihil facilis maiores eos consequatur accusamus nemo ut non ea hic et hic optio asperiores provident qui culpa nam sapiente repellendus ipsam voluptatem eligendi placeat quidem exercitationem impedit adipisci sapiente neque autem dolor excepturi laboriosam atque modi similique perspiciatis doloribus laboriosam aut tenetur reprehenderit eum dolorum ab qui nisi laudantium culpa magnam veniam molestiae et quia vitae in non at omnis quod eum quis nobis temporibus iure et laboriosam ut voluptatum perferendis sit nihil assumenda fugiat autem quo sint et cum ut eligendi quia nobis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-15', '2017-05-14 04:17:00', '2017-05-14 04:17:00');
INSERT INTO `lesson` VALUES ('20', '12', 'Dignissimos esse laudantium quo officiis perferendis at similique distinctio.', 'Autem accusamus quos quas vel est nam non est quos tempora ea officiis et aliquid voluptatibus eveniet velit modi in labore unde omnis pariatur ut consequatur nihil soluta praesentium rerum quia repellat commodi magnam dolorem ab in deserunt velit optio quasi molestias assumenda reiciendis qui eveniet dolorem qui ut assumenda in vitae unde voluptas quas dolor quos ab voluptas mollitia nemo quibusdam aspernatur exercitationem sequi aut a est odit fuga explicabo enim et quia qui non est nesciunt minima et est alias eligendi aliquid a sunt nemo sed rerum praesentium nam expedita nesciunt minima et et omnis distinctio officia porro tempora occaecati repudiandae aut deserunt rerum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-19', '2017-05-14 04:17:00', '2017-05-14 04:17:00');
INSERT INTO `lesson` VALUES ('21', '4', 'Dolores dolorem rerum qui neque ad quam.', 'Voluptatem veniam facere sit ut quos expedita cum voluptatum et illum ab voluptas temporibus ut iure qui consequatur commodi vel ipsam aut vel sunt dolore autem aperiam odio esse deserunt voluptatum incidunt temporibus tenetur quibusdam ut nihil sed sed sint quis officiis aut commodi deleniti voluptates nesciunt voluptas consequatur aperiam esse consequatur ab quam officiis sit incidunt quod magni maiores maxime aut magnam ipsum possimus ut et nisi voluptas reiciendis doloremque possimus harum omnis rem architecto ullam voluptas itaque ut non asperiores odio quia ut expedita possimus maxime quis esse aut officia id iure recusandae.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-16', '2017-05-14 04:17:00', '2017-05-14 04:17:00');
INSERT INTO `lesson` VALUES ('22', '7', 'Ducimus laborum rerum perspiciatis corrupti quas eos blanditiis non.', 'Ut porro quod sit sunt corrupti animi repellendus distinctio quidem eos sed eius aspernatur quas at doloremque quo sunt eveniet provident repellendus molestias aut sint quisquam consequatur reiciendis repudiandae architecto rerum nisi in dolorem culpa quo accusamus fugit qui sed dolorum itaque consectetur possimus esse cupiditate cumque velit aliquam molestiae sunt iste dolor nihil ratione totam quasi aperiam in consequuntur earum explicabo quas quas perspiciatis quasi vitae eum voluptate et facere voluptas ut eius illum nam ab facilis omnis officiis dolor dolorem cumque non quo velit consequatur et quae corporis tempora illum aut et tempora ullam laudantium doloribus alias repudiandae quasi voluptatum asperiores ad in qui optio explicabo sit vitae odit sint sunt repellendus omnis totam impedit ullam accusamus fuga doloremque aut quis commodi est voluptatibus numquam dolor maiores excepturi aliquam culpa quae ex nihil laboriosam cumque nemo et quasi officiis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-19', '2017-05-14 04:17:00', '2017-05-14 04:17:00');
INSERT INTO `lesson` VALUES ('23', '17', 'Quia perferendis cumque sint asperiores recusandae quia.', 'Consequatur voluptate neque officia id enim et aliquid occaecati accusamus reprehenderit quia tenetur laudantium quas mollitia voluptates quam modi quam hic rerum repellat temporibus voluptatem sunt est excepturi odit excepturi repellendus omnis sapiente natus accusamus perspiciatis ut quisquam explicabo unde quia maiores facere enim sequi harum tempore fugiat blanditiis perferendis aut non ullam quibusdam omnis mollitia iusto aut voluptatem qui pariatur dicta iste officiis illo labore hic at sunt commodi maiores et aut accusamus porro harum odio ipsam et molestiae reiciendis temporibus aut necessitatibus harum dolor dignissimos voluptatem eaque sit culpa eos delectus consequatur.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '45', null, '0', '1', '2017-05-19', '2017-05-14 04:17:00', '2017-05-14 04:17:00');
INSERT INTO `lesson` VALUES ('24', '26', 'Et officiis est sed accusamus veniam autem quis est.', 'Doloribus aperiam voluptatibus omnis eaque excepturi distinctio facere quibusdam et labore commodi iste sint ipsam debitis molestiae magni praesentium ipsam officiis et et cupiditate vero et vel quo numquam rerum excepturi perspiciatis ipsa qui eaque ut dolore harum explicabo nisi dolorem nobis doloribus ad odio dicta nihil sint repudiandae eligendi iure quis et minus adipisci officia voluptatem quis ab perspiciatis cum in quo quia voluptatem dignissimos explicabo omnis vitae rerum rem qui officia fuga quia inventore voluptatibus vitae et vel deleniti soluta suscipit veritatis delectus qui recusandae cupiditate voluptatem quo laborum quam dolor excepturi saepe impedit eveniet temporibus omnis magnam est ratione laborum aut modi necessitatibus iste rem ducimus et voluptatum at dolorem mollitia aut assumenda natus et odio omnis expedita sit sed est ullam assumenda excepturi eaque vel.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '45', null, '0', '1', '2017-05-15', '2017-05-14 04:17:00', '2017-05-14 04:17:00');
INSERT INTO `lesson` VALUES ('25', '21', 'Eos distinctio sed eligendi rem sit quaerat dolorem saepe.', 'Ut aliquid quia sit esse voluptatem soluta dolores voluptatibus porro in explicabo saepe quibusdam quis optio est quam iure voluptas ad adipisci qui suscipit sunt quis dolorem quos odio laudantium alias dolorem eos sit non occaecati dolorem non est sed deserunt molestias voluptatem quidem illo reprehenderit totam est atque ipsam accusantium iure vel ipsum cumque quaerat autem quos quam reiciendis quae esse qui non non corporis perferendis qui est et veritatis et quo.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '30', null, '0', '1', '2017-05-17', '2017-05-14 04:17:00', '2017-05-14 04:17:00');
INSERT INTO `lesson` VALUES ('26', '12', 'Voluptas non cumque numquam dolorem voluptatum.', 'Aut inventore dolor porro non labore facilis quisquam aspernatur expedita numquam expedita sapiente mollitia eos delectus quod quidem est iusto facilis nobis quia ab qui omnis assumenda inventore sunt delectus ullam recusandae ad consequuntur iusto ea qui est dolorem molestiae qui totam occaecati eveniet sapiente sint et et repellat ut molestiae debitis ut debitis eius iusto id officiis tempore voluptatem vel illo fugiat nostrum ut maxime dolorem eveniet fuga eius et at ipsa dicta qui rerum molestiae similique minus dolores ea voluptatem odit soluta eos voluptates ut recusandae animi ad veniam voluptate nihil quis pariatur aliquam dolores incidunt eius sint dolores atque ut perspiciatis nulla fuga autem ullam minima error rerum soluta nobis nulla rerum placeat omnis nobis minima omnis consequatur officiis possimus autem eius sint consequatur impedit earum quia sunt voluptatem qui omnis consequatur aut tempora adipisci quaerat neque consequatur.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '42', null, '0', '1', '2017-05-15', '2017-05-14 04:17:00', '2017-05-14 04:17:00');
INSERT INTO `lesson` VALUES ('27', '16', 'Impedit quod enim qui possimus dolorum aut et illo.', 'Magnam sed autem et sunt asperiores id in a error placeat quidem et quo nisi velit deleniti est est iusto autem nesciunt et blanditiis non vitae dolor earum quam quis perferendis qui maiores numquam quia enim accusantium vitae enim nihil pariatur perferendis ut enim quo praesentium nam quia vitae quia ipsum similique culpa voluptas ut ab vel consequatur quas vero numquam debitis reiciendis quo nobis officiis ducimus quia ex hic perferendis accusamus a id et quis quia et et sunt aperiam libero sit dolores nisi numquam atque impedit eligendi dignissimos sapiente magnam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-18', '2017-05-14 04:17:00', '2017-05-14 04:17:00');
INSERT INTO `lesson` VALUES ('28', '30', 'Optio recusandae aperiam et qui dolores laboriosam quas.', 'Ipsum eligendi omnis quia qui ut esse dolore qui tempora dolorum ipsam neque deleniti in unde nam minima excepturi accusamus nesciunt consectetur provident sed ea ut rerum eum quaerat sapiente eaque ut consectetur earum minus quia ipsum qui non velit explicabo pariatur culpa molestias velit eos eaque eum maxime a accusantium aut error consequatur ut illo facilis consequatur vitae voluptas voluptate corrupti hic aspernatur dolor provident et reiciendis optio sint velit velit rerum voluptatum architecto dolorum hic eum aut repudiandae odit voluptas enim suscipit rerum molestias repudiandae aut quia iste autem deleniti nostrum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-15', '2017-05-14 04:17:00', '2017-05-14 04:17:00');
INSERT INTO `lesson` VALUES ('29', '8', 'Quod corrupti neque nemo corrupti id voluptas harum.', 'Velit molestias laborum sed molestiae temporibus voluptas et dicta aut autem eligendi sed aliquam quidem at mollitia nihil odio ipsum doloribus cupiditate quisquam et et quaerat ut ea qui aspernatur facere enim nulla nostrum eaque fugiat nam doloremque autem porro aliquam doloribus nisi illo laboriosam ut consequatur qui qui animi ex et ut explicabo dolorem vel odit ipsum et adipisci ut qui fugit quam nulla voluptatum autem officia qui quaerat fuga omnis odit occaecati esse impedit doloribus voluptatum et temporibus facere eligendi ex repellat laudantium est impedit et ut natus natus cumque dolorum nesciunt qui adipisci beatae repellat eum nisi alias ex in at qui doloremque ea numquam eaque atque reprehenderit ea dolores et non illo rerum sit sunt consequuntur molestiae in non nobis non ut dolorum voluptatem ipsam iste et esse commodi aut qui repudiandae aut qui aliquid.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-15', '2017-05-14 04:17:00', '2017-05-14 04:17:00');
INSERT INTO `lesson` VALUES ('30', '19', 'Voluptatem sint autem quia ut magni consequatur voluptatibus repellendus et.', 'Ut ea reiciendis voluptatibus totam velit sunt ut sunt voluptas corporis minus aut sit maxime esse similique qui quos autem recusandae delectus quae impedit maiores esse magni assumenda nisi odit omnis temporibus voluptatibus officia dignissimos laudantium eveniet harum voluptatem expedita reiciendis numquam dolores molestias consectetur reiciendis ipsa amet natus autem id iure ab accusantium ut eum voluptatem facilis ut laboriosam aut reprehenderit dolores doloribus est sit commodi libero qui non iste modi a error ullam sit consectetur molestias non quia non nulla sed dolor similique est quis qui facere debitis labore vel cupiditate ducimus eum laborum natus unde et aut reiciendis nemo sapiente quis accusamus ullam qui quidem iste reiciendis nihil rerum iste voluptatem aspernatur incidunt nesciunt sunt ducimus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-16', '2017-05-14 04:17:00', '2017-05-14 04:17:00');
INSERT INTO `lesson` VALUES ('31', '11', 'Consequuntur alias tempore dolorem ratione molestiae ipsa ex.', 'Quas ut voluptatum delectus perspiciatis qui cupiditate dolorem aspernatur harum eaque et quia quia et corrupti non et voluptates et est eveniet quidem occaecati ab laudantium unde facilis voluptas quia delectus aut debitis deserunt et expedita repellat aperiam consequatur officia voluptas non voluptatem sit tempora esse repellendus soluta est dolores velit aut quia accusamus rerum est aut consequatur saepe blanditiis soluta et facere minus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-14', '2017-05-14 04:17:01', '2017-05-14 04:17:01');
INSERT INTO `lesson` VALUES ('32', '14', 'Accusamus quibusdam iusto culpa voluptatem voluptas.', 'Vero quia placeat rerum animi qui et facilis hic placeat est corporis ab labore quibusdam voluptatibus quae saepe placeat voluptatibus aspernatur quisquam ullam blanditiis sed quis possimus sint molestiae occaecati ratione nam accusamus suscipit alias itaque sit et similique pariatur fuga eos dolor illum doloribus ut voluptates maxime a ut consequatur deleniti at consequuntur tempore cumque aliquid voluptate harum ullam facere ipsum qui est sapiente excepturi quae eos deleniti sed quia fugiat quis quod culpa illo voluptates eum illo corporis sint eos.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-19', '2017-05-14 04:17:01', '2017-05-14 04:17:01');
INSERT INTO `lesson` VALUES ('33', '16', 'Est illo molestiae qui fuga nihil consequatur nesciunt nemo est et.', 'Nobis nihil quisquam quia unde sint similique debitis consequatur eos aspernatur ex nihil enim fuga adipisci esse reprehenderit incidunt dolor omnis minima natus dolores fugit ut pariatur in necessitatibus dolorem cumque doloribus accusantium blanditiis debitis libero et provident sapiente expedita neque qui maxime vel sit similique nulla eum pariatur rerum et ullam dolore optio itaque eaque et maiores omnis ad omnis cum sed tempore laudantium adipisci commodi et quo reiciendis voluptas error aspernatur doloribus et ut sit autem et laborum nihil earum non minus ut placeat voluptate voluptas sed et dolorem blanditiis est ad similique omnis vel et quia et nesciunt veritatis molestiae aut mollitia ratione autem distinctio laudantium qui neque consequatur quidem tenetur laboriosam mollitia qui cupiditate laboriosam necessitatibus consequatur vitae ut doloremque dolores accusamus consequatur quas sit ut id blanditiis neque voluptate autem similique suscipit nobis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '20', null, '0', '1', '2017-05-18', '2017-05-14 04:17:01', '2017-05-14 04:17:01');
INSERT INTO `lesson` VALUES ('34', '30', 'Iste in optio deleniti amet ab exercitationem eius iusto.', 'Provident voluptates incidunt aut quia saepe rem qui ratione incidunt velit voluptates sed sit temporibus voluptates ipsa nihil veniam error laborum eos saepe eligendi ullam dolores et alias laboriosam ut earum modi dolorem nesciunt sunt doloremque minus dolore est modi enim qui consectetur corporis similique qui quis beatae iure recusandae labore dolor maiores ratione distinctio voluptas vero vero quod nobis voluptatibus a a voluptates explicabo consequatur ut deleniti error sed explicabo dolore eligendi in aliquid ex recusandae accusantium rerum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '27', null, '0', '1', '2017-05-16', '2017-05-14 04:17:01', '2017-05-14 04:17:01');
INSERT INTO `lesson` VALUES ('35', '29', 'Explicabo architecto sequi autem similique aliquid laudantium inventore facere aut doloribus.', 'Doloremque alias maxime cum asperiores vel molestias illo beatae explicabo alias totam sint et corporis vel sint veritatis vitae harum cum saepe eum sit odio similique nemo dolor omnis modi et voluptatibus commodi qui quaerat id aut assumenda ipsa repudiandae iure tempora optio maxime sint voluptatum delectus labore consequatur et totam consequatur cupiditate qui vitae quas rem odio non vero est doloremque praesentium labore iure aperiam libero quam aut omnis earum cupiditate totam ipsum error adipisci facere et voluptas sit similique ea reprehenderit molestias dolores iusto autem praesentium et nostrum animi placeat hic laborum eos enim ducimus quibusdam et laborum dolor aut ullam vel consequatur illum illum quo ut accusantium aut dolorem molestiae aut esse corporis aut nostrum porro qui mollitia earum totam mollitia officiis explicabo delectus nesciunt et dolor dolores.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-14', '2017-05-14 04:17:01', '2017-05-14 04:17:01');
INSERT INTO `lesson` VALUES ('36', '15', 'Rerum cumque eligendi porro facilis sed.', 'Est illo quidem voluptas quia voluptas ullam deleniti quidem nostrum accusantium dicta perferendis enim nam quo dicta et natus porro odit illo aliquid eos voluptatem perspiciatis modi explicabo nam non et facere sunt non unde eaque placeat assumenda consequatur commodi minus cupiditate cumque commodi aut inventore voluptate perspiciatis enim qui facere quisquam natus omnis iste est aperiam rem aut sint ab maxime quibusdam fugiat commodi maxime voluptatem tempora voluptas non asperiores eaque dolores provident distinctio corrupti sequi et rerum earum voluptas magnam et perspiciatis porro aut odio fugiat ea optio ea quia repellendus odit et sed est sint quasi eum mollitia reiciendis qui corporis vel voluptatem aut voluptas placeat quia quis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-14', '2017-05-14 04:17:01', '2017-05-14 04:17:01');
INSERT INTO `lesson` VALUES ('37', '13', 'Placeat animi sit nulla omnis.', 'Occaecati est qui cumque nemo dicta explicabo hic enim voluptas impedit consequatur sit repellendus rerum consequatur delectus ut ullam excepturi necessitatibus corrupti eum debitis quidem incidunt sed accusantium sit iusto nesciunt adipisci minima perspiciatis reprehenderit distinctio minima rem asperiores aliquid inventore reiciendis vitae reiciendis sit sunt sed repellendus velit consequuntur provident consequuntur fugit est quas excepturi dolores recusandae minus optio soluta consequatur atque animi qui voluptas quas et sapiente velit est et maiores vel facilis qui architecto unde et aliquid et earum et tempore porro reprehenderit veniam ut explicabo exercitationem nihil iure odit ipsa exercitationem animi qui facilis dolor rerum ex cum alias veniam possimus fuga iure dolores sint dolores officia occaecati quo eius aperiam et aut recusandae enim.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '24', null, '0', '1', '2017-05-18', '2017-05-14 04:17:01', '2017-05-14 04:17:01');
INSERT INTO `lesson` VALUES ('38', '27', 'Ut necessitatibus ex sequi corporis voluptatum quia qui magni omnis dolore.', 'Cum facilis atque velit dignissimos distinctio quo minima animi impedit optio rerum itaque saepe sit aut minima iusto qui soluta error unde voluptatem molestias laborum id at mollitia nobis eius sit ullam enim consequuntur et voluptates aliquid odit accusantium dolorem et nostrum hic sunt accusamus aliquid debitis quia iure voluptatum sunt quas et veritatis in deleniti omnis voluptas autem aspernatur dolore nemo eos voluptate totam rerum et quia quia velit totam at sit cumque ipsam cumque nihil quia quidem nemo nulla a ad est similique et et soluta iste id nihil eius quo delectus consectetur enim ullam aspernatur quidem officiis cumque et est qui quis voluptatem reprehenderit facere error harum sunt et cum cupiditate quis perferendis maiores tempore corrupti et sunt sit et praesentium non delectus accusantium.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '27', null, '0', '1', '2017-05-17', '2017-05-14 04:17:01', '2017-05-14 04:17:01');
INSERT INTO `lesson` VALUES ('39', '20', 'Exercitationem quaerat et soluta laboriosam at optio ut.', 'Dignissimos suscipit error et repellendus natus quis quasi asperiores nostrum et sequi eos sunt cum accusamus quidem aut minima laudantium corrupti est provident unde dolor inventore odio rem tempora fuga inventore nam eos quibusdam quia sint sed nemo et animi saepe necessitatibus adipisci ea officia sed aut adipisci nulla assumenda voluptates fugit ut ut sunt in est perferendis sunt minus laboriosam in est cupiditate vel officiis sequi expedita ullam voluptas cumque necessitatibus quia nisi eligendi modi consequuntur veritatis ab est aliquid delectus placeat dolore est ex sint exercitationem nisi animi sequi distinctio mollitia perferendis consequatur repellendus facilis exercitationem adipisci rerum ut exercitationem ut ipsum eius sint cum non et rerum ad quas vel ut accusantium vel non cumque dicta autem et repellendus neque veritatis suscipit vero maxime reiciendis quibusdam libero eveniet atque ut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-15', '2017-05-14 04:17:01', '2017-05-14 04:17:01');
INSERT INTO `lesson` VALUES ('40', '5', 'Distinctio quas eligendi molestiae aut quidem occaecati error eos omnis.', 'Mollitia dolor enim consequuntur rerum eos iusto quisquam aliquam voluptatem magnam animi laudantium ipsum rerum nemo totam necessitatibus numquam omnis dolorum autem eum perspiciatis blanditiis explicabo sed est deleniti iste reiciendis in temporibus esse dolor dolorem atque dolorem minus nostrum suscipit nemo aut quo esse repellendus quo qui repellendus facere voluptatibus soluta itaque quam enim sunt officia perspiciatis in et qui libero.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '24', null, '0', '1', '2017-05-18', '2017-05-14 04:17:01', '2017-05-14 04:17:01');
INSERT INTO `lesson` VALUES ('41', '11', 'Perspiciatis incidunt ut quidem sit repellendus quaerat facere eaque non.', 'Et impedit mollitia voluptas omnis est omnis quisquam velit facere reprehenderit in ullam nam et velit ut dolorem similique non ut est voluptatem perspiciatis illum commodi numquam deserunt voluptatibus quis non dolorem ad cumque iusto vel autem modi eligendi facere doloribus quia provident eos ipsum autem et rerum dolorum sequi nulla laboriosam earum eius quia excepturi autem repudiandae corporis ut dolores consequuntur adipisci voluptatem sequi quia ut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-15', '2017-05-14 04:17:01', '2017-05-14 04:17:01');
INSERT INTO `lesson` VALUES ('42', '5', 'Quo nisi inventore minus quos tenetur totam odio velit omnis.', 'Officia doloribus molestiae dolor ea id voluptatem quaerat optio magnam natus excepturi sequi dolorem commodi sit voluptatibus et aut porro id nihil et ut facere aut dolor qui quam hic corrupti architecto aut omnis beatae aut corrupti mollitia quia dolores quaerat et eos eos cupiditate unde facere deserunt nesciunt sit sed facere aliquid perferendis itaque aut ad non voluptatibus blanditiis esse nemo libero temporibus in perspiciatis illum tenetur beatae exercitationem sit impedit ipsum pariatur sed ex enim fuga ipsa consequatur voluptatum dolor sit omnis dignissimos omnis velit eum quia quibusdam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-16', '2017-05-14 04:17:01', '2017-05-14 04:17:01');
INSERT INTO `lesson` VALUES ('43', '10', 'Aut quibusdam sapiente itaque quibusdam perspiciatis.', 'Illum in ratione sed et asperiores laudantium eos doloribus eos voluptatibus ab provident dolor dolorem at fugiat quia omnis eligendi dolor consequuntur adipisci eum eius id est architecto fugiat totam possimus ratione numquam suscipit incidunt tempora animi qui dolorem et atque sed temporibus reprehenderit necessitatibus blanditiis officia ea natus veritatis perferendis autem magni modi eos similique enim illo porro exercitationem quos ea et quia aut deleniti et sit soluta consequuntur voluptates dolorem quasi sit ullam id illum nobis consectetur perspiciatis quo ut voluptatibus fugit et quae est ea delectus quia excepturi hic eum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '39', null, '0', '1', '2017-05-14', '2017-05-14 04:17:01', '2017-05-14 04:17:01');
INSERT INTO `lesson` VALUES ('44', '23', 'Exercitationem deserunt nisi voluptates adipisci aspernatur dolore dolorem.', 'A voluptatum accusamus voluptas eveniet reiciendis nostrum laborum dolores aspernatur porro perferendis illo minima et nisi dolorem sint et corrupti doloremque suscipit quas aut sit eius tempora ea praesentium accusantium eius praesentium sed fugit odit maxime perferendis officia consequatur voluptatem esse ex est deleniti illo voluptatibus quia sint eius quod fuga nobis ea autem facilis labore aut soluta eligendi voluptas pariatur hic rerum aut asperiores sequi voluptatem quisquam optio voluptatem deserunt perferendis dignissimos consequatur eligendi natus id consequatur laudantium quisquam quia quis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-19', '2017-05-14 04:17:01', '2017-05-14 04:17:01');
INSERT INTO `lesson` VALUES ('45', '19', 'Pariatur qui est minus occaecati qui laborum velit dolorum veniam nobis.', 'Maxime dolores numquam consequuntur molestiae aperiam soluta in praesentium distinctio maxime nesciunt sint voluptatem alias nihil mollitia sed id sed quia eligendi et natus et quibusdam magnam reiciendis eos aut dolorem dolor earum expedita laboriosam magni ut odio recusandae voluptatem temporibus in id fuga atque voluptas vitae nulla qui est ipsam tempore et enim minus exercitationem tenetur id doloremque vel atque velit deleniti nesciunt voluptatum consectetur sed doloribus rem similique totam facilis qui eum numquam blanditiis ullam ipsam quod libero eius quam repellendus ut vel nihil dolor quaerat officia omnis ipsa eaque excepturi ipsa voluptatibus officiis totam facere temporibus repudiandae qui ut fugit consequatur doloribus voluptas eos unde hic sapiente et dicta rerum dolores deleniti et ut ad temporibus dolorem temporibus optio.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '36', null, '0', '1', '2017-05-19', '2017-05-14 04:17:01', '2017-05-14 04:17:01');
INSERT INTO `lesson` VALUES ('46', '9', 'Illum expedita odit in explicabo aperiam voluptatum quia iste nesciunt aut.', 'Placeat aut accusantium quis minus ut necessitatibus placeat quo dolorum a sunt delectus officia aut harum incidunt laudantium blanditiis quam similique accusantium dolores numquam autem officiis velit impedit voluptatem voluptas officia quam est at atque est sit distinctio exercitationem excepturi minima ipsa magnam ut similique vitae voluptatem dolorem iste sed quos odio in omnis quaerat quasi asperiores nulla est vel est esse sunt fuga voluptatem ut placeat nihil animi ratione esse consequatur perferendis architecto consequuntur aut consectetur cupiditate ipsam et eos quia qui illo eum consequatur eaque eveniet nemo tempore quam harum sapiente libero quibusdam aut tempora ea harum saepe repellat iure quibusdam laudantium provident ducimus ipsa ipsa iste est consequatur explicabo illum sunt minus debitis sed iste aperiam rerum saepe temporibus nesciunt explicabo architecto iusto quidem ea ut minus nulla voluptas distinctio aut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-19', '2017-05-14 04:17:01', '2017-05-14 04:17:01');
INSERT INTO `lesson` VALUES ('47', '8', 'Odit molestiae nihil voluptatum officia ad.', 'Aspernatur et fugiat impedit non impedit nobis qui eos laboriosam voluptatem sed quisquam recusandae quas voluptas asperiores velit et dolorum quia optio ut voluptas assumenda maxime beatae natus ducimus corrupti ut voluptatem ad dolor cupiditate praesentium eos omnis magni libero est delectus omnis nulla dolor sint qui deleniti repudiandae fugit voluptatibus consequuntur eum dicta sint fugiat id explicabo saepe doloremque optio assumenda quis autem delectus veniam pariatur aut quibusdam dolor debitis quibusdam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-19', '2017-05-14 04:17:01', '2017-05-14 04:17:01');
INSERT INTO `lesson` VALUES ('48', '22', 'Et enim sunt eveniet et aspernatur facere voluptatibus nihil.', 'Quibusdam officiis accusamus corrupti at consequatur occaecati harum totam nihil qui dignissimos adipisci dolorum similique maxime quae ut dolores voluptatem voluptatibus labore debitis vitae repudiandae voluptas reiciendis nemo temporibus omnis expedita eum laborum et vel at harum illum eaque corporis atque illum perspiciatis fugit occaecati dicta quis asperiores assumenda similique aliquam assumenda quo dolorem sint asperiores dolorem et dolore iusto necessitatibus omnis ut quia labore eius aspernatur iste beatae quaerat veritatis ea soluta quia facilis nesciunt consectetur id quasi a et ut et reiciendis dolorum modi voluptatem quam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-19', '2017-05-14 04:17:01', '2017-05-14 04:17:01');
INSERT INTO `lesson` VALUES ('49', '8', 'Nemo et facere et consectetur itaque et perspiciatis.', 'Optio ipsum sunt numquam dolorum maiores et quae consequatur sint fugit sit rerum dolores temporibus ea nihil iusto dolorem nam laudantium deleniti dolores omnis temporibus facere dolorem distinctio facilis error reprehenderit molestias est nesciunt qui suscipit suscipit aspernatur beatae ut perspiciatis maiores et dolorum est eos consectetur et qui illo ea dicta sapiente ullam rerum non ad est nihil molestias assumenda iste eum ea veniam repellendus molestiae nihil nam laborum sit ut soluta illo rerum architecto debitis hic quisquam asperiores dolores aperiam nihil ullam minus omnis eum dolore doloribus ut repellendus accusamus similique qui saepe sed dicta deserunt et doloremque labore sit ullam provident rerum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-18', '2017-05-14 04:17:02', '2017-05-14 04:17:02');
INSERT INTO `lesson` VALUES ('50', '18', 'Commodi nihil incidunt repellendus non aut nam est voluptatum temporibus.', 'Consequuntur et nulla laboriosam et enim accusantium autem ad quia similique laborum sapiente blanditiis ut suscipit quod ipsa et dolores et aut qui quae velit quaerat cumque optio omnis nulla natus laborum enim qui eos possimus nemo nemo velit sed distinctio quos placeat voluptas ipsa veritatis dolorem cumque eveniet tenetur voluptatem ea occaecati rerum dignissimos sit architecto reiciendis et vel vel quia odio aut et alias qui voluptate non blanditiis officia rem est in non dignissimos sit eos.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-19', '2017-05-14 04:17:02', '2017-05-14 04:17:02');
INSERT INTO `lesson` VALUES ('51', '4', 'Ipsum dignissimos hic consequatur tenetur.', 'Maiores expedita officiis eum quia dolorum labore et ut perferendis tempora vero eos eum vero vel voluptatibus qui aut velit iure tenetur voluptas et saepe sint itaque placeat consequatur at reprehenderit sit placeat ut debitis quibusdam at rerum voluptatem impedit ex quia quia et quos nihil occaecati nemo corrupti iure voluptas qui iusto suscipit vero optio molestias qui ab fuga neque assumenda itaque fugiat aspernatur et aliquid rem error nobis dignissimos neque perspiciatis illo est nihil velit quae aut reiciendis rerum ut assumenda repellat corrupti commodi dolores tempore doloribus libero eligendi sint sed rem molestiae eos ab quia dolor blanditiis quisquam est ex fugit ipsa consequuntur velit atque vitae illo nostrum voluptatem vel quisquam voluptatibus molestiae ut ut consequatur nesciunt minus atque officia et velit velit molestiae error quo quia.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '30', null, '0', '1', '2017-05-15', '2017-05-14 04:17:02', '2017-05-14 04:17:02');
INSERT INTO `lesson` VALUES ('52', '13', 'Ut commodi mollitia atque quidem incidunt recusandae.', 'Unde expedita reprehenderit et ex dolorem voluptas dolorem molestias qui est non natus molestias libero temporibus architecto et vero omnis ab voluptatem ex molestiae odit hic quis et molestiae incidunt qui distinctio et dolores voluptatem alias aspernatur repudiandae totam soluta similique blanditiis quasi necessitatibus ut ad et magnam molestias magni iure quam quidem asperiores omnis doloribus et numquam aut aut consequatur voluptatem eligendi ullam doloremque sed deleniti culpa facere soluta facere qui et odit impedit omnis sint optio excepturi illo consectetur enim in sunt sed doloremque repudiandae necessitatibus exercitationem non voluptatem voluptas debitis deserunt pariatur tempore vero sed nesciunt minima voluptatibus sit maiores recusandae alias culpa commodi ut et commodi dicta soluta et iusto id eum omnis amet eius ex sequi velit dolor nostrum architecto sed et quod qui nihil libero.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-14', '2017-05-14 04:17:02', '2017-05-14 04:17:02');
INSERT INTO `lesson` VALUES ('53', '9', 'Ullam cupiditate a provident ipsa commodi praesentium.', 'Et officiis repudiandae consequatur dolorem tempora voluptatum esse nulla qui maiores odit saepe consequuntur dolore aspernatur in voluptatem sunt possimus omnis laudantium dolore non debitis quia id laborum culpa dolorem et sint nobis minima non excepturi eius vel dolores natus accusamus cupiditate exercitationem corporis perspiciatis sequi officia ipsum qui ipsa veritatis quidem dolor facilis labore sed aut praesentium consequuntur nisi est facere et architecto mollitia ipsa assumenda rerum rerum ut non accusantium in dolorem aut rem et reiciendis facilis molestiae delectus rem doloremque nihil inventore rerum sapiente nihil dolorum laborum vel similique alias quisquam velit sed pariatur quae aut quasi ex illum quis vero a minus et nostrum cupiditate quia modi libero nulla praesentium commodi inventore fuga nisi aut delectus sed quam accusantium.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-17', '2017-05-14 04:17:02', '2017-05-14 04:17:02');
INSERT INTO `lesson` VALUES ('54', '4', 'Veritatis aliquid illo dolor delectus nobis molestiae consectetur inventore sequi minus.', 'Labore ullam optio nisi id dicta maxime dolorem temporibus aut ipsa accusamus in tenetur eveniet sit eveniet autem vel temporibus nihil eum aperiam deleniti fugiat nulla sint recusandae tenetur consequatur omnis ut illo omnis voluptas voluptatem non minus laboriosam quis accusamus iste laborum voluptas labore at dolores distinctio libero itaque explicabo nihil voluptates et fugiat minima autem aut ipsam qui aspernatur a sit eligendi accusamus facilis beatae molestiae molestiae odit est impedit ipsam et modi corrupti maxime voluptas magni quam adipisci itaque praesentium quae hic sit repellat tempore occaecati et occaecati voluptatum eveniet voluptatem doloribus quo ratione laboriosam asperiores voluptas.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-18', '2017-05-14 04:17:02', '2017-05-14 04:17:02');
INSERT INTO `lesson` VALUES ('55', '30', 'Quia et quibusdam et voluptatem quis est necessitatibus provident.', 'Placeat molestiae aliquam voluptas officiis consequatur neque aspernatur quaerat perspiciatis est sed eligendi libero non ut autem est qui et ut doloremque eligendi consequuntur voluptatibus at cum ut quas magni occaecati non earum qui laboriosam nesciunt minima qui tempore qui quo suscipit est libero et perspiciatis rerum amet eos quo dolores voluptas voluptatem sed voluptas quia odio autem dolorem eos architecto consequuntur ut enim ut temporibus atque quaerat illum quod inventore officiis vitae et et quibusdam repellat maiores qui incidunt quidem id incidunt tempore est mollitia soluta enim deleniti ut quae sint voluptatem hic ea natus reiciendis placeat facilis sint velit qui ullam iure omnis autem cumque consequatur atque sit fugit cum itaque cumque suscipit odio rerum libero adipisci et numquam nihil nobis laudantium quo nesciunt aut distinctio ut eos doloribus molestiae dignissimos consequatur.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '31', null, '0', '1', '2017-05-17', '2017-05-14 04:17:02', '2017-05-14 04:17:02');
INSERT INTO `lesson` VALUES ('56', '23', 'Eligendi esse praesentium voluptatem qui sequi ut ipsum consequatur ut.', 'Molestiae quibusdam reprehenderit et maiores qui modi consequatur magnam omnis aut non quo aut sed veniam aliquam error vel et qui delectus ut molestiae consequatur cumque tempore modi doloremque optio illo dicta hic est ipsum repudiandae quia est omnis omnis consequatur harum natus odio omnis pariatur placeat dolor rerum maiores ducimus velit sint nemo eveniet sunt tenetur sunt a porro laborum sit sunt est ad tempora asperiores dolores odio labore non molestias dolorem non impedit nesciunt voluptas rerum ut qui et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '22', null, '0', '1', '2017-05-16', '2017-05-14 04:17:02', '2017-05-14 04:17:02');
INSERT INTO `lesson` VALUES ('57', '27', 'Doloremque voluptatem quia aperiam autem autem accusamus rerum laborum adipisci esse.', 'Cumque dolores quaerat id amet quidem delectus ad pariatur aperiam dolorem rerum eveniet voluptas nulla ea laudantium consequatur provident cupiditate molestias voluptatem qui mollitia sint ducimus est magnam quasi rem illum molestiae expedita similique consectetur quo dolores quis occaecati laboriosam et vel iure labore nihil repellendus ut ut quo qui explicabo maiores possimus impedit quo possimus officia recusandae inventore consectetur quis qui neque aspernatur accusamus cumque voluptatem sapiente dicta impedit rem eum et molestias quae est provident ut et delectus soluta consectetur magni aut iste commodi error omnis ea illum adipisci totam eum beatae in velit nam repellat enim iste laborum doloremque nisi velit ut temporibus cum atque eligendi consequatur quis tempora repellendus velit reprehenderit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '31', null, '0', '1', '2017-05-17', '2017-05-14 04:17:02', '2017-05-14 04:17:02');
INSERT INTO `lesson` VALUES ('58', '18', 'Eum quidem doloribus eos facilis et molestiae similique sit vel.', 'Voluptatibus magni quidem ipsum quaerat vero ducimus occaecati officia repellendus corporis error fuga dolore tempora numquam quasi rerum sed quo deserunt ullam qui possimus est architecto quod amet libero quisquam beatae numquam expedita vero modi neque aut culpa voluptatum autem distinctio soluta aut facere nihil expedita cum sint cum quia ut doloremque neque voluptas voluptatibus esse eius sed aut officia ut est omnis accusamus quo est unde minima voluptatem totam voluptatem earum facere quos quo sit aut blanditiis adipisci illo atque fuga maxime dolore veniam placeat minima deserunt id perferendis doloribus eum atque aspernatur saepe quidem quibusdam illum nulla ut aliquam necessitatibus voluptatum minima in distinctio earum qui libero est error velit ut quam enim et distinctio consequuntur et dolorem est adipisci autem et qui eum sit voluptas adipisci explicabo ipsum praesentium est.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '47', null, '0', '1', '2017-05-18', '2017-05-14 04:17:02', '2017-05-14 04:17:02');
INSERT INTO `lesson` VALUES ('59', '16', 'Quod aut est officia ut et minus consequatur ut.', 'Assumenda quidem occaecati officia non maxime nostrum sint et odit dolor accusamus ab odit totam quas ut quidem qui cum velit ipsa fugiat et aut neque eum voluptatem enim illo quam sint aspernatur quo nostrum qui rerum ut quasi reiciendis nesciunt earum voluptatem sit voluptate qui sit accusantium quia quisquam temporibus nihil eius odio omnis aliquid atque quasi autem quasi qui porro est ipsa molestiae esse ratione voluptatibus necessitatibus repellat molestiae voluptatem vel quasi nihil ut consectetur quo sit illo id unde fugit velit sit similique hic repellendus sit perspiciatis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-16', '2017-05-14 04:17:02', '2017-05-14 04:17:02');
INSERT INTO `lesson` VALUES ('60', '26', 'Aut eum laborum voluptas quidem minima et illo officia.', 'Consequuntur libero et et itaque sequi est cum fugit rerum repellat amet ullam autem sit inventore voluptas eligendi neque adipisci et minus ipsam quae est commodi voluptas quis est impedit labore maiores porro aliquid eos cupiditate sint natus pariatur enim corrupti quae ipsum recusandae ad non eveniet illo ipsa molestiae ea atque magnam beatae repellat omnis et et sit ducimus porro aliquam ea eos enim est ad sit dolores sapiente omnis illum autem quod molestiae accusantium placeat saepe vitae non vitae molestias dignissimos nihil ipsum iure amet ab dolorum sed quia ab voluptatem aut architecto suscipit unde voluptatum ut deleniti cumque in iure fuga ut et laudantium quos impedit sapiente culpa aut iste cum nemo eligendi ut veritatis ut similique est quidem blanditiis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '45', null, '0', '1', '2017-05-15', '2017-05-14 04:17:02', '2017-05-14 04:17:02');
INSERT INTO `lesson` VALUES ('61', '11', 'Possimus aut ut ab velit quasi vitae et accusantium suscipit iure.', 'Perferendis odio suscipit cum at esse corrupti voluptatum eum dolorem aut soluta et tempora ea et est nobis ut omnis laborum optio quia suscipit non id amet similique perspiciatis accusantium minus sint temporibus nobis animi ad qui libero possimus rem ratione est excepturi iusto recusandae commodi voluptatum placeat sit temporibus expedita placeat amet nemo qui distinctio quia distinctio consequatur maxime distinctio at esse eveniet iure suscipit dolores officiis laboriosam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '20', null, '0', '1', '2017-05-14', '2017-05-14 04:17:02', '2017-05-14 04:17:02');
INSERT INTO `lesson` VALUES ('62', '3', 'Libero tempore a iure iure iusto magni culpa quibusdam.', 'Deserunt est totam ut eius placeat quam quia et ipsa laudantium rerum ut sit est consequatur adipisci voluptatum vero dolor sunt ducimus veniam est est commodi nemo quis nam eius adipisci asperiores quia perspiciatis aut ipsam dolores magni iste nulla id possimus ut autem voluptatibus natus sint culpa exercitationem est animi et expedita molestiae est quia exercitationem nam exercitationem dolorem modi fugiat autem ea aut est qui aut in ea et facilis quia et quisquam nisi minima sed autem sed laboriosam eum voluptas aut nesciunt omnis sequi laudantium dolore et necessitatibus quasi rerum repellat doloremque voluptatem quam voluptatem adipisci reprehenderit numquam animi dolorum sed tenetur qui perferendis harum qui magnam dolores occaecati eos vel debitis ipsum doloribus laudantium ratione minus repudiandae dolores voluptatem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-19', '2017-05-14 04:17:02', '2017-05-14 04:17:02');
INSERT INTO `lesson` VALUES ('63', '13', 'Voluptatibus repellendus ut molestias velit necessitatibus provident enim dolore.', 'Quae ex officiis non earum accusantium voluptatibus natus sint qui expedita commodi unde sed possimus rerum autem ullam et mollitia commodi sunt enim enim maiores et consequuntur modi iure aut et ipsam non voluptatem amet perspiciatis facilis consequuntur vel consequatur culpa vel molestiae ducimus voluptas quia laudantium quae illum cumque blanditiis magni qui voluptatibus est facere voluptatem dolores distinctio ut eligendi molestiae non occaecati enim enim omnis et possimus ratione asperiores occaecati tempora enim vero rem qui aut rerum dicta ut blanditiis nulla nihil dolorem rerum iure nam autem dolor est suscipit dolorum reprehenderit cum explicabo ut commodi et nihil occaecati aut minima veniam voluptate.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-19', '2017-05-14 04:17:03', '2017-05-14 04:17:03');
INSERT INTO `lesson` VALUES ('64', '26', 'Fuga magni nihil enim adipisci debitis unde laboriosam provident quibusdam.', 'Magnam voluptatem doloribus occaecati necessitatibus debitis explicabo inventore quos doloremque tempora accusantium itaque facilis consequatur numquam error eligendi quia veniam sed quos est officia fugiat odio facilis in hic ut autem quia sapiente exercitationem aliquid amet dolorum voluptatem id odio eos tenetur ut maiores qui porro voluptatem illum nemo optio aliquam perferendis eos itaque quia molestiae dolores consequuntur placeat saepe voluptas reprehenderit inventore quo officiis possimus id consequatur soluta enim ex autem eum reprehenderit maxime qui ut corporis dolorum sed aliquam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '45', null, '0', '1', '2017-05-16', '2017-05-14 04:17:03', '2017-05-14 04:17:03');
INSERT INTO `lesson` VALUES ('65', '14', 'Repellendus quo eum praesentium aliquam consectetur eveniet magni quis sit minus dolorem.', 'Non ut eum ut eligendi et necessitatibus sunt dicta ea aliquam aspernatur fuga aut odit eveniet sequi voluptate temporibus rem incidunt odit et officiis natus molestiae officia et maiores illum provident quo aut veritatis omnis nihil id eligendi mollitia omnis reprehenderit laudantium est eius dolore est ad sit laborum veritatis quae cupiditate error autem magnam unde necessitatibus officiis architecto dolore nihil enim et aut aperiam praesentium aspernatur quae dolor et qui modi nesciunt reiciendis ut consequatur id pariatur eum molestiae distinctio omnis ullam fugiat error reiciendis dolores eos nam et totam eos eos maiores vitae aliquam eaque facilis recusandae minus enim rerum architecto voluptas ut provident expedita nostrum voluptas doloremque aut unde delectus aliquam quos enim ullam aspernatur et provident eaque accusantium vero ut incidunt distinctio omnis debitis repudiandae voluptas quas.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '42', null, '0', '1', '2017-05-17', '2017-05-14 04:17:03', '2017-05-14 04:17:03');
INSERT INTO `lesson` VALUES ('66', '4', 'Aut quo quisquam distinctio delectus et ullam voluptatem et sed eos.', 'Possimus aperiam voluptatem cupiditate dolorem animi dolores enim qui doloremque deserunt quos omnis aut repudiandae et quos sunt natus accusamus doloribus tempora quis ea quis dolorem voluptas consequatur odit aliquid non saepe accusamus nulla vero quia quo ex laudantium molestias mollitia eveniet voluptatum ea occaecati sapiente vel accusamus veritatis pariatur tempora ut architecto hic ut voluptas qui minus corrupti et ratione cupiditate saepe ea occaecati illo iusto veniam repellendus eum eveniet molestiae sed reprehenderit quis quidem aut qui ea numquam dicta labore amet assumenda voluptas sit error natus eaque porro quia eius ullam et dicta autem enim eius atque molestias quisquam iure omnis sequi.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-17', '2017-05-14 04:17:03', '2017-05-14 04:17:03');
INSERT INTO `lesson` VALUES ('67', '26', 'Quia nemo laudantium omnis rerum vero magnam et consequatur.', 'Excepturi amet nihil provident rerum unde expedita officiis soluta incidunt eveniet nihil hic vitae aspernatur numquam ipsa vitae sint eveniet laboriosam dolores non sequi at repellat corrupti minima fuga aut minus tenetur nostrum est minus consequatur suscipit illum ea culpa fuga voluptas necessitatibus quidem voluptatem earum molestias occaecati omnis similique porro quis architecto consequatur id explicabo blanditiis libero repudiandae ipsam quis asperiores asperiores facere ratione dolores ut rerum dolorem et in.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-16', '2017-05-14 04:17:03', '2017-05-14 04:17:03');
INSERT INTO `lesson` VALUES ('68', '29', 'Odio voluptate eveniet architecto eos quidem quis officiis quisquam non perspiciatis.', 'Quod commodi necessitatibus corrupti qui reiciendis ab ex aut id qui aliquam placeat quibusdam provident aut sunt quia ex voluptas sit praesentium ratione aliquam quod inventore nulla ex accusamus ad molestiae incidunt in laboriosam labore quia accusantium id quod neque sed est minima voluptas quae delectus asperiores quae dolores velit cum ea provident mollitia cum quaerat qui quis consequuntur a quis ut quos ut numquam magni et in voluptas nobis est.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '28', null, '0', '1', '2017-05-14', '2017-05-14 04:17:03', '2017-05-14 04:17:03');
INSERT INTO `lesson` VALUES ('69', '10', 'Iusto eum sit debitis ab modi fugit similique.', 'Assumenda ipsum adipisci a est et quo ex dolor sed provident esse dolorum placeat velit ipsum doloremque fuga saepe nostrum sunt odio qui nobis similique facilis qui impedit dicta aliquid vero quod pariatur inventore et iure ut quis et sunt nisi commodi corporis amet at deleniti laboriosam et recusandae quia et rerum ipsam cum adipisci modi nemo ut qui accusantium ea eum suscipit quae eaque quidem libero facilis explicabo molestiae et officia deleniti sunt laborum laboriosam est consectetur rerum dicta possimus nostrum perferendis in totam ut non debitis voluptatem sint odio esse deleniti molestias laboriosam molestiae voluptatibus praesentium alias provident adipisci mollitia aut eos laboriosam explicabo aut nam veniam sunt quibusdam quidem beatae perferendis sequi dolores earum fugit quis rerum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-15', '2017-05-14 04:17:03', '2017-05-14 04:17:03');
INSERT INTO `lesson` VALUES ('70', '5', 'Non molestiae veritatis incidunt aperiam sint quidem dolor et.', 'Suscipit rerum suscipit aliquam ipsum itaque itaque cupiditate vel veniam et vel ut voluptatem ut quidem deserunt saepe quibusdam sapiente sint esse aspernatur quod animi nam earum libero pariatur similique velit autem id tempore alias temporibus assumenda eveniet eos eum officiis totam eos laboriosam in rem nobis magni nobis iusto fuga accusantium delectus asperiores ut natus dolore voluptatem saepe rerum natus et perferendis sed repudiandae temporibus dolores dolor et ipsa quas est saepe dolorum et vel dolorem minima et minima ut quis quo perspiciatis sunt quia voluptatem repellat exercitationem molestiae voluptatem praesentium velit repellat reprehenderit consequuntur est quia voluptatibus qui ea repudiandae molestiae nisi esse quasi quo dignissimos voluptatem illo minima modi suscipit eius delectus laborum quasi.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '39', null, '0', '1', '2017-05-17', '2017-05-14 04:17:03', '2017-05-14 04:17:03');
INSERT INTO `lesson` VALUES ('71', '13', 'Error non ipsam dolor possimus alias aut eveniet quaerat qui.', 'Est sit minus et ad quo consequuntur tenetur vitae earum dolore repellat vitae aperiam perferendis et quos incidunt aliquid voluptates exercitationem cum fugit qui error occaecati est iusto est fuga nulla voluptatem quisquam numquam distinctio debitis hic quidem voluptatum dicta sed expedita non magni illo nihil est qui pariatur beatae id quas dolor soluta voluptatem quia optio quos et itaque dolore harum tempore expedita eligendi eligendi architecto error laborum blanditiis necessitatibus reprehenderit deleniti et accusantium quae saepe libero autem sed temporibus optio illo hic distinctio natus facilis cumque harum omnis pariatur velit sit aut perferendis et nam laudantium quo vel dolorem laborum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '23', null, '0', '1', '2017-05-15', '2017-05-14 04:17:03', '2017-05-14 04:17:03');
INSERT INTO `lesson` VALUES ('72', '17', 'Quasi a non nulla sed est enim voluptates qui dolores voluptatem.', 'Id inventore ab ut saepe nesciunt a error sequi perferendis nisi aut tempora minus quia cumque quibusdam illo et consectetur tenetur odit et asperiores omnis enim ex facilis praesentium aut voluptatum eos veniam accusamus temporibus praesentium ad dolore nisi veniam commodi dignissimos quidem nulla suscipit voluptatem ipsa eveniet quisquam voluptate impedit incidunt nesciunt est quo sint officia ut non quis est eaque aliquam necessitatibus unde dolores ea accusamus temporibus illo omnis vero rerum ut ex eligendi corrupti accusamus tenetur sunt ducimus et facere et veniam aut quidem quibusdam deserunt beatae consequatur exercitationem labore sed sed dolor quisquam eius dignissimos rerum tenetur fugit eos fugiat quis voluptas maxime veritatis rerum quod facilis minus eligendi magni.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-18', '2017-05-14 04:17:03', '2017-05-14 04:17:03');
INSERT INTO `lesson` VALUES ('73', '9', 'Nobis nihil at earum aliquam ex ipsum vel corporis.', 'In ea perferendis nam voluptatum sint sunt aspernatur eveniet nemo omnis voluptatem deserunt et quae non est aut officia fugiat corrupti ipsam dicta et provident eum voluptatum sit nostrum id ullam consequatur eum repudiandae quidem asperiores reiciendis voluptate ullam est deserunt libero magnam quibusdam tempora id et magnam beatae nam perspiciatis iusto rerum totam deserunt soluta aut in soluta impedit minus quam autem vero id ut expedita eius et et natus quae tenetur deserunt libero repudiandae repudiandae reiciendis et aut fugit in alias rerum aut reprehenderit eius cumque aut quasi officia maiores alias maxime ratione soluta distinctio.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-16', '2017-05-14 04:17:03', '2017-05-14 04:17:03');
INSERT INTO `lesson` VALUES ('74', '19', 'Sed eveniet iusto rerum unde repellat amet voluptas.', 'A et rerum veritatis ea corrupti voluptas fuga eligendi quo libero qui nihil vel odio placeat non dolor et natus ea atque nihil vitae praesentium est voluptas et quia qui ratione voluptatem similique qui non rerum velit qui libero quos debitis ea optio non sit omnis reiciendis dolores ut rerum unde id ut ipsa voluptatem laboriosam ut et et iure blanditiis sed qui minima numquam deleniti sed.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-17', '2017-05-14 04:17:03', '2017-05-14 04:17:03');
INSERT INTO `lesson` VALUES ('75', '10', 'Veniam qui velit dolores eligendi quod nemo eius.', 'Magnam sunt sint rem et nesciunt ea modi aliquid corporis quaerat qui sed reprehenderit velit sunt deleniti accusamus dicta consequatur voluptas quod aut ut adipisci et sequi non reiciendis qui aperiam officiis explicabo enim nulla cumque et facilis aut quis aut deserunt nemo qui sit quo repudiandae est natus quis non sunt est et est unde ut maiores nihil officiis omnis voluptas commodi facilis at nobis commodi incidunt quae possimus numquam quos in enim tenetur cumque totam corporis quo cupiditate modi est error voluptatem eos pariatur aut sunt dolorem numquam aut quae aspernatur earum iure ut quisquam unde at enim veritatis consequatur officiis ea quisquam numquam aut architecto consequatur aut eius unde aut eos fuga occaecati molestiae incidunt tempora quasi et consequatur atque animi autem possimus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-14', '2017-05-14 04:17:03', '2017-05-14 04:17:03');
INSERT INTO `lesson` VALUES ('76', '15', 'Consequatur quo sed explicabo alias quasi sapiente delectus debitis velit ab.', 'Non dolor ut ad numquam ipsam aliquid aliquam quod exercitationem magni culpa impedit et dolor vel illo eveniet voluptatum laborum fugiat quia minima omnis qui eius quod soluta reprehenderit et suscipit debitis voluptas illum facilis iste provident magni labore aliquid consequatur qui consequuntur enim itaque distinctio voluptatem eum est officia rerum illum deserunt pariatur et eaque et sunt commodi eum iusto est adipisci accusantium molestiae veniam explicabo aliquid architecto rem sequi numquam nulla molestiae dolorem asperiores vitae possimus qui tempora consectetur quas ratione voluptatem est quod maiores perferendis et et quo ea perferendis rem omnis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-19', '2017-05-14 04:17:03', '2017-05-14 04:17:03');
INSERT INTO `lesson` VALUES ('77', '26', 'Nihil et ipsam quasi odio et in rerum illo.', 'Est porro iure quo voluptatem id alias reprehenderit sit quia et facere nam fuga aut consequatur eaque eveniet aut cum deleniti incidunt tempore sapiente pariatur eum iure eligendi quia non et et sapiente laudantium incidunt voluptatem voluptas molestias nihil enim autem sint omnis cumque sed molestias laborum eos est harum occaecati ut vel sit voluptatem deleniti at perspiciatis cupiditate dolores asperiores voluptatem ea et rem tenetur commodi at odio ut qui molestias quo quisquam nostrum qui minus facilis omnis sit vero omnis quas molestiae exercitationem aliquid aliquid mollitia voluptates iste quia sapiente quia maxime et ipsum amet soluta architecto non est cumque libero iusto consequatur sed distinctio ut quia consequatur itaque sunt beatae autem sequi dolor sed qui atque labore est neque voluptas consequatur deserunt corrupti quisquam adipisci amet maxime labore quam corporis quis architecto iste voluptas.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-19', '2017-05-14 04:17:03', '2017-05-14 04:17:03');
INSERT INTO `lesson` VALUES ('78', '26', 'Consequatur quis quia rerum porro nisi error aut inventore voluptatibus similique.', 'Ut voluptatibus enim nemo ab exercitationem esse at et provident fugiat consequatur mollitia vero asperiores delectus minus ea deserunt nisi dolorum ratione tempore officiis in quis et et et exercitationem et tempore dolorem velit quae animi non perspiciatis voluptas incidunt excepturi consequuntur sed quaerat consequuntur numquam repellat tenetur voluptatem autem iure quia eveniet nihil ut pariatur consequatur natus sint sunt quia quis libero beatae non error quibusdam sit quibusdam qui sit magnam molestiae non qui qui fugit tenetur facilis eaque dolores minima exercitationem blanditiis ea culpa vero autem numquam unde recusandae temporibus autem vero provident voluptatibus nisi aliquid est explicabo consequatur dicta omnis perferendis omnis non tempore libero provident occaecati quae eum qui asperiores est id esse saepe reiciendis eius rerum nisi incidunt ipsum est itaque ipsam natus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-18', '2017-05-14 04:17:03', '2017-05-14 04:17:03');
INSERT INTO `lesson` VALUES ('79', '7', 'Reiciendis in qui necessitatibus eum omnis vitae maiores temporibus.', 'Iste fugiat delectus voluptatem molestiae sit recusandae consectetur veritatis rem vitae esse quasi consequatur quasi est reprehenderit odit earum eum consequatur ut tempora aspernatur rerum et enim excepturi et tempore qui distinctio ipsa et et facere rerum vero fugiat amet molestias dolor voluptatem nulla suscipit ea atque quas eos assumenda et placeat incidunt similique ut quia saepe autem praesentium sit occaecati officia nam rem ipsum tempore dicta dolorum aperiam consequuntur nobis quaerat vero porro quibusdam laborum qui modi aut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '24', null, '0', '1', '2017-05-15', '2017-05-14 04:17:03', '2017-05-14 04:17:03');
INSERT INTO `lesson` VALUES ('80', '21', 'Error et hic consequuntur placeat nemo aperiam dolor est deserunt quisquam.', 'Ut doloribus in facere ipsa voluptatum architecto voluptas quidem non tempore sunt ut eaque non ut nam et soluta minus voluptatem perferendis aspernatur et perferendis quae ad voluptatem inventore beatae sit quo maxime animi sequi sit nisi ipsum sed quasi dolorem animi sed nam exercitationem reiciendis nobis iusto et possimus sint similique ex veniam aut modi error qui cumque veniam aut necessitatibus qui corrupti blanditiis officia nisi sed laboriosam alias consequuntur quisquam voluptas accusamus magni et cum et animi id temporibus facere quod voluptas autem enim sint eos occaecati vitae nostrum culpa labore illum dolore accusantium explicabo animi vel fugiat reiciendis ratione praesentium enim in voluptas.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-17', '2017-05-14 04:17:03', '2017-05-14 04:17:03');
INSERT INTO `lesson` VALUES ('81', '10', 'Occaecati et voluptatum magni neque accusantium.', 'Consequuntur ut vitae distinctio voluptas eum et delectus et autem natus officia praesentium quo dolores ullam voluptatum eaque temporibus dolor quia quis error error in repellat excepturi aut suscipit temporibus suscipit aut qui et exercitationem consectetur dolores eveniet atque asperiores itaque temporibus quas magni occaecati eos et odio sapiente est nemo tempore non est et eum nulla nisi non maiores velit consequatur sed qui inventore rerum distinctio in aut voluptates fuga nostrum deserunt quia nostrum asperiores ipsam sit incidunt voluptatibus dolores quasi eaque totam consequatur nemo unde non iure accusamus tempora est et non deserunt optio officiis omnis voluptatem sit hic odit veniam quis ea quae hic aut nisi inventore.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-16', '2017-05-14 04:17:04', '2017-05-14 04:17:04');
INSERT INTO `lesson` VALUES ('82', '9', 'Et ducimus consequatur voluptatem iure distinctio alias nihil aliquam delectus aut.', 'Reprehenderit perspiciatis esse qui explicabo repudiandae vel voluptas dolor blanditiis nam cum qui aut voluptas quae facere eveniet facere at rerum temporibus animi doloremque eligendi quaerat hic velit ea molestiae est ipsam quia maiores laboriosam fuga quod quisquam error consequuntur quisquam illo corrupti repellat quis distinctio voluptatem laudantium distinctio quis voluptas cupiditate et sed sunt autem voluptates unde illo perspiciatis a officia quia sint corrupti repellat et maxime nemo consequuntur minima fugiat accusantium reiciendis modi fugiat reiciendis voluptatem aut impedit et atque quia qui consequatur ea dignissimos totam expedita nostrum aut non vel culpa enim recusandae excepturi eaque dolorem suscipit a incidunt ut et molestiae ipsa impedit suscipit ipsam dolore earum explicabo praesentium ut sunt accusantium exercitationem hic laudantium dolorum nesciunt magnam occaecati non porro ea aut id possimus dolorum saepe voluptas sit ullam quasi officiis repellendus cupiditate blanditiis dolorem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '47', null, '0', '1', '2017-05-19', '2017-05-14 04:17:04', '2017-05-14 04:17:04');
INSERT INTO `lesson` VALUES ('83', '20', 'Ad sequi officiis dolores dolor dignissimos consequatur ut iste consequatur est quo.', 'Dolor corporis atque quia occaecati sed architecto ut non ut alias facere saepe qui ipsum odit qui praesentium eum est praesentium autem fuga harum saepe nulla at voluptates deleniti autem eum voluptas qui est labore molestiae et placeat et repellat accusantium provident quaerat mollitia ut et occaecati porro eum blanditiis doloribus sit qui vel dolores totam optio et aspernatur repellat et eius eos dolorem et libero in est officia qui possimus facere voluptatem eos itaque eius doloribus veritatis odit deleniti fugit eum quo nemo et recusandae commodi itaque ex veritatis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '27', null, '0', '1', '2017-05-17', '2017-05-14 04:17:04', '2017-05-14 04:17:04');
