INSERT INTO `lesson` VALUES ('87', '4', 'Officiis culpa necessitatibus et doloremque nihil officia nihil explicabo.', 'Repellendus officiis explicabo quo modi perferendis fugit fugiat occaecati laborum quia et esse eum sit omnis expedita et maxime nesciunt aliquam eum laborum aut neque itaque sint omnis veniam sint architecto incidunt enim assumenda sequi facere quo eum deleniti magni libero est sint dolore quaerat dolor molestiae quis illo repellendus ratione aut dolore minima at ipsa nobis cum aliquid est cumque modi nemo ullam laborum dolor dolorum quibusdam magnam ipsa delectus eos non cupiditate rerum repudiandae ut voluptate quisquam et sapiente quasi sit et facilis ipsa aut minima amet aut cum temporibus reiciendis aut sit ratione sapiente mollitia sed.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-19', '2017-05-14 04:17:04', '2017-05-14 04:17:04');
INSERT INTO `lesson` VALUES ('88', '18', 'Alias omnis accusantium est dolor similique quo dolor.', 'Ut inventore voluptates explicabo dignissimos natus molestiae nam hic consequatur sapiente saepe commodi sit aliquam vero labore et consequuntur autem eum eum minus incidunt in quam nemo explicabo quae nihil eos at odit est facere et qui officia nam et aut est quia illum esse possimus est quia totam provident hic quos ut debitis occaecati nobis nam ea atque aut quo non quis illo illum harum quis aut et molestias ea ea ut nemo minus velit perferendis aut eos qui amet sint deleniti quos natus quidem laboriosam incidunt eius.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-18', '2017-05-14 04:17:04', '2017-05-14 04:17:04');
