INSERT INTO `lesson` VALUES ('105', '17', 'Dolorum est labore et rerum unde non.', 'Eveniet inventore asperiores pariatur et omnis qui optio ab quia impedit cupiditate ducimus voluptatem et amet et et perferendis impedit ex doloremque nam et voluptatem esse quos veniam dolor vero quia consequatur qui illo debitis nisi ex ratione rem ut sed reprehenderit eveniet ipsa adipisci ducimus error autem dolores eaque molestiae et et quia voluptate incidunt nam est quasi recusandae fugit consequatur omnis aut et quos non harum provident accusantium et omnis molestiae numquam aut dolores exercitationem dolorum quia.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-16', '2017-05-14 04:17:05', '2017-05-14 04:17:05');
INSERT INTO `lesson` VALUES ('106', '24', 'Voluptatem repellendus est est odio esse ut dignissimos ad.', 'Quibusdam est inventore cumque voluptate quisquam placeat nisi eum sit labore aut cumque et quo amet assumenda et dolor iusto beatae ipsum explicabo reprehenderit assumenda consequatur et est sed distinctio et et quasi error molestias accusantium illum provident est recusandae aperiam non quo exercitationem aut nulla enim enim voluptatibus ullam tempora eligendi temporibus cumque magni itaque commodi totam magni provident amet est vero et in delectus ullam maiores excepturi repellat distinctio quae deserunt assumenda voluptatibus maxime fugiat consequatur illo modi voluptatibus magni.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-18', '2017-05-14 04:17:05', '2017-05-14 04:17:05');
INSERT INTO `lesson` VALUES ('107', '24', 'Aut cupiditate modi natus vel sit consectetur.', 'Ullam quas provident pariatur odio quidem beatae dolores blanditiis animi velit distinctio dolor quam corrupti veniam error cupiditate nisi hic occaecati consequatur veniam quis aliquid illo rem deleniti expedita quis commodi eum rerum et aut aut consequatur voluptate laboriosam aut quae dolore nemo atque ullam quo minima consequuntur sunt sequi reprehenderit velit rem ex sint earum est deleniti voluptatem enim eius ullam deleniti cumque possimus soluta impedit porro et omnis exercitationem provident ut delectus voluptatem assumenda eaque possimus odio ab aliquam quia quia sapiente consectetur est esse ut occaecati natus animi blanditiis est corrupti nam eos aut minima aut repudiandae ab qui architecto ipsa aperiam enim alias reprehenderit consequuntur vero fuga laboriosam dolorum assumenda velit delectus ad assumenda ut accusamus voluptate qui nemo enim porro.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '30', null, '0', '1', '2017-05-15', '2017-05-14 04:17:05', '2017-05-14 04:17:05');
INSERT INTO `lesson` VALUES ('108', '29', 'Eaque consequatur mollitia quidem laboriosam ut in illum.', 'Voluptate vero quia dignissimos facilis porro officiis ea aut nostrum pariatur eum non quae sapiente suscipit nemo aut deserunt veritatis dignissimos ipsam magnam eos sit illum sed fugiat sed optio nihil ratione asperiores eos autem culpa id non alias ut nam rerum magnam quaerat explicabo illo laborum est exercitationem dolore odio dolorem aliquid aut nihil cupiditate ut sapiente quia laudantium est eum et dicta sunt iure autem excepturi repudiandae inventore illo ut vero voluptatem natus ab qui porro corporis sed hic et consequatur autem vero rem vel voluptas saepe earum voluptatum et quo et error dolorem ut perferendis asperiores voluptatem quas sunt et corrupti eveniet ut dolore et sint et aut omnis non repellendus non harum voluptas.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-14', '2017-05-14 04:17:05', '2017-05-14 04:17:05');
INSERT INTO `lesson` VALUES ('109', '17', 'Nostrum perspiciatis accusamus repellat non aliquid qui.', 'Sed vel magni impedit cumque praesentium itaque maiores porro molestias blanditiis soluta ut et ipsum amet fugit praesentium perspiciatis commodi a quam optio enim qui dolores architecto dolorem rerum sit cumque pariatur modi ad dolor aut veritatis sit voluptatem aut molestiae quia autem autem iste voluptatem repudiandae expedita alias nostrum amet aut provident dolor iste neque explicabo nemo voluptas ea nemo error reiciendis occaecati dolores velit minus omnis voluptates sit impedit saepe voluptatum voluptatum cum inventore quo accusamus accusantium explicabo dolorum quam voluptatem nihil.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '31', null, '0', '1', '2017-05-19', '2017-05-14 04:17:05', '2017-05-14 04:17:05');
INSERT INTO `lesson` VALUES ('110', '19', 'Quo qui est ratione expedita nulla soluta illo modi omnis commodi.', 'Ipsam ut commodi consequatur labore esse sunt velit quo quaerat accusamus eos doloribus rerum rerum eos consectetur non magni sint fugiat et et magnam est doloremque magnam provident voluptatum in minima dolor libero sapiente optio excepturi numquam dolor atque voluptas consectetur expedita assumenda officiis et architecto impedit natus quo aut ipsum a qui et labore voluptatem porro ut id doloremque totam qui architecto ipsa eum sapiente eum veniam quis odit quia aut iusto repudiandae illo porro qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-18', '2017-05-14 04:17:05', '2017-05-14 04:17:05');
INSERT INTO `lesson` VALUES ('111', '13', 'Ut occaecati eos quidem ipsum eius sunt omnis iste amet magnam.', 'Animi provident voluptate omnis ut quidem distinctio voluptatum non praesentium ut quia ut pariatur blanditiis accusantium nostrum quod illo voluptatum voluptatem maiores natus harum odit non dolorum qui debitis soluta eos omnis accusantium ut autem maxime nisi officia autem fugit eum nemo iusto quos sed dolor occaecati adipisci illo nobis qui nemo soluta quas sed quibusdam facere dolor necessitatibus repellat culpa consequatur aut et consequatur maiores nemo sunt qui ea fuga adipisci dolores ratione fuga saepe et eligendi et impedit molestias aut eius dolores eos ipsam est deserunt delectus quia ad dignissimos magni unde minus sit qui neque amet fugiat asperiores distinctio aspernatur consequatur quia in enim autem officia et officiis deserunt non impedit vero quis hic ut repudiandae et sit laudantium.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-14', '2017-05-14 04:17:05', '2017-05-14 04:17:05');
INSERT INTO `lesson` VALUES ('112', '14', 'Repudiandae est eveniet accusantium eos quos.', 'Quaerat esse aperiam quasi sed ut aperiam ad culpa eos consequuntur necessitatibus laborum odio cum aliquam maxime ea velit quo occaecati nemo quo et et minus fugit aut dolorem rem et dolorem optio quis aliquid incidunt officia molestias ducimus inventore id tenetur rerum ipsam magni perspiciatis in nemo assumenda quibusdam qui qui consequatur sunt et in explicabo voluptas quae veniam sed veritatis aperiam qui nisi culpa ullam repellendus officia voluptatem est sed autem hic iure facilis quam recusandae repellat blanditiis dolor aut ullam reiciendis est dolorum ducimus veniam eos dolores nam perspiciatis mollitia velit officiis consequuntur laudantium amet eius vero error quisquam impedit sunt voluptas quis ducimus rerum laborum explicabo placeat laudantium ab illo perferendis nesciunt et iure adipisci dicta quo quidem consequatur dicta voluptatem repellendus enim excepturi corporis ut quas et distinctio repudiandae voluptas doloremque ducimus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-19', '2017-05-14 04:17:05', '2017-05-14 04:17:05');
INSERT INTO `lesson` VALUES ('113', '20', 'Consequatur occaecati sed laborum dolorum vero et aspernatur natus earum.', 'Sint architecto dolores omnis culpa laudantium est numquam nesciunt non rerum cupiditate provident dicta et eveniet velit delectus enim velit quia voluptate quis hic et voluptas occaecati fugit perspiciatis debitis accusantium quia nostrum quis consectetur debitis unde doloremque tempore eaque nostrum quia accusantium quaerat cum vel modi quia dolores molestiae sit neque cum asperiores corporis cupiditate quidem saepe dicta quo impedit autem qui accusamus recusandae aut ipsam voluptatem necessitatibus velit cum eaque quod consequatur quis deleniti adipisci.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '36', null, '0', '1', '2017-05-19', '2017-05-14 04:17:06', '2017-05-14 04:17:06');
INSERT INTO `lesson` VALUES ('114', '19', 'Magni sint aut ab beatae sequi aut explicabo saepe aut.', 'Illo ut libero eum fugit commodi aperiam at enim ipsum sint dolorem cupiditate temporibus voluptatem et labore incidunt ut voluptatem accusantium dolores nam mollitia voluptas pariatur numquam eos est ea corporis et enim ut aspernatur corrupti qui consequatur nostrum aut iure optio molestias eligendi est ipsa earum quaerat ipsa quae totam fuga aspernatur sit velit voluptas illo necessitatibus ut quas fugit ipsum dolor et sunt magnam in eligendi recusandae tenetur iste exercitationem beatae similique aut nihil quidem doloremque dicta perspiciatis molestiae ea reiciendis voluptas et ut ullam suscipit voluptate sed ad voluptatem consequatur esse voluptatem nemo laborum nemo sed eveniet doloribus suscipit voluptatem distinctio rerum porro error repellendus in perspiciatis voluptatum asperiores quasi est sint totam voluptatum et ex dignissimos et laboriosam doloremque ut quo quae cupiditate optio voluptatem id.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '47', null, '0', '1', '2017-05-16', '2017-05-14 04:17:06', '2017-05-14 04:17:06');
INSERT INTO `lesson` VALUES ('115', '6', 'Possimus molestiae sunt autem consequatur aut beatae doloremque deleniti et voluptas.', 'Modi est rem eos repellat rem optio tempore tenetur harum voluptas dolor eaque placeat minus maiores nemo natus neque rerum ipsum aliquid necessitatibus recusandae asperiores dolorem quia esse tempore vitae tenetur quam soluta corrupti illum enim ducimus voluptatibus vitae in omnis aut voluptas eveniet a quos soluta sunt saepe tenetur in ipsum sed qui expedita et tempora qui laborum in amet neque deserunt delectus officia ullam quo aut similique id assumenda reiciendis sunt aut fuga ut omnis fugit doloremque totam odit nihil dolor voluptatem eligendi.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-16', '2017-05-14 04:17:06', '2017-05-14 04:17:06');
INSERT INTO `lesson` VALUES ('116', '12', 'Praesentium magnam sit velit quisquam repellendus et doloribus nihil.', 'Ab quae rerum aut culpa quidem recusandae blanditiis iste reprehenderit ipsa molestias et praesentium et dolorum quia in at incidunt deserunt error necessitatibus et dolor illum aperiam neque iste et aut quia ea laudantium error qui praesentium expedita rem a et aspernatur eum et fuga dolores quam eveniet ad est ut in illo omnis voluptatem illo ipsa ullam veniam est voluptatem dolorum suscipit sint expedita est saepe quidem porro deserunt voluptas unde ab libero incidunt magnam quis quis accusantium iusto amet quia molestias minima blanditiis velit quo deserunt dolorem impedit eum et nam qui est laudantium ea labore quibusdam ut at non sit qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-15', '2017-05-14 04:17:06', '2017-05-14 04:17:06');
INSERT INTO `lesson` VALUES ('117', '8', 'Quisquam quia et accusamus neque debitis quasi.', 'Voluptatem qui est fugit rerum ad ea natus placeat provident minima corporis nobis sunt dicta velit aut ducimus officia nostrum sed magni facilis ad voluptas cupiditate aperiam sunt doloribus itaque et beatae nihil fugiat assumenda in ratione ad ut consequatur quisquam magnam cumque unde temporibus occaecati repellat vel eius placeat laborum beatae quae libero quam quibusdam qui repudiandae error quia quo debitis laboriosam rem sunt voluptatem voluptatem veniam dolore est voluptatum molestias numquam aut molestiae consequatur facilis quam consequatur nulla earum officiis alias dolore adipisci incidunt delectus consequatur aut commodi quia vel fugit consequuntur error dolores veritatis doloremque a quo ex reprehenderit dolor quis quia excepturi aut debitis optio quidem et aut dolores quis autem nesciunt ut cum officiis nesciunt ut aut et assumenda deserunt quia quia porro odio iure ut magni.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-18', '2017-05-14 04:17:06', '2017-05-14 04:17:06');
INSERT INTO `lesson` VALUES ('118', '2', 'Placeat voluptate neque non aliquam et.', 'Cum laborum animi et laboriosam voluptatem voluptatum mollitia non aut quo et mollitia consequatur consectetur ut facere consequatur eum quo et minima debitis amet nesciunt omnis adipisci voluptatem amet quibusdam sed atque sed voluptatem distinctio numquam quae sit voluptatibus veniam dicta sed voluptatem impedit doloremque vel aut sed possimus magnam commodi adipisci voluptatibus quaerat ut eos minus minima assumenda et nemo velit enim ducimus inventore quia dolorum et error dolorum aperiam aliquam rem aspernatur beatae est corrupti odit ipsum maiores unde et sed error voluptatum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '30', null, '0', '1', '2017-05-17', '2017-05-14 04:17:06', '2017-05-14 04:17:06');
INSERT INTO `lesson` VALUES ('119', '22', 'Officiis ea sapiente et excepturi earum voluptatem sint.', 'Est quia asperiores asperiores ad rerum consequuntur porro consequatur quis voluptatibus quia quidem iure pariatur quod nulla et id est quae voluptates voluptatem consequatur alias maxime enim vel natus molestiae error nihil nesciunt error laboriosam numquam dolorem in cupiditate aut fugit vero autem nostrum aperiam maiores officia dolores eum ut quam ipsam velit quam ex saepe molestiae quia possimus labore necessitatibus officia enim praesentium laboriosam est dolorum illo est iste tempore quos qui minima praesentium voluptatem laborum est voluptas consectetur explicabo qui et error quibusdam quidem sint eum laborum nostrum suscipit explicabo sit sit quaerat et incidunt earum suscipit optio non fugit quo excepturi sed id sint et aut et illo qui sit eius provident assumenda quos ut quidem ullam quidem accusantium animi voluptatem eveniet alias eius iste nihil rerum ad sed.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '28', null, '0', '1', '2017-05-15', '2017-05-14 04:17:06', '2017-05-14 04:17:06');
INSERT INTO `lesson` VALUES ('120', '2', 'Consequatur sequi consequatur asperiores sed ex nesciunt aspernatur ratione dolore velit.', 'Nam quis labore ab cumque omnis voluptatem et quo quos est quibusdam adipisci dolor ut ducimus similique qui quas nisi voluptatem vel et et quam placeat et eum molestiae est assumenda et aut sit voluptate nisi quam atque deserunt et voluptatem esse repellendus dolor sit vitae quia ea dolor dolor saepe facilis nisi corporis impedit dolores quisquam similique rerum hic nam neque quae iusto perferendis assumenda omnis laudantium molestias aut sed quisquam sit laboriosam adipisci hic eveniet ipsum sit tempora consequatur dolores est temporibus dolores voluptates maiores rerum qui et temporibus dignissimos qui provident fugiat iure porro dolorem assumenda aut ut vel est illo atque dolor nihil magni sit dicta quam ut culpa facilis velit provident provident.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '22', null, '0', '1', '2017-05-17', '2017-05-14 04:17:06', '2017-05-14 04:17:06');
INSERT INTO `lesson` VALUES ('121', '25', 'Aliquid et provident error aspernatur laboriosam quasi perspiciatis doloribus.', 'Dolores totam fugit dolore fuga aut qui distinctio est accusantium odit in qui rerum optio odit recusandae sunt ipsum unde eos error temporibus quisquam optio voluptates esse consequuntur unde perspiciatis aut aut ducimus itaque corrupti aperiam ut omnis odio deleniti omnis omnis autem ullam et voluptas repellat aperiam velit enim voluptas iure dicta aut et nihil ab minus qui tempore sint reprehenderit delectus sapiente beatae repellat at maiores eveniet ut illum et quae molestiae quo mollitia totam suscipit quisquam velit aut et accusamus et ut ad officia corporis odio facere explicabo aut est nobis ut est reiciendis ratione sequi dolorum molestiae doloremque quae veritatis cumque ducimus alias accusantium nulla minima tempore modi eaque ut sed beatae reprehenderit nostrum vero qui quidem rerum in.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '27', null, '0', '1', '2017-05-15', '2017-05-14 04:17:06', '2017-05-14 04:17:06');
INSERT INTO `lesson` VALUES ('122', '23', 'Saepe beatae est quis delectus quo facere vel rem unde.', 'Unde asperiores eaque sint doloribus ut fugiat aut voluptates eligendi repudiandae nobis dolores rem esse quo natus quia magni vel voluptas sapiente velit iure cum vel nostrum placeat a inventore sapiente ut aut dolor aut necessitatibus tenetur officia facilis neque aut ipsa similique eveniet vitae voluptatem fugiat ratione ea non ut quia est nihil soluta nemo mollitia hic laudantium accusantium dolore temporibus ipsum maiores ex facilis voluptate omnis voluptatem id inventore nobis eveniet sunt dolorem voluptatem esse consectetur esse itaque fuga velit doloribus quae enim odit nam non incidunt vitae amet consequatur aut omnis nesciunt corrupti qui ea ducimus quia velit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-19', '2017-05-14 04:17:06', '2017-05-14 04:17:06');
INSERT INTO `lesson` VALUES ('123', '16', 'Et qui praesentium sint dolores eum et veritatis voluptas perspiciatis possimus.', 'Voluptas alias mollitia et unde ut deleniti ex similique ut quis ut quia est delectus optio quia doloribus asperiores esse error magni hic enim fugit ex eos eos cumque quis incidunt ea nisi ipsam dolor tempora ipsa alias suscipit nihil rerum sit recusandae voluptates saepe voluptatem dicta dolore qui voluptatem sunt quidem odit voluptatum illum voluptatum sed corporis eum qui ea dolor natus pariatur veritatis molestiae eos dolorem qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-16', '2017-05-14 04:17:06', '2017-05-14 04:17:06');
INSERT INTO `lesson` VALUES ('124', '11', 'Quibusdam assumenda occaecati id deleniti magnam quis.', 'Sed sed explicabo aut ea repellat nemo aut et hic fugiat cupiditate qui earum neque facere sunt ut reprehenderit ut repellendus ut possimus perspiciatis nihil eum consequatur enim earum natus suscipit reprehenderit quis maiores eum quidem facere voluptates sit dolorum ea et culpa consequatur quibusdam iure nostrum laboriosam ut eius porro officia dolorem provident in quis eius harum at exercitationem quos qui excepturi enim molestiae nostrum odio sit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-16', '2017-05-14 04:17:06', '2017-05-14 04:17:06');
INSERT INTO `lesson` VALUES ('125', '16', 'Enim officia eos tempora quibusdam enim omnis corporis sunt.', 'Corrupti perspiciatis eos accusantium sed beatae quam repellat consectetur et laboriosam nulla sint nostrum eius architecto ea ut odit nam accusantium harum voluptate provident quod quo architecto aliquid quo omnis est necessitatibus enim sed dolore eius quam quos et veniam quae corporis sit qui mollitia similique sit pariatur dolores optio repellat aliquid inventore deserunt qui perspiciatis facere ea eum sunt soluta aspernatur distinctio nulla quam reiciendis debitis ut a corporis aspernatur aut sequi velit minus doloremque accusamus ut vero asperiores et dicta sed et corporis temporibus quis sunt odio excepturi cupiditate quibusdam qui exercitationem soluta eum quis asperiores quia ullam sunt aut perferendis similique non quibusdam magni accusantium sint enim consequatur qui sapiente similique et qui dolores nostrum deserunt voluptas ea sunt aut doloribus amet recusandae in consequuntur nemo error aperiam quia nemo veniam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '30', null, '0', '1', '2017-05-18', '2017-05-14 04:17:06', '2017-05-14 04:17:06');
INSERT INTO `lesson` VALUES ('126', '11', 'Placeat aperiam nostrum eaque veritatis expedita delectus quia consequatur laborum mollitia ad.', 'Illo qui quis quae ducimus quibusdam asperiores esse sed voluptatum quidem illum sit nam consequuntur fuga pariatur esse officia qui pariatur quae tempora enim ut ipsum quia officia maxime ea rerum error nihil ut voluptatem nobis architecto ab molestiae qui expedita provident aliquid perspiciatis minima incidunt occaecati iure non eius consectetur nesciunt quis sunt molestiae repudiandae iure quaerat molestiae perferendis autem accusamus est neque voluptas id molestiae aliquam perferendis et voluptatem tempore aspernatur beatae beatae aut repellendus nulla nobis alias voluptatem mollitia voluptatem est ducimus commodi reprehenderit nulla sed illo fugiat voluptatem omnis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-17', '2017-05-14 04:17:06', '2017-05-14 04:17:06');
INSERT INTO `lesson` VALUES ('127', '22', 'Et iure ut sint ullam et voluptas illum porro aut hic et.', 'Ad sint quisquam cum aut recusandae saepe nihil veritatis ut similique omnis et incidunt et reprehenderit molestias minima ipsum labore autem aliquam nihil eos perferendis sit praesentium aperiam aut rerum eos qui sed recusandae nulla aut voluptas dicta et id qui et corporis sed aut qui voluptatem sed temporibus possimus aut tempore veniam veritatis beatae voluptatem dolores facilis et quia officia ipsum esse est hic rerum iste.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-18', '2017-05-14 04:17:06', '2017-05-14 04:17:06');
INSERT INTO `lesson` VALUES ('128', '13', 'Vel sed nihil illo quis omnis quo ipsam dignissimos.', 'Officia doloremque dolor blanditiis consectetur eveniet tenetur facilis odit beatae quam minima incidunt labore ullam vero et vel eligendi quod molestiae est dicta mollitia et delectus nihil architecto consequatur ut vel deleniti officia quia quos voluptate fugit voluptates nihil quisquam quaerat soluta quo est laudantium rem possimus rerum iusto cum ut omnis consequatur corrupti accusantium atque deserunt tempore saepe et odit laboriosam quibusdam sed esse et ipsa dignissimos modi eos autem nostrum reprehenderit minima et earum debitis ut nisi perspiciatis perspiciatis est magnam dolores officiis fugit rerum eum mollitia quo rem neque earum quo provident eaque.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-15', '2017-05-14 04:17:06', '2017-05-14 04:17:06');
INSERT INTO `lesson` VALUES ('129', '17', 'Quae sunt numquam nulla sed.', 'Iusto officia deleniti sit nulla molestiae placeat qui dolores eius molestias eligendi explicabo et veritatis reiciendis illum et dolores rerum praesentium laudantium commodi nihil quisquam dolorem qui dignissimos dolores quos assumenda architecto vero quia est voluptatibus perspiciatis alias ratione consequuntur dolores earum cupiditate sed alias architecto impedit vel unde recusandae impedit nihil laudantium tempora temporibus delectus explicabo odit sit possimus eaque numquam non et earum fuga consequatur optio enim ut omnis quibusdam consequatur quia adipisci minus cupiditate qui vero qui harum cupiditate molestiae sint earum numquam architecto cum dignissimos vero aut sit soluta quo commodi beatae eius provident qui facere aperiam vero cumque quia asperiores nam similique assumenda fugit minima consequuntur ut sunt excepturi laudantium quidem asperiores qui doloribus possimus aut officiis quas eum totam rerum sit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-17', '2017-05-14 04:17:06', '2017-05-14 04:17:06');
INSERT INTO `lesson` VALUES ('130', '5', 'Est mollitia tenetur sit aut soluta sunt.', 'Dignissimos omnis rerum facilis blanditiis et iste odio voluptas consequatur magni iure animi quis in ipsa qui et quia exercitationem tenetur ad eum corrupti autem perspiciatis dignissimos et molestiae placeat quod fuga eos vel eveniet labore sequi delectus non officia temporibus numquam repellendus commodi molestias velit et nesciunt minus et consectetur nulla molestias sed suscipit sunt qui ut sit reiciendis et repudiandae minus facere quis esse molestias labore et ipsam assumenda eum enim provident qui est quod nihil accusamus atque eveniet quidem qui aliquid aut et ut aut eius accusamus omnis odit fuga aut minus quasi animi quo quia unde voluptatem sunt illo est dignissimos nostrum neque error quisquam ad et dolorum suscipit qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-18', '2017-05-14 04:17:07', '2017-05-14 04:17:07');
INSERT INTO `lesson` VALUES ('131', '20', 'Est eos commodi debitis et eos quia maiores cumque.', 'Doloremque nisi est occaecati non ipsum labore inventore saepe suscipit omnis id temporibus eveniet rerum ab eius ea id omnis eos quis non in dolorum corrupti non consequuntur qui aut ipsa aut eum aperiam numquam maxime dolores magni dolores voluptatem molestias nam ratione laborum sed quisquam quod ut consequatur ipsum eaque saepe saepe dicta quos reiciendis fugit voluptas autem vitae neque facilis velit voluptatem quas reiciendis et incidunt voluptas molestias quia enim aliquid hic occaecati reiciendis et iure incidunt rerum facilis iusto aut iure veniam vel et maxime consequatur magnam quia libero pariatur nihil numquam qui vitae possimus id sint quo doloremque omnis delectus ad quisquam ex sit possimus natus non quis aut debitis eius ut aliquid sit dolorem rerum maiores provident ducimus voluptatem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '30', null, '0', '1', '2017-05-15', '2017-05-14 04:17:07', '2017-05-14 04:17:07');
INSERT INTO `lesson` VALUES ('132', '21', 'Eligendi reiciendis expedita ullam sequi nulla.', 'Similique voluptatum iste et asperiores aperiam dolorem quos omnis autem neque sapiente quibusdam ad asperiores eveniet quo aut neque est ad ab voluptatibus sed enim expedita ut numquam blanditiis expedita ut sed totam quaerat et unde nihil quasi quos error soluta et voluptas eos quia id vel aliquid ut in neque ipsam laborum nisi dolor sed fugit consequatur autem illo laborum est doloremque nemo reiciendis nam et perferendis ab nostrum harum nobis quod et et accusamus debitis qui doloremque quasi aliquam omnis quis praesentium ullam architecto ut et quis rerum minus quas omnis repellendus voluptas voluptas amet consequuntur et sequi corrupti et nesciunt consequatur quidem ea quia nam possimus eligendi quas quae autem voluptatem et magnam rem et enim et libero nulla placeat molestiae sint dolore velit natus quia libero odio autem quis aliquam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '42', null, '0', '1', '2017-05-15', '2017-05-14 04:17:07', '2017-05-14 04:17:07');
INSERT INTO `lesson` VALUES ('133', '20', 'Adipisci nulla velit excepturi et sunt alias ab vel.', 'Provident minima unde vel error nihil iusto accusantium dignissimos reiciendis facilis doloremque quia iure ut consequatur voluptatum qui incidunt ex excepturi amet doloribus magni quisquam deserunt modi dignissimos rerum dolorem in nihil est mollitia illum natus voluptatibus ullam optio tempora autem officia qui asperiores ut et quibusdam minus quae iusto dolor ea facilis vel sint suscipit et eos tempora doloremque eum aliquid odit nobis sit voluptas velit necessitatibus odit accusamus autem assumenda numquam laudantium possimus corporis minus id quia placeat repellat consectetur in adipisci illum eum laudantium aut est numquam voluptas eaque similique doloremque nam maiores quam doloremque aut qui similique minus deserunt totam minima est ratione id explicabo qui exercitationem dolores est non nam nihil aliquid voluptate quaerat tempora laudantium nihil doloribus nam officiis libero tempora numquam repellendus reiciendis ea est assumenda illum minima odio excepturi quibusdam cum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-14', '2017-05-14 04:17:07', '2017-05-14 04:17:07');
INSERT INTO `lesson` VALUES ('134', '8', 'Sunt alias soluta vel voluptatem non consequuntur delectus assumenda voluptatem.', 'Repellat et accusamus fugit veritatis est id ut rerum molestiae dolorum consectetur voluptatum velit voluptatibus qui consequatur blanditiis explicabo deserunt hic nisi deleniti neque nemo iste itaque facere quia maxime amet maiores et distinctio facilis veniam explicabo et necessitatibus nesciunt nulla pariatur impedit ipsa ipsa atque sequi quae mollitia quod illum voluptatum ratione qui adipisci quisquam aut rem molestiae consequatur impedit non voluptatibus asperiores ex ea illo maiores voluptates corporis reiciendis odio commodi eos quis ex quis enim corrupti nesciunt incidunt vero possimus ullam hic enim veniam consequatur velit in rerum esse quia voluptatem nisi eum nemo placeat sapiente pariatur aliquid enim et velit maxime velit sequi dolor et magni similique dolor in ipsam eius placeat dolorem culpa atque fuga voluptatum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-14', '2017-05-14 04:17:07', '2017-05-14 04:17:07');
INSERT INTO `lesson` VALUES ('135', '4', 'Quis vero similique fugiat quia et architecto qui quo vel.', 'Debitis est sed sed at molestiae eaque quam voluptate omnis voluptatibus esse modi nemo rerum error vitae nulla nisi possimus voluptatem autem exercitationem omnis quas rem tenetur ut porro placeat est deleniti est ducimus illum suscipit a fugiat perferendis ea modi possimus molestias enim nihil voluptatem illo tempora vitae sint libero nobis quia modi saepe omnis iste eum asperiores quo est voluptas nostrum neque sequi vitae quia est quae placeat id voluptatibus fuga ducimus id autem unde voluptas illo molestiae consectetur nulla soluta dolorem sed nemo omnis deserunt exercitationem nam eum quo quidem impedit occaecati repellendus dolorem neque explicabo deserunt accusamus repellendus voluptatem porro.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-15', '2017-05-14 04:17:07', '2017-05-14 04:17:07');
INSERT INTO `lesson` VALUES ('136', '25', 'Corrupti provident culpa ex repudiandae autem reprehenderit sit ut sapiente rerum.', 'A rem delectus magni aut officia voluptas quod sunt voluptas voluptates quia temporibus amet expedita dignissimos quia ipsam ipsum beatae doloremque eum porro id veritatis aspernatur odit qui optio et vitae magnam tenetur eveniet dicta numquam sapiente est vero et similique neque voluptatibus ad delectus est voluptatibus itaque et dignissimos in vitae aut qui voluptatem mollitia ipsam labore ipsum quia et eos aspernatur voluptatem voluptas omnis dolorum libero minus atque perferendis rerum omnis consequuntur dolores saepe cum non autem quasi magni nisi reprehenderit beatae nulla cum facere nostrum aliquam eaque voluptates voluptatem fugiat necessitatibus sapiente aut quia laborum dicta quaerat modi dolores voluptate rerum sit est et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '28', null, '0', '1', '2017-05-15', '2017-05-14 04:17:07', '2017-05-14 04:17:07');
INSERT INTO `lesson` VALUES ('137', '21', 'Dignissimos voluptatem vel ea ut rerum est.', 'Distinctio qui doloremque fugit ut hic nihil suscipit nostrum minus voluptate repellat sequi optio excepturi aperiam magnam ut assumenda non impedit magnam debitis in perspiciatis dicta distinctio nostrum minus sapiente dignissimos repellendus ratione placeat est voluptatem quo maiores non est non quos non itaque aperiam voluptate qui voluptatem hic accusantium voluptatem aut ipsum aliquid consequatur architecto dolorem eum voluptatum non veritatis voluptatem distinctio ullam quo ut sint voluptas at voluptatem facilis sed illum unde voluptatibus est esse voluptatum eos nemo consequatur tempora et et a at laboriosam distinctio in quia ducimus mollitia et recusandae et excepturi qui quibusdam mollitia et itaque in nobis repellendus ipsum id doloribus perferendis ut commodi corporis enim laudantium et autem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '28', null, '0', '1', '2017-05-18', '2017-05-14 04:17:07', '2017-05-14 04:17:07');
INSERT INTO `lesson` VALUES ('138', '21', 'Velit consectetur non error velit.', 'Et vel saepe blanditiis qui rem dolor porro asperiores at occaecati quis vel aut sunt debitis et sunt mollitia minima laborum eum illum voluptas vitae quibusdam at et explicabo enim eligendi quis possimus maiores quo optio quasi cupiditate exercitationem voluptatem placeat quasi voluptatem et et non sunt vel tempora consequatur rerum sit ducimus quasi consectetur magni ipsum voluptates doloribus non quaerat quaerat facere dolor ad quae aut cum beatae architecto alias alias soluta magni ullam provident.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-15', '2017-05-14 04:17:07', '2017-05-14 04:17:07');
INSERT INTO `lesson` VALUES ('139', '29', 'Velit omnis consequatur recusandae aliquam voluptatibus amet omnis tempora harum.', 'Accusantium consequatur itaque quia minus rerum autem ea fuga facere tempora dolor aut voluptas mollitia quia nihil eius ea dicta accusamus eaque deserunt quis minus accusantium tenetur voluptates et voluptatem fugit praesentium natus facere assumenda alias corrupti et et repellendus sed quibusdam nam odio ut tempora et aliquid consequatur magnam molestiae recusandae ipsum illo explicabo et quis natus eum necessitatibus ea amet doloremque est quam voluptatem atque explicabo quo accusamus vero aut illo qui quo natus natus cupiditate est consequuntur enim error voluptas aut et molestiae dolores odio quaerat recusandae cupiditate natus aut est illo error voluptas mollitia et facere veritatis debitis dolor ex ullam mollitia eos eligendi quos.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-19', '2017-05-14 04:17:07', '2017-05-14 04:17:07');
INSERT INTO `lesson` VALUES ('140', '4', 'Ea ipsa nam repudiandae eveniet libero totam porro.', 'Molestiae ut ipsum cumque rem saepe reiciendis nihil molestiae voluptas quos numquam perspiciatis quia recusandae illo nobis iste et eligendi tenetur neque voluptate eos mollitia deserunt id ea aut est omnis est voluptatibus nihil repellendus autem velit perferendis excepturi aut rerum dolorem quae voluptatem eos ad et commodi voluptate quidem nesciunt laudantium nostrum iure numquam quia cum dolores occaecati dignissimos et distinctio sed maiores voluptate laborum deserunt aut et qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '39', null, '0', '1', '2017-05-16', '2017-05-14 04:17:07', '2017-05-14 04:17:07');
INSERT INTO `lesson` VALUES ('141', '17', 'Dolores rem aut sed blanditiis autem non.', 'Quos est odio ut expedita ullam in quis nihil et amet possimus eum eos architecto repellat dignissimos consequatur delectus quaerat quos at et in delectus sed officia est minus itaque eos qui eum odit voluptatibus dolorem commodi doloremque quod in aut quod inventore et est vel dolor est dolores et consequuntur consequatur et natus iste doloribus reprehenderit magni nam dignissimos aspernatur qui nihil laborum tempore suscipit nesciunt voluptatibus enim qui provident velit ut perferendis sed omnis vero et assumenda accusamus et rerum eos modi accusamus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-19', '2017-05-14 04:17:07', '2017-05-14 04:17:07');
INSERT INTO `lesson` VALUES ('142', '24', 'Qui quidem quasi quia sed ducimus est magnam animi maiores.', 'Voluptas libero a ex velit expedita beatae sed eum voluptas doloremque assumenda ipsa dignissimos qui officia omnis totam expedita earum dolor labore aut aut et vel in dolorem nulla occaecati fugit aut esse provident voluptatum qui ut alias maiores ratione labore vel alias est blanditiis et quae perferendis velit sit nemo atque natus voluptatem vel consequuntur aut in excepturi assumenda aliquam voluptas placeat voluptatem nulla voluptatem et consequatur iste.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-17', '2017-05-14 04:17:07', '2017-05-14 04:17:07');
INSERT INTO `lesson` VALUES ('143', '27', 'Modi perspiciatis iure porro omnis laudantium ipsam et aut et et.', 'Eum ea dolor possimus inventore quis dolores illo et ut quia placeat et neque deserunt impedit illo quia sunt quis aut omnis quos modi sint vel quisquam et voluptates ut a qui quis sit illum est et eligendi non possimus autem quos saepe magnam officiis temporibus odit repellat ad quibusdam veritatis voluptatum quis dolores aut ipsam consectetur itaque possimus a reiciendis ratione ipsa et occaecati sunt consequatur et blanditiis numquam qui velit expedita mollitia perferendis eum numquam voluptates odit aut rerum consequatur quo sit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-17', '2017-05-14 04:17:07', '2017-05-14 04:17:07');
INSERT INTO `lesson` VALUES ('144', '1', 'Vel vel est dolor amet velit dolorum nobis autem voluptatibus.', 'Adipisci et dolor et maiores aut voluptas consequuntur et consequatur aut vero est repellat earum amet aut sunt exercitationem dolore voluptatibus aut dolorem earum iusto et fugit qui veniam voluptatum ut debitis iusto voluptatem incidunt illum vel illum nesciunt dolores et voluptatibus quam recusandae consectetur iusto maiores sit quibusdam dolores ut qui labore ratione recusandae nisi sequi maiores qui fuga minus alias qui corrupti et autem magni eius fuga laborum laborum eum molestiae voluptas iusto aliquam pariatur consequatur totam optio enim velit pariatur facilis aperiam inventore magnam accusantium deserunt qui dolor vel iusto placeat.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '36', null, '0', '1', '2017-05-15', '2017-05-14 04:17:07', '2017-05-14 04:17:07');
INSERT INTO `lesson` VALUES ('145', '13', 'Necessitatibus sit explicabo dolores cupiditate recusandae necessitatibus aut.', 'Aut et quia ut et est et qui sit repellat et sed qui facilis et est quis voluptates aperiam consequuntur reprehenderit rerum inventore placeat officiis et ipsa molestiae quia voluptatem deserunt eligendi consequatur et eveniet quod cupiditate qui doloremque porro architecto nobis dolores nihil quia veritatis voluptates reprehenderit molestiae consequatur alias quisquam modi dolor dolorem explicabo fugiat in incidunt adipisci error mollitia exercitationem ratione voluptatem quod rerum ut est deserunt et officiis possimus quia dolorem animi autem ipsum eaque rem blanditiis est sint omnis dolores quas et aliquid amet architecto corrupti corrupti placeat iure.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-19', '2017-05-14 04:17:07', '2017-05-14 04:17:07');
INSERT INTO `lesson` VALUES ('146', '22', 'Minima hic quos est et saepe.', 'Ipsum et mollitia est voluptates ratione molestias culpa modi necessitatibus dolores aut perspiciatis quasi et quibusdam nobis dicta est enim eius consequatur velit velit autem odit adipisci maxime et hic cupiditate reiciendis iste odio voluptatem similique vel omnis doloremque qui sequi quibusdam debitis a saepe accusantium qui deserunt labore perferendis quis quo laudantium illo delectus sit illo vero dolor numquam architecto quis qui consequatur earum sit dolor qui et quam voluptas sit voluptatem ut et doloribus dolorum velit ea delectus asperiores id dolores nihil aut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-15', '2017-05-14 04:17:07', '2017-05-14 04:17:07');
INSERT INTO `lesson` VALUES ('147', '9', 'Officia nemo rerum id inventore aut est suscipit nihil.', 'Sed voluptas amet neque possimus nemo magnam ut dolores molestias cum voluptas voluptatibus perferendis atque omnis et dignissimos ducimus et unde magnam quo et aspernatur nemo sapiente ut maiores esse eum cupiditate dicta distinctio laboriosam exercitationem voluptas quasi distinctio corrupti reiciendis incidunt nihil rerum dolores nam dignissimos nihil quia et deserunt vitae officiis minus aperiam asperiores animi doloribus voluptatibus reprehenderit illum temporibus modi accusamus quidem quidem eveniet qui iste et autem ratione sunt in architecto consequatur dicta in et ut eum inventore ratione quibusdam quidem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '45', null, '0', '1', '2017-05-17', '2017-05-14 04:17:07', '2017-05-14 04:17:07');
INSERT INTO `lesson` VALUES ('148', '18', 'Repudiandae qui qui sint harum minima quia accusantium totam.', 'Recusandae ea eaque doloribus iusto culpa quaerat repudiandae sint non aspernatur adipisci minus hic deleniti qui beatae et adipisci dolorem optio sed amet voluptatem quasi est est deleniti totam quae voluptatem repellendus a voluptas dolores qui aut nihil necessitatibus eveniet eaque enim aut molestiae ut alias explicabo velit omnis incidunt pariatur eos officiis voluptates mollitia voluptatem recusandae autem quia voluptatem dolore provident aliquid esse hic eum maxime saepe eos atque est dolorem aut ut iure dolores cupiditate magni necessitatibus et quidem architecto rerum est et ut voluptatem doloribus odit a debitis ut eos voluptatum vel suscipit quia vero sint et quo exercitationem nesciunt quos praesentium delectus est laborum consequatur cum autem quaerat pariatur voluptas sint voluptatibus possimus minima quisquam quaerat soluta eius quidem id et similique et molestiae aut rerum laboriosam molestias impedit dolores repellat qui odit est natus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '31', null, '0', '1', '2017-05-18', '2017-05-14 04:17:08', '2017-05-14 04:17:08');
INSERT INTO `lesson` VALUES ('149', '13', 'Deserunt aperiam vel autem nemo consequuntur sunt provident facere.', 'Ea explicabo magni velit in rerum esse sed itaque expedita magnam magnam ea quae assumenda et similique et delectus est id aut ex qui modi et autem qui recusandae laudantium consequatur cum fugit est alias itaque sit voluptatem a odio et eaque facere commodi praesentium iusto minima saepe laudantium velit neque ut voluptatem nobis commodi libero adipisci repellendus sapiente omnis corrupti voluptatem quia eum minima et nesciunt quae voluptatem eos quis rerum neque vel tenetur ut vel explicabo dicta et nisi sit qui quos eum vel ducimus exercitationem non saepe est dolores perferendis quam quae exercitationem sit ut fugiat in repudiandae aut autem voluptatem et architecto est id iste rem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-16', '2017-05-14 04:17:08', '2017-05-14 04:17:08');
INSERT INTO `lesson` VALUES ('150', '18', 'Ea modi ut voluptatem cumque blanditiis omnis.', 'Minus rem ut porro quisquam enim voluptatem debitis sint atque temporibus nam reprehenderit nihil ab nesciunt minus ea qui dolores ut dolor perspiciatis nobis molestiae enim aliquam porro molestias sed tempora explicabo et dolor ullam dolor omnis quae architecto quasi et totam eos est quae harum dolorum fuga et qui corrupti et quod debitis nesciunt odit neque molestiae officiis corporis in aut illo et quos modi sit excepturi velit iste occaecati repellendus voluptatem maiores nesciunt distinctio consectetur aut quo omnis itaque voluptatem sit veniam eligendi ut sint vitae est aliquid qui nemo voluptas enim perferendis totam ad quasi praesentium ducimus veniam atque consequatur est nulla hic tempore iste aperiam rerum reiciendis mollitia qui suscipit et ab velit aut animi consequatur.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-18', '2017-05-14 04:17:08', '2017-05-14 04:17:08');
INSERT INTO `lesson` VALUES ('151', '17', 'Ullam nesciunt qui tempore ea ea itaque.', 'Eum atque reiciendis sit eos fugit exercitationem natus nihil voluptatem qui doloribus animi minus nam eos quidem qui qui ut quis nulla vel voluptas voluptas ratione nostrum eveniet et saepe a eius aut non odit ut amet numquam et eaque totam rerum distinctio accusamus itaque dolorum eius rerum est et nesciunt et dignissimos illum et iure sit quae ut porro eum sunt ab odit sit voluptatem porro laborum velit laudantium quasi rem cum nihil velit doloribus reiciendis perferendis quo aliquam sed odio voluptate pariatur est assumenda ullam nisi velit et non sed natus eos blanditiis unde laudantium nulla maxime consequatur eum voluptate accusantium atque aut itaque dolorum inventore ipsam reprehenderit praesentium quis eum fuga ut tenetur ipsa corrupti eveniet dignissimos eveniet deserunt ad tenetur nostrum autem et dolorum ab molestias repellendus minima rerum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-14', '2017-05-14 04:17:08', '2017-05-14 04:17:08');
INSERT INTO `lesson` VALUES ('152', '11', 'Eos laudantium doloremque ea quo qui nam minus.', 'Placeat ut explicabo nobis perspiciatis consequatur odit est aut eveniet est quidem ab ab est consequatur odit impedit illum qui deserunt unde molestias dignissimos nihil excepturi quo eligendi quisquam libero omnis unde velit corporis eos labore voluptates iusto esse quasi deleniti sequi et aut maiores rerum ut consequatur nihil eaque quibusdam deleniti est modi voluptatem voluptas dolorum eaque at tempora qui reprehenderit voluptatem enim quas exercitationem accusamus voluptatem eum dolorum iure tempora aut dicta quisquam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-14', '2017-05-14 04:17:08', '2017-05-14 04:17:08');
INSERT INTO `lesson` VALUES ('153', '1', 'Cum non eligendi ab necessitatibus nostrum necessitatibus aut quae autem.', 'Eius est et in at reprehenderit est asperiores accusamus itaque odit ut deleniti praesentium non ratione non delectus numquam laboriosam ipsum quos debitis sed omnis a facilis esse fuga distinctio sed et quia facilis natus distinctio at occaecati nihil iste iure iusto sit cupiditate quidem rem corrupti iure harum consequatur ipsum quod amet quod et ut modi aut ut quisquam distinctio nulla fugit qui perspiciatis laudantium voluptatibus laborum ut in voluptatem ea dolorem voluptates.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-16', '2017-05-14 04:17:08', '2017-05-14 04:17:08');
INSERT INTO `lesson` VALUES ('154', '26', 'Et excepturi illo mollitia maiores in delectus atque ex vel natus sed.', 'Facere vel velit consequatur suscipit qui est eos sapiente non doloribus dolorem facere molestiae similique aperiam officiis fuga error est tempora illum cum qui sequi facilis officia cum et veniam nihil corrupti eveniet omnis laboriosam quidem eveniet est soluta quae et sunt tempora nulla magni sit vel soluta nulla dolores quia est non suscipit ea repellat eaque mollitia quam est accusamus blanditiis ea repellendus rerum enim commodi vel facere esse rem iusto aut assumenda velit expedita fugit porro odio magnam recusandae pariatur non ad provident libero ipsum deleniti consequuntur vero est molestiae totam veniam laboriosam dolor consequuntur aut iure hic suscipit facere omnis voluptates distinctio culpa quisquam voluptatem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-18', '2017-05-14 04:17:08', '2017-05-14 04:17:08');
INSERT INTO `lesson` VALUES ('155', '10', 'Ut perspiciatis aliquid necessitatibus ab.', 'Sapiente eos praesentium et corrupti quibusdam ab sapiente aut culpa nesciunt recusandae porro quia eos repudiandae nam quia molestias placeat omnis et inventore ex doloremque itaque provident quia et sint assumenda nostrum et est est unde pariatur omnis nulla pariatur eveniet delectus ratione eius nemo provident est pariatur corrupti adipisci suscipit porro numquam ea aut sunt omnis eius architecto quo quas delectus qui aspernatur dolores voluptatem illo natus dolores accusamus autem consequuntur tempora corporis ipsum maxime consequatur quis earum velit repellendus nemo architecto alias reiciendis sapiente similique occaecati corporis blanditiis maiores aut in vero adipisci amet qui rerum rerum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-17', '2017-05-14 04:17:08', '2017-05-14 04:17:08');
INSERT INTO `lesson` VALUES ('156', '11', 'Eius aperiam aut dicta est quod quia.', 'Nemo dicta dicta omnis earum quis qui quia et aut et quia cupiditate incidunt est in qui autem excepturi dolorem ipsa tempora corporis et non et rerum nemo quae praesentium quibusdam quos ut quas dolorum quo recusandae molestiae saepe animi ut recusandae placeat possimus mollitia suscipit facilis omnis sint minima ad recusandae officiis distinctio voluptatem laudantium quis facere fuga neque omnis reiciendis consequatur molestiae enim asperiores asperiores ut nobis dolorem eligendi culpa alias repellendus praesentium nisi est eaque beatae quia cum omnis eum ea nesciunt enim voluptas ex accusantium ut mollitia doloremque dicta quia architecto doloremque aliquam id est deserunt ut magnam libero et quod occaecati iusto accusantium sunt quia alias odio ducimus officia rerum ratione rerum excepturi doloremque ea et ab.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-17', '2017-05-14 04:17:08', '2017-05-14 04:17:08');
INSERT INTO `lesson` VALUES ('157', '11', 'Qui vel velit et officiis id quo dolore laudantium veritatis cum.', 'Dolores repellat excepturi officiis similique est aut pariatur ut ut enim officia qui itaque accusantium at distinctio necessitatibus quam pariatur doloribus at ipsum laborum nesciunt repellendus recusandae voluptas sint quasi ea illo laudantium est vel dolorem iusto quaerat non voluptas voluptas animi qui quo et sit suscipit numquam quia nihil nisi magni est est eaque eveniet voluptatem exercitationem recusandae consequatur quam ipsam sed id sequi nihil sit dolores recusandae est aut a saepe consequatur reiciendis sed enim fugit consequatur dicta nulla hic non qui aut fuga suscipit et consequatur rerum rerum animi neque aut vel nobis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-19', '2017-05-14 04:17:08', '2017-05-14 04:17:08');
INSERT INTO `lesson` VALUES ('158', '30', 'Suscipit incidunt incidunt molestiae suscipit sit corrupti.', 'Quisquam dolorem aut quo non assumenda hic et repellendus neque delectus natus aliquid non ea sint eveniet ad eum vel tempore delectus dolor fugit voluptatum provident est dignissimos quo rem aut qui aut nihil voluptatem est omnis aliquam non sint eius deserunt placeat maiores quam omnis mollitia quo et eum dolor minima similique eligendi exercitationem nobis repudiandae quo esse et quo laboriosam rerum non cumque deserunt debitis quisquam sed quis delectus et modi similique neque et voluptatem totam dignissimos debitis qui quibusdam facilis dolor sed repellendus nam voluptates consequatur deleniti sequi nulla excepturi porro modi repellat nihil maiores nisi iste enim expedita est accusamus veritatis numquam voluptas autem laudantium et quisquam nihil aut sint et corrupti ipsa dolores qui tempore eum ipsum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-14', '2017-05-14 04:17:08', '2017-05-14 04:17:08');
INSERT INTO `lesson` VALUES ('159', '22', 'Voluptatem neque eveniet repudiandae voluptatem explicabo nesciunt aut.', 'Id iusto minus maiores aut reiciendis eos vel est similique molestiae itaque omnis eaque consequatur et dolore dolorem minus repudiandae consequuntur magnam quia cum quibusdam incidunt voluptas explicabo ea aut molestiae voluptas eveniet iusto natus saepe explicabo dolor non eveniet nesciunt aut magnam error ea non ad saepe consequuntur vitae nostrum esse voluptas quia optio doloribus dignissimos alias id minima voluptatem molestiae et distinctio aut aut at atque harum id possimus perspiciatis blanditiis veniam sit a ipsum ut aliquam quis maxime similique quae aut asperiores mollitia et et ipsa.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '45', null, '0', '1', '2017-05-18', '2017-05-14 04:17:08', '2017-05-14 04:17:08');
INSERT INTO `lesson` VALUES ('160', '7', 'Iure officiis nemo quis aliquid expedita recusandae aperiam est nihil sed.', 'Magnam veritatis quia ut at quaerat dignissimos voluptatibus voluptatem repellat voluptatem suscipit possimus aut sunt maxime repellendus temporibus aut maiores ut repellendus aut et numquam corporis ut et sint doloribus quam non et maxime explicabo veniam quia necessitatibus nam magni natus in incidunt ea voluptatum eum facere ut recusandae aperiam numquam ut officiis aperiam magnam perferendis officia labore consequatur et provident voluptas voluptates quibusdam voluptas sapiente impedit expedita dolore qui et commodi hic iusto molestias hic ut quam ullam accusamus adipisci ut tenetur atque saepe alias nesciunt quo vitae dolorem et molestias aut quod non velit ipsa dolor perspiciatis ducimus ut enim dolorum nam sunt placeat dignissimos accusantium dolor ullam in dolores sed quasi consequatur pariatur quas eum temporibus enim rerum voluptatibus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-16', '2017-05-14 04:17:08', '2017-05-14 04:17:08');
INSERT INTO `lesson` VALUES ('161', '18', 'Et nam molestiae et quos non vel et voluptatibus.', 'Et facere quam iure sunt quod quo saepe suscipit officiis aperiam accusantium sit ut numquam odit vitae quasi aut voluptate laborum qui debitis qui suscipit provident ipsam culpa velit suscipit error soluta est totam aut repellendus sint temporibus necessitatibus et dicta non provident doloremque at deserunt nesciunt hic qui error dolores odio quidem deleniti quam tempore maiores aliquam quae cupiditate perspiciatis enim similique quo nihil omnis accusantium laboriosam nihil dolorem quaerat est blanditiis sunt ducimus voluptate dolor quidem blanditiis doloribus dolore dolorem voluptatem omnis molestias ducimus quia quas eaque eveniet debitis vero aut ipsa placeat iure eligendi et aliquid explicabo provident dolores iusto aut et laudantium laudantium alias ut id iure aspernatur ut consequuntur fuga enim corporis nam eaque quo illum ut a suscipit minima consequatur qui quo nisi corrupti itaque veniam eos quis et repellat architecto consequatur.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '31', null, '0', '1', '2017-05-15', '2017-05-14 04:17:08', '2017-05-14 04:17:08');
INSERT INTO `lesson` VALUES ('162', '8', 'Ab culpa quis sed et et quia quidem.', 'Ullam amet sint totam debitis unde non placeat accusantium earum saepe atque omnis aperiam quod consectetur ea ullam facere vitae quas et quasi quos omnis commodi doloribus sed et non ea cumque nisi pariatur vel dolore exercitationem odit consequatur molestiae totam aut dicta accusamus excepturi et cumque est ducimus quod pariatur doloribus sed sed delectus inventore iure vero quo beatae consequatur laboriosam est suscipit eum error fugiat et saepe incidunt quod excepturi veniam qui minima perspiciatis modi modi dolores laborum dolore animi et cumque fuga in totam earum sapiente ut expedita non deserunt nobis numquam libero omnis distinctio voluptas vero dolores voluptas harum dolorem velit ad nesciunt eligendi quia sint aspernatur et dolorem et saepe ipsum aperiam voluptate autem quia blanditiis blanditiis possimus quos delectus animi veniam iste et quaerat in tenetur optio nam excepturi.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-14', '2017-05-14 04:17:08', '2017-05-14 04:17:08');
