INSERT INTO `lesson` VALUES ('164', '24', 'Eum doloribus neque eos et id est rerum aut.', 'Iure illum cum debitis impedit dolorem dolor maxime itaque est voluptatem repellat cum laboriosam fugiat qui ipsam nam debitis necessitatibus laborum voluptatem id qui et vero dicta minus voluptatem voluptatem in velit reiciendis adipisci earum repudiandae labore vitae nisi ut est corrupti laudantium quam hic vero aspernatur rerum id cumque facere nam voluptas distinctio non et dicta nam itaque dolor laboriosam eveniet excepturi et occaecati sed ratione doloremque provident odit totam ab omnis quasi et adipisci quis eos mollitia facere enim quam numquam illo qui id quod dolorem sed nobis dolore aut molestiae sunt ipsum sunt optio id accusamus eos consectetur rerum quo ut sunt facilis qui veritatis minus aut tempore dolor minus fuga distinctio dolor dolore molestiae vel delectus quas dignissimos omnis qui dolorum nulla doloremque voluptatem voluptatem voluptate et labore sed dolorem est illo aut tempore aut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '22', null, '0', '1', '2017-05-17', '2017-05-14 04:17:08', '2017-05-14 04:17:08');
INSERT INTO `lesson` VALUES ('165', '10', 'Ex est dolorum cupiditate optio nesciunt.', 'Iusto assumenda excepturi est est blanditiis omnis eum hic vero impedit eaque saepe voluptas laboriosam vel optio deserunt quaerat dolor quisquam autem quos aut sed numquam recusandae et eum accusantium voluptatem autem mollitia ab itaque nihil ullam aut quos aut repellat a dolor error et ut modi rerum ab reiciendis qui maxime omnis harum architecto dolor cupiditate itaque repudiandae nostrum minus qui ullam impedit suscipit modi quisquam deleniti dolorum vel pariatur numquam quam est quidem corrupti voluptatem cupiditate labore debitis officiis aut placeat sint possimus sint soluta non ea suscipit aut architecto.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-15', '2017-05-14 04:17:08', '2017-05-14 04:17:08');
