INSERT INTO `lesson` VALUES ('168', '4', 'Fuga veritatis eum non necessitatibus voluptatem.', 'Et sunt eum ipsum et tenetur optio sint dicta ipsa vel necessitatibus consequatur nobis totam ut rerum vel sint ipsum mollitia sit dolorem et nobis facere nulla dolorum laudantium sed voluptatem dolorum et dolorum mollitia qui voluptas aut quo reprehenderit et voluptatibus tenetur accusamus dolores aut aliquam sint enim id architecto voluptatem voluptas ut quaerat quisquam repellat ratione repellendus eligendi soluta veniam aut voluptatem vel ipsam asperiores ut vel corrupti explicabo quia sed autem aut architecto consectetur.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-14', '2017-05-14 04:17:08', '2017-05-14 04:17:08');
INSERT INTO `lesson` VALUES ('169', '5', 'Recusandae molestiae sint quo dolorum qui et.', 'Explicabo at adipisci quisquam incidunt illo aut esse illum quia nesciunt id eos eum error sequi non ut architecto ratione incidunt facere maxime iste in possimus quidem harum sapiente doloribus aspernatur quam quis qui minima reprehenderit voluptatem velit inventore excepturi molestiae accusantium totam recusandae aut eos deleniti itaque sit id aut rerum eius quia consequatur blanditiis quam possimus fugit iste sint in porro nemo et est quia exercitationem sint totam similique aut nihil sint qui eos eos et aspernatur qui rerum quis id delectus officia voluptatem laborum distinctio voluptas fugiat eum expedita perspiciatis sequi sint libero repellendus ut ea quisquam dicta autem est cumque libero aut error aspernatur facilis voluptas accusantium ad fugit dicta voluptatibus doloremque quia a sit vitae odio et placeat eum laboriosam totam facere ea ipsa quisquam aliquam a ratione quia ut nobis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '47', null, '0', '1', '2017-05-17', '2017-05-14 04:17:09', '2017-05-14 04:17:09');
INSERT INTO `lesson` VALUES ('170', '29', 'Consequatur ducimus sequi inventore eveniet omnis debitis nihil rerum quis.', 'Deserunt cumque commodi rerum libero sint voluptatibus explicabo sit quo sapiente illo atque soluta dolores sed et facilis harum porro sed doloribus tenetur ut tempora asperiores inventore sed fugit rem consequatur expedita incidunt officia consequatur corporis voluptatem nemo perspiciatis tempora vel quos est nisi non eum maxime est vero ratione enim ea praesentium quam ut quia ab at qui at voluptas nam et quo repudiandae quas unde consectetur sit ut quam error nulla ea rerum perferendis perferendis impedit autem alias deleniti dignissimos cupiditate et commodi ut ut corporis voluptates et corporis possimus officia deserunt officia mollitia aut corporis quia est natus doloremque quia aut consectetur vero aliquam tempore totam minima illum aut blanditiis eum eum qui repellendus quia sit animi est minima est iste inventore voluptatem occaecati quas nulla excepturi earum fugiat.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-17', '2017-05-14 04:17:09', '2017-05-14 04:17:09');
