INSERT INTO `lesson` VALUES ('173', '9', 'Rerum ut et voluptatem et tenetur veniam cum.', 'Ut labore rerum a dolor magnam aut explicabo ea magnam veniam ea sunt esse voluptatem provident temporibus quam provident quibusdam officia a quae qui dolores amet eveniet ea et cumque porro possimus velit nihil enim fuga ratione voluptas nulla maiores est et culpa delectus voluptatem facere id nihil nisi eius nihil aut est alias ullam sapiente minima quasi qui ipsum et non commodi omnis dolorum ut ullam dicta culpa ut architecto expedita est delectus repellat voluptatum necessitatibus eveniet dolores et quisquam modi voluptate fuga et nisi officiis et eaque pariatur iure sint exercitationem harum aut inventore ipsa quidem voluptatibus laboriosam quae sed enim id aut non nulla totam minus fugiat et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-19', '2017-05-14 04:17:09', '2017-05-14 04:17:09');
INSERT INTO `lesson` VALUES ('174', '27', 'Natus ut voluptatem laudantium iusto rerum iusto qui quo in.', 'Quo non impedit possimus iusto et necessitatibus eligendi illum labore magnam saepe et sunt ea hic repellendus sequi incidunt aut magni magni quis earum ut est quo minus fugiat doloremque accusamus eius ipsa sit placeat sit iusto dolores dolores qui eos et ea occaecati est ad adipisci minus dicta eum hic et iste aut accusantium non cum optio iusto commodi eveniet aperiam voluptatem provident esse maiores qui temporibus sint aliquid id qui modi voluptatem aliquid aut officiis nisi sed voluptate dolores harum tempora ab officia illo quasi cupiditate repellendus incidunt iste quia et ut labore tempora sit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-16', '2017-05-14 04:17:09', '2017-05-14 04:17:09');
