INSERT INTO `lesson` VALUES ('177', '3', 'Ut asperiores autem sint corrupti magnam.', 'Ipsum corporis aliquam magni magni est dolor porro ipsum mollitia perspiciatis delectus in aut eius et dolor aspernatur laudantium doloremque veniam praesentium omnis omnis nihil a tenetur harum sunt autem quaerat molestiae perspiciatis voluptatem nemo omnis qui corporis distinctio ut et provident quia quibusdam suscipit consequatur aut et nisi deserunt dolor voluptas enim aut rerum provident nisi porro doloremque numquam vel alias at laborum omnis ipsam molestias alias ullam inventore rerum totam adipisci placeat exercitationem debitis omnis et molestias molestiae aperiam minus aliquid totam ipsam quas eos beatae odit non et repellat et consectetur iure facilis optio eos impedit consequatur et libero omnis velit minus qui eveniet repellat in atque sapiente maxime magni animi natus sit natus voluptas ut iste omnis numquam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-18', '2017-05-14 04:17:09', '2017-05-14 04:17:09');
INSERT INTO `lesson` VALUES ('178', '14', 'Quos nesciunt vitae non sed cumque.', 'Ut non consectetur accusamus ut praesentium voluptate dolorum quia non ut qui commodi id officiis perspiciatis saepe voluptas odit ullam a ex minima vel et non dolor tempora iusto neque enim ab dolorem sit atque sit enim quasi quasi est porro tenetur provident et quia possimus illo occaecati dolores accusamus vitae quae et quia ut ab earum aut fugit sit incidunt repellendus ut ad ipsa quia est aperiam quos laudantium corrupti minima distinctio quas aut reprehenderit quasi tempore corrupti reprehenderit aspernatur recusandae aut fugit incidunt tenetur quasi ut molestiae est assumenda necessitatibus et possimus in eum nisi et perferendis alias in illum non qui et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-14', '2017-05-14 04:17:09', '2017-05-14 04:17:09');
INSERT INTO `lesson` VALUES ('179', '19', 'Libero natus ab dignissimos hic aut iste aut a et reiciendis.', 'Et adipisci libero dolores occaecati consequatur unde beatae vel aut et consequuntur inventore molestiae repudiandae numquam iusto et hic dolorem et dolorem et ipsum ab sint voluptas accusamus animi tempore aperiam libero atque recusandae voluptate explicabo molestiae harum quibusdam aliquam cum illo quia similique quisquam cupiditate reprehenderit autem est hic exercitationem vel est facere natus quo eum id ab sunt aperiam accusantium ullam possimus omnis veritatis sed molestiae qui occaecati soluta quasi dolor ipsa eos ea eum consequatur eligendi sint ea autem et et est consectetur est distinctio qui quo modi enim commodi fugiat natus harum quia quis expedita ut aut placeat.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-18', '2017-05-14 04:17:09', '2017-05-14 04:17:09');
INSERT INTO `lesson` VALUES ('180', '8', 'Ut in qui dicta qui est in molestias inventore eligendi.', 'Deserunt perspiciatis sed porro a laborum nulla est quos aliquid natus earum autem similique ab eum et recusandae dolor quia inventore et consectetur optio delectus in qui sed enim eveniet sed expedita a ea ea architecto inventore voluptatibus qui ab odit dolores sed officia delectus voluptas earum perferendis quis labore provident fugit et animi distinctio in quia maiores autem assumenda officia ipsam sit et cum qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-16', '2017-05-14 04:17:09', '2017-05-14 04:17:09');
INSERT INTO `lesson` VALUES ('181', '27', 'Quas qui officiis dolorum rerum praesentium voluptas laboriosam expedita in.', 'Et et est id asperiores sint sit id molestiae ratione nam qui eum debitis dolores rerum quia ratione nesciunt non deserunt voluptatem molestias est sed nihil voluptate sed omnis dolores laborum reiciendis non libero deserunt impedit repellat ratione voluptas cumque amet quos fugit illo dolores est aut quo quo id odio officia dignissimos sit doloremque vero aperiam delectus omnis maiores eius sit commodi et et nihil laboriosam at ducimus aut ipsam praesentium est saepe eaque et expedita eligendi ea quisquam aut consequatur provident laborum sed excepturi explicabo molestiae et nesciunt rerum esse quidem nihil ut quidem et quis molestiae pariatur deleniti sint rerum et reiciendis esse veniam soluta repudiandae facere sit nesciunt veritatis harum beatae quod voluptatem accusantium non earum sunt veniam architecto ut in debitis delectus exercitationem qui et laboriosam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-16', '2017-05-14 04:17:09', '2017-05-14 04:17:09');
INSERT INTO `lesson` VALUES ('182', '25', 'Similique in impedit iure eos optio dolore sint fugiat.', 'Quibusdam minima minus voluptatem incidunt voluptatem adipisci aut recusandae voluptatibus sed soluta molestiae qui aliquid sequi eligendi inventore aut tenetur laboriosam officia atque modi ut excepturi deserunt est quia quos veritatis vero fugiat vero ipsum consequatur voluptas corrupti ipsa et magnam ab aliquid natus ullam et non vitae consequatur architecto sint et velit pariatur esse natus dolorem corrupti qui assumenda eum laborum voluptatem tempore eligendi commodi optio tempora ipsum consequatur placeat ut aut quas voluptas veritatis suscipit officiis quasi omnis dolor fugiat a recusandae animi eum culpa consequatur vel ut dolor dolorem asperiores ut molestiae sint qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-19', '2017-05-14 04:17:09', '2017-05-14 04:17:09');
INSERT INTO `lesson` VALUES ('183', '11', 'Reiciendis sed esse neque rerum facere totam sed voluptate est dignissimos quod.', 'Possimus cumque voluptatem et quae facere sunt non accusantium sed et aut labore animi repellat praesentium perferendis ut et tempora dolorem eaque eos ipsam modi nemo esse deserunt aperiam deleniti dolorem non eligendi molestiae nemo ipsam dolor ducimus accusamus aut eius tempore sit adipisci dolorum debitis optio et aliquid eos laborum ut iure expedita eum quia maxime esse corrupti maiores a explicabo consequatur veniam ut velit rerum ipsa suscipit esse autem id omnis dolores consequatur molestiae ad culpa qui et aut nesciunt inventore quis rem maiores qui enim reprehenderit voluptates ipsa enim maxime quam laudantium natus quisquam mollitia velit in molestiae tenetur sunt debitis dolores voluptatibus molestiae et fugit optio et consequatur minima nihil nemo rerum provident possimus voluptatem aut debitis neque aut laudantium autem animi perspiciatis officia sit vero et odio ut tempora fugit et accusantium architecto est.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-18', '2017-05-14 04:17:09', '2017-05-14 04:17:09');
INSERT INTO `lesson` VALUES ('184', '23', 'Quibusdam nostrum ullam reiciendis rerum impedit eveniet.', 'Omnis aut aspernatur ea ex explicabo molestiae soluta debitis nulla ea qui rerum consequatur sint ut amet et eos porro necessitatibus quo quod quo occaecati eos sit repudiandae dolorum magni incidunt et sint consequatur ut eum aliquam iste voluptate illo hic cupiditate mollitia enim omnis odio in quae corrupti praesentium atque fugit dolorum maiores aliquid autem aut sunt dolores earum sit quaerat totam aut qui totam natus rem enim sit vel sint distinctio nobis et deserunt reprehenderit iure qui mollitia tempora et necessitatibus explicabo ut nobis earum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-16', '2017-05-14 04:17:09', '2017-05-14 04:17:09');
INSERT INTO `lesson` VALUES ('185', '4', 'Commodi totam sit et cum quia quos asperiores hic facilis.', 'Quia sapiente consequatur quae necessitatibus asperiores deleniti quidem esse maiores ipsam aut architecto quae odio totam voluptatem molestias recusandae eaque voluptatibus occaecati quisquam repudiandae et vel quis rerum delectus ad autem earum et qui modi mollitia ut consequatur quae atque quos eum modi in autem porro sint molestiae est et sed explicabo ipsum autem ipsam numquam ea voluptas nobis hic minima ipsum mollitia inventore ullam consequuntur natus reprehenderit dolor nesciunt dolor veniam maiores cupiditate omnis similique est ipsum sequi quod.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-14', '2017-05-14 04:17:09', '2017-05-14 04:17:09');
INSERT INTO `lesson` VALUES ('186', '29', 'Consequuntur laborum quia aut exercitationem et perferendis non repellat est repellat.', 'Et eveniet ea minima pariatur voluptatem sit officiis soluta aut porro enim et tempore omnis qui velit deleniti ut placeat quam odit magni eum quidem est blanditiis deserunt vitae nam earum omnis aliquid mollitia atque voluptatum ullam exercitationem nemo rem quo commodi at repellat animi iusto veniam ut ut dolorem magnam omnis earum a id debitis voluptatum enim mollitia eum quibusdam harum voluptas non sunt perspiciatis labore qui asperiores sapiente debitis est neque et aut maiores aut molestiae eum ut unde qui recusandae tenetur ipsum est pariatur aperiam mollitia nesciunt velit modi rerum cupiditate asperiores provident cumque accusantium enim ut officiis molestias ut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-16', '2017-05-14 04:17:09', '2017-05-14 04:17:09');
INSERT INTO `lesson` VALUES ('187', '30', 'Aut voluptatem nam et ut eos quo ipsam.', 'Aut voluptatum nisi animi blanditiis possimus distinctio aut nesciunt beatae dolorum minus cumque ipsum perspiciatis neque dolorum molestiae ducimus quas officiis ut qui quo doloremque ratione voluptatem repudiandae quia dignissimos autem dolor explicabo nobis quia temporibus architecto quo dolor sed veritatis nihil aut ut ut ipsa mollitia quod reprehenderit qui iusto unde quia minima unde ut odit nisi ipsam et eos non ea itaque consequuntur corrupti dignissimos reiciendis voluptas id error dolor repudiandae ut excepturi distinctio maiores non placeat dolorem optio quam ut molestiae et vel vel qui reiciendis dignissimos corrupti nam ut aut nesciunt voluptates quas aut eligendi sed non.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-17', '2017-05-14 04:17:10', '2017-05-14 04:17:10');
INSERT INTO `lesson` VALUES ('188', '11', 'Sed et eaque deleniti qui magni enim vel.', 'Maiores vero et quasi nesciunt voluptates molestiae molestiae assumenda aut unde et optio rem nam sapiente nihil dicta molestias eos voluptatem omnis repellat esse voluptate incidunt consequatur quo qui voluptas quasi et vel eaque quos dignissimos quam et debitis dolore et non doloribus est quasi quae quia nisi temporibus est nemo velit aperiam et reiciendis asperiores optio inventore neque aliquam totam temporibus provident cumque temporibus ea voluptatem quos sunt commodi doloribus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-16', '2017-05-14 04:17:10', '2017-05-14 04:17:10');
INSERT INTO `lesson` VALUES ('189', '8', 'Adipisci tenetur tempora velit vitae animi qui asperiores sequi non dolor.', 'Non omnis voluptas in ex velit ad suscipit molestiae aliquid incidunt facilis aut cumque voluptatem dolorum ad vel quam facere ut sed repudiandae architecto aut provident distinctio occaecati nihil eveniet dolorem saepe nisi natus cupiditate et omnis in deserunt repudiandae ut odio corporis ut quaerat soluta mollitia autem fugit earum eveniet veniam autem mollitia ab esse accusantium eos voluptas est aut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '39', null, '0', '1', '2017-05-15', '2017-05-14 04:17:10', '2017-05-14 04:17:10');
INSERT INTO `lesson` VALUES ('190', '1', 'Rerum blanditiis autem harum amet et dolorem fugiat incidunt pariatur.', 'Ut inventore non consequatur molestiae quo ea rerum at facere laborum molestiae magnam soluta dolores sapiente earum sed perspiciatis perferendis porro sed ut dignissimos facilis sit ut saepe aut porro quia inventore iure delectus perspiciatis molestiae amet beatae expedita quaerat ut a nesciunt voluptatem ea explicabo qui atque doloribus consequuntur maiores perferendis nam dolore ut molestiae necessitatibus occaecati laborum aliquid error quo et omnis aut incidunt deserunt molestiae deleniti soluta qui pariatur in facilis est sit est et sit quos incidunt ab temporibus qui tempore at dolorem qui inventore qui ad rerum inventore.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '31', null, '0', '1', '2017-05-18', '2017-05-14 04:17:10', '2017-05-14 04:17:10');
INSERT INTO `lesson` VALUES ('191', '24', 'Quaerat labore quo illo voluptatem id beatae vel ad.', 'Et eos nobis atque odio quas nisi aut perferendis non et provident quam nihil omnis rerum sed qui voluptatem eum nihil laboriosam quae nesciunt cupiditate illo deserunt error voluptas quia pariatur rerum omnis officiis officia magnam in corporis aut quia iure qui sint vel non animi non et explicabo a molestiae eveniet aut illo deserunt quia aperiam quia id et ipsum rem quos voluptatem consectetur ea harum itaque molestiae soluta et qui sapiente iusto fugiat et qui praesentium et consequatur est incidunt numquam mollitia excepturi architecto et eos est maiores nostrum veniam pariatur ab ut nobis incidunt veniam ad harum facilis molestiae placeat atque pariatur repudiandae ullam porro eligendi error numquam quia omnis est molestiae qui nesciunt et non repellendus modi et repudiandae impedit laboriosam non magni autem nesciunt maxime quas accusamus quibusdam atque incidunt et aut veritatis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-18', '2017-05-14 04:17:10', '2017-05-14 04:17:10');
INSERT INTO `lesson` VALUES ('192', '23', 'Sit ut voluptas assumenda nulla provident.', 'Nulla corporis corporis maiores nam et ducimus nesciunt nostrum nobis vitae nostrum optio ullam ex eos ex aut consectetur ut voluptatibus ipsam praesentium ut ab nisi sed odio asperiores id quia veniam autem omnis beatae exercitationem maxime voluptate nobis dolore consequatur ad veritatis animi quia sit ut quo qui incidunt officia aut quia voluptate accusamus tempora est id adipisci omnis eveniet eos eveniet cumque voluptates accusamus ea nobis sed voluptate expedita quidem ut architecto alias voluptatem eveniet alias possimus exercitationem perferendis repudiandae vitae non omnis quae repellat perferendis delectus aut sunt cupiditate provident reiciendis maxime dolores rerum officia enim cum aut reiciendis ut quis soluta praesentium voluptatem laborum repellendus unde et modi qui iure doloribus dolorum voluptas illum sunt et eum nisi praesentium illo quam temporibus odit consectetur maxime consequuntur labore repellat hic.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '30', null, '0', '1', '2017-05-15', '2017-05-14 04:17:10', '2017-05-14 04:17:10');
INSERT INTO `lesson` VALUES ('193', '12', 'Veniam numquam modi illum minima assumenda omnis accusantium.', 'Quae porro nostrum laudantium esse quo ducimus dolor blanditiis culpa perspiciatis quis reiciendis dolores est reprehenderit doloremque harum corporis ex quidem voluptatem architecto nobis placeat est qui vitae quas voluptates aperiam quaerat voluptates omnis consequuntur fuga officiis voluptate expedita sunt eaque eos ipsa rerum ea dolores expedita recusandae impedit ducimus laboriosam exercitationem occaecati et culpa in laboriosam delectus culpa molestiae sapiente iure quia et eaque rerum iure est inventore deleniti voluptatem voluptatem rerum laborum rerum aut quasi laboriosam nesciunt similique quisquam neque quibusdam ratione dolorem porro sapiente quisquam et explicabo minima dolorum nemo aut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-18', '2017-05-14 04:17:10', '2017-05-14 04:17:10');
INSERT INTO `lesson` VALUES ('194', '22', 'Eos eius iure recusandae voluptates molestias cum unde quo.', 'Quas deserunt et excepturi consequatur non perspiciatis id est id omnis quod quaerat praesentium reprehenderit dicta eius minus eum et maxime qui sed incidunt cumque aut qui iure hic nostrum beatae ratione labore quod voluptatum ullam est impedit eius dolor ea et laborum sed velit voluptatem facilis eaque praesentium magni quis enim eligendi hic voluptatem necessitatibus modi cum tempora consequatur dolorem maxime ut quia nihil ut blanditiis autem iusto doloribus est rerum et maxime nobis unde est dolor tenetur eligendi id quaerat laboriosam voluptatum mollitia laborum eaque totam in quisquam pariatur sed et rerum magnam eos laborum aliquid recusandae porro dolor repellat voluptatem quo sint aliquid laboriosam laboriosam veritatis est distinctio quo facilis vero harum saepe.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-19', '2017-05-14 04:17:10', '2017-05-14 04:17:10');
INSERT INTO `lesson` VALUES ('195', '14', 'Consequatur voluptatibus optio blanditiis ut aut sequi quos.', 'Eius facilis qui eius quis eaque consequatur dolor fuga exercitationem doloremque eos quia eum quis vel architecto consequuntur eos minima adipisci similique aliquam autem voluptatibus autem quo nesciunt aut vitae repellendus eius cumque adipisci dolorum provident aut voluptates suscipit et aliquam est distinctio reprehenderit rerum quasi reiciendis iure necessitatibus facere atque recusandae sit error atque sequi labore corrupti quas alias ut sed inventore expedita quod quam et maiores sed voluptas inventore hic molestias reprehenderit architecto architecto officiis eos porro alias et sit libero voluptatem consequatur similique voluptatem quam quis quod deserunt doloremque iure sunt qui natus ex quis consequatur magni et est est est aut deleniti rerum eius dolore omnis soluta laudantium autem recusandae vel corporis est sint hic doloremque placeat sed quia voluptas quibusdam exercitationem voluptatem eius aut et quae dolore enim doloremque veritatis illo quod.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '20', null, '0', '1', '2017-05-18', '2017-05-14 04:17:10', '2017-05-14 04:17:10');
INSERT INTO `lesson` VALUES ('196', '13', 'Perspiciatis aut eaque aliquid quas corporis ea aspernatur.', 'Voluptas nostrum a quia ut rerum sapiente repudiandae harum officia adipisci eum eveniet quasi quo modi consectetur id provident consequatur tempora repudiandae cupiditate a molestias earum voluptas non perspiciatis eligendi doloribus consequatur cupiditate est quis asperiores et eos accusantium blanditiis nihil et quos maiores quaerat quibusdam exercitationem assumenda cupiditate iste fugiat quidem quaerat voluptas corporis iste ullam assumenda dignissimos enim adipisci dolor distinctio quo molestias est reprehenderit eum maiores odit voluptas quisquam laudantium eos quasi culpa consequatur vero doloribus fugit omnis perspiciatis autem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '20', null, '0', '1', '2017-05-15', '2017-05-14 04:17:10', '2017-05-14 04:17:10');
INSERT INTO `lesson` VALUES ('197', '3', 'Quaerat deleniti eos fugit blanditiis ea expedita.', 'In sapiente adipisci earum iusto omnis vitae quisquam non fuga suscipit enim et dolorem nemo voluptates quae pariatur nesciunt illo perferendis dolore vero id sit optio ratione iste corrupti minima nobis dolorum sapiente cum beatae aliquam sit optio suscipit ut reiciendis est molestiae vel incidunt asperiores ducimus libero alias unde et doloribus soluta rerum assumenda quae aut deserunt quibusdam sit voluptatem aut qui sed ut quam culpa qui perspiciatis at deleniti veniam possimus culpa nemo est totam est eos officiis consequatur ut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-15', '2017-05-14 04:17:10', '2017-05-14 04:17:10');
INSERT INTO `lesson` VALUES ('198', '30', 'Recusandae ex dolor incidunt possimus consectetur.', 'Deserunt error cum earum quo quasi et ipsam et beatae iure laborum ea quos voluptatem iure distinctio et repellat saepe corrupti sapiente suscipit velit sequi ut minima aut qui dolorem consequatur dignissimos ex tempore labore odit sed similique impedit consectetur possimus iusto fuga enim nesciunt eos illo cumque minima eligendi possimus voluptatem nihil aspernatur corrupti labore qui rem quo dolore ea voluptates adipisci voluptate eligendi vel cum ad optio accusantium nemo vitae rem quia impedit eligendi cum odio nostrum illum sunt qui doloribus voluptas voluptatibus ea veritatis minus voluptates aut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-14', '2017-05-14 04:17:10', '2017-05-14 04:17:10');
INSERT INTO `lesson` VALUES ('199', '15', 'Atque eum aut magnam non repellendus libero laborum possimus aut.', 'Quam vitae totam aut sunt velit aut aut enim omnis qui aut est ea similique sint distinctio omnis voluptatum consequatur ad natus aperiam sit tempore maxime possimus voluptate qui fugit pariatur officia illum qui et et necessitatibus maxime aut officiis quam omnis ipsam corrupti velit voluptate aut assumenda a ut voluptatum voluptatem exercitationem mollitia deleniti dignissimos odit sed voluptatum vero nihil commodi id ab omnis distinctio et adipisci autem autem repellat cum aspernatur ut sapiente et ullam similique dolorem doloremque tempora et et natus voluptatem numquam mollitia maxime quaerat dicta doloribus non atque quia dicta iusto.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-18', '2017-05-14 04:17:10', '2017-05-14 04:17:10');
INSERT INTO `lesson` VALUES ('200', '28', 'Est illum officiis dolorem impedit.', 'Recusandae ut harum dicta fuga delectus quia rerum voluptatum et voluptatem quia consequatur et quia rem est fugiat corrupti nam dolore qui ut eius porro iusto doloribus voluptatibus atque et quia id porro repellat qui et quisquam fuga voluptatum nisi aut sed eos culpa dolore eligendi quae occaecati repudiandae aspernatur iusto adipisci et autem voluptas sit quaerat voluptates ullam quod voluptas ex beatae voluptatem corporis est reprehenderit laborum voluptas repellendus sint aut consequatur error voluptatem voluptatibus quas sed est iure cupiditate nihil facere eum voluptatem dignissimos nihil sit autem recusandae repudiandae quaerat autem aut error eos dolorem nihil.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-16', '2017-05-14 04:17:10', '2017-05-14 04:17:10');
INSERT INTO `lesson` VALUES ('201', '28', 'Temporibus quis voluptate vitae architecto consectetur nisi vitae qui laborum.', 'Sint id nihil corporis nemo sit ipsum enim blanditiis blanditiis qui numquam quam ipsam modi ut vitae hic vel accusantium earum debitis accusamus sunt animi temporibus ipsa ea corrupti alias mollitia odio est officia aut ea soluta in ipsa quia aut velit labore corporis molestiae suscipit nihil blanditiis officia quos eum quae culpa veritatis quia nesciunt facere at quasi illum amet mollitia at qui dolorum et mollitia aliquam numquam corrupti voluptatem aut quia et tenetur nemo recusandae architecto iusto et dignissimos provident qui aliquid nihil est quas deleniti expedita quam doloremque placeat omnis ut aperiam commodi sed quam repellendus consectetur et non veritatis hic minima sunt dolor cumque labore dolor.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '47', null, '0', '1', '2017-05-16', '2017-05-14 04:17:10', '2017-05-14 04:17:10');
INSERT INTO `lesson` VALUES ('202', '29', 'Dolor et non possimus debitis officiis.', 'Ex sapiente et commodi est quasi libero laboriosam autem amet itaque ullam esse reprehenderit harum aliquid necessitatibus in totam nisi officia quisquam quisquam qui fugiat occaecati consequuntur sit placeat sapiente eos et iste et culpa ut asperiores odio ipsum provident possimus iure possimus eveniet expedita culpa laudantium ut aut ea placeat itaque necessitatibus dicta eum ut ea aut tempora quia fugiat hic sed voluptatibus vel rerum accusantium omnis voluptas occaecati non inventore veritatis sunt dolorem culpa perferendis veniam sed voluptas nemo nulla vero illo labore quia delectus qui tenetur aut et molestiae nostrum quis pariatur id aut facere placeat id quod quos quisquam omnis consequatur minus rerum modi corrupti amet perferendis cupiditate doloremque harum doloremque praesentium expedita adipisci libero recusandae repellendus qui labore unde atque voluptatem natus quia et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-19', '2017-05-14 04:17:11', '2017-05-14 04:17:11');
INSERT INTO `lesson` VALUES ('203', '11', 'Numquam voluptatem qui nesciunt neque est praesentium repudiandae sapiente dolorem voluptas beatae.', 'Eum earum veniam fugit asperiores doloremque ut cum ratione aut explicabo totam voluptatem minus eaque aspernatur vitae consequatur consequatur inventore rerum expedita praesentium sunt aliquid ut dolor magni aut qui vero saepe dignissimos illo ad voluptatum animi ipsam consectetur ut libero dolorum in ducimus ipsum autem ut velit eos earum sed corrupti iure iste ratione odit harum aut enim fugiat molestiae molestiae dolorem consequatur ut nostrum vitae sapiente et aliquam ea tenetur dolorem ea ducimus nihil id dolor non placeat et dolor dolorum enim voluptas.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-17', '2017-05-14 04:17:11', '2017-05-14 04:17:11');
INSERT INTO `lesson` VALUES ('204', '16', 'Dolor esse quam expedita consequatur unde voluptatem ex harum.', 'Placeat dolorem impedit alias facere est doloribus sint molestias nisi voluptatum eligendi eius quis voluptate ut id voluptatum perspiciatis cupiditate molestiae veniam libero quisquam iusto cupiditate libero recusandae nihil aliquam minima temporibus autem voluptates aut facere facere architecto blanditiis enim quidem inventore consectetur et iste consectetur dolores ipsum id repellat pariatur est commodi laborum cumque excepturi unde facere unde voluptas libero soluta minus repellendus itaque assumenda voluptate minus ut quos in qui at ullam illo neque minus reprehenderit modi sequi pariatur omnis consequuntur dolores iure voluptatibus vel possimus numquam molestias nostrum ullam sint qui omnis corrupti dolorem omnis labore voluptas voluptates impedit sunt optio sit quis molestiae iure harum unde sint nobis voluptatem fugit eos aut est illum voluptas quis eius eum et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '45', null, '0', '1', '2017-05-17', '2017-05-14 04:17:11', '2017-05-14 04:17:11');
INSERT INTO `lesson` VALUES ('205', '11', 'Eius odit ullam rerum ullam maxime voluptatem voluptatibus aliquam et.', 'Voluptatem ratione eum et eligendi aliquam vero facilis ipsam enim modi perferendis nobis et ut et sit voluptate quo vitae nulla non dolorum magnam quasi corrupti ea nam temporibus laborum consequatur eum ut consectetur asperiores voluptates dolorum assumenda nihil ut velit consequuntur sunt ipsam reiciendis vel quo odio itaque omnis molestiae perspiciatis velit veniam aliquid corporis officia corrupti non impedit maxime et est sit eius accusamus minus id adipisci numquam quia voluptatem qui qui esse laudantium excepturi quas et autem et eius accusamus vel non quia rerum sapiente velit in saepe perspiciatis et debitis unde.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-14', '2017-05-14 04:17:11', '2017-05-14 04:17:11');
INSERT INTO `lesson` VALUES ('206', '2', 'Et omnis autem aliquam architecto.', 'Unde voluptas facilis enim cumque est eum ut laborum culpa rerum ea quis perferendis sapiente corporis omnis quibusdam quod id voluptatem aut maiores voluptas voluptatem maxime saepe ullam sit commodi esse excepturi fugit nulla nesciunt at voluptates reiciendis est pariatur et corrupti numquam odit corrupti perspiciatis consectetur veniam eum porro ea quaerat illo quam commodi aspernatur dolor eligendi asperiores facere sit vero totam fugit hic commodi aut ex ea enim magnam saepe rerum fugiat architecto dolor tempore reprehenderit autem odio ad sit ducimus maiores consectetur eos quibusdam voluptatibus quo et et perferendis possimus molestiae magnam est est qui quae soluta cum et expedita iusto maxime.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-14', '2017-05-14 04:17:11', '2017-05-14 04:17:11');
INSERT INTO `lesson` VALUES ('207', '3', 'Tenetur laboriosam libero assumenda saepe et qui veniam accusantium quae dolore.', 'Eum ad eos quibusdam nihil illo aut mollitia consequatur eligendi animi vitae maxime atque quas molestiae molestiae dignissimos aut voluptatum voluptatum reprehenderit hic ducimus nihil quibusdam quidem repellendus ipsa consectetur reiciendis veniam hic qui id et repellendus et aliquid qui dolorem iusto ratione dolorem repudiandae tempore earum corporis laboriosam et quas occaecati aut necessitatibus sit repellendus deserunt sed blanditiis sed cumque maxime perspiciatis ullam atque voluptas maxime amet consequatur eaque asperiores cupiditate sequi aut harum ipsam et similique et dolor nihil consequatur temporibus sunt et vero nemo sapiente ut assumenda voluptatem a est suscipit quis sunt similique fuga.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '42', null, '0', '1', '2017-05-16', '2017-05-14 04:17:11', '2017-05-14 04:17:11');
INSERT INTO `lesson` VALUES ('208', '20', 'Numquam culpa nemo id ipsa debitis dolores et dolor pariatur adipisci.', 'Inventore qui ut recusandae quis sunt voluptas et qui inventore voluptatibus officiis eligendi veniam enim animi nobis aut molestiae voluptatem id non explicabo animi nihil quo rem repudiandae sunt aperiam est optio facilis expedita odit est autem impedit amet aspernatur aut ad quas nostrum pariatur ex fugiat itaque alias neque id ut aut voluptatum sunt aut rerum id perferendis et placeat quis esse dolor praesentium qui autem facere nesciunt exercitationem nostrum possimus placeat sunt aut praesentium et sed perspiciatis vitae doloribus reprehenderit enim dolorem molestiae dolor accusamus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-16', '2017-05-14 04:17:11', '2017-05-14 04:17:11');
INSERT INTO `lesson` VALUES ('209', '23', 'Ea libero cupiditate perferendis excepturi cupiditate a est voluptas aut.', 'Vero aliquid velit quod expedita beatae temporibus nostrum dolor labore deleniti sapiente reprehenderit voluptas delectus dolore recusandae dolores necessitatibus repellat vel voluptatem facere recusandae occaecati est dolor magnam voluptates atque vero ipsa illo quo enim maiores nobis dolorem ea dolore qui provident suscipit nemo aut ut sint perspiciatis tempora est ut dolores repudiandae dolorem eveniet in asperiores ut voluptas qui asperiores voluptatem ut quasi iure dicta eos qui libero cum voluptatum quia quia necessitatibus voluptatem dolorem tempora labore reprehenderit asperiores molestiae saepe nihil inventore dolorem veritatis corporis perferendis autem fugiat nam modi exercitationem et quidem ab aut quisquam dolorem voluptas reiciendis voluptatem a beatae repudiandae ratione non assumenda voluptatem rem voluptas nobis nemo rerum soluta id autem blanditiis hic numquam sed sed exercitationem unde aut animi atque voluptate officia et similique quaerat ab est et nihil neque inventore.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '28', null, '0', '1', '2017-05-16', '2017-05-14 04:17:11', '2017-05-14 04:17:11');
INSERT INTO `lesson` VALUES ('210', '25', 'Nihil laboriosam quidem consequatur sed enim nulla voluptate amet cumque.', 'Qui ex id maxime voluptatem non occaecati modi est itaque quam et laborum aut illum est incidunt et quisquam non et quaerat et dolorum non blanditiis totam aspernatur ea vel neque quis suscipit hic ad rerum quia nesciunt qui amet earum fugiat temporibus veniam occaecati ad dolores blanditiis ea rerum quo sit nam repellendus est doloremque in tempora nisi ullam quas eaque aut quam dignissimos aut eos est unde cumque modi ea voluptates et voluptatum quia officiis esse sequi laudantium vero nisi esse explicabo enim sit ut laudantium ut architecto nobis ut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '39', null, '0', '1', '2017-05-15', '2017-05-14 04:17:11', '2017-05-14 04:17:11');
INSERT INTO `lesson` VALUES ('211', '18', 'Ut nostrum amet consequatur exercitationem cumque nam et.', 'Distinctio excepturi nemo velit necessitatibus et nobis vel sit voluptatibus magni qui iste reprehenderit et hic omnis unde quas omnis quia aperiam impedit et animi non corporis minus voluptatem dolor earum rerum est et non odio at dolor consequatur sit asperiores velit eum architecto accusantium dolores ut aut cum officiis excepturi non totam quam velit et exercitationem nemo sed eius accusamus quaerat ut voluptas ut molestiae quaerat deleniti ratione occaecati accusamus et rerum qui et et error sit officia quo consequatur autem laudantium minima laborum illo perferendis dolore eius laudantium voluptatem adipisci recusandae sit ipsam a error est corrupti explicabo dolores eligendi beatae quia consequatur amet commodi illo eum esse.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-18', '2017-05-14 04:17:11', '2017-05-14 04:17:11');
INSERT INTO `lesson` VALUES ('212', '9', 'Sit quia enim quia id laborum nobis.', 'Non non in aperiam nulla consectetur dolorem voluptatum asperiores facilis veritatis eum voluptatem sit necessitatibus unde quidem inventore qui perferendis rem et pariatur odio eveniet porro earum quam delectus veritatis nemo qui et eligendi numquam eveniet laboriosam quo nobis dolorum ut dolorem vitae sed sequi temporibus illo facilis qui et est impedit nam illum qui ducimus voluptatibus aut iure nemo quis consequuntur enim tempora nam numquam earum incidunt ratione laboriosam illum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-19', '2017-05-14 04:17:11', '2017-05-14 04:17:11');
INSERT INTO `lesson` VALUES ('213', '17', 'Maxime vel sint similique libero est delectus necessitatibus libero maxime sapiente.', 'Quo sint tenetur tenetur aut ut iste natus minima aperiam repellat impedit est et qui quam qui ipsum est est in eum molestiae animi qui ullam quos itaque consequatur eum voluptatum magnam voluptatem hic blanditiis sit sit odio porro et assumenda veritatis eligendi quae et maxime harum libero enim voluptatem consequatur et placeat voluptate rerum omnis consequatur nisi ea aliquid itaque corporis id dolores autem harum molestiae ipsum officia soluta deleniti autem eius aliquam itaque corporis ea ex vel est vitae fuga fugiat sunt aut vel et numquam est aliquam minima rem assumenda rerum adipisci ut asperiores doloremque et quasi a harum reprehenderit itaque et modi sed dicta labore dicta id fugit atque dicta aut illo voluptas et amet aut repellendus sint sunt harum debitis incidunt officia sed quia nihil.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-15', '2017-05-14 04:17:11', '2017-05-14 04:17:11');
INSERT INTO `lesson` VALUES ('214', '28', 'Consequatur nobis voluptates ea pariatur unde nam voluptas est.', 'Ut numquam alias sit quia veniam quo animi ducimus sint similique enim dicta et sint explicabo explicabo inventore culpa repellat harum odit voluptas quaerat corrupti soluta sunt et facere occaecati enim ad laborum dolorum consectetur id quia odio est rem soluta rerum omnis eligendi eius quia id aut ad ut voluptatem quis magnam sed molestiae aperiam autem asperiores rerum provident odit asperiores voluptas quam eaque voluptas ut reiciendis reiciendis et vitae dolor et debitis beatae doloremque praesentium ipsa excepturi sequi.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '30', null, '0', '1', '2017-05-17', '2017-05-14 04:17:11', '2017-05-14 04:17:11');
INSERT INTO `lesson` VALUES ('215', '9', 'Aperiam eos delectus consequatur dolores autem velit.', 'Necessitatibus tempora odio enim eligendi possimus unde modi a quo quam minus sed omnis ut beatae error molestias fugit nemo quia vitae in omnis odit suscipit vero enim aut saepe inventore quibusdam id nulla dolorem expedita voluptates blanditiis aspernatur cumque commodi distinctio deserunt at dolore omnis et inventore eum velit sed magnam magni a vitae et inventore sapiente dolore soluta qui eum distinctio suscipit officiis eligendi et ut molestiae.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-19', '2017-05-14 04:17:11', '2017-05-14 04:17:11');
INSERT INTO `lesson` VALUES ('216', '20', 'Commodi in ipsa sint sed quia voluptatem.', 'Blanditiis inventore dolorem ipsa inventore eos nesciunt odio eos fugit nostrum rerum et consequatur eius alias distinctio ut cumque qui adipisci placeat dolore architecto nam exercitationem impedit dignissimos tempora neque quos qui fugiat facilis autem officiis tempore voluptates officiis aperiam et atque enim eum architecto hic nemo non qui velit fugit dolor explicabo dolor tempore dicta ducimus et excepturi reprehenderit fuga aspernatur ad ut assumenda quidem atque repudiandae maiores possimus qui inventore ab exercitationem labore qui aliquid officiis sed earum adipisci ea sapiente eaque quia omnis et vero et illum nulla quidem eos architecto omnis eius error molestiae explicabo pariatur voluptas illum necessitatibus illo corporis aut quasi pariatur aspernatur eos quod ad occaecati dignissimos quae modi maiores sit voluptatem hic sit velit culpa voluptate quos dolor cumque fugiat eaque consequatur facere et omnis repudiandae est quis eum voluptates est necessitatibus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-14', '2017-05-14 04:17:11', '2017-05-14 04:17:11');
INSERT INTO `lesson` VALUES ('217', '20', 'Repudiandae ad tempora voluptas architecto ut qui cumque consequatur omnis et.', 'Vel aut totam aut vitae vel molestiae quis iure voluptas consequatur rerum aperiam quo ratione culpa perspiciatis nisi architecto voluptatem odio qui voluptatem quia ut ducimus ea necessitatibus veniam fugit minus impedit facere officiis ipsam rerum laboriosam sunt molestiae tempora est nobis et expedita nostrum a fugit officia ut est sint praesentium eum atque voluptas doloribus ex hic iure ipsa alias eum eos voluptate sapiente amet molestias vel illum explicabo quidem deleniti tempora quos voluptatem vero molestiae accusantium quia quasi magnam sit repellendus quidem excepturi ut illo iste aut facilis labore voluptatem fuga dolor.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-14', '2017-05-14 04:17:11', '2017-05-14 04:17:11');
INSERT INTO `lesson` VALUES ('218', '17', 'Ea eum quo sed velit aut culpa qui quibusdam vitae.', 'Neque explicabo voluptates esse dolores a minima suscipit fuga provident modi ex repellat ratione eos aut voluptate mollitia et rem nemo voluptas incidunt laboriosam ut velit iure eaque iure asperiores veritatis omnis ea voluptas voluptatem sed nihil quis sequi fugit et dolores autem dolorem quo eos aut adipisci tempore neque fugiat in eligendi aliquid suscipit aut vero ut earum neque deleniti distinctio non vitae sapiente a debitis nemo quae aut sit labore quis quia consequuntur magnam odio at nisi dolore quidem saepe odio enim et similique commodi delectus deleniti.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-14', '2017-05-14 04:17:11', '2017-05-14 04:17:11');
INSERT INTO `lesson` VALUES ('219', '14', 'Et qui dolores temporibus reiciendis unde repellat voluptates atque neque.', 'Aut illum aut rerum explicabo minima harum quae tenetur consequuntur et ipsa ut sed explicabo dolor corrupti voluptas officia qui quos et sed dolor quos porro sed nihil harum sint magni maiores eum iusto dolor libero maiores corporis sit consequatur eveniet odit alias animi omnis corporis et cumque aliquam voluptatem dolores cupiditate ducimus ratione dolores cumque iste qui velit qui laudantium dolorem fugiat nostrum corporis perferendis aut sed et quo doloribus velit sint.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '24', null, '0', '1', '2017-05-18', '2017-05-14 04:17:11', '2017-05-14 04:17:11');
INSERT INTO `lesson` VALUES ('220', '7', 'Odit non enim autem fugiat asperiores unde est.', 'Molestiae id qui doloribus officiis voluptatem dolores debitis et minus repudiandae temporibus quisquam delectus numquam dolor debitis error aut sed amet aliquam atque enim voluptatum incidunt minus accusamus molestias qui ad saepe est ad molestiae natus maxime qui recusandae est dolor dolorum at quibusdam dolorum mollitia numquam quia doloremque velit quo corporis aut recusandae rem maiores labore eaque praesentium expedita at consequatur consectetur veniam fugiat et ratione officia eaque nihil eaque exercitationem ea odit voluptates similique quam quis et vitae facilis sunt voluptatibus vel nihil dolor fuga quisquam ex facilis et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-14', '2017-05-14 04:17:11', '2017-05-14 04:17:11');
INSERT INTO `lesson` VALUES ('221', '20', 'Et nihil maxime quis totam voluptas consequatur commodi dolores.', 'Perspiciatis soluta eos temporibus dolorem sequi in voluptatem assumenda sint qui esse animi neque quis alias quisquam nisi consequatur tempore asperiores quia nemo aut impedit sed omnis sint aut et quo deserunt sit labore nesciunt sit facilis quidem voluptates in molestiae debitis eum nobis cupiditate voluptatem rem qui aut sapiente fugit eum ut veniam error officia sunt ullam aperiam nihil odio recusandae exercitationem omnis eum deserunt non ex aperiam ut magni repellat nihil sunt velit aspernatur sit quae veritatis minima neque sit qui est similique qui soluta expedita qui et aliquam sequi harum quo velit non sunt quis voluptates earum est quibusdam autem explicabo ipsam officia possimus nihil quidem sit aut distinctio officia inventore et unde quia commodi ut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-19', '2017-05-14 04:17:11', '2017-05-14 04:17:11');
INSERT INTO `lesson` VALUES ('222', '28', 'Perferendis deserunt quibusdam pariatur earum debitis.', 'Eos maxime id consequatur et soluta quibusdam assumenda tempore enim dolorum quod recusandae laborum ipsa ex officia vero quo temporibus culpa aut porro est iure eos illo fuga nihil autem in eligendi et est beatae cupiditate voluptatem omnis molestiae blanditiis modi architecto maxime ullam voluptatem quia provident amet ad dicta quos exercitationem ut odio rerum ducimus animi perferendis fuga architecto id perspiciatis sequi ut cumque id aliquam eos voluptate velit et quia quidem quos veniam quibusdam pariatur nulla nobis molestiae adipisci voluptatem excepturi quidem quod eos iusto in ut consequatur et architecto in odit et dignissimos quos aut vel aperiam autem amet quia repellendus voluptatum est incidunt sit quam ut mollitia quidem dignissimos et fuga et veniam iure commodi laudantium minus quia et necessitatibus aut tempore quis laudantium et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-19', '2017-05-14 04:17:11', '2017-05-14 04:17:11');
INSERT INTO `lesson` VALUES ('223', '10', 'Voluptatem consequatur hic aspernatur consequuntur aut sunt placeat.', 'Dolorem placeat eos quis cupiditate possimus repellendus dolores sint tempora quibusdam debitis praesentium sit est consequatur vitae qui vitae blanditiis corrupti sunt nulla expedita ducimus quasi debitis dolor et ut inventore accusantium vel temporibus sint libero nemo fuga libero adipisci accusamus a officia aliquam excepturi et magni in quo facilis non ut dolores suscipit nihil tempora laboriosam libero nulla et consectetur sed alias consectetur officiis odio quos animi corporis quo accusamus in quo sit eum iusto similique doloribus mollitia ratione deleniti architecto enim est vel qui omnis quam nemo sint impedit suscipit sapiente quos sed enim quam ad fugit ipsa omnis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '42', null, '0', '1', '2017-05-14', '2017-05-14 04:17:12', '2017-05-14 04:17:12');
INSERT INTO `lesson` VALUES ('224', '16', 'Incidunt corporis dolores dolores consequatur quas laudantium ipsa quod qui.', 'Qui et eveniet voluptatem iusto rerum aut odio explicabo sit est architecto corrupti incidunt tempora ut veritatis optio enim deleniti ab et expedita enim fuga aut in voluptatem quas reprehenderit voluptate officiis dolores qui non sit dolor dolorem voluptatem sunt quod deleniti dicta rem quam ipsam voluptas sunt velit quas eligendi esse mollitia accusamus autem atque non quas laudantium dolor rem aspernatur at voluptas nihil eos quaerat magni et cumque necessitatibus perspiciatis neque tempore iste error laudantium officia et ut pariatur consectetur debitis dolores aut maxime aperiam quia dolore aliquam quia quasi voluptatem laboriosam non nemo maxime excepturi aspernatur suscipit hic animi atque minima reprehenderit hic facere expedita et perferendis sapiente quaerat cumque natus qui facere velit ut repellendus laboriosam veniam tenetur eligendi est.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '30', null, '0', '1', '2017-05-19', '2017-05-14 04:17:12', '2017-05-14 04:17:12');
INSERT INTO `lesson` VALUES ('225', '26', 'Quidem numquam dolor nemo illum quisquam qui voluptatem ab eum.', 'Vel magnam eius quae quia enim quos illo ducimus qui dolorem ipsum voluptas eos nostrum aut saepe iure dolorum facilis voluptatibus sed tempore optio exercitationem vel reprehenderit voluptatem voluptas harum eum deserunt iusto in ab quia ad officiis eveniet aperiam est fugit nam atque sunt ab quam eveniet consequatur accusantium exercitationem labore magnam praesentium sunt eos deserunt sit consequatur et consequatur repellat culpa aut beatae quia aliquam ea quo eos tenetur natus dolor quo voluptatem quis expedita ut sint molestiae possimus in.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-15', '2017-05-14 04:17:12', '2017-05-14 04:17:12');
INSERT INTO `lesson` VALUES ('226', '25', 'Necessitatibus aut vel amet maxime repudiandae libero voluptatem.', 'Aliquam omnis veritatis reprehenderit possimus id dolor illo deserunt soluta est velit facere occaecati blanditiis aliquam magni sapiente est molestias reprehenderit atque voluptatem saepe non sint at sapiente explicabo magni deserunt sequi commodi velit quam asperiores est et ut et vel non fugiat praesentium recusandae non non ut voluptatum vero est veniam quibusdam animi saepe fugit quod cupiditate ab dolor dolores odio voluptatem id exercitationem corrupti nihil tempora consequatur nam rerum dolores molestias quas ut occaecati quia veritatis sunt.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '23', null, '0', '1', '2017-05-16', '2017-05-14 04:17:12', '2017-05-14 04:17:12');
INSERT INTO `lesson` VALUES ('227', '11', 'Et iusto et et velit.', 'Modi exercitationem consequatur illo recusandae eaque quidem voluptate quis et itaque nulla perspiciatis soluta ab dolor consequatur id delectus quos ex sed numquam ut recusandae doloribus iure dolores autem id labore qui autem doloremque doloremque debitis praesentium odio dolorem numquam et eligendi cumque ipsam dolorem impedit autem maxime omnis quod soluta earum odio deleniti sed repudiandae autem autem quia consequatur voluptas soluta est quo consectetur omnis culpa reiciendis voluptatem omnis consequatur odit velit aut nihil eos et autem animi est atque quia ea quasi assumenda sunt voluptatem aut dignissimos delectus enim optio quia aut inventore placeat vero rerum dolore numquam quo accusamus sapiente et nisi exercitationem dolor corrupti non quod placeat aliquid nisi odio qui et assumenda nulla fuga expedita consequatur quidem quidem voluptas libero corporis et nihil dignissimos consequatur est est occaecati.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-19', '2017-05-14 04:17:12', '2017-05-14 04:17:12');
INSERT INTO `lesson` VALUES ('228', '30', 'Quasi sit est explicabo et ad itaque tempore sed placeat ea.', 'Odio eius in quia asperiores aut in qui et dolor porro delectus maxime placeat illum aut et odio rerum totam excepturi voluptas labore quos laudantium omnis voluptatibus autem perspiciatis perspiciatis nostrum autem molestiae repudiandae temporibus est voluptates architecto reiciendis culpa quo at vel natus voluptas autem qui non praesentium hic sint natus tempora minus illum et unde nostrum ut modi officiis dolorem distinctio molestias ut quaerat ipsam voluptatem quia ipsum porro dignissimos dicta rerum est omnis fugiat molestiae et minus non odit nihil quo sapiente id ratione libero dolorem repellat soluta ducimus qui enim atque et rerum facilis ullam necessitatibus qui molestiae ut ut vel temporibus quis illum facere consequuntur aliquid recusandae est ab quis placeat incidunt eius magnam mollitia vel sapiente reprehenderit molestiae harum labore consectetur magnam et officiis iste eos.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-14', '2017-05-14 04:17:12', '2017-05-14 04:17:12');
INSERT INTO `lesson` VALUES ('229', '22', 'Aspernatur velit repellendus consequatur sequi architecto illo laudantium quia.', 'Aut in exercitationem amet aliquid necessitatibus alias occaecati dolor consequatur saepe et facere accusantium autem cupiditate adipisci rerum esse blanditiis numquam magni recusandae aut at illo minus quia exercitationem qui fuga consequuntur enim aut qui eum voluptatem eos laboriosam animi dolor rerum minus placeat facere tempore sequi culpa qui deserunt iusto cupiditate iusto nihil aperiam aut illum tempora earum et consequatur veritatis architecto officiis eligendi eos quia tempore eligendi eveniet vero qui vel velit commodi occaecati consequatur sed nihil provident harum doloremque at quia totam laboriosam dolorem voluptatem sit ut et ipsam animi incidunt quo autem harum dolorem voluptates qui vel iste libero sunt explicabo eius laborum magnam sint libero et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '22', null, '0', '1', '2017-05-14', '2017-05-14 04:17:12', '2017-05-14 04:17:12');
INSERT INTO `lesson` VALUES ('230', '15', 'Qui qui et voluptatem iusto est optio necessitatibus vel.', 'Sunt tempore nam dignissimos dolores tempora vel ratione culpa facilis dolores veniam nihil culpa consequatur dicta dignissimos dolorum doloremque pariatur dolor quia sint et alias expedita voluptate quia maiores aliquid nihil fugiat voluptatem occaecati quas rem corporis sunt reiciendis aut qui id consequatur veritatis fugiat et totam omnis sint consequatur quidem optio nisi amet ut est consequatur maiores aut maiores sed voluptas error laudantium qui dolor eum quo qui similique magnam fuga magni et quam autem dolores voluptatem commodi.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-19', '2017-05-14 04:17:12', '2017-05-14 04:17:12');
INSERT INTO `lesson` VALUES ('231', '9', 'Alias beatae aut neque quo qui culpa quod rerum sequi.', 'Numquam explicabo cumque ex assumenda facere neque sint facilis libero debitis perferendis nostrum eius dolor aut non quibusdam dolor nihil ut architecto molestiae harum expedita repellat nulla et et ea ut ut sunt non placeat deserunt voluptates dolores dicta omnis hic culpa soluta qui doloribus nobis et in id porro accusamus autem exercitationem nisi aut omnis accusantium sequi placeat omnis similique harum voluptatem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '27', null, '0', '1', '2017-05-16', '2017-05-14 04:17:12', '2017-05-14 04:17:12');
INSERT INTO `lesson` VALUES ('232', '10', 'Omnis sunt iste quis eos soluta id vero est qui et.', 'Sequi est impedit eum beatae cum aperiam aut incidunt ut voluptate sit nihil eum dignissimos et unde officiis rerum et sequi non illo eaque delectus eos laudantium occaecati aut architecto ratione voluptatem consequatur fuga aliquam et earum sed aut dicta molestias rerum officia cum eum sint qui incidunt et nihil dicta iste recusandae nam rem iste dolorem quo quasi quod vitae qui architecto autem et fugiat qui exercitationem voluptas aut nihil incidunt facere totam voluptatibus nam sit omnis sequi tempora aut qui quia quis non nam incidunt rerum cum quis quibusdam hic praesentium necessitatibus voluptatem ut commodi quia omnis debitis ex necessitatibus quos ut sunt sapiente nihil et cumque qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-18', '2017-05-14 04:17:12', '2017-05-14 04:17:12');
INSERT INTO `lesson` VALUES ('233', '16', 'Ipsa et ratione nihil molestias a.', 'Saepe aperiam repellendus sequi fugit fugit aut consequatur et itaque sequi aliquid numquam nisi illum quia aut et eveniet magni quibusdam eligendi eos adipisci totam delectus et cum aperiam consequatur voluptas sapiente similique quod et sint asperiores dolorum nulla earum suscipit molestias et repudiandae molestias exercitationem nulla nihil error mollitia debitis error minima ea velit quis expedita laudantium iste reprehenderit porro nihil reprehenderit est laborum iure est saepe qui aut laboriosam velit atque animi ipsam sint atque rerum eligendi sint et dolorum iste eligendi dolor velit enim voluptates et maxime velit non iste omnis et et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '23', null, '0', '1', '2017-05-14', '2017-05-14 04:17:12', '2017-05-14 04:17:12');
INSERT INTO `lesson` VALUES ('234', '23', 'Quibusdam inventore et ut odit quae reiciendis sit quidem.', 'At iusto minus veniam voluptatem ducimus iusto occaecati ab optio molestiae quis aut aliquam quis illo fugit dolores et aut rerum perferendis perspiciatis consectetur provident nulla quo sunt et dicta et labore quia quisquam veniam et quia facere eum minus sequi et modi qui magni eius veritatis molestias rem qui omnis pariatur dolorem ut ex perspiciatis eius dignissimos voluptatem recusandae eius est dolorem omnis quia placeat.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '39', null, '0', '1', '2017-05-17', '2017-05-14 04:17:12', '2017-05-14 04:17:12');
INSERT INTO `lesson` VALUES ('235', '13', 'Molestias adipisci maiores ipsum est doloremque.', 'Explicabo necessitatibus sapiente accusamus libero molestiae iure quia ut saepe consequatur ea qui in aliquam id quod asperiores animi debitis dolor delectus totam quia voluptas consequatur similique et nobis libero illum expedita sint minus vel voluptas necessitatibus aliquam quia error voluptates minus voluptas optio quo illo pariatur ipsa est omnis praesentium possimus harum et omnis at iure qui quo officiis architecto exercitationem neque ad qui nisi cum et doloremque eligendi eligendi eius aspernatur sit odit reiciendis est amet totam minima minus aut est dolores delectus ut quo mollitia ea ab non accusamus placeat aspernatur suscipit asperiores magnam et at.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-18', '2017-05-14 04:17:12', '2017-05-14 04:17:12');
INSERT INTO `lesson` VALUES ('236', '3', 'Ratione vero voluptatem eos optio aliquam sequi necessitatibus a explicabo corrupti.', 'Deleniti sed maiores est qui voluptas fugiat veritatis in eos a ipsa dignissimos et eos omnis ab nostrum tempore ut quidem modi aut est vitae et ullam voluptatibus praesentium architecto debitis debitis repudiandae sed itaque quia non sint quidem facilis ratione autem sit ad minima qui in error ad voluptatem tempora ipsum dolorem qui consectetur consequuntur nisi ut consequatur quis voluptatem non qui explicabo vel expedita magni saepe et tempore eum et et perspiciatis saepe corporis fugit eum reiciendis ut nostrum nostrum optio numquam non sed quis mollitia corrupti aliquid aliquam harum vel quos tenetur quia sunt facere tenetur id adipisci nemo dignissimos explicabo aut expedita sed corrupti et fugiat molestiae possimus a aut esse odio consectetur quo voluptatem reiciendis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '36', null, '0', '1', '2017-05-18', '2017-05-14 04:17:12', '2017-05-14 04:17:12');
INSERT INTO `lesson` VALUES ('237', '16', 'Maiores natus incidunt aliquid earum quia distinctio esse voluptatem.', 'Qui quis consequatur beatae quas quis voluptatibus quidem aliquam mollitia ea doloribus dolorum deleniti sint dicta harum ipsa eos qui incidunt non voluptatem sed nihil molestias molestiae facilis sapiente rem voluptas rerum velit voluptatem ex nisi quo accusantium ut itaque sunt labore debitis reiciendis qui quis ea maxime voluptatem quia fuga ipsam facilis mollitia delectus et facilis ut qui et ut explicabo voluptates sit iste cupiditate voluptatem quae iure reprehenderit et voluptatem voluptatem expedita voluptatem voluptatem incidunt sed illo vero et sunt neque qui dolorum quos ratione dolor quia maiores in quia non sit sed dolore similique maiores eum non non dolore optio.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-14', '2017-05-14 04:17:12', '2017-05-14 04:17:12');
INSERT INTO `lesson` VALUES ('238', '30', 'Architecto ipsam dolores impedit aut autem.', 'Voluptatibus cumque nisi facilis laboriosam optio culpa maxime laudantium fugit aliquam et dolores voluptas voluptates officia minima iusto sit ad perferendis sunt consequuntur et nisi atque veniam consectetur molestias consequatur illo suscipit ea blanditiis nulla adipisci voluptatem quod est a aut quis non similique ut ut recusandae corporis asperiores eum eaque unde aliquam minus sit fugit ut repellat quam sed et est provident molestiae porro ut repudiandae excepturi doloribus odit ad tenetur itaque est amet.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-16', '2017-05-14 04:17:12', '2017-05-14 04:17:12');
INSERT INTO `lesson` VALUES ('239', '23', 'Rerum rem nihil at quia ad voluptas quibusdam doloremque et tenetur et.', 'Ullam cum ea aperiam aperiam delectus consectetur quibusdam corrupti unde aliquam et repellendus qui fuga beatae sed nisi vero ut dolorem possimus eligendi suscipit commodi quibusdam voluptatem sed vitae nobis ex corrupti laborum aut deserunt ut ut deserunt in esse at in delectus quod ea et voluptatem fugiat nisi rerum corporis non et quidem omnis vitae distinctio ea consectetur itaque dolores numquam cupiditate corporis esse sit quas vero eos ratione molestias autem est qui facere ut laudantium et harum sequi velit impedit quibusdam laudantium sequi ipsam minus voluptatem minima ipsum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-19', '2017-05-14 04:17:12', '2017-05-14 04:17:12');
INSERT INTO `lesson` VALUES ('240', '20', 'Assumenda blanditiis qui deserunt quasi hic.', 'Adipisci non fuga quia commodi commodi labore deleniti quis vitae ea dolor aperiam doloribus qui molestiae aliquid ut explicabo eligendi sunt quo quia veniam velit quis vero eos saepe voluptatem corporis inventore labore et assumenda nostrum omnis est necessitatibus omnis minus ipsum amet expedita et inventore et et blanditiis sunt sunt accusantium doloremque maxime maxime in eos totam commodi aut assumenda quia dolor est non fuga autem qui nemo provident in laudantium vitae odio vitae incidunt deleniti aut ab porro consequuntur rerum quo quia et sit magni maxime perferendis hic modi occaecati natus voluptatem maxime doloremque modi et et et facere sit perferendis eum reprehenderit sed veniam vero voluptatum inventore tempore distinctio rerum sed voluptates magnam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-14', '2017-05-14 04:17:12', '2017-05-14 04:17:12');
INSERT INTO `lesson` VALUES ('241', '13', 'Quis dolores ut eius adipisci vel blanditiis.', 'Delectus laboriosam atque tempore est debitis vitae fugit sit ut voluptates omnis voluptatem qui cum laborum quaerat nihil mollitia distinctio dolores quia quia at fuga possimus minus porro impedit qui repudiandae accusamus ut qui et non laboriosam eum possimus illum ducimus qui facilis possimus omnis exercitationem voluptas totam fugiat iste ducimus rerum ducimus voluptas placeat modi enim enim accusamus quae quam voluptatem hic eos in odit deserunt voluptas voluptatum fuga inventore voluptates animi non quis quis explicabo pariatur similique asperiores eos optio exercitationem itaque aperiam est veniam nihil non repellat veniam dolorem sit qui et alias assumenda illum repellendus nemo facere ipsam omnis deserunt et accusamus velit inventore est impedit qui accusamus ut veniam nemo quia laboriosam possimus vero porro reiciendis repudiandae ullam totam quas itaque autem ut nihil et possimus porro ducimus nam enim voluptatem fugiat ex voluptas et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-17', '2017-05-14 04:17:12', '2017-05-14 04:17:12');
INSERT INTO `lesson` VALUES ('242', '25', 'Quos est blanditiis et voluptate quo omnis vel sequi doloremque et dolor.', 'Repellendus reiciendis sed ipsum laborum vel quisquam sit recusandae vel aut quas velit maiores laboriosam voluptatem dolorem ut rerum est quas quis ab quia nam et sapiente sed et aut et est necessitatibus voluptatem mollitia itaque est sit provident quibusdam quae dolorum qui mollitia quia repellat saepe molestiae quia voluptatem voluptate dolorem animi natus eligendi id ratione illum quod non atque temporibus et unde dolores repellendus quia laboriosam molestiae voluptates qui ex voluptates dignissimos perspiciatis qui vitae nostrum est atque numquam aut debitis ratione perferendis molestiae quia ut praesentium maxime accusantium fugiat est repudiandae dolor voluptate ab pariatur et asperiores aut dolor et eveniet et ad eveniet cumque dolores assumenda repellendus inventore nam nobis aut non laborum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '28', null, '0', '1', '2017-05-16', '2017-05-14 04:17:13', '2017-05-14 04:17:13');
INSERT INTO `lesson` VALUES ('243', '27', 'Ipsa culpa illum et mollitia distinctio excepturi et voluptatum aperiam est.', 'Sed beatae voluptates voluptas impedit nisi quo animi dolores et eum expedita error quia praesentium qui fugit et blanditiis qui minus sit laboriosam quo sed eos dolorem delectus in fugit rerum ex cupiditate nostrum recusandae officia dolorum itaque commodi nesciunt assumenda odit rerum voluptatem nesciunt dolore ipsa placeat in et aliquid in qui non omnis est quam unde quas maiores est ad harum et suscipit debitis magnam repellendus assumenda incidunt est excepturi modi distinctio repellendus sint omnis esse quas ex dolor corporis praesentium consequatur nostrum exercitationem rem rerum a voluptate ut placeat sunt tempora provident repudiandae omnis quam et impedit quia aut deleniti et est recusandae asperiores vel nesciunt praesentium rerum nulla corrupti voluptas laboriosam sed molestiae eos animi sequi labore vitae maiores sed velit quia sed omnis quibusdam praesentium itaque in consequatur molestias repellendus repellat accusamus voluptatem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-16', '2017-05-14 04:17:13', '2017-05-14 04:17:13');
INSERT INTO `lesson` VALUES ('244', '2', 'Optio aspernatur ea doloremque soluta enim fugiat eum dicta non.', 'Recusandae est nisi adipisci magni numquam et voluptate sunt culpa doloribus nulla culpa excepturi quod libero vel aut qui a incidunt omnis quae adipisci laborum ut dolorem vel veniam libero provident natus soluta magni dicta officiis ea vero blanditiis reiciendis asperiores dolorem sequi nihil magni omnis et quis optio excepturi natus consequuntur molestiae facilis aspernatur ullam voluptatem et dolores ut eius accusantium vitae et tempora deserunt qui blanditiis et est impedit sapiente qui nesciunt voluptatem nam eius error possimus qui animi commodi ut eum molestias suscipit voluptatibus dolorem ut optio est assumenda qui a sed.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '39', null, '0', '1', '2017-05-16', '2017-05-14 04:17:13', '2017-05-14 04:17:13');
INSERT INTO `lesson` VALUES ('245', '24', 'Eveniet nisi temporibus nesciunt debitis nihil reprehenderit.', 'Aut tempora dignissimos itaque repellendus fugit qui provident autem voluptatibus enim necessitatibus commodi debitis aut perferendis quia facere consectetur hic asperiores cum commodi sint dolores accusantium sed consequuntur eligendi repellendus qui consequuntur impedit ullam porro et fuga enim nesciunt voluptates hic quod ipsam ut at nesciunt consequatur qui itaque voluptas rerum explicabo vitae molestiae maiores ipsa alias qui quae nulla distinctio quod id iure tempora in saepe autem aut saepe aut at unde qui delectus minus impedit eos qui ipsum perferendis sit omnis unde enim a vero fugit veritatis libero voluptas laudantium voluptates magni delectus voluptate nesciunt quaerat.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-18', '2017-05-14 04:17:13', '2017-05-14 04:17:13');
INSERT INTO `lesson` VALUES ('246', '14', 'Blanditiis ullam adipisci vel sed suscipit impedit velit qui non expedita.', 'Qui velit veritatis labore earum unde dolor accusantium odit id corporis recusandae quisquam neque quia nemo qui voluptatem nisi id atque vel ut eaque illum eos vel eveniet quia recusandae sed harum et eius et asperiores dolores illo inventore ex aut molestias veniam consequatur minima est ut eum amet repudiandae in non ut error consequatur libero molestias ut quod sunt dolores molestias libero vel ipsam magnam ullam alias atque vero non soluta possimus eaque ipsum perspiciatis magnam ea cumque commodi rerum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-14', '2017-05-14 04:17:13', '2017-05-14 04:17:13');
INSERT INTO `lesson` VALUES ('247', '7', 'Sunt quod voluptates id omnis nisi sit a quis quisquam quidem eos.', 'Iusto deserunt quidem itaque enim aliquam aut dolorem velit vel occaecati vel rerum pariatur voluptate fugiat voluptas sapiente ut assumenda dignissimos dolorem quas dolor quasi nihil velit quam sapiente sed delectus voluptatum qui est iste atque quia quos in animi exercitationem voluptas itaque nesciunt nisi non voluptate fugiat animi quas et omnis cupiditate adipisci deleniti unde explicabo omnis possimus quae occaecati qui laborum quia doloremque culpa qui asperiores ut dolorem similique consequatur consequatur voluptas fuga quisquam quis inventore placeat enim rerum voluptatem harum repellendus ad reprehenderit qui eaque architecto et architecto eos eos quasi consequatur eius iusto magnam libero vel et hic laudantium vel modi sint inventore esse autem nisi laboriosam eum minus aliquid repellat natus dolores rerum quia vero aut nihil perferendis dolore dolorem magni distinctio magnam esse quia mollitia laboriosam earum aut sunt commodi corporis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-16', '2017-05-14 04:17:13', '2017-05-14 04:17:13');
INSERT INTO `lesson` VALUES ('248', '21', 'In optio repellendus tempora voluptas officiis aliquid cum occaecati.', 'Dolorum rerum ut error cumque facere odit quis molestias sunt nihil ipsam velit quidem quos ut quia ipsum sit quasi dolorum non eos iste fugit qui quos vel non maxime at ut reiciendis aperiam totam eos cupiditate perferendis laboriosam nobis earum eum blanditiis ea ea fugiat cupiditate laudantium et voluptatum illo repellat maiores odit ut illo enim magnam tenetur expedita voluptas non neque provident consequatur vel in ipsa sed enim voluptatibus recusandae vero soluta eveniet sit et nemo quaerat et ut non aut itaque dolorum eum quod optio doloribus eos sapiente similique consequatur veritatis sint autem ut odit et quo tenetur ratione ipsa ea fugiat nam dolorem exercitationem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-18', '2017-05-14 04:17:13', '2017-05-14 04:17:13');
INSERT INTO `lesson` VALUES ('249', '4', 'Voluptas nostrum aut esse in possimus accusantium quibusdam.', 'Consequatur magnam eveniet sint neque expedita in reiciendis modi deserunt eum accusamus voluptatem numquam voluptatem rerum fuga molestiae veniam qui officia in earum sequi quo nihil fugiat fuga rerum voluptate maiores quae ipsam fugit omnis praesentium itaque quo nostrum quia sit eos dolorem dignissimos omnis harum cum et molestias quos facilis ea molestias dolor vero facilis sequi consequatur quae rem repellendus magnam omnis aut vitae laborum recusandae unde est dolor inventore est animi aut dolorem praesentium commodi non neque accusantium ipsa sunt est eos consequatur.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-19', '2017-05-14 04:17:13', '2017-05-14 04:17:13');
INSERT INTO `lesson` VALUES ('250', '11', 'Occaecati sit nesciunt rerum cum et adipisci corporis perspiciatis.', 'Ut et ea occaecati accusantium maiores inventore fugiat illum sit nemo nihil voluptas sed impedit et reiciendis incidunt ex dolorum nemo voluptatem quidem beatae eligendi dolores voluptates eum non et maiores dolorem nesciunt quam sit sunt commodi iure sit nobis dolores aspernatur facilis est dolore eaque repellendus rerum ratione eligendi consequatur consequuntur ab et et eum fugiat iusto temporibus et suscipit vel et eaque recusandae labore quidem inventore et quia velit omnis magni quia cum numquam voluptate magni cum aliquam nulla et iste non cum tempore consequuntur vel rem ut necessitatibus atque nihil error.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-14', '2017-05-14 04:17:13', '2017-05-14 04:17:13');
INSERT INTO `lesson` VALUES ('251', '19', 'Dolore exercitationem qui tempora aut adipisci et distinctio.', 'Dicta vel dolorem ex doloremque in laboriosam ipsa perferendis sed est facilis et ad officia deserunt optio ea voluptatem saepe harum et alias maiores voluptatem illum ex sint debitis explicabo aut ad molestias earum fugit tempora odit ratione veniam architecto sit id saepe doloremque atque facere eveniet a accusantium odio quisquam beatae dignissimos culpa ab culpa ea inventore a ipsa atque quod mollitia laudantium et ut delectus fugit qui hic ut qui omnis at sed qui aut autem cum culpa aut impedit maxime ullam ipsa harum possimus dolores hic possimus assumenda voluptas et illum quam voluptatem maiores repellendus magni necessitatibus quis et sequi quo vitae deleniti iure vel incidunt ab odit nisi sed iusto pariatur dolorem excepturi ut voluptatibus aut animi repellendus consequatur rem ut laborum maxime veniam nesciunt sint aut dolor aut quia aut architecto sunt ipsam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-16', '2017-05-14 04:17:13', '2017-05-14 04:17:13');
INSERT INTO `lesson` VALUES ('252', '5', 'Minus nesciunt ut maxime amet aperiam officia ut officia.', 'Est enim nihil aut quidem impedit provident quis dolores temporibus aut ut maiores soluta quo iure quia ea et aspernatur et id quidem officia ducimus incidunt impedit non hic numquam a exercitationem soluta perferendis vitae ea aspernatur itaque consequatur non neque eligendi dolores debitis nostrum expedita at ullam deleniti enim sequi temporibus et dicta tempora consequatur quia cupiditate officiis voluptates tenetur voluptatem est dolorem a explicabo sit maiores et nemo ratione et doloremque quisquam quae quis fugiat rem corporis tempore iusto harum aut eveniet omnis nostrum at quia rerum officia ex et sequi ut id impedit ut qui voluptates voluptatum deserunt eos aspernatur laborum pariatur officia consequatur consequatur et voluptatem nam error autem quo est optio officiis aut sit consectetur culpa illo voluptatem expedita.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-17', '2017-05-14 04:17:13', '2017-05-14 04:17:13');
INSERT INTO `lesson` VALUES ('253', '23', 'Rerum corporis ut quam excepturi in numquam.', 'Odit ad iusto non cupiditate iure magnam a corrupti et quae nobis sit sed amet excepturi ratione et eligendi eos molestias quisquam ut et sed ut quia ut sed voluptates dolorem voluptates dolor possimus aliquid minima sit aperiam sed earum et dicta enim tempore dolores voluptate eos non et dolorum earum iusto exercitationem itaque tenetur ea fugit ratione cumque esse voluptatem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '20', null, '0', '1', '2017-05-19', '2017-05-14 04:17:13', '2017-05-14 04:17:13');
INSERT INTO `lesson` VALUES ('254', '21', 'Assumenda est sapiente voluptas reiciendis numquam quis doloribus a dolor.', 'Ut sint illum accusantium ullam distinctio id hic velit laudantium ipsam aut cupiditate et nam enim deserunt nam dolorum ut dolorem facilis porro fugiat molestias dolorem inventore eligendi qui aut ducimus autem mollitia exercitationem rerum soluta nihil non soluta dolorum ex asperiores velit eos repudiandae et ea provident non molestiae quas id velit et quas voluptatum molestiae ut sunt voluptas consequatur aspernatur nihil maxime aliquam velit illo delectus quae voluptatem nesciunt ratione et qui aspernatur quos eaque nisi quos laboriosam repudiandae et laborum voluptatibus sequi officiis in natus rerum temporibus tenetur expedita et est non enim et quasi accusantium aut pariatur.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '23', null, '0', '1', '2017-05-16', '2017-05-14 04:17:13', '2017-05-14 04:17:13');
INSERT INTO `lesson` VALUES ('255', '11', 'Nam recusandae libero sunt numquam est.', 'Eveniet maiores illum ad sed error vero fugiat et magnam est adipisci rerum aspernatur qui eum sed incidunt sed animi dicta et omnis exercitationem libero perspiciatis animi cupiditate non enim consequatur nihil et maiores quaerat qui aut eligendi exercitationem rerum est recusandae dolorem cumque animi iusto quas hic porro est qui sint ipsam excepturi eos autem eaque ut autem voluptatum temporibus beatae voluptas eveniet eius sit aperiam consequuntur illum quia ut nemo nulla facilis modi ad reprehenderit ipsum dolor nobis impedit magni nemo perspiciatis repellat consequatur itaque non aliquid neque asperiores repellat reprehenderit incidunt hic odit ut assumenda delectus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '42', null, '0', '1', '2017-05-18', '2017-05-14 04:17:13', '2017-05-14 04:17:13');
INSERT INTO `lesson` VALUES ('256', '5', 'Est nesciunt veniam totam pariatur corrupti amet assumenda.', 'Dolores non corrupti odio quae quis ut voluptatem necessitatibus cum quidem doloribus aliquid odio eum incidunt nam provident qui perspiciatis et ipsum asperiores temporibus nisi illum iste excepturi adipisci consequatur et ullam repellat fugiat autem sunt odio iusto similique ipsum est qui ut asperiores odio voluptatem qui veniam ea porro autem qui consectetur fuga nisi perferendis quis voluptatem magni autem sed fugiat quisquam recusandae et dolor iusto culpa est hic excepturi autem harum qui delectus corrupti ducimus quod.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-16', '2017-05-14 04:17:13', '2017-05-14 04:17:13');
INSERT INTO `lesson` VALUES ('257', '29', 'Sint quis facilis quis quo sed ut cupiditate et.', 'Et velit qui quasi ut aut optio eos accusamus non consequatur molestiae quam beatae perferendis veniam voluptatum optio qui deleniti assumenda unde reiciendis omnis velit corporis nam fugiat possimus voluptatem incidunt assumenda omnis porro similique nemo temporibus eaque eaque doloremque omnis dolores sed error necessitatibus fugit perspiciatis ipsam et rerum eveniet aut voluptatem ut cupiditate aliquam iusto ea quasi ratione illo est voluptatem magni eum quia maiores ex omnis sunt occaecati sit quis asperiores et laboriosam optio corrupti aliquid ut inventore error suscipit itaque voluptas repudiandae consectetur porro nemo cupiditate porro sunt animi ut corporis dolor fuga corporis ea ea minima quasi rerum debitis nam fugit fuga voluptas recusandae a aut dolores sit sunt earum minus commodi debitis aut ipsum autem culpa odio quis nemo praesentium incidunt atque doloribus quas minus tempora.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '47', null, '0', '1', '2017-05-14', '2017-05-14 04:17:13', '2017-05-14 04:17:13');
INSERT INTO `lesson` VALUES ('258', '13', 'Magni repellat pariatur sed explicabo quam aperiam deserunt.', 'Nesciunt labore sint distinctio sunt accusamus et voluptatum qui voluptas sint non et rerum dolor vel officiis fuga eum excepturi harum deleniti nemo molestias et sunt aut fuga est et doloribus architecto cum unde fuga id voluptatem dolorum ut porro reiciendis dignissimos quibusdam cupiditate reprehenderit reiciendis est non beatae dignissimos asperiores id maiores quia architecto sit ea aliquam et quas odio est incidunt eum blanditiis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-18', '2017-05-14 04:17:13', '2017-05-14 04:17:13');
INSERT INTO `lesson` VALUES ('259', '6', 'Aliquam consequatur eos quia quam perferendis repellendus fugiat ducimus illo.', 'Perspiciatis qui eos ut et corrupti quisquam hic dignissimos ab beatae culpa vel vel sequi aut qui molestiae assumenda molestiae rerum asperiores earum tenetur ut dolore excepturi a rerum et error eum sint impedit ea perspiciatis qui laudantium at voluptas sequi ut suscipit enim in ipsam tempora nemo quia aspernatur et error nulla nesciunt reprehenderit repellendus dolorem et voluptate fugiat quas id ea et facere voluptatem ut deleniti esse quo est in quia quae eaque officiis error ipsum molestiae voluptatem ut est sunt.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '47', null, '0', '1', '2017-05-14', '2017-05-14 04:17:13', '2017-05-14 04:17:13');
INSERT INTO `lesson` VALUES ('260', '15', 'Ut dolore tenetur eos et ad vitae maiores consectetur omnis.', 'Dolores pariatur sequi voluptatem error in molestiae reprehenderit ipsa et doloremque soluta dolores molestiae beatae sed quis excepturi eveniet aut debitis qui repellat asperiores commodi voluptatum molestiae quam aperiam exercitationem unde laboriosam beatae magnam repudiandae doloribus tempore ipsam adipisci sequi rerum eum architecto facere blanditiis ad mollitia et quia omnis consequatur id est et est distinctio iste quas omnis amet et quo quo eius eum soluta totam id voluptatem quo sed aut accusamus temporibus provident ad perferendis ea animi officia soluta error soluta quas at ut dolor qui quibusdam doloribus quis praesentium tenetur.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '30', null, '0', '1', '2017-05-15', '2017-05-14 04:17:14', '2017-05-14 04:17:14');
INSERT INTO `lesson` VALUES ('261', '24', 'Cum beatae dolorem voluptas eligendi porro laboriosam vel.', 'Cupiditate nobis eaque sit architecto aliquam at consequatur deleniti aperiam ut nesciunt et neque commodi quis dolorum facere et occaecati sequi culpa eligendi qui aspernatur nihil ullam dolorum rem reiciendis omnis voluptatum nam minus maxime dolore sunt quia laudantium ullam labore aut error aut nesciunt unde ipsum voluptatem quae autem itaque temporibus et fuga enim sit voluptas et harum voluptatem accusantium necessitatibus voluptate sint est repudiandae dignissimos ex quas dolores est laudantium laboriosam vero odio fugiat et incidunt modi id alias unde maiores voluptatum inventore reiciendis aut cumque est alias qui doloremque voluptatibus dicta beatae laboriosam sit velit consequatur libero quos ea natus dolores eligendi quod.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-17', '2017-05-14 04:17:14', '2017-05-14 04:17:14');
INSERT INTO `lesson` VALUES ('262', '7', 'Dignissimos aspernatur nihil soluta doloribus aliquam quis sed eos.', 'Sint voluptatem dolor omnis iure sit debitis nulla corrupti ut ad sed laborum autem voluptas voluptatum at non qui maiores harum rerum excepturi facilis vel voluptatibus quia saepe ullam quidem possimus quasi rem est perferendis consequatur ad voluptatem voluptas dolor quaerat impedit illo praesentium quisquam eos repudiandae a et totam delectus incidunt dicta eligendi cum officia et est nobis voluptatem ut debitis provident repudiandae quo perferendis nostrum ut nulla rerum exercitationem ut maiores est commodi ratione cupiditate nobis et est quas est odit incidunt magnam perferendis ut quia eveniet.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-14', '2017-05-14 04:17:14', '2017-05-14 04:17:14');
INSERT INTO `lesson` VALUES ('263', '5', 'Unde quo in illum consequatur aliquid.', 'Sequi ad consequatur cum ea veritatis et voluptatem ipsa qui impedit sunt reprehenderit ad sunt ea qui consequatur aut nam quae sed aliquam dolorem iusto itaque totam adipisci vero sit necessitatibus illo consequuntur voluptatem voluptas non laudantium quo dolorum dolorum temporibus vitae voluptates aut atque quo quia modi accusamus illo delectus natus voluptatum exercitationem fuga perferendis et nihil illum consequatur eius iste quasi blanditiis commodi et consequuntur rerum inventore voluptatem molestiae mollitia quia id repellat cum mollitia laboriosam deserunt ipsum vel ab saepe quia mollitia molestias aut et neque assumenda expedita eos perspiciatis quibusdam quaerat accusantium quis et voluptates laboriosam mollitia tenetur expedita nihil blanditiis enim provident nam quo minus cumque id non laborum veritatis itaque laboriosam consequuntur quidem a velit aliquid excepturi dolor magni ab.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '30', null, '0', '1', '2017-05-15', '2017-05-14 04:17:14', '2017-05-14 04:17:14');
INSERT INTO `lesson` VALUES ('264', '21', 'Exercitationem consequuntur ullam repellat quaerat cumque dolorem sint eos ut.', 'Qui quasi aperiam non ipsa harum et enim similique omnis molestiae et deserunt et modi enim voluptate recusandae aut excepturi et iure explicabo earum totam et autem corporis tempora voluptate aspernatur omnis velit accusamus cumque debitis nam autem dolores enim est excepturi fugiat totam atque deserunt fugiat nihil facilis qui ullam facere ut hic nihil est dolor fugit dolor possimus hic officiis qui nihil iste sint recusandae eius qui impedit quo architecto ut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-14', '2017-05-14 04:17:14', '2017-05-14 04:17:14');
INSERT INTO `lesson` VALUES ('265', '30', 'Accusantium culpa sint et ut dolor eveniet.', 'Labore est aspernatur omnis sequi quia incidunt in eum voluptatibus tempora quaerat aspernatur sequi fuga qui molestiae ullam aut ut labore quos sunt qui vero repudiandae consequuntur nemo eum ex voluptate dicta consequatur aut eveniet sed commodi modi et cumque rerum omnis sunt rerum minus dicta et qui maxime corrupti dolor dolorum ut fugit repudiandae nihil error molestias voluptatibus repellat quam nihil ad consequuntur qui dolore delectus cum vel neque temporibus et veritatis recusandae ea eius velit aut error molestias animi earum commodi consequuntur rerum corrupti blanditiis autem et nisi sequi non quam assumenda sequi repudiandae repudiandae vitae enim et quibusdam fuga aut reiciendis voluptatem optio iusto molestiae temporibus tempora non possimus itaque.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-19', '2017-05-14 04:17:14', '2017-05-14 04:17:14');
INSERT INTO `lesson` VALUES ('266', '23', 'Eveniet est exercitationem distinctio ut maiores sunt nobis porro sunt.', 'Quis voluptatem fugit autem sed sint et ea quas distinctio quo veniam nam vero at assumenda aut qui officia similique consequatur vel odio iure tempore nemo cum qui debitis molestias qui quis consequatur provident magnam repellendus qui eum nam possimus ipsa dolor ullam est culpa est itaque beatae omnis molestiae sit dolorem cumque cum soluta quis rerum eveniet aut iste adipisci quos sit qui maxime.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-19', '2017-05-14 04:17:14', '2017-05-14 04:17:14');
INSERT INTO `lesson` VALUES ('267', '29', 'Dicta rerum aut qui porro quia.', 'Esse itaque et voluptatem aut ratione eveniet est quas quisquam sed aut perspiciatis suscipit soluta ad doloribus ut et aliquid quis nisi eos et consequatur id velit quia aut corrupti et debitis voluptatem est molestiae exercitationem omnis fugiat quia aut suscipit totam quaerat et molestiae in corrupti expedita iste accusamus nam officia aliquid adipisci dicta voluptates rerum ut itaque et consequatur est reiciendis vitae non quaerat velit provident repellat magni ea omnis laudantium atque deleniti dicta debitis ullam dolores in ratione.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-19', '2017-05-14 04:17:14', '2017-05-14 04:17:14');
INSERT INTO `lesson` VALUES ('268', '16', 'Dignissimos laborum voluptatibus quia unde dolorum aut.', 'Excepturi ut quibusdam porro velit qui sequi maiores dolore suscipit quisquam dolores voluptatem aliquam consequatur sed vero ducimus omnis molestiae molestias dolores sunt ipsam similique a fuga exercitationem fugiat suscipit quae sed quidem eum odit et corrupti quaerat magnam expedita occaecati fuga blanditiis dolorum omnis atque ad dolorem dolore et voluptatem voluptatem inventore officiis repellendus et sed provident blanditiis et non soluta non minima sint soluta repellendus beatae aut dolor eligendi minus ullam cumque dolorem et dolore enim possimus commodi quia aspernatur voluptatem odio ipsam et inventore delectus maiores et magni ut accusantium et qui occaecati voluptates explicabo vel quasi atque ducimus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-19', '2017-05-14 04:17:14', '2017-05-14 04:17:14');
INSERT INTO `lesson` VALUES ('269', '8', 'Iusto hic natus esse ut et quo provident dolor id laudantium.', 'Aliquid neque hic eum ratione enim impedit tenetur libero voluptas aut qui aspernatur suscipit quia velit necessitatibus omnis natus accusantium qui doloremque eligendi saepe ea et unde cumque excepturi iusto nesciunt autem sunt non praesentium dolorum eos hic quidem tenetur sint rem magni facilis saepe eos explicabo aliquid blanditiis commodi minus molestiae aut sequi voluptatem tenetur est ducimus ut repellendus possimus commodi modi quo perferendis consequatur maxime labore nihil non ea cumque maxime enim in et amet nihil non quia et non tempora est labore beatae et non assumenda dolore aliquid voluptas placeat nulla nobis qui ab consequatur voluptatem dolores asperiores quae delectus sint est minima possimus facilis voluptatum laborum et ut quam aut dolor occaecati consequatur minima placeat voluptatem recusandae sequi fugiat cum quam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '24', null, '0', '1', '2017-05-15', '2017-05-14 04:17:14', '2017-05-14 04:17:14');
INSERT INTO `lesson` VALUES ('270', '9', 'Quaerat esse aliquam itaque nisi esse quis.', 'Occaecati quia impedit veritatis unde temporibus qui delectus enim velit necessitatibus cumque sunt cum voluptatum tempora ipsa unde veritatis quidem accusantium ut molestias sed excepturi minus fuga esse repellendus corrupti ut ut perspiciatis facere nulla voluptate iusto voluptates rem consequuntur deserunt rerum in illum id ea aut totam voluptatibus ea sit provident pariatur provident aut laudantium deleniti voluptates consequatur modi placeat qui et omnis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '42', null, '0', '1', '2017-05-18', '2017-05-14 04:17:14', '2017-05-14 04:17:14');
INSERT INTO `lesson` VALUES ('271', '27', 'Sunt est facere quis esse ab consequatur commodi quas repellendus.', 'Corrupti sit non ea expedita commodi quae quibusdam aut iure officiis veritatis nihil molestiae accusamus quasi odio dolores quibusdam debitis aspernatur hic sed perferendis quis nam ut nihil est ut ab eum voluptas numquam velit maxime placeat nihil et architecto provident perspiciatis sed et molestias voluptatem aperiam quam voluptatem sed ratione deserunt ratione fugit totam dolor qui delectus eaque consectetur ab eius eligendi aspernatur ut ut officia error quam corporis occaecati est.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-16', '2017-05-14 04:17:14', '2017-05-14 04:17:14');
INSERT INTO `lesson` VALUES ('272', '22', 'Et natus dolore dolorem dolor est eos sint.', 'Aut aut placeat culpa enim est voluptatem cupiditate temporibus est sint dolor molestiae accusantium in voluptate alias quia sunt sunt provident qui possimus minus vitae magni eos doloribus eligendi voluptas provident iusto magni est vel non in quasi harum sed eos sed quis sunt accusamus tempora accusantium asperiores odio harum excepturi ipsum odit aut in similique velit repellendus itaque in assumenda sed et aspernatur quos architecto veritatis ut voluptas veniam architecto deserunt temporibus voluptatum deleniti molestiae delectus optio vel sunt id dolores enim laboriosam expedita dolorem cum et reiciendis itaque accusantium ut voluptatem sed et debitis dolor nam rerum est qui nam quo itaque est eos optio at molestias iusto animi placeat.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-14', '2017-05-14 04:17:14', '2017-05-14 04:17:14');
INSERT INTO `lesson` VALUES ('273', '13', 'Deleniti accusamus odio recusandae laudantium consectetur mollitia.', 'Laudantium soluta eum repudiandae inventore id maxime qui vitae nisi et eaque cum velit exercitationem labore quia voluptas commodi error aliquam qui quisquam libero ipsa velit et et dolore labore excepturi sed asperiores et nesciunt minima quaerat voluptatum est esse omnis et est sunt mollitia velit ea aspernatur autem reiciendis reprehenderit adipisci vitae sit tenetur id quae nostrum a consequuntur dicta facere quis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '31', null, '0', '1', '2017-05-19', '2017-05-14 04:17:14', '2017-05-14 04:17:14');
INSERT INTO `lesson` VALUES ('274', '18', 'Nulla non id omnis eligendi autem error nemo.', 'Ex beatae quia molestias non quod maxime assumenda possimus qui nesciunt nisi voluptas aut atque qui maiores aliquid dolores dolore quas est sit deleniti autem optio eveniet sequi vero quibusdam ducimus nesciunt non beatae consequatur vero veritatis beatae est qui sed ut repudiandae veniam quis blanditiis reprehenderit dicta vero facilis facere occaecati esse facere amet error quas voluptate in est officiis quae.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '22', null, '0', '1', '2017-05-18', '2017-05-14 04:17:14', '2017-05-14 04:17:14');
INSERT INTO `lesson` VALUES ('275', '16', 'Exercitationem sed et quos pariatur sint et et ipsa.', 'Impedit distinctio voluptas rem quibusdam laborum dolores sapiente tenetur quod ullam eos et hic illum repellendus velit facilis inventore quam ad facilis illum et accusamus debitis iste asperiores nobis officia rerum repudiandae aspernatur sed quod qui ex suscipit molestias eos rerum magni reiciendis inventore iusto dolores consequatur rerum ipsam velit quam ullam sint quisquam quia qui soluta itaque qui illum est illo laboriosam et tempore consequatur eius pariatur aliquam dolorem eaque et deserunt qui eius rerum sunt qui temporibus deleniti libero ipsum ut labore ullam quidem eos occaecati et in iste mollitia debitis a dolorum minus fuga placeat et veniam nobis dolores libero neque voluptas blanditiis quis ullam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-16', '2017-05-14 04:17:14', '2017-05-14 04:17:14');
INSERT INTO `lesson` VALUES ('276', '4', 'Ipsam eius molestiae ducimus saepe minima corporis explicabo inventore.', 'Voluptas doloribus ipsum occaecati veritatis asperiores vitae accusantium et ut iste rem voluptas sed mollitia neque eveniet iure dolor quis eveniet soluta voluptates dolorum hic ullam nesciunt et voluptatibus voluptatem voluptatum aut repellat occaecati veritatis perspiciatis similique est est quibusdam eius autem nulla mollitia incidunt quo aliquid libero incidunt cumque nisi soluta et quasi id optio in est temporibus est odio autem quas amet omnis porro voluptatem dicta repellat dolor autem nobis dolor eum eaque corrupti a est dolorem in non rerum et non soluta.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-15', '2017-05-14 04:17:14', '2017-05-14 04:17:14');
INSERT INTO `lesson` VALUES ('277', '30', 'Corrupti doloribus quisquam quis saepe nihil soluta quae voluptates.', 'Minus unde voluptatibus beatae sit velit eum doloribus esse porro aut nulla qui optio molestiae asperiores voluptas enim totam quo aperiam consequatur qui et illo praesentium labore similique voluptatum modi sapiente at voluptatem aut repellat sit ullam iusto magnam in labore blanditiis quae magnam eaque et repellendus perspiciatis qui maiores quasi modi quasi porro nemo debitis corporis illo quo molestiae ratione aliquam ratione dolorem eligendi officiis totam facilis quibusdam vero cupiditate quis et non eius consectetur veritatis itaque minima voluptatem ducimus qui amet ab ex est distinctio impedit odit sapiente optio nisi quod est ratione a velit et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-19', '2017-05-14 04:17:14', '2017-05-14 04:17:14');
INSERT INTO `lesson` VALUES ('278', '16', 'Iusto tempora deleniti sit dolores illo aperiam.', 'Sed sint velit ut ipsum enim ad recusandae ab aut minima voluptatem velit aliquam quos rerum dolorem modi est fuga sint temporibus voluptatum repellat accusantium iste et laboriosam ut repellendus nulla in ipsam blanditiis laborum quae ut atque eligendi commodi sequi iusto quam qui sed corporis dolor magnam odio aut eveniet laudantium odio repellat illo et eaque vitae illum ea quia laboriosam natus et quia quo illum porro ea illo asperiores et velit ad beatae ea et voluptatem voluptas libero asperiores vero fugiat sequi optio fugiat reprehenderit in sed vitae dolores voluptatem sunt unde cumque fuga rerum aperiam incidunt ab ducimus rem officiis consectetur recusandae enim est quaerat recusandae sunt voluptatem occaecati quia et ducimus aut impedit deserunt voluptatem animi libero qui aut facilis illum nisi sed sequi quo fuga explicabo repellat deserunt saepe sed quis ut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '20', null, '0', '1', '2017-05-19', '2017-05-14 04:17:14', '2017-05-14 04:17:14');
INSERT INTO `lesson` VALUES ('279', '14', 'Sit voluptatem et autem quam eos vel cupiditate voluptatem non.', 'Dolorem aliquam vero atque sint voluptas dolorem cum laudantium consequuntur quia at et iste nemo placeat fugit tempora amet omnis quis beatae repudiandae ea accusantium quaerat amet omnis ea aut rerum aut debitis maiores illo eveniet et laboriosam asperiores illum velit itaque ut distinctio laudantium laudantium voluptas labore et eos quos dolor molestias perferendis eos animi aut sed dolor dicta nam ratione voluptates quos aut sed nihil impedit corrupti maiores qui quod beatae consequatur harum sapiente maxime quia aut eius natus iste eos rerum libero officiis aut aut necessitatibus consequatur harum sit eum aut possimus ullam dolores eos nihil et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-16', '2017-05-14 04:17:15', '2017-05-14 04:17:15');
INSERT INTO `lesson` VALUES ('280', '16', 'Et ipsa possimus fugiat libero quasi perferendis.', 'Illo impedit aut qui qui blanditiis quasi quasi nemo magni maxime aliquam consectetur laboriosam totam unde ut tenetur consectetur numquam nam in aut quo iusto aliquid ut ut saepe eligendi sunt rerum nobis sit ea ea tempora deleniti fugit iste eveniet quas fuga perspiciatis nam consequatur eveniet quo et voluptates facere rerum libero nemo iste facere ea sunt earum cupiditate dolores rem voluptatem molestiae consequatur est et et autem molestiae accusantium rerum molestiae sed exercitationem neque aliquam reiciendis laboriosam vero molestias quia dolorem repudiandae cupiditate consequatur unde corrupti repellendus dolor quasi doloribus eum laborum molestiae ullam cumque aspernatur dolores rerum quia placeat molestiae officia sequi eos ab nostrum quae tempore exercitationem aperiam dolores maiores minima sed recusandae corrupti sapiente nobis ducimus similique sed nisi repellat magnam aut dignissimos consequatur eius facilis incidunt consequatur cupiditate magni est quasi.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-18', '2017-05-14 04:17:15', '2017-05-14 04:17:15');
INSERT INTO `lesson` VALUES ('281', '4', 'Perspiciatis necessitatibus quo quia reprehenderit unde qui totam.', 'Expedita est vero sed accusantium ipsam quod est incidunt molestias omnis et corporis provident incidunt qui repellendus asperiores voluptas aut numquam repellat est ut impedit dolorem expedita ut hic ad eos consequatur reprehenderit maiores dignissimos dolorem quod eligendi doloribus corrupti ipsum rerum aut omnis ut placeat et ut sit esse qui laudantium sit ut odit voluptas a vel ea nemo quisquam quas est a autem doloremque quibusdam at consequatur quis dolor fugit eius voluptas veritatis tempore rerum fugiat qui aut eos eius quisquam eveniet voluptatum corporis fugiat sunt amet omnis excepturi assumenda mollitia expedita quasi ut nesciunt laudantium ad quos necessitatibus et sit vel.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-18', '2017-05-14 04:17:15', '2017-05-14 04:17:15');
INSERT INTO `lesson` VALUES ('282', '29', 'Impedit repudiandae odio in voluptatem consequatur suscipit quia sunt non.', 'Qui magni placeat sit nisi vel possimus eos et quam omnis totam aut rerum quidem fugiat similique earum et consequatur ullam enim quas explicabo sit sapiente quia beatae et error vel est quo quia assumenda et voluptatem officiis consectetur id voluptatibus consequatur sequi quos ut iure rerum dicta illum et natus blanditiis voluptas consequuntur libero minima voluptas excepturi deserunt blanditiis debitis sed rem est consequatur voluptatem cumque ut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-17', '2017-05-14 04:17:15', '2017-05-14 04:17:15');
INSERT INTO `lesson` VALUES ('283', '27', 'Voluptatibus voluptatibus assumenda quas sapiente eligendi quis earum voluptatum.', 'Cumque atque doloremque labore laudantium ipsum ex dolorum sit quas ea repudiandae et pariatur voluptatem quia tenetur dolor dolorem et numquam natus quam eos aspernatur aliquid quisquam autem corporis tempore quia deserunt atque qui quis molestias id ut delectus et et neque ut ab consequatur dolor reprehenderit doloribus voluptates dolores quibusdam similique fugit non distinctio aut quia dolores ea totam minus inventore placeat iusto culpa et molestiae aliquam sit sunt qui aliquid exercitationem accusamus voluptas dolores aliquid non recusandae et atque quae similique recusandae molestiae harum unde magni omnis tempore consequatur sint molestiae deleniti aut optio exercitationem ipsam incidunt illum maxime voluptatibus enim sapiente.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-17', '2017-05-14 04:17:15', '2017-05-14 04:17:15');
INSERT INTO `lesson` VALUES ('284', '4', 'Repellat qui unde quisquam quia quo inventore occaecati esse sequi neque animi.', 'Aut omnis omnis non sequi et velit voluptatem illo dicta alias fugiat consectetur minus ut est earum atque iure aut velit voluptates doloremque fugit aperiam vel voluptatem impedit accusamus adipisci aliquid magni sint deserunt eos nostrum et aut magni et eos in voluptates cum consequatur laborum numquam praesentium earum autem commodi atque officiis velit provident ut quia molestiae quidem repellat quo quis in saepe aut sed voluptatem asperiores veritatis iusto iste eos doloribus doloremque repellat dolor ut officiis sed vitae ex voluptatum sequi voluptate quos.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-17', '2017-05-14 04:17:15', '2017-05-14 04:17:15');
INSERT INTO `lesson` VALUES ('285', '5', 'Consequatur dolorum enim placeat harum eaque sint est dolor.', 'Minima quo qui at quasi id enim perferendis voluptas facilis laborum ratione consectetur ab qui consectetur rerum alias necessitatibus excepturi in illo rerum voluptas similique quasi et quis voluptates dolorem perspiciatis neque a veniam nemo adipisci molestiae voluptas accusantium aut velit fugit est alias pariatur aspernatur veritatis et expedita voluptatibus voluptatem pariatur magnam quia laudantium quidem quidem assumenda sint aliquam ut fugit eligendi.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '36', null, '0', '1', '2017-05-17', '2017-05-14 04:17:15', '2017-05-14 04:17:15');
INSERT INTO `lesson` VALUES ('286', '18', 'Tenetur id et adipisci et ratione aut est neque quaerat et fugiat.', 'Nam beatae quas nam hic suscipit aut itaque perspiciatis nesciunt excepturi atque perferendis quam est eos fugit molestiae quod aut omnis atque qui aut ducimus animi recusandae porro eos a fugiat qui nulla ratione dolore voluptatum dignissimos et deleniti nemo est aliquam rerum consequatur quisquam voluptates voluptatem omnis ut veniam sit esse tempora est pariatur nam rerum quo eveniet voluptatibus voluptatum aut optio illo et non neque dolor suscipit aut iusto id sequi placeat quae autem enim ut excepturi eum veniam quasi saepe harum natus molestiae quis voluptatem ratione minima impedit dicta nemo commodi quisquam mollitia quae officiis iste aut eaque aperiam minima odio et ipsam et modi autem quia excepturi facilis odio amet omnis quibusdam omnis dolorum non non minima aut aperiam sit in est.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '42', null, '0', '1', '2017-05-18', '2017-05-14 04:17:15', '2017-05-14 04:17:15');
INSERT INTO `lesson` VALUES ('287', '15', 'Quia aut a accusantium inventore aspernatur aut repudiandae.', 'Voluptas labore reiciendis soluta quia quam modi fugit fuga eveniet sint qui laboriosam iusto quos blanditiis eum labore repudiandae ut et cumque odit reiciendis qui est a et sunt magni optio repudiandae quia numquam autem nisi deserunt facere tempora minus modi fugiat aliquid dolore ut ipsum dicta quasi ipsum iusto velit maiores pariatur eum et nobis et in ipsum totam enim nihil quo commodi vel eius illo ipsa minima illo temporibus eum enim esse incidunt dolorem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-18', '2017-05-14 04:17:15', '2017-05-14 04:17:15');
INSERT INTO `lesson` VALUES ('288', '27', 'Quaerat error consequatur voluptatem quaerat nesciunt ut veniam.', 'Enim voluptas corporis ratione impedit accusantium dolore laudantium neque voluptas dolore et non provident voluptatem dolor ea totam non voluptatem quod et nihil occaecati aut iure mollitia soluta autem voluptas vel ipsa et necessitatibus dicta et et non voluptates velit et fugit aperiam est eum quos sequi quas porro impedit eaque illum sequi nobis officia illo ut accusantium et qui omnis id sapiente illum consequatur dolorum modi dignissimos quis ducimus ipsam aut ex provident qui id ea officia nisi quidem culpa qui quos esse vero dolorem ex officiis sit exercitationem voluptas et deleniti culpa quis minus qui dolorem porro ratione est esse error quaerat aperiam ex unde quaerat.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '42', null, '0', '1', '2017-05-17', '2017-05-14 04:17:15', '2017-05-14 04:17:15');
INSERT INTO `lesson` VALUES ('289', '18', 'Officia tenetur dolor aliquid consectetur ut.', 'Voluptatibus in quas dicta aut neque vitae nesciunt voluptatem est consequatur sit voluptatibus vero est omnis eaque sit dolor sed eum est officiis aliquam minus omnis in doloremque voluptates minima asperiores veritatis nulla animi qui excepturi consequuntur omnis reiciendis aut est deserunt expedita est magnam ratione natus eum ea ut ut harum facilis voluptas fuga laboriosam necessitatibus sunt dolorem dolores provident qui ut quam laudantium atque corporis et et aut quia sed nobis illo temporibus debitis ea accusantium quasi saepe esse deleniti eum sint autem voluptatem praesentium nobis quo facilis aut aut adipisci quisquam reprehenderit sit illum id inventore omnis ullam velit aut quas et fugiat voluptatibus enim nostrum corporis quo esse quod molestiae dolores architecto vero magnam accusantium exercitationem ullam distinctio dolores vel fugiat inventore officia rem dolore dignissimos culpa molestiae eos in quis voluptatem expedita possimus sit veniam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '27', null, '0', '1', '2017-05-19', '2017-05-14 04:17:15', '2017-05-14 04:17:15');
INSERT INTO `lesson` VALUES ('290', '27', 'Eveniet aut aliquam aperiam amet eius quasi quaerat dolorum.', 'Ut harum et et praesentium qui quia dolorum earum et non illum ipsum aut natus eius amet sed eaque sint explicabo ut ea eaque sed quo eligendi minus sunt deserunt non voluptas voluptatum qui quasi aut laboriosam est similique et ab sapiente quis atque consequatur totam debitis et repudiandae soluta aut est asperiores corrupti quo earum a aliquid voluptatem sunt autem qui aperiam repudiandae atque debitis quia et ducimus sit molestias quidem commodi quia officiis illum et natus tempore vitae libero earum minus impedit debitis eligendi eius optio quam quia assumenda suscipit dolorem temporibus nostrum earum aliquid hic asperiores incidunt autem molestias aperiam minima aut officia nisi ipsum id ut quas quisquam quaerat accusamus nam enim rerum voluptatem qui neque repellat voluptates eaque quaerat aspernatur dolorem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '47', null, '0', '1', '2017-05-17', '2017-05-14 04:17:15', '2017-05-14 04:17:15');
INSERT INTO `lesson` VALUES ('291', '25', 'Dicta qui quis quae modi quo ipsam.', 'Excepturi qui voluptatem nam aliquam vitae eos pariatur nihil reprehenderit quia quae est vitae reprehenderit ut quaerat quisquam laudantium id reiciendis eos veniam delectus adipisci rerum ut voluptas veniam ratione aut in dolores optio autem quis aperiam distinctio dignissimos et similique sit voluptates perspiciatis doloribus quaerat voluptas ut officia id deleniti laborum reprehenderit nobis quis dicta error sunt aut inventore fuga cumque dignissimos quisquam blanditiis officia in quia aut quidem totam vero ut consectetur dolore consequatur ad temporibus iusto earum in voluptatibus est aspernatur quidem adipisci perferendis assumenda ut velit nemo modi libero qui reiciendis beatae error possimus numquam atque quod dignissimos facere ullam ut illum dolor fuga commodi et molestiae.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-17', '2017-05-14 04:17:15', '2017-05-14 04:17:15');
INSERT INTO `lesson` VALUES ('292', '22', 'Quia pariatur excepturi sequi amet dolore mollitia sunt vel.', 'Aut voluptas et vel doloribus quibusdam maxime ex expedita iure ut iusto voluptatum dolores enim aspernatur dolores sed rerum adipisci quo corporis quia a numquam nam quo esse qui inventore laudantium odio excepturi voluptatem voluptatem unde vero ratione tenetur distinctio voluptatem repellendus et at sequi accusamus alias at dolorem non aliquid sit sequi repudiandae non quia et labore animi dolores earum est ut omnis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-18', '2017-05-14 04:17:15', '2017-05-14 04:17:15');
INSERT INTO `lesson` VALUES ('293', '23', 'Voluptatem corporis quia iure nostrum mollitia veniam et perferendis quia dolorem.', 'Repudiandae iste dicta itaque dicta sed numquam repellendus similique debitis quis omnis libero ducimus laborum non et ratione voluptas est praesentium omnis tenetur libero eum veniam recusandae quia ipsum eum natus itaque aut pariatur sunt necessitatibus ut laborum dignissimos quibusdam architecto iusto placeat quis qui est nam pariatur culpa quod quidem at quo sunt dicta quae aut officia tempora odit et error quas aperiam quas iusto sed est delectus id a vero ratione tenetur aut ad id rerum quis laborum voluptatem distinctio quibusdam nobis est fuga vitae omnis id itaque at accusantium officia est eos ut dolorem est libero molestiae eaque non qui odit rem exercitationem totam corporis voluptatibus earum dolores officiis adipisci quos harum atque voluptates ipsum aliquid sit omnis accusamus culpa aperiam est dolorem voluptates libero cum voluptas aut non reprehenderit omnis ullam excepturi nam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '36', null, '0', '1', '2017-05-14', '2017-05-14 04:17:15', '2017-05-14 04:17:15');
INSERT INTO `lesson` VALUES ('294', '9', 'Molestias dignissimos quod sunt aut eius.', 'Nam et et consequatur non vitae tenetur sed fugit architecto sint dolor qui voluptas eligendi itaque non exercitationem est et consequuntur aut tenetur nam voluptas maiores quia enim et expedita magnam aut ut neque expedita quia necessitatibus suscipit adipisci dignissimos voluptatem aut porro sit numquam fuga occaecati quam qui quia molestiae nihil quae dolorem occaecati ipsum sit aliquam quam quos voluptatem pariatur fuga qui est dolorum eos dicta ex vel rerum et quibusdam neque consequatur fugit vel nobis voluptas quis aut enim aperiam consequatur accusamus consequatur et qui magnam quidem suscipit aut dolores quidem dolorum fugiat est modi odit odio rerum quas et eligendi aut dolores tempora dolores totam quibusdam autem odio aut rerum consectetur dolorum assumenda earum aut nemo earum est reiciendis est sint perspiciatis quos eius voluptatem odit excepturi ipsam officia illo sit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '31', null, '0', '1', '2017-05-15', '2017-05-14 04:17:15', '2017-05-14 04:17:15');
INSERT INTO `lesson` VALUES ('295', '20', 'Quia beatae delectus a quia aut dolor commodi magni.', 'Et eos beatae optio laboriosam sed eaque quis nostrum placeat ipsa quos fugiat vitae aut praesentium id est sequi fugit maxime quas iste libero in recusandae ipsam molestiae consequuntur aut dolorum quia iusto sint exercitationem nihil quaerat eaque blanditiis incidunt perspiciatis voluptate dolore ut deleniti molestiae autem suscipit vel et mollitia architecto doloribus autem eius vero quo adipisci officia vel autem sequi suscipit consequatur quia occaecati rerum voluptatum enim id ab aut nisi dignissimos et omnis et alias quaerat dolores quos voluptatibus deleniti ipsam ipsa et qui expedita ut sunt tempore quidem libero neque a qui ullam commodi est nisi possimus quia laborum voluptatem ut aut pariatur enim accusantium suscipit ducimus ut totam mollitia.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-14', '2017-05-14 04:17:15', '2017-05-14 04:17:15');
INSERT INTO `lesson` VALUES ('296', '8', 'Laborum non mollitia quod aut ut ratione odio at.', 'Iste enim impedit ab tempora consectetur vel impedit eos eum inventore quia non dolores et voluptas ea consequatur voluptatem in quia minima laboriosam beatae et vitae quo dolorem ipsam impedit quos ut quas rerum voluptatem voluptates et non vel occaecati dolorem autem et officia non id nam reprehenderit aperiam occaecati voluptate voluptatem sequi explicabo sit deserunt dolorem excepturi quibusdam ratione asperiores fuga unde accusamus maxime vel earum dolorem quaerat et et consequatur aliquid sed voluptate ut reprehenderit temporibus id ut rem blanditiis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '23', null, '0', '1', '2017-05-17', '2017-05-14 04:17:15', '2017-05-14 04:17:15');
INSERT INTO `lesson` VALUES ('297', '29', 'Est fuga saepe voluptatum est eaque autem qui sit.', 'Ipsa maiores voluptatem quod ut soluta rem rerum sit autem praesentium et tempore harum iure velit ad illo veritatis odit modi possimus maxime sit rerum et fugit libero iure et aliquid accusantium vel illo beatae sit incidunt est voluptas quibusdam vel molestiae perspiciatis totam qui et explicabo aspernatur dolore in consequatur voluptates fuga magni id atque ex at id architecto natus culpa aliquid ullam dicta vel sed numquam nam ipsam consequatur placeat illum et maiores cum in a aliquid quidem voluptas repellat reiciendis ut nulla architecto in sint et eum similique repellendus deleniti eaque quod ex enim impedit minus sint ea doloremque tempora accusantium dolores optio quia in voluptates ad doloremque velit aut omnis labore qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-14', '2017-05-14 04:17:16', '2017-05-14 04:17:16');
INSERT INTO `lesson` VALUES ('298', '5', 'Aut sapiente fugiat autem est non tempora eos tenetur esse quia.', 'Sapiente commodi est rerum unde ipsa sed et ut mollitia expedita quisquam et quasi maxime reprehenderit reprehenderit similique non modi nihil voluptatem aspernatur doloremque error alias omnis quia culpa exercitationem voluptas odio velit non aliquid et aut beatae ipsa quia tenetur et asperiores et tenetur nisi quo quasi consequatur quod ipsum nobis dolore omnis ea corrupti fugiat distinctio eos aut et aut impedit pariatur omnis rerum harum voluptatem velit eum voluptas dicta dolor totam consequatur aut ea reprehenderit sint ullam dolor quis perspiciatis iste qui repellat rerum autem et necessitatibus et iste nihil necessitatibus qui numquam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '23', null, '0', '1', '2017-05-14', '2017-05-14 04:17:16', '2017-05-14 04:17:16');
INSERT INTO `lesson` VALUES ('299', '4', 'Eum voluptatem maxime pariatur sint dolore illo.', 'Blanditiis aut consequatur excepturi nobis ipsa qui delectus eum et odio facilis aliquid error minus velit accusamus dolore ratione est quae vel non est quae voluptatem animi magni consequatur odio quo eos nihil non eos veritatis est quo dolorum sunt officiis nesciunt enim consectetur minima porro est velit eligendi autem ea nobis libero quam molestiae nulla laborum quo dolores in provident quia sequi quis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-14', '2017-05-14 04:17:16', '2017-05-14 04:17:16');
INSERT INTO `lesson` VALUES ('300', '17', 'Et qui aliquid sit quia aspernatur molestias fuga.', 'Ipsa soluta laborum et ratione quia sequi atque quos dolorum iste et inventore et et sit quia aut consequatur ex reiciendis adipisci qui non vel eos recusandae recusandae voluptas ex quibusdam in saepe aut aut et voluptatem sunt voluptas fugiat et autem vel saepe in ut eos inventore beatae esse voluptatibus non et error quia dicta accusamus officiis necessitatibus voluptatem consequatur et aut ut adipisci aut tempora quis aut blanditiis occaecati quis et similique et ullam ea possimus modi enim cupiditate omnis repellendus doloribus labore voluptates eum delectus quasi culpa maiores vel voluptatem omnis non natus dolor et sunt dicta voluptatem et harum repellendus assumenda aut sed perspiciatis id id enim quisquam ex accusantium assumenda labore inventore et et vitae eveniet deleniti nesciunt tempore numquam laboriosam vel nobis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-19', '2017-05-14 04:17:16', '2017-05-14 04:17:16');
INSERT INTO `lesson` VALUES ('301', '29', 'Nostrum sit non optio quae amet.', 'Explicabo maiores qui reiciendis ad sed eaque est fuga provident vero reiciendis accusantium adipisci saepe exercitationem aliquam praesentium ratione vero dolorem nisi provident dolorem veniam temporibus enim voluptatem hic voluptate ut ratione ea officiis molestiae et quia explicabo nostrum deserunt porro voluptatibus dignissimos cumque nihil et sapiente debitis natus dolorem culpa ducimus ut odio magni dolorum deleniti voluptatibus necessitatibus voluptas iusto voluptate vel harum ab et explicabo eveniet eos animi quasi est doloremque nihil ad alias ut pariatur sit nesciunt quisquam minus delectus placeat totam ea est sit et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-17', '2017-05-14 04:17:16', '2017-05-14 04:17:16');
INSERT INTO `lesson` VALUES ('302', '26', 'At qui est ad minus ut.', 'Nam qui qui incidunt nemo soluta quia error rerum rerum sint odit soluta officiis ut ea maxime omnis quo quisquam repellat aut consectetur molestiae itaque illum ut aperiam earum dignissimos maiores numquam illum architecto laboriosam aut voluptas id sunt atque odio quas facere nisi est est quia optio et sit suscipit iusto officia totam qui molestiae quibusdam est mollitia aut temporibus nihil et optio atque atque reiciendis laborum at et consequuntur nulla esse omnis fugit iusto voluptas reiciendis recusandae in dolor ut et voluptates repellat velit alias et eos quas consectetur sunt repellendus illo qui sint in molestiae est unde necessitatibus dolorem veritatis enim autem occaecati dolorum vel et voluptatibus sit maxime aut nihil corporis reiciendis repellendus aut id quos laudantium et nam nihil voluptatem consequatur ratione natus quia illo est nemo dignissimos quo molestiae qui a.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-14', '2017-05-14 04:17:16', '2017-05-14 04:17:16');
INSERT INTO `lesson` VALUES ('303', '15', 'Ex ducimus sint laudantium veritatis consequatur natus quod quia.', 'Temporibus aperiam omnis aut velit illum aliquam qui occaecati vel praesentium magnam modi quibusdam et porro est rerum facilis ut esse ut ipsa dolorum minus nesciunt dignissimos ducimus aut velit placeat corrupti sequi in libero modi sint minus est id dolorem et vero officiis non sequi perferendis necessitatibus et delectus quia et ducimus reiciendis beatae sed minus nobis qui sit sit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-17', '2017-05-14 04:17:16', '2017-05-14 04:17:16');
INSERT INTO `lesson` VALUES ('304', '4', 'Voluptatem a praesentium expedita dolore aut exercitationem rerum eveniet.', 'Aspernatur ut quaerat maiores aut autem aut ex eos et est aut voluptatibus magnam qui quam rerum non aliquam non est aut deleniti et quia numquam voluptatum a ut nihil eaque sunt distinctio quia veniam recusandae natus sed labore asperiores voluptas id dolore quis amet eos velit sit voluptas fuga sed rem rerum ipsa deserunt blanditiis explicabo id sapiente impedit animi sed blanditiis odio doloremque nihil veritatis dolor nam laudantium eligendi quis aliquam odit illum assumenda aut optio ratione eos voluptatem fugiat soluta eum dicta incidunt culpa dolore assumenda voluptatibus necessitatibus quis ut dolorem non corporis doloremque illo libero reiciendis et earum harum placeat voluptates provident harum doloremque tempora reiciendis nostrum veniam et sit est ut et a voluptate quasi quasi natus ad et dolor id ducimus quis quia.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '23', null, '0', '1', '2017-05-15', '2017-05-14 04:17:16', '2017-05-14 04:17:16');
INSERT INTO `lesson` VALUES ('305', '4', 'Praesentium expedita illum ut rerum nesciunt et inventore.', 'Aliquid ipsum placeat non ut quasi cupiditate voluptas aut nihil deserunt excepturi dolorem quia rerum et repellat laborum repudiandae aperiam impedit architecto autem quisquam voluptas eum cumque vitae et nihil ut voluptates soluta consectetur quasi adipisci at consequatur quia placeat nesciunt voluptas deserunt excepturi nihil corrupti est tenetur omnis nostrum necessitatibus maxime voluptate sit minus deserunt molestiae autem temporibus placeat rerum voluptates similique voluptatem dolor eveniet doloremque delectus porro voluptatem et enim maiores unde repellendus et voluptatem voluptatibus sit eum voluptas aut nam laborum provident sed nulla mollitia ullam delectus quia eos et mollitia dicta architecto.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-14', '2017-05-14 04:17:16', '2017-05-14 04:17:16');
INSERT INTO `lesson` VALUES ('306', '12', 'Nam velit cumque voluptates aut laboriosam.', 'Vel quis nihil tempore reprehenderit ea quibusdam porro sed ad aut officiis omnis recusandae omnis at esse deleniti amet quo quis quo quis velit et et necessitatibus commodi dignissimos voluptatem nesciunt ipsam quia illum sint architecto rerum ipsam vel illo quia voluptatibus neque fugit non unde nam doloremque ut eligendi quia minima enim delectus odio nihil ut et rerum error ut suscipit aliquid laboriosam laudantium at id voluptatum cupiditate tenetur asperiores consectetur qui corrupti sint voluptatum voluptatem ut vero similique odio dolore excepturi ut sint odit rerum et veniam aut natus ut ut consequatur velit tenetur soluta quod vel id vero dolor magnam adipisci ipsum ut facere.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-14', '2017-05-14 04:17:16', '2017-05-14 04:17:16');
INSERT INTO `lesson` VALUES ('307', '4', 'Magni rerum sint eum tenetur minima quia enim.', 'Adipisci et nemo velit reiciendis consequatur minus quo tenetur id officiis magnam et et qui qui quibusdam sequi harum adipisci in magnam at id pariatur aut nesciunt architecto voluptate eveniet consequatur fugit et enim nihil delectus repudiandae consequatur eum ut ut amet sint harum et distinctio ullam culpa pariatur adipisci et mollitia sint minima id sequi id sunt dolore quis veritatis est facilis libero alias ut quia recusandae tenetur tenetur ut eveniet illum minima sunt eligendi odio porro officiis facere quaerat.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-19', '2017-05-14 04:17:16', '2017-05-14 04:17:16');
INSERT INTO `lesson` VALUES ('308', '1', 'Atque error repellat saepe asperiores incidunt nesciunt consequuntur.', 'Laborum hic possimus explicabo nemo magnam incidunt autem maiores fugiat perspiciatis sint expedita in aliquid repellat minima voluptatem qui reprehenderit quos consequatur laboriosam maiores qui iure quo possimus explicabo molestias et omnis qui eaque ad excepturi iure dicta inventore aut qui harum alias quia suscipit magni voluptas ad dolor voluptatum et impedit suscipit debitis recusandae iusto sint cumque sapiente inventore voluptate aut labore est cupiditate ipsum recusandae consequatur id commodi consequatur nihil delectus inventore nihil consequatur dolor necessitatibus reprehenderit sed qui consectetur officia eaque odio repudiandae iusto quia rerum praesentium quia sapiente nesciunt eligendi qui dolores nemo laudantium magnam assumenda.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-14', '2017-05-14 04:17:16', '2017-05-14 04:17:16');
INSERT INTO `lesson` VALUES ('309', '22', 'Ipsa reiciendis dolorum aut inventore veniam ab nobis ex.', 'Quibusdam repudiandae aut assumenda maiores doloribus fugiat autem quis cumque quis asperiores odio doloremque similique id incidunt perspiciatis quia corrupti laborum et eveniet et a dolor et dolore necessitatibus dolor veritatis accusantium dolorem a et modi ut voluptate dolores et dolore dolorum placeat nihil est sit veritatis voluptatem ab voluptas est nostrum et eum blanditiis nam aliquam reprehenderit est quod consequatur ex officia maiores consectetur et voluptatem id recusandae eveniet sint quia tenetur quos sint eum doloribus possimus aut quod corrupti ex sunt inventore mollitia sed dolores in iure voluptatem fugit mollitia beatae voluptatum culpa doloremque voluptatem aut cupiditate ut qui animi omnis quis sed ab unde totam sint vero perspiciatis neque tempora eum quis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '45', null, '0', '1', '2017-05-16', '2017-05-14 04:17:16', '2017-05-14 04:17:16');
INSERT INTO `lesson` VALUES ('310', '20', 'Placeat necessitatibus sit eveniet voluptatum quia nihil blanditiis enim.', 'Nobis iure natus eveniet ipsa laborum cum repellat nisi quo quod sed iusto labore eum magni quod saepe numquam praesentium consequatur eveniet non atque pariatur quo itaque voluptas quia totam ipsa ut minima non accusamus fuga maxime recusandae voluptatem quia corporis sed similique perferendis harum voluptas praesentium perspiciatis ducimus laboriosam pariatur illum fugit beatae ut enim temporibus nihil consequatur ut eaque inventore amet sapiente quo quod qui molestias autem tempore sed et ut non id a unde repudiandae blanditiis dicta enim nobis doloremque ut nemo et nihil aut sit explicabo ut facilis in quidem illum et placeat vitae eaque quo qui ipsa vero fuga veritatis et voluptatem omnis aspernatur dolor est voluptatem expedita animi quasi nihil aspernatur rerum praesentium rerum exercitationem officia consequatur ea ducimus voluptas laborum ut impedit molestias reiciendis et modi ab ut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '24', null, '0', '1', '2017-05-16', '2017-05-14 04:17:16', '2017-05-14 04:17:16');
INSERT INTO `lesson` VALUES ('311', '15', 'A aut ipsum occaecati aut culpa.', 'Quo delectus quia vel non eius officia voluptate iste possimus corrupti dolorem labore et qui omnis occaecati blanditiis non nesciunt minima aliquid accusantium sed qui amet quis aut ipsam rem laborum fuga non et enim quidem ex repellat aut et voluptatem et sit ut sit reprehenderit odit placeat est tempora odio voluptates esse autem velit rem iusto voluptatum a quidem corporis quibusdam omnis suscipit quibusdam incidunt dolorem explicabo blanditiis deserunt iure nesciunt dolores quia sint sed rerum earum et voluptatibus esse eos et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-14', '2017-05-14 04:17:16', '2017-05-14 04:17:16');
INSERT INTO `lesson` VALUES ('312', '30', 'Voluptates vel officiis autem delectus autem et aliquam.', 'Debitis eos dolores a dolorum aspernatur neque qui deleniti at eum repellat quidem nesciunt repellat aspernatur dicta provident rerum et tempora modi quod vitae quis repellat quaerat at qui quis sed nam dolores omnis non quas voluptatem impedit qui officia quia aut rerum ratione consequatur quis iusto quae optio voluptas ducimus esse molestias rerum voluptates labore et facilis id rerum vel magni culpa voluptas consequatur molestiae vel ut quod harum nobis sapiente qui minus culpa dolor est eligendi et id omnis iure qui provident iure aut et voluptas est voluptatibus aliquam architecto aspernatur sit nemo distinctio praesentium atque cum sed nihil quasi dolore dolores facilis non consequuntur sed eos.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-14', '2017-05-14 04:17:16', '2017-05-14 04:17:16');
INSERT INTO `lesson` VALUES ('313', '11', 'Deleniti voluptatem est et consequatur quidem sit consectetur placeat dolorem.', 'Blanditiis fugiat quasi rerum corrupti est non odit architecto sed qui doloremque sunt quia maxime nesciunt odio voluptas labore repellat cupiditate et velit omnis minima et ut ipsa tenetur quam nulla perferendis tenetur in officia magnam esse quibusdam nam a quae vel quia similique alias dolor et numquam aperiam odio iusto accusantium unde eius cupiditate distinctio tempore voluptates cumque minima ut veniam inventore et commodi ex nam amet harum nesciunt et vero facilis quibusdam quisquam magni odit aspernatur enim ab et est veniam vel consequuntur non atque quisquam suscipit porro aliquid.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '20', null, '0', '1', '2017-05-15', '2017-05-14 04:17:16', '2017-05-14 04:17:16');
INSERT INTO `lesson` VALUES ('314', '4', 'Dolor alias eligendi deserunt reiciendis voluptas qui sed fugiat suscipit perferendis.', 'Magni laboriosam vitae eos dolorem fugit omnis nam amet dicta et quis tempora eos dicta ipsa est natus et mollitia ut ut voluptates eum quia doloribus libero possimus nihil rerum eveniet fuga enim illum enim et autem sit vitae et eos velit rerum est similique excepturi est sequi ab porro eum id ut accusantium architecto veritatis nisi labore earum in ut sit aut vitae expedita debitis facilis ducimus magnam deleniti autem quidem non sed aliquam rerum maxime fuga id.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '45', null, '0', '1', '2017-05-18', '2017-05-14 04:17:16', '2017-05-14 04:17:16');
INSERT INTO `lesson` VALUES ('315', '21', 'Sunt tenetur expedita dolor et ut qui expedita temporibus illum quidem.', 'Ipsa unde provident facere atque nemo temporibus culpa quam labore possimus distinctio quidem temporibus quasi aut ipsa optio saepe qui deserunt sit ut sunt qui quas corrupti aperiam et perferendis facere soluta fugit a magni quam voluptate sed ipsa doloremque vel nisi saepe corporis aut alias dolor sapiente provident assumenda fugiat aperiam ab debitis deserunt natus at sunt consequatur sunt voluptas a doloremque eum excepturi est ea quae assumenda eum voluptas nihil enim odit veritatis qui vel rerum labore et occaecati aut non laboriosam quod perspiciatis accusantium dignissimos ea consequatur possimus excepturi est esse nulla modi ducimus dolores et molestiae ad et non.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '45', null, '0', '1', '2017-05-15', '2017-05-14 04:17:16', '2017-05-14 04:17:16');
INSERT INTO `lesson` VALUES ('316', '19', 'Reprehenderit amet fugiat possimus officiis sequi eaque.', 'Debitis incidunt veniam sed quis sit nobis ut qui voluptatem voluptatem qui vel velit rerum minus et vel quasi et sunt debitis voluptatem consequuntur omnis deleniti in qui ut et qui exercitationem ut modi voluptas harum illum eum maxime veritatis distinctio sit omnis ducimus qui explicabo quo excepturi eaque reiciendis nam fugiat voluptatibus commodi dolorem vitae in autem quo ipsa odio quia unde non impedit natus beatae quis temporibus ut sapiente eos ut vel voluptatem non accusantium at facere nobis inventore inventore nihil quo veniam itaque occaecati illum officiis aspernatur rem quia et sint eaque aut laudantium ratione totam et eligendi.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '28', null, '0', '1', '2017-05-18', '2017-05-14 04:17:16', '2017-05-14 04:17:16');
INSERT INTO `lesson` VALUES ('317', '16', 'Eius odio porro ut odio quibusdam deserunt explicabo.', 'Rerum autem quasi sint quia nam a aperiam adipisci consequatur nisi sint voluptatem rerum vero laboriosam quis cupiditate nobis ullam consequuntur dolorum voluptas vero nemo neque maxime asperiores aut voluptatem autem illum fugiat exercitationem aut aliquam adipisci porro libero incidunt odio et soluta reprehenderit non sunt reiciendis eum quo esse et molestias molestiae nesciunt nostrum est omnis qui eos iusto officiis illo in corrupti dolorem alias dicta qui nemo nihil veniam omnis est totam sit accusamus et quia et hic quo ullam quisquam sequi dolor aut eveniet itaque impedit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '28', null, '0', '1', '2017-05-16', '2017-05-14 04:17:17', '2017-05-14 04:17:17');
INSERT INTO `lesson` VALUES ('318', '16', 'Laboriosam nisi omnis quasi inventore enim quo.', 'Illum doloribus nemo voluptates consequatur mollitia corrupti quisquam qui et eos quo vel natus aut accusamus omnis iste harum reiciendis et ea odit sit officiis dolorem esse qui quis magni fugit necessitatibus corporis nostrum corrupti assumenda optio minus ex recusandae perspiciatis in quas voluptas est ut sed labore non repellat omnis ut fugiat expedita cupiditate cum expedita quae eum ut pariatur velit facere amet vel atque quidem maiores tempora itaque dicta eos omnis a et nam voluptas esse eos eligendi quos eius iusto voluptas necessitatibus blanditiis aliquid blanditiis necessitatibus laborum non natus praesentium aperiam rem ea labore dicta qui officiis vero sed sint ipsum ad delectus praesentium eveniet occaecati esse est tenetur.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '23', null, '0', '1', '2017-05-14', '2017-05-14 04:17:17', '2017-05-14 04:17:17');
INSERT INTO `lesson` VALUES ('319', '25', 'Neque nihil aperiam tenetur occaecati non laborum id at.', 'Esse cumque iste earum vero iusto qui voluptatem eum in similique eum tenetur quia qui nobis fuga dolorum omnis dolor velit est distinctio nam ipsum doloribus labore ullam optio et consequatur similique ad alias ut id aut quia qui velit doloribus voluptas et quidem id dicta modi aut quisquam pariatur et dolores non placeat non perspiciatis ut ea nihil reiciendis animi ex placeat quisquam vero quaerat ea officia voluptate molestias ea vel error expedita inventore sunt pariatur quas quos et quia.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '45', null, '0', '1', '2017-05-19', '2017-05-14 04:17:17', '2017-05-14 04:17:17');
INSERT INTO `lesson` VALUES ('320', '10', 'Accusantium repudiandae necessitatibus quis veniam temporibus architecto non et est neque.', 'Maxime rem autem at eius nulla qui ex animi fuga totam in reprehenderit et ea iusto quos tempore dolores dolor quis quas distinctio minima aut at tempore voluptas rerum enim sequi ea laboriosam et nobis iste eius provident consectetur incidunt excepturi officiis dolorum facilis facere dolorem consequatur dolores magnam adipisci et iste perferendis nam beatae laudantium ipsum error molestias impedit esse eaque et eligendi modi et eaque consequatur ut neque neque consequuntur ullam est sit qui aspernatur earum sit aut ab quia saepe nemo praesentium eos veniam itaque dignissimos a.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-19', '2017-05-14 04:17:17', '2017-05-14 04:17:17');
INSERT INTO `lesson` VALUES ('321', '6', 'Reprehenderit vero in aut quam est vel ipsam impedit.', 'Excepturi qui est nam in et aliquid ut quam autem ipsum et distinctio incidunt repellendus qui non ut ullam eius unde sapiente et qui laborum harum provident voluptatem quos perferendis officiis non omnis voluptatum et tempora non quo autem modi blanditiis sit doloremque soluta recusandae molestiae asperiores dignissimos sed ea numquam harum voluptas ab et explicabo ea ea iste repudiandae cupiditate a aperiam omnis itaque soluta sit qui quaerat aut iusto maiores at aut et consequuntur ut dolores voluptas iusto dignissimos fugiat id error et rerum recusandae architecto non vel eligendi qui quo beatae atque minus fugit enim ad nulla in quo porro doloremque voluptatem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '24', null, '0', '1', '2017-05-17', '2017-05-14 04:17:17', '2017-05-14 04:17:17');
INSERT INTO `lesson` VALUES ('322', '9', 'Est ipsam delectus amet libero qui optio eum.', 'Quo illo quia sapiente reiciendis iure sint autem ut expedita veritatis deserunt ipsam alias sunt ratione temporibus minima error dolorum corporis vero deleniti ex aliquam et eos natus et voluptates ut repellat hic nisi exercitationem voluptas ut modi architecto est minima sit quas est rerum eum amet maxime quas at voluptatem laboriosam nemo iste blanditiis ut ad vel recusandae culpa doloribus numquam repellendus quisquam id enim deserunt quasi animi ea.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-15', '2017-05-14 04:17:17', '2017-05-14 04:17:17');
INSERT INTO `lesson` VALUES ('323', '14', 'Nihil odio in maxime ut velit dolore.', 'Repellat eveniet harum omnis in nulla cumque nulla nobis aut odio dolorem et dolorem et quae tempore fugiat quis ex et est libero dolorem similique voluptatem nobis nihil quia velit illo qui accusamus tempora veritatis eveniet ipsum at voluptas dolores rerum in dolore iure sit illo possimus ab et pariatur architecto quaerat enim voluptates sit ut eligendi ea in iusto aliquam odit ducimus non deserunt perspiciatis est quibusdam sequi tempora sit et corrupti consequatur ut repudiandae autem natus a tenetur itaque rerum id dolorem corrupti facere quia molestias omnis fuga excepturi id nihil tempora iure possimus quae non aliquam suscipit ut occaecati ducimus voluptatibus necessitatibus labore qui quae.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '47', null, '0', '1', '2017-05-15', '2017-05-14 04:17:17', '2017-05-14 04:17:17');
INSERT INTO `lesson` VALUES ('324', '10', 'Ut aperiam quia quia aperiam fuga iste qui est temporibus repudiandae.', 'Quae provident quo modi facere veniam neque eum assumenda ad repudiandae veritatis sunt dicta natus quam qui ducimus rerum rerum nihil accusantium et ipsa ut consectetur qui dignissimos molestiae velit ut praesentium autem doloremque et soluta laudantium dolor vel est adipisci qui qui et id rerum quisquam at et iusto omnis laudantium architecto eum corporis similique quo qui non debitis itaque excepturi vitae mollitia omnis praesentium doloribus amet dolorum laborum et aliquid quisquam sit amet recusandae molestiae eos est quam odio et est sunt nemo asperiores ipsam corporis nostrum similique quia ipsam laboriosam temporibus aut dolores voluptas porro facere consequatur ratione ut molestias dolorem temporibus qui totam alias.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-17', '2017-05-14 04:17:17', '2017-05-14 04:17:17');
INSERT INTO `lesson` VALUES ('325', '27', 'Deleniti incidunt est possimus sit perferendis sed tempora.', 'Beatae est dolor vero quis quis aut ut quos maiores nisi quam eos fugiat nisi qui commodi ut ipsa quia cupiditate quo aut rerum commodi quo est eius alias ipsam adipisci quam nemo sapiente quod possimus est nostrum deleniti alias porro ut id et ut ipsa ut autem repudiandae occaecati voluptatibus qui odio id vitae omnis ullam alias enim est rem dolor eum culpa sit repellendus fugiat inventore sunt et ea alias quam sit fuga vitae possimus quod possimus tempora officia earum omnis pariatur totam quis aliquam aut voluptatibus dolorem quo debitis voluptatibus aut id est dignissimos iusto commodi fuga incidunt nihil explicabo quidem nostrum ab dignissimos quia laboriosam ea cum porro.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-17', '2017-05-14 04:17:17', '2017-05-14 04:17:17');
INSERT INTO `lesson` VALUES ('326', '28', 'Suscipit est omnis vel dolorem quia illo dolores laboriosam ut quia.', 'Consequuntur ea dolorum voluptates excepturi non sapiente suscipit a repellendus illum quod perferendis sit soluta sit unde iure ex quia in distinctio error ducimus non suscipit id qui tenetur aperiam illo ut officia rem in in eveniet laboriosam voluptas sit beatae dolorem odio adipisci neque vel eum repellat illo nihil tempore laborum quas expedita dicta iusto expedita ut temporibus ad deleniti omnis ratione asperiores animi neque eaque incidunt quo sit at temporibus est reprehenderit eius harum ut quidem voluptates ea omnis veritatis ipsam doloribus ea dolorum voluptatem sunt beatae corporis occaecati qui ullam nihil rerum inventore velit pariatur sit ducimus tenetur sunt quod accusamus sit unde et molestiae delectus earum adipisci et vel quaerat alias aliquid dolorem voluptatum autem et neque officia ut nihil autem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '28', null, '0', '1', '2017-05-19', '2017-05-14 04:17:17', '2017-05-14 04:17:17');
INSERT INTO `lesson` VALUES ('327', '6', 'Aspernatur vero ipsa illo aliquam fugiat similique ea consequatur.', 'Quis deleniti est qui natus ut exercitationem dolorum ea est dolor rerum sed exercitationem sed ab blanditiis praesentium labore molestiae dolorem architecto nulla sint quam aut natus voluptas consequuntur ea accusantium eos nihil quod optio dolor repellendus ut ea veniam illo aut ea ut qui ut nisi architecto ab illum et id aut tempore facere consequatur accusamus consequatur quaerat excepturi et sapiente ullam a atque laborum aut optio dolores esse ex doloremque explicabo quo reprehenderit ut natus atque id nulla laudantium et quia dolor quod ullam sunt est ex optio aut dolores illo earum et placeat est sunt voluptatem et tempore accusantium dignissimos laborum voluptas ut perspiciatis assumenda.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '23', null, '0', '1', '2017-05-17', '2017-05-14 04:17:17', '2017-05-14 04:17:17');
INSERT INTO `lesson` VALUES ('328', '6', 'Eveniet et doloribus est atque officia.', 'Quisquam enim similique veritatis aperiam sit cum officia deleniti blanditiis quod aperiam libero et praesentium natus eum id deleniti voluptatem repudiandae nam vero iusto saepe similique autem assumenda molestiae sed ut quos optio exercitationem recusandae ut qui illo eos aperiam omnis eos maxime consequatur sit consectetur ullam qui illum rem id et eum ullam illo perspiciatis dolore tempora rerum maxime et tenetur mollitia ut veniam tenetur atque saepe est sed eius vel commodi culpa facilis perferendis occaecati aspernatur quas aut eum ipsum hic fuga at et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '45', null, '0', '1', '2017-05-18', '2017-05-14 04:17:17', '2017-05-14 04:17:17');
INSERT INTO `lesson` VALUES ('329', '17', 'Aut in dolores voluptas nemo.', 'Fugiat quidem veniam laborum eos deserunt est error ea odit cupiditate porro ad excepturi id accusantium nesciunt aspernatur sunt alias est dolor explicabo sunt inventore eum voluptate libero quia sit dolores ea nam labore ab nesciunt reprehenderit aperiam rerum facere cumque deleniti et in quisquam eos quibusdam commodi harum veniam adipisci rerum perspiciatis consectetur culpa placeat blanditiis doloribus aut et ab ut cupiditate aperiam non possimus maiores officia nostrum ut occaecati dolor aliquam sunt dolorem voluptas et laudantium libero dicta aliquid voluptatem deleniti alias in quam aperiam nulla odio inventore rerum consequatur in vel in in ut quis blanditiis ullam accusamus non dolores minus et et autem voluptas architecto esse aut ab error mollitia deserunt sit libero ut eum delectus repellat dolor vero quia animi necessitatibus hic in ut neque temporibus quo dicta et recusandae debitis molestias.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-14', '2017-05-14 04:17:17', '2017-05-14 04:17:17');
INSERT INTO `lesson` VALUES ('330', '25', 'Sed sed in nostrum et nisi placeat occaecati culpa.', 'Quod ut ducimus doloribus deleniti neque natus asperiores quaerat velit adipisci repudiandae est voluptas est aliquam officiis autem aut aut dicta similique qui culpa rerum iure libero expedita est et repellendus dignissimos et quia placeat dolore quidem quis laudantium tenetur necessitatibus aut cupiditate est sed quisquam explicabo consequatur et ad culpa nihil aut molestias aliquid qui ipsam quia vero eos in itaque cumque quam qui sed facilis dicta non dicta quo dignissimos voluptas voluptatem et facilis amet provident omnis quasi sint nihil odio quidem asperiores voluptatem qui iusto eum earum rerum qui inventore cum at molestiae.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-15', '2017-05-14 04:17:17', '2017-05-14 04:17:17');
INSERT INTO `lesson` VALUES ('331', '24', 'Sit sint optio architecto eveniet ut quaerat aliquam tempore.', 'Animi sit nemo veniam dolore et nisi incidunt fuga fugit harum occaecati aut qui enim mollitia quae laboriosam harum eligendi voluptate rem cumque aut fugit eos perspiciatis consequatur et quod dicta similique dolorum deserunt voluptatem corporis recusandae laboriosam facere praesentium voluptatem dolor vero et et et ad dolores quo dolorem animi facere voluptatem tempora et maiores sit repudiandae ea nihil aut atque beatae cumque quod dolorem blanditiis nam ut atque quam provident qui neque omnis beatae amet atque sed et accusantium ut at ut voluptatem omnis ut dicta natus error esse aliquid voluptas sapiente harum quia aperiam facilis nobis consequatur et doloremque ut quasi.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-18', '2017-05-14 04:17:17', '2017-05-14 04:17:17');
INSERT INTO `lesson` VALUES ('332', '10', 'Eligendi sapiente est veniam nisi qui asperiores ipsum iusto.', 'Accusantium adipisci neque in inventore repudiandae recusandae ut omnis accusantium nihil voluptatem ut eligendi ea et sequi asperiores illo sed ex eum exercitationem facilis et eligendi debitis nihil ipsum dolorem sunt quia aut libero dolores ex ut qui omnis quia corrupti tempore neque ipsam aut commodi et optio accusamus et ducimus vero sint esse aut vitae dolores explicabo esse at quod quod minima unde enim porro et rerum excepturi quis nemo incidunt quia qui neque qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-19', '2017-05-14 04:17:17', '2017-05-14 04:17:17');
INSERT INTO `lesson` VALUES ('333', '30', 'Enim at alias velit qui recusandae esse quaerat vel eaque exercitationem.', 'Nostrum non natus dolor ut soluta sed eaque laborum temporibus id illo est labore dolor est debitis a et hic officia aut labore quia magnam nobis nihil ex tenetur maxime amet dolores fuga rerum vel quia non asperiores est delectus consequatur possimus unde tenetur sequi excepturi est mollitia repellendus ut corporis quos sint soluta dolor deleniti fugit aut vitae ducimus ut rerum necessitatibus numquam harum fugit animi voluptatem quam odit recusandae est mollitia neque odio saepe placeat error sed et nam repellendus sapiente non rerum odit fugit officiis ad est quia voluptas beatae.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-15', '2017-05-14 04:17:17', '2017-05-14 04:17:17');
INSERT INTO `lesson` VALUES ('334', '10', 'Facilis molestiae deleniti culpa qui debitis.', 'Quis tenetur ex rem magnam voluptates ab distinctio earum sit quia quaerat sapiente inventore excepturi qui fugiat accusantium earum sequi iure odio placeat enim modi maiores similique aut incidunt tempore quis repudiandae voluptates quasi voluptatem laudantium et labore omnis culpa porro non eum et exercitationem voluptatibus quia et doloribus fuga in distinctio officiis et consequuntur aut quia eum dolores omnis rerum quam repellendus consequuntur voluptates est possimus minus atque impedit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-19', '2017-05-14 04:17:17', '2017-05-14 04:17:17');
INSERT INTO `lesson` VALUES ('335', '19', 'Magni eaque nostrum numquam at.', 'Tenetur et omnis quia voluptas voluptas qui enim quam commodi ullam rem suscipit saepe soluta eum consequatur dolore minima commodi praesentium quaerat natus excepturi reprehenderit sint facilis placeat et consequatur asperiores totam ad nobis suscipit accusamus qui et nobis rerum consequatur ipsam adipisci reiciendis hic occaecati quaerat itaque quo quod dolorum quo deserunt ut itaque eum id perferendis architecto eum atque aliquid magni eaque velit non aut ipsum qui totam rerum repudiandae voluptatem incidunt at earum et est voluptatem reiciendis nihil voluptas harum debitis harum id voluptates asperiores dolore inventore tenetur magni praesentium sit porro ullam exercitationem iure dolores dolores totam qui deserunt molestiae deleniti labore ullam consequatur quo facilis incidunt delectus harum doloremque dignissimos odio impedit et soluta quia praesentium vitae similique corporis vel non ut sequi quo esse impedit quod voluptate rem ducimus dolore tenetur.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '31', null, '0', '1', '2017-05-15', '2017-05-14 04:17:17', '2017-05-14 04:17:17');
INSERT INTO `lesson` VALUES ('336', '17', 'Neque et aliquam et quae voluptatibus molestiae et et sint.', 'Adipisci praesentium ut quo sit nesciunt officiis aliquid quo dolorem et aut sit qui qui occaecati quidem culpa et voluptate nobis deleniti temporibus sit sit numquam voluptatibus optio amet consequuntur magni illo hic qui autem nesciunt nam excepturi voluptatem sed ut qui non hic consequatur hic qui dolor quibusdam libero impedit error labore magni quos quia sunt commodi consequatur dolor aliquam voluptatibus ab architecto praesentium numquam corporis mollitia quisquam unde corporis eum aut quos qui tempora voluptas quia qui eveniet illo qui accusantium dolor eius id iste voluptas excepturi sed quis quibusdam sapiente voluptate libero ut iure corporis et quae et aut autem et dolores qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-19', '2017-05-14 04:17:17', '2017-05-14 04:17:17');
INSERT INTO `lesson` VALUES ('337', '7', 'Eos odio quibusdam optio id occaecati exercitationem distinctio occaecati.', 'Vitae sunt qui qui delectus quis qui odit tempore commodi harum voluptas sint omnis fugit soluta ea suscipit dolores earum vel inventore est praesentium id aut amet assumenda atque beatae sed vitae dolores qui molestiae dolorem corporis ullam nihil non ratione beatae ea deleniti sapiente ipsam eum illum perspiciatis non non provident eligendi fugit laborum pariatur omnis enim quia animi et perferendis velit corporis illum cumque ut minus praesentium dolores voluptatibus ad consequatur ipsum deserunt dolores est ut amet libero ipsam autem accusantium ut dolores reiciendis culpa vitae voluptates quia molestiae sit facere ut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-15', '2017-05-14 04:17:18', '2017-05-14 04:17:18');
INSERT INTO `lesson` VALUES ('338', '16', 'Et explicabo accusamus dicta ad fuga quia.', 'Doloribus sint suscipit natus id nihil nulla voluptates corrupti quibusdam harum sed et nulla labore consequuntur consequatur qui et voluptatum earum vero praesentium voluptate consectetur eligendi maiores magnam magnam quis ab sint et quisquam dignissimos non laudantium sit voluptas id recusandae minima et est voluptatem soluta harum sint delectus saepe soluta voluptatem laudantium nam dolorum dolorem ut maiores tenetur libero saepe dicta nihil sapiente natus magni.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-14', '2017-05-14 04:17:18', '2017-05-14 04:17:18');
INSERT INTO `lesson` VALUES ('339', '15', 'Voluptatem nihil porro ratione aut tempore voluptatum quisquam.', 'Nobis sed vero quod soluta et minima consequuntur quidem qui atque ex accusamus fuga consequatur animi rerum ratione doloribus ducimus aut ut ipsam et voluptas aut reprehenderit dolores excepturi optio saepe inventore aut ipsa doloremque dicta repellendus laboriosam delectus odit similique suscipit asperiores similique ut rerum sit nemo officiis cupiditate id vel ex consequuntur eum temporibus est enim corrupti perspiciatis voluptatum dolor velit itaque aut perspiciatis est rerum accusamus sit modi consequatur id vel a nulla ducimus doloremque cupiditate porro ut iusto ut ea.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-15', '2017-05-14 04:17:18', '2017-05-14 04:17:18');
INSERT INTO `lesson` VALUES ('340', '17', 'Ea laudantium adipisci quo ullam commodi enim.', 'Sed non voluptate est autem fugiat et sit minus harum magni facilis autem id consequuntur aut alias sed rem autem veniam illo aut eos consequatur et veniam eaque atque voluptatem quis omnis aut aut non quas qui et sit ullam magni modi sit doloribus reiciendis quam exercitationem officia consequatur perspiciatis dolor veniam enim voluptas dolorem ut ea doloremque et aut qui sit harum sequi nesciunt ducimus ullam nemo ex impedit aut corporis officia quasi modi quae laudantium delectus qui repellat quia et ut ea.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-14', '2017-05-14 04:17:18', '2017-05-14 04:17:18');
INSERT INTO `lesson` VALUES ('341', '19', 'Et molestias autem tempora quia ullam voluptas.', 'Alias voluptate sint animi dolorem aut commodi error aliquid iste et aut quo optio voluptatem non doloremque aperiam vitae reiciendis laudantium iusto omnis ut laudantium et sapiente aut laboriosam enim quis in dolores temporibus ipsum et numquam aut modi sit temporibus provident aliquid vero sed et commodi molestias suscipit vel expedita quidem id libero ut facere est officia quis aut omnis a.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-19', '2017-05-14 04:17:18', '2017-05-14 04:17:18');
INSERT INTO `lesson` VALUES ('342', '12', 'Quasi molestiae eos labore sed ipsam commodi.', 'Quasi mollitia est expedita cupiditate eaque quia hic nihil aut nobis fuga ullam repellendus eos quasi dicta qui consequatur velit sunt totam ipsum rem recusandae sequi quis sed non debitis doloribus perferendis voluptatem culpa voluptatem autem aliquam cum sit eos quibusdam voluptate impedit accusantium consequatur dolorem est temporibus in odio ut omnis eum assumenda repellat a libero hic atque provident nobis commodi consequatur ex ullam ipsum praesentium quia velit adipisci culpa praesentium et corrupti doloremque ipsa dolorem aut voluptatibus nobis assumenda labore voluptas sint sunt totam est voluptatibus sed corrupti iste unde aperiam est a maiores ea cupiditate provident accusamus nostrum ex iure doloremque aut alias debitis dolorem unde doloremque nemo voluptatum et magnam aut quod maxime rerum eum asperiores amet aut consequatur eaque ea iste accusamus rerum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '24', null, '0', '1', '2017-05-16', '2017-05-14 04:17:18', '2017-05-14 04:17:18');
INSERT INTO `lesson` VALUES ('343', '2', 'In ea quasi et cumque pariatur odit ipsum dolor.', 'Rerum laborum atque harum alias quia molestiae amet a repellat excepturi et autem necessitatibus animi quia ratione quisquam aliquam non fugit architecto perferendis illum aliquid doloremque corrupti reiciendis qui soluta provident et rerum recusandae tenetur excepturi soluta et amet aperiam dolores blanditiis blanditiis fugiat dolorem omnis est voluptatem est consequatur eos quia et quaerat quasi nostrum nisi quos quo autem quis quibusdam reprehenderit voluptatibus voluptatem quos nobis vero rerum voluptates totam aliquam natus qui molestiae rerum voluptates ipsum temporibus fuga vel sit facilis molestiae et vel sed est recusandae enim dignissimos minus aut vel aut voluptatem aut quisquam molestias cum doloribus sed iste ducimus eligendi excepturi omnis voluptate doloremque voluptate occaecati corporis dolores sit minima illum ratione omnis quasi.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '36', null, '0', '1', '2017-05-14', '2017-05-14 04:17:18', '2017-05-14 04:17:18');
INSERT INTO `lesson` VALUES ('344', '11', 'Sit odio ea molestiae dolore id.', 'Sunt dolorem pariatur aut et sit qui aut vel pariatur suscipit vero et quia officia et in sequi sed voluptatibus enim porro dolores aut ex non qui et quia aliquid sed minus quas qui beatae soluta quaerat quas accusantium ipsam corrupti nisi qui cum fugit harum repellat occaecati et cum numquam illum suscipit rerum ullam assumenda deserunt rerum et reiciendis quaerat et nihil corporis iure quidem in fuga aut saepe dolore voluptatem cumque praesentium voluptas magnam corporis soluta adipisci pariatur odit deserunt quaerat est et aut sapiente reprehenderit accusamus odio eum aliquam nostrum nulla excepturi sint eius dolor quae qui similique suscipit at quo rerum exercitationem aliquid aut in unde sit omnis neque modi quia autem enim fugit praesentium qui aspernatur dicta sed architecto eligendi vero sunt dolorem rerum magni unde cumque voluptas.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '28', null, '0', '1', '2017-05-19', '2017-05-14 04:17:18', '2017-05-14 04:17:18');
INSERT INTO `lesson` VALUES ('345', '29', 'Soluta delectus provident non autem aut debitis quia aut officia iure.', 'Sit eum beatae nihil nostrum et deleniti atque in dolor vitae magnam doloribus quos veniam ea quisquam quia sit nemo aperiam non veniam sunt eos maiores optio consequatur est quidem et consequuntur delectus laudantium recusandae explicabo vitae consequatur non ut et sed vitae et ipsam est nostrum aut iusto facere dolorum tempore provident molestiae deserunt deserunt et ea a odio tempore et voluptatem beatae ipsa dolor vel amet mollitia voluptas veniam cum sed nisi incidunt magnam illum vel qui dolorem tenetur rem sequi temporibus consequuntur quia voluptatem aut deleniti aut exercitationem quis quo sequi quidem fugit deserunt illo deserunt ipsum alias incidunt atque omnis et omnis ipsum suscipit qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-14', '2017-05-14 04:17:18', '2017-05-14 04:17:18');
INSERT INTO `lesson` VALUES ('346', '5', 'Placeat nulla animi corporis voluptatem voluptates et ut.', 'Magnam culpa fugiat voluptas et quia consequatur qui laboriosam aut harum et id iure iure error dolores debitis deleniti aut dolorum rerum quam numquam nam velit reprehenderit est itaque quos ullam dolorem nemo suscipit iusto officiis est asperiores doloribus delectus fugiat architecto eligendi est ut beatae tempora beatae praesentium et aliquam qui earum veritatis tempore ad aut maiores accusamus ducimus saepe delectus porro illo tempora et illum alias molestiae nesciunt iste consequatur rem dolores beatae sunt est odit sunt molestiae consequatur tempora tempore veniam culpa suscipit commodi cumque ad vel alias et modi eum odit perferendis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '24', null, '0', '1', '2017-05-18', '2017-05-14 04:17:18', '2017-05-14 04:17:18');
INSERT INTO `lesson` VALUES ('347', '30', 'Ut consequatur animi voluptates error consequatur maiores non.', 'Asperiores a voluptatem fugit adipisci tenetur sint explicabo voluptas nihil ullam corporis quia doloribus modi facilis corporis sit adipisci deleniti blanditiis totam quia adipisci et dolorum eum et qui ea eos eum magnam sunt nesciunt natus vel qui sunt nemo ea fugit et molestiae sint explicabo quis voluptatem assumenda vel doloremque laboriosam fugiat neque exercitationem ratione qui in minus aut velit eum corrupti occaecati aut voluptatibus qui sed repellendus est repellendus eligendi incidunt facere reiciendis dolores.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-18', '2017-05-14 04:17:18', '2017-05-14 04:17:18');
INSERT INTO `lesson` VALUES ('348', '21', 'Sed aut consequatur similique consequatur vero doloribus.', 'Nesciunt maxime autem dicta possimus quasi sunt saepe molestiae voluptates et veritatis delectus amet totam nemo sapiente enim nisi fuga id eveniet et vel et omnis quaerat voluptatem est nulla placeat veniam aut doloribus dolores tempora sint sunt necessitatibus sit qui quidem ad deserunt dignissimos veritatis repellat nisi et mollitia voluptatum sit sunt blanditiis tempora quas aliquam fugit autem ipsa qui quia repellat doloremque quasi dolorem tempore itaque non omnis aspernatur harum optio blanditiis aut doloremque atque velit quibusdam id aperiam sit consequatur quasi atque enim commodi provident placeat excepturi neque consequatur autem sunt.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-18', '2017-05-14 04:17:18', '2017-05-14 04:17:18');
INSERT INTO `lesson` VALUES ('349', '28', 'Et modi ullam quaerat totam dolorem odit cupiditate.', 'Eos quibusdam ea enim distinctio rem ratione ipsam molestias earum et laboriosam est adipisci quia aperiam ea nemo velit a et voluptatem aut est voluptas saepe odit vel quo possimus id ut recusandae voluptates dolorum repudiandae atque beatae facilis eius reprehenderit corrupti rerum ut ea officia est quod facere suscipit mollitia aut ut quia necessitatibus quasi quod eaque et harum et veritatis illum temporibus nemo similique possimus quam expedita ex aliquid corporis dolorum a doloribus non eligendi aspernatur quaerat consequatur omnis quae ea eum suscipit laudantium aut cum et pariatur pariatur sed fugit aut unde illum asperiores aut omnis aliquid dignissimos voluptatibus minus inventore reprehenderit consequatur dolores accusamus ipsam est reprehenderit quae quasi quidem autem in molestiae et possimus voluptas unde accusamus totam non fuga sit labore corporis non repellendus eos.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '30', null, '0', '1', '2017-05-16', '2017-05-14 04:17:18', '2017-05-14 04:17:18');
INSERT INTO `lesson` VALUES ('350', '19', 'Quidem ut quibusdam dicta consectetur nulla officiis.', 'Quaerat qui possimus non rerum eaque necessitatibus sit sint at cupiditate velit ut voluptate eius pariatur a illo odit molestias sapiente et sunt quam voluptas mollitia quis quo qui nihil pariatur ab odit quos non exercitationem maxime quod voluptatem repellat saepe enim omnis magni magnam distinctio perspiciatis optio ut aperiam odio placeat et repudiandae ipsa similique in dolor neque fugit doloribus consequatur qui voluptas a omnis distinctio dolorum enim quas illo qui sit esse consequatur ex tenetur officiis ea tempore est praesentium impedit modi velit qui repellat natus totam unde deleniti omnis et aut cumque ut rem dolorum laboriosam esse nihil non ut quae magnam qui non voluptas voluptatem sequi voluptates et non vero quia aut quod hic maxime rerum sed facilis ea ex explicabo debitis mollitia eum quo in ullam aut earum occaecati cumque.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-14', '2017-05-14 04:17:18', '2017-05-14 04:17:18');
INSERT INTO `lesson` VALUES ('351', '19', 'Officiis ab consectetur rem eos corrupti tenetur.', 'Laborum quis soluta nihil voluptas molestias atque sit odio ut rerum maiores officia repellendus asperiores repellendus modi provident quod quidem sunt earum perferendis sit velit eligendi assumenda harum quia ut officiis saepe aliquam et sint sed ut in id accusamus non ducimus sint repellendus et nihil excepturi qui voluptatem nobis aperiam ut ex amet sit quia eius voluptatem libero sed incidunt nulla ipsam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-18', '2017-05-14 04:17:18', '2017-05-14 04:17:18');
INSERT INTO `lesson` VALUES ('352', '15', 'Veniam velit consectetur reiciendis alias sed ratione.', 'Ut sapiente modi ut quaerat ut corrupti dolorem eveniet nulla aliquam ut vitae impedit atque saepe et eaque deleniti asperiores magni ut magni sed et voluptate et vel sunt nobis quas dignissimos ea voluptatem nam placeat eum aut deleniti adipisci ut corporis minima occaecati deleniti impedit sed voluptatum nesciunt eligendi fugiat unde ex quia quasi accusamus laborum sed quidem est occaecati iusto porro nisi rerum dolorem nihil dolore tenetur libero voluptatum aut ducimus assumenda laudantium omnis dolore ut perferendis numquam aperiam tempora dolorem cumque dolores vel eligendi facere quos velit voluptatem sit rerum autem ipsum accusantium et veritatis quod molestias veritatis atque nihil qui repellat dolores.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-16', '2017-05-14 04:17:18', '2017-05-14 04:17:18');
INSERT INTO `lesson` VALUES ('353', '26', 'Et odio a quis reprehenderit et omnis aliquid velit praesentium nobis.', 'Nisi sunt modi ad rem minus aut sapiente illo aperiam quod velit distinctio itaque quas sed alias ut officia velit odit perspiciatis quidem iste maiores recusandae necessitatibus natus sit sed aspernatur facilis distinctio qui accusantium rerum enim explicabo explicabo quas laborum cupiditate aperiam placeat sapiente ducimus sequi aut at possimus animi et eum doloremque libero ratione aspernatur animi iste et animi nihil et aut velit dignissimos molestias consequatur vel soluta esse aut quam consequuntur id ad quis illo voluptatem et possimus nihil nihil et est voluptatibus incidunt dolores odio molestiae voluptas minima qui sed exercitationem eum est repudiandae vel quaerat laborum enim necessitatibus ea quod dolor voluptatibus ut blanditiis ea blanditiis earum neque occaecati molestias ea molestiae quis blanditiis asperiores iusto officiis quia totam amet voluptate facere necessitatibus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-18', '2017-05-14 04:17:18', '2017-05-14 04:17:18');
INSERT INTO `lesson` VALUES ('354', '14', 'Qui sint recusandae quia pariatur autem repudiandae nulla et doloribus veniam.', 'Quo est saepe atque qui quia est et suscipit ut consequatur nisi et sequi facere sapiente ea non eum minima quae molestiae aut necessitatibus est assumenda velit est sapiente excepturi facere quo voluptas ut in sunt impedit in enim in culpa ad et exercitationem at quia cum quaerat deserunt porro facilis eius reprehenderit corrupti vel dolorem enim voluptatem quia mollitia velit est quod enim sunt earum et quia et libero ut explicabo ad alias ut eligendi esse officiis amet cum sed delectus explicabo fugit ratione facilis velit neque culpa dolor ipsum consequatur necessitatibus vero fugit ut mollitia totam cumque non quasi asperiores sequi voluptas et ex quisquam adipisci omnis excepturi dolor nulla aspernatur perspiciatis officia eveniet accusamus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-14', '2017-05-14 04:17:18', '2017-05-14 04:17:18');
INSERT INTO `lesson` VALUES ('355', '2', 'Provident quas doloremque velit eos dolores tempora.', 'Quia quidem libero earum asperiores et unde eos reiciendis quidem nesciunt iste neque voluptas nisi voluptatum aut velit ex enim quam suscipit molestiae architecto tempora voluptatum perspiciatis et quia pariatur aut quam sapiente enim repellendus autem minus architecto labore rerum et odio eius nulla et et deserunt totam ab quia ratione doloribus error rem sed dolores enim et error sint et placeat quod repellendus necessitatibus id.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-15', '2017-05-14 04:17:18', '2017-05-14 04:17:18');
INSERT INTO `lesson` VALUES ('356', '9', 'Inventore facilis impedit accusantium quidem rem.', 'Nisi laborum quia fuga rerum non consequatur ea at harum fugiat perspiciatis minima fugiat debitis quis ratione officia sed facilis iste expedita eius ratione sint recusandae id numquam vel sequi perferendis veniam et dolores perferendis soluta quisquam in repellat labore et ex est illo sit debitis est recusandae quas consequatur odio odio qui numquam ullam dicta cum accusantium non ex beatae qui et deserunt maxime eaque magni illum accusantium est autem voluptatem quod quisquam rerum optio maiores earum expedita consectetur aliquid facilis et assumenda harum iste iusto provident est odit voluptatem dicta animi omnis pariatur qui corporis reprehenderit laborum soluta aperiam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-15', '2017-05-14 04:17:18', '2017-05-14 04:17:18');
INSERT INTO `lesson` VALUES ('357', '6', 'Eveniet delectus accusantium vitae sit et.', 'In repudiandae asperiores dolor dicta nihil sunt vel nemo aliquam quisquam consectetur autem deserunt eaque et nihil consequatur iusto dignissimos alias consectetur sit doloribus aut qui itaque excepturi aut minus aut vero distinctio sed dolorem dolore voluptatem repellendus est harum adipisci natus tenetur ut est pariatur quod et commodi ut magni omnis praesentium esse aliquid facilis eligendi quas nostrum delectus alias et quasi voluptate autem ea beatae laudantium qui quia quos eos est fuga ut expedita sed laudantium quia illum dolores et esse sit et ut iste placeat officiis quis beatae rerum et iusto praesentium qui harum esse voluptas dolor nam natus qui qui et saepe voluptate alias ut maiores qui rerum temporibus quis dolores illo aperiam sequi et accusamus vel accusantium minus aut et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-17', '2017-05-14 04:17:18', '2017-05-14 04:17:18');
INSERT INTO `lesson` VALUES ('358', '14', 'Similique nihil maxime blanditiis mollitia reiciendis enim est.', 'Quia soluta enim et omnis minima sunt omnis mollitia sit mollitia et molestias ab quia vero soluta iure consequatur dolor repellat recusandae nihil quibusdam molestiae fuga et numquam occaecati eligendi illo eos nobis consequatur et quis molestiae et voluptate voluptatum et dolores aut nam aut accusamus quidem reiciendis dolores nostrum aliquam ut sed at hic nisi eius dignissimos dicta possimus optio laudantium deleniti ab esse doloribus nulla molestiae dolorem magni tempore unde sunt neque non laboriosam commodi voluptatem id animi minus reiciendis inventore et commodi nostrum facere ratione quas accusamus omnis maxime qui rem dolorem repellat eum consectetur amet quam sunt sunt inventore nostrum tempore sunt vero assumenda non natus aperiam amet consequatur dolorem et omnis vero omnis saepe non dignissimos quae.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-19', '2017-05-14 04:17:19', '2017-05-14 04:17:19');
INSERT INTO `lesson` VALUES ('359', '10', 'Dolorem adipisci recusandae voluptatem id voluptas aut explicabo recusandae eum voluptatum.', 'Eos non quisquam repellat asperiores voluptatem omnis voluptatum est officia dolorem nostrum consequatur est voluptatem voluptatem facilis expedita corrupti maxime repudiandae consequatur ut adipisci porro minus blanditiis qui earum esse quas qui esse accusamus aut ut est iste dignissimos minus aut fuga repudiandae labore non facere optio dolores perspiciatis praesentium sit omnis accusamus error saepe iusto ullam aut doloremque earum nulla veritatis amet nihil et molestiae rem voluptas sequi ab fugiat non aut sint expedita doloremque cum a sint non iusto aliquam consequatur corrupti quibusdam veniam necessitatibus culpa doloremque sit aut omnis distinctio doloribus vitae qui dicta tempore sit dolores et a quasi id dolorem sed quis ad dolorem culpa eos officiis cumque officia a voluptatum quo harum eos repellat est neque quis sit molestiae et veniam ut ab praesentium dolor quo.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-18', '2017-05-14 04:17:19', '2017-05-14 04:17:19');
INSERT INTO `lesson` VALUES ('360', '2', 'Tempora aut praesentium exercitationem molestiae non.', 'Veritatis fugit culpa dolorem est corrupti consequatur libero architecto enim aut ullam dolor consectetur reiciendis veniam magnam quis facilis deleniti veritatis eius ut in tempora error ipsam sunt non ex quaerat quis mollitia libero aperiam quod illum commodi soluta at commodi atque inventore et voluptatem rerum fugit deserunt id fugit dolore mollitia sint omnis molestias culpa sed aut alias voluptas rerum quaerat ex voluptas molestiae dolores voluptatem quia exercitationem laudantium possimus quis enim adipisci quibusdam et numquam similique doloribus laborum tempora unde alias perspiciatis consequatur iste vero iste beatae quae numquam voluptate nihil possimus quibusdam rerum qui vel possimus beatae et laudantium esse rerum accusantium qui sequi cupiditate repudiandae quod molestiae consequatur unde animi similique nemo consequatur suscipit corporis saepe provident.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '45', null, '0', '1', '2017-05-18', '2017-05-14 04:17:19', '2017-05-14 04:17:19');
INSERT INTO `lesson` VALUES ('361', '17', 'Possimus ipsam rerum quibusdam cum optio quos voluptate sint rerum voluptatem sed.', 'Dolores ipsum ut ut sequi veritatis incidunt voluptas sed illum vero quam voluptas et ex commodi et iusto in est molestias provident tempore et impedit at doloribus enim molestiae id eos incidunt accusantium commodi qui et harum nam quam fugit debitis natus esse commodi necessitatibus necessitatibus voluptatem et incidunt enim soluta error eius libero consectetur eius sequi accusantium deserunt vel et et facilis tempore sunt unde atque praesentium et ipsa quo iusto autem id aut corrupti aut quis aut laboriosam repellendus alias repudiandae praesentium ea accusamus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-16', '2017-05-14 04:17:19', '2017-05-14 04:17:19');
INSERT INTO `lesson` VALUES ('362', '27', 'Aut et veritatis est et.', 'Omnis quis ab fugiat recusandae in aliquam odio voluptatem error officiis voluptatem nihil molestiae suscipit doloribus eligendi ut culpa laborum dolor eum enim sed rem totam eum esse repudiandae sit neque voluptatem voluptas ullam qui nulla rerum consequatur est odio sed aut totam at nostrum laudantium sapiente accusamus est velit ut aut molestias distinctio exercitationem quia qui odit eum alias molestiae adipisci a impedit magnam delectus eos ipsum laudantium fugiat et explicabo ut animi esse dolorem quaerat soluta neque adipisci molestias perspiciatis consequatur quos ducimus nostrum nobis ea autem quo hic in maxime et veritatis ipsam veritatis et provident qui quasi quas dolorum et id magnam in non non deleniti pariatur et exercitationem nulla ut accusantium accusamus inventore qui et molestias voluptatem rerum eveniet quis eos quis saepe voluptatem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-14', '2017-05-14 04:17:19', '2017-05-14 04:17:19');
INSERT INTO `lesson` VALUES ('363', '10', 'Ut debitis ea sit sit nostrum est et adipisci.', 'Error porro sit eaque cumque pariatur perferendis aspernatur minima aliquam molestiae doloribus suscipit quisquam excepturi ut ea modi id tempore cupiditate laboriosam sunt sit ducimus non unde accusamus cumque soluta dolorum voluptatibus et qui dolores ea ab aut non ut et ab dicta inventore natus facere laudantium mollitia libero quod optio ducimus commodi consequatur laborum non ipsum ut voluptate fugit quia inventore at nemo.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '39', null, '0', '1', '2017-05-19', '2017-05-14 04:17:19', '2017-05-14 04:17:19');
INSERT INTO `lesson` VALUES ('364', '9', 'Ab et et dolor qui nemo praesentium vero.', 'Qui quia ea sint doloribus ipsam iste natus quo dolores earum aut et eligendi quisquam delectus exercitationem pariatur ipsum est ut voluptate nobis id rem sequi non minima expedita tempore aut maiores at omnis tempora dignissimos qui porro nulla in temporibus eveniet aut molestias dignissimos dolore ut et nisi pariatur aut necessitatibus aut inventore eligendi exercitationem ut nemo et sint perspiciatis alias veritatis qui quisquam nisi sint est eveniet neque numquam facilis sed aut sapiente vel voluptas minus dolorem vel officiis maiores rem ducimus ratione quia illum expedita atque qui incidunt debitis soluta ex architecto eligendi eos a enim.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-19', '2017-05-14 04:17:19', '2017-05-14 04:17:19');
INSERT INTO `lesson` VALUES ('365', '13', 'Sit placeat quo tempora magnam sequi quam alias repudiandae.', 'Enim ducimus nihil eos optio qui aspernatur placeat illo repellat ipsam optio quisquam ut adipisci id illo placeat nam explicabo expedita et eligendi placeat ea blanditiis et nesciunt numquam est voluptatem aspernatur et officia dolorum rem voluptatibus mollitia aut quisquam debitis facilis rerum occaecati sit quia nisi error aut nihil ipsum quaerat perspiciatis qui omnis eaque alias recusandae consequatur veritatis deserunt sit praesentium sunt praesentium et architecto quasi dolorem impedit sint eum et recusandae qui deleniti accusantium asperiores nisi nesciunt eos debitis minus aut dolor ut quod quasi id est doloremque.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-15', '2017-05-14 04:17:19', '2017-05-14 04:17:19');
INSERT INTO `lesson` VALUES ('366', '18', 'Et est quidem dicta quia error dolor aspernatur est.', 'Numquam eveniet illum quia nihil similique maiores et quis similique rem maiores non aut molestiae in architecto excepturi voluptas qui nobis magni voluptatem sit est quos rerum consectetur dolor blanditiis ut molestias animi voluptatibus autem et hic distinctio quidem eum qui quos aspernatur placeat impedit eligendi alias enim non quia delectus quod perferendis eligendi vel repellendus rerum reiciendis laborum dolores cum eaque possimus repellat sit autem cupiditate occaecati numquam tenetur non voluptatibus exercitationem excepturi quis aut sunt aut praesentium dolorem eos autem numquam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '47', null, '0', '1', '2017-05-14', '2017-05-14 04:17:19', '2017-05-14 04:17:19');
INSERT INTO `lesson` VALUES ('367', '1', 'Esse voluptatem quis animi rerum velit cumque labore pariatur quasi quos incidunt.', 'Sint quo cumque autem placeat sit voluptatem illo unde tempora inventore nam consequatur at aliquid maxime minus quis et molestiae praesentium voluptatibus et temporibus sint omnis ut veniam debitis et qui sint provident laboriosam veniam corrupti et cupiditate amet enim quas dolores occaecati nulla magni et ut officia suscipit maiores et nobis cum quia sed mollitia est magnam sint et voluptates itaque repudiandae velit cum quia perferendis aut modi rerum et commodi modi aut at officia et quis natus atque nihil inventore ut error aut quia eum quo sapiente ut doloremque molestiae commodi quia qui qui hic iusto vero quo quo quibusdam odit et deserunt facere voluptatem natus quos quas dolore voluptates consequatur temporibus unde amet quaerat atque dolores itaque vel tenetur iste dignissimos ab voluptate ratione enim voluptates quam earum eum nulla deleniti et quisquam qui voluptatum exercitationem voluptate voluptatem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-18', '2017-05-14 04:17:19', '2017-05-14 04:17:19');
INSERT INTO `lesson` VALUES ('368', '15', 'Sed vero magnam sit magnam excepturi qui dolor corrupti facere eum.', 'Architecto et quo ea natus qui vero officia recusandae est explicabo earum et maiores consequatur saepe vel incidunt velit odio aut nihil tempore non vero aliquid est ab distinctio rem sed nisi autem voluptatem optio molestiae qui cumque cumque vel laboriosam labore debitis possimus et illum laborum excepturi ducimus rerum deleniti autem optio error veniam non vel sed distinctio vel tempora odio rerum et perferendis quos omnis ad qui neque consequatur architecto autem culpa ut consectetur et natus blanditiis consequatur nobis veniam maxime ut eius reprehenderit unde et sit consequatur rerum mollitia suscipit facere quia ducimus consequuntur temporibus assumenda dicta dolorem illum voluptas vitae aperiam sed.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-14', '2017-05-14 04:17:19', '2017-05-14 04:17:19');
INSERT INTO `lesson` VALUES ('369', '1', 'Blanditiis natus autem quam nam ipsum modi debitis libero.', 'Cupiditate et adipisci iste molestiae ipsam autem odit impedit consequatur quia dolorem corporis qui voluptatem et dolor aut placeat est facilis occaecati et laborum ut nihil et perferendis incidunt sapiente beatae cupiditate quisquam architecto non molestiae vitae reprehenderit qui aut molestiae at consequatur ipsa quaerat temporibus ab et nam et fuga autem unde nulla blanditiis dolor voluptatem eos atque assumenda repellendus vitae sit aut magnam ex pariatur officia autem facilis in corporis eius delectus aut consequatur et omnis ut dolore modi ipsa vel sint facere non et voluptatem voluptates eaque facilis non eos exercitationem molestiae mollitia ut qui iure molestias quod blanditiis quas corporis repellendus non quidem beatae explicabo nihil tempore aut magni non repellat animi quidem et et doloribus qui et dolor rerum qui voluptatem deleniti ducimus quaerat natus fugiat rem sit commodi eveniet consequatur sed possimus voluptates molestiae est.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-16', '2017-05-14 04:17:19', '2017-05-14 04:17:19');
INSERT INTO `lesson` VALUES ('370', '14', 'Vero dolorem aut impedit non.', 'Ut sint ut quasi corrupti provident natus vel consectetur aut qui quibusdam molestiae voluptatem dolores velit ad unde ipsam ipsum ipsum neque autem quia dolores deleniti quod quae fugit explicabo voluptate culpa voluptatum ipsa aspernatur quam unde ut vel numquam autem voluptas nemo error quos ut cumque autem ut est repellendus omnis unde sit voluptatem rerum magnam ea eos quis quidem deleniti id veniam fuga et ut magni earum dolorem aut sint aut similique vero expedita dolorem et eveniet quis hic dolor sed aut suscipit quisquam est illo incidunt repellendus exercitationem repellendus architecto et sed nobis accusantium animi cupiditate voluptas voluptatem et in ab sit neque necessitatibus suscipit vel esse rerum et sequi eum voluptas rerum blanditiis voluptatum esse enim voluptate sit commodi cupiditate quia et exercitationem perspiciatis deleniti in molestiae officia consequuntur libero.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '20', null, '0', '1', '2017-05-18', '2017-05-14 04:17:19', '2017-05-14 04:17:19');
INSERT INTO `lesson` VALUES ('371', '8', 'Qui iste soluta qui ipsam inventore totam soluta ratione maxime quia.', 'Iusto molestiae cupiditate velit nemo culpa et non fugiat aut dolores non repellat praesentium amet et quod error et qui aut commodi atque ad et non et impedit nam minima consequatur aliquid labore molestiae esse qui in quo similique molestiae velit sit temporibus omnis id voluptate hic repudiandae labore necessitatibus quo est quam dicta dolorum rem illo vel dolorem qui perferendis ab sit consequatur voluptas illo incidunt sit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-15', '2017-05-14 04:17:19', '2017-05-14 04:17:19');
INSERT INTO `lesson` VALUES ('372', '7', 'Possimus in blanditiis delectus tempore temporibus.', 'Ipsa perferendis corporis voluptatem possimus itaque iure neque fuga unde voluptas maxime ipsum fuga dicta tempore quas aut accusamus qui ut laboriosam impedit mollitia dolor a perspiciatis quos autem et vero et quidem delectus deserunt enim esse excepturi voluptas fugit rerum delectus non ut in earum ratione repellat nisi odio cum quidem qui nihil voluptatem aut nihil necessitatibus distinctio quis est et esse dolorum praesentium debitis voluptas dolor eos accusamus sed perferendis esse voluptatem beatae enim sint maxime molestiae aspernatur rerum delectus molestiae exercitationem tenetur magnam et quae pariatur rerum molestiae ut cumque sint eum quaerat cumque quaerat dolor minima aperiam aut numquam itaque.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-18', '2017-05-14 04:17:19', '2017-05-14 04:17:19');
INSERT INTO `lesson` VALUES ('373', '24', 'Aspernatur ipsum ea quaerat sit ipsum repellendus voluptates quibusdam.', 'Alias deleniti aut tenetur fugit quia asperiores id rerum velit ad cumque est iure nesciunt voluptas eos illo sed culpa non eum animi ea non cum tempore consequatur repellat sed amet est earum corporis dolorem iure molestiae dolorem hic aut totam animi nihil ratione hic adipisci corrupti quaerat quis aliquam soluta ipsum et voluptas quis natus veniam iste dignissimos voluptatem modi explicabo rerum ut et molestias et culpa pariatur eos veritatis ut soluta in impedit amet ut officia aut quam voluptate quod commodi inventore temporibus aut ut libero illum quia eligendi animi dicta distinctio est dolores sapiente dolores deserunt sit earum qui et quos dolore molestiae laboriosam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-16', '2017-05-14 04:17:19', '2017-05-14 04:17:19');
INSERT INTO `lesson` VALUES ('374', '30', 'Occaecati veniam esse magnam illum dolor consequatur.', 'Ad quia perspiciatis voluptatem nam eos qui tenetur ipsum nihil reprehenderit et autem velit sed nostrum aperiam dolore porro veniam inventore aperiam qui consequatur commodi ex vel quis et assumenda repellendus quidem ut excepturi fuga natus quia molestias libero laboriosam sed soluta quidem sapiente cum dicta et a magni ut occaecati sit et officia animi velit laudantium sed commodi est itaque maiores voluptatem rerum vitae adipisci sequi dolor quasi enim neque sit quia dolorem impedit laudantium dignissimos accusamus error perspiciatis exercitationem et cupiditate voluptas occaecati sequi placeat omnis et nostrum ullam delectus id in laboriosam laborum voluptatum et nihil optio nulla aut fugiat tenetur pariatur cum iste id dignissimos et aut aut nam ea occaecati deleniti voluptas aut laboriosam nostrum enim molestiae aut dolore voluptatem et dolorem eveniet eligendi neque consequatur ea sed ab natus aut eum incidunt.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '24', null, '0', '1', '2017-05-14', '2017-05-14 04:17:20', '2017-05-14 04:17:20');
INSERT INTO `lesson` VALUES ('375', '6', 'Dolor accusantium ad reiciendis aspernatur rerum eaque accusantium dolore.', 'Beatae quis optio ad delectus voluptas architecto beatae atque officia ab sunt illo ducimus accusantium odio non eveniet minima sunt amet in sunt nulla provident quibusdam et voluptate et omnis id non praesentium consequatur consequatur minima assumenda consectetur neque ducimus molestiae consequatur occaecati aperiam illum omnis consequatur magnam rerum ex est eveniet sunt saepe qui voluptas vel in atque omnis illum ea nostrum est ea reprehenderit non sequi reiciendis et perspiciatis eveniet expedita provident blanditiis et porro ipsam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-17', '2017-05-14 04:17:20', '2017-05-14 04:17:20');
INSERT INTO `lesson` VALUES ('376', '4', 'Debitis quisquam quas in excepturi illum rerum inventore nemo.', 'Ratione tempore nobis quidem aut dolores expedita eum maiores quibusdam totam qui corrupti eum nobis quae eos provident non quas eaque soluta similique et sunt vel adipisci corrupti et aut iste nobis laborum placeat voluptatum consequuntur est corporis sequi veritatis distinctio sunt ad dolorum perferendis harum autem id consequatur labore sint magni vitae quia libero laborum animi atque dolorem hic deleniti atque numquam quibusdam nisi inventore et facilis similique quisquam voluptas illum ipsum ut esse praesentium temporibus ratione et aut molestiae eaque sint facere dolores velit aliquid minima qui exercitationem et aut fugiat nostrum ab veritatis adipisci doloremque aut saepe est doloribus velit et dignissimos recusandae voluptates voluptas quia ex voluptatem aut dolor in autem delectus et cum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-16', '2017-05-14 04:17:20', '2017-05-14 04:17:20');
INSERT INTO `lesson` VALUES ('377', '17', 'Beatae aut corporis fuga qui laboriosam quos libero laborum.', 'Voluptatibus aut qui perferendis in odit consectetur fugit nostrum modi minus asperiores omnis fuga officia cumque et molestias dicta ea deserunt vel totam eos officiis nulla saepe et optio dolore assumenda officiis ut omnis iusto dicta aspernatur veritatis exercitationem facere ducimus molestias magnam aut placeat aliquid incidunt assumenda pariatur et id deserunt voluptate molestiae accusamus nesciunt fugiat ipsum impedit recusandae nihil omnis cum et et inventore rerum nihil mollitia impedit totam eos vero molestiae autem reprehenderit enim consequatur soluta optio ea ut voluptates tenetur possimus labore iure in sequi tempore voluptatibus natus similique et et voluptatem et animi et temporibus ut asperiores fugiat neque non eos aliquid unde id nesciunt natus molestiae et nulla earum sint qui culpa et exercitationem est perspiciatis inventore laboriosam earum quas dolor facere omnis nihil est recusandae dolorum quidem consequatur aut suscipit ut ut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '36', null, '0', '1', '2017-05-16', '2017-05-14 04:17:20', '2017-05-14 04:17:20');
INSERT INTO `lesson` VALUES ('378', '13', 'Autem quod exercitationem temporibus qui consequatur.', 'Facere ab non ipsa quis alias in qui ut ea natus nihil blanditiis molestiae omnis fuga quod mollitia nam non ratione sunt nisi id rerum eum accusantium officiis explicabo dicta ex illo animi in voluptas aut et consequatur libero saepe et id amet accusamus tenetur nemo consequatur dicta rem ipsum assumenda accusantium qui aut rem dolores voluptatum consequuntur dolores qui eveniet soluta veniam ducimus occaecati ad dicta labore deserunt libero repudiandae beatae quis minima sapiente nam qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-14', '2017-05-14 04:17:20', '2017-05-14 04:17:20');
INSERT INTO `lesson` VALUES ('379', '9', 'Esse libero quasi est molestiae at non voluptas dignissimos.', 'Doloremque sequi sed autem temporibus et natus soluta ut ut commodi sed et quas in accusantium ipsa eum rerum nemo sed excepturi sunt vel explicabo velit voluptatem consequatur velit voluptas fugit velit aut placeat dignissimos et sit ut corrupti at qui impedit nisi voluptas natus sequi cum et quaerat molestiae aut harum cumque est architecto qui ut magnam ea quia autem voluptate id laboriosam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-18', '2017-05-14 04:17:20', '2017-05-14 04:17:20');
INSERT INTO `lesson` VALUES ('380', '16', 'Laborum labore natus omnis quia et laboriosam fuga.', 'Mollitia inventore est aut mollitia laboriosam repudiandae accusantium asperiores fugiat magnam aut quae odio et et ducimus quas officiis et at et quia rerum est tenetur sit eos et nostrum consequatur ut et labore ut aut nihil odio mollitia modi labore molestiae voluptas totam ipsa consectetur minus voluptatem quo enim hic ut impedit at tenetur dolorem dolorem facere in quo eum vitae voluptas sapiente deserunt expedita veniam ipsam nobis voluptatem nam error sunt ea in necessitatibus nesciunt veritatis eius dignissimos nostrum consectetur odit itaque nam nostrum ex ducimus aliquam beatae occaecati non est praesentium numquam consequuntur impedit possimus velit magnam dolor saepe non tempore dignissimos.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-15', '2017-05-14 04:17:20', '2017-05-14 04:17:20');
INSERT INTO `lesson` VALUES ('381', '25', 'Sed officiis maiores non eaque sed nam distinctio aut est porro.', 'Quae voluptas alias eos soluta nostrum voluptatum eos architecto voluptas explicabo accusantium itaque qui et ullam corporis alias corrupti sunt voluptate mollitia incidunt voluptate et qui aliquid distinctio soluta et dolor esse vel quia dolorem qui dolorum error itaque nisi vitae sequi distinctio qui eius recusandae tenetur modi sequi tempore eaque quaerat neque culpa dicta rerum repellat in omnis ut ipsa dolorem neque possimus nam provident porro quia unde qui rerum qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '28', null, '0', '1', '2017-05-18', '2017-05-14 04:17:20', '2017-05-14 04:17:20');
INSERT INTO `lesson` VALUES ('382', '25', 'Dicta ea quibusdam laudantium odit nesciunt tempore commodi vel ullam voluptate.', 'Quia ducimus tempore atque voluptatem nobis facere sunt atque voluptatem magnam et a vel enim labore totam qui non dolorum quidem est vel harum et non dignissimos aliquam sequi consectetur perspiciatis voluptate iure ex assumenda quia eius sint aliquam rem excepturi minus perferendis consequatur quaerat ut sit maxime quasi reprehenderit veniam enim incidunt minus qui animi dolorum amet quae accusantium voluptas quasi quasi architecto dolore eos quia explicabo ad nihil eum qui fuga expedita dolores quis aut et necessitatibus asperiores soluta qui ipsum doloribus nobis porro necessitatibus dolorem voluptatem consequatur suscipit non impedit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '27', null, '0', '1', '2017-05-17', '2017-05-14 04:17:20', '2017-05-14 04:17:20');
INSERT INTO `lesson` VALUES ('383', '27', 'Dolorum dignissimos mollitia voluptatem et et ea omnis rerum eum id sapiente.', 'Odit quod ut facilis voluptas expedita nihil quas at nisi explicabo vel neque nihil suscipit quo consectetur blanditiis voluptatem earum aut porro quia adipisci distinctio iste et aut voluptas consequatur non ut quam repellat labore vel vel est assumenda ut incidunt voluptatum non reprehenderit autem dolores illo vel eos dolorem ipsum odio accusantium et adipisci et voluptatem rem alias et laboriosam enim ducimus fuga cumque facere.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-18', '2017-05-14 04:17:20', '2017-05-14 04:17:20');
INSERT INTO `lesson` VALUES ('384', '5', 'Nemo et voluptate expedita quod iusto.', 'Tempore repellendus quod porro ea consequatur autem ea magni veniam rem possimus eligendi quis exercitationem esse repellendus voluptatem officiis quasi impedit qui vero ratione aut fuga sint quam aut sed quam natus architecto rerum fugit vero veniam deserunt ut aperiam est explicabo cumque nulla earum rerum veritatis doloremque sit autem dolorem nemo molestiae laborum libero eaque quia et consequatur aut veniam nam sit quidem architecto ea officiis aut totam magnam perferendis vitae sequi hic accusamus culpa dolorem optio quod tenetur corporis amet eaque ut non itaque ea eaque in id sequi aspernatur repudiandae ab nisi placeat laboriosam dolorem sint vitae doloribus voluptas in qui et temporibus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-15', '2017-05-14 04:17:20', '2017-05-14 04:17:20');
INSERT INTO `lesson` VALUES ('385', '5', 'Magnam corrupti enim vitae qui incidunt laborum.', 'Soluta distinctio minus consequatur et error ut temporibus nihil ut velit autem minima illum corporis harum animi aut qui sit incidunt laborum optio facere odio amet deserunt ducimus distinctio excepturi iure impedit nemo autem animi optio optio reiciendis incidunt totam in numquam officiis labore est harum aut ut ad et ea explicabo numquam est alias nulla aut ducimus ut non harum voluptatem consectetur facere quia omnis est alias soluta magnam nisi est dolorum temporibus numquam eum voluptas repudiandae veniam quasi cupiditate dolor rerum maxime quo magni molestias ducimus sed nulla eligendi modi ut quisquam quas repudiandae et laudantium magnam consequuntur sint veniam cum dolores odit beatae quas qui doloremque ratione.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '42', null, '0', '1', '2017-05-17', '2017-05-14 04:17:20', '2017-05-14 04:17:20');
INSERT INTO `lesson` VALUES ('386', '11', 'Aspernatur explicabo quasi dolores enim qui autem et non nihil.', 'Voluptatem repellat dolorem rerum exercitationem veniam officiis non aspernatur nam sunt quisquam consequatur ipsa vel a quia accusamus dolor sed rerum eaque odio placeat ut autem porro ut ullam est ut magnam earum harum officiis delectus facere occaecati ullam vel quo at rerum iste molestias et ipsa omnis accusantium minima assumenda voluptates explicabo enim tempore atque esse dignissimos doloribus incidunt consequatur nulla amet velit qui iusto ullam itaque eos voluptatibus minus est.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-15', '2017-05-14 04:17:20', '2017-05-14 04:17:20');
INSERT INTO `lesson` VALUES ('387', '4', 'Qui quod et dolorem ea voluptate quidem error accusantium adipisci vero.', 'Commodi molestias laborum illo sint non soluta in fuga aut facere voluptatibus qui consectetur id vel qui eos suscipit dolorum porro tempore qui autem sed dolores ipsam incidunt reprehenderit voluptatum soluta laboriosam iste nam quia ipsa laboriosam labore et est dolorum aliquam necessitatibus ipsa neque rerum ipsam dolorem pariatur laudantium itaque ut autem illo repudiandae facere consequatur sint officiis et tenetur itaque aspernatur soluta ut eius est harum enim ut repellendus ducimus dolores molestiae autem sunt sunt aut cupiditate debitis sed ipsa aliquam quidem deserunt hic eligendi sit dolor dolor nobis enim perferendis illum sit enim a et qui cupiditate qui esse molestiae magni odio unde nesciunt consequuntur ut dolorem mollitia consequatur quae aut corporis error.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '47', null, '0', '1', '2017-05-15', '2017-05-14 04:17:20', '2017-05-14 04:17:20');
INSERT INTO `lesson` VALUES ('388', '27', 'Doloremque porro voluptas et excepturi odit veritatis neque itaque.', 'Cupiditate aut libero sit tempora occaecati nobis eos est possimus vitae et culpa ipsum hic quia soluta inventore nesciunt quae aut doloribus vel vitae quos et consequatur sunt sed sapiente nostrum ipsum odio hic error rerum accusantium velit et natus sed earum vel qui quas autem soluta ut in unde vero sed minus accusamus dolorum officia ut qui inventore itaque id libero voluptas rem id ut qui sed minima asperiores et ipsum quo quos et odio dolorem fuga delectus eum quibusdam nemo consectetur quaerat ipsa sint maxime veniam rerum in veniam consequatur omnis adipisci vitae illo molestias pariatur nostrum et nostrum suscipit accusamus adipisci est est qui ut hic.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-15', '2017-05-14 04:17:20', '2017-05-14 04:17:20');
INSERT INTO `lesson` VALUES ('389', '10', 'Eum modi earum labore id est eaque esse sunt necessitatibus.', 'Ut aut nemo omnis nihil ut quas rerum aut nobis saepe cupiditate nobis dolores quibusdam optio ipsum odio est reprehenderit asperiores aut hic enim magni corporis ut necessitatibus eligendi explicabo rerum assumenda et quasi illum velit quos recusandae voluptatem recusandae quia voluptatem assumenda id eum est ea odit similique magni rerum temporibus quia perspiciatis adipisci dolor explicabo itaque nam voluptate autem soluta voluptatum cumque dolores quia voluptas nemo ut ex in aliquam deleniti qui et aut est nam nemo illo ducimus non et quasi voluptatum alias eius minus consectetur aut voluptas sed voluptatem qui voluptatem laudantium maxime consequatur nobis et sapiente voluptas autem consequatur est consequuntur et impedit ad facilis distinctio nihil est consequatur excepturi sequi voluptates rerum impedit aliquid reprehenderit eligendi.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-19', '2017-05-14 04:17:21', '2017-05-14 04:17:21');
INSERT INTO `lesson` VALUES ('390', '10', 'Itaque expedita quasi error et nam quia et cupiditate atque vel.', 'Et eligendi dolore quos voluptatem qui maiores inventore accusamus accusantium beatae ratione qui fugiat velit aut maxime impedit labore atque est molestias explicabo recusandae facere officiis nostrum consequatur quibusdam consectetur odio unde maiores aut ratione et vel cumque est suscipit natus quia similique repellendus doloribus omnis adipisci quo eaque nostrum ut id sed hic assumenda hic ea iure fugit quis ea et tempore distinctio laborum illo totam vel.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-15', '2017-05-14 04:17:21', '2017-05-14 04:17:21');
INSERT INTO `lesson` VALUES ('391', '3', 'Neque suscipit sed quasi enim et.', 'Voluptas quos tenetur voluptas eum nemo et labore ut magni vitae molestiae commodi harum magnam qui omnis enim rem neque officia numquam sunt totam recusandae quidem est occaecati ut aut sequi qui temporibus dolorum rerum laboriosam nesciunt beatae ipsa tempore non dolor ipsa maxime minima asperiores inventore aut veritatis incidunt laborum labore commodi quia voluptatibus perferendis et deserunt ex numquam sunt harum odio voluptatem qui iure doloremque exercitationem recusandae dolore molestias aut eos porro consequuntur odit magnam necessitatibus voluptatibus debitis blanditiis quisquam nihil ut nihil nobis quae quidem accusamus vel ex sed maxime possimus in incidunt error illum et soluta nobis temporibus voluptatem doloribus corrupti non aut quam ab perferendis ut est sunt.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-16', '2017-05-14 04:17:21', '2017-05-14 04:17:21');
INSERT INTO `lesson` VALUES ('392', '12', 'Tempora nihil ut vitae fugit quia pariatur.', 'Officia voluptatem sed provident iste aperiam inventore aut consequuntur et distinctio perspiciatis iusto eligendi quidem qui provident qui ut tempore sed modi officia quia qui reiciendis sit quae deleniti fuga ut voluptas quod pariatur occaecati commodi sint recusandae quia neque quas debitis quisquam dolorum mollitia sapiente assumenda dignissimos at laudantium dolores libero ut et excepturi enim consequatur consequatur quasi sint a optio voluptatibus sequi ex tenetur perspiciatis magnam voluptatem animi cupiditate vel vero sed hic dolorem nesciunt deserunt quis repellat non et et consectetur harum accusamus expedita adipisci praesentium porro ea earum doloremque nulla quibusdam dolore qui voluptatem enim dicta soluta repellendus aut eveniet ea ut magnam sed fugiat asperiores enim nam recusandae vero rerum delectus ut ut rem assumenda ut similique sed asperiores quis ut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '39', null, '0', '1', '2017-05-15', '2017-05-14 04:17:21', '2017-05-14 04:17:21');
INSERT INTO `lesson` VALUES ('393', '13', 'Sapiente neque autem minus cupiditate et quidem sed quod et.', 'Dolor dolores velit natus dolorem cumque culpa quam ex culpa et fugiat sapiente et voluptatum vel maiores aut qui dolorem atque assumenda ipsa sint nihil reiciendis quasi sed velit consequuntur iusto quis eum iure quisquam enim quia totam illo eos fugit vel consequatur assumenda qui dolorem nam blanditiis voluptatum minus eum est recusandae ea cupiditate soluta neque eligendi eos ullam sed quisquam amet et sequi soluta recusandae consequatur qui explicabo est culpa soluta expedita veniam velit facilis quae et officia assumenda aut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-16', '2017-05-14 04:17:21', '2017-05-14 04:17:21');
INSERT INTO `lesson` VALUES ('394', '13', 'Et et architecto sint architecto quod ullam dolore.', 'Dolorum doloremque corrupti vel ullam similique nulla dolorum maxime eos quibusdam et temporibus voluptatum aut iste recusandae harum nihil aperiam aspernatur accusamus neque natus dignissimos corporis quis cum corrupti animi sint error omnis quo consequatur eaque consequatur modi quae ratione et dolor perspiciatis dolorem soluta est occaecati qui laudantium cumque a et aperiam architecto rerum explicabo occaecati debitis rem fugit temporibus consequatur pariatur consequatur quos aut voluptatem numquam illum pariatur omnis voluptatem id reprehenderit sit molestiae ipsa molestiae repudiandae culpa consequatur quo id non sit perspiciatis qui voluptatum rem dolor voluptatem itaque quam vel id ut officia neque quae ad repellendus voluptas qui maxime laborum ut quia iusto impedit enim provident nihil aspernatur rerum a non quod.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-18', '2017-05-14 04:17:21', '2017-05-14 04:17:21');
INSERT INTO `lesson` VALUES ('395', '21', 'Est ut facilis id mollitia harum aut quis reiciendis tempore voluptates.', 'Quia dignissimos impedit deserunt quaerat eius labore qui et et atque dolore exercitationem neque nisi quae voluptas ut reprehenderit aut nobis harum beatae eveniet a maxime nobis odio earum magni qui harum vitae incidunt quis sint temporibus ut molestiae fuga quaerat et vel tenetur non voluptas eligendi deleniti magni qui nostrum similique numquam similique praesentium cumque assumenda ut tempora quis temporibus voluptatem qui doloremque excepturi voluptas sit eligendi optio fugiat assumenda voluptatibus autem laboriosam nemo in distinctio corrupti eum amet beatae deleniti consequatur eaque fugit impedit repellendus fugit dolores repudiandae qui nemo doloremque quod eius rem tempora sint corporis numquam et ut omnis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-14', '2017-05-14 04:17:21', '2017-05-14 04:17:21');
INSERT INTO `lesson` VALUES ('396', '7', 'Laborum qui iste rerum est nisi quos ratione.', 'Inventore beatae est adipisci necessitatibus est consequatur quis rerum earum facere sed veniam facilis excepturi consequuntur maxime libero ut et eveniet eos nulla impedit sed architecto placeat blanditiis rerum facilis delectus laboriosam consectetur voluptas accusamus temporibus voluptatem cum enim distinctio dignissimos eveniet voluptatem quo ipsa dolor ratione quaerat omnis laudantium nesciunt consequatur officiis ut molestias est voluptatem sit eveniet necessitatibus quia est beatae distinctio commodi illum quaerat sint labore vel dolor sequi error delectus eveniet aut itaque nesciunt eligendi amet quis libero officia aut error est dolor dolores eum est.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '36', null, '0', '1', '2017-05-19', '2017-05-14 04:17:21', '2017-05-14 04:17:21');
INSERT INTO `lesson` VALUES ('397', '4', 'Eius nesciunt et dolores sunt sunt ut exercitationem sed voluptatum.', 'Quibusdam ut in autem tempora laudantium ullam fugit dolorem ipsum a rerum quod error qui vel impedit nesciunt exercitationem et delectus est debitis sunt sit vel cum consequatur harum necessitatibus quaerat consectetur et eum dolorem voluptas consequatur tenetur aliquam aspernatur id sed possimus velit molestiae pariatur vero eligendi beatae sint eum quo quos saepe harum est perspiciatis nesciunt sequi eius velit saepe ea quibusdam cupiditate ex ab et tempore aut nostrum repellendus maiores et velit nam doloribus dolores voluptas cupiditate quia fuga totam ex sunt occaecati dolores omnis et nobis iure commodi dolore aut accusamus veniam et consequatur quia et ullam fugit laboriosam dolorum sed molestiae est ut aut tempora est eligendi non voluptatem ex repudiandae voluptatibus itaque quos in aut quis eveniet harum distinctio sint reiciendis modi quis maiores quos voluptatem et et sunt necessitatibus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-18', '2017-05-14 04:17:21', '2017-05-14 04:17:21');
INSERT INTO `lesson` VALUES ('398', '10', 'Corporis excepturi fugiat nobis ducimus et omnis accusantium qui aperiam.', 'Alias neque autem id nisi sed quasi illo reiciendis aut velit fugit et laboriosam aut recusandae ut impedit dignissimos doloremque aut modi eum non natus quo rerum nemo sunt quia animi earum eum alias reprehenderit incidunt quae voluptatum nihil culpa inventore et qui ipsa officiis magnam voluptatem magnam odio dolor voluptatem sed odit sit consequatur reiciendis corrupti modi ad amet et voluptas fugit aut voluptatem voluptas aliquam dolor eum officia voluptatum facilis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-17', '2017-05-14 04:17:21', '2017-05-14 04:17:21');
INSERT INTO `lesson` VALUES ('399', '6', 'Omnis tenetur esse sed eaque ea soluta.', 'Sint illum rem laborum accusantium ipsa cupiditate ratione commodi est nobis qui consequatur necessitatibus vitae eaque mollitia nemo ex doloremque vero natus sed deserunt numquam cupiditate iure tempora ut in perferendis rerum officia quia aut et quasi doloribus est facere debitis optio quo architecto earum in minima eligendi error tempore sapiente nostrum itaque inventore ipsum nesciunt ea cum aut excepturi atque accusamus tenetur rerum nihil accusantium accusantium doloremque commodi dolores vel pariatur et esse vel facere a fugiat deserunt hic odit ut ipsa qui modi aperiam voluptas id qui et voluptate ut ducimus quas soluta voluptatibus alias quis ipsam dicta debitis earum nemo iusto sint totam vel rerum culpa hic omnis ad mollitia eligendi et explicabo pariatur magni ex quaerat repudiandae rerum dolor odit vero ullam ea assumenda vero nam et voluptatem vel ut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '24', null, '0', '1', '2017-05-14', '2017-05-14 04:17:21', '2017-05-14 04:17:21');
INSERT INTO `lesson` VALUES ('400', '27', 'Ipsam laborum eius architecto molestias sed delectus ea quaerat rerum.', 'Dolor omnis quod aut voluptatem tempora id ut asperiores sit et molestiae quod quisquam et et doloremque aperiam quod aliquam excepturi ut sit id nemo porro ipsa quod cumque culpa dolor error vitae quod assumenda dolor ipsum ducimus ut error recusandae perferendis fugiat vitae quo cum suscipit recusandae maiores laudantium quod quis repellendus voluptatem fugit repudiandae et quod qui nisi ducimus ipsa a neque non quibusdam rerum dolore ea perspiciatis at molestias enim quidem nesciunt harum mollitia dolor necessitatibus quam eaque omnis rerum beatae atque dolorem eum nihil rerum sint officiis et voluptas in dolorum et aut et non quia voluptatem provident repellendus aut ducimus nihil eius atque minima odio laborum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-14', '2017-05-14 04:17:21', '2017-05-14 04:17:21');
INSERT INTO `lesson` VALUES ('401', '20', 'Quis officia tempora asperiores sed cum.', 'Ut porro laudantium omnis facere eligendi minima quo aut provident quo ut cumque pariatur sit tempora accusamus doloremque nemo sit dignissimos molestias ut non fugiat qui ut maiores impedit aut nesciunt cupiditate ut cumque quia sequi aut recusandae natus quasi animi tempore accusantium et corrupti hic porro quia temporibus officia aperiam explicabo cumque quia consectetur occaecati quis veniam inventore enim blanditiis laudantium et possimus rerum ut hic consequatur laudantium et laboriosam illum nesciunt omnis cumque voluptatem dolores quae eius quisquam cupiditate ullam consequatur est aliquid quia soluta quibusdam perferendis et voluptatem voluptatem alias repellat ratione quia aut ipsam veniam quae eveniet occaecati ut modi consequatur quis architecto cum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-15', '2017-05-14 04:17:21', '2017-05-14 04:17:21');
INSERT INTO `lesson` VALUES ('402', '28', 'Consequatur non nobis architecto cupiditate sit minus doloremque.', 'Quaerat illo molestias ex ut eum eligendi qui voluptatem commodi est repellendus quisquam quaerat aut ut qui harum est voluptatem non id quibusdam numquam fugit cumque dolorem consequatur in quam ex illum nostrum facilis assumenda illo sed qui dignissimos temporibus quam dolorum voluptatibus non rerum tenetur cumque dolorem quis nostrum consequatur possimus quod tempore perferendis omnis distinctio vel voluptate et est quia impedit similique deserunt vel ab minus occaecati mollitia voluptas quia facere quae tempore dolorum cupiditate enim voluptatem quidem aut voluptatum qui sunt placeat rerum sunt aliquid ipsa suscipit libero enim distinctio impedit illo et est ut temporibus suscipit qui possimus quo temporibus similique sunt dicta dolorum nihil.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '27', null, '0', '1', '2017-05-14', '2017-05-14 04:17:21', '2017-05-14 04:17:21');
INSERT INTO `lesson` VALUES ('403', '27', 'Voluptas quod impedit omnis quia velit ut error ratione et hic.', 'Aut tempora ut consequatur dignissimos in quisquam vitae dolor dolorem laudantium voluptate laborum dolor ut cum deserunt et aliquid animi nihil eaque omnis qui fugit qui tempora ullam rem dignissimos fugiat rerum inventore sint et eius et est sed est illum quibusdam odit quia animi iusto asperiores culpa quidem ipsum libero fugit ducimus mollitia et quo quae consequatur iusto sint nisi nam fuga est perspiciatis nostrum et nemo ea vel eos velit enim odit error minus eum quia aut distinctio veniam nihil perspiciatis dolorem unde mollitia repudiandae explicabo esse quia cum quam molestias sed dicta quae voluptatibus nulla mollitia et vero repudiandae eos sint at sit numquam voluptatem ex commodi ea facilis aut voluptatem natus omnis quia sunt incidunt rerum non alias et itaque eveniet sunt ut repudiandae commodi quia.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '31', null, '0', '1', '2017-05-14', '2017-05-14 04:17:21', '2017-05-14 04:17:21');
INSERT INTO `lesson` VALUES ('404', '3', 'Similique aut aut quis minima tempora.', 'Qui sint laborum possimus maxime labore enim natus non eos iste sed deserunt nobis sed quasi aliquam at sint nemo magni in et voluptatum sit non iste assumenda ducimus est dolor dolorum ea quo ea dolores repellat hic sed voluptas eligendi autem fugit quibusdam animi suscipit est quia amet voluptates voluptate ut accusantium omnis ratione culpa unde placeat omnis eos explicabo maxime pariatur dolorem dolor aperiam exercitationem nisi autem ducimus exercitationem saepe dicta minus et exercitationem placeat ducimus omnis architecto veniam ea et quia sed voluptates quo.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-19', '2017-05-14 04:17:21', '2017-05-14 04:17:21');
INSERT INTO `lesson` VALUES ('405', '19', 'Aut amet accusamus nostrum est odio itaque et quidem omnis officiis.', 'Temporibus aut laudantium sit quas eius illum hic omnis sunt molestiae ut eligendi in officia suscipit ea doloribus cupiditate ut eum quibusdam laboriosam corrupti omnis quibusdam inventore quo praesentium ipsa unde qui similique voluptas quo vel neque omnis et ut alias qui placeat cum quia qui tempora eum ut ut voluptatibus doloribus ullam sit molestiae beatae possimus quo ut id libero sed numquam saepe quibusdam fuga et qui dicta voluptates enim dignissimos autem enim aut debitis modi exercitationem et voluptates quos quos illo repellendus hic dolorum provident qui assumenda consequatur id magnam optio velit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '28', null, '0', '1', '2017-05-15', '2017-05-14 04:17:22', '2017-05-14 04:17:22');
INSERT INTO `lesson` VALUES ('406', '9', 'Occaecati qui tempore eum eius quisquam hic maxime sapiente possimus quia.', 'Sint reprehenderit ut qui commodi iusto aliquid doloremque est ducimus perferendis vitae eligendi natus consequatur et odio ex alias inventore quis est et et vitae dicta assumenda nemo autem beatae porro amet iste et ipsam in commodi qui quos quas eos fuga cupiditate nulla voluptas pariatur est cum quis et accusamus itaque voluptatum voluptas saepe officiis non voluptatem illo consequuntur libero quisquam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '30', null, '0', '1', '2017-05-16', '2017-05-14 04:17:22', '2017-05-14 04:17:22');
INSERT INTO `lesson` VALUES ('407', '2', 'Quia molestiae nostrum unde placeat.', 'Laudantium tempora non dolore iste voluptates hic reprehenderit exercitationem minus facere facere praesentium aliquid sunt temporibus nemo dolores est libero ea magnam optio ipsam at ex soluta fugiat dolor soluta delectus rerum labore dolores saepe quo facilis molestiae molestiae aspernatur autem harum ex quia labore quia aut saepe velit aliquam quaerat blanditiis quam eveniet exercitationem dolor est nisi harum quisquam ut dolores ea natus harum accusamus facilis qui commodi sint est et ad possimus repellat asperiores consequatur veritatis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-18', '2017-05-14 04:17:22', '2017-05-14 04:17:22');
INSERT INTO `lesson` VALUES ('408', '19', 'Minus sapiente illum rerum expedita quasi numquam debitis distinctio.', 'Assumenda et suscipit itaque commodi voluptatem hic et aspernatur velit at non et expedita similique et unde doloribus laborum pariatur molestiae aut mollitia non sit sed porro unde itaque et eligendi qui qui id officia maiores ut molestiae fugiat itaque eaque cupiditate expedita debitis deleniti animi consequatur omnis deleniti ut quo excepturi consequatur eveniet maiores esse doloribus earum odio dicta enim harum perferendis iste ea eaque excepturi eos labore vel est beatae amet porro temporibus odio ut libero rerum beatae aut est quae molestiae fugiat nobis debitis vitae nihil voluptas nisi non quae natus non debitis nisi voluptas et consectetur dolor voluptatem labore quia repellendus qui cupiditate eos ipsum porro eaque consequatur porro esse ut minus sapiente est qui eaque ullam repellat sed delectus est sint ea et ex totam iste.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-18', '2017-05-14 04:17:22', '2017-05-14 04:17:22');
INSERT INTO `lesson` VALUES ('409', '21', 'Explicabo aliquam eveniet sunt nostrum laborum voluptatem eligendi repellat impedit cupiditate.', 'Voluptatem est sapiente architecto quis ea minima blanditiis et esse sequi non dolor amet at odio corrupti molestiae non possimus occaecati facilis expedita ipsam est aut expedita nemo iusto voluptate et pariatur esse voluptatem ab velit unde quia ex reiciendis impedit commodi consequatur accusantium et aperiam rerum autem eum fugiat atque nisi facilis dolor hic qui ipsam qui sed quia architecto quidem ut recusandae deserunt omnis aperiam dolorem similique totam qui aut soluta quos nobis deserunt quis ab et cupiditate est qui ratione pariatur odit ut sit laborum maxime.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-19', '2017-05-14 04:17:22', '2017-05-14 04:17:22');
INSERT INTO `lesson` VALUES ('410', '23', 'Rerum quia architecto maxime voluptatum dolores dicta suscipit qui qui provident.', 'Sequi similique quisquam et qui ipsam natus quia laudantium praesentium exercitationem doloremque ab quo fugiat est sed velit velit voluptatem iste aut earum laudantium quasi aut ut aspernatur blanditiis molestiae exercitationem voluptate minus maxime velit itaque libero et ipsam dolor sit molestias aliquam rerum ut dolor quidem eveniet ab pariatur qui fugiat quidem consequatur esse beatae est sint dolores repudiandae illum ullam aperiam nihil dolores.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '22', null, '0', '1', '2017-05-15', '2017-05-14 04:17:22', '2017-05-14 04:17:22');
INSERT INTO `lesson` VALUES ('411', '30', 'Quia voluptate esse sed quisquam similique harum nihil.', 'Voluptatum qui non non est quidem facere ab quam voluptatem sed quo distinctio rerum rerum vitae consequatur accusantium asperiores sint voluptas pariatur est nihil aut rerum sapiente quia incidunt rerum libero in nesciunt aliquid illum inventore maiores neque et fugiat quo quia ad debitis quod enim et quidem quibusdam placeat aut expedita temporibus debitis rerum qui dolor voluptas unde et omnis accusamus et minima veniam et voluptatem ipsam qui adipisci quas voluptates perspiciatis maiores quia quam at recusandae ut deleniti ratione qui molestiae et qui adipisci officia ipsam cupiditate recusandae suscipit omnis dolorum veniam voluptas non.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-15', '2017-05-14 04:17:22', '2017-05-14 04:17:22');
INSERT INTO `lesson` VALUES ('412', '13', 'Culpa molestias id reiciendis alias et est qui tempore nihil quo.', 'Fuga quas aspernatur necessitatibus autem et sed odit velit pariatur odio exercitationem aut modi velit omnis veritatis nihil illo voluptatem ullam unde recusandae delectus animi ut ipsa repudiandae dolore laborum at porro unde fugiat quos totam in consequuntur expedita asperiores et amet fugit recusandae commodi excepturi praesentium dolores dicta quo quis iusto earum impedit dolor magni rerum accusantium illo architecto rem sequi beatae quia in amet voluptatem cupiditate sed qui doloribus possimus illo quia sit aut asperiores magnam non porro nihil placeat est sunt velit consequatur laborum praesentium voluptas.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-15', '2017-05-14 04:17:22', '2017-05-14 04:17:22');
INSERT INTO `lesson` VALUES ('413', '2', 'Modi perferendis fuga debitis neque cumque velit blanditiis ut.', 'Ea rerum aut labore nihil harum perferendis recusandae earum nobis cumque corrupti aut voluptatem voluptas officiis excepturi quas harum magni animi dolor quae et optio voluptas asperiores ut alias eum esse eum sit ea aut explicabo itaque unde sit quia ad minus asperiores nihil natus impedit ut sapiente pariatur aut veniam ea cupiditate beatae neque praesentium vero animi nisi illo magni et accusamus quia occaecati expedita sit sit neque ullam hic facere at sint sed dolores ratione repellat quia dolores nemo amet eligendi explicabo minus placeat perferendis blanditiis dolore dolorum veniam praesentium libero non voluptatibus voluptatem quo impedit recusandae et error vitae praesentium necessitatibus eos eaque ab labore dolorem quia laborum voluptas inventore tempore voluptas nisi velit voluptas adipisci enim recusandae voluptatem eveniet repellendus possimus et impedit doloremque quia facilis ab.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-15', '2017-05-14 04:17:22', '2017-05-14 04:17:22');
INSERT INTO `lesson` VALUES ('414', '20', 'Ad quidem et reprehenderit doloribus voluptatem sit harum sunt.', 'Alias quia explicabo est vel quod quia qui voluptate modi sapiente quibusdam necessitatibus enim facere nihil autem magni nihil id consectetur sed at fuga ut aut voluptas aut dolores soluta laudantium rerum quibusdam odit et ut nobis repellat et eveniet rem eius aut maxime qui et accusamus mollitia autem omnis voluptas omnis repellendus exercitationem ut ipsa quae nostrum id quae quasi natus molestias a aliquid ipsa sit et quia sunt mollitia illo qui dolore et voluptas minus excepturi aut itaque dolorum quam quis labore sit suscipit cum dolorum et omnis ducimus ea aliquid.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '36', null, '0', '1', '2017-05-14', '2017-05-14 04:17:22', '2017-05-14 04:17:22');
INSERT INTO `lesson` VALUES ('415', '10', 'Mollitia quo et maiores nihil est adipisci exercitationem voluptatem incidunt.', 'Et cupiditate expedita vero velit quia quo sint officia culpa quia repudiandae sapiente labore rem eveniet et tempore voluptatem voluptatem mollitia rerum ratione ea eligendi voluptates autem dolorum commodi iure eligendi quis molestias illo consequuntur est labore quos id excepturi maiores quia officiis delectus reprehenderit quia consequatur eum tempore magnam fugiat earum quia recusandae sunt eos ipsa quas iure eaque labore quas in et nihil laborum dolores repellendus aut ab odio sequi error et harum aut quia a tempore mollitia illo quod a magnam sit unde dignissimos ducimus est eveniet cum quibusdam iste iusto unde voluptate rerum eaque ad ab voluptatem ipsa et nisi qui accusamus consequuntur sint fugit non officiis consequatur dolore et fuga maxime consectetur excepturi.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-17', '2017-05-14 04:17:22', '2017-05-14 04:17:22');
INSERT INTO `lesson` VALUES ('416', '28', 'Et fugiat iste a non quaerat dolores dolor porro sunt.', 'Iure iusto ipsa vitae sunt quas ipsam provident quis sit numquam odit qui est vitae corrupti dolor et qui itaque mollitia aliquam accusantium assumenda laboriosam saepe ipsum corporis architecto autem mollitia atque fugit nemo et aut quis totam odio minus totam accusamus deserunt vitae eum soluta delectus nihil minima magnam ut nemo molestiae quam ex sequi quia accusamus qui quasi voluptatem enim non quidem ut velit eaque beatae.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-19', '2017-05-14 04:17:22', '2017-05-14 04:17:22');
INSERT INTO `lesson` VALUES ('417', '5', 'Ab animi voluptatem hic non sapiente laborum molestias ea repudiandae non.', 'Non quos cum omnis quo numquam id rerum et cumque unde libero laudantium ipsum sunt laborum voluptas dolorem at praesentium quia sit omnis accusamus sed atque odio quia voluptates aut debitis dolores voluptas hic velit earum qui voluptatibus magni qui eaque sit numquam non vero dolorem sit unde exercitationem ratione laboriosam et sed explicabo magni doloremque necessitatibus architecto beatae quaerat exercitationem veritatis assumenda sunt autem velit rerum unde repellat vel assumenda tempore iure quia rerum velit consequatur ab velit temporibus ut in adipisci at quibusdam temporibus est accusantium neque et alias consequatur molestiae dolores delectus repellendus ipsa sapiente at dicta commodi accusantium et quam nihil quo quasi ut labore voluptates ut nobis quam voluptates.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-15', '2017-05-14 04:17:22', '2017-05-14 04:17:22');
INSERT INTO `lesson` VALUES ('418', '19', 'Non in autem culpa rerum saepe.', 'Hic omnis quis vel temporibus eaque rerum est quos illo dolor quo magnam eligendi earum nostrum sunt repudiandae hic accusantium repudiandae sit quo mollitia qui perspiciatis nam qui deleniti dignissimos quia aut incidunt aut dolor modi aut numquam incidunt magni omnis ut beatae consequuntur perspiciatis deserunt sed cumque excepturi perspiciatis quidem repellat ut qui et ab aspernatur perferendis consequatur error consequatur voluptas aspernatur voluptatum et cumque earum inventore quo consequatur impedit quod quia odio voluptas ea quam iste nam quam sit consequatur perspiciatis officiis qui qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-18', '2017-05-14 04:17:22', '2017-05-14 04:17:22');
INSERT INTO `lesson` VALUES ('419', '27', 'Perspiciatis odio voluptas nihil dolorem est autem sit sit.', 'Distinctio aut optio perspiciatis minus reiciendis enim voluptas itaque perspiciatis nostrum ratione quos quas et voluptas quia quis natus delectus ex est recusandae eos quas consequatur illum esse animi sint et eos ullam reiciendis facere nam est aspernatur voluptates deleniti aperiam doloremque voluptatum alias eveniet quidem vero et quasi hic velit atque aut similique aut illo quia aspernatur nam et temporibus odio.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '20', null, '0', '1', '2017-05-19', '2017-05-14 04:17:22', '2017-05-14 04:17:22');
INSERT INTO `lesson` VALUES ('420', '30', 'Officia assumenda perferendis cupiditate necessitatibus voluptas tempore at culpa facere aut.', 'Id repellat aut optio quia maxime porro quas quis dolor quia ducimus reiciendis molestiae et vel quia dicta consectetur est culpa animi quia autem in quo asperiores dolor ex sit mollitia atque ut culpa iste similique eum aliquid et qui quibusdam necessitatibus quia vitae perspiciatis corrupti animi impedit ab natus error voluptatem qui iusto dolores consectetur accusantium eveniet blanditiis ut voluptatem rerum et facere natus nulla veniam dolor et iste reprehenderit praesentium qui numquam eveniet molestiae blanditiis et non sed accusantium mollitia et minima et repellat consequuntur et pariatur sunt sit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '36', null, '0', '1', '2017-05-15', '2017-05-14 04:17:22', '2017-05-14 04:17:22');
INSERT INTO `lesson` VALUES ('421', '7', 'Quo beatae autem sed sint non voluptas similique soluta dicta.', 'Et ullam earum ad dolorem qui aut ut libero ipsam enim est consequatur ut qui eligendi est est ab repellat temporibus occaecati distinctio rem quis velit aut voluptatibus ratione dolorem at eum nemo dolores ut repellat dolorem ipsa fugit ipsum temporibus voluptas rerum ex ipsa sit non illum reprehenderit ut ad eaque soluta eveniet sed velit dolores quisquam optio qui ea voluptates.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-18', '2017-05-14 04:17:23', '2017-05-14 04:17:23');
INSERT INTO `lesson` VALUES ('422', '14', 'Vero sed voluptate quasi ut dolorem vero.', 'Aliquid voluptas excepturi quis commodi dolorem aut sit modi enim expedita ducimus et animi id et sed quia sit repellat magnam numquam molestias sed dolor veniam quaerat quia impedit cumque minima vero esse alias vel ea illum quia quis ea sed dolorum a est repellendus aut voluptatem sunt consequuntur ducimus ab et sunt doloremque suscipit numquam soluta et placeat fugit animi debitis qui iste aut ea et praesentium nam itaque officiis vel et rerum autem assumenda vel.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '42', null, '0', '1', '2017-05-14', '2017-05-14 04:17:23', '2017-05-14 04:17:23');
INSERT INTO `lesson` VALUES ('423', '30', 'Distinctio sint ut mollitia quibusdam.', 'Ut rerum voluptatum culpa itaque iste voluptatem rem sunt a et possimus nostrum dicta omnis nemo distinctio atque iusto fugiat molestias aut et aut sapiente dolorem exercitationem eum qui atque et perferendis nobis doloribus odio repellat quisquam in enim quos est delectus et voluptas ullam nam maiores voluptatem ex neque deleniti laboriosam eum praesentium in cumque enim consectetur ea nam dolores eius assumenda repudiandae aut qui est officia quibusdam minima voluptatem modi mollitia ullam facilis asperiores quo non animi similique laborum odit minima possimus et et iusto maiores esse perferendis quaerat veritatis exercitationem sed qui id omnis consequatur sed non doloremque consequatur molestias enim omnis in sed sed sit aperiam expedita.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '20', null, '0', '1', '2017-05-14', '2017-05-14 04:17:23', '2017-05-14 04:17:23');
INSERT INTO `lesson` VALUES ('424', '9', 'Ut et nobis voluptas quia.', 'Ratione culpa quia nostrum eveniet sed ea voluptatibus aut ut velit necessitatibus reiciendis ut dolorum eos autem minima voluptas mollitia maiores molestiae ab cupiditate tenetur enim quas unde sunt debitis exercitationem eius ad veniam tenetur et officia voluptates voluptas ipsum a ut magnam ducimus qui et ipsam occaecati aliquid sit odio aliquid animi aperiam consequuntur est nulla sit laudantium nihil ut sed blanditiis minima saepe sapiente nostrum at a distinctio harum consectetur quis ut eveniet et enim laborum et sint eos aut eaque ducimus non laboriosam labore dolores rem aliquam non necessitatibus unde voluptas porro omnis tempore laboriosam est et consequatur enim ut a rerum eos rerum voluptatem et culpa eum totam et rem eos nemo nobis mollitia enim aut vitae qui nostrum eum vel qui eum vero aliquid sit optio ipsum eos in commodi eius cum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '28', null, '0', '1', '2017-05-17', '2017-05-14 04:17:23', '2017-05-14 04:17:23');
INSERT INTO `lesson` VALUES ('425', '16', 'Alias nulla quibusdam quibusdam dolore sapiente cupiditate ab ut.', 'Sed repudiandae doloribus qui exercitationem sapiente ipsa magnam hic aliquid assumenda exercitationem recusandae laudantium dolorem ea quia molestiae qui deserunt est eum molestias voluptatibus unde quibusdam unde soluta aut recusandae voluptates sed et nulla voluptatem sit commodi possimus quasi repudiandae nostrum possimus excepturi at magnam nobis quia ea at qui corrupti provident ex qui nihil eaque repudiandae laboriosam reiciendis quis et molestiae qui consequatur quis eaque qui molestiae voluptas voluptatem dolorem expedita voluptate enim qui et neque in debitis enim optio nulla assumenda quas sint incidunt et quaerat vero consequuntur aspernatur ipsam pariatur est aspernatur occaecati magni sint error magnam aut voluptatum ut omnis expedita eum quasi consequatur fuga iste cumque dolores sit sapiente enim.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-16', '2017-05-14 04:17:23', '2017-05-14 04:17:23');
INSERT INTO `lesson` VALUES ('426', '15', 'Voluptates fugiat dignissimos quia quas corrupti officia vero aut.', 'Exercitationem sunt quod et dolorem illo quaerat accusantium consequatur laboriosam est dicta reprehenderit impedit et in sit aut sit porro ipsam cumque quas et et amet quia incidunt eum voluptatem quasi illum et illo sunt aperiam suscipit dolorem vel et inventore quam quia voluptatem animi minus reiciendis aut voluptatem repellendus cupiditate in vel necessitatibus et sunt et quae consequatur sint sunt nisi rerum facere vel consequuntur.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-17', '2017-05-14 04:17:23', '2017-05-14 04:17:23');
INSERT INTO `lesson` VALUES ('427', '25', 'Distinctio repellat aut omnis libero culpa et voluptas porro qui esse.', 'Natus id ipsa dignissimos ad sed molestiae quia quis et consequatur eius provident quas vero reiciendis voluptas odit accusantium culpa aut et omnis et praesentium dolores animi autem ut non ut sint ut nihil accusantium maiores eaque quia laborum quidem laboriosam doloremque ad ducimus laudantium consectetur recusandae praesentium corrupti cum dicta modi sit quibusdam maiores ipsam optio accusamus ea incidunt numquam asperiores quod et sed fugiat minima dolore consequuntur nulla cupiditate similique quis qui voluptatem id atque quibusdam odit et rerum qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-17', '2017-05-14 04:17:23', '2017-05-14 04:17:23');
INSERT INTO `lesson` VALUES ('428', '19', 'Facere sunt voluptatem fugiat consectetur adipisci ullam.', 'Odit odio vero harum sapiente quae veniam officiis delectus sit rerum aut earum nam recusandae excepturi id molestiae nemo doloremque ut omnis est nam assumenda voluptatum et est at qui atque praesentium rerum adipisci aliquam dolorem error voluptas dolore doloribus quam fugit dicta sint omnis et et quis quidem recusandae soluta quia aut minus sed minus soluta veritatis in a et et sed voluptates est inventore autem repellendus vel ratione harum cupiditate ut nostrum atque eligendi iusto nostrum ea ratione eum libero amet iure itaque dignissimos porro ipsum et repudiandae velit veniam qui excepturi beatae eius omnis voluptates.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-15', '2017-05-14 04:17:23', '2017-05-14 04:17:23');
INSERT INTO `lesson` VALUES ('429', '14', 'Incidunt impedit rerum explicabo et possimus rem qui veritatis.', 'Optio consequatur sint nam mollitia illo aliquid id voluptas debitis debitis iure vero veniam sint amet consequuntur sequi nihil suscipit incidunt autem esse molestiae aut molestiae non animi quam sed sint minima sint natus rerum at maiores magnam laboriosam velit odit consectetur molestiae aliquam dolorum consequatur ullam aut aspernatur non nihil at laudantium est ab non molestiae quis quibusdam modi earum est iusto minus iure sint aperiam sit laborum non accusamus quas voluptatum dignissimos nam rerum tempore ut facere nesciunt suscipit vitae dolorum ab alias mollitia nesciunt aspernatur in nam esse laborum vel eum error fugiat quas excepturi quasi et quis quaerat error vitae.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-15', '2017-05-14 04:17:23', '2017-05-14 04:17:23');
INSERT INTO `lesson` VALUES ('430', '24', 'Doloribus adipisci voluptas voluptas qui culpa debitis neque qui sed aut.', 'Tempora nihil voluptas ipsum recusandae perspiciatis aut quasi ut quia perferendis ut velit distinctio modi et tempora recusandae laudantium natus voluptatem atque facere vel rerum aut est rerum dolores eos nihil cum non id tenetur assumenda nulla autem facere qui facilis debitis quasi ex rerum nisi veritatis voluptate voluptatibus quia natus dignissimos cupiditate eos et sint itaque adipisci esse amet nam dolore quia aliquam quo molestiae error voluptatem non quae rerum itaque omnis amet et est necessitatibus et quas animi praesentium beatae nemo aut voluptas impedit sed nam quod repudiandae sit quod.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '30', null, '0', '1', '2017-05-14', '2017-05-14 04:17:23', '2017-05-14 04:17:23');
INSERT INTO `lesson` VALUES ('431', '2', 'Sunt molestiae aut culpa consectetur aut qui odio dolor quasi alias.', 'Nulla inventore veritatis deleniti soluta consectetur placeat et at qui deserunt aperiam eligendi architecto nesciunt magni qui ex dolore ut cum sapiente nihil minima eligendi nostrum numquam ipsum veniam consequatur et vel minus dicta dicta similique ipsa rerum autem impedit ipsum aperiam tempora qui quo minima tempora pariatur odit adipisci nesciunt aut quibusdam error eligendi quo nihil voluptatum eos quo incidunt molestiae non molestiae quam odio itaque quaerat impedit esse est maiores quia a quas minima quisquam quia est dolores dolores voluptatem facilis sunt odio occaecati asperiores incidunt veritatis rerum est eveniet repudiandae reprehenderit amet nam rem qui vero nam non totam accusantium ullam et magnam quia dolor et perspiciatis similique.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-19', '2017-05-14 04:17:23', '2017-05-14 04:17:23');
INSERT INTO `lesson` VALUES ('432', '22', 'Sunt praesentium quidem qui nesciunt asperiores sequi.', 'Voluptatibus aut nam nisi accusantium consequatur illum enim vero accusantium consectetur similique repudiandae reprehenderit sed dicta sint numquam cumque facere non minus laudantium ducimus consequatur unde tempora necessitatibus dicta minus et voluptate harum voluptates minima praesentium excepturi perspiciatis et ut quia neque aut quam iste quae non possimus velit qui quaerat laudantium vitae aut sunt praesentium expedita officia ut a accusamus amet labore et est debitis dicta deleniti ad quia perspiciatis distinctio vel aspernatur eos et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '23', null, '0', '1', '2017-05-15', '2017-05-14 04:17:23', '2017-05-14 04:17:23');
INSERT INTO `lesson` VALUES ('433', '22', 'Quam expedita qui cum quia quis autem voluptatem deleniti sit sit.', 'Quia dolore esse laudantium praesentium nihil reiciendis consequatur aspernatur sunt odio fuga tempora autem numquam illum voluptas commodi est et in perferendis modi ab ad dolor repellat non et voluptatibus eaque consequatur autem ut consequatur rerum quaerat qui hic accusantium sint numquam et architecto est eum consequatur est voluptatum totam ab earum possimus rerum nihil quasi magni praesentium doloremque eaque libero et et omnis sunt sit minus saepe amet unde necessitatibus illum error voluptatem pariatur eos inventore eum nobis saepe distinctio perferendis vero exercitationem qui id qui corporis dicta laudantium enim error omnis aut et nulla omnis facere qui id veniam explicabo tenetur omnis qui ut nobis aut ut necessitatibus ipsum adipisci ut quia quia assumenda debitis corrupti non provident.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '23', null, '0', '1', '2017-05-14', '2017-05-14 04:17:23', '2017-05-14 04:17:23');
INSERT INTO `lesson` VALUES ('434', '15', 'Rerum et voluptate perferendis omnis aspernatur odio aut provident praesentium.', 'Dolor esse cum harum sit ullam totam est dicta placeat praesentium aut autem maiores ex aut sit natus iste enim expedita ut voluptas aut deleniti et aut corrupti assumenda commodi et ea est repudiandae culpa explicabo et optio provident qui odit consequatur quo atque nemo ipsa et ducimus odio consequatur molestiae dolore et et eum id molestiae et et quod et quo molestias dolorum laboriosam laudantium voluptatem voluptatum soluta possimus sint quia est qui veritatis excepturi dolor magnam nihil aut beatae enim numquam unde magni officia doloremque rerum modi dolores similique ab fugit dolorem animi voluptatem rerum rem laborum laborum sunt porro harum nostrum enim laudantium dolor cumque cupiditate commodi voluptatibus blanditiis facere quod voluptatem odio qui consequatur ipsam delectus voluptatibus nemo vitae dolores esse facilis at eveniet minima nemo ut distinctio nisi dolor rerum minima incidunt quam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-16', '2017-05-14 04:17:23', '2017-05-14 04:17:23');
INSERT INTO `lesson` VALUES ('435', '9', 'Placeat velit omnis perspiciatis quia accusantium minus voluptas.', 'Quia assumenda fugit asperiores quaerat odit dolores nihil repellendus ratione est eaque pariatur sed repellat tempora quos iure molestiae cupiditate voluptas ut velit aut a quia et soluta et voluptate adipisci dolores dolor ullam tempora eligendi odio odio consectetur officiis qui expedita atque reiciendis cumque saepe vel aut harum est nihil commodi adipisci eligendi ab aut et est quis rem voluptatem dolores autem rerum voluptatem quod consequuntur asperiores molestias repellat labore quam vel occaecati natus quas et et corporis odio velit velit ipsa id consequuntur ipsa voluptatem molestias officiis eos vel error voluptatum est voluptatem inventore odit ut aperiam qui temporibus quidem dolore consequatur veniam sint est quasi ipsa excepturi reiciendis sit minima et tempora et omnis cumque consequatur voluptas amet in mollitia reprehenderit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-19', '2017-05-14 04:17:23', '2017-05-14 04:17:23');
INSERT INTO `lesson` VALUES ('436', '27', 'Sed omnis dolor qui ea aliquam quibusdam consectetur.', 'Itaque aut ipsam voluptatum dignissimos saepe illo sit nisi et sed tenetur est fugiat necessitatibus et sit debitis aut ullam deleniti quasi magni a voluptatibus sed rerum totam omnis ut vel exercitationem amet sit iure perspiciatis aut qui in aspernatur maxime nulla sint perspiciatis itaque quisquam asperiores cupiditate numquam libero sint fugit ducimus id aliquid rem dicta recusandae ducimus illum corporis beatae enim nihil qui ullam voluptatem occaecati ratione facere sapiente praesentium quos magni vero quisquam recusandae ea laborum est aut dolores atque occaecati est vero omnis tenetur pariatur neque alias doloremque iure doloribus cumque facilis dolores adipisci iure quisquam ea voluptate harum perspiciatis reiciendis atque et dolorem provident nihil voluptatem facilis facilis excepturi harum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-14', '2017-05-14 04:17:24', '2017-05-14 04:17:24');
INSERT INTO `lesson` VALUES ('437', '15', 'Qui at aut impedit et pariatur dolore quod ut architecto.', 'Quasi accusamus quas excepturi veritatis sed itaque iusto et reprehenderit quibusdam autem nemo quasi maxime provident ea nam assumenda cupiditate dolor et quidem in porro et repellendus id quaerat hic et nihil occaecati voluptas porro illo laboriosam enim quia vitae ut quia aut hic quia placeat ducimus saepe dolor vero deserunt facilis minus beatae delectus eos rerum et minus quis sit adipisci cupiditate accusantium doloribus hic qui quia facilis aliquam rerum officiis rem ratione hic corporis iure voluptatem dicta ut itaque laudantium inventore dolorum iste molestiae eaque illo illo impedit laborum beatae aspernatur omnis labore et rerum nulla voluptatem sed.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-17', '2017-05-14 04:17:24', '2017-05-14 04:17:24');
INSERT INTO `lesson` VALUES ('438', '10', 'Architecto et voluptas et non quis.', 'Quidem necessitatibus porro ut neque sapiente in et qui quia qui sint voluptatibus velit sit consequatur et aliquam nulla pariatur et provident dolor aut velit animi molestias quibusdam sunt ut exercitationem unde adipisci omnis corrupti quo et maiores numquam autem architecto et quis quam tenetur fuga molestiae aut sequi porro porro et possimus mollitia asperiores ut facere accusamus ea soluta at aut expedita similique ex temporibus ad explicabo qui et sit neque iure autem sed culpa explicabo nam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-18', '2017-05-14 04:17:24', '2017-05-14 04:17:24');
