INSERT INTO `lesson` VALUES ('440', '26', 'Totam voluptates eius possimus est harum tempora a deleniti.', 'Sit aut mollitia dolor nisi saepe et ea quis qui debitis maiores numquam hic molestiae consectetur sint qui voluptatem ut autem molestiae sed error sint ut eaque architecto fugit repellat vero quaerat earum est veniam laborum laborum doloremque similique atque exercitationem fugiat architecto ut voluptate quae rerum rerum modi pariatur qui tempora enim corporis voluptas nulla qui libero iste repellat enim repudiandae ea earum nostrum et dolores rerum aut aut voluptatem iusto vel ut rerum asperiores hic dolorem vel dolorem rerum eum voluptatem numquam at ratione rerum adipisci voluptatibus in doloribus nostrum ipsam quod autem facilis tenetur est exercitationem et est aliquid pariatur omnis beatae illo quia reiciendis saepe culpa.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '24', null, '0', '1', '2017-05-16', '2017-05-14 04:17:24', '2017-05-14 04:17:24');
INSERT INTO `lesson` VALUES ('441', '23', 'Odit iusto ut qui non et officia iusto.', 'Eos et ut in odio commodi reiciendis ea ea aspernatur soluta inventore dicta amet aut eos et omnis nostrum molestiae facilis delectus unde laboriosam quo est blanditiis est voluptas quo quas quia odit velit itaque voluptatem vel nisi officia tenetur vel sed amet ut quaerat magnam qui neque vero porro est possimus deleniti voluptatem minus quia sunt qui sed repellat qui perspiciatis perferendis ea eveniet molestias aperiam ut provident laudantium qui molestiae ex beatae quidem aut ut et aliquam libero quidem provident quia porro voluptas rerum minima aut molestiae sit vitae ratione ut voluptatem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-14', '2017-05-14 04:17:24', '2017-05-14 04:17:24');
