INSERT INTO `lesson` VALUES ('444', '25', 'Pariatur recusandae alias eum occaecati tenetur quos.', 'Et dicta sunt quisquam rem natus rerum sit id velit pariatur et qui laborum ut sunt incidunt quia enim voluptatem alias consequatur consequatur est est quisquam est nemo itaque iusto sit sit laborum quisquam eum sunt magnam provident et tempore est quisquam est eaque necessitatibus excepturi perspiciatis qui sequi dolor et officiis aliquid ut et possimus ex voluptas eaque aliquid et perferendis aut exercitationem facere quaerat natus harum minima modi quo eius autem maiores sapiente sed neque et dicta itaque porro nemo quia incidunt optio quia ut exercitationem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-18', '2017-05-14 04:17:24', '2017-05-14 04:17:24');
INSERT INTO `lesson` VALUES ('445', '5', 'Harum sed dolore tempore corporis tempore officia ex sed.', 'Praesentium provident cum quisquam voluptatem nesciunt perferendis nobis repudiandae praesentium aspernatur quo saepe est voluptas et occaecati commodi explicabo ipsum praesentium corrupti odio repellat magni ipsum dolorem labore ipsum officia et modi provident maiores quas voluptatem id dolor illum et voluptas perspiciatis quam et nesciunt delectus quas sed omnis eaque minus quia dolores ducimus ab cumque illum praesentium voluptatibus qui sed delectus qui omnis eveniet aliquid expedita vitae id dicta autem veritatis ea voluptas id labore occaecati commodi sit suscipit sed saepe sit numquam est alias deleniti eos sint asperiores voluptatem sapiente eaque quasi est repudiandae distinctio nesciunt reprehenderit quos accusamus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '31', null, '0', '1', '2017-05-14', '2017-05-14 04:17:24', '2017-05-14 04:17:24');
INSERT INTO `lesson` VALUES ('446', '15', 'Inventore enim totam non dicta consequatur sit repellat commodi.', 'Aut enim provident et aut quia rem occaecati rerum alias voluptatem quos beatae nihil in quia ut minima aliquid veniam architecto dolorem aut repellendus quia accusamus eos nulla et minima eos ea soluta debitis sapiente fugit totam ut repellendus est nihil iure quos rerum maiores dolor dolores at deserunt eos reprehenderit autem dolores itaque inventore tempora rem animi totam eum deserunt sequi harum necessitatibus architecto in optio nisi voluptas autem eos sit minima incidunt similique et odit ullam doloribus provident sunt esse ea quo itaque tempora mollitia voluptatibus explicabo voluptas consequatur recusandae alias nemo dolore aut tenetur.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '30', null, '0', '1', '2017-05-18', '2017-05-14 04:17:24', '2017-05-14 04:17:24');
INSERT INTO `lesson` VALUES ('447', '8', 'Eligendi placeat et beatae quis aut debitis accusamus soluta itaque maiores.', 'Perspiciatis repudiandae voluptas labore incidunt culpa eum doloribus dolore sunt cumque et aut autem laborum nihil vero ipsam ut dignissimos libero et accusamus necessitatibus commodi nam enim consectetur rerum corporis autem minus optio eius saepe perferendis enim eligendi nostrum tempora esse hic rerum quia porro explicabo recusandae facilis vero at tenetur quo sint debitis itaque ea sint architecto suscipit delectus et esse nulla nesciunt sint deleniti non eius culpa sunt nesciunt et qui sed quo quos expedita vero sed labore nisi eius possimus tenetur repellat provident distinctio eum et deserunt maiores voluptas odit optio autem quia saepe officia doloribus magni asperiores fugiat est esse pariatur nam tenetur sed sint dolore est necessitatibus dolor quia sequi aut dolorem ratione officia qui libero aut quis impedit explicabo esse itaque est dolorem pariatur ipsam ipsa.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-19', '2017-05-14 04:17:24', '2017-05-14 04:17:24');
INSERT INTO `lesson` VALUES ('448', '26', 'Quis nemo quaerat occaecati ea cupiditate et molestiae hic veritatis laborum.', 'Nisi velit dicta est quae quis ipsam sit facere minus quo quae voluptatem eos quas delectus dignissimos ipsam voluptas laborum exercitationem consequatur commodi illum perspiciatis dolorem inventore aut totam dolorem officiis nobis necessitatibus voluptatum ut consequatur vero saepe illum earum veniam totam voluptatibus ratione consequatur praesentium dicta odit impedit amet delectus adipisci et suscipit id ad natus sint aut et at accusamus voluptatem in omnis eum qui nemo iste laudantium nam provident aut consectetur qui ducimus iste dolores.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-19', '2017-05-14 04:17:24', '2017-05-14 04:17:24');
INSERT INTO `lesson` VALUES ('449', '27', 'Enim sed saepe ea modi cumque beatae voluptatibus dolor est doloribus laudantium.', 'Blanditiis quod consequatur sit iusto accusantium amet veniam autem vel velit ut eos ducimus et molestiae consequatur et rerum impedit voluptate aut aut asperiores et aut ab velit optio ut velit velit modi odit et atque itaque assumenda doloremque ea nihil accusantium cupiditate ad nemo nihil maiores non dolores pariatur ut et repellendus mollitia animi alias et quas aut maxime omnis blanditiis ratione ea necessitatibus suscipit qui voluptas ut natus atque et id voluptatem nihil occaecati ipsam sed velit molestiae corrupti corrupti voluptates culpa iste sit quasi quam est voluptatum ullam quia aperiam temporibus reprehenderit occaecati reiciendis quia reprehenderit officiis tenetur nisi eos eligendi libero iure fugit at.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '45', null, '0', '1', '2017-05-19', '2017-05-14 04:17:24', '2017-05-14 04:17:24');
INSERT INTO `lesson` VALUES ('450', '23', 'Fugit non quia consequatur dolore corrupti accusantium mollitia praesentium.', 'Dolore et quia excepturi quam sit hic voluptatum et sit aut consequatur illum rem consequatur nobis fuga laudantium nam illo vero quae esse consequatur repellat quae expedita blanditiis atque illum est vel fuga porro ut sapiente nobis veritatis omnis atque vero quia et nihil similique praesentium aliquid nulla non tempore fuga est possimus quis saepe nihil nihil sed doloremque sint similique deleniti qui incidunt nulla deleniti voluptatibus veniam aliquid facere amet vero fugiat accusantium dicta ipsa rerum voluptatem porro magni ipsam veritatis consequatur sit velit harum quis assumenda impedit doloribus voluptate ut numquam non rerum quod repudiandae laboriosam iure voluptatum natus vel iusto expedita consequatur quis quibusdam cumque laborum facere ratione autem ad sequi iusto debitis labore qui et optio.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-19', '2017-05-14 04:17:24', '2017-05-14 04:17:24');
INSERT INTO `lesson` VALUES ('451', '4', 'Fuga porro est maxime dignissimos aut et eveniet.', 'Quo numquam ea repudiandae voluptatum eos inventore amet debitis voluptate sint enim eveniet dicta necessitatibus id tenetur voluptas temporibus cum possimus voluptatem id autem est non blanditiis qui ipsum quibusdam doloremque quam quaerat dolorum aliquam maiores ipsam voluptas minus nobis qui nisi vel reiciendis laboriosam voluptas velit veniam provident cupiditate veritatis eum fugiat sit animi adipisci ducimus consectetur dignissimos voluptatem beatae quam explicabo voluptatibus optio perferendis voluptas quas.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-14', '2017-05-14 04:17:24', '2017-05-14 04:17:24');
INSERT INTO `lesson` VALUES ('452', '12', 'Id rerum dolore earum aspernatur eaque dolorem veniam quia.', 'Quia numquam quae ut deserunt voluptas iusto dolor voluptatem rerum voluptatum laudantium deserunt tenetur quo id distinctio necessitatibus repudiandae et sequi magni et in maxime quod et voluptatem ea corrupti inventore excepturi in ipsam facere doloribus consequatur dolorum aliquid et esse corrupti cumque possimus rerum molestiae eveniet tempore quaerat nam eos voluptatem doloribus est quia deserunt molestiae soluta praesentium aspernatur est deleniti quidem et aperiam odio et voluptas harum corporis eius fuga numquam distinctio nulla accusantium sed sed dolor vel consequuntur minima neque sed temporibus reprehenderit voluptas repellendus nihil sed dolor tenetur sed sit consequatur ut et qui numquam quia ut veritatis itaque voluptatem aut veniam voluptate quam sunt cumque ut aut aut rem atque nulla.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-19', '2017-05-14 04:17:24', '2017-05-14 04:17:24');
INSERT INTO `lesson` VALUES ('453', '17', 'Vero optio ut autem corporis libero qui reiciendis.', 'Totam nemo voluptas nesciunt et dolores et rerum at a aspernatur voluptatem sit quia velit et enim occaecati et consequatur minima vero quam at aperiam quibusdam at veritatis suscipit doloribus et sed neque rerum cupiditate soluta sed quae est voluptatem in nisi voluptates accusantium reprehenderit debitis suscipit ut aut autem suscipit doloribus consectetur dolores doloribus cum mollitia et saepe culpa facilis quod quas quia voluptas non numquam rerum expedita similique atque recusandae consectetur dolorum exercitationem dolor officiis ea enim vel explicabo vero qui nostrum blanditiis necessitatibus repellendus natus quasi ratione eum vel qui in molestias et tempora ipsum blanditiis fugit voluptatem nostrum in et assumenda.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-19', '2017-05-14 04:17:25', '2017-05-14 04:17:25');
INSERT INTO `lesson` VALUES ('454', '18', 'Quae aliquid impedit rerum illum labore sequi nam rerum qui.', 'Architecto dolore earum aut aut facilis repellendus minus quia quia omnis iure quidem consequatur eum aspernatur numquam accusantium et ullam pariatur vitae et sit architecto eius modi accusamus accusantium qui repellendus eius et assumenda et sapiente est repellendus corporis dolores aut quod est aut et soluta earum dolores eius vero aut ullam et aperiam quo accusamus aut omnis doloremque sit exercitationem iusto aperiam ex est veritatis vel minus ipsum saepe eaque nulla autem commodi accusamus in asperiores dolores consectetur incidunt mollitia molestiae et ad minus enim asperiores magnam enim ad mollitia esse eum dolorum quibusdam dolor et sit vero accusamus et et ut et dicta corporis corrupti neque porro magnam exercitationem quae quasi est non commodi labore consequuntur ea similique consequatur ut illo inventore quos esse necessitatibus officia non enim velit temporibus sint aut illum delectus quisquam doloremque reiciendis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '45', null, '0', '1', '2017-05-15', '2017-05-14 04:17:25', '2017-05-14 04:17:25');
INSERT INTO `lesson` VALUES ('455', '12', 'Alias necessitatibus et a error cum consectetur dolores enim assumenda.', 'Aut sunt suscipit modi eum excepturi illo ullam magnam sed suscipit vel non eos id hic dolor porro esse tenetur neque quae molestias molestias quos unde cum enim dicta veniam sunt autem et consequuntur et distinctio voluptatem excepturi non magnam reiciendis saepe quis qui qui soluta architecto vel laudantium provident eveniet possimus similique sed atque est optio aut unde et explicabo blanditiis totam accusantium doloremque aliquam eos doloremque labore minus est esse ut necessitatibus aspernatur.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-14', '2017-05-14 04:17:25', '2017-05-14 04:17:25');
INSERT INTO `lesson` VALUES ('456', '24', 'Enim eum voluptatem reiciendis est eum ipsam eaque dolorem itaque et libero.', 'Quisquam doloribus nihil voluptatibus fugit quasi quos fugit veritatis fugit id nisi non molestiae dolores qui quidem veritatis dolores sapiente rerum et omnis vitae praesentium aliquam in aut architecto explicabo illum quos pariatur distinctio velit aut doloribus eligendi architecto possimus consequatur veniam nulla deserunt neque sed voluptatibus atque enim voluptate facere perferendis voluptatem aperiam voluptatem dolores veritatis doloribus impedit dolorum autem maiores voluptatem molestiae quas placeat voluptas cupiditate molestiae harum sit impedit voluptatem quis voluptas consequuntur consectetur minus cum ea dolores corrupti sint occaecati voluptate ut cumque rerum nihil a vel exercitationem quibusdam explicabo neque inventore doloremque saepe similique aut labore dicta facere esse voluptate ut sed quidem eos et dolores fuga voluptas.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-15', '2017-05-14 04:17:25', '2017-05-14 04:17:25');
INSERT INTO `lesson` VALUES ('457', '28', 'Rem qui alias molestiae distinctio aut dolor quibusdam.', 'Quo qui rem architecto consequuntur maiores in dolorem quo consequuntur quis excepturi labore aut quam inventore sed libero nemo placeat amet enim et maiores magni possimus enim distinctio et consequatur id qui harum aut qui rerum natus minus nulla nihil et eos veritatis fugiat in rerum illum consequatur fugit possimus explicabo ipsam cupiditate commodi ut autem magnam qui nemo reprehenderit nihil est repellat aspernatur odit quisquam ex eos quae doloremque laudantium non non consequatur beatae cumque cum qui qui veritatis laudantium non porro vel nihil eum et eligendi provident rerum qui asperiores eum saepe voluptas magnam itaque beatae quisquam et sed eius recusandae assumenda.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '24', null, '0', '1', '2017-05-17', '2017-05-14 04:17:25', '2017-05-14 04:17:25');
INSERT INTO `lesson` VALUES ('458', '3', 'Neque sit mollitia error ad architecto aperiam aliquid tempore a.', 'Ipsa rem magnam et totam qui est neque vitae veniam et dolorum voluptas fuga voluptatem quia velit ipsum vel totam eius incidunt tempore assumenda inventore necessitatibus rem voluptatibus totam molestiae nihil est non dolores placeat accusantium iusto voluptas distinctio ea est reprehenderit illo corporis sed dolore asperiores assumenda aut possimus id velit numquam et voluptatum numquam id molestiae voluptate dolor modi quis nobis unde similique quo in temporibus qui eos nostrum cumque magnam autem et aperiam rerum sed quisquam quod placeat cum repellat praesentium necessitatibus veniam possimus aut sit omnis officiis facilis est et quibusdam dolorem et reiciendis rerum animi dolores unde tenetur occaecati quod unde id corrupti enim omnis voluptatem reprehenderit vitae molestiae ab omnis aut sint est exercitationem quis delectus dolorem nulla laboriosam molestiae qui quo numquam omnis ad cum ut error qui expedita nobis nostrum error minus rem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-15', '2017-05-14 04:17:25', '2017-05-14 04:17:25');
INSERT INTO `lesson` VALUES ('459', '7', 'Optio qui et facere itaque aliquid praesentium nemo vitae.', 'Accusantium provident corrupti ea ut commodi nisi nam voluptatem enim aut modi assumenda et autem nobis blanditiis totam et doloremque quod mollitia error dolorem beatae laborum qui et veritatis assumenda cumque reiciendis occaecati ipsa impedit et tenetur aspernatur animi sequi nisi hic dolorem fugit sit et voluptas modi perspiciatis eum voluptatibus in voluptas voluptas animi molestias unde sit praesentium rerum perferendis id soluta quod quis aut porro unde doloribus esse ut dicta tempora repellat doloribus provident ut illum optio voluptates repellat consequatur atque sequi debitis aut minima aut repudiandae est id aperiam incidunt sint debitis nisi non itaque consequuntur assumenda adipisci error sint autem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-17', '2017-05-14 04:17:25', '2017-05-14 04:17:25');
INSERT INTO `lesson` VALUES ('460', '3', 'Et eveniet animi consequuntur optio quis.', 'Exercitationem velit optio nobis vero sapiente ab ut sunt mollitia eos qui illo repellendus non et error consequatur aliquam nemo sint delectus praesentium ratione corporis ullam dignissimos praesentium tenetur magni officiis ab iure exercitationem enim ea quos praesentium nostrum aliquam earum saepe nisi ratione quos dolore corrupti nam quia nemo est eum tempora officia debitis distinctio est esse quo rerum atque odio laboriosam adipisci dolorem consectetur aut sit expedita iure sequi magni unde qui vel expedita dolorum qui consequatur numquam repellendus voluptatem sint saepe est inventore nihil eos deserunt debitis repudiandae est voluptas praesentium inventore fuga assumenda minima nemo consequatur praesentium nam ipsam et aut nemo officia maxime ab et at rem voluptatem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-18', '2017-05-14 04:17:25', '2017-05-14 04:17:25');
INSERT INTO `lesson` VALUES ('461', '4', 'Quia saepe velit labore fugit mollitia eos illo nihil consequatur maiores.', 'Quae laborum consequatur et qui ullam illum sed ut eius delectus aliquid quam vel in qui fuga adipisci eius aut labore ea voluptas ullam sunt autem ex consequatur velit reprehenderit suscipit accusamus dolorem impedit autem sapiente soluta iure illum sapiente sint eius enim illo illum minima laborum impedit inventore et veniam cumque ipsa asperiores rerum qui excepturi commodi maxime earum consequatur mollitia dignissimos consequatur amet omnis quae eaque voluptatem voluptas dolorem voluptatem accusantium quae quo beatae ipsum quis adipisci voluptates odit eos facere quidem aperiam ex ut porro placeat saepe id quaerat omnis aspernatur doloremque quis deleniti.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-19', '2017-05-14 04:17:25', '2017-05-14 04:17:25');
INSERT INTO `lesson` VALUES ('462', '6', 'At amet sunt facilis aliquid perspiciatis excepturi voluptatem vel sapiente perspiciatis.', 'Molestiae reiciendis perferendis sunt vitae consequatur aperiam dicta blanditiis autem asperiores non facere amet tenetur numquam maiores optio deleniti similique aut voluptatem sed iure distinctio voluptas adipisci odit in quia animi quis aliquid necessitatibus nisi minus excepturi id tenetur sunt ducimus quam molestiae reiciendis molestiae et aut maxime laboriosam quaerat similique vitae provident delectus fuga vel quia vel est aut cupiditate vitae sequi eaque deserunt voluptatibus vitae et aut quia repellat esse eveniet beatae amet porro quo nostrum eos vitae voluptatem aut et asperiores occaecati quidem nihil ab iste autem voluptas iusto sequi et molestiae nostrum a ad et maiores iste asperiores veritatis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-14', '2017-05-14 04:17:25', '2017-05-14 04:17:25');
INSERT INTO `lesson` VALUES ('463', '4', 'Voluptatem odit exercitationem magnam voluptas perspiciatis non vel voluptate.', 'Dolore accusamus ad omnis dolorum veniam laboriosam voluptatem et facere provident doloremque aut consequatur doloremque illo quia assumenda eaque minima voluptates et placeat voluptatem aliquam sit dolores enim impedit voluptatem rerum cum sit eos non et qui consequatur magnam ut sed expedita et veniam qui modi quos voluptatem ut odio architecto molestias quo saepe quidem dolorum sint velit quis natus eaque ut est nostrum minus natus quisquam omnis asperiores suscipit ullam rerum doloribus ut qui est non minima et doloribus qui ex voluptatum iusto corporis possimus quis molestiae placeat vitae dolorum eligendi nostrum corporis corrupti rerum tenetur tenetur quibusdam sunt repudiandae aliquid illo dolor et ea voluptas quia molestiae nihil reprehenderit deserunt ad nesciunt ratione quia quasi et sit voluptas consectetur delectus neque impedit ex dolores id voluptate error qui ex quo et a quia maxime pariatur ab nam nemo.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-16', '2017-05-14 04:17:25', '2017-05-14 04:17:25');
INSERT INTO `lesson` VALUES ('464', '26', 'Ut voluptas aut consequuntur repellat perspiciatis aliquid et aut eum quos.', 'Sint quo error quasi eveniet aut ipsam eligendi animi nisi a tempore quod reprehenderit esse alias ipsa asperiores repudiandae vero sed quos molestiae minima facere aspernatur labore est rerum repudiandae cupiditate porro laborum architecto non sapiente inventore quia ea deserunt veniam aut ex repellat sunt dolores et tenetur illo aut quia cum quasi in quae corrupti voluptas enim nihil distinctio at ut veniam autem quia enim eligendi cumque eos impedit iusto ut ipsa ex aut quo est ex id deserunt ut et nulla enim porro veniam itaque in incidunt totam facilis cumque deserunt delectus quibusdam possimus consequatur quisquam voluptas non rem harum voluptatem qui quidem nam qui libero quia soluta ea voluptas voluptatum sapiente doloremque sint ab sed officiis sed iure voluptate nihil aspernatur sed ut est.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '23', null, '0', '1', '2017-05-14', '2017-05-14 04:17:25', '2017-05-14 04:17:25');
INSERT INTO `lesson` VALUES ('465', '7', 'Voluptatem amet fugit consequatur praesentium.', 'Dolores non et nam nostrum impedit maiores ducimus ut non explicabo at sint ut dolor rerum aliquid ut veritatis accusantium est sed voluptatum dolor sed expedita animi atque voluptatem dolorem porro eaque sequi neque ut impedit saepe sint exercitationem corporis autem error beatae suscipit eveniet rerum labore perferendis quia exercitationem et beatae voluptatem facilis consectetur et vel enim aspernatur voluptatibus est praesentium esse nihil ea nihil numquam voluptatibus saepe in architecto tempora impedit natus officiis tempora quod.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-19', '2017-05-14 04:17:25', '2017-05-14 04:17:25');
INSERT INTO `lesson` VALUES ('466', '28', 'Neque id quo qui beatae esse unde dolore voluptatem.', 'Porro velit quae ipsum similique eveniet fuga corrupti consequatur quas facere earum excepturi non quidem voluptatibus accusamus facere voluptatem corporis fuga quod dolorem consequatur possimus unde corporis velit quos quam magnam voluptatum quia impedit velit sunt sit est quasi et placeat quia alias quae ad itaque eum et aperiam perspiciatis nesciunt alias quia ipsam et architecto voluptas totam possimus molestiae qui perferendis fugit provident quod ut hic et voluptas at voluptas dolore nihil rerum qui perspiciatis autem quisquam reiciendis non aut sunt ea qui eveniet mollitia porro distinctio molestiae quam pariatur dolorum eveniet dolore sed assumenda autem nulla saepe autem qui vero corrupti aperiam consequatur est.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '31', null, '0', '1', '2017-05-15', '2017-05-14 04:17:25', '2017-05-14 04:17:25');
INSERT INTO `lesson` VALUES ('467', '17', 'Culpa aut quis tempore quo vero dicta rerum commodi ipsam.', 'Asperiores porro iure doloremque voluptatem nihil aut libero dolore sed impedit ut aliquid dolorum et et id ab mollitia similique labore accusantium nihil architecto ut enim excepturi ab voluptas occaecati ut repellendus qui sint et eligendi eveniet est cum quia soluta aut atque aut impedit id veritatis consectetur sequi quia neque et sed ipsa et tempore architecto consequatur libero aliquid accusamus odio delectus omnis debitis dolores rerum sed veritatis hic exercitationem expedita aliquam enim qui nihil dolores qui facilis maxime dolor sed ut dolores eum neque eius quo quaerat dolores quod aperiam et sunt in doloribus blanditiis ea fugit molestiae molestiae at voluptatibus sunt repellat et ad quasi mollitia nihil rem nihil amet distinctio qui voluptas est recusandae modi quia ut repellendus veniam rerum minima quos nemo eum quod.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '22', null, '0', '1', '2017-05-14', '2017-05-14 04:17:25', '2017-05-14 04:17:25');
INSERT INTO `lesson` VALUES ('468', '13', 'Reiciendis eveniet nulla iusto et dolor eum saepe sit optio omnis.', 'Exercitationem nihil occaecati molestiae magni molestiae sunt id minus dolore pariatur ab non sunt reprehenderit rerum qui eius sed ipsa odit aliquid enim deleniti omnis qui et quia culpa qui nam quis autem excepturi amet est quasi deserunt sint accusamus eligendi et quis qui quae quibusdam deserunt velit fugit minima sit molestiae possimus quia voluptas voluptas qui dolores natus accusamus voluptatem voluptatem pariatur consequuntur ea nobis sequi ea consequatur animi quam voluptatem voluptatem eum ut repudiandae qui beatae voluptatem suscipit eveniet accusamus cupiditate repudiandae non odio architecto et dolorum ratione sed minima odit cum est voluptate est.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-15', '2017-05-14 04:17:25', '2017-05-14 04:17:25');
INSERT INTO `lesson` VALUES ('469', '3', 'Neque ab non exercitationem aperiam ut.', 'Nam vel omnis odit voluptatem possimus quas veniam beatae aliquid dolorem laboriosam illum repellat ut rerum nisi quam autem fugit quo omnis nihil voluptas omnis et molestiae et at qui et delectus et sed laborum tempora et velit incidunt omnis est iusto voluptatem nemo est fugiat excepturi et qui exercitationem ea aut et accusamus numquam dicta laborum similique at enim corporis reiciendis unde repellendus voluptatem praesentium officia quas qui est recusandae aliquam quam dignissimos aut cum laborum facere est similique rerum dolor suscipit et sunt mollitia aut quae non sit omnis quibusdam quia error quaerat omnis sit iusto in blanditiis omnis et voluptas tempora voluptatem laudantium ex magnam cupiditate enim quis qui eaque sed illum et fuga sequi voluptas aut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-19', '2017-05-14 04:17:25', '2017-05-14 04:17:25');
INSERT INTO `lesson` VALUES ('470', '20', 'Repudiandae doloremque qui hic error qui ea accusantium.', 'Nostrum rerum rerum et fuga eius occaecati totam non voluptatum voluptate error ratione minus impedit corporis nesciunt rerum quibusdam et et totam inventore doloribus enim quo velit sunt ut sit ipsum corrupti est dolorem ullam totam sint id aliquam facilis tempora eligendi ut rerum tempora impedit provident ut saepe molestiae consectetur quis suscipit aut voluptatem tenetur suscipit nihil qui sunt nam a eum voluptates nulla voluptatibus cupiditate et aut sit dolor est numquam officiis quia asperiores architecto et cupiditate qui omnis qui veniam quis quia accusamus neque commodi beatae quis ut qui inventore voluptas suscipit magnam nam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-15', '2017-05-14 04:17:25', '2017-05-14 04:17:25');
INSERT INTO `lesson` VALUES ('471', '1', 'Eum rerum voluptatibus et aut.', 'Eius omnis enim aut quo nulla et rerum dolores nam non vitae praesentium provident ullam ex ut possimus quas aut ut aut inventore iusto distinctio quia minus nihil voluptatem omnis blanditiis quo illo sit tenetur qui harum at minus labore sint recusandae aut eos et dignissimos sit nesciunt quam qui enim voluptas et ratione maxime ullam pariatur quis incidunt est perferendis quia magnam et id saepe labore unde accusantium sed et commodi sed et ut sed quod maxime perspiciatis sequi saepe non et velit dolore necessitatibus deserunt aliquid error eveniet est qui repellat quo in facilis eum quos sunt quia ex sunt eius voluptatem harum aliquam doloribus nisi dolorum amet quis nostrum dolores dolorem cupiditate rerum aliquam recusandae provident et ducimus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-17', '2017-05-14 04:17:25', '2017-05-14 04:17:25');
INSERT INTO `lesson` VALUES ('472', '25', 'Cupiditate voluptates pariatur dolorum id impedit enim consectetur accusamus ex.', 'Accusamus quae molestiae quasi voluptates nisi reprehenderit error sint dolore distinctio sed ipsum illum fugit aliquid dolor et saepe voluptas sunt et exercitationem quibusdam ut eos explicabo quae exercitationem sit enim cumque repellat assumenda odio quidem animi nemo harum quis explicabo aut quae a qui delectus doloribus placeat ad et voluptas ea est aut debitis odit ut ut accusamus totam odit dolor vel incidunt et possimus ullam et corrupti itaque voluptas nemo voluptate error qui sint quod quo delectus aut quas cum libero voluptatem odit nihil modi voluptas quas aut facilis sunt et similique impedit quia alias ratione quas ducimus illo nostrum molestias distinctio vel porro nesciunt qui consequatur quis ex dolor perspiciatis neque saepe ut aliquid est labore sed id.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-16', '2017-05-14 04:17:26', '2017-05-14 04:17:26');
INSERT INTO `lesson` VALUES ('473', '29', 'Asperiores minus iure ut nihil similique at.', 'Ipsum culpa tempore hic perferendis ea ullam rerum doloribus officia provident minus ut cupiditate soluta ea et tempore ipsam similique eligendi numquam voluptatem aut ratione laborum eius facere quas ab unde ut delectus labore sunt ut repudiandae quibusdam et quidem ea asperiores dolore ut quia error vel debitis expedita hic velit ipsa neque laudantium deserunt et suscipit impedit facilis consequatur et voluptatibus iste qui recusandae est praesentium numquam dolor unde ut voluptatem dolor et et tempora voluptatem qui iste voluptatum voluptatem qui aut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-18', '2017-05-14 04:17:26', '2017-05-14 04:17:26');
INSERT INTO `lesson` VALUES ('474', '24', 'Numquam perferendis impedit tempora quo minima rerum ipsam et quisquam.', 'Et cupiditate officia deserunt unde sit eveniet vel consequatur consequuntur dicta temporibus minus consectetur deserunt deleniti maiores voluptates sed voluptatem minima reiciendis maiores iure sequi numquam nesciunt quia eos voluptas molestiae illo et nobis saepe delectus consequatur dolor libero officia unde et accusantium quibusdam quia voluptatem itaque voluptate sint recusandae numquam voluptates ea placeat sint non earum natus sequi ut mollitia exercitationem facilis voluptatibus odit ratione quia labore soluta in iure ullam delectus et unde et est voluptatem et quo dolores id excepturi id numquam voluptatem id hic dicta dolorum eos cumque dignissimos enim aut accusamus minus facilis ipsam sint officiis est non et commodi totam ut ea dolores dolores debitis deleniti sint quas at quisquam occaecati provident praesentium error neque omnis doloribus voluptatem sed sint molestiae harum similique commodi maiores officiis enim.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-19', '2017-05-14 04:17:26', '2017-05-14 04:17:26');
INSERT INTO `lesson` VALUES ('475', '29', 'Ratione quasi sint dolor vel vel praesentium modi aliquid.', 'Officia illo aut temporibus ut ea porro laudantium voluptas dolores qui nobis perferendis culpa soluta laboriosam quis quis tempore ipsam qui inventore ut vel molestiae ut commodi architecto quibusdam amet sapiente maxime facilis ad aut eaque amet modi odio velit doloribus dicta illum ullam quo quos amet sed veritatis ducimus et amet suscipit illum dolorum ea neque et perferendis ut eum iure et omnis rem in rerum maxime sed id delectus sit modi sapiente aliquid rerum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '42', null, '0', '1', '2017-05-16', '2017-05-14 04:17:26', '2017-05-14 04:17:26');
INSERT INTO `lesson` VALUES ('476', '13', 'Fugiat totam nihil optio non quibusdam doloremque recusandae rerum non.', 'Nemo harum debitis veritatis sed ut dolorem expedita omnis nihil est qui nulla culpa quis consequatur delectus hic asperiores quibusdam consequatur magni at in debitis molestiae ut occaecati qui et qui culpa quasi deleniti molestias quae dolores animi eos reiciendis sapiente quo alias aut consequuntur velit nulla ea est ut dolorum occaecati quo qui qui est est esse molestiae temporibus dicta expedita vel ut iusto est necessitatibus rerum eveniet repellat voluptas porro qui ipsam voluptatibus beatae voluptatum blanditiis qui necessitatibus illum laboriosam neque natus ea modi accusamus eius alias earum placeat ducimus soluta.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-18', '2017-05-14 04:17:26', '2017-05-14 04:17:26');
INSERT INTO `lesson` VALUES ('477', '1', 'Aut quo quo sit itaque corrupti qui a dolorem et.', 'Non quidem possimus laboriosam quos rerum blanditiis et harum tempora impedit ea tempore ad aperiam perferendis ut ea itaque culpa aut temporibus magni aut quidem quam et consectetur corrupti recusandae omnis veritatis non deserunt fugit explicabo iste nemo amet repellat libero expedita voluptatibus necessitatibus nam est aut expedita saepe dolor nobis similique qui et sit aut commodi nobis ratione sint iusto est tempore quo voluptatem voluptas suscipit delectus et culpa aut sit repudiandae quia aut totam laudantium consequatur saepe magnam sed voluptatem quis et cupiditate cupiditate odit tempora sint nihil itaque incidunt.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-16', '2017-05-14 04:17:26', '2017-05-14 04:17:26');
INSERT INTO `lesson` VALUES ('478', '18', 'Deleniti quod distinctio earum et sit.', 'Sint illo voluptatum voluptatum expedita iusto voluptatem velit minus qui velit omnis accusamus sit est quidem sed eligendi debitis hic labore rem minus ex repellat dolor eos ipsa nostrum debitis dignissimos ad rerum et ut omnis excepturi numquam quo molestiae pariatur molestiae labore repellendus aut sed id voluptas amet amet aut sint saepe sit quae itaque ratione ea hic odit commodi et accusantium dignissimos vitae facere dolor est possimus quis odio magni cupiditate quos quo nihil aperiam voluptatibus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '23', null, '0', '1', '2017-05-18', '2017-05-14 04:17:26', '2017-05-14 04:17:26');
INSERT INTO `lesson` VALUES ('479', '21', 'Praesentium possimus et esse iste ducimus minus quia ratione dolorem.', 'Illum qui numquam iusto eveniet reiciendis et dolores saepe qui quisquam minus at nobis eius rerum vero pariatur iste vel enim quidem debitis itaque ipsam vero perspiciatis ex rerum similique et est et et molestias nesciunt eveniet porro perspiciatis architecto fugiat beatae enim cumque impedit numquam laudantium amet sit et cupiditate repellat reiciendis asperiores eveniet ea voluptatum aperiam illo qui incidunt sed saepe voluptas et magnam ipsam tenetur adipisci ea nihil sit nulla ut voluptas saepe sunt commodi sunt.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-15', '2017-05-14 04:17:26', '2017-05-14 04:17:26');
INSERT INTO `lesson` VALUES ('480', '23', 'Sed officiis est tenetur non aut ipsa impedit necessitatibus.', 'Et eum eos sequi deserunt maxime et aut nihil aspernatur cumque non debitis sit et rerum voluptates explicabo autem assumenda quibusdam asperiores sunt soluta similique doloremque error eum explicabo asperiores et voluptas voluptate dolorem alias aliquam qui delectus et esse officiis veniam nihil debitis suscipit sint voluptatem ad eligendi veniam doloremque id voluptatem quam commodi ea voluptatem magnam est dolores corporis optio eligendi neque illum veniam est voluptatibus sint et aut maiores.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-14', '2017-05-14 04:17:26', '2017-05-14 04:17:26');
INSERT INTO `lesson` VALUES ('481', '21', 'Dolorem architecto ut ut sit voluptatem tenetur recusandae delectus eveniet quisquam.', 'Vero fuga nam odit voluptas unde enim et distinctio placeat ut assumenda possimus sequi voluptatibus ullam odit itaque et possimus ut nobis qui quis consequatur eum dolorum aut laudantium maxime enim quae aliquid repellat mollitia repellendus sunt rerum qui illo soluta qui nostrum possimus rem et pariatur qui excepturi totam quo unde est enim minus non voluptatibus omnis et quae dolorem aut maxime culpa nisi ut fugiat dolores vel sed iure.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '28', null, '0', '1', '2017-05-19', '2017-05-14 04:17:26', '2017-05-14 04:17:26');
INSERT INTO `lesson` VALUES ('482', '19', 'Magnam placeat aliquam ad soluta alias commodi officia rerum exercitationem.', 'Illum animi animi dolorem ratione eligendi qui doloremque voluptatem ut perferendis maiores ad voluptatum ex harum dicta est voluptates at fugiat et provident eveniet et occaecati corporis vero reiciendis voluptas labore omnis doloremque est praesentium ut ea illum voluptas quas assumenda voluptate qui quia aut placeat recusandae ipsum ab est accusantium placeat pariatur pariatur sit odio sint earum minus rerum doloremque corporis quia numquam vel ut quia quos qui nihil repudiandae beatae corrupti fuga inventore cum ipsa laborum impedit debitis nulla impedit ut repellendus et quos consequatur sed amet neque natus quia nisi ipsum sed vero velit voluptatibus sed pariatur fugit qui velit accusamus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-18', '2017-05-14 04:17:26', '2017-05-14 04:17:26');
INSERT INTO `lesson` VALUES ('483', '24', 'Ea est et repudiandae ea eum vero voluptates ullam qui laborum.', 'Ipsa ea eius nihil est ad omnis non deleniti repudiandae eum animi laudantium esse reprehenderit aspernatur qui deleniti in delectus eum omnis ratione exercitationem unde neque quia provident id incidunt vel non repellat incidunt saepe voluptatibus culpa ex qui reprehenderit vitae cumque explicabo dolor nostrum consectetur quo temporibus laborum dolore et voluptas debitis ut alias fugiat atque ut culpa nisi error nihil id debitis ut eaque quo aut reprehenderit facere voluptatem omnis molestiae perferendis exercitationem voluptate et quia error esse quaerat quia facere voluptatem omnis debitis vel non minus fuga pariatur excepturi eum accusamus nesciunt inventore consectetur placeat autem quis repellat sequi aliquid quia accusamus consequatur quia magni impedit reiciendis ut in deleniti ut cupiditate et temporibus consequatur quisquam est quas in nostrum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-18', '2017-05-14 04:17:26', '2017-05-14 04:17:26');
INSERT INTO `lesson` VALUES ('484', '22', 'Veritatis fugiat voluptas illum quia minima iste cum sit sunt.', 'Necessitatibus eos beatae aut voluptatem cupiditate beatae ea sint ut voluptates et voluptates non natus odio aut eos totam recusandae impedit facere dicta a dolore molestiae distinctio sit nobis et id autem recusandae dolore id fuga illo ratione consequuntur possimus harum est at voluptas voluptas laudantium facilis ipsa et vel totam ad sunt eius labore voluptas mollitia doloremque molestiae qui quos id harum expedita nihil consectetur aut enim eius necessitatibus nesciunt id optio repellat perferendis nemo sequi quia non itaque cumque et et fuga voluptas sequi nihil rerum qui sunt illum placeat laudantium sapiente et doloribus dolorem alias repellat est aut quia aliquid repudiandae ut et asperiores eveniet eius aliquam deleniti repudiandae delectus dolorem vel aut quia alias veniam molestias ullam ut dolorum dolorem molestias.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-17', '2017-05-14 04:17:26', '2017-05-14 04:17:26');
INSERT INTO `lesson` VALUES ('485', '21', 'Et magnam incidunt tempora et exercitationem at ut magni.', 'Non rem nisi veniam sapiente voluptatibus dolorum numquam dolor est ex non et necessitatibus quibusdam laboriosam quasi voluptas ipsa voluptas animi dolorum molestiae quia architecto eos repellendus quas est ipsum omnis et dolor voluptatem necessitatibus omnis praesentium fuga sit illo voluptatem et eligendi ut dolor autem eveniet non ratione aliquam labore hic ipsam quis laudantium dicta eveniet odit reiciendis porro porro omnis at nam molestiae aut dolorem dolores ratione sapiente.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '23', null, '0', '1', '2017-05-16', '2017-05-14 04:17:26', '2017-05-14 04:17:26');
INSERT INTO `lesson` VALUES ('486', '29', 'Impedit repudiandae sed cumque magni voluptatem aspernatur beatae dignissimos.', 'Eligendi nostrum autem tenetur repellat porro consequatur sed eos et rem in id voluptas quis facere soluta molestias rerum nobis consequatur repudiandae et quia ipsum distinctio possimus sit omnis sit et voluptatum laudantium consequatur saepe impedit repellat excepturi exercitationem ducimus doloremque fugit provident sunt optio recusandae in numquam eaque eos debitis necessitatibus porro possimus quibusdam voluptates modi qui autem corporis ratione rerum aut ut laboriosam quia ex et quasi in autem inventore a voluptas rerum id quo eos qui laudantium necessitatibus aliquid eius consectetur necessitatibus est autem tempora cupiditate natus provident sint eaque id accusamus molestias vitae aut quis veniam autem et maiores incidunt ea laborum beatae placeat porro deleniti labore facilis mollitia sequi nesciunt officia voluptatem provident mollitia optio aspernatur laboriosam et quam possimus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-16', '2017-05-14 04:17:26', '2017-05-14 04:17:26');
INSERT INTO `lesson` VALUES ('487', '9', 'Quo consequatur aut eveniet fuga nostrum nulla.', 'Voluptatem sit recusandae rem perspiciatis mollitia inventore est labore incidunt ipsam qui sit vero tenetur maiores quaerat ut totam officiis sit sequi architecto nulla aut qui asperiores fugit fugit qui laudantium veniam et accusamus assumenda possimus odio aliquam accusantium ut omnis ut provident eos corrupti consequuntur praesentium mollitia explicabo nostrum non laudantium voluptate et eum voluptates harum ratione dolores aut voluptatum quia nihil asperiores autem magnam placeat sed delectus voluptas omnis repellat doloribus est et sequi quod sunt illum eum et corrupti natus id culpa sapiente explicabo.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-14', '2017-05-14 04:17:26', '2017-05-14 04:17:26');
INSERT INTO `lesson` VALUES ('488', '29', 'Quia fuga aliquid aut nulla optio.', 'Et asperiores suscipit quas deleniti unde a nisi minima quidem recusandae qui vero aut id reiciendis consequuntur et hic in incidunt error voluptatem consequatur veniam minus veritatis atque aut dicta ut exercitationem laudantium repudiandae consequuntur et eum ut ratione quae perspiciatis provident sint aut repellat quidem ea quam sint omnis nulla saepe vero quisquam occaecati ab magni voluptatibus repudiandae id tenetur et numquam tempora sunt ducimus eum aut eius dolorem fugiat delectus facere excepturi architecto repellat et sunt aut iusto quos quis repudiandae.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '36', null, '0', '1', '2017-05-14', '2017-05-14 04:17:26', '2017-05-14 04:17:26');
INSERT INTO `lesson` VALUES ('489', '3', 'Sunt enim sapiente placeat omnis esse.', 'Tempore quae nihil itaque nisi porro et ut et quaerat nemo et et repellat quas illum amet distinctio est ipsa omnis enim est ipsa dolorem repudiandae eveniet adipisci debitis odio tempore id enim ut ut perferendis omnis cumque odit voluptatem enim dolores quaerat eos sit debitis fugiat quas ut et vel aliquid ipsa sunt nulla eum vel quia est doloribus magnam quasi et odit deserunt voluptate reiciendis accusantium aliquid non magni necessitatibus atque ut vitae laudantium ab consequatur tenetur perspiciatis et aut incidunt voluptas ipsum ipsa maxime.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-19', '2017-05-14 04:17:27', '2017-05-14 04:17:27');
INSERT INTO `lesson` VALUES ('490', '4', 'Voluptas sequi voluptatum culpa minus harum.', 'Illum quidem ab dolor odio eius labore dicta ut asperiores iure ipsam vel accusamus non nobis vel aut et dolorum autem qui eius id est maiores autem et quaerat consequatur qui iusto odit assumenda dolorum aperiam ea atque aperiam error placeat ut amet quae autem fugit omnis et molestiae vel pariatur ut atque maiores nisi rerum ut voluptates sequi iure ut eaque sit dolorum similique dolorum eius amet tempora impedit et voluptas.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-19', '2017-05-14 04:17:27', '2017-05-14 04:17:27');
INSERT INTO `lesson` VALUES ('491', '30', 'Quibusdam et exercitationem id consequatur quam.', 'Soluta consequatur qui est distinctio eius laboriosam vel ut cumque nihil voluptates ipsa tenetur dolorum recusandae veritatis ipsam dolorem eos quis expedita alias animi consequuntur dignissimos temporibus corporis nam sed iste error aut et praesentium vero atque odio amet tempore accusamus voluptas et perspiciatis saepe eum distinctio iusto quasi aut illo possimus excepturi eaque eos ut et voluptas esse officiis quia rerum natus inventore sit doloremque sunt earum perspiciatis aliquam qui quia beatae nobis sunt distinctio deleniti vel eos id aspernatur dolore impedit est.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-15', '2017-05-14 04:17:27', '2017-05-14 04:17:27');
INSERT INTO `lesson` VALUES ('492', '9', 'Qui vel voluptatum sit rem officia ad ullam corrupti.', 'Quibusdam et magnam quis et corrupti sit esse earum temporibus illo est et molestiae quia numquam optio voluptatem repudiandae ipsum totam alias molestiae ut atque facilis molestiae architecto nulla pariatur officia saepe non culpa voluptas odit animi exercitationem earum dignissimos cumque quis tempora ea ipsum nam sunt quaerat necessitatibus fugit aut quaerat quia ullam omnis quae impedit vel qui atque delectus occaecati eveniet cum consectetur velit voluptates quibusdam deserunt dignissimos blanditiis odit ipsam deserunt perferendis illum est eum ipsa itaque modi.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '28', null, '0', '1', '2017-05-15', '2017-05-14 04:17:27', '2017-05-14 04:17:27');
INSERT INTO `lesson` VALUES ('493', '3', 'Laboriosam dolore provident aliquid maiores numquam.', 'Tempora occaecati quasi alias et est similique aliquam vitae consequatur quod quas culpa accusamus ut error sed et possimus quis earum voluptas aut et voluptatem enim qui numquam molestiae magnam doloribus eos ullam provident reiciendis illum eos eum ipsa qui ut tempore voluptatem et nihil ut odit quia autem aut consectetur laborum illum cum veniam aspernatur nostrum doloremque quisquam et repudiandae sed corrupti harum provident odit excepturi error itaque autem tempora sit id sint voluptatem sit numquam mollitia assumenda consequuntur ipsum beatae tempore alias consequatur voluptate dolore libero amet tenetur amet sit laborum corporis eligendi quidem nesciunt unde enim omnis nemo vero ipsa rerum et incidunt sunt ipsa iusto amet qui inventore qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-16', '2017-05-14 04:17:27', '2017-05-14 04:17:27');
INSERT INTO `lesson` VALUES ('494', '11', 'Architecto tempore consequatur aspernatur autem corrupti culpa omnis debitis cum.', 'Labore et et quibusdam et debitis ducimus necessitatibus voluptates reprehenderit odit dolorem neque ea molestiae pariatur ea et ex odio soluta aspernatur fugit molestias officia officia voluptatem reiciendis aut maiores iusto officia et consectetur aperiam illo velit similique debitis molestiae porro et architecto totam quis sunt accusantium quae reiciendis aperiam vel possimus provident maxime assumenda at corrupti aut aut nulla neque quo architecto est aut quae voluptatum autem eos praesentium perferendis labore omnis quasi ea et adipisci possimus qui ut distinctio eveniet nobis magni alias sit explicabo quia aut optio laboriosam cum quos ea provident ex debitis animi autem voluptatem nisi impedit a temporibus porro mollitia quo omnis praesentium modi minima vel.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-15', '2017-05-14 04:17:27', '2017-05-14 04:17:27');
INSERT INTO `lesson` VALUES ('495', '16', 'Iusto id ratione nostrum in molestiae aperiam perspiciatis in.', 'Provident explicabo impedit voluptas quia laudantium sed iusto non aut molestias doloremque illo ducimus odit eos reiciendis modi ut id nam iusto dolor architecto necessitatibus et doloremque sint ab exercitationem omnis aspernatur voluptas voluptas qui debitis praesentium et ut vel illum minima voluptas voluptatem quam numquam mollitia tenetur sit rerum doloribus dolorum consectetur et vel autem animi in rerum deleniti perferendis temporibus quaerat explicabo et voluptatem distinctio veritatis rerum aliquid expedita aut mollitia et maiores id totam eos explicabo quia iure ullam voluptatibus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-15', '2017-05-14 04:17:27', '2017-05-14 04:17:27');
INSERT INTO `lesson` VALUES ('496', '17', 'Inventore dolorum omnis expedita velit voluptate eligendi laudantium illo dicta.', 'Maiores rerum voluptas repudiandae earum non sint repellendus impedit similique itaque quaerat vero eum quia itaque assumenda aut qui praesentium non sit aperiam nostrum soluta minima quia aut autem cupiditate nisi porro eos sit delectus recusandae placeat repellendus vel voluptatibus omnis fugiat facilis porro et ut aliquam expedita voluptatum ut necessitatibus placeat omnis commodi quisquam consequatur aperiam enim ab aut amet laudantium non ipsam doloribus commodi ab cumque ipsa corrupti iusto autem aut eum id repellat ullam tempore maiores dolores quia.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-15', '2017-05-14 04:17:27', '2017-05-14 04:17:27');
INSERT INTO `lesson` VALUES ('497', '22', 'Ipsam quisquam beatae ab incidunt in iusto.', 'Alias et optio corrupti aspernatur quia culpa ut tempora nihil itaque vel voluptates reprehenderit aut fugiat aspernatur praesentium accusamus quia repellendus dolores dolorem voluptatem est et quis possimus eum voluptas voluptatibus dolorem sint et aspernatur est error mollitia possimus eaque modi recusandae dolorum beatae in ut est culpa occaecati accusantium consectetur ullam officia laborum nihil reprehenderit distinctio corporis vel eos et quis dolor et quo dolor officiis voluptas labore ullam et laborum enim aperiam voluptatibus quidem ipsam ab dolorem ab ut repellendus debitis impedit inventore in omnis quod minus quibusdam fuga eligendi nobis atque.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '39', null, '0', '1', '2017-05-15', '2017-05-14 04:17:27', '2017-05-14 04:17:27');
INSERT INTO `lesson` VALUES ('498', '10', 'Et quod culpa qui minus odit velit commodi.', 'Reprehenderit quis deleniti quam ea ut optio reprehenderit sequi perspiciatis ut nisi sint quas quae aut distinctio laudantium voluptates in placeat voluptatibus velit qui error consequatur rerum quo autem in tempora sapiente ratione tenetur veritatis ab iusto quo sint enim quis adipisci praesentium eveniet consequatur qui consequatur cum voluptas quis ea fuga provident repellendus labore voluptatem eos nihil voluptates quod a omnis tempora aut natus qui dolore voluptatem architecto animi laborum enim voluptas dolor sed dolor voluptas officia ab saepe neque rerum culpa ducimus consequuntur suscipit iure saepe reiciendis sed cumque vel sit unde dolores inventore qui quis et aliquam neque ut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-16', '2017-05-14 04:17:27', '2017-05-14 04:17:27');
INSERT INTO `lesson` VALUES ('499', '22', 'Illum non error pariatur ipsa.', 'Neque qui aut ut ab eligendi quia cumque itaque numquam consequatur dolore doloribus nisi adipisci qui eum similique totam dignissimos dolore consequatur et consectetur aliquam voluptatem rerum suscipit ducimus omnis sit incidunt vero optio error omnis qui quod dolorem placeat sunt laboriosam enim voluptas ad rem omnis et rerum aut vel impedit vel labore suscipit aut vero quidem hic iure perferendis ea nulla quia et est totam molestiae sed in occaecati a sint provident est eos quia atque ea repudiandae aut quibusdam ut tempore suscipit nobis voluptatum non quasi veniam aspernatur recusandae est ad minus in numquam repellendus et aut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-19', '2017-05-14 04:17:27', '2017-05-14 04:17:27');
INSERT INTO `lesson` VALUES ('500', '21', 'Asperiores in quo est est dicta ex.', 'Omnis voluptatem reiciendis cupiditate fugit qui dolorem ut et cumque error non est quo ea porro nihil quod quidem sed harum assumenda odit cum illum voluptatum similique dolorem vitae nulla expedita omnis id est praesentium quisquam occaecati eveniet possimus odit natus corporis voluptatem voluptatem voluptate perspiciatis quis consectetur perferendis facere voluptates cupiditate tenetur sed odio nostrum rerum ut rerum in nostrum quam similique nemo qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '36', null, '0', '1', '2017-05-19', '2017-05-14 04:17:27', '2017-05-14 04:17:27');
INSERT INTO `lesson` VALUES ('501', '5', 'Et exercitationem nostrum accusamus sed.', 'Et ducimus pariatur quos vel repudiandae dolorem magni quaerat tempora numquam non voluptas consequatur voluptates facere doloremque atque magnam temporibus tenetur ut et quis et numquam est quia non ut quae cum provident optio dolorum voluptatem quasi reprehenderit magnam error voluptatem eaque provident rem ullam soluta tenetur qui temporibus veritatis voluptatem ducimus optio qui labore amet est et et quidem adipisci aut consequuntur et in quo maxime repellat eos sit provident qui laborum illo pariatur ullam odio neque aut est non esse non molestias qui neque fuga officia nulla qui molestiae dignissimos ut eum ipsa voluptatem repellendus illo est voluptatem et aut ipsa aspernatur qui vero pariatur distinctio dolorem sit magnam id.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-19', '2017-05-14 04:17:27', '2017-05-14 04:17:27');
INSERT INTO `lesson` VALUES ('502', '23', 'Qui amet dolore sed qui eius minus possimus nemo consectetur.', 'Quia mollitia sed cupiditate magni reiciendis eaque consequuntur nemo ducimus sequi sint magnam nihil optio nihil quo quaerat a impedit commodi et adipisci rem sed doloremque consectetur ea maxime quia et quo dolorum temporibus ipsum et et officiis voluptate fugiat laborum sunt expedita accusamus totam labore voluptatem voluptatem aut eum velit exercitationem aperiam consectetur dolorem minus mollitia molestias in voluptatem temporibus asperiores et et sed ut quia voluptates eaque et consequatur qui veritatis eum vero non amet quisquam perferendis aut hic suscipit dolorem odit et mollitia quam in facilis minus dolorem excepturi non dicta facilis libero quos placeat reiciendis quis quasi harum possimus quidem ea aut cum molestiae eligendi odit vel ipsam ut est voluptas sunt sit explicabo officia sed aliquam earum esse consequatur perferendis similique exercitationem dolor velit dolorem voluptatem quo vel rerum atque quia sunt id excepturi aliquam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '30', null, '0', '1', '2017-05-19', '2017-05-14 04:17:27', '2017-05-14 04:17:27');
INSERT INTO `lesson` VALUES ('503', '22', 'Ea cumque ut ratione quae fugiat consequatur dolores aperiam ad esse.', 'Saepe aut ut beatae et dolor sunt rerum voluptas neque officia ea doloribus natus ex deleniti fuga incidunt facere fuga delectus atque ab aliquam ut dicta unde perspiciatis natus mollitia ab deserunt architecto nihil iste enim iste est eos quis qui ut numquam ab temporibus praesentium quae est incidunt quia nobis est est earum nihil vel magni voluptas at distinctio vero dolore consequatur voluptatem itaque aut perferendis qui id blanditiis a sequi autem deserunt est.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-15', '2017-05-14 04:17:27', '2017-05-14 04:17:27');
INSERT INTO `lesson` VALUES ('504', '11', 'Odio nostrum ea aut quis.', 'Corporis consectetur rerum voluptatibus quia nihil sed incidunt sint dolor repellendus provident tempora quibusdam non mollitia cumque at dicta quia vitae qui aut eaque vitae accusamus alias assumenda minima a enim aut ratione autem blanditiis est suscipit laborum velit officia quasi eligendi quidem placeat porro molestiae voluptatum aut vero aut id optio necessitatibus voluptas cum error et aut consequatur laboriosam ut qui blanditiis distinctio magnam aliquam ducimus nesciunt dolorem qui ea est provident et non earum quasi vel explicabo non minima aut dolores magnam voluptas recusandae facere maxime maxime ratione est fuga doloremque.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-18', '2017-05-14 04:17:27', '2017-05-14 04:17:27');
INSERT INTO `lesson` VALUES ('505', '8', 'Eligendi fugiat voluptatem fugiat quibusdam aut.', 'Repellat et rerum eum velit accusantium amet eaque qui recusandae voluptas distinctio error eos aut aut tenetur iste sint aliquid quasi voluptatem nesciunt sint occaecati ipsum fuga laudantium qui voluptatibus optio quo repudiandae deserunt tempora voluptatum non in occaecati neque perspiciatis porro veritatis dolore repellendus ducimus deleniti adipisci tempore culpa libero et quam architecto optio quia qui blanditiis ut sed quos dolorem consectetur illo non sit ipsa libero fugiat consequatur veniam aut laboriosam atque cum consequatur minima delectus eos harum doloribus tempora facere quisquam quo esse veritatis qui et voluptatem ratione quia quia earum asperiores sint rerum alias et incidunt officia atque provident ut quisquam ea error quia a incidunt nesciunt nemo earum voluptatibus eos neque et cum non.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-18', '2017-05-14 04:17:28', '2017-05-14 04:17:28');
INSERT INTO `lesson` VALUES ('506', '9', 'Laboriosam veniam est ratione vitae deserunt quis doloremque eligendi praesentium omnis.', 'Delectus vel recusandae fugiat sed rem vitae dolores consequatur ut perferendis voluptatem atque aut culpa sequi quam qui ut facere veritatis id similique sapiente cumque voluptas suscipit commodi excepturi dolorem eveniet quod reiciendis et et quo ab dolores quis quaerat natus laboriosam placeat quasi sint nam omnis sint est amet neque tempora natus doloribus omnis debitis atque aut quia similique magnam voluptas rerum id et sunt sit ut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-14', '2017-05-14 04:17:28', '2017-05-14 04:17:28');
INSERT INTO `lesson` VALUES ('507', '10', 'Molestias reiciendis dolor architecto rerum eos suscipit iusto est voluptas aut eos.', 'Esse incidunt earum et quisquam vel porro fugit nesciunt recusandae quisquam laborum quis est quia nobis praesentium et veritatis officiis non dignissimos alias voluptas at perspiciatis commodi aut sit odio voluptates suscipit omnis neque excepturi ex est laudantium sunt dolorem aut cupiditate laborum reprehenderit id atque minima quos dolor veritatis sequi assumenda ratione tempora modi voluptatem praesentium qui optio modi qui ut rerum consequuntur facilis reiciendis occaecati illo vel atque adipisci dignissimos vel earum dolore sit quod rerum omnis quidem sint nobis veritatis ut iste aspernatur dolor tenetur ut consequatur aut cumque sed dolore qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-19', '2017-05-14 04:17:28', '2017-05-14 04:17:28');
INSERT INTO `lesson` VALUES ('508', '12', 'Inventore pariatur earum quod quia voluptatibus.', 'A non quia ab velit dolorum voluptatem voluptatibus fugiat enim quia hic illo eligendi nihil quia sed et repellendus ex qui voluptatem a aut aliquid beatae quisquam dolorem temporibus similique dicta quia cum maxime voluptatem ut dolores dicta itaque voluptatibus magni adipisci adipisci voluptatem sed dolor molestiae aut officia molestiae voluptate voluptatibus possimus libero similique et animi laboriosam officia vitae dignissimos et delectus voluptatum id ipsa ut quibusdam molestias qui enim consequatur reiciendis vel aut temporibus voluptates doloribus ut ut quisquam vel nulla reiciendis pariatur sequi est quia cupiditate occaecati aliquam omnis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '22', null, '0', '1', '2017-05-17', '2017-05-14 04:17:28', '2017-05-14 04:17:28');
INSERT INTO `lesson` VALUES ('509', '23', 'Atque aut pariatur dolor ut quia corporis.', 'Eveniet nostrum maxime illo a blanditiis veniam provident doloremque dolorem vero eos provident totam sint velit illum quia distinctio ipsam at id et voluptatem voluptatem voluptas non assumenda sunt ratione fugiat voluptas est quasi harum error illum aut natus quis dolores maiores numquam molestiae eum et sunt consequatur debitis nesciunt ut assumenda pariatur perferendis consequuntur odit at iste qui reprehenderit rem et aut dolor laborum velit eligendi earum consequatur commodi voluptatem ad deserunt aut qui earum iure temporibus at dolores mollitia quia impedit neque.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '22', null, '0', '1', '2017-05-16', '2017-05-14 04:17:28', '2017-05-14 04:17:28');
INSERT INTO `lesson` VALUES ('510', '10', 'Cumque officiis excepturi ex at quisquam.', 'A eos est sunt a quibusdam perspiciatis eum autem necessitatibus aut est accusamus dolores saepe in perferendis qui et expedita quasi nulla illo aperiam natus nam illum minus magnam tempora et et deserunt expedita libero assumenda ipsa non labore magnam praesentium eos dolor nisi quis minima et ea dignissimos expedita culpa ut in totam iure impedit earum pariatur ipsam nulla praesentium.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-14', '2017-05-14 04:17:28', '2017-05-14 04:17:28');
INSERT INTO `lesson` VALUES ('511', '21', 'Optio quo a sit consequuntur voluptatem ut.', 'Qui iste quia blanditiis reiciendis laborum nobis iure autem velit eos asperiores in sint omnis quo quisquam culpa deserunt repellendus facere aut reiciendis et illo expedita molestias minus ea quo et in occaecati et fugiat vitae non saepe veritatis cum id et dignissimos doloremque ipsum et qui dicta quis sed quia aut voluptas corrupti consequuntur vitae eius aut inventore sed voluptate possimus commodi nulla et consequatur illum sit consectetur iure aut voluptas enim iste dolore aut neque vero eligendi ea saepe molestiae illo ad rerum quos eum et consequuntur saepe aliquid sequi itaque voluptas placeat magnam repellendus facilis itaque enim sit similique odit assumenda sunt dolores illum quas.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '42', null, '0', '1', '2017-05-19', '2017-05-14 04:17:28', '2017-05-14 04:17:28');
INSERT INTO `lesson` VALUES ('512', '26', 'Consectetur dolorum dolorum quasi temporibus quia rerum culpa rerum eius quia natus.', 'Vero aspernatur iste vel dolore nam minus quo est officiis eveniet impedit odit sed maiores saepe consequatur quis consequatur vitae quis accusamus earum animi quasi sapiente ipsum sed quo ducimus ea quo dolor eum accusantium qui nobis id incidunt porro ea architecto excepturi minima quam sit nesciunt sint minus et rerum et dolores asperiores alias consectetur deleniti cum et cumque id fuga officia quos nihil illo et molestiae distinctio quo consequatur est impedit soluta dolor minima quos provident nostrum at necessitatibus minus facilis perspiciatis repellat vitae molestiae accusantium dolores repudiandae accusamus optio ipsam impedit quia nisi hic ipsum dolore tempora totam officiis quo sit dicta minima aut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-18', '2017-05-14 04:17:28', '2017-05-14 04:17:28');
INSERT INTO `lesson` VALUES ('513', '18', 'Porro recusandae saepe cupiditate repellat deleniti eius ea sit aut numquam.', 'Qui qui aut quae alias et ab inventore repellendus omnis ut beatae vel et sed assumenda sit unde voluptatem fugiat omnis recusandae soluta enim quia non repellendus quasi debitis dolorum esse non qui veritatis accusantium mollitia minus excepturi at hic dolorem sint vel et voluptas eligendi iste amet nobis maxime dicta est ut debitis nesciunt rerum aut nobis necessitatibus quas omnis nulla quisquam id facere delectus quia harum architecto aut saepe alias ut temporibus id occaecati modi odit aut dolores consectetur.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '27', null, '0', '1', '2017-05-16', '2017-05-14 04:17:28', '2017-05-14 04:17:28');
INSERT INTO `lesson` VALUES ('514', '10', 'Et non qui vel qui laborum earum dolorem.', 'Similique quas dolorum sit quia magnam totam adipisci aut voluptates consequatur non sint impedit consequatur iusto alias sunt non ratione est quo aut ut ut et commodi nihil ea vitae accusantium aut veniam expedita aut voluptate tempora distinctio aut inventore ea reiciendis sapiente velit unde id vero sed cupiditate nobis repellat aut molestiae est minima accusantium recusandae quod ut est sequi aperiam corporis rerum voluptatem corrupti corrupti ea possimus rem sint voluptas quia voluptatem fuga dolor excepturi sapiente quia consectetur cum odio dicta omnis aut officia incidunt reprehenderit sed rerum facere quas ut est vitae voluptate sed possimus illum assumenda.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '39', null, '0', '1', '2017-05-18', '2017-05-14 04:17:28', '2017-05-14 04:17:28');
INSERT INTO `lesson` VALUES ('515', '13', 'Deserunt magnam suscipit dolor qui veritatis voluptas aut illo.', 'Quasi modi ullam voluptatem tempora eaque fuga impedit sapiente necessitatibus maxime qui neque quis aperiam aut mollitia qui vero a numquam assumenda ut voluptatem non quisquam qui error dolorum adipisci at corporis beatae repudiandae omnis sunt voluptas architecto sequi impedit dolorem minima quasi expedita eum debitis doloremque omnis quas ab omnis dicta ea minima vel eos illo voluptatem nostrum voluptatem et ut quis accusamus molestiae culpa voluptate debitis perferendis quae iste modi temporibus corporis illum non dignissimos asperiores ipsa alias aut minima deleniti sequi sequi et molestias eligendi reiciendis ad harum incidunt aut et ullam laboriosam quia sit neque ea expedita et esse quos aliquid eos sint ut quisquam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-15', '2017-05-14 04:17:28', '2017-05-14 04:17:28');
INSERT INTO `lesson` VALUES ('516', '12', 'Eos eum dolores veniam eius delectus excepturi velit ut.', 'Ex quod ut sed perspiciatis necessitatibus unde libero consectetur qui ipsum tempora et quo libero maiores maxime quia labore velit est impedit voluptatum quasi eaque inventore saepe et possimus nulla dolorem sed veniam est quos eaque eos quia quae quos in rerum ut molestiae a illum et rerum tenetur facere consequatur reprehenderit consequatur qui hic est asperiores deserunt porro sed omnis officia quidem est debitis est architecto atque rerum dicta facere odit vero non beatae rerum earum commodi atque possimus quis facere et dolore et illo est quod rerum exercitationem non qui consectetur culpa distinctio accusamus distinctio dolorum quasi consectetur atque voluptatem ratione officiis cumque sint quaerat quis fuga harum et neque corrupti repudiandae quis et possimus non officiis nihil aperiam magni non cum commodi voluptatum vel voluptas earum illum est dolor earum ad veritatis perferendis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '23', null, '0', '1', '2017-05-18', '2017-05-14 04:17:28', '2017-05-14 04:17:28');
INSERT INTO `lesson` VALUES ('517', '8', 'Laudantium voluptas debitis saepe ipsam aut.', 'Ab necessitatibus exercitationem aut optio vero eveniet aut nemo nostrum et officia ipsum quia non autem explicabo facere eius nulla quia dolorem culpa hic vero quia impedit sit voluptatum quis eos ut cumque quae quo voluptatem voluptate vel eos et consequatur natus vel qui doloribus et recusandae ipsum qui tempore recusandae quia porro inventore sit dolores facere repellendus porro beatae adipisci at magni magni sed in adipisci enim voluptatem voluptas quasi sequi perspiciatis est nostrum deleniti temporibus aut eligendi dolores et qui culpa odio velit hic eum sit expedita labore qui repudiandae ut saepe beatae odio earum magnam dicta dolor doloribus corporis sed dolor nemo iure necessitatibus placeat voluptas eos ut et rerum soluta amet fuga eaque quos enim dolore ea ut ratione nihil tempore provident dolore est.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '23', null, '0', '1', '2017-05-19', '2017-05-14 04:17:28', '2017-05-14 04:17:28');
INSERT INTO `lesson` VALUES ('518', '13', 'Ab doloribus molestias quaerat corrupti hic non.', 'Et quos saepe magni sequi laborum dicta ipsum ipsam est nemo nihil qui minus consequatur qui deleniti necessitatibus magnam nisi qui rerum enim quia debitis cupiditate explicabo rerum blanditiis vero enim corporis voluptate et ut iste amet architecto soluta id et ratione necessitatibus et voluptatem aut magnam voluptatem rerum voluptatem laudantium asperiores et recusandae nulla accusantium assumenda dignissimos voluptatem qui at officiis at.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-14', '2017-05-14 04:17:28', '2017-05-14 04:17:28');
INSERT INTO `lesson` VALUES ('519', '20', 'Repellat odit aut quia et.', 'Maiores quam rerum rerum dolor suscipit cumque ut qui molestias tempore consequatur tenetur rem asperiores reiciendis vero quam illo non amet facilis et error ut aut est ut minus dolore voluptates ullam reprehenderit aut occaecati laboriosam est est fugiat quisquam eum nobis et voluptatem aperiam facilis adipisci non ut exercitationem eaque odit sint doloremque praesentium quis cupiditate consequatur nostrum ut ad voluptatibus ab minima recusandae sit aut sit aspernatur rerum ipsum dolores non voluptatem facilis odio aut odio quibusdam eaque tempora quia quaerat id hic magni veritatis esse aut accusantium sint et neque eaque dicta esse ut sunt beatae et illum possimus laudantium esse dolores maxime ut iure ut sit aliquam blanditiis ducimus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-17', '2017-05-14 04:17:28', '2017-05-14 04:17:28');
INSERT INTO `lesson` VALUES ('520', '2', 'Minima occaecati iusto quis quia quo illo.', 'Eos ea ad velit et est nam molestiae iste quisquam veritatis quis aspernatur et nostrum quos nesciunt reiciendis ipsum amet maxime beatae et rerum iure consequatur illum facere sint aliquid sunt est similique cum sequi eum voluptate aperiam est labore et quia nihil doloribus sunt doloremque quo ut consequatur qui et enim est vel et recusandae ipsum est aut libero assumenda adipisci consequatur quo assumenda hic omnis odio et porro quisquam sunt eligendi dolores est dolorum perspiciatis quis repudiandae qui molestiae fuga enim modi rem aspernatur enim aliquam tempora placeat repellendus similique aspernatur reprehenderit et qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-17', '2017-05-14 04:17:28', '2017-05-14 04:17:28');
INSERT INTO `lesson` VALUES ('521', '27', 'Minima incidunt repellendus facere ipsum quis.', 'Dolores eum in labore provident debitis adipisci reprehenderit sunt omnis dignissimos repudiandae est necessitatibus culpa aut et non sapiente et error et et blanditiis earum in adipisci facere totam aliquid assumenda voluptate nesciunt excepturi debitis magni ipsa id magnam dolorem est sapiente nostrum nam sunt laudantium ut velit possimus possimus repellendus ut distinctio officiis et numquam facilis nam quas consequatur eveniet aperiam doloribus cum est voluptatem veniam ipsa tempore repellat possimus non et quos et impedit quam ea officia ut eligendi ullam suscipit rerum animi in sunt dicta consequatur dolore.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '39', null, '0', '1', '2017-05-18', '2017-05-14 04:17:28', '2017-05-14 04:17:28');
INSERT INTO `lesson` VALUES ('522', '19', 'Non hic nesciunt id voluptas architecto ipsa.', 'Aut veniam ullam qui vero mollitia vel omnis itaque voluptas maiores voluptatem voluptas eveniet sint repudiandae commodi dolor ipsum excepturi quo et dolor dolor sit quia veritatis dolorum saepe et quo soluta ducimus possimus incidunt dolorem ea aut dolore ad dolorem non temporibus et aut eum ullam ad suscipit optio numquam nulla quia ab voluptatibus ipsum iste quisquam cum consequatur molestiae autem et voluptas sint nulla rerum iure nisi repellat nulla voluptatem minus natus facere mollitia consequatur ea dolorum et est tempora voluptatibus dolorum ipsam deleniti eum voluptas dolores optio nobis odit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-15', '2017-05-14 04:17:29', '2017-05-14 04:17:29');
INSERT INTO `lesson` VALUES ('523', '16', 'Aut et quia labore voluptatem magnam temporibus ducimus aut porro dicta.', 'Sequi vero omnis ut numquam fugiat adipisci aut non quos eos est rerum architecto ut et rerum quasi eius hic quaerat consectetur exercitationem voluptatum et maiores qui aut perferendis accusantium itaque optio accusantium nemo et aut tenetur corrupti iste sit quod ea earum commodi quam blanditiis et magni quisquam eos est atque est neque rem dolor quaerat ea fugiat nesciunt non qui facere expedita repudiandae quam nobis voluptates ducimus sit veniam porro non tempora consequatur magni sed aperiam sed voluptatem sit et eos voluptate quisquam et officiis tenetur sed maxime quod minus facere vel rerum veniam iusto eius aspernatur nisi iusto quisquam maxime et praesentium quia et ullam enim nesciunt provident nesciunt nihil quia odit assumenda quo harum eos perspiciatis ut rerum quod saepe deleniti pariatur quia incidunt repellendus placeat quibusdam aperiam architecto facere rerum ut quod.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-15', '2017-05-14 04:17:29', '2017-05-14 04:17:29');
INSERT INTO `lesson` VALUES ('524', '5', 'Quia quia reprehenderit optio blanditiis non.', 'Quod consequatur quos provident iusto vitae et minima dignissimos sed voluptatem esse consequatur nobis magni sint et officiis cupiditate velit vitae ipsa eos ullam sit sequi qui fugit optio enim quia explicabo asperiores voluptatibus non et autem doloremque enim non nihil dolores tempore quo autem numquam in explicabo iste dolorem officia voluptates quibusdam tempora nisi facere sequi quisquam ipsa quis illo numquam qui sunt tempore esse est atque deserunt voluptates tempora sed cupiditate aliquam quasi et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-16', '2017-05-14 04:17:29', '2017-05-14 04:17:29');
INSERT INTO `lesson` VALUES ('525', '2', 'Maxime sed qui fugit nihil labore ducimus ipsum eum sed qui.', 'Non dolorem neque id sed sunt ducimus distinctio consectetur aut labore quaerat unde maiores odit omnis rerum est explicabo totam corrupti est et quibusdam omnis voluptas et ut aut eos porro porro expedita sit nam cum qui beatae reprehenderit odio illo expedita ut est blanditiis placeat totam sit voluptas quidem ut et mollitia quia vero tempora aut expedita non itaque autem sit magni necessitatibus sed voluptatibus illo repellendus unde quaerat molestiae maiores corporis ut nihil et dolores ad ea ad impedit consequatur veritatis eligendi autem et reiciendis autem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-18', '2017-05-14 04:17:29', '2017-05-14 04:17:29');
INSERT INTO `lesson` VALUES ('526', '21', 'Atque eum tempore id optio voluptatem quas soluta.', 'Ratione quisquam aut aspernatur animi facere minus doloremque tempore dolorem sed dolor quibusdam qui iure nihil aliquid dicta laboriosam et ea maxime ipsam possimus mollitia enim magnam ratione fuga voluptas ipsum maiores inventore sit voluptas temporibus quos excepturi ipsum fuga labore a consequuntur qui quisquam delectus non voluptatem nihil veniam qui sequi mollitia quam expedita quasi est ut ipsum harum et rerum libero saepe aut impedit rerum maxime id reiciendis error voluptatum qui qui iste quisquam nostrum mollitia voluptates autem quas eum voluptas consequuntur nulla ut vero ipsum omnis quasi tempore labore officia ut cum possimus nostrum nulla assumenda enim voluptas sit sunt eius repellat itaque eos nihil ducimus non eaque iure.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '39', null, '0', '1', '2017-05-14', '2017-05-14 04:17:29', '2017-05-14 04:17:29');
INSERT INTO `lesson` VALUES ('527', '27', 'Itaque ut aliquid natus sed quo aut et.', 'Ut enim adipisci consequatur iure accusamus velit velit corrupti sed asperiores vitae placeat veniam officia et aut rem unde fugiat laborum quo alias aut repellendus vero fugiat temporibus tempore ut aperiam similique qui praesentium vel ut laboriosam voluptate incidunt id quia provident maxime excepturi voluptatum minus cupiditate eius iusto et velit sed occaecati praesentium omnis dicta dolorum sit quidem eos non et voluptatibus et recusandae minus sint quam nisi exercitationem cupiditate magnam est sed assumenda sed tempora autem totam molestiae et voluptate aliquam maiores repellendus quos nulla dolor a occaecati quam asperiores beatae pariatur officiis sequi vel voluptatem rem iusto qui et vitae ut facere ad est architecto facilis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '39', null, '0', '1', '2017-05-15', '2017-05-14 04:17:29', '2017-05-14 04:17:29');
INSERT INTO `lesson` VALUES ('528', '3', 'Ea nesciunt quae quo cumque repudiandae omnis labore dolores cum repellendus.', 'Dolorem ut nemo fugiat deserunt exercitationem ut sunt incidunt impedit odio facere ullam ut doloremque et cumque cumque sed ullam quia doloribus aperiam dolor autem exercitationem consequatur quod id non et quia dolores nostrum soluta eos similique fugit quia et veniam sunt ut qui aut aspernatur reiciendis odio possimus eveniet error architecto quisquam commodi qui totam amet deserunt distinctio iure nostrum voluptate harum quam quaerat dolor molestiae et deserunt natus esse eum voluptatem consectetur qui ut eum sed veniam dolore sit similique veniam neque harum autem ex molestiae vitae perspiciatis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-14', '2017-05-14 04:17:29', '2017-05-14 04:17:29');
INSERT INTO `lesson` VALUES ('529', '14', 'Aliquid in sunt at molestias veritatis iusto fugiat et.', 'Voluptatem ea ratione et odit at sed iusto nihil hic eos hic voluptatum ipsum rerum fuga vel id et illo fugiat id voluptas nulla rerum sequi molestiae id culpa in aut consequatur harum cupiditate consectetur ducimus consequatur mollitia autem odio saepe dolorum in doloribus itaque expedita accusantium illum sequi quis aut iusto vel dolorem fuga possimus beatae dolore et aut laudantium ducimus nihil qui amet ipsum architecto in consequatur aperiam doloribus dolores et fuga beatae accusantium et rerum qui magnam porro facilis eos sed cum omnis ea asperiores nostrum placeat dolor cupiditate non temporibus iste quod voluptatem quis ea aut sunt eos ullam aut quo.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '30', null, '0', '1', '2017-05-14', '2017-05-14 04:17:29', '2017-05-14 04:17:29');
INSERT INTO `lesson` VALUES ('530', '26', 'Quia voluptate aut et placeat natus.', 'Vel minima atque optio laborum voluptatem atque dolores qui aut molestiae officiis cupiditate qui officia numquam repudiandae omnis cum esse consequatur nemo ipsa sunt tempore rerum rerum molestias nihil voluptate cupiditate recusandae omnis hic ipsa cum et aliquid quaerat quis doloribus aut est animi vel ut velit ullam quia esse nam in ratione nesciunt temporibus reprehenderit ab aut aut et dolores iste provident voluptatem voluptate nostrum nobis voluptatem cupiditate voluptates voluptatem quisquam qui sapiente ut molestiae cumque dolore aut aut quo et possimus qui vitae consequatur qui aut ducimus id qui praesentium quam quia placeat distinctio laborum ipsum aut fugiat deserunt.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '27', null, '0', '1', '2017-05-16', '2017-05-14 04:17:29', '2017-05-14 04:17:29');
INSERT INTO `lesson` VALUES ('531', '18', 'Voluptatem est quo sunt facere quaerat non est sunt quod.', 'Perspiciatis provident autem est et maxime dolorem ut sunt iure reiciendis facere qui est cum voluptatem assumenda eum minima est est est maiores quo ut doloribus quo magnam maxime sapiente quia ea id dolores cupiditate dolore quis quia quia voluptatem voluptas harum est et nostrum nihil nostrum dolor dolore id cumque nostrum aut deleniti molestiae magnam at et est molestias quos rem voluptatem corporis eum sit ea labore quia facere molestiae nulla sunt eaque eos vel non non et tempore at laborum dolores nihil voluptatem voluptas sed sapiente facilis cum possimus tempora ad sit in sed nisi architecto eum earum ipsam occaecati officia sequi aspernatur et est ab consequuntur perferendis error odio non provident est unde id tenetur ipsum ea fugit voluptate culpa.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-17', '2017-05-14 04:17:29', '2017-05-14 04:17:29');
INSERT INTO `lesson` VALUES ('532', '26', 'Magnam dolor recusandae rem officiis tempora laborum ut reprehenderit minus natus.', 'Cupiditate eum et sed commodi facere ipsam deleniti exercitationem nihil qui dolorum et eum quaerat placeat voluptatem nostrum aliquid quisquam et voluptatem dolores libero porro illo ipsam eum quae aut reiciendis sapiente porro id dolorem voluptatem quia in ut et est molestias maiores et non ea veniam laudantium quos ea commodi iure vitae soluta et dolores quae sed doloribus non eum voluptatem dolor asperiores aut consequatur velit esse rerum fugiat sit nesciunt architecto aut perferendis voluptate non repellendus accusantium ea laboriosam minima maxime qui voluptas est non repudiandae iste temporibus eligendi expedita quia aut repellat non quisquam perferendis minima aut quos consequatur et voluptates vel.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '31', null, '0', '1', '2017-05-15', '2017-05-14 04:17:29', '2017-05-14 04:17:29');
INSERT INTO `lesson` VALUES ('533', '18', 'Nostrum modi consectetur velit sapiente facere sed dicta assumenda ea dolorum.', 'Accusamus saepe tempore molestiae blanditiis corporis sequi laudantium et delectus aut animi aliquam tempore nulla saepe officia impedit debitis autem neque nesciunt alias est at consequuntur modi modi sit sequi labore quo ut incidunt optio quidem totam occaecati qui a et provident praesentium non sed ipsa itaque eveniet voluptatem sit dicta aut autem possimus rem voluptatem ea quia animi et molestiae aliquam est ullam officia temporibus fuga tempora quasi iusto.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '22', null, '0', '1', '2017-05-16', '2017-05-14 04:17:29', '2017-05-14 04:17:29');
INSERT INTO `lesson` VALUES ('534', '26', 'Eos autem ut nulla incidunt sed aut cupiditate qui.', 'Enim repellat consequatur expedita hic autem illo laudantium blanditiis nostrum sunt sint rerum veniam possimus ex dolor eum et nobis impedit non magni ut sed sapiente odit non nisi at ut itaque est ab reiciendis vitae velit earum magnam quia totam perspiciatis nulla ut natus itaque non consequuntur tenetur aut quo sed perspiciatis doloribus et a eum quae reprehenderit vel maiores esse itaque incidunt sequi non eligendi excepturi ducimus est voluptates et hic voluptas aliquid perspiciatis quasi voluptas fugiat dolores amet quia fugit qui blanditiis praesentium voluptates omnis eaque consequatur veniam voluptas voluptatem deleniti nobis dolor dolorum iste sunt quo est sunt autem atque voluptatem sapiente at ea nisi libero temporibus enim autem amet reiciendis suscipit perferendis rerum labore ut fugiat deleniti aut rerum ut pariatur soluta quis soluta sit sed dicta cupiditate quaerat maxime velit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-15', '2017-05-14 04:17:29', '2017-05-14 04:17:29');
