INSERT INTO `lesson` VALUES ('538', '22', 'Qui est quas accusantium consequuntur sint.', 'Non exercitationem at non nesciunt quas et eos quo voluptate omnis quisquam nihil aliquam fuga consectetur corporis et quaerat sint explicabo delectus libero accusamus et eos amet dicta nemo non maiores odio ut dolor laboriosam vel eius dolorem omnis nihil error quo corrupti non deleniti quis voluptatibus voluptatem et itaque dolorem non sapiente atque ipsam minus porro qui est beatae qui qui ut et ad rerum et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '24', null, '0', '1', '2017-05-18', '2017-05-14 04:17:29', '2017-05-14 04:17:29');
INSERT INTO `lesson` VALUES ('539', '26', 'Iusto dolor nihil repudiandae maxime et quia cupiditate exercitationem voluptatem iusto.', 'Animi ut et nemo aliquam quisquam molestiae sed at cupiditate suscipit quia ut maxime voluptatem et voluptatem architecto temporibus sed ex corrupti magnam architecto quos delectus voluptatem exercitationem saepe et et et at labore eveniet dolor aperiam provident numquam eos accusamus sed laborum tenetur eaque nobis distinctio expedita ducimus sunt voluptatibus temporibus eius et repudiandae eos nemo libero est voluptatibus assumenda enim magnam cum et nobis ab ut est at sint aliquid esse est unde ipsam et voluptas voluptatum at voluptates repellat unde dolores autem qui officia sint dolor laboriosam alias doloremque dolorem est dolor quis dolore aut quo voluptatem sit omnis reprehenderit ipsa magni veniam reprehenderit et assumenda voluptates quaerat facilis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-16', '2017-05-14 04:17:29', '2017-05-14 04:17:29');
