INSERT INTO `lesson` VALUES ('541', '2', 'Eveniet odit soluta voluptas natus nihil.', 'Qui in non inventore est modi placeat molestias eligendi enim cumque et non ut aspernatur veritatis qui consectetur assumenda voluptas saepe aperiam et rerum quaerat error et voluptas dicta velit eius qui quibusdam delectus expedita voluptatem sunt illum exercitationem vel suscipit aliquid sed fugiat consequuntur nam qui facere blanditiis provident alias beatae dolores laboriosam corrupti sint optio eos totam perferendis architecto dolor illo veniam atque quis hic consequatur impedit aspernatur est illum iste soluta qui et et numquam non optio repellat sed assumenda voluptates qui ut et soluta aut rerum modi iste ratione expedita nobis molestiae modi ut dolorem animi ut eius aut minima qui magnam et fugiat iusto fuga.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-16', '2017-05-14 04:17:30', '2017-05-14 04:17:30');
