INSERT INTO `lesson` VALUES ('543', '10', 'Corrupti beatae non eos voluptate qui totam ratione nam ut.', 'Minima modi in totam voluptatem qui eligendi ad ut eius mollitia consequatur voluptas voluptatem consectetur provident assumenda illo placeat ut rerum iure magnam voluptates et vel autem cumque in vel ad ut quod non explicabo voluptatem enim quasi est laboriosam corporis et possimus ullam et qui aut corporis quas ex voluptate non numquam non quam dolorem laboriosam porro atque consequuntur enim culpa.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-18', '2017-05-14 04:17:30', '2017-05-14 04:17:30');
INSERT INTO `lesson` VALUES ('544', '8', 'Perferendis rerum voluptatum minus et non aliquid temporibus officia et ab.', 'Officiis ipsam ducimus incidunt fugit voluptas eos nihil error officiis et commodi sit asperiores illum explicabo molestias molestiae libero et rerum officia voluptate sunt pariatur dicta quasi officiis illum animi quia iste neque suscipit velit nihil eligendi sint rem enim veniam tenetur odio ut doloribus labore eligendi reprehenderit a voluptates eaque rem debitis quidem magnam dolorum id vel molestias deserunt eaque rerum perspiciatis voluptatem libero incidunt sint sint porro voluptatem vel possimus consequuntur eos nisi numquam quam facere enim pariatur recusandae suscipit qui dolorem corporis earum ex autem adipisci cumque ut culpa incidunt porro ratione quaerat nesciunt minima voluptates aut ipsa repellat inventore pariatur nam deserunt.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-15', '2017-05-14 04:17:30', '2017-05-14 04:17:30');
INSERT INTO `lesson` VALUES ('545', '28', 'Sed dolorem veniam rerum non ratione totam qui.', 'Ipsam voluptatibus delectus nihil rem et commodi ad voluptatum optio reprehenderit explicabo pariatur in placeat repellat cumque eos tempore quaerat in in et facere sit asperiores ut eos quisquam laboriosam quisquam dignissimos reprehenderit molestiae assumenda non eveniet eveniet sed minus soluta consequatur id perspiciatis odit est quisquam ducimus sit voluptatum et non earum eos laborum repellendus odio culpa ut ad ea aut est ut eum cupiditate ut doloremque qui temporibus et iure officiis neque doloremque laudantium neque sit voluptas cupiditate est suscipit excepturi voluptatem et sint et facilis repellat velit iste sit ab quis beatae quidem et tenetur eaque soluta enim sed consequatur quia ut molestiae rem voluptas.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-15', '2017-05-14 04:17:30', '2017-05-14 04:17:30');
INSERT INTO `lesson` VALUES ('546', '16', 'Ratione earum sunt soluta fuga perspiciatis ducimus omnis provident natus.', 'Autem eveniet fugiat est itaque natus exercitationem consequatur deleniti vero hic eaque sed id nobis omnis omnis doloremque ut molestiae cupiditate et et sunt sunt quae ut voluptate et corrupti rerum illo alias accusamus aut ipsum corrupti sint fugit dolores et vero et est reprehenderit tenetur et magni corporis non laborum fugiat cum itaque perspiciatis omnis ab laboriosam ex aliquam quam optio eaque a at modi sint repudiandae.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '39', null, '0', '1', '2017-05-18', '2017-05-14 04:17:30', '2017-05-14 04:17:30');
INSERT INTO `lesson` VALUES ('547', '30', 'Asperiores non eum quasi atque enim dolor.', 'Rem numquam ut quam delectus nobis magnam incidunt eos distinctio iure sed qui vero eos possimus harum molestias voluptatibus deleniti omnis est possimus dolor quos necessitatibus est officiis quidem optio est eos vel odio temporibus ea placeat et dolores similique reiciendis dolorem veniam aliquam odit natus sed est dolores quam voluptatem consequuntur amet ullam atque dicta qui accusantium occaecati quis aut est repellendus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-17', '2017-05-14 04:17:30', '2017-05-14 04:17:30');
INSERT INTO `lesson` VALUES ('548', '12', 'Facere occaecati eum ad et cum eum aut quia quae.', 'Et sunt temporibus molestiae dolorem cum et inventore quidem aspernatur est illum magnam eius a non consequuntur qui dicta est deleniti minus repellendus perferendis suscipit facere sit labore quae dolorem harum est quos error quis magni delectus repellat nulla eligendi iste et debitis perferendis nostrum non cumque non porro reiciendis molestiae in quia excepturi blanditiis reprehenderit sed sunt laboriosam quis incidunt qui libero perferendis qui quis consectetur sed aut corporis at tempore dolores qui rerum voluptas minus laudantium saepe consequuntur aut fugiat consequatur dolorum suscipit ut a est consectetur est aliquid sit mollitia voluptas voluptates harum accusantium tenetur voluptatibus similique et unde vero ipsum dolores et ipsam provident nisi eum nostrum accusantium culpa dignissimos ex ipsam molestiae doloremque earum vero tenetur quidem officia omnis nam molestiae architecto esse quae labore repellendus ipsum ratione optio aut temporibus voluptas alias.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-18', '2017-05-14 04:17:30', '2017-05-14 04:17:30');
INSERT INTO `lesson` VALUES ('549', '21', 'Assumenda minima debitis rerum et earum quia omnis et.', 'Aliquam vitae nobis aut cumque eaque sequi et incidunt quo velit numquam et reiciendis animi quam nihil quae et est qui voluptatem ipsum dolores et voluptatem asperiores nam perferendis quis ut quisquam quis voluptatem velit et reiciendis similique quos dolor iure veniam incidunt quidem omnis quo est cum ullam modi sint est nihil expedita aliquam est incidunt iusto ducimus aperiam est non perspiciatis blanditiis sit magni cumque excepturi iusto minima neque ea consequatur minima reiciendis esse.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '27', null, '0', '1', '2017-05-18', '2017-05-14 04:17:30', '2017-05-14 04:17:30');
INSERT INTO `lesson` VALUES ('550', '28', 'Alias eos sapiente iure similique adipisci autem sunt cum et nobis maxime.', 'Qui aut dolores tenetur quaerat ut vel corrupti eaque molestiae repellendus dolor eveniet in est qui voluptates voluptas est similique quis modi quos voluptatem quia ipsum voluptatem ut quas et doloribus ut provident ducimus mollitia ut sapiente nihil temporibus vero dolorem voluptates alias consequatur dolor veniam ullam ut distinctio tenetur impedit commodi eum veritatis ut sit totam voluptatem velit quis ipsa quo et dolor eum adipisci sunt temporibus voluptatem rerum dolores id quo deleniti eos similique reprehenderit aspernatur vitae dolorem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '22', null, '0', '1', '2017-05-18', '2017-05-14 04:17:30', '2017-05-14 04:17:30');
INSERT INTO `lesson` VALUES ('551', '8', 'Atque sit rerum quis deleniti pariatur qui aut in ab quasi nemo.', 'Natus nobis distinctio minus officia et in ea iure dolor error ipsa rerum assumenda eum sit magni consequatur quis dolor est et ut aut ut similique rem maiores error magni aliquid voluptas vitae alias consequatur sunt molestiae vel asperiores porro quis nesciunt est dolores iusto velit libero consequatur soluta eaque impedit autem et ut et esse occaecati sapiente eos ab non fuga eaque ut in temporibus nam nesciunt sint aut autem quis deleniti harum fugiat quidem sequi ullam ratione qui nemo dolorum repellat sit possimus omnis voluptatem quasi minus laborum dolor corrupti dolorem quia totam qui enim et porro voluptates.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '23', null, '0', '1', '2017-05-19', '2017-05-14 04:17:30', '2017-05-14 04:17:30');
INSERT INTO `lesson` VALUES ('552', '24', 'Eaque sit vitae iure necessitatibus id nostrum fugit quas atque.', 'Veritatis voluptate et aliquid alias perspiciatis et sequi voluptatem libero et est atque consequatur ut illo nulla nemo sed quia quia odit aperiam nihil a sed natus error et et nihil ullam sunt vel dolorem sed vitae et at voluptates vel qui sunt nostrum error iste minima nesciunt rem deserunt quam expedita et itaque fuga animi doloremque sint cum tempore qui aliquam alias aliquid similique nulla maxime esse voluptas et aut eaque numquam molestiae aut dignissimos saepe molestias voluptatum officiis inventore ut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '45', null, '0', '1', '2017-05-15', '2017-05-14 04:17:30', '2017-05-14 04:17:30');
INSERT INTO `lesson` VALUES ('553', '14', 'Omnis non et magni non quam qui nam est tempora voluptatum dolorum.', 'Ratione facere occaecati dolor numquam suscipit in officia cumque est quas cupiditate ut mollitia consequatur quam rerum quia eveniet iste sed dolorum id praesentium dolor nulla quidem aut a corporis qui nostrum nemo quae aut aut nulla soluta libero qui molestiae corporis voluptatem ipsum voluptatem excepturi quos et nesciunt eaque velit et accusantium consequatur quam minus et recusandae natus inventore dolor dolorem est fugit sequi vitae itaque est assumenda fuga.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '22', null, '0', '1', '2017-05-14', '2017-05-14 04:17:30', '2017-05-14 04:17:30');
INSERT INTO `lesson` VALUES ('554', '19', 'Provident dolorem suscipit quaerat pariatur est quam a.', 'Eveniet quia voluptatum alias placeat totam ut distinctio necessitatibus sit in eius totam nihil at non facilis dolorum molestias fugiat provident ducimus et assumenda qui quis rem omnis omnis possimus sint ad omnis consequatur molestiae voluptate et ut consequuntur ex aut consequatur eaque eligendi nam aut quo nam qui sit accusamus nihil omnis aspernatur et in non magni natus libero veniam et ullam quisquam sit quo sapiente voluptas fugiat aut debitis aut molestias delectus eos itaque unde quibusdam consequatur tempore.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-19', '2017-05-14 04:17:30', '2017-05-14 04:17:30');
INSERT INTO `lesson` VALUES ('555', '9', 'Tenetur sed iure minus eos omnis consequatur.', 'Similique porro voluptas eligendi qui aliquid ratione rerum itaque nam sunt sapiente est soluta accusantium omnis explicabo nisi quo et rerum atque reiciendis et omnis reprehenderit quo cum sed distinctio ut qui animi sunt et est illum natus facere omnis rerum autem sint totam eum nemo harum saepe quia dolores maiores nisi at ea consequatur ut nostrum adipisci doloribus ut aut voluptas omnis vel mollitia ut sequi labore similique enim dignissimos qui eius maxime pariatur consequuntur eligendi blanditiis id atque maxime illum in vitae omnis ab quia non harum nemo et dicta ut aut sit et velit vero voluptatem mollitia odit praesentium sit voluptatum nostrum ipsa modi commodi nesciunt voluptas placeat quo.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '36', null, '0', '1', '2017-05-18', '2017-05-14 04:17:31', '2017-05-14 04:17:31');
INSERT INTO `lesson` VALUES ('556', '30', 'Voluptas est debitis illo quo est earum omnis sunt.', 'Sunt non ut occaecati sit enim non facere velit nihil aut impedit sunt suscipit exercitationem occaecati sunt rerum veritatis neque animi quaerat omnis iure rerum magnam natus iste labore nulla blanditiis eum sit explicabo et iste et sed consectetur et accusamus perferendis iusto omnis facere quos dolorum rem veritatis molestias nisi esse quia neque nemo minima quibusdam omnis necessitatibus fuga quas omnis dignissimos et in ipsam sapiente fuga aliquid voluptatem similique doloremque libero aperiam sapiente nobis sint perspiciatis quisquam beatae exercitationem rerum voluptatem ipsum corrupti.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '45', null, '0', '1', '2017-05-15', '2017-05-14 04:17:31', '2017-05-14 04:17:31');
INSERT INTO `lesson` VALUES ('557', '7', 'Blanditiis laboriosam dolorem est ex neque.', 'Ut voluptatem culpa voluptate dicta dolorem et nesciunt qui consequatur est quibusdam neque sequi vitae accusantium corrupti consequatur ratione totam praesentium ducimus natus ut et dolorem voluptatem consequatur non tempora earum similique autem et qui iusto ea recusandae consequuntur corporis et qui officiis aut odit rerum fugit similique nulla architecto et temporibus inventore velit libero nobis ipsa nihil labore officia numquam quas omnis et eligendi quaerat et quo sit magnam sed ratione voluptate ducimus est eos officiis rerum repudiandae cum suscipit est illo quos ipsum eos aut doloribus quae velit odio consequatur laudantium rem incidunt iure ipsam odit tempore eveniet laudantium quis eveniet possimus impedit aut et cumque perspiciatis qui praesentium ullam maiores sit nihil suscipit earum ex et rem sunt veritatis et et deserunt amet non temporibus voluptas fuga.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-16', '2017-05-14 04:17:31', '2017-05-14 04:17:31');
INSERT INTO `lesson` VALUES ('558', '16', 'Quisquam autem est perspiciatis et sed aut et necessitatibus fugiat fuga.', 'Eaque libero impedit alias alias id harum explicabo suscipit quae quod maxime et fugit magni sed reiciendis repellat vero tempore modi similique fugiat nisi laborum odit voluptate ea iste velit voluptatibus ipsam quibusdam quos et ut sequi dolores necessitatibus quo necessitatibus voluptatibus aperiam perferendis nesciunt aperiam voluptates quisquam ut nisi explicabo sed necessitatibus asperiores et iste numquam optio consectetur delectus expedita magni aut rem reprehenderit quibusdam quisquam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '27', null, '0', '1', '2017-05-15', '2017-05-14 04:17:31', '2017-05-14 04:17:31');
INSERT INTO `lesson` VALUES ('559', '20', 'Odio est laboriosam eos deserunt blanditiis.', 'Ratione fugiat at maxime dolor quia molestiae voluptatem tempore neque aperiam est dolorem ut nostrum atque eum vel qui exercitationem alias magni ea accusamus omnis deleniti ut sed recusandae sunt nobis voluptatem voluptas sed eaque repudiandae excepturi ipsam quia distinctio natus magni ipsam debitis nobis id iure non ratione veritatis nulla architecto corporis nihil harum in voluptate non aperiam quo libero ipsam corrupti explicabo repellat est sed recusandae et rerum nobis qui qui cupiditate debitis tempora ullam voluptatum totam incidunt deserunt id inventore voluptatibus quam sapiente rerum qui dolore excepturi iusto rerum deserunt.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-19', '2017-05-14 04:17:31', '2017-05-14 04:17:31');
INSERT INTO `lesson` VALUES ('560', '19', 'Ullam doloribus expedita quaerat rerum enim nihil ad dignissimos.', 'Dolorum voluptates voluptatem eum repellendus et et culpa ex voluptatem voluptas aut voluptas dolores dolorem dolor fugit incidunt animi ipsum possimus consequatur sit tempore dolores aut totam sit consequatur et repudiandae nemo amet voluptas praesentium quisquam voluptate nemo sunt debitis voluptatem exercitationem et esse repudiandae fuga dolor natus hic ut non quis fugiat non accusantium laudantium dolor odit sequi excepturi corrupti enim dolorum corrupti quod dolorem maiores et modi consequatur totam dolorum vero magnam saepe recusandae ipsam sed.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '39', null, '0', '1', '2017-05-17', '2017-05-14 04:17:31', '2017-05-14 04:17:31');
INSERT INTO `lesson` VALUES ('561', '19', 'Hic blanditiis rerum unde quia voluptatem ut sed.', 'At molestias dolores doloribus similique sint ratione iure esse sequi qui ut quo qui est et praesentium quis facilis impedit est omnis sapiente eligendi voluptate perferendis aliquam ullam est corporis nihil sunt ipsum quasi in omnis iure dolor vel culpa voluptas sint nostrum quibusdam nihil magni aut similique error vitae ut voluptatem magni ducimus aut qui impedit recusandae iure provident mollitia accusamus debitis atque vitae assumenda ea distinctio quasi repellendus qui ut est in dolorum et minima eaque natus dolorem eum et quia expedita eos quis veniam veritatis quia dignissimos est officiis sed hic ex non inventore atque aut vitae voluptatibus occaecati maiores quisquam rerum perspiciatis eius consequatur harum ut est ullam voluptatem molestiae repellat dolore voluptatem maiores itaque magni qui reiciendis et ducimus dignissimos facilis delectus qui fuga molestiae quo.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-16', '2017-05-14 04:17:31', '2017-05-14 04:17:31');
INSERT INTO `lesson` VALUES ('562', '8', 'Dolorum vel eum quibusdam voluptas dolor deserunt qui.', 'Tempore id assumenda sapiente magnam dolorem culpa cumque ea molestiae voluptatem harum blanditiis temporibus saepe sunt illo consequuntur commodi aut sed sequi in dolor hic rerum iure est perspiciatis minima consequatur in sunt dolor placeat consequatur et ex fugit deleniti itaque iusto rem qui voluptate exercitationem quia modi et voluptatem at qui nam saepe autem molestias dolorem delectus quisquam excepturi fugit incidunt non facere a ea corporis autem ipsa consequatur voluptatem voluptate rem dolores nihil et id ut consequatur dicta consequatur accusamus omnis odio quia veritatis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '39', null, '0', '1', '2017-05-18', '2017-05-14 04:17:31', '2017-05-14 04:17:31');
INSERT INTO `lesson` VALUES ('563', '25', 'Quo aspernatur quisquam maxime dicta nobis.', 'Eius aliquid ut quam placeat sed accusantium non quibusdam sed consequatur aut similique totam rerum molestiae rem quo non voluptatibus iusto rerum molestiae dolores libero et in quis itaque dolores fugiat similique dolorem et alias ipsam ea eaque impedit ad aut nam quisquam odit magni consectetur voluptatem id ea modi dignissimos dolor provident suscipit laudantium laborum dolor non fuga vero et qui eum quasi doloribus excepturi dicta nisi nobis quia quod autem velit aut assumenda velit officiis tenetur molestiae dolor maiores voluptatem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-14', '2017-05-14 04:17:31', '2017-05-14 04:17:31');
INSERT INTO `lesson` VALUES ('564', '23', 'Similique et quos eum cupiditate corporis provident enim aut nihil corporis corrupti.', 'Enim ducimus et et accusantium possimus laborum fuga quaerat praesentium fuga molestiae cum autem dolor natus magni numquam aperiam cupiditate et eos explicabo et voluptatem illo autem sed id unde facilis eos deserunt praesentium fugiat ut id aut debitis possimus eaque rerum ut cupiditate fugiat ipsam quia maxime et exercitationem non sit iure autem dolor excepturi debitis et voluptas veniam aut id perspiciatis quia et minus laborum deleniti dolor doloribus vero dignissimos et rerum incidunt.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-19', '2017-05-14 04:17:31', '2017-05-14 04:17:31');
INSERT INTO `lesson` VALUES ('565', '4', 'Et qui quaerat sit accusamus ipsam est at.', 'Sit id voluptas eos sequi culpa eos ut esse et est ut quasi sint id porro quo nesciunt enim est itaque esse ex voluptas omnis neque deleniti culpa quidem optio consequatur corporis veritatis autem quidem molestias fugiat accusamus nihil magnam libero culpa explicabo sit a ut quaerat blanditiis dicta esse consequatur dolor ut consequatur at dolor numquam et corrupti corrupti quae perferendis ab quia recusandae explicabo ea qui autem praesentium inventore ullam ipsa ad voluptate et sint tenetur libero tempore dolor maxime aut dolores ducimus voluptatem molestiae quia et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-18', '2017-05-14 04:17:31', '2017-05-14 04:17:31');
INSERT INTO `lesson` VALUES ('566', '16', 'Cumque eum vel aut culpa non consectetur aut magnam quis.', 'Cumque aliquam qui ut et quo neque dolor omnis quia officiis est et aspernatur quos officiis delectus tenetur qui sed molestias iste sint asperiores vero debitis eligendi velit ut quaerat sequi dolore excepturi iste consectetur iste dolores eius dolores accusamus neque assumenda iste aut dignissimos ut vel odio provident et non eligendi dolorum amet laborum voluptatum quos ut officia reiciendis vel non neque nemo earum nisi facilis iusto facere soluta dolorem necessitatibus eos sunt quia aut neque omnis velit repellat ipsam soluta molestiae pariatur qui fuga nostrum sequi voluptate aut fuga quas iste veritatis nobis occaecati fugiat sapiente est tenetur accusantium corporis iusto et cupiditate neque vel incidunt minus et ea ea est nemo vitae ut vel autem et animi.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-15', '2017-05-14 04:17:31', '2017-05-14 04:17:31');
INSERT INTO `lesson` VALUES ('567', '11', 'Nisi deleniti repellat expedita nostrum necessitatibus in.', 'Hic illum et explicabo facere est nobis sit facilis alias veritatis expedita excepturi totam iusto quas aut cumque ut dignissimos necessitatibus ut voluptatem eum voluptas aut vero amet quasi sunt iste inventore aspernatur excepturi ex maxime corrupti eum fugiat recusandae minima illo omnis aut et assumenda minima error porro et veniam cupiditate saepe libero et tenetur nihil esse aut in quae nam et dolor et quo ut modi impedit quia qui voluptas est suscipit qui quam iusto dolorem enim voluptas.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-18', '2017-05-14 04:17:31', '2017-05-14 04:17:31');
INSERT INTO `lesson` VALUES ('568', '30', 'Consequuntur ut ipsa consequatur qui odio.', 'Et non nihil quam quo consequatur blanditiis sed alias eos provident blanditiis consequatur quia velit esse et et est fugiat reprehenderit dolor pariatur sit officia maxime reiciendis iusto suscipit sapiente modi ut molestiae quo natus nam laudantium dolorem harum quia cupiditate necessitatibus amet occaecati soluta qui tempora aut ad sint ex vero eos enim quae et cum odit consequuntur debitis rem commodi est qui inventore et dolor hic reiciendis reprehenderit temporibus voluptatum distinctio et dolorem voluptates deleniti et reprehenderit minima qui consectetur adipisci ut esse enim nihil molestiae nostrum corrupti fugit labore et enim quia optio minus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-17', '2017-05-14 04:17:31', '2017-05-14 04:17:31');
INSERT INTO `lesson` VALUES ('569', '14', 'Soluta id omnis fugiat suscipit officiis quaerat occaecati sequi voluptatem.', 'Quas exercitationem sit error ad fugit repudiandae hic laboriosam cupiditate et eos expedita omnis quis sequi molestias culpa consequatur sint harum quod amet placeat quia voluptatem fugit vel occaecati quia molestiae autem sed sit vel similique et non aut temporibus praesentium blanditiis hic nihil nemo veritatis ut similique vero iste repellat ad distinctio quas tempora animi quis qui aut minus provident qui at vero et earum soluta quo modi placeat maiores possimus aut ut exercitationem voluptates ipsum corporis consequatur corporis magnam maiores quod id velit sunt quas ut doloribus voluptatem nihil quo molestiae veniam distinctio nihil tempore voluptatem officiis consequatur porro quia doloremque.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-18', '2017-05-14 04:17:31', '2017-05-14 04:17:31');
INSERT INTO `lesson` VALUES ('570', '8', 'Magnam numquam est corrupti voluptatem voluptatem aut eligendi soluta repudiandae labore.', 'Ullam accusamus soluta similique eveniet ratione harum magnam omnis temporibus autem corrupti harum at ea est ea debitis non provident ut recusandae cumque enim praesentium blanditiis sunt qui voluptates debitis facilis unde tenetur cumque laboriosam voluptatem voluptas rerum atque nihil corporis incidunt nam commodi illo debitis aspernatur et rerum aut in aliquid rerum dolorem sint sint cupiditate natus eum maxime id vel natus sint consectetur sapiente praesentium reprehenderit nihil et enim in cumque dolor dolor necessitatibus porro rem maxime nostrum ipsa voluptatibus a deleniti libero a sed cum necessitatibus incidunt dolor atque et cupiditate eos aut architecto quibusdam sint.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-15', '2017-05-14 04:17:31', '2017-05-14 04:17:31');
INSERT INTO `lesson` VALUES ('571', '15', 'Maxime cupiditate impedit dolores non aut officiis nemo.', 'Illum voluptatum ut atque occaecati voluptatum et earum animi earum dignissimos sint aut aut omnis sed ipsam quaerat beatae quo sed sint rerum ab aliquam in rerum aperiam porro delectus laborum aut vero omnis harum repellat veritatis saepe eveniet qui rerum quas excepturi beatae quo corporis enim ex saepe rerum architecto et nam est possimus itaque voluptatem velit excepturi explicabo ut facere ipsum iure voluptatibus consequatur enim autem nobis amet quo omnis quia sint tenetur vel dolor facilis adipisci suscipit et sunt autem est eum fugit ut eveniet suscipit facilis nostrum enim doloremque maxime laudantium ab qui veritatis ea fugit qui totam qui sed enim voluptas est autem ut dolorem et est quibusdam maxime consequatur est aut tempora non eum quia ratione consequatur officiis officia sit enim dolor vel eos et esse laboriosam repudiandae voluptas.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-16', '2017-05-14 04:17:31', '2017-05-14 04:17:31');
INSERT INTO `lesson` VALUES ('572', '18', 'Exercitationem amet recusandae illo mollitia qui in aut laudantium ut ducimus.', 'Laborum enim deserunt id voluptates ipsam esse eum error numquam ut aliquid iure ipsam natus necessitatibus rerum et aut voluptatem sint sit quisquam quia voluptatem alias sint iure architecto itaque amet non accusamus beatae tempore est culpa velit magni quo iusto ullam deserunt quae est et in eaque ut velit sed et corporis fuga voluptas sit non odit alias vel minima illo est ea fugit et quod ea ut officiis facilis laboriosam libero maiores quibusdam qui aut ut voluptas quasi quas amet quia et et et possimus autem impedit et voluptatem quis est consequuntur ut soluta odit ipsa quae reiciendis excepturi praesentium sed libero placeat perspiciatis expedita atque nihil eos et animi et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-19', '2017-05-14 04:17:31', '2017-05-14 04:17:31');
INSERT INTO `lesson` VALUES ('573', '11', 'Est harum debitis dolorem esse ut porro officiis est quisquam.', 'Assumenda consequatur quo possimus deserunt consequatur distinctio quos minus deleniti unde expedita natus molestiae vel unde hic animi est repellendus aliquam placeat omnis eius exercitationem et totam modi sunt debitis maiores nesciunt aut voluptatem deserunt nihil porro totam consequatur assumenda pariatur vel incidunt consequatur quae optio sed aut et praesentium et adipisci animi corrupti assumenda animi quaerat qui error non qui optio alias iste autem inventore aut eaque reiciendis quidem temporibus voluptatem quis dolorem modi eveniet incidunt fugit unde ea aspernatur in facilis accusamus harum nihil sunt quasi omnis consequatur cupiditate.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-17', '2017-05-14 04:17:32', '2017-05-14 04:17:32');
INSERT INTO `lesson` VALUES ('574', '6', 'Deserunt rerum suscipit ipsam aut consectetur ex in cupiditate dignissimos velit.', 'Dolore culpa voluptates doloribus hic mollitia odit unde enim eaque odit consequatur incidunt mollitia odio dolores doloremque deleniti perspiciatis aspernatur blanditiis esse voluptatibus omnis minima et sit et ab voluptatem nobis et reprehenderit tempora accusamus vel quibusdam qui totam qui iusto iusto quam quis saepe sint aut voluptatibus molestiae perspiciatis asperiores ad nesciunt explicabo molestias ab quo et nobis rerum non quas dicta sit qui illum velit est velit cupiditate repudiandae exercitationem consequatur nihil at vero consequatur voluptatem eos ab illo ut nostrum eum voluptatibus voluptas beatae dolorem eius ut asperiores maiores pariatur tenetur pariatur libero id dolor dolorem amet sit quod veniam officiis quidem error ut facere et repellendus totam totam debitis quisquam dignissimos iste molestiae aut quo eius inventore quod quam natus ipsum voluptatibus nam voluptas rerum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '45', null, '0', '1', '2017-05-17', '2017-05-14 04:17:32', '2017-05-14 04:17:32');
INSERT INTO `lesson` VALUES ('575', '7', 'Qui molestias non facere et distinctio praesentium nobis molestiae.', 'Expedita in similique reiciendis et eos eligendi dicta laboriosam aut consequuntur eos corporis minus nulla repellendus voluptas assumenda commodi deserunt dolorum voluptatem minima repudiandae velit ut facilis optio voluptate aut aut ea maxime aut dolore delectus accusantium qui et sed rerum rem et perspiciatis qui consequatur ipsam aut hic est in perferendis ab perferendis consequatur sunt cumque est dolor temporibus voluptas iste et quia optio laboriosam enim blanditiis fuga repudiandae quo sit veritatis itaque voluptas ratione temporibus maiores et et et non praesentium harum quis iure ea quo labore aliquam placeat aperiam amet nihil iure quisquam sit commodi quo optio sunt voluptatibus odit eaque sit eos ea laudantium quos asperiores laudantium non corporis non aut deleniti et ex voluptatem commodi culpa quasi harum id quis quas tempore hic asperiores nam deleniti explicabo debitis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '22', null, '0', '1', '2017-05-16', '2017-05-14 04:17:32', '2017-05-14 04:17:32');
INSERT INTO `lesson` VALUES ('576', '11', 'Enim harum temporibus ut aperiam voluptas sed ut reiciendis qui.', 'Qui sunt eos omnis et quia earum nihil aperiam aut in voluptatem eveniet aut autem dolor dolore illum est hic nihil dolore quidem rem error sit hic excepturi quod reiciendis delectus velit optio porro mollitia dicta porro distinctio veniam qui rerum repudiandae quis vitae qui ut nostrum tenetur sapiente pariatur nesciunt reiciendis eius qui deserunt quia aliquid aut sequi maxime enim et omnis deserunt quia nulla et qui in.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '42', null, '0', '1', '2017-05-14', '2017-05-14 04:17:32', '2017-05-14 04:17:32');
INSERT INTO `lesson` VALUES ('577', '14', 'Veniam quia in fugiat vel.', 'Perferendis harum aspernatur aut suscipit sed quia voluptatem iste expedita aut ullam est accusantium ipsum unde minus fuga sit vel perspiciatis voluptas deserunt velit quae aut omnis voluptates necessitatibus optio recusandae aut blanditiis corrupti et provident repellendus ea quod amet laboriosam possimus ipsa dolorum assumenda in dolores nisi fuga modi at quo quia ea quisquam veritatis et necessitatibus impedit officia nostrum ratione esse ipsum provident non enim accusantium a at omnis eos aut enim hic corrupti facilis aut omnis ad minima voluptatem et labore dolorem dolor ex illum quo beatae non quae cupiditate maxime ut labore saepe alias sunt aut praesentium distinctio velit nisi ut sit doloremque enim esse et dolorum ullam ullam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-17', '2017-05-14 04:17:32', '2017-05-14 04:17:32');
INSERT INTO `lesson` VALUES ('578', '23', 'Consequatur recusandae saepe dignissimos et esse ipsum blanditiis consequatur beatae.', 'Iste blanditiis ad officiis repellat nostrum facilis qui ea et consequatur repudiandae harum consequuntur ex recusandae et sit ex architecto officiis omnis eaque eos omnis adipisci aut aut quod illum voluptatum ipsa dolore ducimus ipsam nihil quam ad ut harum voluptas totam aut qui pariatur nihil quis quibusdam minima et molestiae qui omnis incidunt fugit voluptas ea aperiam sint ex consectetur exercitationem vitae ipsa id consequatur dicta pariatur et quas ipsam ut blanditiis nam sit impedit sit quia molestiae hic iure asperiores voluptatem praesentium magni minus molestiae officia quisquam blanditiis eum ea sed mollitia vitae saepe totam quo vitae suscipit qui est omnis sit molestiae quod corrupti excepturi voluptatem adipisci similique necessitatibus consequatur ipsa et atque libero aut in ullam dolorem quae et dicta dolorem laboriosam et alias blanditiis voluptas corrupti aut ratione ut aut ut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-15', '2017-05-14 04:17:32', '2017-05-14 04:17:32');
INSERT INTO `lesson` VALUES ('579', '21', 'Rerum provident omnis maxime nihil natus sit sapiente minus.', 'Reprehenderit eaque neque quis et ea enim error similique ut est incidunt deleniti occaecati dolores ad doloribus beatae deleniti hic ut quo nisi minus fuga sequi magnam quas sed numquam fuga sed perferendis corporis perferendis velit beatae eos nulla eos ea sapiente fuga enim odit ipsum ab occaecati optio officiis repudiandae sed quasi ut et aut omnis eaque deleniti dolores vero eius laudantium dignissimos repellat debitis velit eum laudantium possimus suscipit quam labore quidem praesentium sit iste aperiam ducimus numquam quam eos quasi voluptate ipsa ut cum iure.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '36', null, '0', '1', '2017-05-14', '2017-05-14 04:17:32', '2017-05-14 04:17:32');
INSERT INTO `lesson` VALUES ('580', '1', 'Rerum laboriosam eius autem molestiae nobis.', 'Aliquid rerum deserunt repudiandae iste aut quas maxime quam facere animi facilis similique quia quod corrupti quis necessitatibus veniam corporis quibusdam eius est illo eos rerum eos aut ut veritatis cumque consectetur quaerat exercitationem maxime ad aut sequi ut nemo minus rem iusto beatae ex quia consequatur maiores ut libero sed consequatur sed molestias doloribus rerum accusamus modi saepe praesentium et nesciunt quos provident qui sit veritatis ipsam nisi nam est rerum tempore repudiandae aspernatur officia quibusdam ipsa consectetur fugit non similique voluptas aut eligendi quae quia quidem quidem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '23', null, '0', '1', '2017-05-15', '2017-05-14 04:17:32', '2017-05-14 04:17:32');
