INSERT INTO `lesson` VALUES ('582', '11', 'Accusantium esse saepe magni nesciunt qui.', 'Tempora tempora iste quod est sed iusto tempora perferendis vel qui vel magnam placeat suscipit repellendus at placeat nemo delectus ut et optio vitae distinctio qui vel aliquid quis id necessitatibus dolores et odit cumque architecto quae placeat maiores corrupti aut dolorum rerum aliquam doloremque consequatur asperiores numquam rem quo laudantium mollitia qui rerum ipsam temporibus unde maiores dignissimos minus vel nihil eveniet delectus id libero atque eligendi accusamus et corrupti velit dolor ab aut ea itaque nesciunt distinctio excepturi unde non vero suscipit et rerum rerum nesciunt magnam et accusamus ut ipsa neque impedit rerum voluptate.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-18', '2017-05-14 04:17:32', '2017-05-14 04:17:32');
INSERT INTO `lesson` VALUES ('583', '23', 'Sunt in aut hic molestias sed impedit aperiam.', 'Iste ut voluptas sed minima reprehenderit earum impedit sit necessitatibus quae optio harum itaque eligendi excepturi tempore porro natus reiciendis maiores ratione iure eveniet recusandae fugiat tempore qui non quia cum quia tempora explicabo ea et esse deleniti et quas ipsum ex quis voluptatem et ea libero quia quia omnis deleniti doloremque molestiae laborum maiores animi libero voluptatum facilis ipsa eum tempora voluptatem quidem nostrum aliquid excepturi saepe quas id rerum consequuntur rerum possimus et et odio tenetur voluptatem rem quas in temporibus explicabo quisquam unde eum vel tempore et ut magni aut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '27', null, '0', '1', '2017-05-18', '2017-05-14 04:17:33', '2017-05-14 04:17:33');
INSERT INTO `lesson` VALUES ('584', '26', 'Quia consequatur provident ut voluptas omnis voluptas nemo molestiae.', 'Consequuntur dolorem sit veniam minima cupiditate perferendis ab eos dolores laudantium molestiae et qui quis delectus eum est ipsa ex aperiam fugiat minus magnam enim quidem ea qui reiciendis accusantium sequi velit ipsa ipsa iste ducimus culpa et quis deserunt nisi iste mollitia enim sint in adipisci reprehenderit voluptates sed et error ab nulla voluptates at sunt minus aut explicabo amet soluta consectetur rerum consequatur et aut odit dolor non id iure excepturi expedita amet rem eos quia maxime cum et id est quo delectus nihil delectus esse expedita et assumenda non possimus blanditiis voluptatem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-19', '2017-05-14 04:17:33', '2017-05-14 04:17:33');
INSERT INTO `lesson` VALUES ('585', '20', 'Dolorem voluptate eum eum a sed qui voluptas magnam asperiores eaque.', 'Laborum et totam consectetur voluptatibus impedit quia ipsum sint eaque et fuga quis cupiditate quidem iste cupiditate aut possimus reiciendis voluptatem assumenda enim aliquam non non magnam provident temporibus non et repudiandae in dicta magni vero velit eveniet necessitatibus et quae quia incidunt perspiciatis at voluptas voluptates accusamus voluptas ut accusamus quae qui dicta qui dignissimos ut incidunt dolorem distinctio dicta rerum possimus tempora sed sunt et sed consectetur ratione voluptatibus et quo esse et hic blanditiis voluptas vero rerum praesentium aut modi voluptatem et doloremque facere omnis minima quidem repellat ab ullam ad modi perspiciatis perferendis quidem aut praesentium natus sunt ut voluptatem ut architecto consequuntur quia ut iste et fuga quos fuga at nobis molestiae perferendis consequatur aut harum ut enim aut quo iusto aut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-18', '2017-05-14 04:17:33', '2017-05-14 04:17:33');
INSERT INTO `lesson` VALUES ('586', '11', 'Nulla at quis accusantium voluptates minus.', 'Quia provident porro delectus nulla et enim aut repellendus et iste qui mollitia eum neque et nam delectus fugit officiis animi repellat consequatur quos veniam illo dolores dolorem tenetur nulla nemo nihil nostrum quibusdam deserunt non temporibus rerum recusandae eligendi voluptatibus necessitatibus reprehenderit ratione officia dolore asperiores placeat ut ipsa expedita odio quia sunt id in iure repellat et sunt non sed autem aut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-15', '2017-05-14 04:17:33', '2017-05-14 04:17:33');
INSERT INTO `lesson` VALUES ('587', '3', 'Sint corrupti libero consequatur occaecati.', 'Id minima commodi quidem sit dolores atque dignissimos tempore quibusdam dolores corporis quibusdam iure beatae tempore et dolores asperiores et neque magni dolor ab odit voluptatem et eos consectetur et nemo rerum nemo itaque molestiae eos debitis blanditiis vel voluptatem numquam veritatis laudantium ipsa repellendus qui fuga at quis dicta delectus et eum facilis neque corporis quia nemo qui aperiam quaerat quia necessitatibus doloribus expedita aliquid repellendus nulla quod aut et et laboriosam similique molestias et sint eligendi dolorem alias eum qui amet pariatur et laboriosam dignissimos consectetur temporibus aut voluptate alias eligendi hic.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '42', null, '0', '1', '2017-05-17', '2017-05-14 04:17:33', '2017-05-14 04:17:33');
INSERT INTO `lesson` VALUES ('588', '23', 'Nobis pariatur error libero quia unde laudantium adipisci ut expedita sint.', 'Explicabo porro quas consequatur vitae est delectus et expedita cumque incidunt ratione nobis quis et in eveniet officia amet ullam perferendis harum et alias harum quae non quod quia quasi mollitia aliquam aut quaerat fuga dolores quaerat ullam enim est eos animi quos qui est sunt molestiae nostrum et deserunt velit sapiente ut laboriosam officiis consequuntur odio quasi occaecati quas commodi omnis repellat vitae autem omnis molestiae soluta est eum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '45', null, '0', '1', '2017-05-17', '2017-05-14 04:17:33', '2017-05-14 04:17:33');
INSERT INTO `lesson` VALUES ('589', '24', 'Sunt et itaque tempora voluptatum soluta magni temporibus sed accusantium sed.', 'Quos quo quo aut sint ut distinctio quis accusamus commodi minus ut deserunt autem laborum qui delectus consectetur deleniti necessitatibus soluta distinctio nam iusto doloremque et nam vel fuga a et minima sunt vero vero molestias fugit excepturi nam qui libero repellat voluptatem nulla porro iste ut velit molestias distinctio dolor animi tempora et cupiditate aliquid sapiente facilis beatae quibusdam ut ea provident sit ea reiciendis est occaecati aliquid quae delectus sunt consequatur perspiciatis blanditiis fugit totam harum tempore libero rem architecto aspernatur nisi cupiditate dolores culpa odit rerum delectus eaque cumque eligendi excepturi iusto quas nisi sed.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-18', '2017-05-14 04:17:33', '2017-05-14 04:17:33');
INSERT INTO `lesson` VALUES ('590', '23', 'Cum similique et est et autem iure velit.', 'Corporis dolore consequatur asperiores magnam eum eveniet sapiente error quia dolorum sed eos ex laborum soluta atque impedit officia dignissimos in id corrupti voluptatem ea quibusdam officia sit velit ab modi earum placeat hic reprehenderit accusamus incidunt voluptatem facilis doloremque fugit quis est quia non non dignissimos consequatur laborum quidem totam amet minus vero exercitationem quod omnis eum voluptas velit nisi ipsa animi asperiores numquam quos ut nisi et doloremque cupiditate reprehenderit ex commodi nobis sint quia et soluta deleniti voluptatibus quis quo fuga laudantium sapiente recusandae debitis optio placeat excepturi id laudantium quae voluptatem quibusdam fugiat labore aut consequatur rem numquam quidem ut dicta et error omnis et modi accusantium id placeat qui iure voluptatem inventore.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-18', '2017-05-14 04:17:33', '2017-05-14 04:17:33');
INSERT INTO `lesson` VALUES ('591', '12', 'Occaecati et odit neque sapiente suscipit a in illum.', 'Occaecati saepe eaque mollitia ab rerum repellat est quod qui deserunt reiciendis iusto at aspernatur voluptatem ipsa labore incidunt voluptatem laboriosam natus iure sit voluptate ad mollitia quia adipisci rerum enim ut dolores qui eum ipsam delectus ea sed quam veniam modi autem fugiat provident ad aut aliquid dignissimos est quo et odit dolores architecto velit quae eos odio nihil sint sunt eos blanditiis iure corporis consequuntur pariatur sint nam qui commodi vitae quod.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-15', '2017-05-14 04:17:33', '2017-05-14 04:17:33');
INSERT INTO `lesson` VALUES ('592', '8', 'Vel nostrum ipsum nisi excepturi et.', 'Voluptas laborum ut suscipit autem qui beatae et molestiae laborum sed provident et doloremque sit optio possimus et voluptas eum vero in est voluptates id non nemo magni excepturi dolorem cum sed sit in est ex sequi accusamus veritatis omnis voluptatem mollitia sapiente sunt rerum laborum exercitationem sunt maxime doloremque voluptas aut nobis repellendus deleniti magnam deserunt et libero odio aliquid non dolores vero omnis repudiandae qui dolor voluptates cumque consequuntur ut quia saepe doloribus ea ut similique consequatur reprehenderit enim magni dolores cum in perferendis sunt eligendi sint impedit enim molestias occaecati veniam expedita nisi laboriosam deleniti distinctio vitae natus id hic dolores laboriosam fugit sit eius commodi quis ut magnam voluptatem dicta quisquam corrupti perferendis autem iusto sit consequuntur at qui et ipsam voluptatum nesciunt inventore omnis placeat illum quisquam iure aut velit eveniet unde consectetur quaerat.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-17', '2017-05-14 04:17:33', '2017-05-14 04:17:33');
INSERT INTO `lesson` VALUES ('593', '7', 'Ab esse excepturi ipsam omnis tempora qui.', 'Consectetur facere et saepe atque vel qui pariatur voluptas et doloribus dolorem autem veritatis consequatur et ipsum quia est tempora et ut debitis eligendi vel magni non reprehenderit corrupti quo esse cumque tempore reiciendis enim occaecati magni sint corporis praesentium qui excepturi ad et qui velit mollitia consequatur est explicabo praesentium id ea tenetur in quo culpa voluptatem temporibus modi deleniti aut qui veniam animi aut ipsam eum sint sed provident animi vitae sint ducimus ut eum saepe exercitationem consectetur magni eum aspernatur aut voluptates at tenetur consequatur fuga et fuga magni est necessitatibus provident vel et nam commodi numquam delectus dolores tempora dolor error iure sint odio maiores non omnis excepturi molestias id accusantium repellendus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-19', '2017-05-14 04:17:33', '2017-05-14 04:17:33');
INSERT INTO `lesson` VALUES ('594', '26', 'Quidem odio voluptates est qui nisi voluptatem quisquam sunt.', 'Praesentium quo fugit minus vitae possimus amet voluptatem quam numquam sequi voluptatem quae soluta ut et est fuga quia dolor molestiae quos hic rerum inventore est nesciunt assumenda est maxime accusamus labore eos iure qui impedit aperiam ad accusantium illum sed est molestiae nisi laborum id aut soluta reiciendis et excepturi maxime officiis dolores esse pariatur sint voluptatibus quo et voluptatem et est delectus voluptatum aut ipsa vitae eius unde ratione accusantium laborum vel fugiat voluptatem modi sed qui maiores incidunt autem aperiam magni vero eum quis neque repudiandae sint non eum voluptatem ratione corrupti impedit ut ea at atque aut consequatur praesentium explicabo rerum natus natus commodi vel fugit qui voluptas et aperiam qui alias.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-14', '2017-05-14 04:17:33', '2017-05-14 04:17:33');
INSERT INTO `lesson` VALUES ('595', '20', 'Modi suscipit laboriosam delectus non iure ea cum.', 'Eveniet id aliquam eos laboriosam officia quidem autem eos corporis tempora dolorem quaerat quas quo voluptatem qui voluptatibus id vel molestias saepe id nesciunt excepturi placeat voluptate magnam sed mollitia sed fuga libero ut ducimus necessitatibus omnis tenetur atque illo id aut cumque quia odio enim animi quisquam repudiandae quibusdam qui officiis qui mollitia dolore eos perferendis corrupti officiis veniam nulla eum eos doloribus sint doloribus aut autem velit natus quidem dolorum quibusdam molestiae quidem commodi eligendi et ut recusandae sed laborum et esse cumque suscipit optio temporibus enim ipsum praesentium aut quae sed error dignissimos ipsum voluptas optio commodi sapiente occaecati id tenetur totam vero laborum et nihil harum dolor expedita ad.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '28', null, '0', '1', '2017-05-17', '2017-05-14 04:17:33', '2017-05-14 04:17:33');
INSERT INTO `lesson` VALUES ('596', '30', 'Dolor est ullam dignissimos eaque sunt quod assumenda ut maxime aut.', 'Explicabo nisi voluptas nihil sint officiis adipisci quia vitae debitis praesentium optio sint sequi exercitationem cum non et esse mollitia tempora rem odio recusandae pariatur consequatur inventore nostrum nihil reprehenderit consequuntur eligendi ab sed ut numquam officiis laborum consequatur consequuntur tempore sunt ut ratione alias consectetur ut iure qui sint dolores error voluptatem omnis voluptatem voluptatem animi voluptatem explicabo accusantium soluta culpa accusamus beatae consequatur exercitationem quia sunt eum atque ut et explicabo est fugiat incidunt est eaque dolorem dolores ut architecto ipsum odit et officia aut beatae et magnam possimus optio ex nesciunt explicabo voluptas dicta ut corporis ipsa consequatur ex et est.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '27', null, '0', '1', '2017-05-19', '2017-05-14 04:17:33', '2017-05-14 04:17:33');
INSERT INTO `lesson` VALUES ('597', '4', 'Laborum nemo qui enim beatae voluptates quo ut cum.', 'Accusantium magni natus necessitatibus amet at et explicabo doloribus ducimus et ea quidem et quia in laudantium praesentium deleniti et suscipit non adipisci voluptas optio mollitia voluptate dicta est molestias praesentium assumenda similique et consequuntur magni officiis quidem voluptatibus nobis eos ea eveniet culpa quia est optio quam quos nihil sed molestiae quod quo sit placeat ea ut optio explicabo culpa rerum optio delectus molestiae modi molestiae expedita dignissimos ea nesciunt in accusamus quidem consequatur odit dolorem in praesentium quis quia molestiae necessitatibus et incidunt dolores et dolore ullam beatae aliquid ut quidem praesentium voluptatem magni nemo eligendi aut neque odit et possimus voluptas debitis est sit dolore eos est doloribus suscipit sunt voluptas aperiam ut incidunt qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-19', '2017-05-14 04:17:33', '2017-05-14 04:17:33');
INSERT INTO `lesson` VALUES ('598', '21', 'Dolores consectetur repellendus quidem illum vitae mollitia hic.', 'Modi qui est omnis quia eaque amet dolores provident dignissimos officiis dolores expedita illo reiciendis omnis nam dolorum voluptas quia sit molestiae provident ipsa eius molestiae excepturi at sit quia nihil velit sit sit eum sunt et aut et rem ea iste qui est id ratione velit quod ut eveniet a inventore quia id quas et incidunt dolorem et molestiae non eum aliquam officiis labore natus est deleniti atque dolor dignissimos qui sed voluptas fuga sint sit dolorem et explicabo quaerat et consequatur dolorum rerum enim voluptatum quae et sit in ipsa quis modi commodi.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-18', '2017-05-14 04:17:33', '2017-05-14 04:17:33');
INSERT INTO `lesson` VALUES ('599', '24', 'Et numquam repudiandae dolores enim voluptas ut minima dicta ex.', 'Deleniti earum ea culpa ea tempore quia in dolorum temporibus dolor commodi temporibus libero adipisci quia alias illum doloremque et sunt vero omnis asperiores tempore voluptatem sed et asperiores laudantium eaque unde excepturi aut tempora consequatur voluptatem ut qui quidem sint occaecati eveniet natus assumenda reiciendis fuga recusandae vel voluptatem officia voluptates sapiente veritatis molestiae sint assumenda molestiae amet laborum sit sit magni fuga rerum repudiandae repellendus culpa et magni repellat explicabo neque in perferendis odit tempora est saepe voluptatibus culpa fuga occaecati molestiae odio accusamus magnam quas doloremque cupiditate quo placeat eveniet et voluptatem animi nihil quidem amet consequatur et officiis accusamus voluptates ab necessitatibus quia consequatur autem pariatur qui quae ex et quaerat quam est.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-18', '2017-05-14 04:17:33', '2017-05-14 04:17:33');
INSERT INTO `lesson` VALUES ('600', '26', 'Exercitationem autem non expedita atque beatae.', 'Illum eos voluptas culpa aspernatur soluta eaque fuga iste non quos dignissimos et laboriosam incidunt dignissimos maiores in consequatur omnis provident dolorem molestias id quaerat voluptatem dolore perferendis sint adipisci distinctio atque repellendus tempora sequi sed molestiae iure expedita sed ratione saepe non amet alias dolor qui eum totam illo natus voluptas quia beatae delectus suscipit itaque optio sed ea veritatis qui vitae omnis est sequi sed ea aspernatur totam dolorum velit vero adipisci sunt mollitia modi ipsam consequatur nulla unde qui minus quasi ut quasi consequatur accusamus occaecati atque nisi officia illo et doloribus quas sed perspiciatis natus amet repellendus voluptatem sunt veniam magnam est consequatur occaecati dignissimos illum et consectetur mollitia voluptatem inventore et et officia possimus itaque qui incidunt occaecati quo aut esse ratione sit laudantium et beatae animi aperiam tempora dolor reprehenderit excepturi voluptatem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-18', '2017-05-14 04:17:33', '2017-05-14 04:17:33');
INSERT INTO `lesson` VALUES ('601', '4', 'Quis rerum consequatur architecto odio qui vitae.', 'Possimus eligendi et sit neque ut doloribus suscipit est rerum eligendi cum neque incidunt in ex provident quaerat aliquam consequatur aut ipsum aut in mollitia consectetur doloremque veritatis veritatis asperiores vero fugiat itaque voluptatem perspiciatis nisi expedita debitis sed laboriosam asperiores veniam eos qui et voluptatem est soluta aliquid nostrum est aut nihil quia error quae sed et impedit voluptas rem nam necessitatibus ex qui aperiam veniam sunt architecto ipsum labore modi optio nemo ducimus quidem laboriosam voluptates magnam quae in vel alias eos ut perferendis maiores et reprehenderit aliquid autem voluptas est fuga dolores maxime aut enim aut ut consequuntur temporibus voluptatem explicabo earum eius alias veritatis hic nulla et consequatur et aut doloribus illo mollitia similique excepturi quibusdam unde molestiae quos.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-19', '2017-05-14 04:17:33', '2017-05-14 04:17:33');
INSERT INTO `lesson` VALUES ('602', '10', 'Ut consequatur qui odit a amet est omnis.', 'Dicta nam eos eveniet magni natus soluta corrupti dolorem quidem ut cum debitis magnam qui hic aliquam quae iusto voluptatem ullam eum pariatur id rerum dolorem omnis possimus natus et explicabo et eum sed ut aut deserunt ut neque aut voluptas voluptas eum numquam fugit veniam aspernatur et ad adipisci dolores cumque in neque dolor corporis aut quis exercitationem cupiditate molestiae dolorem eum enim adipisci et in magnam eos itaque nisi quam est cumque animi et sit molestiae illo odio fuga maiores id.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '22', null, '0', '1', '2017-05-16', '2017-05-14 04:17:33', '2017-05-14 04:17:33');
INSERT INTO `lesson` VALUES ('603', '7', 'Maxime sed et laudantium et quasi distinctio.', 'Nisi enim odit consequatur et assumenda in expedita odio molestiae expedita explicabo necessitatibus non quasi asperiores eaque qui ipsum cupiditate facilis harum et aut aspernatur hic cupiditate laborum et officia ea corporis omnis dolor consectetur voluptatem voluptatibus qui iste minima consequatur nam expedita officia aut illo et ipsa dicta eius deserunt laudantium natus voluptates tempore quae atque accusantium sunt dolorum animi eos inventore odit qui veniam cum qui est in molestias unde et magni placeat consectetur vitae aliquid dolore id ipsum consequatur et quae cum dolore ipsam qui qui voluptas distinctio ut maxime nemo quos ea rerum voluptas quia dolores sint maiores.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-19', '2017-05-14 04:17:33', '2017-05-14 04:17:33');
INSERT INTO `lesson` VALUES ('604', '29', 'Est rerum cum qui ipsa autem et.', 'Dolores fugiat recusandae hic est ut fugit blanditiis sed aut numquam illo possimus reprehenderit neque corporis et et eligendi occaecati id eligendi quo officia et praesentium accusamus expedita et ipsum similique iure quas accusantium voluptas quod optio eum aspernatur tempore deleniti assumenda id consequatur magnam dolores amet qui sed quibusdam et aliquam ut asperiores perferendis ut voluptatem magni qui ea quam quod incidunt dolor est quo voluptatem et vero vel ut eum ipsam qui officiis natus at dolores maiores tenetur similique excepturi dolores laboriosam impedit minus eveniet quidem aut cum qui corrupti alias occaecati facere non numquam explicabo fuga earum voluptatem laborum vitae et voluptatem et perferendis neque porro est aut officia molestias autem eveniet nihil culpa dolores possimus beatae nostrum soluta sint aspernatur optio laborum eum labore deleniti maxime labore id delectus deserunt error unde.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-19', '2017-05-14 04:17:33', '2017-05-14 04:17:33');
INSERT INTO `lesson` VALUES ('605', '19', 'Sed ut similique accusamus consequatur itaque error ipsam fuga necessitatibus minima.', 'Qui fuga excepturi ab hic ipsam rerum quia magnam sapiente est error quae odit voluptatem et illum qui sint est nam eligendi ut expedita sed et sint magni consequuntur non maiores sapiente reiciendis quo quo eum temporibus asperiores aut delectus quis voluptas repudiandae molestias labore non ipsam id harum non minima corrupti pariatur quod vitae ipsam eveniet autem dignissimos dolorem a iusto quibusdam dolore quia impedit tempore qui est nemo asperiores fugit velit molestiae voluptate iste commodi quasi possimus et error distinctio id sed ducimus aut non odio enim molestias cupiditate dolores distinctio velit illo ab id dicta et iure libero ex nisi quia dolores ratione itaque sapiente debitis at beatae quis aut et praesentium harum explicabo ea mollitia reiciendis animi rerum esse sed non et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-19', '2017-05-14 04:17:34', '2017-05-14 04:17:34');
INSERT INTO `lesson` VALUES ('606', '25', 'Dolorem repellat id deserunt quia enim autem.', 'Itaque officiis natus et eum reprehenderit qui qui enim cupiditate voluptas praesentium eum nihil autem sapiente dolores sit omnis ex deserunt iusto temporibus rerum sunt veniam in quibusdam unde ipsa dicta ab distinctio rerum aut ratione dicta vitae culpa sed qui saepe officiis ut beatae modi possimus numquam eos et voluptas quia est amet ipsa in laudantium quis et perspiciatis est ut odio et eum eum expedita aut rem dolores porro doloremque in ea.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-16', '2017-05-14 04:17:34', '2017-05-14 04:17:34');
INSERT INTO `lesson` VALUES ('607', '25', 'Amet numquam rerum odit eum eius itaque et accusamus aspernatur facilis.', 'Quis nulla excepturi et velit optio perspiciatis voluptas quidem consectetur eaque tempora perferendis dolorem doloremque eum libero non maxime porro eaque sit eum delectus quia possimus quos eum aut facere repellendus qui ab sint sequi eos quia porro voluptatibus qui asperiores deleniti dolor reiciendis reiciendis voluptatem est ab et unde saepe laborum iste et assumenda quis dignissimos ipsam et ducimus minima a veniam a corrupti dolore voluptatem perspiciatis assumenda repellendus voluptas illum ut quas commodi sit voluptas quis nihil laborum incidunt quaerat in praesentium exercitationem magnam voluptatem corrupti aliquam est.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-14', '2017-05-14 04:17:34', '2017-05-14 04:17:34');
INSERT INTO `lesson` VALUES ('608', '7', 'Tempore sint qui quia distinctio quos.', 'Rem eum quos aut at magnam laborum veritatis quia eius voluptas exercitationem deleniti quia sapiente non eos ut quo omnis quae ad nam et consectetur qui labore quas nihil dicta soluta qui quod vitae voluptas eveniet voluptatem eveniet nihil eveniet asperiores eaque id cum et sequi ea deserunt ipsam quia similique libero veniam alias dicta dolores aut fuga pariatur vel eum vel voluptas illum vel quidem provident nam nemo nesciunt magnam consequatur delectus aut beatae recusandae tempore at occaecati ex dolorem suscipit qui repellendus distinctio alias quo tempora dolorum consequatur enim facere illum nam mollitia a facilis totam aspernatur quis consequatur libero recusandae commodi libero.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '20', null, '0', '1', '2017-05-14', '2017-05-14 04:17:34', '2017-05-14 04:17:34');
INSERT INTO `lesson` VALUES ('609', '24', 'Iste impedit quis placeat reiciendis eligendi ut debitis quam.', 'Dolorum provident aut ducimus est dolor dolorem magnam ipsam exercitationem alias alias sapiente temporibus repellendus earum iure et temporibus rem dolor ut nemo officia beatae eum ut qui qui optio occaecati rem occaecati in sunt tenetur nisi sunt illum sit aut nesciunt perspiciatis asperiores eligendi qui quasi doloremque tenetur qui molestiae architecto minima repudiandae omnis nam non tempora sunt corporis tenetur in aut qui sequi ut eligendi repellat sed itaque doloribus et unde et vel officia aut et minima ducimus libero nam facilis exercitationem molestiae porro quia.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-15', '2017-05-14 04:17:34', '2017-05-14 04:17:34');
INSERT INTO `lesson` VALUES ('610', '2', 'Porro deleniti accusamus sunt itaque repudiandae assumenda quaerat tenetur alias molestiae.', 'Maiores recusandae recusandae voluptatem magnam quos iure perspiciatis aliquam quae omnis in in qui facere sit saepe ut distinctio earum est modi in autem ut dolorum consequatur asperiores inventore aliquid ex earum qui similique ex vel similique blanditiis non voluptatibus iure rerum aut sit accusamus odit voluptas dolorem voluptatem et assumenda unde tenetur rerum aut quidem eos recusandae unde debitis non itaque.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '31', null, '0', '1', '2017-05-17', '2017-05-14 04:17:34', '2017-05-14 04:17:34');
INSERT INTO `lesson` VALUES ('611', '1', 'Et sed est illo nisi est.', 'Laborum blanditiis explicabo dolores dolorum est voluptas ut molestias voluptates et adipisci sit et quis cumque et sunt rerum quod laboriosam accusamus optio sunt ea ratione officiis consequatur enim praesentium dolores ipsa dignissimos odio libero aspernatur inventore et voluptas sunt aliquam pariatur nulla repudiandae autem nulla cumque dolore sequi iste repudiandae est dignissimos et sunt qui neque qui illo et a distinctio eos voluptatem et fuga soluta voluptatem corrupti et dolorum aut ipsa magnam qui et quo aperiam quis reiciendis quae quia dolor ut deserunt officia vel soluta dolor et sit labore qui aut quos inventore enim impedit necessitatibus aliquid maiores illo sit saepe dolorem et commodi quis ratione voluptate cupiditate ipsum vel dolore voluptatum aut sit tempore odit at aut et sequi blanditiis sit unde accusantium tempore in voluptatem hic earum quis modi dolores libero sunt corrupti quas quia sit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-19', '2017-05-14 04:17:34', '2017-05-14 04:17:34');
INSERT INTO `lesson` VALUES ('612', '6', 'Voluptas sed vitae tempora dolorem corporis dolor.', 'Nihil itaque quia pariatur nobis vel assumenda repudiandae accusantium fugiat quam nam asperiores est est voluptatibus a aliquid fugiat eos quia excepturi minima voluptas impedit excepturi quos maxime labore accusantium voluptate iste nobis non repellendus quo explicabo mollitia eius earum non qui non sed molestias ea deleniti blanditiis rerum et non libero ea aperiam aliquam ut numquam porro explicabo autem praesentium accusantium pariatur repudiandae rem recusandae aperiam quod nemo voluptate eos eaque.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '27', null, '0', '1', '2017-05-16', '2017-05-14 04:17:34', '2017-05-14 04:17:34');
INSERT INTO `lesson` VALUES ('613', '5', 'Quam odit laudantium consequatur ad cupiditate sint velit.', 'Dolores et nihil aspernatur iusto beatae natus ex sunt fugiat ratione ut earum sint totam mollitia qui saepe at iusto aliquam et odit excepturi est quod eveniet illum recusandae consequatur qui nesciunt libero illum minima maxime rerum est id corporis vero illo cupiditate molestias non aut nihil delectus possimus rerum esse dolore vero aut blanditiis optio consectetur saepe consequatur esse eos veniam rem fugiat veniam eius rerum tenetur qui ullam corporis rem cupiditate nulla mollitia in ea laboriosam qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '45', null, '0', '1', '2017-05-16', '2017-05-14 04:17:34', '2017-05-14 04:17:34');
INSERT INTO `lesson` VALUES ('614', '13', 'Inventore aut ad et maiores quo ut fugiat praesentium quis sapiente delectus.', 'Doloribus voluptate molestias quod et distinctio ea et laboriosam molestiae enim voluptatibus expedita eligendi voluptates quaerat nisi tempore quas voluptates molestiae commodi quia voluptate nihil explicabo odit iure facilis esse at consequatur exercitationem vitae dignissimos inventore molestiae tenetur omnis fugiat qui odio cum vitae molestias nesciunt necessitatibus aliquid debitis accusantium tempore ut delectus corrupti enim officiis ipsam dolorum dolores omnis assumenda deleniti accusamus consequatur molestias cupiditate sed repellat dicta sit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-14', '2017-05-14 04:17:34', '2017-05-14 04:17:34');
INSERT INTO `lesson` VALUES ('615', '11', 'Et consequatur iure aspernatur enim temporibus qui iure molestias sint sed.', 'In sunt quam sed tenetur ea cum aliquid hic ullam et asperiores accusamus aut qui voluptas ipsa quam enim qui fugit dolores sit et totam consequatur iusto hic amet veritatis ratione tempore et dolor consequatur ducimus ut dolor earum porro voluptatem est explicabo et consequatur quia corporis fuga ea quo voluptas sapiente dolor ut eaque est nulla dolores repellat deserunt aspernatur velit nihil modi vel voluptate ut eum harum ut nemo quo dolorum laudantium possimus est possimus tempora aperiam ipsa ipsum fugiat velit dolore vel qui tempore vel debitis autem omnis vitae sit maiores dolores enim perspiciatis suscipit temporibus debitis nihil fuga quo saepe quis soluta ea porro quasi quasi enim qui nulla quisquam aut exercitationem non doloremque voluptatem et accusamus dignissimos quos quidem quia impedit tempora nisi minus mollitia nam aliquid aut est dolore dolorum quia quod sunt ad consequatur.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-19', '2017-05-14 04:17:34', '2017-05-14 04:17:34');
INSERT INTO `lesson` VALUES ('616', '14', 'Blanditiis aut et laudantium fugiat nihil.', 'Eius nihil et ducimus est reprehenderit porro aliquam qui maiores error quia fuga officia minus perspiciatis rem quia quis aut aliquid dolor sunt dolor impedit repellat dolore illo maxime impedit ullam nam asperiores totam maiores aut reiciendis unde quia animi asperiores ut modi excepturi ipsum repellendus eius eveniet fuga facere incidunt totam atque ea et eos molestiae voluptatem et quo fuga iste nihil qui accusantium laudantium consequatur voluptatum ducimus itaque blanditiis voluptatibus nisi nam reprehenderit et quisquam est impedit itaque tenetur illo voluptate qui voluptatem eum commodi inventore asperiores consequatur aspernatur laborum nostrum eum qui et perspiciatis molestias harum aperiam non minus quo maiores dolorum quam optio non ipsam voluptates corrupti autem atque aliquid pariatur illum laudantium aut voluptatum labore molestiae ut sequi et vel non exercitationem amet et tempora corrupti deserunt dicta ipsum aut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '27', null, '0', '1', '2017-05-18', '2017-05-14 04:17:34', '2017-05-14 04:17:34');
INSERT INTO `lesson` VALUES ('617', '28', 'Sed eligendi delectus voluptatibus assumenda asperiores vel omnis soluta tempore iste.', 'Itaque aliquam blanditiis corrupti sit a animi cumque voluptatibus autem dolor enim consectetur neque alias temporibus adipisci alias dolore doloribus modi numquam harum dolor similique cum fuga ullam excepturi id rerum reprehenderit aut commodi eum eius repudiandae veniam praesentium nisi eos vel vel amet odio totam tempore est unde rerum dolores ea autem excepturi non reiciendis accusantium sapiente qui voluptate quaerat ut laborum neque rerum provident provident aut omnis ab ut iusto sunt laborum mollitia suscipit iusto reiciendis aut eum voluptatem porro vel animi quam reprehenderit ex aut aut minima minus velit accusamus inventore voluptatem ex ducimus et similique sunt molestiae rerum ea hic omnis eos tenetur esse sit exercitationem sit dolores nesciunt distinctio autem modi aut quia consectetur hic assumenda fugiat expedita.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '24', null, '0', '1', '2017-05-18', '2017-05-14 04:17:34', '2017-05-14 04:17:34');
INSERT INTO `lesson` VALUES ('618', '23', 'Est eaque dolore corporis libero est reprehenderit repellat consequatur architecto est.', 'Itaque enim ab laudantium velit non sunt fugit dolore est recusandae quia iusto soluta aut enim praesentium quia dignissimos quam ut tempore quam officiis eum voluptate quo cumque deserunt eligendi facere assumenda non dolorum sed corrupti nostrum qui accusantium aut itaque corporis praesentium libero voluptatem temporibus mollitia consequatur quo dolores aperiam officia dolores ea ut alias dolores iure illo atque facilis qui aut et ipsam est corrupti sunt veritatis dolorem minima voluptatum inventore expedita et quis tempore enim sed sit harum facere voluptate nesciunt magnam cumque earum repellat officiis et vel quis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-15', '2017-05-14 04:17:34', '2017-05-14 04:17:34');
INSERT INTO `lesson` VALUES ('619', '20', 'Et ad occaecati sed quidem doloribus.', 'Quibusdam ea veniam repellat eum praesentium veniam aspernatur tempora maiores alias voluptates distinctio voluptates molestias et nulla delectus reiciendis nihil porro qui voluptate aut repudiandae vel quo deserunt est consectetur ut et molestiae in culpa nulla rerum et vitae voluptas ut et quis provident quia maiores non tempore assumenda perferendis et odio aspernatur aspernatur illum exercitationem odit pariatur aut sed sed quam numquam dolores magni rem pariatur et modi ratione accusamus quibusdam voluptatem eos architecto quisquam molestiae ea rerum aut et accusamus libero sit sint nobis perspiciatis et vero culpa quo occaecati asperiores enim quam itaque deserunt omnis animi est placeat harum expedita eaque incidunt reprehenderit itaque eveniet earum ut ex rerum veritatis inventore voluptatem cum quis eum inventore distinctio cupiditate sunt ducimus numquam nulla totam eos eum veritatis modi et consequatur vitae quisquam facilis eius neque quos.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-15', '2017-05-14 04:17:34', '2017-05-14 04:17:34');
INSERT INTO `lesson` VALUES ('620', '5', 'Nobis veritatis aut vel aliquid quo at a quam ipsum omnis.', 'Magnam sapiente in autem nisi et laboriosam animi et non doloribus harum corrupti qui nostrum praesentium illum quo at voluptatem culpa eos suscipit ut qui omnis sed placeat dignissimos voluptatem voluptate fugiat illo rerum doloribus libero expedita fugit cupiditate aliquam est aperiam et a et a repudiandae deserunt velit consectetur est sit sint deserunt eveniet dolorem aut voluptatibus et inventore soluta quas dolorum eum ullam reprehenderit nobis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '30', null, '0', '1', '2017-05-16', '2017-05-14 04:17:34', '2017-05-14 04:17:34');
INSERT INTO `lesson` VALUES ('621', '16', 'Dolorem soluta maxime sit velit quod nulla aut sapiente quae.', 'Ut aspernatur repudiandae alias sed culpa qui culpa sit nam ea et ipsum consequuntur est maxime voluptas nobis ipsa voluptatem exercitationem dolorem voluptates maiores aperiam rem esse totam occaecati sit non nostrum consequuntur quia cupiditate et labore expedita voluptas eveniet id et maiores dolor voluptates et distinctio impedit nihil id iusto ea fuga aut laboriosam odio voluptatem quae harum est illo voluptas sed qui aliquam numquam voluptatem perspiciatis quia voluptatem a exercitationem veniam sit aut recusandae harum eos ut sed quasi ea quis sed vitae sequi quidem maiores autem non fugit suscipit quisquam accusantium odit vitae ea nobis non aliquid omnis id illo asperiores.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-19', '2017-05-14 04:17:34', '2017-05-14 04:17:34');
INSERT INTO `lesson` VALUES ('622', '3', 'Et illo et deleniti dignissimos necessitatibus nostrum quia modi assumenda.', 'Sit ipsum occaecati soluta est est distinctio qui iste dolorum ea soluta consequatur aliquid et sed consequatur quia sed cupiditate sunt quibusdam consequatur est non deleniti consectetur unde modi amet pariatur et debitis ad facilis ut dolore expedita dolorem corporis illo tempore saepe autem temporibus eum a voluptate illum eligendi magni qui sed repellat facilis eum maiores nihil a molestias velit aut autem veritatis qui accusamus consequatur dolorem et tempore voluptas nemo ab cupiditate occaecati incidunt quia totam sapiente commodi enim rerum aut omnis illum in dolores modi assumenda dolores occaecati ratione autem aut repudiandae vel vero sunt voluptatem inventore nesciunt hic nemo sit occaecati velit fuga ipsam est velit nostrum omnis facere libero itaque est aliquam error magnam velit error voluptate sit sit non suscipit enim quaerat earum assumenda est voluptatem aut eum illum quidem libero quidem eligendi.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-18', '2017-05-14 04:17:34', '2017-05-14 04:17:34');
INSERT INTO `lesson` VALUES ('623', '11', 'Eos sed nihil eos delectus natus ut autem.', 'Similique adipisci labore qui maiores dolorum alias eius et aperiam dolor voluptatem neque doloribus quo omnis quae sint necessitatibus doloribus optio quia neque ullam molestias alias pariatur et omnis quis aut provident soluta quo sit nam et quia dolorem quam est nisi sunt sit officiis sint necessitatibus placeat quas doloribus eos velit fuga ratione aut ducimus repellendus quia in voluptatem qui neque a magnam excepturi exercitationem nihil quibusdam fugiat tempore hic iste ut rerum non officia et et temporibus laudantium sunt architecto qui eos in possimus labore temporibus iste ut qui nam qui libero quos consequatur a distinctio autem deserunt reprehenderit molestiae fugit architecto quia iusto ut dolorum itaque accusamus explicabo veniam eius.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-18', '2017-05-14 04:17:34', '2017-05-14 04:17:34');
INSERT INTO `lesson` VALUES ('624', '22', 'Reprehenderit quas aliquid architecto pariatur et vero excepturi neque velit.', 'Est non iure aut nobis numquam sapiente qui iusto explicabo ut cumque atque reiciendis officiis consequatur corporis rem in architecto cumque corrupti omnis vitae adipisci rerum qui quo et optio asperiores rerum in ipsa qui nisi asperiores dolore minus molestiae corrupti blanditiis quo nulla maxime tenetur est quasi quo accusamus optio totam iusto nesciunt consequatur facilis ut repellat porro dolorem alias molestiae reprehenderit rerum odit ab voluptates eum voluptatem velit ut nemo suscipit ex et rem omnis modi ea culpa vitae voluptate itaque minus laboriosam rerum sit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '27', null, '0', '1', '2017-05-19', '2017-05-14 04:17:34', '2017-05-14 04:17:34');
INSERT INTO `lesson` VALUES ('625', '19', 'Fugiat enim hic molestias aliquam aut distinctio.', 'Odio sit quod voluptatem est soluta ipsam nemo commodi quia voluptatibus hic sint corporis nobis harum maxime inventore molestias eum laudantium aliquid nostrum inventore sint dolore exercitationem voluptatem consectetur officiis dolor quidem sed earum ad perspiciatis ullam rerum voluptatem explicabo exercitationem sequi commodi et nobis totam ea ex voluptate quia ratione et voluptas aut voluptatem aut est molestiae nihil odit expedita labore veniam aut repellendus temporibus modi accusamus consequuntur fugiat dignissimos quis qui ut omnis dolorum omnis et aut dolore laborum ea quia qui vel voluptate alias illo voluptas est quidem ipsam suscipit magni eveniet aut fuga illo aut earum adipisci voluptas non quis odio minima autem et illum facere dicta id qui et repudiandae ratione quo eius voluptatibus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '24', null, '0', '1', '2017-05-16', '2017-05-14 04:17:35', '2017-05-14 04:17:35');
INSERT INTO `lesson` VALUES ('626', '12', 'Qui voluptates quisquam sit veritatis tempore.', 'Alias ducimus laudantium ut nihil iste voluptatem quibusdam ut est temporibus voluptates iure fuga tempora numquam sequi cumque vitae est maiores architecto nemo totam nihil est quis architecto sunt sed est doloremque delectus provident porro autem magnam at rerum vitae cupiditate officiis repellat praesentium nemo esse pariatur ipsam possimus amet eveniet architecto ut expedita ipsa et unde placeat consectetur eos cum dolorum sint animi quia officia provident molestiae suscipit praesentium quasi vel ut doloribus optio magnam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-18', '2017-05-14 04:17:35', '2017-05-14 04:17:35');
INSERT INTO `lesson` VALUES ('627', '21', 'Laborum ratione et quia doloremque laudantium ad.', 'Explicabo in rem minima voluptates explicabo et et odio eum sequi quos voluptas voluptas enim eos optio sequi ut illum velit occaecati et harum minus sit placeat sit atque dolores libero sit ipsa illum velit exercitationem mollitia hic praesentium et id temporibus id officia voluptas velit sunt illum omnis qui impedit eaque nihil tenetur quisquam qui a et ipsum voluptas est recusandae optio deleniti aut perferendis ab cumque quasi totam tenetur rem molestiae eos velit ratione aperiam possimus tenetur voluptatem esse quasi id quia quos magni autem impedit consequuntur quod voluptatibus voluptas eveniet aut similique qui voluptatum ab exercitationem est voluptate ut ut incidunt et laudantium et quos distinctio qui accusantium sunt dicta dolorem quae architecto adipisci sit dolores cupiditate suscipit molestias laudantium suscipit cumque et sunt occaecati repellat nihil omnis amet.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '30', null, '0', '1', '2017-05-15', '2017-05-14 04:17:35', '2017-05-14 04:17:35');
INSERT INTO `lesson` VALUES ('628', '28', 'Voluptatum quaerat aut rerum illum odio occaecati.', 'Quisquam ex sunt debitis est nulla quis eligendi corrupti et nihil assumenda aspernatur ea alias aut fuga tempora est voluptatem eligendi esse eius molestiae tenetur nihil sint et nobis quaerat eius id soluta rerum aut culpa labore vel non tempora maxime deleniti ipsam quia libero tempora iusto iure quasi non sit soluta consequatur minus autem voluptatibus et saepe qui in sapiente voluptatum in illum voluptatibus aut qui odio nam dolores dolor neque aut quas odio explicabo ut ipsum asperiores totam dolor delectus est quis laborum blanditiis corporis ut unde maiores perferendis eos illo fugiat sit sunt officia modi consequatur earum delectus ipsum earum ut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-15', '2017-05-14 04:17:35', '2017-05-14 04:17:35');
INSERT INTO `lesson` VALUES ('629', '19', 'Consequatur qui molestiae et totam amet.', 'Voluptates ea qui quasi dolor nulla repellendus distinctio ex quaerat et ducimus nisi consequatur unde eveniet dicta nulla hic qui ut eaque distinctio voluptas esse ea ut consequatur non quas aperiam quo nihil veritatis distinctio et dolor id eius et corporis facere provident maxime odio repudiandae error possimus sed vel ducimus eos numquam ea voluptatem voluptas molestiae sequi esse excepturi temporibus nihil mollitia architecto harum iusto perspiciatis labore magnam consequatur et velit consequatur quo quis assumenda est quia omnis id tenetur.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-16', '2017-05-14 04:17:35', '2017-05-14 04:17:35');
INSERT INTO `lesson` VALUES ('630', '13', 'In ad voluptatibus ut facilis sit rem dolore praesentium est.', 'Repellat pariatur sed dolorum temporibus exercitationem a enim nobis dolor in et sint voluptas occaecati quia et doloremque assumenda voluptatum voluptates est nam dolore magni qui incidunt est modi voluptas aut commodi debitis quo aut neque harum enim non voluptas voluptas quos facilis molestiae totam pariatur enim reprehenderit et aut sit voluptatem ut dignissimos unde enim iure ratione ad rerum et voluptatem quo voluptatem nesciunt aliquid ea unde magnam est voluptas amet quae nesciunt sit tempora deserunt officia tempora cumque tenetur veniam odio illo molestias sit quo iste quibusdam dolorum est rerum itaque id dicta sit nesciunt labore et repellat sed voluptas.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-18', '2017-05-14 04:17:35', '2017-05-14 04:17:35');
INSERT INTO `lesson` VALUES ('631', '22', 'Enim eveniet nostrum aut amet est aliquam et dolore aliquid.', 'Tempore eum sapiente sed iste esse quia fuga beatae est quidem nobis reprehenderit est ea distinctio assumenda dolore et ex ex enim aliquid earum voluptatibus quidem aut in provident ipsa architecto repellendus quasi ut perspiciatis voluptatum asperiores ut omnis consequatur suscipit aliquam sequi et dolorem illo impedit quibusdam rerum consectetur consequuntur non ducimus facere quisquam et et nesciunt maiores qui quos sed saepe commodi sint porro et voluptates eos doloribus quia aut ullam sequi sunt sit qui est eaque qui pariatur voluptates officiis voluptatibus non.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-19', '2017-05-14 04:17:35', '2017-05-14 04:17:35');
INSERT INTO `lesson` VALUES ('632', '9', 'Et nemo qui sunt ratione illo quia.', 'Eos iste placeat modi dolores quasi quo eos earum impedit sint ut asperiores eum cupiditate veritatis ab aliquid earum est assumenda voluptatum nemo qui ut non qui porro natus ducimus sed qui omnis dicta esse commodi rerum non reiciendis et rerum sunt laboriosam animi aut sit libero cumque et consequatur reprehenderit ut aut voluptatem ea praesentium id enim repellendus eum occaecati dolor dolore natus fuga enim sit porro maiores recusandae et voluptatibus ratione tempora facilis neque assumenda nostrum vel distinctio consequuntur quasi velit provident veniam et iste nobis voluptatem sit molestiae ratione nisi dolores illum rerum et qui qui molestiae consectetur consequuntur labore et a sint dolorem id est voluptatem est.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-14', '2017-05-14 04:17:35', '2017-05-14 04:17:35');
INSERT INTO `lesson` VALUES ('633', '7', 'Modi est quos aut aliquid nostrum et nemo voluptatem architecto.', 'Blanditiis dicta ullam dolor ducimus eum cum quia quidem enim vitae aut quasi corrupti repudiandae velit ducimus iure tempora dolore id ut repudiandae error quis a et doloribus inventore quasi aliquid autem eos ratione et eos voluptas maiores architecto aut dolorem dignissimos qui vel enim aut est incidunt qui delectus officiis voluptatibus voluptates consequuntur repudiandae enim vero totam molestiae rerum quibusdam sit laudantium omnis qui et et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-16', '2017-05-14 04:17:35', '2017-05-14 04:17:35');
INSERT INTO `lesson` VALUES ('634', '30', 'Repellendus culpa aut doloribus maxime voluptas harum.', 'Expedita et molestias voluptas qui qui temporibus voluptas corrupti excepturi quo voluptatem ut nostrum et dolor eaque ad animi ducimus laboriosam consequatur quaerat et repellat eum sint assumenda facere id vel aliquam enim et ipsam architecto id doloremque quaerat est et cupiditate ex illo ducimus quia et cum minus reprehenderit ea sunt maiores adipisci id vero quasi omnis aliquid quo aut ab harum natus repellat tempore quia quia eius sunt atque voluptatem id et totam dicta exercitationem incidunt error ad dolorem doloremque beatae non ea sit minus non nobis reiciendis quibusdam tenetur repellendus voluptas dolorum aut non debitis facilis saepe itaque sint alias autem rerum eum et voluptates laudantium sunt.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-16', '2017-05-14 04:17:35', '2017-05-14 04:17:35');
INSERT INTO `lesson` VALUES ('635', '21', 'Voluptatem sit numquam aliquid provident laudantium deleniti non eos.', 'Et nobis quae facere ut repudiandae deleniti aspernatur reprehenderit facere non voluptatem dicta commodi consequatur libero sit soluta aut dicta ut ipsa repellat ullam magnam atque doloremque et autem est ex sed voluptatem optio ex libero cum pariatur voluptates suscipit maiores et officia nobis consequuntur pariatur fugit quod unde enim natus aut explicabo beatae consequatur suscipit vero culpa nemo quia quos ratione repellat magni debitis rerum sint exercitationem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-14', '2017-05-14 04:17:35', '2017-05-14 04:17:35');
INSERT INTO `lesson` VALUES ('636', '27', 'Aut distinctio aut vero quam ut reiciendis est.', 'Aliquam nihil nostrum facere perferendis qui voluptas numquam quia eos facere et quidem sunt repellendus quam ea et eum optio enim magni est rerum cumque eos praesentium explicabo eveniet quis et officia quia animi corporis voluptatem eius dolorem ut perspiciatis aperiam hic eaque rem dolor esse ut illo vitae quis tempora ea accusantium doloribus odit hic et accusamus provident quia iusto quis fugiat ut mollitia soluta consectetur fugit voluptas ipsum delectus blanditiis architecto aut totam excepturi similique cum provident consequatur aperiam fugiat culpa magnam consequatur quia sint ea sed optio explicabo iure saepe nulla consequuntur adipisci dolor qui blanditiis consequatur illum quae magni consequatur sed omnis rem qui laborum rerum cumque facilis quaerat placeat enim eos tenetur sit soluta et eveniet vel nulla ea aut eius numquam et nihil dolorem ut et et sunt.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-19', '2017-05-14 04:17:35', '2017-05-14 04:17:35');
INSERT INTO `lesson` VALUES ('637', '7', 'Aut recusandae provident ea voluptatem.', 'Corrupti est sint libero nulla tenetur labore ea qui totam corrupti libero aperiam perspiciatis corporis velit reprehenderit aspernatur quam optio iure sed corrupti perferendis laborum voluptates adipisci rem consequatur iste voluptas voluptatibus aut non exercitationem ratione qui officiis qui quos ipsa quod corrupti consequatur at adipisci exercitationem sapiente aut est ratione modi ex et non velit ullam cupiditate eveniet rem consequatur dolorum assumenda perspiciatis voluptas porro quia eos aliquid impedit dolorem unde iusto blanditiis qui sit odio ipsam rerum odio recusandae eum modi nisi enim fugit saepe qui vel dignissimos laboriosam ad.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '42', null, '0', '1', '2017-05-17', '2017-05-14 04:17:35', '2017-05-14 04:17:35');
INSERT INTO `lesson` VALUES ('638', '4', 'Quaerat ea et consectetur voluptates amet consequatur vero aut aut optio.', 'Qui sapiente et omnis sunt rem et numquam quia reiciendis quaerat eum saepe deserunt eum non rerum ad voluptatibus voluptatem tempora deserunt est dolorem quia nihil vitae iure consequatur a sit et sit quis possimus magni qui nulla ducimus aut rerum sit cum sit est totam corrupti nulla sunt qui inventore optio eos rerum reprehenderit fugit harum aspernatur soluta qui laboriosam quam vero veritatis dicta et dolorum soluta voluptas qui nostrum ut laudantium.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-14', '2017-05-14 04:17:35', '2017-05-14 04:17:35');
INSERT INTO `lesson` VALUES ('639', '27', 'Dolor reiciendis qui non magnam.', 'Velit quo earum aliquam iste omnis veniam dolores commodi veniam rerum quasi accusamus atque quis quia et velit repellat soluta aliquam veritatis recusandae vitae exercitationem quisquam sed fuga illo qui officiis neque ipsam quos tenetur impedit officia perferendis odit rerum ut dignissimos reiciendis magni quis qui veniam distinctio laboriosam quasi qui hic dolorem rerum recusandae officiis dignissimos modi rerum libero dolore voluptatem sit aut non qui repellat quo omnis consequatur ipsam rerum expedita aut neque nobis ipsum pariatur enim et id ut quisquam amet corporis quisquam vel dignissimos blanditiis sed fuga temporibus corrupti quidem beatae consectetur id voluptatem vitae occaecati voluptatem accusamus repudiandae qui tempora qui recusandae id et quia maiores sed officia ex eum amet error nemo reiciendis maiores voluptas cumque quia placeat earum eos quia.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-17', '2017-05-14 04:17:35', '2017-05-14 04:17:35');
INSERT INTO `lesson` VALUES ('640', '26', 'Eligendi repellendus dolorem consectetur dicta excepturi ut.', 'Aspernatur a est molestiae fugit nam assumenda ut cupiditate eveniet quis voluptas ipsum omnis et excepturi illo et natus iusto ratione modi aut fugiat eos voluptas saepe eum dolor impedit sit sint et impedit sint rerum iusto a sunt quia optio quo est exercitationem voluptatum quam velit nobis suscipit minima veniam id itaque minus dolore quo consequatur vero laboriosam sit exercitationem omnis ipsa dicta qui mollitia voluptatem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-18', '2017-05-14 04:17:35', '2017-05-14 04:17:35');
INSERT INTO `lesson` VALUES ('641', '18', 'Inventore nemo voluptatem quibusdam minus ut quaerat repellendus.', 'Aut ducimus facilis hic omnis minima deleniti eius est et modi deleniti veniam quibusdam temporibus aut quam a modi voluptatibus ipsam pariatur voluptatem et et minima magnam non minus rerum ducimus animi qui et consequuntur omnis magni dignissimos debitis totam est unde quas recusandae laudantium rerum nesciunt vel vel vel dolor id nisi nulla distinctio id exercitationem voluptas sint dolor nihil repudiandae nulla vero et odit eius voluptatem eos et voluptas sit ut aliquam rerum dolor quo dolore velit autem ut aperiam qui quam hic distinctio tenetur esse.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-14', '2017-05-14 04:17:35', '2017-05-14 04:17:35');
INSERT INTO `lesson` VALUES ('642', '13', 'Nostrum odio perspiciatis voluptatibus id ratione eos quae aut id.', 'Nam qui nostrum et sapiente quasi est delectus quo repellendus dicta ipsam vel laboriosam et facilis aliquam hic voluptatem sed sit minus qui veritatis est accusamus ut animi velit adipisci maxime eveniet praesentium qui dicta deleniti quo minima quisquam accusamus excepturi repellat perspiciatis et aut rerum est dolor sequi et perspiciatis repellendus aliquid molestias ipsam iste eligendi consectetur incidunt temporibus ex molestias adipisci sit omnis sed quos corrupti odit in rem pariatur in eos et odit culpa ducimus libero in et eaque quia sint maiores ut ut dolorum vel consequatur recusandae in aliquid quae quisquam et officiis consequuntur minus quasi eum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-16', '2017-05-14 04:17:35', '2017-05-14 04:17:35');
INSERT INTO `lesson` VALUES ('643', '14', 'Harum dignissimos ut ullam perferendis.', 'Ipsam id corrupti rerum ut consequatur facilis repudiandae et autem nemo laborum et laborum ipsum consequatur consequatur nam consectetur cupiditate ratione ad doloremque alias quas modi pariatur tempore quae error est excepturi autem totam odio harum earum voluptates reiciendis blanditiis numquam dolores dolorem at blanditiis delectus aut sapiente delectus quidem qui consequatur illo dolorem qui autem expedita architecto suscipit adipisci minus rerum dicta ratione eius voluptatem eligendi consectetur et sunt est aut eum soluta eos pariatur.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '42', null, '0', '1', '2017-05-15', '2017-05-14 04:17:35', '2017-05-14 04:17:35');
INSERT INTO `lesson` VALUES ('644', '3', 'Earum reiciendis et ut dicta rerum ea repudiandae est architecto asperiores.', 'Sint ea eos eaque id esse similique odit hic eius aperiam laboriosam itaque quia deleniti vero odit qui vero quaerat est impedit consectetur sed quo harum debitis mollitia consequatur ratione ad qui necessitatibus ut repudiandae recusandae ab inventore non iusto voluptates unde id ullam et aperiam neque fugit quasi iste aliquam in odit consequatur nihil suscipit dolorem ducimus sit veritatis ratione occaecati nisi id.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-16', '2017-05-14 04:17:35', '2017-05-14 04:17:35');
