INSERT INTO `lesson` VALUES ('646', '19', 'Omnis voluptatem et et quia beatae quo dolor suscipit ducimus.', 'Reprehenderit necessitatibus quos in cumque ipsum quaerat et accusantium distinctio et quod sit velit sunt dolorum totam qui quia in doloremque nobis quod adipisci exercitationem laboriosam voluptatem enim dolorem laudantium quod accusamus optio reprehenderit veritatis distinctio porro illo quo itaque aut nihil blanditiis deserunt eos minus natus distinctio ut aut ducimus sed magni eum autem dolor voluptatem accusamus autem aut odio et earum nostrum eius aut laborum qui omnis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '31', null, '0', '1', '2017-05-17', '2017-05-14 04:17:36', '2017-05-14 04:17:36');
INSERT INTO `lesson` VALUES ('647', '30', 'Vitae tempore voluptatem quaerat a sed et est dicta accusantium aliquam.', 'Ex adipisci qui laudantium quisquam qui dolore placeat sunt accusamus dolor recusandae dolor odio doloremque sit velit vero quidem amet omnis est et optio tempora aut non consequatur quo earum ab necessitatibus consequatur voluptate deserunt velit vero id corrupti officiis nemo aspernatur assumenda omnis quaerat id nobis sit distinctio sed hic deserunt aspernatur error deleniti dolor ut officiis velit quidem possimus optio repellendus aspernatur aliquid quod fuga delectus et doloribus quisquam et reprehenderit velit impedit sint est dolores quaerat ut illo tempore omnis explicabo quas aliquid omnis tempore neque velit libero fugiat quibusdam voluptates corporis magni ipsam nostrum velit quis consequuntur unde eum accusantium dolor sapiente eum qui dolores dolorem inventore aperiam expedita dolorum blanditiis aperiam error quia repudiandae odit praesentium rem sit temporibus amet occaecati in nihil.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-18', '2017-05-14 04:17:36', '2017-05-14 04:17:36');
INSERT INTO `lesson` VALUES ('648', '17', 'Mollitia quas culpa facilis quis neque omnis voluptas sit voluptatem.', 'Ab aut id voluptatibus voluptate dolorum ipsam et earum blanditiis ut est fugit voluptatem ut iste ipsa sed ad voluptatem nam corrupti in expedita aperiam incidunt et blanditiis impedit neque et et reprehenderit exercitationem reprehenderit qui deserunt sed nihil repellat et pariatur aut dolor ea aut aperiam ipsam quia debitis blanditiis dolor eius praesentium voluptatem esse distinctio eligendi aspernatur ipsum ut est quo excepturi maiores repudiandae vel quia quia aut tempore blanditiis et quia alias recusandae nesciunt est doloremque dolor nam excepturi et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-14', '2017-05-14 04:17:36', '2017-05-14 04:17:36');
INSERT INTO `lesson` VALUES ('649', '28', 'Consequatur aut est repellat nihil maiores voluptatem fugiat hic consequatur et.', 'Incidunt quod qui consequatur fuga dolore consequatur quia natus a asperiores autem dolor itaque maiores ipsa rerum ex nam aliquam enim alias possimus explicabo dolor sed adipisci voluptatem est et ad dolorem et ipsam facere assumenda quod enim facilis dicta voluptatem sint aut odit sit adipisci nemo nam optio enim doloremque mollitia tempore quos deleniti esse veniam enim autem ipsum voluptas qui cupiditate exercitationem asperiores rem pariatur dolor et velit atque quidem sequi omnis dolores harum deserunt incidunt quam non consequatur labore officiis sed distinctio eaque dolorem nam veritatis enim dolorem voluptatem hic asperiores dolorem ipsam illo sed repellat voluptas eum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '31', null, '0', '1', '2017-05-19', '2017-05-14 04:17:36', '2017-05-14 04:17:36');
INSERT INTO `lesson` VALUES ('650', '16', 'Consequatur necessitatibus et modi dolore voluptatibus soluta sed saepe aut.', 'Magnam consequatur iusto ea aliquid qui consequatur cumque nobis esse consequatur voluptatem dolorem doloribus et doloremque aut quis pariatur et voluptas molestiae earum eos placeat quia est aspernatur quo consectetur magni adipisci molestiae dolore vel dolores et nostrum porro in ad velit reprehenderit ratione voluptatem sed et ipsam sequi unde ex et libero ea est minus sed est sit tempora excepturi mollitia modi voluptatibus qui iusto possimus aut maxime dolore fugit sapiente sed.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '27', null, '0', '1', '2017-05-17', '2017-05-14 04:17:36', '2017-05-14 04:17:36');
