INSERT INTO `lesson` VALUES ('652', '1', 'Voluptate ducimus autem qui id earum rerum in iusto.', 'Aut inventore modi doloremque sed velit asperiores exercitationem quasi enim aut id iure repellendus quod blanditiis dolore delectus vitae animi saepe enim voluptatem qui cumque quia tempore laborum ut earum occaecati blanditiis quia qui est ea libero exercitationem maiores vero vitae alias illum non pariatur est aut esse fugit ipsa natus debitis error soluta quia saepe quidem minus fuga ut est minima velit eveniet.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-15', '2017-05-14 04:17:36', '2017-05-14 04:17:36');
INSERT INTO `lesson` VALUES ('653', '20', 'Molestiae culpa est sapiente eligendi voluptatum.', 'Et adipisci sunt nihil nulla reiciendis reprehenderit amet qui quidem amet quis quis alias architecto ab adipisci dolorem itaque excepturi sit et quibusdam possimus aspernatur nostrum qui et consequatur sequi tempora maiores asperiores voluptatem eum harum quia qui quam rerum autem culpa architecto iusto eligendi facere voluptatem nemo quibusdam numquam animi voluptatem officia provident cum aliquam officiis eveniet enim nemo autem minus voluptate doloremque quo consequuntur voluptas enim consequatur suscipit doloremque sit nam est laudantium et et asperiores aliquam cum autem voluptas alias qui omnis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-17', '2017-05-14 04:17:36', '2017-05-14 04:17:36');
INSERT INTO `lesson` VALUES ('654', '27', 'Cumque aspernatur enim quae aut quasi recusandae veritatis.', 'Praesentium ut sint quas aliquid qui at atque hic optio molestias minima reiciendis aliquam voluptatem aperiam perspiciatis qui inventore incidunt aut iste veritatis veniam tempora ut nulla similique porro magni sint quo reiciendis est est est qui eligendi corrupti quasi ea architecto odit a perspiciatis ut id accusantium ea debitis dignissimos eum aut quam doloremque nam fugiat sunt ipsa cumque consectetur aut id vel aliquam praesentium quis aut ut et est magnam error labore praesentium et iusto cum quis quia suscipit hic labore quis cumque inventore eum ad iure at qui ipsum quia aut nisi odit omnis non dolores adipisci sed ut sapiente repudiandae quas.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-14', '2017-05-14 04:17:36', '2017-05-14 04:17:36');
INSERT INTO `lesson` VALUES ('655', '12', 'Doloribus voluptates quae eveniet dolor exercitationem porro exercitationem qui earum.', 'Ut sequi nihil ut voluptatem enim eaque qui nulla odio repudiandae excepturi adipisci perferendis sunt perspiciatis at voluptas cupiditate quaerat velit voluptatem eveniet eum et officiis nemo asperiores earum ipsum illum magnam iusto iste repellendus ea veritatis dolores repudiandae in enim est veritatis nesciunt omnis aut autem sit non unde qui et quam qui quibusdam quam neque sit reprehenderit dolor mollitia sequi veritatis vero qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '39', null, '0', '1', '2017-05-17', '2017-05-14 04:17:36', '2017-05-14 04:17:36');
INSERT INTO `lesson` VALUES ('656', '18', 'Ut qui quaerat dolores accusantium qui commodi deleniti quia.', 'Eos consequatur enim et culpa tenetur tempora ad et sed necessitatibus occaecati impedit accusamus eum occaecati neque architecto hic quasi repellendus sed sequi culpa iure libero ea natus sunt consequatur aut rerum culpa laudantium quas et praesentium iure libero voluptatum odio id et assumenda et et officiis est similique libero quo cumque harum voluptas quod et aut officia consequatur debitis ex.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-19', '2017-05-14 04:17:36', '2017-05-14 04:17:36');
INSERT INTO `lesson` VALUES ('657', '6', 'Delectus quia laboriosam aut itaque non.', 'Voluptatem perspiciatis aliquam et labore molestiae dignissimos nulla praesentium consequatur et nisi qui et nemo nostrum et accusantium debitis iusto ducimus magni quos placeat aperiam totam temporibus qui accusantium expedita pariatur odit praesentium aspernatur enim quis architecto eum qui mollitia qui culpa eligendi quasi dolor pariatur ratione non error numquam voluptas sit labore odio in facere perspiciatis unde culpa distinctio harum quisquam dolorum voluptas magnam expedita veritatis eligendi pariatur in accusantium qui ut aut et sed similique porro et est beatae adipisci atque incidunt voluptatibus sed et et laboriosam est ipsum reprehenderit dolorum impedit consequatur magni eveniet sunt debitis optio vel ratione dolore beatae ad ea pariatur architecto blanditiis est omnis libero expedita nulla ut modi repudiandae commodi commodi sit eveniet blanditiis qui facilis dolore.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '28', null, '0', '1', '2017-05-15', '2017-05-14 04:17:36', '2017-05-14 04:17:36');
INSERT INTO `lesson` VALUES ('658', '14', 'Non tempora qui inventore aliquam doloremque distinctio aliquam.', 'Quis voluptates architecto tempore perferendis eius maiores consequatur sed non magni adipisci dignissimos error vel molestias harum iste excepturi est expedita perferendis rerum qui qui asperiores ut accusamus perspiciatis enim voluptas ut consectetur aut cupiditate perspiciatis temporibus ea porro omnis nemo voluptas nesciunt qui et omnis voluptas eveniet doloremque nihil ipsa enim odio ad provident et autem minima autem harum ea vel sunt est at rerum modi eos hic doloribus enim omnis explicabo libero animi atque nobis et vero debitis cumque blanditiis omnis dolore perspiciatis ut reprehenderit vel.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '36', null, '0', '1', '2017-05-17', '2017-05-14 04:17:36', '2017-05-14 04:17:36');
INSERT INTO `lesson` VALUES ('659', '18', 'Adipisci tempora ab aut excepturi omnis voluptatem sit non error eum.', 'Asperiores rem maxime et quidem voluptate harum eveniet quis tempore voluptatum beatae eum fugiat aliquam similique ducimus sint illum autem sequi tempore dolores accusamus a vitae ut suscipit sunt autem et ad repudiandae nostrum ducimus harum aut et non quia cupiditate illum laboriosam tempore debitis voluptatem explicabo quibusdam praesentium impedit consequatur omnis quo est molestias in cumque laborum eos odit voluptas quasi delectus ex ut dolore numquam qui optio repudiandae repellat ullam hic et in dicta voluptatem iure odit ipsam unde et qui quo expedita et vitae velit illum dicta ullam recusandae eius aspernatur voluptatem dolorum ut quaerat.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '24', null, '0', '1', '2017-05-15', '2017-05-14 04:17:36', '2017-05-14 04:17:36');
INSERT INTO `lesson` VALUES ('660', '12', 'Itaque laudantium numquam dolorem consectetur sapiente nobis asperiores aut aut.', 'Labore minus et quis quasi qui aliquid sequi dolorum repellendus amet ea et inventore tenetur doloribus beatae blanditiis quam aliquam quos et aut cum voluptas dicta sit sint officiis exercitationem qui ducimus impedit nisi sequi dolorum vel et recusandae rerum iste unde eligendi id nesciunt dolore suscipit eos sapiente repellat nesciunt placeat adipisci aperiam ipsa et exercitationem hic nobis quia dolores voluptate nesciunt laborum dolorem ad eos rerum ipsam quia qui reiciendis enim fuga quasi laborum porro voluptas voluptates doloremque repellat eum a est eius qui repellat molestiae quo quam saepe officiis voluptatem tenetur blanditiis voluptas voluptas error inventore praesentium dolorem facere.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '20', null, '0', '1', '2017-05-16', '2017-05-14 04:17:36', '2017-05-14 04:17:36');
INSERT INTO `lesson` VALUES ('661', '24', 'Quis numquam cum recusandae vitae sequi ea.', 'Quasi quibusdam quas dolorem eveniet inventore consequatur et quidem maxime et odio dolores architecto repellendus reiciendis architecto sunt reprehenderit aut magni debitis ipsum nobis quia fuga atque at praesentium ut eos dicta illum a in deserunt nam ullam quo autem in quia molestias sed voluptatibus nemo rerum quis in veritatis ipsam dolor nemo quis inventore soluta nulla illum voluptas eaque harum qui officia qui est est consequatur consectetur facilis quisquam est minima ut expedita dolorem aut quam magni fugit ea voluptate tempora qui in ab voluptatem id quia officiis et odit cupiditate et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '36', null, '0', '1', '2017-05-16', '2017-05-14 04:17:36', '2017-05-14 04:17:36');
INSERT INTO `lesson` VALUES ('662', '5', 'Consequatur in aut cumque et in.', 'Aut perferendis facilis non veniam odit ratione non non ipsam dolores quidem dolore dolores sint autem vero est est et eius facere ea laboriosam doloremque sunt cupiditate fugiat reprehenderit aut quisquam placeat omnis ut voluptatem nemo officia reiciendis eaque numquam nihil sint molestiae est dolorem doloremque ea sint doloremque aut corporis suscipit quae corrupti impedit quasi repellat et asperiores qui omnis ut consequatur repudiandae magni ullam eligendi minus et non explicabo excepturi.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-15', '2017-05-14 04:17:36', '2017-05-14 04:17:36');
INSERT INTO `lesson` VALUES ('663', '4', 'Ut iure ipsa veniam labore.', 'Temporibus voluptates quam ea cum non culpa in sit et consequatur est officia tenetur eum sint sunt ut omnis ut aut nemo optio rerum consectetur voluptas tempora at odio consectetur ut sed dolor autem atque voluptas eius architecto eum corporis quia animi nemo quia amet minus ex fuga laudantium autem eveniet quia et labore quas voluptatem impedit ducimus fugit eos ducimus exercitationem cupiditate in dicta omnis enim earum fugiat est animi sed quaerat sequi facilis eligendi exercitationem et illo et inventore quo assumenda recusandae enim facilis qui eum deserunt sequi recusandae consequatur laboriosam quia tempora voluptas non omnis accusamus quo et ducimus eveniet vitae delectus eligendi quia voluptates eaque ut ut minima nobis rem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '30', null, '0', '1', '2017-05-19', '2017-05-14 04:17:36', '2017-05-14 04:17:36');
INSERT INTO `lesson` VALUES ('664', '10', 'Soluta odio quo minus id qui et quisquam.', 'Qui eum nihil minus cupiditate ipsa sapiente eveniet aut illum quia nulla qui velit aspernatur qui vero repellat in quo mollitia explicabo assumenda ipsam repellendus quae commodi fugit vitae harum velit cumque non est voluptatibus consequatur nostrum ea fugit deserunt dicta voluptates tempore quia eos nam fugit aut atque vitae sint dolores molestiae perspiciatis dolor quo molestiae molestiae ex dolores labore architecto at tempore quis doloribus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '20', null, '0', '1', '2017-05-16', '2017-05-14 04:17:36', '2017-05-14 04:17:36');
INSERT INTO `lesson` VALUES ('665', '18', 'Amet possimus officiis sunt dolores eum quam praesentium dolorem.', 'Laboriosam commodi est minima aut provident et ipsam quia dignissimos dolor temporibus quasi voluptatem expedita omnis maiores nam ut impedit ullam aut officia aut cum est porro neque veniam aut eaque consequatur accusamus sit dolores corporis odit in ad vero laudantium qui eum ut dignissimos veniam dicta saepe molestiae itaque ut ea nemo sed excepturi delectus ut adipisci possimus minima eaque doloremque natus quia eaque omnis est aut quasi ratione mollitia sequi ut ad quia aut iusto pariatur facilis ipsam minus sit debitis quam et dolor molestias nihil quia quo eaque iusto non magni consequatur et tenetur non natus placeat corporis facere et illo voluptas minus exercitationem sed beatae nihil sunt eos eaque animi ipsa voluptates alias nobis commodi ut culpa quia deserunt debitis eos tempora quia ab animi qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-15', '2017-05-14 04:17:36', '2017-05-14 04:17:36');
