INSERT INTO `lesson` VALUES ('667', '23', 'Quae reiciendis ea magni ducimus corrupti optio quasi delectus.', 'Aperiam laboriosam culpa itaque quia optio perferendis similique sapiente voluptas laborum qui nulla voluptas ratione vel dolorem fugit veniam eum ut sit nihil rerum excepturi perferendis sequi totam vero voluptatem autem itaque incidunt ea voluptas sit minus accusamus possimus quia animi alias ratione porro beatae optio quisquam veritatis aut dignissimos ab inventore quae non et aliquid ut iusto atque aperiam quis aperiam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-17', '2017-05-14 04:17:36', '2017-05-14 04:17:36');
INSERT INTO `lesson` VALUES ('668', '2', 'Hic aut velit doloremque nostrum laborum et amet eligendi suscipit.', 'Recusandae rerum porro veniam blanditiis autem voluptas beatae modi consequuntur deserunt eum ullam consequatur molestias tenetur possimus distinctio ut voluptatem aut atque neque aut repellat commodi qui possimus maiores officia atque aut saepe quis aliquam quasi amet harum expedita ab et excepturi dolorem quam qui inventore quia quisquam accusantium incidunt veritatis eos ut ad consequatur doloremque reprehenderit eius reprehenderit dolores blanditiis et ut et ea minus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-16', '2017-05-14 04:17:36', '2017-05-14 04:17:36');
INSERT INTO `lesson` VALUES ('669', '26', 'Consequatur assumenda quis ipsam atque dolor consequatur quia magnam distinctio modi nihil.', 'Odit officia labore quo qui esse autem sunt quia qui est ducimus accusamus veritatis ut modi sit eius qui quo reiciendis dolor nemo velit explicabo mollitia doloribus ratione vel dolore molestiae aut sunt eius sint dolorum consequatur sint est consequatur necessitatibus quibusdam dolorem ut eveniet est quo incidunt expedita repellat id voluptas at optio reiciendis unde perspiciatis impedit corrupti velit id atque nemo quasi placeat mollitia non nesciunt beatae illo distinctio velit accusamus dicta aspernatur sed quasi aliquam molestiae nemo quam voluptate tempore sequi ratione quia.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-16', '2017-05-14 04:17:36', '2017-05-14 04:17:36');
INSERT INTO `lesson` VALUES ('670', '13', 'Laudantium aliquid assumenda consequatur omnis ratione.', 'Non reprehenderit a placeat error veritatis excepturi sunt adipisci quae iusto exercitationem nihil dolorum dolore omnis minima ad et fugit eaque deleniti pariatur ut autem aut modi provident consequuntur sit sed vel commodi illum neque quis quam sunt omnis maxime voluptate eum qui voluptatum et iure laboriosam iste laboriosam qui quod rerum repellendus est enim non aut inventore maiores deleniti rerum modi.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-18', '2017-05-14 04:17:37', '2017-05-14 04:17:37');
INSERT INTO `lesson` VALUES ('671', '10', 'Cumque ut molestias molestiae quis laboriosam nobis quidem perferendis quos sit eos.', 'Dolor non aut quam esse velit voluptatum hic facilis id dicta culpa qui dolorem qui aliquid velit quia iusto aut nemo earum autem eos eaque incidunt et qui quia quam voluptatem dolores qui dolor vero rerum nihil sunt rerum et voluptate optio vel atque aliquid dignissimos dolores et iusto vel voluptatibus tempora aut eveniet asperiores sed ad delectus ut ut cum earum est alias quae quia vitae dolorum mollitia facere impedit maiores deserunt eveniet ducimus magni quia molestias iusto tempore numquam dolorum quas ipsam id eos voluptatibus omnis temporibus qui error est iste est odio aspernatur aperiam eligendi illum corrupti ipsum pariatur nobis esse libero hic consequuntur eveniet sunt tempora eligendi ex error repudiandae qui dolorum sint mollitia accusamus minima est omnis perspiciatis quis pariatur omnis qui et tempore corrupti facilis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-18', '2017-05-14 04:17:37', '2017-05-14 04:17:37');
INSERT INTO `lesson` VALUES ('672', '5', 'Similique harum fugit laboriosam voluptatem sunt.', 'Ea et commodi vel nemo sunt autem et recusandae voluptas fugit modi sed et nulla dignissimos soluta fugiat pariatur pariatur tempore ut non fuga nulla ullam nemo aut qui aspernatur reprehenderit voluptatibus nostrum quia debitis nobis velit neque velit ea ea iure quis necessitatibus rerum est qui dolor vero modi enim quasi non voluptatem aut voluptas et cumque cum sed repudiandae animi eum ut minus vel vero ad voluptas expedita ut non sint impedit ipsa doloremque aliquam ipsam expedita rerum enim praesentium dolore aut necessitatibus omnis voluptas eos temporibus necessitatibus fuga esse ut necessitatibus autem expedita vel at sit consectetur in enim cum qui asperiores et est et vitae quam corporis non dolores corrupti ducimus harum eum et qui et dolorem deleniti velit harum maxime eius magni cumque recusandae corporis ad dolorem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-18', '2017-05-14 04:17:37', '2017-05-14 04:17:37');
INSERT INTO `lesson` VALUES ('673', '26', 'Expedita id saepe aut quibusdam est repellendus voluptates consequuntur qui ex sunt.', 'Iusto qui recusandae reprehenderit est corrupti deserunt quia ut vero provident voluptas id numquam nobis officiis est beatae perspiciatis cumque ipsam cumque qui possimus autem laborum dolor fugiat et suscipit consectetur ratione odio non quia nobis saepe quia aliquam mollitia quaerat tenetur sit quidem ad iste nisi est cupiditate magni fuga dolore culpa quos a dicta quas dolor qui porro perferendis esse minima qui numquam corporis reiciendis quis ut in similique impedit error quasi commodi totam fugit amet deleniti quaerat sed vero et qui quam culpa nobis delectus et eligendi a consequatur maxime fugit laudantium dolore voluptas ut animi ab qui error aut et provident quam quibusdam ut quis eligendi ut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '27', null, '0', '1', '2017-05-17', '2017-05-14 04:17:37', '2017-05-14 04:17:37');
INSERT INTO `lesson` VALUES ('674', '25', 'Quia eligendi repellendus veniam illo amet eos et aperiam cum.', 'Tempore quaerat et libero vel reprehenderit recusandae minus quia sint architecto reiciendis quia aut ut illum modi et in possimus eos ut labore sit cum non quod minima fuga rem voluptas voluptate qui officiis ut magni tenetur fuga architecto facilis quidem nostrum tenetur labore culpa autem vitae est repellendus quos ut voluptatem quae eius et eaque nulla nisi dolorum repudiandae sed illum nobis unde id ut nihil dolores ducimus cumque dignissimos perspiciatis repellat explicabo enim expedita qui id voluptatibus consequuntur velit ex cumque id culpa repellendus voluptas doloremque et aliquam atque eius vel vel eum laboriosam in et quasi facere eos quia iure nostrum consequuntur vel delectus quia ad non perspiciatis est accusamus aut voluptas laudantium.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-18', '2017-05-14 04:17:37', '2017-05-14 04:17:37');
INSERT INTO `lesson` VALUES ('675', '21', 'Ut vel quia dolorem consequuntur id consequatur aspernatur.', 'Quaerat ut et eum officia expedita odit blanditiis nisi quia consequuntur non quibusdam magni ut ex ducimus sint magnam cupiditate expedita et minus sed nam rem fuga ex reiciendis fuga sint sit deleniti sit eos doloremque distinctio est porro nihil voluptatibus sapiente dolor facilis veritatis quia perferendis consectetur consequatur in pariatur laborum harum quod sint aliquam occaecati adipisci voluptas facere earum tempora sint nulla dolorem voluptatum optio inventore et quisquam fugiat molestiae libero deleniti earum aut tempore culpa quae ut nobis quisquam qui voluptate sed consequatur vel aut consequatur quia a reprehenderit non esse qui ut libero odit aut laboriosam omnis quia blanditiis sunt est ea nemo nostrum ut minus est natus aperiam consequuntur et id tenetur ad deleniti suscipit aut quibusdam aut dolore non eos aliquam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-17', '2017-05-14 04:17:37', '2017-05-14 04:17:37');
INSERT INTO `lesson` VALUES ('676', '12', 'Corrupti error est alias ea in molestias.', 'Autem assumenda et sapiente architecto qui eum blanditiis ipsum quas cupiditate et ratione maiores quo cum dicta in quis enim ea laboriosam tempore quasi blanditiis voluptatem alias non consequuntur sequi vero animi vel sunt iusto qui omnis nulla voluptas omnis rerum neque dolor rerum eligendi et quia eum necessitatibus rerum hic molestiae illo necessitatibus dolore dicta error velit totam sed et dolor et autem aut esse adipisci et distinctio consectetur veniam est reiciendis iure harum velit non non pariatur unde sunt velit ut ipsa maiores aut voluptas quidem deleniti.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-16', '2017-05-14 04:17:37', '2017-05-14 04:17:37');
INSERT INTO `lesson` VALUES ('677', '23', 'Laborum autem blanditiis ex consequuntur praesentium quas.', 'Aliquam officia excepturi sapiente non quia minus qui enim sequi qui porro veniam unde ullam voluptates dolorum qui molestiae cum est eum perferendis velit quae voluptatem asperiores sint corrupti reprehenderit et eligendi aperiam commodi distinctio dolores sed qui dolore pariatur eius sequi consectetur et distinctio sit error nobis illo quisquam ipsum minima incidunt nam nemo impedit et culpa eaque ut error quis expedita temporibus aut eaque odit exercitationem architecto in deserunt asperiores at qui aperiam rerum similique tempora omnis enim ea nihil nesciunt quis aut ut ut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '47', null, '0', '1', '2017-05-19', '2017-05-14 04:17:37', '2017-05-14 04:17:37');
INSERT INTO `lesson` VALUES ('678', '29', 'Consequatur itaque eos delectus aut temporibus et laudantium iusto provident sit.', 'Tempore in non et et animi reprehenderit ipsa quae odit quos magni quidem ut magnam doloribus ratione ullam nobis officiis ullam qui itaque itaque exercitationem et facilis voluptates pariatur rerum pariatur fugiat perspiciatis quisquam quo sit facere dolor iure quaerat ratione ut molestiae modi eligendi eos explicabo laborum est est fuga numquam assumenda vitae quia eligendi voluptatibus labore omnis voluptatem animi illum voluptatem ea sint et provident necessitatibus doloribus culpa accusamus corporis aut voluptate dolor quas dicta sed dolores quod ipsa laborum placeat quisquam distinctio adipisci quos placeat cumque consequuntur eius provident sed eveniet aut debitis alias quam aut vitae amet.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-18', '2017-05-14 04:17:37', '2017-05-14 04:17:37');
INSERT INTO `lesson` VALUES ('679', '13', 'Debitis at sed sit sequi voluptas itaque culpa optio eum.', 'Debitis qui quibusdam tempora eos quis illo totam quos omnis architecto qui sit sit repellat consequatur laborum voluptatem fugit nostrum atque error fuga et ratione qui sunt sit ipsam expedita autem aspernatur totam rerum facilis facilis culpa qui numquam modi velit autem omnis mollitia iure cumque illo quis sunt doloribus explicabo officia nihil est qui quis nemo voluptas asperiores eum et odit repudiandae iusto in dolor atque sapiente culpa.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-17', '2017-05-14 04:17:37', '2017-05-14 04:17:37');
INSERT INTO `lesson` VALUES ('680', '13', 'Quod velit quo perferendis aut est aliquam.', 'Sint debitis et maxime porro sapiente aut iusto aut architecto eligendi nostrum quia nostrum eos odit suscipit quam dolorem odit et quaerat tempora odio cumque necessitatibus est qui nisi recusandae accusamus minus eligendi recusandae qui ut facilis id sunt aperiam nesciunt et magni maiores animi non nobis omnis nesciunt ab repellat ab perferendis quia quo commodi itaque omnis dolores voluptatem non et mollitia fugiat facere dolore nulla maiores quas enim veniam non sit harum beatae dolorem natus officiis fuga ut delectus ratione nihil et eligendi eum ut voluptatem eaque fugit quo sed dolorum eligendi eum rerum magnam officia aut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-19', '2017-05-14 04:17:37', '2017-05-14 04:17:37');
INSERT INTO `lesson` VALUES ('681', '23', 'Qui ullam voluptatum eum natus nam.', 'Et numquam vero architecto vel quo nisi ullam mollitia libero fugiat dolorem est voluptatibus in minima pariatur eum unde nostrum quod qui est non qui maxime ut assumenda quam maxime perferendis eaque fugit ipsum corrupti hic eum voluptatibus dolorem illo et quasi ab in exercitationem cupiditate enim qui dolor non dolorem error laboriosam voluptatibus ab architecto maiores quo eius quisquam commodi aut et rem quidem blanditiis rerum ut saepe laboriosam omnis sunt asperiores voluptas.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '39', null, '0', '1', '2017-05-14', '2017-05-14 04:17:37', '2017-05-14 04:17:37');
INSERT INTO `lesson` VALUES ('682', '9', 'Nam consectetur laboriosam ut est nulla.', 'Hic quia voluptatem voluptatem quam illo fugiat in repellat quisquam sit nesciunt rerum rerum totam aut sed consequatur dolorem veniam omnis autem tempora cumque dolor qui eaque odio ea earum ratione aut dolorem maxime sit consequatur itaque nihil enim eum sit labore voluptatem quia ad ut atque ratione consequuntur optio cumque minima vero maiores facere ullam fuga qui rerum fugiat eligendi nisi consequuntur nisi pariatur qui cupiditate aut deserunt tempore fuga ipsum perferendis delectus est expedita quisquam deleniti aspernatur qui sit cupiditate et laudantium deleniti omnis quibusdam explicabo eligendi non laboriosam sapiente qui nulla est laborum et in fugiat explicabo maxime distinctio sunt vel dolores illum veniam voluptas repellendus ut sint sequi harum excepturi quia magnam sunt quod dolores minima voluptatem suscipit quo et nemo quis cum nam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-18', '2017-05-14 04:17:37', '2017-05-14 04:17:37');
INSERT INTO `lesson` VALUES ('683', '13', 'Dicta laudantium at unde saepe dicta porro dicta sequi.', 'Fugit ex possimus non recusandae consequatur blanditiis animi qui ut non molestiae explicabo possimus illo culpa nemo ab qui ut delectus est voluptatum quia temporibus pariatur velit iste reiciendis praesentium enim aut omnis nemo libero deleniti voluptates et sapiente est culpa debitis possimus commodi animi rerum expedita at vel quis omnis sit et soluta dolorem officia quod et molestiae est placeat praesentium qui veritatis voluptate voluptate voluptates est neque minima consequatur occaecati doloribus deserunt sit facilis in earum aut sapiente et accusantium voluptate quia fugiat ipsam rerum quas praesentium nesciunt amet ipsam voluptatem voluptates numquam explicabo vel voluptatem voluptatem nihil quasi quia vel neque incidunt accusantium omnis sit earum sed facilis ipsam iusto alias est aut et eos similique totam qui unde tempore corrupti architecto eos dicta similique sapiente voluptatem eveniet quia rerum animi nulla dignissimos nihil.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-14', '2017-05-14 04:17:37', '2017-05-14 04:17:37');
INSERT INTO `lesson` VALUES ('684', '16', 'Est neque sed voluptatem aut pariatur dolor cum officiis.', 'Quidem ut excepturi quisquam sint deserunt nihil nulla odit aut exercitationem consequatur maiores hic omnis fugiat fuga illo maiores nihil nisi unde reiciendis culpa iusto sunt eum id quibusdam officiis labore nulla ducimus voluptate quae culpa dolor voluptatem quia ducimus et nobis tempore mollitia rerum corrupti tenetur possimus maxime voluptatem veritatis autem velit aut et mollitia aliquid itaque voluptas et qui doloremque enim in rerum odio molestias excepturi repellendus sint est hic nesciunt at recusandae sit qui non cupiditate harum sit possimus beatae ut dolor consequuntur.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '42', null, '0', '1', '2017-05-17', '2017-05-14 04:17:37', '2017-05-14 04:17:37');
INSERT INTO `lesson` VALUES ('685', '12', 'Omnis suscipit fuga aperiam illo corporis illum vel sint odit iste.', 'Sapiente cupiditate necessitatibus quae culpa nam error rerum commodi ipsa dolor omnis sequi ea ratione dolores laudantium reprehenderit qui eos fugit debitis ipsa error beatae omnis quidem amet asperiores nihil veritatis enim blanditiis aut illum tempore fugit molestias aut quos et maxime ratione nihil sit qui at eum aut sit dolore harum et est quia rem impedit veritatis ab et illum ut in quibusdam culpa atque tempora qui est quis facilis sed rerum excepturi pariatur et esse alias fugiat non sunt voluptatem tenetur ratione eos.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-15', '2017-05-14 04:17:37', '2017-05-14 04:17:37');
INSERT INTO `lesson` VALUES ('686', '8', 'Voluptatem voluptas non vitae nostrum et quas a sapiente ab praesentium veniam.', 'Optio blanditiis rem maxime dolorum ut optio sequi architecto excepturi omnis quisquam dolorum repellendus assumenda non veniam repudiandae beatae odit dolor earum animi voluptatem alias voluptatem reprehenderit quia laboriosam nam possimus veniam aut amet pariatur dignissimos non quia accusantium aut ut et voluptatum sed ipsam eum porro illo inventore numquam qui repudiandae sed dicta quis molestiae saepe fuga libero voluptas et qui veniam voluptas ipsam dolor sit occaecati magni nostrum explicabo possimus quia quia ut magnam rerum omnis est dolor dolores necessitatibus explicabo deleniti aspernatur consectetur alias adipisci eos esse itaque est dignissimos sunt sint in ut explicabo a omnis ad aspernatur eos atque odit voluptates aliquam fugiat quia sint molestiae et in dolor aliquid exercitationem qui voluptates delectus qui id sint esse suscipit ut ullam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-17', '2017-05-14 04:17:37', '2017-05-14 04:17:37');
INSERT INTO `lesson` VALUES ('687', '8', 'Dicta quia ratione officiis nisi dolor.', 'Ducimus quam voluptatum dolores reprehenderit omnis vitae consequatur tempore et sed optio mollitia corrupti et ea ratione quam illum ut qui rem veniam vitae est tempora et veniam error quo laborum sint voluptatum quam consequatur exercitationem ea dolores consectetur nemo ad fuga consequatur illum tenetur in voluptatibus vel vel consectetur sint quisquam cum fugit occaecati minus et ipsa ut optio deserunt placeat explicabo officia doloribus nostrum nihil vero et consequuntur quo perspiciatis blanditiis ut sed et sapiente vitae ex qui ipsum modi nulla dolorem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-14', '2017-05-14 04:17:37', '2017-05-14 04:17:37');
INSERT INTO `lesson` VALUES ('688', '22', 'Dolores quos repellat officia rerum sed omnis labore.', 'Ipsum saepe quo qui sint vitae aut sed id eum in non eos at deserunt nesciunt ut est consequuntur accusamus consequuntur labore consequatur debitis ut odit est eum doloremque aut maxime et qui magnam dignissimos voluptates voluptatum molestiae voluptatem tempora qui animi labore beatae qui totam officia eaque doloremque aut magni nihil soluta voluptatum et nisi a assumenda consequatur molestias ut et culpa delectus omnis fugiat dolores nulla illum nulla eligendi quibusdam possimus soluta quas atque molestiae odit sunt odio aspernatur in voluptas error et voluptatum quisquam optio quae quas blanditiis quos sequi provident et culpa rerum aperiam alias reiciendis minus asperiores est beatae quibusdam sed est in sint unde aut laborum est nostrum neque et in in libero qui rem totam voluptatibus voluptatem ab vel animi molestiae asperiores nisi reprehenderit minima.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '39', null, '0', '1', '2017-05-15', '2017-05-14 04:17:37', '2017-05-14 04:17:37');
INSERT INTO `lesson` VALUES ('689', '28', 'Et maxime aut dignissimos ab architecto occaecati qui.', 'Aut quia totam eaque ipsa quisquam assumenda eum quia officiis et qui accusamus quae dolores illo ratione facere voluptatibus perspiciatis est aut odio omnis molestiae molestiae impedit est sit optio non qui molestias atque quia culpa sunt at illum sit et eius nihil alias nostrum quisquam aut est dolorem nihil porro repudiandae porro voluptatem eos sint enim accusamus laboriosam repellendus fugit quo repellat deleniti id voluptatum quas maiores dolor.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '20', null, '0', '1', '2017-05-14', '2017-05-14 04:17:37', '2017-05-14 04:17:37');
INSERT INTO `lesson` VALUES ('690', '23', 'Laudantium ut debitis veritatis ea numquam minima velit est quisquam deleniti.', 'Assumenda alias incidunt odio dolor cum provident sed aut error iste et eveniet nisi et vel et eveniet rerum reprehenderit delectus consectetur ullam consequatur magnam nihil delectus assumenda sit laborum rem explicabo quos libero vel consequatur autem sit perferendis earum accusantium rerum autem minima minima beatae error omnis sunt soluta error corporis odio optio dicta ducimus aperiam adipisci debitis quaerat doloribus dicta excepturi vel et odio.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '47', null, '0', '1', '2017-05-16', '2017-05-14 04:17:38', '2017-05-14 04:17:38');
INSERT INTO `lesson` VALUES ('691', '6', 'Ad dolore voluptatibus vel ea quo iste sint quae quod eum.', 'Accusantium veritatis omnis harum repellat provident minima quis dicta vero autem dolores aut et vero labore officia ipsam ex sed molestiae est nulla nostrum nisi quis in deleniti occaecati vel dolores delectus ipsam beatae autem quod porro similique iusto quis veritatis facilis vel pariatur dolore qui nesciunt repudiandae ea ipsam neque reiciendis qui eaque dolorem laudantium vel nihil porro earum ullam mollitia placeat repellendus sapiente omnis dolor qui inventore eos adipisci quasi necessitatibus quia ullam qui aperiam et quia omnis quas velit voluptatem similique sapiente quae vitae neque recusandae corrupti neque et blanditiis ullam non aut earum doloremque eos optio amet qui quibusdam fugit voluptatem minus voluptatem placeat eos id necessitatibus aliquam soluta deserunt ducimus sint velit et eveniet totam sint iste dolorem autem est numquam assumenda in voluptas.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-17', '2017-05-14 04:17:38', '2017-05-14 04:17:38');
INSERT INTO `lesson` VALUES ('692', '3', 'Nostrum quia qui dolor sunt quos doloribus quos quam ut.', 'Eaque nihil ea unde in laborum et maxime eius aliquam non accusantium voluptate aut provident accusantium hic laboriosam iusto vel autem modi itaque est voluptas in quaerat qui delectus ut laborum nesciunt debitis tempore quis enim in tenetur dolor ullam saepe quis at facere veniam qui quas sed dolores praesentium quas rerum ut sit sit dolores labore est sit numquam excepturi molestiae esse illum ab quos est qui distinctio alias ut architecto ea ea iste quia neque alias deleniti iure ab unde excepturi omnis voluptatem impedit eos impedit facere iure nulla et id consequatur ratione tenetur sed culpa temporibus amet et nam aspernatur ut excepturi dolorum autem distinctio asperiores dolorum praesentium nisi modi similique eligendi minima magnam occaecati.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '36', null, '0', '1', '2017-05-18', '2017-05-14 04:17:38', '2017-05-14 04:17:38');
INSERT INTO `lesson` VALUES ('693', '8', 'Quia nihil illo doloribus est et enim.', 'Illum consequatur iste nihil rem eos nostrum molestiae aut rerum ipsam nemo qui dolorem omnis excepturi iusto sunt suscipit rerum nihil libero rerum distinctio sit id praesentium inventore sit aliquam dolorem quis vel tempore praesentium repudiandae sit necessitatibus nam maxime eos magni et itaque quam ut autem omnis sed ipsum expedita minus quis excepturi dolores amet ea dolores quia officia hic et sint reiciendis illum sit rerum id deleniti quo quo voluptate ea omnis ab consequatur non expedita nesciunt rerum optio ea quia libero et et assumenda totam esse ut perferendis quam porro id ratione fugiat fuga minus nemo dolorem et necessitatibus voluptatibus ut nemo nesciunt deleniti eveniet nihil numquam neque pariatur perferendis nobis voluptas delectus incidunt nisi illo error fugiat et et repudiandae id deleniti animi consectetur laboriosam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-16', '2017-05-14 04:17:38', '2017-05-14 04:17:38');
INSERT INTO `lesson` VALUES ('694', '7', 'Necessitatibus ratione expedita optio quibusdam placeat est a velit aut qui.', 'Deleniti repudiandae ipsa ut et neque corporis iure quia sapiente aut dignissimos et nostrum distinctio cupiditate quod at omnis temporibus aperiam cum nulla suscipit veniam ullam magnam consectetur sit eius veniam harum est consequatur quia et officia et aut unde eum voluptas itaque totam molestiae voluptas voluptas perspiciatis aspernatur omnis molestiae aut et ut odit doloremque non corporis velit aperiam odio beatae magni omnis aut expedita perferendis aut blanditiis et minima id voluptatem tempora.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-18', '2017-05-14 04:17:38', '2017-05-14 04:17:38');
INSERT INTO `lesson` VALUES ('695', '23', 'Aut tempore molestiae autem ut ipsum iure vel pariatur quaerat quam.', 'Explicabo temporibus illo aliquam aut doloremque quae illum molestiae qui beatae quis perspiciatis quia officia et maiores voluptatibus et aspernatur consequatur ratione perspiciatis quam numquam minima labore dolor saepe tempore molestiae ab alias ex autem et et et ipsam voluptatem voluptates officia ullam animi non harum et nesciunt aut illo aut mollitia blanditiis ut voluptates aliquid fuga maxime repellendus repellendus molestiae maxime quaerat magni necessitatibus repellat eligendi iusto harum deserunt pariatur rerum ut veritatis corporis ipsum voluptatem vel laborum et excepturi deleniti distinctio aut est molestiae sunt ea sit vel blanditiis nobis harum voluptas cum et voluptatum dicta dolores labore velit eligendi voluptatum voluptas quod ipsam nobis delectus praesentium sint et officia ut praesentium non facilis sit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-16', '2017-05-14 04:17:38', '2017-05-14 04:17:38');
INSERT INTO `lesson` VALUES ('696', '23', 'Quam accusantium deleniti pariatur fugit inventore dolorem facilis veritatis.', 'Aut ex sit possimus tempora aperiam sunt qui nihil enim voluptatem unde et qui sit iusto natus dolorem totam perferendis delectus qui voluptatem dignissimos voluptas nemo quas et aliquam nihil non repudiandae sit nihil aspernatur voluptate nisi neque quo molestiae quia reprehenderit expedita vero reprehenderit rerum et ea sunt non sit odit aut quia reiciendis sit magni aliquam illum ab tempora eos aut earum a consequatur illo eum libero minima provident consequatur molestiae aut voluptas ea odit autem amet sed nobis ullam ipsa distinctio maxime dolorem eveniet numquam dolorem qui est omnis iure sint sint non atque ut consequatur laboriosam officia consectetur eaque minima voluptas excepturi maxime rerum voluptatem modi exercitationem ut ut iste.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '22', null, '0', '1', '2017-05-15', '2017-05-14 04:17:38', '2017-05-14 04:17:38');
INSERT INTO `lesson` VALUES ('697', '24', 'Sint dolorem occaecati libero qui voluptatem.', 'Et mollitia ipsa atque id dolorem maxime ut sunt voluptates harum voluptatum officiis deleniti sed doloribus rerum voluptatum enim occaecati laborum doloribus voluptatum suscipit ut vero quo fugiat accusamus expedita quo aut rerum autem illum voluptatem et reiciendis consectetur ea odit et velit totam nihil rerum non officia laudantium dicta ut accusamus dicta non quam et consequatur ea laboriosam et est aut quasi et impedit eaque sit iste non dignissimos necessitatibus architecto ipsum aut numquam blanditiis quos fuga eos aut vitae officiis aliquid cumque enim dolore omnis quae ipsam porro inventore vero ipsa consequuntur necessitatibus ex rem quod aut voluptatem fuga aliquam odit labore.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '22', null, '0', '1', '2017-05-19', '2017-05-14 04:17:38', '2017-05-14 04:17:38');
INSERT INTO `lesson` VALUES ('698', '19', 'Est voluptas omnis laboriosam non quas debitis et et similique nihil.', 'Cupiditate qui ullam quidem veniam quos dolores facere aut molestiae cupiditate sed et assumenda est sapiente quis illo rem nobis tempora necessitatibus accusamus atque reprehenderit architecto voluptas vel ab aspernatur incidunt totam odio dolores animi est vel sit excepturi dicta est doloremque enim enim delectus temporibus aliquam voluptatum eveniet impedit omnis minus vel recusandae in non nesciunt ex aut vel voluptas accusamus non minima est qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '22', null, '0', '1', '2017-05-18', '2017-05-14 04:17:38', '2017-05-14 04:17:38');
INSERT INTO `lesson` VALUES ('699', '19', 'Ad quis reprehenderit voluptate ut perferendis.', 'Maxime molestias pariatur illo dignissimos accusantium velit repudiandae expedita magni deleniti molestiae incidunt sed nostrum porro ratione harum at illum saepe et ut quia minima minima voluptatem voluptate quisquam voluptas ipsa cum maiores autem eos cupiditate rerum iusto totam velit animi saepe earum esse iure minima voluptates occaecati in distinctio inventore esse autem incidunt nesciunt sed sint quas autem beatae est harum in autem deleniti perspiciatis voluptatem aperiam occaecati enim assumenda minima eaque aut officiis aperiam est dignissimos quasi necessitatibus sit earum aliquid quidem molestias ipsam eligendi optio error occaecati hic velit in aperiam libero.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-14', '2017-05-14 04:17:38', '2017-05-14 04:17:38');
INSERT INTO `lesson` VALUES ('700', '13', 'Amet doloribus id totam rerum saepe distinctio repellendus laboriosam at rerum.', 'Doloribus tenetur et sint eos maxime natus et assumenda qui quam et harum et non repudiandae aut optio velit inventore facilis blanditiis repudiandae et placeat perspiciatis quia corporis aut fuga autem ut vel velit est et tenetur dolores repellendus repellendus at suscipit tempore totam voluptatem illo et non doloremque eos est animi quos dicta quas ut voluptatem odit voluptas consectetur provident velit nemo veritatis est voluptas voluptatum ut sed quisquam aut qui voluptate alias quas et saepe ullam aut qui neque doloribus molestiae quam dolorem provident porro sed ut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '27', null, '0', '1', '2017-05-19', '2017-05-14 04:17:38', '2017-05-14 04:17:38');
INSERT INTO `lesson` VALUES ('701', '19', 'Iusto ut rerum aliquam earum enim.', 'Temporibus provident sunt expedita sed et veritatis reiciendis temporibus sit quis nisi veritatis sunt exercitationem ipsa non ullam illum beatae molestiae facere et omnis facilis in error ut molestias odio maiores consectetur eos modi dolore et voluptate quos blanditiis est consectetur blanditiis voluptas aut dolorum non dicta necessitatibus repudiandae illum possimus ad rem et esse culpa autem reiciendis repudiandae provident dolores qui maxime harum autem natus iusto corrupti quis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-14', '2017-05-14 04:17:38', '2017-05-14 04:17:38');
INSERT INTO `lesson` VALUES ('702', '24', 'Culpa nostrum optio ut sint natus consequatur quibusdam.', 'Eum quia eligendi rem et totam ad est beatae tempora ut tenetur iste perferendis magnam similique nihil rem minima minus velit praesentium eligendi delectus illo tempora adipisci laborum animi sint dolorem repellat quia fugiat impedit et consequatur sed ipsum consequatur natus ex dolores a voluptas repudiandae animi optio voluptatibus cumque quaerat maiores et qui expedita quas in quisquam quas consequatur voluptatum ut exercitationem itaque cumque dolores quidem sed voluptatum sapiente eos quia molestias aut sed eius magni et illo commodi asperiores nostrum veritatis sint et repellendus quae ratione cum corporis quia doloremque odit fuga quia voluptates quisquam voluptatum qui tempore est suscipit temporibus quaerat consequatur dolor id deleniti consequuntur optio laboriosam cum eum quo.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-14', '2017-05-14 04:17:38', '2017-05-14 04:17:38');
INSERT INTO `lesson` VALUES ('703', '21', 'Sed eum nisi placeat culpa aliquam.', 'Pariatur optio accusamus inventore rerum est aliquam harum dignissimos autem et excepturi molestias ut est perferendis in ab eaque nesciunt deleniti id exercitationem commodi aut ut culpa ut explicabo nemo tempora libero quaerat dolores tempore vero suscipit iusto dolor maiores possimus numquam voluptates consequuntur numquam consequatur tenetur ut error ut optio aliquid voluptatibus veritatis nostrum tempore assumenda vel velit consequuntur temporibus minus adipisci eos consectetur velit ad ut mollitia asperiores est fuga non iure et officiis architecto perferendis sunt ratione molestiae accusamus cupiditate ad ea omnis rerum qui cum qui molestias optio in doloribus qui omnis voluptatem asperiores ad neque voluptatum numquam consequuntur eligendi voluptas iure quasi maxime quam blanditiis nulla reiciendis ut illo est accusantium voluptatem qui aut ut consequatur provident non atque ullam corporis minus non veniam autem quia accusantium ut tempore.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-14', '2017-05-14 04:17:38', '2017-05-14 04:17:38');
INSERT INTO `lesson` VALUES ('704', '14', 'Autem minima sunt laudantium ex quia asperiores.', 'Qui quos enim quis voluptas animi eligendi tenetur id repellendus voluptatem nihil veritatis possimus enim voluptates consequatur id expedita amet necessitatibus fuga quia doloremque esse rerum eum sit officia ratione et iusto provident maiores sed beatae minima et voluptates sit alias dolorum explicabo rem vel tempore ipsum placeat quia consectetur nihil sequi enim et molestias modi vel vel illum molestias velit nostrum aliquid nesciunt est itaque dolor perferendis accusamus explicabo et aperiam dolorum accusantium unde nam doloremque quia nihil natus voluptatem et neque consequatur corrupti distinctio vel ut cupiditate quo molestias vitae dicta iste eum aliquid dolorem incidunt porro iste.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-17', '2017-05-14 04:17:38', '2017-05-14 04:17:38');
INSERT INTO `lesson` VALUES ('705', '8', 'Alias vel consequatur qui error et voluptatem.', 'Dolore autem id id deleniti assumenda adipisci perferendis deleniti sit inventore id quia in cumque labore optio sequi fuga mollitia ullam fugit ea quo qui unde velit quos qui illum ut autem aut sed ullam odio magnam fugiat rerum molestiae omnis officiis natus veniam repellat ex dolor corrupti id voluptatem laudantium reprehenderit dolorem magnam ut voluptatem provident unde dolores dolor nam quos magnam natus pariatur eos laborum repellat eligendi laboriosam sit sit ut at quis sit doloribus quaerat deserunt dolorum voluptatem et eum nemo officiis perspiciatis quos et consectetur consequatur consequatur veritatis blanditiis explicabo consectetur iusto nemo voluptas et ipsam nihil ipsam dolorem facilis debitis id itaque.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-16', '2017-05-14 04:17:38', '2017-05-14 04:17:38');
INSERT INTO `lesson` VALUES ('706', '12', 'Id blanditiis fuga quibusdam sunt molestiae autem sint sunt.', 'Odit quasi aut minima quos alias hic et et quisquam at accusantium saepe asperiores iure sit et dignissimos dolores repudiandae nihil eos quae dicta occaecati voluptatibus sed est perferendis accusamus quisquam omnis ea non quia explicabo voluptatum totam illum ratione officia harum eaque non assumenda amet ipsa et omnis consequatur itaque quo quibusdam aut modi quaerat fuga incidunt praesentium quam nobis qui sed omnis consequuntur est sint repellendus blanditiis voluptas quas aperiam placeat reiciendis voluptatum qui qui numquam minus sunt enim deserunt enim quo eum est sit nemo sapiente ipsam eligendi laborum ipsa ut consequuntur id mollitia nobis est nulla quaerat et sint odit assumenda quaerat consequatur consequatur quam doloribus qui qui voluptas rerum sunt quaerat quasi sint voluptatem tenetur soluta et dolores iste necessitatibus commodi aut totam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-14', '2017-05-14 04:17:38', '2017-05-14 04:17:38');
INSERT INTO `lesson` VALUES ('707', '7', 'Amet quis est libero mollitia earum neque.', 'Perferendis est mollitia impedit non veritatis corrupti nemo autem hic qui velit inventore sunt ipsam aperiam ut eos vero sunt ea nesciunt sit est dolorum labore omnis ex quo non iste est qui veritatis vel esse quia ut voluptas ab repudiandae ut ratione a ad laborum et accusamus non sint voluptatibus incidunt nihil tempora minima nemo libero saepe odit aut numquam quia aperiam impedit natus dolorem porro enim pariatur in voluptatem omnis dolorem reprehenderit quasi blanditiis quaerat animi molestias animi vitae saepe minima perferendis sit consectetur atque sit inventore consequatur aliquid veniam et nihil tempora id rerum quo ipsum iste ab natus amet molestias sed doloremque ut repellendus qui ea facere eum quae aut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-19', '2017-05-14 04:17:38', '2017-05-14 04:17:38');
INSERT INTO `lesson` VALUES ('708', '25', 'Aliquam consequatur qui qui asperiores nisi.', 'Ut tempore doloribus dolor quam repellendus voluptatem qui qui ab esse perferendis asperiores blanditiis non possimus cupiditate et assumenda placeat nam ut laborum ut qui ut soluta enim neque pariatur sunt est nulla sed et quod et perferendis debitis corrupti aperiam eos laboriosam explicabo magni nulla voluptatem id assumenda corrupti omnis pariatur autem in impedit voluptatibus consequuntur omnis et saepe ad voluptatem molestias perspiciatis minus provident eligendi qui earum et delectus rerum dolor rerum vero et amet perferendis accusantium sed soluta quia optio placeat error neque sunt pariatur totam et et perspiciatis tempora ut et mollitia ullam iste impedit cupiditate illum nihil aspernatur possimus vel similique error pariatur eius voluptatem mollitia consequatur ut officiis qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '28', null, '0', '1', '2017-05-17', '2017-05-14 04:17:38', '2017-05-14 04:17:38');
INSERT INTO `lesson` VALUES ('709', '24', 'Autem voluptas alias necessitatibus occaecati debitis qui et.', 'Molestias et distinctio laudantium neque dignissimos nobis veniam odit sunt rerum aperiam aut aut fugiat non sequi veniam voluptatem perspiciatis aliquid magnam omnis quia officia fuga consequatur labore eos optio aliquid qui reiciendis enim dolor quidem atque fugiat dolorum vitae et reprehenderit quas provident dolorem eum tenetur voluptas aperiam veritatis dolores illum laudantium aut sit quam odio ea tempora autem nam nisi mollitia nulla quidem accusamus incidunt adipisci at earum esse dolorem expedita omnis quia aut in hic id culpa ipsum doloremque amet quo saepe quia odio sed ut earum dolores ad suscipit nostrum totam eum quibusdam provident quia alias possimus iste et aut unde temporibus non et aspernatur aliquam laborum et aut sunt cupiditate id omnis aut corrupti adipisci ullam id rem molestiae repudiandae qui non in facilis ut officia omnis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '28', null, '0', '1', '2017-05-15', '2017-05-14 04:17:38', '2017-05-14 04:17:38');
INSERT INTO `lesson` VALUES ('710', '13', 'Quis in aut ipsum voluptatem quis aliquam ut.', 'Quibusdam voluptatum consequatur autem repellendus rerum eligendi nesciunt odio nostrum praesentium voluptatem non a est est consequuntur quas aut sunt et recusandae esse vero pariatur reiciendis animi voluptatibus libero dicta qui sunt accusantium dolorem corrupti illo voluptatem unde incidunt nisi velit quidem labore minima maxime eaque numquam quas molestias ipsam delectus animi dolore iure harum totam cumque quas commodi est velit quia totam atque nemo tempora adipisci modi.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-15', '2017-05-14 04:17:38', '2017-05-14 04:17:38');
INSERT INTO `lesson` VALUES ('711', '13', 'Alias voluptates ipsa incidunt ullam voluptatum quia.', 'Dicta atque sed minus laborum qui quos ullam excepturi voluptatem maiores pariatur et quos nemo dolor nisi debitis sit temporibus beatae aliquam dolorum et aut dolorem eum et illum sed minima asperiores ut voluptatem deserunt adipisci occaecati nulla temporibus et autem nobis blanditiis mollitia et illum non repellat magni natus mollitia voluptate qui illum aut eum distinctio veniam quis minima aspernatur rerum tenetur in ipsam enim nihil aut aspernatur reprehenderit et voluptatem ducimus harum sequi error aut labore quasi doloribus quam pariatur est ipsa ipsam nulla eligendi harum at dolor saepe ea cumque quia quo non et placeat sint.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-19', '2017-05-14 04:17:38', '2017-05-14 04:17:38');
INSERT INTO `lesson` VALUES ('712', '7', 'Debitis est quasi et eveniet.', 'Nostrum fugiat at iure dolores doloribus corporis nobis temporibus quaerat voluptates labore quasi nihil sed odit corporis sint voluptas ullam explicabo cum dolores et aut velit velit sunt voluptates vitae ut ut consequatur dolor earum soluta sed accusamus sit sapiente aspernatur optio ratione qui sapiente occaecati aperiam error incidunt maiores rem id excepturi nihil assumenda tenetur voluptatum sit unde ad recusandae eligendi necessitatibus autem nobis eos fugit et est aut sint esse quae sequi deserunt possimus iusto laudantium id voluptas ducimus culpa placeat aut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-17', '2017-05-14 04:17:38', '2017-05-14 04:17:38');
INSERT INTO `lesson` VALUES ('713', '11', 'Voluptatem incidunt unde necessitatibus autem et ut quos neque.', 'Sequi sunt alias rem aut qui sed molestiae hic officiis facilis ea repellendus dolorum fuga ea quia minima enim facilis magnam minus occaecati quas et ut ea nam blanditiis minima nesciunt saepe quia id ipsam quibusdam vero maiores voluptatem doloribus sit cupiditate qui libero vel debitis enim ad omnis dignissimos veritatis asperiores rerum et accusamus id provident tenetur tempore minus et autem maiores aut itaque nam et accusamus eos assumenda sunt distinctio non.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-16', '2017-05-14 04:17:39', '2017-05-14 04:17:39');
INSERT INTO `lesson` VALUES ('714', '6', 'Molestias adipisci nihil reiciendis aut mollitia nisi et assumenda nobis excepturi.', 'Similique sed minus at eos repellendus natus similique autem maxime iure perferendis quibusdam voluptas mollitia ab rem ad debitis mollitia error molestiae accusamus nulla quae est velit sint perspiciatis laboriosam qui aut suscipit repellendus et id consectetur ipsum ratione magnam autem sit molestias impedit quia minima nesciunt cumque aspernatur voluptas velit nulla aperiam nostrum corporis et voluptatibus pariatur officia dolorem reprehenderit quam blanditiis aut dolores quibusdam necessitatibus et et quis eos voluptatibus optio mollitia inventore quia maxime iste quo enim est tenetur velit tenetur vitae est aut inventore quibusdam reiciendis dolore consequatur nulla veniam hic laborum odit ea repellat consectetur fugiat non ea quam aperiam in voluptatem saepe consequatur eaque non error minus eveniet possimus magni.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-15', '2017-05-14 04:17:39', '2017-05-14 04:17:39');
INSERT INTO `lesson` VALUES ('715', '7', 'Veniam qui sed enim quod autem.', 'Necessitatibus ducimus quo ut provident nihil saepe quia nihil quo magnam dicta cupiditate recusandae exercitationem omnis veniam possimus ea mollitia officiis perspiciatis officia nihil aut quia molestiae voluptates quam accusamus nesciunt ipsam temporibus perspiciatis quo ut voluptatem et sequi qui eaque dolorum voluptates recusandae voluptatem voluptatibus qui et in deleniti officia suscipit ut ex repellendus doloribus cumque quia officia non cum dolore numquam omnis in omnis debitis sequi dolorum non tempore quam dolore in veritatis occaecati nostrum ut necessitatibus tempore aliquid quaerat officia veniam excepturi qui quasi eum consequatur sit doloribus aliquid vel itaque recusandae mollitia aut aperiam rerum iste sit consequatur similique fugiat omnis et sequi cupiditate et culpa harum modi iste eum est ut maxime sit saepe voluptatem dolore debitis officia et ut sed qui alias incidunt non ad et et sint similique nesciunt eos.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '22', null, '0', '1', '2017-05-17', '2017-05-14 04:17:39', '2017-05-14 04:17:39');
INSERT INTO `lesson` VALUES ('716', '25', 'Tempora non sunt voluptate quis odit itaque.', 'Doloremque rerum quia excepturi voluptate expedita et ea sunt est ea itaque quibusdam quos earum quia fuga accusamus et numquam occaecati minima dolores ut quo quis illum et rem nemo et cupiditate facere velit aut qui repudiandae quos sapiente est debitis ut et enim autem consequatur nam tenetur molestiae consectetur sequi tempore ducimus enim omnis doloremque aut facere voluptas unde officia aut rerum dolores et explicabo blanditiis eligendi voluptas illum vel magnam architecto nihil eligendi sed incidunt nulla dolorem unde soluta maiores id optio eos deserunt dignissimos dolorum accusamus dicta ut necessitatibus et placeat qui sint veritatis suscipit aut nihil id accusantium unde atque voluptatem voluptatem enim cum qui voluptatem maiores dolorem autem facere non exercitationem quibusdam deleniti aut vitae aut ut ad similique veritatis necessitatibus veniam non ut magni eos aspernatur eum occaecati veniam fuga enim eum et architecto.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '24', null, '0', '1', '2017-05-14', '2017-05-14 04:17:39', '2017-05-14 04:17:39');
INSERT INTO `lesson` VALUES ('717', '17', 'Magni accusamus iure id iste nihil facere laudantium natus cum.', 'Enim consectetur qui sunt eum minima ut consequatur saepe eius laborum alias tenetur dolores fuga quisquam quisquam quisquam veritatis est et nisi ut autem est architecto voluptate labore placeat voluptatum non id odio esse et ratione excepturi id culpa labore qui rerum voluptatem non ratione facilis et odio ea eum iste voluptatibus aut saepe explicabo eveniet explicabo velit sint molestias ipsum eaque atque facilis dicta inventore pariatur assumenda veritatis adipisci quasi optio corrupti est alias quis rerum dolores soluta aut eum et quas fugit voluptatibus eaque facilis repudiandae officia qui consectetur ut ut est repellat quisquam sunt pariatur veniam porro eligendi accusamus minima quisquam quis possimus laborum natus neque aspernatur rem qui quia omnis harum repudiandae error dolore sed veniam qui officia.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-17', '2017-05-14 04:17:39', '2017-05-14 04:17:39');
INSERT INTO `lesson` VALUES ('718', '5', 'A consectetur sed similique vel voluptatum sequi aliquam.', 'Sed quia deserunt eveniet neque quo expedita illo debitis nihil nulla sed eligendi laborum dolorem culpa velit laborum beatae animi libero illo ut maiores minima aut quisquam ut sint dolor ullam ab expedita maxime voluptatum voluptates rerum quis provident dolores laudantium accusantium rerum et omnis consequatur numquam ad odio rerum et asperiores voluptatibus occaecati autem voluptas cumque placeat veniam voluptatem inventore voluptatem nemo sunt quis cumque vitae distinctio fuga voluptatem molestiae.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-15', '2017-05-14 04:17:39', '2017-05-14 04:17:39');
INSERT INTO `lesson` VALUES ('719', '19', 'Similique aut occaecati id doloribus eveniet consequuntur ut quaerat expedita nihil.', 'Soluta omnis illo enim iusto neque quod quod commodi voluptas ab soluta quis quia aut quod tempora est modi doloribus nam deserunt et nostrum iste voluptatem id vitae aut sequi quo est harum ab aut illum earum libero enim pariatur consectetur sit id est et voluptatem fugiat ut iusto voluptate doloribus fuga quod id odio eius error qui sed nemo esse facere necessitatibus nobis rerum dicta expedita dolor accusamus voluptas et odit corrupti asperiores est reprehenderit voluptatum rerum nulla minus facilis et corrupti consectetur sunt sed possimus nisi delectus sunt omnis voluptatem reiciendis eveniet minima commodi aut consequatur et aut molestias quis eaque maiores eos distinctio voluptas iure non eius qui deserunt quaerat voluptatibus consequatur quaerat nobis quia ea consequatur voluptas.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '22', null, '0', '1', '2017-05-18', '2017-05-14 04:17:39', '2017-05-14 04:17:39');
INSERT INTO `lesson` VALUES ('720', '24', 'Nemo dignissimos nihil sint commodi quasi dolores qui voluptatibus natus quis.', 'Delectus quis et voluptatem sint maxime eligendi possimus autem dolorem eum veritatis deleniti excepturi illo sed iusto similique provident quod labore commodi sit cum possimus ipsa voluptatibus est vel alias eveniet modi autem ex omnis architecto vel ipsam id ut sint voluptatem dolores laboriosam beatae occaecati repudiandae voluptas necessitatibus ab tempora adipisci molestias qui eum praesentium magnam assumenda neque et nostrum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-16', '2017-05-14 04:17:39', '2017-05-14 04:17:39');
INSERT INTO `lesson` VALUES ('721', '6', 'Tenetur sed rerum qui sed corrupti nam unde et.', 'Dolorum in minima excepturi deserunt voluptatem expedita harum molestiae quis quia voluptate omnis qui qui dicta distinctio nobis fuga est occaecati autem est quasi nesciunt enim voluptatem atque ex magnam et et reprehenderit ea eos ad quos officia eius qui non sed ut occaecati ratione fugiat vel eveniet dolorum et dolores praesentium assumenda totam reprehenderit adipisci ex qui adipisci blanditiis harum neque.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-16', '2017-05-14 04:17:39', '2017-05-14 04:17:39');
INSERT INTO `lesson` VALUES ('722', '3', 'Facilis harum aut nostrum quibusdam rerum consequatur harum.', 'Facere reiciendis repellendus commodi id velit amet voluptate alias harum nam numquam odit ducimus qui quia fugiat quia et et deleniti vero hic eius non sunt quibusdam omnis et rem quia accusantium perferendis et doloribus possimus quia quae architecto amet soluta perspiciatis et nesciunt voluptatibus aut enim distinctio labore optio cupiditate quia aliquam voluptates pariatur aspernatur et a eos fugiat officia quos eum culpa excepturi voluptatum rerum ut veritatis facere ad quis voluptas doloremque debitis itaque velit est.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-19', '2017-05-14 04:17:39', '2017-05-14 04:17:39');
INSERT INTO `lesson` VALUES ('723', '26', 'A aut assumenda ex autem soluta expedita sit dolor aut qui.', 'Officia nisi ipsam deleniti odit cupiditate ut rerum et dolorum autem voluptas quis maiores esse rerum et voluptatibus enim qui necessitatibus beatae reprehenderit vero enim magni repellendus repellat laudantium voluptas in qui dolor temporibus sit quia consequatur maiores consequatur aut quia voluptatum aut non ipsam cumque inventore et enim sequi est ut eaque voluptas numquam veritatis quia ea ut sit commodi nihil nihil rerum et consequatur est voluptatum cum veritatis aperiam earum nostrum sunt autem debitis laborum quasi in labore dolorem officia aut numquam aut beatae eaque a aut ut fuga reprehenderit sed nisi et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '39', null, '0', '1', '2017-05-18', '2017-05-14 04:17:39', '2017-05-14 04:17:39');
INSERT INTO `lesson` VALUES ('724', '16', 'Aliquam doloribus fugit odio tempore est quas et possimus sapiente vero.', 'Tenetur qui est nostrum tempore aut qui velit nihil suscipit et sit eligendi maxime porro non recusandae qui eveniet nobis ab non quos ea minima error vitae voluptatibus repudiandae voluptatem quas qui repellendus debitis velit cumque quibusdam voluptas nihil iusto ut fugiat incidunt rerum rem quae recusandae qui ut tempora et sint enim et possimus voluptas perferendis earum ut magnam doloremque iusto et in accusantium laborum qui et debitis ea dolores aut quia velit quibusdam atque quasi aut inventore perspiciatis quo sit beatae autem aliquid.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '23', null, '0', '1', '2017-05-19', '2017-05-14 04:17:39', '2017-05-14 04:17:39');
INSERT INTO `lesson` VALUES ('725', '29', 'Atque deleniti recusandae quas cumque sed velit.', 'Illum magnam velit omnis recusandae officiis nobis reiciendis voluptatem impedit consequuntur incidunt quam et illo hic quod quaerat unde ducimus voluptatem et quia aspernatur qui eos voluptas tenetur vitae asperiores vero voluptatem numquam itaque animi voluptas aliquam voluptatem quia cupiditate quisquam perspiciatis fugit dolor est voluptatem et nihil ex et non soluta facilis neque reiciendis earum atque provident eos cum quia et ipsum sunt vel suscipit dolore error cumque qui aut quia magnam culpa qui harum harum amet placeat molestiae quis aperiam ut quo dolor voluptas nam ut ipsum quasi similique fugiat expedita qui est dolorum id quia dolor dicta sequi labore perspiciatis quia est ut nemo qui deserunt eveniet ut eum perspiciatis placeat officia debitis eveniet unde molestiae sint nulla minus in voluptas nemo alias qui inventore rerum recusandae nemo enim.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-14', '2017-05-14 04:17:39', '2017-05-14 04:17:39');
INSERT INTO `lesson` VALUES ('726', '6', 'Officiis ullam ratione id maxime sit ut cum.', 'Est qui voluptate qui velit possimus ut error error sed repudiandae id tempora eos quidem porro corrupti quos assumenda velit quo ipsa ut ut id fuga quod inventore vel ut ad sapiente vel qui exercitationem fugit alias assumenda nam aut veniam magnam inventore totam qui quam est est reiciendis rerum ea harum rem quia quibusdam distinctio aut eum quisquam eveniet tempore est illo ipsa dolores quasi laboriosam culpa.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '24', null, '0', '1', '2017-05-14', '2017-05-14 04:17:39', '2017-05-14 04:17:39');
INSERT INTO `lesson` VALUES ('727', '17', 'Debitis dignissimos recusandae et occaecati vero.', 'Cumque quasi velit nam harum consequuntur numquam tempora in sit optio molestias iusto tempore provident est perferendis voluptates sunt nobis sint qui perspiciatis cum nulla doloremque architecto asperiores sit architecto explicabo vitae et voluptas nam recusandae eos impedit est totam et nesciunt dolorem hic sed magnam id harum quibusdam maiores velit cum est odit cumque consequatur aut dolores neque voluptatem eius nobis quod officiis provident ducimus voluptatum doloribus voluptatem autem et itaque possimus eos veniam nostrum aut ut qui est pariatur quasi quisquam dolor et inventore maxime provident voluptatum quos et sint quam delectus nobis tempore sapiente praesentium.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-14', '2017-05-14 04:17:39', '2017-05-14 04:17:39');
INSERT INTO `lesson` VALUES ('728', '17', 'In consequuntur perspiciatis et nam dignissimos voluptatibus voluptas dignissimos.', 'Facilis similique blanditiis nam inventore quaerat quis reiciendis autem voluptate temporibus repellendus quod et pariatur maxime assumenda totam voluptate dolores soluta fugiat debitis ea est repellendus fugiat minima veniam eos id est perferendis odit veritatis laboriosam nobis vitae quia commodi aut hic eligendi sed et culpa velit sed ut repellat porro totam quia nihil consequuntur est quae veritatis quae officiis commodi alias fugiat facere enim dolorem qui vitae illum quaerat id sed et molestiae laudantium eos enim amet nam sit nisi quia perspiciatis ut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-16', '2017-05-14 04:17:39', '2017-05-14 04:17:39');
INSERT INTO `lesson` VALUES ('729', '27', 'Est ipsam dolores dolores provident quis sequi sint cum qui.', 'Laborum tempora enim molestiae quia quae ut velit nemo eos error commodi nihil libero officiis tenetur ipsam et veritatis voluptatibus occaecati iste est natus perferendis laborum repudiandae aut ut est nulla facere amet consequatur quo qui error repellendus sit non quia illo fugit placeat sed laboriosam esse ut atque perspiciatis consequuntur blanditiis quia voluptatem aliquid atque ab consequatur illo et sint est nulla omnis in officia sed alias et dignissimos consequatur quia magnam voluptatum quia est aliquam fugit eum harum iusto ut quis consequatur optio est vel ea voluptatibus fugit eos tempora distinctio dolorem et et voluptatum ab veniam sit rerum quisquam laborum iure repellendus eos enim delectus asperiores vel fuga et totam et cupiditate sit ut et molestias quo ad veniam totam iusto id laudantium sed rerum nihil.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '36', null, '0', '1', '2017-05-15', '2017-05-14 04:17:39', '2017-05-14 04:17:39');
INSERT INTO `lesson` VALUES ('730', '28', 'Laboriosam soluta velit exercitationem tenetur eveniet aut.', 'At delectus qui et rerum veniam iste est in quo modi optio et delectus voluptatem iste totam qui voluptas aut quo nisi harum saepe et ipsam aut molestias ipsa vero tempore consequatur est optio quas similique quas minus eveniet ut dolorem voluptas architecto reiciendis quo necessitatibus sunt nulla et iusto voluptatibus et ullam vel quia laborum reprehenderit recusandae magni veritatis totam qui odit natus mollitia necessitatibus qui earum sint doloremque quia quia dolor ut repudiandae quo et ullam minima blanditiis perspiciatis aut enim libero quae voluptatem quidem blanditiis est consequatur omnis nemo quibusdam vel enim non ipsa rem sed est eveniet est in consequatur doloremque inventore nesciunt inventore dolores officia ea quam maxime magni quia odio est et quos tempora est quo facere fuga dolore nihil qui nesciunt ab fugit est aperiam voluptatem et a voluptatibus facere.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-19', '2017-05-14 04:17:39', '2017-05-14 04:17:39');
INSERT INTO `lesson` VALUES ('731', '26', 'Laborum eligendi exercitationem numquam iure maxime ut illum nam atque.', 'Eligendi nulla enim quas quia cupiditate pariatur voluptatum ea exercitationem nihil consectetur vel odio laborum in et ad suscipit rerum et aliquid non suscipit ipsum officia repellat aspernatur odit reiciendis vel sit sunt dignissimos omnis quo quisquam pariatur enim rerum iste voluptatem eveniet rerum doloremque facere hic nemo ullam debitis laboriosam voluptate laborum id tempora incidunt vel temporibus ducimus facere architecto consequatur quia consequatur velit quisquam laboriosam autem eum dolor reprehenderit hic voluptas expedita aut totam facilis laboriosam voluptatum totam voluptatem delectus pariatur sit placeat inventore optio molestiae quam quasi omnis occaecati rerum alias quis deleniti nihil debitis consequatur aut vero sed velit in ad eveniet quisquam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '30', null, '0', '1', '2017-05-17', '2017-05-14 04:17:39', '2017-05-14 04:17:39');
INSERT INTO `lesson` VALUES ('732', '17', 'Voluptatibus et qui quo excepturi ipsum quis eligendi non.', 'Amet officiis modi tempora exercitationem repellat ipsum quia qui totam ut perferendis est ratione ea harum ea repellendus voluptatem dolore ratione nam nihil unde quas earum id eius eius qui esse minima molestias quam facilis et assumenda quam ratione quisquam repellendus unde praesentium eius ut iure autem eos ut adipisci consequatur vitae iste molestiae sunt nihil non quod eveniet placeat in voluptatem voluptatem beatae adipisci culpa magni non quia autem architecto illum dolorem aliquid est ea aut nobis eos et eum et ut est sunt laudantium recusandae dolores veritatis aut porro cumque ut molestias molestiae hic tempora dolor eos enim et deserunt doloribus perferendis maxime consequatur et nostrum perferendis quia itaque quos voluptatem aut iste corrupti veniam ducimus quisquam dolor deleniti enim voluptates natus placeat similique tempore earum dicta sed est.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-17', '2017-05-14 04:17:39', '2017-05-14 04:17:39');
INSERT INTO `lesson` VALUES ('733', '9', 'Est repudiandae quo aut deleniti harum labore beatae molestias qui blanditiis.', 'Quos minima error molestiae explicabo consequuntur sit perspiciatis autem saepe id voluptatum tempore laudantium dolorem deserunt asperiores ut reiciendis est recusandae eius cum et nemo eligendi aliquid et aut amet molestias nisi laborum assumenda ut similique perspiciatis cupiditate voluptatem minus et qui ut itaque et qui molestias et corporis explicabo sapiente ipsam in quasi pariatur quasi harum distinctio voluptas quas quo fugit aut laboriosam amet aliquam laborum error corrupti aliquam molestiae ullam dolorem voluptatem iusto dolore ratione ea iusto consequuntur quam quaerat aut voluptatem facilis laborum ab ipsa officia autem ut cum ut nemo qui voluptatem quo corrupti.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '28', null, '0', '1', '2017-05-16', '2017-05-14 04:17:40', '2017-05-14 04:17:40');
INSERT INTO `lesson` VALUES ('734', '9', 'Dolores vero soluta quos quaerat nemo qui vitae facere corrupti aspernatur.', 'Sit atque dolor possimus corporis error unde dolorem corrupti perspiciatis optio consequuntur aut quos voluptatum reprehenderit non cumque ipsa itaque voluptas quaerat earum omnis odio quia nemo nostrum doloribus id ut non iste aut qui qui rerum et autem corporis velit est nihil voluptatibus reiciendis ipsum nulla deleniti omnis et dolore ab accusamus ut nihil a a veniam eum qui explicabo a architecto quo quidem et velit quidem eum voluptatibus vel et rem ea dicta illo est non reprehenderit impedit quis corporis est delectus enim sequi consectetur adipisci saepe dolorum commodi ut consequatur sit voluptatem quisquam ut quidem autem ducimus ipsa sunt magni saepe vel sequi sequi consequatur consectetur rem doloribus libero enim quam cum adipisci qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '27', null, '0', '1', '2017-05-14', '2017-05-14 04:17:40', '2017-05-14 04:17:40');
INSERT INTO `lesson` VALUES ('735', '11', 'Ut quis similique corrupti laboriosam expedita necessitatibus.', 'Est ut iusto dolor dolorum doloribus et corporis architecto sed debitis non dolorum cumque possimus debitis omnis autem qui aut maxime et beatae atque voluptatem et fugit mollitia optio cumque repellendus tenetur sint eum totam illum exercitationem soluta consequatur non consequatur aut neque aut cumque ratione laudantium eius et voluptatem esse at est voluptatibus architecto quia numquam rem odio distinctio ipsa hic aperiam qui explicabo tempore iusto a sint omnis mollitia corporis corporis dolor sed harum sunt omnis quia et qui et suscipit totam illo pariatur quam corporis facere repudiandae eligendi ipsa.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-17', '2017-05-14 04:17:40', '2017-05-14 04:17:40');
INSERT INTO `lesson` VALUES ('736', '27', 'Laborum et velit nostrum natus aut amet a quidem aliquam impedit.', 'Sed tempore molestias similique quae non saepe qui inventore ut mollitia et dolor sed quia est rerum nostrum vel alias id consequatur molestias similique voluptas inventore sed eius consequatur provident nulla magni quia magni recusandae itaque consequatur et hic qui sint qui impedit et voluptatem sed quia aut rerum dolorum enim quia fuga eaque veniam aut non voluptatem quia ducimus culpa enim ab id non voluptas possimus dolore placeat autem nobis a impedit a similique et quam deserunt saepe molestias non enim voluptatem accusantium ut et doloribus deleniti ut in qui omnis vero molestias non et voluptas cupiditate quo odio assumenda ratione assumenda molestiae aliquam neque enim pariatur inventore voluptatibus sit architecto amet sed quia neque atque ratione omnis est.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '23', null, '0', '1', '2017-05-18', '2017-05-14 04:17:40', '2017-05-14 04:17:40');
INSERT INTO `lesson` VALUES ('737', '4', 'Praesentium iusto error totam odio aut tempore et.', 'Et hic similique facere aliquam porro necessitatibus non voluptatem iste ut voluptatem tempora voluptas sed suscipit ut maxime repellendus omnis totam aut ut veniam omnis est laboriosam aliquid maxime dolorem qui dignissimos rerum qui ad et ad exercitationem nisi dolores sapiente odio rerum aspernatur consequatur rerum sit est dolore praesentium explicabo aperiam ad quia architecto et inventore facilis maiores est quidem fugiat perferendis nam voluptatem hic fugit unde perferendis est laudantium rerum dolor magnam officiis dolorem esse sit doloremque aspernatur accusamus et et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-18', '2017-05-14 04:17:40', '2017-05-14 04:17:40');
INSERT INTO `lesson` VALUES ('738', '24', 'Delectus dolorem ut omnis neque consequatur voluptas.', 'Dolor rerum expedita iste excepturi quibusdam sit sed et voluptatem dolores ea iure hic quia rerum qui quo et ullam totam qui dicta et explicabo illo reprehenderit et recusandae doloribus distinctio sunt fugit dolorum voluptatum velit delectus praesentium nesciunt voluptatibus est alias ex quos nihil reprehenderit et qui consequatur in consequatur animi officiis minus animi sapiente pariatur qui enim at iusto assumenda et reprehenderit reiciendis sed blanditiis aut nesciunt sint animi officia animi ut in.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-19', '2017-05-14 04:17:40', '2017-05-14 04:17:40');
INSERT INTO `lesson` VALUES ('739', '1', 'Aut sint pariatur perferendis expedita ipsum atque ex.', 'Et itaque eligendi voluptatem nam alias at nemo animi quos aperiam placeat minima doloremque fuga rerum iure sit sit eum provident necessitatibus recusandae quasi voluptatibus non quia accusamus delectus minus eum tempore dolores officiis aliquid et dignissimos sunt accusamus dignissimos iste magni quasi sint unde et alias repellat sed dolor at et autem quisquam qui velit facere sint voluptas reprehenderit numquam esse vel est molestiae possimus maxime qui necessitatibus qui laudantium nobis aut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-15', '2017-05-14 04:17:40', '2017-05-14 04:17:40');
INSERT INTO `lesson` VALUES ('740', '20', 'Itaque corrupti facilis qui quod nemo ratione quis et voluptatem.', 'Quia molestiae maxime doloremque sed quam dolores ex maxime omnis sint deleniti modi voluptas molestias vitae temporibus itaque quo aut earum recusandae saepe tenetur odio quaerat est corrupti facilis fuga harum alias earum hic velit necessitatibus consectetur at sunt ut corrupti ipsam eum ut recusandae voluptas eaque repudiandae maiores mollitia nihil beatae consequatur vel consequuntur beatae officia ipsum ab neque voluptate in ut pariatur repellat culpa id enim cupiditate vel placeat suscipit blanditiis dolor mollitia inventore dolorum est distinctio cumque omnis sunt assumenda qui qui aspernatur est est labore temporibus aut dicta aliquid esse.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-19', '2017-05-14 04:17:40', '2017-05-14 04:17:40');
INSERT INTO `lesson` VALUES ('741', '4', 'Totam magnam iusto explicabo numquam harum adipisci cum.', 'Tempore ut fugiat et pariatur omnis et beatae quia temporibus quo facilis ipsum eum explicabo veniam sint dolorum dolores maiores dolor illum quidem voluptatibus libero ut magnam consequuntur magni accusamus placeat voluptates et accusantium et porro aut voluptas qui qui dolores sit omnis dolor et autem voluptatem et eveniet et error harum repellat eos dicta minima accusamus quasi harum quo est est nemo laboriosam harum officia beatae possimus aut officiis totam fugiat quis placeat assumenda cum praesentium voluptatem nostrum maxime quia unde in hic doloribus reprehenderit unde voluptate libero ut consectetur maiores.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '47', null, '0', '1', '2017-05-16', '2017-05-14 04:17:40', '2017-05-14 04:17:40');
INSERT INTO `lesson` VALUES ('742', '15', 'Facilis sed iusto expedita ducimus repellat veritatis suscipit temporibus.', 'Eveniet quos ipsum veritatis nostrum soluta voluptatem eligendi ut repellendus quaerat unde unde sit libero dolor omnis atque exercitationem repudiandae nemo ratione non perferendis iusto omnis voluptatem incidunt laudantium eaque maiores minus minus quia illo praesentium quo odio ut provident quia vel repellat sequi a voluptas est repellendus a maxime ducimus molestiae eum omnis officia numquam accusantium sed ipsam accusamus eos amet illo dolore voluptatem molestiae voluptatum ad accusantium soluta non cumque velit aut asperiores vero accusamus fuga facilis exercitationem inventore nam sapiente qui neque modi ut error nam nihil accusantium beatae cumque ut dignissimos officiis minus officiis sed explicabo corporis explicabo voluptatum doloremque deleniti numquam veritatis est sunt et autem facilis ullam qui alias autem voluptatem vitae.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '20', null, '0', '1', '2017-05-14', '2017-05-14 04:17:40', '2017-05-14 04:17:40');
INSERT INTO `lesson` VALUES ('743', '1', 'Consequatur sunt omnis maiores cum omnis.', 'Natus non voluptas maiores animi aut corrupti adipisci explicabo quia voluptas tenetur facilis illum facilis repellendus alias rerum aut non id tenetur at facere est consectetur deleniti excepturi qui molestiae dolorum voluptas non nam porro labore minus accusamus ut ipsa beatae omnis non sunt quas doloremque molestias nisi quas voluptatibus sit recusandae eius qui soluta vitae enim cupiditate accusantium id nihil nihil nostrum ipsum sit suscipit voluptatem nihil illum repellendus ea est nulla.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-14', '2017-05-14 04:17:40', '2017-05-14 04:17:40');
INSERT INTO `lesson` VALUES ('744', '20', 'Possimus et id ducimus quaerat nam.', 'Est quo illo distinctio qui adipisci officia quis dignissimos laboriosam alias aliquid neque a quis laboriosam similique ut nostrum qui nisi commodi ad accusantium beatae distinctio dignissimos veritatis cum et omnis voluptatem dolor reiciendis et iste placeat modi sunt harum perferendis aut id non omnis ad et non eos molestias non sequi omnis excepturi aut aut eum id et sapiente earum est architecto tenetur modi voluptatibus possimus sed maiores rerum ut id rerum reiciendis error et ea dolores vel commodi laborum libero voluptas rerum dolorum hic consectetur facere vel sed eum aspernatur officiis accusantium iusto beatae sint aliquid ex molestiae quae consequatur aut repellendus commodi aut quia unde velit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-17', '2017-05-14 04:17:40', '2017-05-14 04:17:40');
INSERT INTO `lesson` VALUES ('745', '5', 'Qui ea in reiciendis nemo et qui dolore repellendus esse illo.', 'Aliquam ipsa officia totam sit possimus porro ratione deleniti velit nihil sit possimus aut possimus aut quaerat vel ut enim sit ab est est cum voluptas ut aut ut sit exercitationem magnam sapiente est occaecati doloribus incidunt illo aperiam minima fugiat quod quod similique tempora voluptas nam perferendis voluptas dolorem quos ipsum vel asperiores ut distinctio voluptas et itaque et fuga omnis consectetur commodi neque possimus aspernatur qui cum beatae reprehenderit aut sed sunt accusantium molestiae laborum et ipsum dolore in optio non expedita consectetur aut ea vitae sed vel harum ex sed non eveniet quia ipsam explicabo est qui et eius pariatur ipsam ullam illo nihil ut ad eius ut et error corrupti nam quae amet est itaque ea.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-19', '2017-05-14 04:17:40', '2017-05-14 04:17:40');
INSERT INTO `lesson` VALUES ('746', '25', 'Fuga numquam maiores laudantium delectus nihil consequatur vero fugiat ipsa maxime.', 'Odio ipsa quia eos velit atque iusto et nostrum dolorem voluptas dicta molestias aliquam inventore perspiciatis consequatur repellendus molestiae eum et velit non occaecati accusamus voluptatem occaecati hic natus nihil est ad ut repudiandae fugit eum iste ea autem accusantium vero perferendis vel quia laborum enim voluptatem quae officiis saepe enim alias beatae amet sed libero recusandae voluptates minus porro quis qui repellendus mollitia distinctio quaerat excepturi ullam id corporis temporibus aut quia.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-14', '2017-05-14 04:17:40', '2017-05-14 04:17:40');
INSERT INTO `lesson` VALUES ('747', '12', 'Natus quae praesentium non numquam dolorem explicabo.', 'Repudiandae voluptatem dolores sequi vitae et dignissimos consequatur maiores omnis neque animi sit nobis omnis a voluptas incidunt ea quia alias quo hic inventore repudiandae et tempore aut et harum et excepturi velit atque aspernatur voluptatibus deserunt saepe sint quasi qui adipisci omnis itaque voluptatum sunt aut et qui exercitationem est architecto laboriosam nesciunt non quisquam cum quisquam perferendis in deserunt dolorem cum possimus aliquam ut esse quo enim delectus et iste molestiae non sed tempora recusandae occaecati tempore reprehenderit modi suscipit quos veniam fugit animi beatae quo numquam quis rerum suscipit harum dicta eum vero ratione sint consequuntur rerum perspiciatis exercitationem officiis rerum ut assumenda eum et est ullam nihil aspernatur aut architecto similique possimus qui non ratione est totam ea qui voluptatibus corrupti quas ut dignissimos et quibusdam explicabo nostrum impedit voluptatem qui dolorem illum nobis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-14', '2017-05-14 04:17:40', '2017-05-14 04:17:40');
INSERT INTO `lesson` VALUES ('748', '24', 'Quae nobis voluptas repudiandae voluptatem nesciunt nulla nobis mollitia animi.', 'Laudantium iure omnis nulla et consectetur cum doloremque ex sint rem voluptatum nobis veniam est molestias eum excepturi quia saepe et deserunt a cum nostrum voluptatibus fuga est repellat aliquam vel et eligendi est et velit nulla omnis magni natus iste iste dolorem doloribus id laboriosam blanditiis rerum ut et velit fugiat cum consequatur voluptas illo quis quasi iure amet soluta a sequi debitis explicabo voluptas enim quae labore occaecati et dolor placeat ullam laborum pariatur quaerat tempore ea sed porro est sint voluptatum corrupti iusto assumenda qui magni inventore sequi dolorem eos consectetur quo rerum est magnam est perspiciatis enim quis odio laboriosam nisi ut assumenda nisi omnis accusantium nulla totam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-16', '2017-05-14 04:17:40', '2017-05-14 04:17:40');
INSERT INTO `lesson` VALUES ('749', '4', 'Ipsam voluptatum tenetur quas minima repellat beatae voluptatum facere.', 'Placeat eum deserunt deserunt quis quia voluptatem non pariatur aperiam quia voluptatem quis tempora et commodi magni ea saepe culpa et molestiae molestiae quos voluptas totam nulla magni perferendis necessitatibus placeat itaque magnam culpa pariatur dignissimos et quia nam molestiae quam culpa est ut sed qui possimus ea maiores nostrum sint eum cum quae deserunt numquam in error ipsam nostrum explicabo enim placeat recusandae ut fugit maiores aut a sint dolores consequatur nostrum commodi quaerat vero dolore asperiores corrupti voluptatem quibusdam odio inventore aut voluptatum quia praesentium molestiae at laudantium quia et ullam id libero libero amet veniam qui magnam et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-19', '2017-05-14 04:17:40', '2017-05-14 04:17:40');
INSERT INTO `lesson` VALUES ('750', '1', 'Libero molestiae ratione aut fuga reiciendis perferendis saepe omnis harum.', 'Voluptatibus repellat deleniti at omnis eius incidunt ut dolores delectus asperiores nihil et facere earum est est eaque ut repellat impedit odio commodi optio ullam ea dolor molestiae nobis est atque consequatur sed voluptas odit voluptatem fuga voluptas illo saepe illo labore excepturi ut fugiat eveniet reprehenderit est assumenda sequi praesentium occaecati itaque sit possimus ex labore id est aut expedita quia fugiat consectetur est quia maiores ullam fugiat ipsa repudiandae deserunt hic voluptatum est rem culpa totam inventore nam consequuntur sit iusto quisquam rem molestiae quos officiis itaque sint qui quisquam a ullam atque sit ipsa placeat nam esse sed porro eos earum sit sunt et quis officia porro beatae vitae non et unde possimus soluta voluptas qui reprehenderit sit necessitatibus quibusdam sit tenetur eum tempora eaque aperiam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-16', '2017-05-14 04:17:40', '2017-05-14 04:17:40');
INSERT INTO `lesson` VALUES ('751', '23', 'Accusamus est dolorem ab corporis perferendis aut magnam.', 'Molestias eligendi animi molestiae qui est corrupti qui ut pariatur dolores veritatis beatae et minus ut placeat natus in quam est reprehenderit optio impedit repudiandae voluptas est doloremque possimus neque reiciendis dolore corporis ut quaerat voluptatibus quo autem suscipit aut et recusandae consequatur ullam qui itaque ut aut ad earum atque nemo a reiciendis ut officiis voluptatibus at qui rerum omnis accusamus dolorem doloribus voluptatibus est vitae excepturi aut necessitatibus architecto laborum cupiditate sit inventore quisquam sed veniam sapiente quis repellendus aliquam debitis explicabo.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '47', null, '0', '1', '2017-05-18', '2017-05-14 04:17:40', '2017-05-14 04:17:40');
INSERT INTO `lesson` VALUES ('752', '10', 'Perferendis vero quod aliquid atque ut unde quo atque accusamus aspernatur.', 'Quas quos qui et veniam soluta qui culpa fuga perspiciatis aspernatur fugiat tempora tempora est aliquam dolore est voluptates voluptates aut minima consequuntur assumenda et eos dolores autem voluptatem nostrum sit corporis explicabo est similique soluta ipsum sunt assumenda rerum voluptatem iusto impedit aspernatur et accusantium quia et ut itaque quod voluptatem beatae corporis facere aut provident et harum sit quia autem tempora molestiae quo perspiciatis doloribus voluptas voluptatem dolorem ullam voluptatem maiores dolor hic sit aliquam ut qui ut eligendi reiciendis inventore maiores soluta sit consequatur adipisci cupiditate voluptates et eaque enim modi et quia voluptatum laborum qui reiciendis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '36', null, '0', '1', '2017-05-14', '2017-05-14 04:17:40', '2017-05-14 04:17:40');
INSERT INTO `lesson` VALUES ('753', '24', 'Enim ea omnis architecto dolores omnis.', 'Sunt ipsa doloremque non id quis temporibus id eos sapiente suscipit delectus nulla recusandae dolores soluta asperiores iure non placeat consequatur tenetur blanditiis sit voluptas nemo nemo doloremque in quam placeat molestias voluptatem id rerum distinctio quaerat eveniet laudantium sed est est ut quia libero labore ut reprehenderit praesentium voluptatem necessitatibus ipsum itaque ullam ducimus est rerum est tempore aspernatur libero quam qui tempore magnam consequuntur ad omnis vel exercitationem quam error et facere iure nostrum id accusamus sint incidunt quam consequatur est aliquam cum ducimus odit repudiandae.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-18', '2017-05-14 04:17:40', '2017-05-14 04:17:40');
