INSERT INTO `lesson` VALUES ('755', '23', 'Error culpa et quos molestiae.', 'Sunt et eos dicta eveniet porro labore ut non consectetur unde facilis ut eveniet nihil qui fugit quibusdam veniam aut iusto aut exercitationem libero sunt impedit voluptatem deserunt consequatur magnam ea aperiam ipsum voluptatem deleniti dicta porro voluptatem aut optio officiis dicta ea quo ut aut aliquam a repellat temporibus tempore ut et eligendi velit iste voluptatem ipsam molestiae perferendis sit ducimus perspiciatis ut sunt aliquid assumenda quis nisi enim nemo facere amet vel at pariatur nostrum qui inventore labore vero qui modi maiores quia atque dolore.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '27', null, '0', '1', '2017-05-17', '2017-05-14 04:17:41', '2017-05-14 04:17:41');
INSERT INTO `lesson` VALUES ('756', '21', 'Tempora et dolorem quia maxime.', 'Molestiae accusamus consequuntur consequuntur sit possimus expedita dolor exercitationem totam blanditiis assumenda quas reprehenderit sit dolores iure sit ut cupiditate repellendus cumque nam in non voluptates sint ex consequatur eum unde et qui in dolorum est nihil non suscipit esse qui numquam impedit illo facilis quo tempore omnis repellendus eius ipsa sapiente unde eaque voluptatem doloremque nihil reprehenderit minima et officiis amet architecto voluptatum esse reiciendis ipsam exercitationem voluptas eveniet velit nobis consequatur voluptatem unde iusto adipisci illum porro reiciendis odit tempora sed qui eaque qui quibusdam sunt id dolor maxime iste voluptatum tenetur molestias est veritatis itaque qui reiciendis aut quasi occaecati accusamus ipsam blanditiis enim aliquid.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-18', '2017-05-14 04:17:41', '2017-05-14 04:17:41');
INSERT INTO `lesson` VALUES ('757', '15', 'A quos et libero quisquam veritatis eum.', 'Totam magni dolorum omnis ipsa soluta tempore amet dolorem deleniti ut omnis quo praesentium eum beatae quia doloribus quia fuga id dolore possimus eius consequatur atque minima unde aut ab voluptatem aut totam dolorem quasi aliquid veniam vel debitis sit voluptates sit ut qui officia incidunt ipsa voluptates natus beatae et consequatur natus dolorem tenetur nam ducimus soluta perferendis recusandae doloremque quos quam nostrum aut quasi illum omnis minima voluptatem consequatur velit dignissimos dignissimos expedita quos eum nam est aut dolor ut consequatur aut ipsum nisi eos et iusto voluptates ullam autem laboriosam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '24', null, '0', '1', '2017-05-14', '2017-05-14 04:17:41', '2017-05-14 04:17:41');
INSERT INTO `lesson` VALUES ('758', '9', 'Culpa vel perspiciatis eos commodi velit autem.', 'Voluptatem eum et nemo possimus et at eum eveniet sit at eaque voluptatibus minus natus dolore sit asperiores sit qui eos aut modi eveniet minus necessitatibus iste ad ut fuga perferendis magnam praesentium repellendus odit enim qui dolorum sit commodi quo ullam repellendus libero harum dolorem deserunt suscipit voluptas corrupti ea corrupti modi ut ipsam accusantium dolor omnis sint debitis magni rerum hic optio temporibus et mollitia dolore nihil possimus delectus deserunt deleniti inventore.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '30', null, '0', '1', '2017-05-17', '2017-05-14 04:17:41', '2017-05-14 04:17:41');
INSERT INTO `lesson` VALUES ('759', '25', 'Aut suscipit consequatur minima iure doloremque ratione voluptas.', 'Neque expedita laboriosam voluptates animi ea laboriosam aut est eveniet aut fugiat qui odio voluptas et aut magni rerum eum et asperiores aliquid aut dolorem non iste maiores pariatur ut culpa hic architecto assumenda iusto recusandae dolor ut ut autem nihil enim sed molestias cum voluptatem quis asperiores eos qui asperiores debitis recusandae id quaerat quidem magni nobis ut voluptas commodi ut at qui asperiores eaque iste mollitia et molestiae et asperiores quam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-14', '2017-05-14 04:17:41', '2017-05-14 04:17:41');
INSERT INTO `lesson` VALUES ('760', '15', 'Tempore assumenda minima eum facere exercitationem quod odio ea ratione harum.', 'Officia aut nesciunt explicabo sed ullam alias occaecati id consequatur fugiat ipsam aliquid voluptate quia perferendis sed quidem quis suscipit nihil cupiditate laboriosam debitis quis qui voluptatum quasi expedita quia rerum optio perspiciatis nisi temporibus aut repellat debitis fugit quia laudantium ut animi fugit eveniet doloremque delectus at quis repellat officiis sed et mollitia ut quo quas voluptatem numquam est eveniet ut rerum enim exercitationem vel non aut omnis voluptatem in architecto nam reprehenderit vel quia ullam iure error vel quis ad eos maiores iure inventore fugit et velit omnis atque ullam architecto beatae quia tenetur consequuntur culpa nisi excepturi odio optio corporis aut nulla recusandae numquam nam nobis dicta et qui rerum animi et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-17', '2017-05-14 04:17:41', '2017-05-14 04:17:41');
INSERT INTO `lesson` VALUES ('761', '10', 'Quia modi dolor laudantium earum reprehenderit et.', 'Quia et hic consequuntur enim fuga dolores quos sit aliquid ut minus sint nihil aut sit nulla maxime dolor ab ipsam pariatur omnis sit omnis deserunt veritatis labore cumque dicta laudantium dolor aperiam saepe veritatis molestias quod in magni ut quibusdam assumenda laboriosam laboriosam nam ex officia velit vel ab iusto cupiditate fugiat fugiat quis beatae odio harum exercitationem quae facere nobis maiores quisquam maiores sint qui non sint aut repudiandae officiis qui nobis tempore amet et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '20', null, '0', '1', '2017-05-16', '2017-05-14 04:17:41', '2017-05-14 04:17:41');
