INSERT INTO `lesson` VALUES ('763', '18', 'Enim reiciendis ea id commodi quia dolorem qui.', 'Ut libero autem dolor similique ullam sed tempora non dolore voluptates inventore necessitatibus laborum sed perspiciatis exercitationem provident eum illum animi nihil quaerat harum quaerat voluptates doloremque est eum vero quis placeat ullam et repellendus laboriosam velit et vel est delectus magni deleniti tempore quam porro consequatur laudantium quia voluptatem ut voluptatem rerum ea id qui et veritatis voluptas consequatur deleniti magni occaecati modi ut reiciendis necessitatibus accusantium vitae totam et earum nobis enim dolores eos nam iure molestiae nihil distinctio voluptatem inventore ut est id ducimus saepe iusto voluptatibus similique harum id praesentium et nam molestiae asperiores saepe aut velit commodi qui explicabo eligendi esse et dicta quos id eum corrupti quia et libero.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-17', '2017-05-14 04:17:41', '2017-05-14 04:17:41');
INSERT INTO `lesson` VALUES ('764', '9', 'Labore perferendis corrupti voluptatem neque praesentium laudantium.', 'Aliquid facilis eum voluptas sint deserunt eos et id eius alias molestias iusto perferendis omnis maxime omnis autem laboriosam neque vero odit molestiae at omnis aliquid aut esse accusamus et eaque ab laboriosam maiores pariatur temporibus suscipit et eos aut et unde rerum voluptatibus maxime ea deleniti nostrum enim hic incidunt rem ratione tempora rerum earum libero esse perferendis possimus qui velit vel rerum voluptatem omnis dolor blanditiis deserunt delectus ut non similique nisi blanditiis excepturi quia voluptates est et voluptatem ullam nisi illum quo quae velit nisi accusamus totam modi laudantium natus eos voluptatem ullam asperiores sit id unde vero modi dolor neque iure tenetur sit amet illum est nostrum ut neque ut velit sit nisi culpa alias ut facere sed nihil incidunt commodi quo aut voluptas sapiente minus a.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '28', null, '0', '1', '2017-05-19', '2017-05-14 04:17:41', '2017-05-14 04:17:41');
INSERT INTO `lesson` VALUES ('765', '28', 'Et corrupti aut earum porro quidem quidem aut quasi.', 'Ratione nihil aut laborum sit ullam autem atque aut natus occaecati ullam asperiores nobis autem odio praesentium magni unde dicta reprehenderit ullam incidunt enim tempora nihil itaque sint illum unde ipsam velit repudiandae quisquam et deleniti sint rerum veniam eaque molestiae quia voluptatem soluta architecto sint ratione aspernatur dolore eveniet velit et voluptatem voluptas esse voluptatem magni quis at omnis sit minima nostrum expedita repudiandae aliquid sed ea id et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '39', null, '0', '1', '2017-05-15', '2017-05-14 04:17:41', '2017-05-14 04:17:41');
INSERT INTO `lesson` VALUES ('766', '7', 'Sapiente debitis voluptas officiis culpa voluptatum voluptatem.', 'Et quia quis voluptas vel sapiente totam et fugit voluptatem repellendus dolor ut et laboriosam est unde id eveniet et quia aperiam et totam quod quo numquam velit qui voluptatem et neque quisquam eum mollitia aut ex laborum aperiam ipsum voluptatibus deleniti explicabo consectetur eos debitis soluta consequatur voluptas voluptas ea corporis iusto ea et harum qui reiciendis quia non est magnam eligendi enim ut perspiciatis ducimus facilis voluptatem similique ad enim quo corrupti voluptates eos maiores magnam iusto animi sequi sed beatae quas officia officia autem cumque.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-18', '2017-05-14 04:17:41', '2017-05-14 04:17:41');
INSERT INTO `lesson` VALUES ('767', '25', 'Harum qui doloribus praesentium beatae magnam facilis ipsum tempora autem harum.', 'Et nihil non non dolorem expedita nihil nam eveniet sapiente voluptatum eos earum eveniet libero magni ab quasi qui ut quo ipsa quia esse ipsam porro quibusdam et rerum quisquam tempore non et asperiores ipsam reiciendis non aut adipisci et et doloremque sint magni dolorum molestiae voluptatem voluptas omnis sit rerum dignissimos autem quod ut eos autem eaque illum officia in eaque deleniti esse in distinctio ut atque facere aut aut consectetur voluptatem doloremque assumenda harum qui recusandae quas quia commodi similique aut sit voluptatem consequuntur sit architecto et natus eum maxime commodi cupiditate vel quos quia incidunt ad corporis est nobis asperiores harum et dicta ratione quaerat voluptatibus repellendus voluptatem natus atque provident ut error earum unde natus autem labore est non dolorem sunt dignissimos ut consequatur velit ut rerum nihil autem quia molestiae nesciunt et aut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-19', '2017-05-14 04:17:41', '2017-05-14 04:17:41');
INSERT INTO `lesson` VALUES ('768', '28', 'Expedita laudantium dolores adipisci quibusdam voluptatum quo quis ut aut.', 'Et nam corporis et repellat non repudiandae facere est sed necessitatibus sit fugiat ad eum officia voluptate sit eum consequatur reprehenderit ex incidunt exercitationem asperiores officiis quod dolor debitis animi odit et facere qui suscipit amet porro maxime voluptatibus ea aliquid culpa cum mollitia sunt sit alias explicabo laudantium atque ab mollitia temporibus eveniet numquam ut qui enim nisi sit velit officia nobis vero ea officiis soluta voluptatem enim asperiores et reiciendis et placeat quibusdam odio magnam et corporis qui perspiciatis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '22', null, '0', '1', '2017-05-15', '2017-05-14 04:17:41', '2017-05-14 04:17:41');
INSERT INTO `lesson` VALUES ('769', '1', 'Ea in ut aut maxime est rerum nihil.', 'Qui quos nam omnis sed pariatur nisi ut voluptas nesciunt error accusamus sed maiores debitis ea excepturi occaecati quia natus omnis sequi ea fugiat velit non fuga consequatur dolorem laborum enim qui animi sunt praesentium veniam tenetur et repellendus est perspiciatis neque sapiente voluptatem ut nihil dolor tempore voluptates enim ipsum inventore saepe cupiditate perspiciatis corporis ullam sapiente laborum dolores nulla vero cumque velit magnam dolorum amet quia et sit culpa beatae incidunt ut facilis temporibus quam sed possimus quaerat omnis porro accusamus et veniam atque dolores autem inventore voluptas quidem sit consequatur velit est autem accusamus quia est rerum laborum neque non culpa accusantium et in rerum dolor omnis voluptas cupiditate quas nam eum ullam ipsum ut non quae voluptatem quia nisi itaque blanditiis ut ut incidunt et facere eum beatae quia quibusdam qui dolor numquam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-17', '2017-05-14 04:17:41', '2017-05-14 04:17:41');
INSERT INTO `lesson` VALUES ('770', '1', 'Nam recusandae laboriosam qui fugit voluptates alias sint voluptas delectus aut.', 'Eveniet sed soluta quasi corporis voluptates quam sapiente debitis perspiciatis ad dolorum labore delectus atque qui reprehenderit nostrum consequatur aliquid nihil voluptas aut et eum cumque aliquam dolor autem doloremque numquam magnam veniam id distinctio quo occaecati aut consequatur corporis mollitia ut blanditiis ipsa ex voluptas quia ut dolorem iste eos quia ad officiis facere neque perferendis quia odio et neque ab tenetur omnis et beatae cum voluptatum esse cumque qui libero tenetur fugit necessitatibus suscipit commodi harum qui blanditiis exercitationem voluptas illo saepe distinctio tenetur commodi tenetur tempore vel tempore et iste est enim ipsum et quia nulla deleniti ut voluptatem ratione nesciunt rem velit aut eum corrupti cum minima numquam molestiae sint adipisci id incidunt molestiae sint maxime eum quibusdam illo.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-19', '2017-05-14 04:17:41', '2017-05-14 04:17:41');
INSERT INTO `lesson` VALUES ('771', '11', 'Voluptas non corporis et maiores autem enim.', 'Possimus est impedit deleniti ex sequi autem accusamus et eligendi dolorem ut non dolorem corrupti et praesentium est exercitationem ut numquam voluptatum soluta at quas voluptas velit modi dolor quo earum est itaque at consequuntur corporis fugiat repellendus corporis ducimus quia et distinctio at consequatur libero harum aspernatur et rerum ipsum suscipit est est consequuntur exercitationem quia ut magnam sit est et est consectetur vitae praesentium exercitationem asperiores aut accusamus illo hic quo ad quam amet ipsa aut ipsum similique officia velit ut qui beatae repellendus nam in molestiae eveniet hic autem voluptatem nemo.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '28', null, '0', '1', '2017-05-18', '2017-05-14 04:17:41', '2017-05-14 04:17:41');
INSERT INTO `lesson` VALUES ('772', '17', 'Voluptates magnam eum et facere omnis sunt odit recusandae est.', 'Id rerum magni qui voluptatum impedit ratione suscipit nihil libero esse suscipit fuga reprehenderit quis consequatur cum consequatur asperiores iusto iusto dolores temporibus porro nam adipisci incidunt quia doloremque autem laudantium dignissimos ratione quidem rerum dolores cumque eveniet quasi blanditiis in perferendis qui nesciunt voluptatem quisquam fugit voluptates dolorem eaque dolores autem provident cumque ut quia est mollitia accusantium eaque enim dolorum sint aliquid ex quis explicabo facere sit est assumenda doloribus qui nostrum nostrum maxime natus deleniti consequuntur deserunt sint praesentium in a ut nisi velit corrupti odio voluptate sapiente et similique.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-18', '2017-05-14 04:17:41', '2017-05-14 04:17:41');
INSERT INTO `lesson` VALUES ('773', '16', 'Ipsam magnam esse aliquid facilis harum saepe quas natus tenetur sint.', 'Inventore ut id voluptate voluptatum eligendi molestias dolor in ipsa deleniti minus assumenda mollitia quia officia dolorum veritatis aut ullam eaque quidem quod libero dignissimos laboriosam consequuntur impedit quia ut laudantium id velit perferendis vel soluta et ipsum a quo et rerum dolores sit cumque voluptatem voluptate ut eos et exercitationem asperiores ipsa officiis sit minima animi similique hic beatae rerum cumque et magni ut magni mollitia non ea.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '24', null, '0', '1', '2017-05-14', '2017-05-14 04:17:41', '2017-05-14 04:17:41');
INSERT INTO `lesson` VALUES ('774', '1', 'Et omnis quia enim amet rem laudantium nihil cumque.', 'Aut veniam corrupti tempora qui delectus perferendis qui aut alias quisquam adipisci officiis non quia ipsam modi minima nobis sunt earum dolorum nulla culpa itaque voluptatem consequatur optio quisquam et voluptatem fugit velit esse assumenda magni veniam a distinctio distinctio cumque ab consequatur alias ipsam illum laboriosam et provident distinctio sed sed in cupiditate velit quia illum eveniet voluptate molestias et eos excepturi aut necessitatibus eligendi sunt id nihil amet porro corporis excepturi dolores nulla rerum deleniti cumque quibusdam dolores nemo totam autem occaecati eligendi impedit nihil ad rerum corporis beatae ut unde voluptatem aut quia error quidem quo quasi ad molestiae minus non consequuntur provident quis est.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-19', '2017-05-14 04:17:41', '2017-05-14 04:17:41');
INSERT INTO `lesson` VALUES ('775', '10', 'Velit ut explicabo quae quis eveniet asperiores nisi eos expedita facere.', 'Aliquid laudantium aut consequatur soluta neque quis omnis non dolor voluptatum hic id voluptas maxime commodi facere reprehenderit fugiat doloribus consequatur dolorem voluptatem explicabo expedita et cupiditate omnis autem aut facilis maxime sit odit consectetur totam recusandae quos minus possimus laboriosam repellendus dignissimos aspernatur cum voluptatem ipsum impedit quam ducimus aut molestiae error qui voluptatem et non eos minus nostrum ut sit aut iure qui soluta rerum animi voluptas facilis eius omnis optio magnam aut culpa porro in maiores quasi dignissimos et et odio et mollitia sint et eligendi omnis eum aliquam laborum ut deleniti suscipit sed quia eius ipsam distinctio non ut sequi vero hic omnis qui expedita optio doloremque quis iusto voluptatem dignissimos nihil reiciendis velit maiores qui odit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-18', '2017-05-14 04:17:42', '2017-05-14 04:17:42');
INSERT INTO `lesson` VALUES ('776', '22', 'Qui consequatur vero voluptatem velit nulla.', 'Sed eum doloribus repellendus animi facilis voluptatem adipisci est quam velit inventore ut nulla eos autem possimus voluptate autem et fugiat doloribus nesciunt cum sunt quo voluptate culpa et consequatur voluptatem quia voluptas temporibus quo et dolor reprehenderit et officiis aliquam ea officia assumenda at ad dicta dolor aut dolore hic alias pariatur aut libero quas maiores officiis eos impedit quasi placeat perspiciatis maxime quis laborum non ea sit qui nemo possimus ab dolor suscipit perspiciatis voluptas hic in vero non ut consectetur atque voluptas voluptatem aut eos corrupti totam odit cumque ut necessitatibus dolor dolorem dolorem enim consequuntur ipsum quo explicabo dolorem corrupti libero explicabo dolorem id qui fugiat rem voluptatum quisquam accusantium rerum et laboriosam provident esse rem quis perspiciatis aut nihil molestias quasi modi aut qui adipisci ab quo quo maiores molestiae.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-16', '2017-05-14 04:17:42', '2017-05-14 04:17:42');
INSERT INTO `lesson` VALUES ('777', '25', 'Odit vel asperiores officiis omnis delectus optio.', 'Nihil odio ut est aliquid quisquam expedita nostrum aut blanditiis odit sint fuga nihil aut illum eos repellendus numquam et optio veritatis ipsum nobis rerum neque delectus est ad id fuga cumque dolor minus ipsa dignissimos et enim expedita necessitatibus eos cum ab debitis cumque quia sapiente dolor soluta soluta sint repellat voluptas et illo eos qui unde aut et similique sed perferendis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-18', '2017-05-14 04:17:42', '2017-05-14 04:17:42');
INSERT INTO `lesson` VALUES ('778', '13', 'Quisquam est quos et facere aut soluta quo.', 'Laborum tempora perspiciatis repellendus illo ab impedit accusamus exercitationem expedita reiciendis assumenda doloremque voluptate animi quaerat vero expedita voluptatibus dolores accusamus velit eos in molestias dolorum quia nesciunt in hic beatae illum qui in quis pariatur quas in ipsa quia corporis molestiae mollitia atque nobis nam eaque laudantium totam fuga et sint consequuntur quia enim voluptatem sunt error temporibus deserunt rerum et alias dolorem eos quia ut aut ea aut sed corrupti error id eum sunt provident omnis facilis et sint nobis vitae nam repudiandae a modi quis ea quia optio ut perferendis delectus nam et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-18', '2017-05-14 04:17:42', '2017-05-14 04:17:42');
INSERT INTO `lesson` VALUES ('779', '18', 'Expedita nostrum accusantium neque tenetur et tempore libero iure voluptatum repellendus.', 'Consectetur animi ea velit delectus vel sed et aliquam iusto consequatur deleniti sint ut quisquam quidem facere aut corrupti cumque suscipit atque eius et itaque ducimus necessitatibus totam ut cupiditate error facere aut autem dolores velit ut facere explicabo dolorem deserunt libero accusamus nesciunt qui deserunt ut excepturi sit rerum facilis non dolor voluptas optio numquam ipsam quas esse quidem maxime.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-18', '2017-05-14 04:17:42', '2017-05-14 04:17:42');
INSERT INTO `lesson` VALUES ('780', '6', 'Inventore ullam tempora amet perspiciatis quia ut quia.', 'Esse iure omnis sunt quae repudiandae in totam voluptas et recusandae accusamus doloribus cumque dignissimos ut perspiciatis necessitatibus dolorum magni minus deleniti officia doloribus id tempora ipsa voluptate consequatur et ipsa non voluptatum mollitia expedita id non vel commodi non aperiam est quis corporis distinctio error aut alias inventore maiores mollitia libero neque minus earum quibusdam dolorem qui alias maxime ea omnis occaecati maiores dolorem maxime rerum velit occaecati non aspernatur est nam enim sed laudantium eum et aspernatur ducimus nobis commodi dignissimos consequatur voluptatibus omnis maiores earum voluptatem a molestiae quidem dolorum quo at aut ut eum excepturi facere sint perferendis officiis ea quos magnam dolore nihil quo quis officiis nisi laborum repudiandae sed doloribus ea tenetur et autem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-19', '2017-05-14 04:17:42', '2017-05-14 04:17:42');
INSERT INTO `lesson` VALUES ('781', '9', 'Totam quo non saepe vel non et.', 'Qui delectus similique consequatur est aut quasi nulla nihil repellendus aut aut quia ut rerum sed laudantium eos molestiae amet dicta dolores nobis eaque officia voluptatem nihil fugit quod sint voluptates ab excepturi aut sit dolores eos laboriosam inventore autem sit reprehenderit ut necessitatibus ducimus repudiandae ratione nihil dolorum possimus corporis qui beatae magni quo consequuntur sequi voluptatem voluptatibus sed sequi est consequatur maxime cupiditate nihil blanditiis et rerum quia qui dolor ipsum optio officiis molestiae dolores at est dignissimos ducimus impedit nesciunt quia sequi tempora temporibus eos tenetur aut tempore repellat minus natus ut vero reprehenderit iste quasi harum atque voluptatum aut provident voluptatem eum rerum commodi accusamus est iure voluptatem culpa eaque cum optio facilis vitae ut nostrum ea.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-17', '2017-05-14 04:17:42', '2017-05-14 04:17:42');
INSERT INTO `lesson` VALUES ('782', '14', 'Rerum nihil nihil nemo recusandae adipisci aperiam officiis suscipit consectetur.', 'Vel necessitatibus voluptate cupiditate perspiciatis nihil quod qui aspernatur aut nam amet voluptatibus deserunt earum illum consequatur aliquid enim explicabo voluptas adipisci sed ullam ipsa neque saepe placeat itaque id voluptas ea quia consequatur dolorem culpa voluptatibus labore officia culpa odio odio earum voluptatum porro est cumque vero enim delectus omnis sed eligendi dicta rerum repellat adipisci harum sint a rem consectetur quibusdam vel veniam impedit impedit est eveniet autem aut unde autem dolorum et hic animi non consequuntur dolores quidem numquam illo amet ducimus qui quod exercitationem et expedita in molestias.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '31', null, '0', '1', '2017-05-18', '2017-05-14 04:17:42', '2017-05-14 04:17:42');
INSERT INTO `lesson` VALUES ('783', '25', 'Nostrum id ullam itaque nihil cumque beatae ea saepe.', 'Vel quas est sapiente qui itaque aut dolorum dicta veniam est voluptatum nisi aut saepe omnis labore veniam corrupti debitis numquam quia eius tenetur ab quis sit aut dicta aliquam quod necessitatibus recusandae voluptates mollitia libero ipsa ipsa suscipit ab nihil rerum debitis sed optio quam incidunt officia ut consectetur eos quae distinctio aut fuga et fugit dolores officia ut nesciunt ullam nesciunt et omnis accusamus odio deleniti occaecati nihil aspernatur architecto aut nihil et nemo dolores doloribus et laudantium sapiente libero aliquid deserunt quia molestiae sit praesentium similique quis tempore distinctio in inventore nihil et omnis ut facere rerum illum dolore sit doloribus fugiat nobis adipisci laboriosam voluptatum a dolorem suscipit est quis provident omnis consectetur sapiente ut distinctio quaerat quidem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-19', '2017-05-14 04:17:42', '2017-05-14 04:17:42');
INSERT INTO `lesson` VALUES ('784', '16', 'In voluptatem alias pariatur est expedita voluptatum suscipit optio deserunt.', 'Laudantium consequatur dolor assumenda nesciunt et repudiandae voluptatem voluptates ratione placeat mollitia vero laboriosam ut ut sed assumenda hic ea sint eligendi corrupti repudiandae nihil qui commodi minima ut quis voluptatem delectus voluptatem qui delectus rerum earum vero delectus nulla quae dolores dolore rerum tempora similique quo cum sed dolorem asperiores id mollitia velit saepe et ipsum nobis id consequatur unde in optio modi nulla vel ea explicabo eaque ullam consequuntur maxime doloribus dolore dolores quidem et maxime culpa consequatur quia aliquid tempore animi veritatis veritatis ipsum error nisi neque molestiae officiis dicta debitis aperiam ut dicta fugit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-19', '2017-05-14 04:17:42', '2017-05-14 04:17:42');
INSERT INTO `lesson` VALUES ('785', '8', 'Dolore recusandae nam ad at facere maxime sint vel corrupti aspernatur.', 'Maxime aliquam aut consequatur possimus tenetur nemo saepe inventore ad doloremque voluptatem assumenda velit quaerat excepturi ut facere consequatur rem sit veniam harum culpa nihil voluptatibus excepturi eos tenetur ipsum sed iure ullam blanditiis omnis nam quos neque corrupti voluptas nam consequatur commodi numquam vitae enim ut hic occaecati quas eos dolores cum laboriosam et unde animi repellat et nam aut et nihil enim autem ut praesentium rerum asperiores enim consectetur illum dignissimos dolores eius soluta iusto eveniet dolor porro illum et tempora non voluptates non quos non qui nihil eum sit labore velit excepturi quae libero consequuntur in culpa molestiae.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-18', '2017-05-14 04:17:42', '2017-05-14 04:17:42');
INSERT INTO `lesson` VALUES ('786', '18', 'Dolorem aspernatur ut minus recusandae repudiandae minus dolores velit.', 'Aut voluptas perferendis assumenda quis dolorem nisi necessitatibus deserunt autem perferendis consequatur quas aliquid reprehenderit asperiores qui eveniet et in est ullam vel ad eos et dolor quia dolores nemo nisi amet aut rerum dignissimos praesentium est exercitationem eum perspiciatis praesentium voluptate temporibus eveniet eum et cum eligendi labore enim deleniti a repudiandae dicta impedit non iure quos voluptatibus nostrum mollitia porro nulla ut ullam et eius veniam dolorem facilis dolor fuga omnis voluptatem accusantium dolores aut non consequatur et dolor minima et fuga quia sit quaerat nam ad ullam et corrupti minus voluptas praesentium consectetur est numquam repellendus quaerat error quia alias temporibus laborum dolor in et eaque commodi porro ipsa sit voluptates cupiditate iusto.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-19', '2017-05-14 04:17:42', '2017-05-14 04:17:42');
INSERT INTO `lesson` VALUES ('787', '17', 'Iure vel debitis quod voluptas consectetur ducimus est veniam cumque molestias.', 'Vero dolorem aut ipsum recusandae officiis omnis et voluptatem illo et enim facilis est amet magnam nihil eos magni corrupti neque voluptas eum quo hic dolorem laboriosam aut quod amet quos recusandae corrupti tenetur ea pariatur autem illo illo ullam nemo laborum velit ea quaerat est consequatur quam quibusdam excepturi impedit minus aut omnis magni voluptatem possimus non molestias repellendus ea omnis doloribus magnam soluta assumenda doloribus cumque et et vel cumque ipsam saepe aspernatur quis voluptatem est deleniti illum dicta beatae expedita neque doloremque consequatur consequuntur ut maxime maiores et iste et alias sed dolorum aut fugit minus eligendi at praesentium eius dolorem iusto repellat illum voluptatem ut fuga sed necessitatibus quisquam recusandae beatae quia officia velit est est quis eaque consequatur ut dolorem sequi aut dolorem modi illum et saepe inventore corporis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-16', '2017-05-14 04:17:42', '2017-05-14 04:17:42');
INSERT INTO `lesson` VALUES ('788', '4', 'Ut at impedit eos deleniti qui hic aut nihil.', 'Est dicta sit voluptatum cum qui non et non sint est nihil sequi consequatur voluptatem rerum corrupti qui mollitia voluptate enim eligendi ea rem ipsam quo ea unde molestias occaecati nesciunt itaque quod aut inventore molestias quis debitis ratione veniam exercitationem eius iste vel consequatur fugiat labore laboriosam saepe voluptas qui fugit voluptatem sed incidunt iusto fugiat facilis eos dolore sed nam eum natus eos praesentium sit et dolor qui eos omnis consequatur repudiandae tempora non omnis non cupiditate aliquam consectetur amet iure est adipisci cumque aperiam esse ratione et qui quia molestiae iste est aut sit at saepe sit quis cumque non et in ex ratione quisquam sed ut natus voluptatem molestiae recusandae incidunt officiis qui nobis eligendi rerum cupiditate.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '45', null, '0', '1', '2017-05-14', '2017-05-14 04:17:42', '2017-05-14 04:17:42');
INSERT INTO `lesson` VALUES ('789', '20', 'Tempora ut eligendi numquam eius voluptatem cumque aut maiores.', 'Odit sunt in deleniti et omnis est et est voluptatem nisi iusto odit ex nam maxime optio tempore non error nobis velit amet cumque consequatur praesentium et nihil reiciendis maxime dolor reiciendis vel ut libero inventore reiciendis rem et at quas sunt voluptatum incidunt porro nihil beatae doloremque accusantium dolorem qui assumenda voluptas suscipit animi officia et quis aperiam non sed enim accusantium perspiciatis ut eaque dignissimos sapiente placeat quo rem fuga quo possimus consequuntur ut ratione tempora quia vitae dolor sit in earum alias occaecati rerum quae similique in est debitis maxime fugit sit id odio est sed facere ex eligendi illum autem commodi quos vel eligendi debitis velit ea dolores molestias occaecati nulla maiores dolores et illo rerum sed ut nesciunt reprehenderit nihil et corporis enim.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '20', null, '0', '1', '2017-05-16', '2017-05-14 04:17:42', '2017-05-14 04:17:42');
INSERT INTO `lesson` VALUES ('790', '5', 'Modi ab sint qui iusto fugiat qui aliquid dolorem.', 'Incidunt nulla at occaecati aliquid provident autem est nisi eveniet voluptatum tempore exercitationem unde illum dolore nobis recusandae dolorem aut dolore iure eveniet in blanditiis corporis magnam blanditiis culpa maiores maiores illum est voluptatem consequatur ipsam et rerum dolorum adipisci alias qui ullam consectetur illo quo est labore assumenda delectus quia sed laudantium consequatur itaque ut blanditiis eius illo esse delectus eligendi nemo explicabo consequatur blanditiis et incidunt tenetur sit qui ea labore atque dolorem et cum et non consequatur voluptatem consequuntur amet occaecati esse odit ut quaerat voluptatem officiis ut consequuntur non esse pariatur illum ut aut aut sapiente quam sed alias voluptate est dolores quia velit iste et veniam tenetur voluptatem adipisci beatae non et sed quia sunt qui vitae aliquam libero consequuntur non amet dolore et qui repellendus sed expedita qui sunt totam sint perspiciatis laborum assumenda molestiae.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-17', '2017-05-14 04:17:42', '2017-05-14 04:17:42');
INSERT INTO `lesson` VALUES ('791', '30', 'A veritatis dolores itaque repellendus ut labore sunt vel voluptatem incidunt.', 'Doloribus quis iste dolorem quo aliquam optio laboriosam est vel dolores nemo beatae eius repellat ducimus aut similique accusantium facilis excepturi nihil quos vel deserunt quo voluptatem distinctio vero in dolorum est sed explicabo dolorem natus facere quo consequatur ut praesentium accusantium facilis impedit voluptas nihil culpa porro ut magnam suscipit error quos accusantium rerum id accusamus quo tempora ut aut odit eos.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-17', '2017-05-14 04:17:42', '2017-05-14 04:17:42');
INSERT INTO `lesson` VALUES ('792', '29', 'Dolore quidem perferendis minima ad asperiores dicta voluptas.', 'Illum nihil soluta qui repudiandae provident unde magnam incidunt aliquid rerum sapiente qui dicta velit laborum provident et deserunt officiis iste iusto in reiciendis maxime beatae qui omnis placeat perspiciatis nobis veniam in officiis nemo est rerum perspiciatis cumque possimus possimus iure est in fugit quaerat nam voluptatem atque iure mollitia a molestiae dignissimos voluptas possimus quia corrupti id cupiditate odio blanditiis laboriosam adipisci eos voluptatem laboriosam dolores corporis sapiente et quam ea culpa est architecto nostrum incidunt fugit qui deleniti commodi optio tempora veniam itaque reiciendis possimus voluptatibus explicabo.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-15', '2017-05-14 04:17:42', '2017-05-14 04:17:42');
INSERT INTO `lesson` VALUES ('793', '28', 'Quam quas est omnis a impedit commodi.', 'Sed et provident deleniti aliquam ullam rem saepe id rem alias porro soluta molestiae qui molestiae doloribus nostrum distinctio dolores incidunt dolores distinctio magnam nulla nam exercitationem culpa nisi veritatis incidunt harum dolorem nihil corrupti harum enim veniam eaque molestias optio nihil enim quisquam sunt quis alias et sit possimus beatae voluptatem culpa accusamus illum officia quo velit mollitia provident modi iste nesciunt quos recusandae aut magni pariatur commodi magni est expedita debitis atque ea repudiandae expedita sint cupiditate id est quo aut dolores velit dolorem ipsum quo enim aut unde aut eaque vel dignissimos voluptas ullam animi unde est voluptas nihil assumenda sunt est est dignissimos quo explicabo inventore qui et voluptatem beatae quod quae ullam earum tempore voluptatem quas explicabo tenetur et expedita dolores modi quidem velit ab adipisci.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-14', '2017-05-14 04:17:42', '2017-05-14 04:17:42');
INSERT INTO `lesson` VALUES ('794', '16', 'Et non a nulla ut.', 'Est harum sint quod repudiandae alias rem eos nostrum assumenda ipsa eum inventore unde quaerat magnam repellendus fugiat quis ipsam tenetur sed doloribus sed inventore mollitia saepe commodi blanditiis labore nobis dolorem nisi et ea aut nesciunt qui sapiente voluptatibus asperiores repellendus qui dolor voluptas ipsam odio fugit eligendi ipsa provident nesciunt sed molestias repudiandae quod ducimus est qui omnis sed temporibus minus et sed consequuntur quibusdam quaerat quis qui facilis natus aliquam quia enim quod sequi labore a enim saepe corrupti beatae error quod rerum excepturi sunt est id aut atque.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-18', '2017-05-14 04:17:43', '2017-05-14 04:17:43');
INSERT INTO `lesson` VALUES ('795', '1', 'Fugiat qui rerum rerum quo beatae dicta deleniti enim culpa laboriosam.', 'Quibusdam optio voluptas tempore accusamus repellendus molestiae velit qui similique officia consequatur non officiis asperiores fugit consequatur velit quia adipisci minus dolores ex aliquam et reiciendis corporis cumque non quidem mollitia consectetur veniam ex et et et a voluptatibus ullam aut quae est et non incidunt ut numquam id inventore sed velit iusto corrupti et modi qui quia quos nihil quibusdam asperiores officiis quam rerum esse officiis voluptas aut facere minus porro placeat non non laborum sit eum voluptas et adipisci quis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-15', '2017-05-14 04:17:43', '2017-05-14 04:17:43');
INSERT INTO `lesson` VALUES ('796', '20', 'Aut consequatur magnam aperiam recusandae itaque aut adipisci hic.', 'Est doloremque quo pariatur rerum velit autem fugiat suscipit suscipit nobis cupiditate id amet fugiat facere nisi eveniet voluptatem omnis cupiditate totam maxime aut ut in nam numquam quia explicabo consequatur dignissimos et ex voluptates eaque et facilis laboriosam sed fugit beatae et sunt eum quis ullam dolor eos ea corporis laudantium quia alias unde et assumenda saepe et quis velit praesentium at voluptatem eos qui et quos magnam hic qui nemo distinctio quos dolores voluptate vel magni nam officiis voluptate qui nisi iusto omnis rerum esse aut officiis suscipit assumenda mollitia dolores quia.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '36', null, '0', '1', '2017-05-15', '2017-05-14 04:17:43', '2017-05-14 04:17:43');
INSERT INTO `lesson` VALUES ('797', '9', 'Molestias soluta nam illum sit non consequatur.', 'Nesciunt sint odio quae quia veniam itaque provident similique quos illum repudiandae cumque neque quod nihil quis error esse amet ipsam molestiae delectus laborum a dolores magnam distinctio et velit ipsa qui qui ab beatae dignissimos unde vitae in ratione deserunt impedit inventore officia dicta dolor in eveniet tempora ullam dolor optio quibusdam cumque impedit aut quia aut est suscipit veritatis sunt quae qui sed officia deserunt impedit vel.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-18', '2017-05-14 04:17:43', '2017-05-14 04:17:43');
INSERT INTO `lesson` VALUES ('798', '27', 'Amet aliquam eum vero dolorum asperiores in ut id natus.', 'Blanditiis alias nostrum quibusdam aut incidunt omnis repellat velit occaecati aut aut voluptatibus commodi voluptas modi libero illo dolorum est incidunt voluptatem voluptas commodi autem illum nisi excepturi hic aut sed illo enim illum non autem omnis deserunt sit dignissimos et repellendus architecto optio reprehenderit explicabo ex voluptatem et doloremque repellat voluptatibus sapiente voluptate repellendus beatae voluptatum sequi quod nihil maiores veniam dicta eius tempora aut libero.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-15', '2017-05-14 04:17:43', '2017-05-14 04:17:43');
INSERT INTO `lesson` VALUES ('799', '29', 'Enim omnis rerum ut et quasi sequi cum voluptatum animi nihil id.', 'Quas laborum qui architecto possimus in placeat veniam perspiciatis magnam asperiores quod ea commodi neque quasi et facere quis praesentium aperiam consectetur ut et saepe velit est recusandae laudantium nihil qui omnis qui aut tenetur repellat nihil porro repellat facere tempore odio asperiores quasi ut qui et voluptas temporibus molestias sapiente vitae sed repellat accusantium molestiae qui et et nisi et vero sunt dolorem tempora est molestiae sed non error minima id est quod quis ut eum reiciendis eos ad autem alias iste et ut sed ipsum laborum id ut unde maxime et quod similique.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '23', null, '0', '1', '2017-05-16', '2017-05-14 04:17:43', '2017-05-14 04:17:43');
INSERT INTO `lesson` VALUES ('800', '20', 'Rerum et in vitae eum est voluptatem incidunt.', 'Voluptatem id facere rerum molestiae mollitia doloremque fuga enim ad voluptatibus et eos dolorum sit impedit blanditiis est rerum voluptatibus corporis rerum debitis eos praesentium ea est dignissimos voluptatem temporibus ut laudantium omnis quas deserunt quidem corporis iusto hic repellendus rerum pariatur ratione culpa qui qui dolores dolorem architecto eius iure inventore possimus vero illo unde fugit laudantium quia eligendi omnis odit facere odio et dolor sit vitae dolores architecto eius corrupti est ipsam rerum debitis autem molestias quia recusandae ipsa laboriosam id dolore minima porro aut dicta explicabo dolor sunt error est incidunt id iure et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-19', '2017-05-14 04:17:43', '2017-05-14 04:17:43');
INSERT INTO `lesson` VALUES ('801', '10', 'Similique et voluptas quae quia et.', 'Enim id exercitationem provident voluptates explicabo assumenda sint dicta corporis et quaerat temporibus nobis eligendi reiciendis autem iusto ut deleniti ullam recusandae dolorem quod repudiandae quaerat tempore magni laudantium fugit sit et numquam velit expedita saepe natus consequatur qui vitae a aliquam et doloribus cumque quis eveniet repellat eos omnis est quis fugiat qui dolore minus deserunt eius ut tempore quis nulla quod minus quia quia adipisci itaque et architecto repellendus nulla totam et corporis et eius doloribus qui ut asperiores quis est odio quibusdam tempore ipsa nulla maxime totam omnis sit unde quasi error enim ducimus et quo beatae ab eius est itaque qui ut aliquid nesciunt voluptate rerum nobis sed nisi qui repellendus aut consequuntur voluptatibus iste quibusdam similique mollitia qui saepe in voluptatum beatae qui aut possimus qui non consequatur ab inventore qui ducimus sed sit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-18', '2017-05-14 04:17:43', '2017-05-14 04:17:43');
INSERT INTO `lesson` VALUES ('802', '3', 'Earum nostrum consectetur accusamus maiores accusantium voluptate et vel et.', 'Aut distinctio labore inventore sunt debitis ullam atque et aspernatur explicabo nisi nobis ea quas laudantium assumenda enim veritatis eaque quos et qui autem fuga cumque velit autem rerum perferendis aliquam ut amet et officiis itaque fugiat quod illum nemo minima rem dolores vero et mollitia eaque eos est doloribus voluptas sit ipsum nemo hic pariatur quod ut repudiandae sint dignissimos sed sed voluptas pariatur sapiente amet culpa nostrum natus atque ut reiciendis error et reprehenderit placeat quasi laborum dolorum nihil neque blanditiis fugit vitae consequatur at et facere quaerat atque molestiae doloribus doloremque dolores cupiditate eum rerum omnis qui laboriosam optio id tenetur omnis corrupti aut hic non deleniti eum nulla ut et ad adipisci ea repellendus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '47', null, '0', '1', '2017-05-17', '2017-05-14 04:17:43', '2017-05-14 04:17:43');
INSERT INTO `lesson` VALUES ('803', '26', 'Fugit fugiat occaecati voluptatem architecto consequuntur.', 'Voluptatem numquam quibusdam debitis voluptas aut maiores corrupti quis earum temporibus itaque et est voluptatem numquam sit autem perferendis libero maxime voluptatem eos recusandae vel repellendus quia et dignissimos illum dolor quia nihil similique voluptatem ipsam aliquid enim aut quia dolores aut debitis provident reprehenderit in rerum sed veritatis vel quia corporis et eum perferendis est sed nihil quibusdam aut sint tempore animi ea temporibus totam consequuntur beatae aut adipisci voluptas ipsa culpa qui quis dicta fugit et reprehenderit quo.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-16', '2017-05-14 04:17:43', '2017-05-14 04:17:43');
INSERT INTO `lesson` VALUES ('804', '11', 'Et magnam enim dicta eum asperiores doloribus eos id iusto eveniet.', 'Accusamus similique dolores sequi quasi non sed reiciendis tempora quam rerum delectus quis tenetur ex dolorum ducimus asperiores et minus incidunt ut qui expedita quam quidem omnis vero ea quis ipsa quos accusamus non itaque minus exercitationem ipsum et consequatur modi possimus tempora qui et sint voluptas et accusamus expedita nihil sit reiciendis neque qui numquam et quasi est accusantium tempora quisquam aut pariatur ea deserunt velit enim esse velit omnis exercitationem minima sequi illo voluptatibus assumenda et vel eius non sed doloremque atque magni provident.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-18', '2017-05-14 04:17:43', '2017-05-14 04:17:43');
INSERT INTO `lesson` VALUES ('805', '1', 'Voluptas nesciunt et ad voluptate neque vero repellat qui.', 'Qui dolore quia perspiciatis ducimus et iste omnis reiciendis unde iste est aliquam sapiente itaque aperiam et voluptatem aut molestiae reprehenderit et et accusantium odit ab et impedit reprehenderit qui ut vitae rem facere architecto tempora inventore consequatur inventore aut aut hic impedit temporibus et sit earum voluptatem excepturi ullam quasi dolore aut dolorem odio maiores doloremque enim adipisci eveniet saepe nostrum optio nobis quo et inventore eos dolore maxime sequi pariatur omnis eum quis quas id molestias quia nam mollitia amet incidunt eligendi exercitationem sed quia commodi sed aut ipsam id sint et magnam sint provident ipsam error adipisci consequatur quo neque soluta molestiae nisi.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-16', '2017-05-14 04:17:43', '2017-05-14 04:17:43');
INSERT INTO `lesson` VALUES ('806', '7', 'Qui sit debitis similique quo quisquam voluptate officia optio expedita fuga.', 'Ullam consequuntur non nobis eius sit consectetur voluptas earum quo et corrupti est consectetur unde rerum delectus mollitia natus libero omnis et quia natus pariatur rerum officia quo perspiciatis perspiciatis ipsum possimus voluptatem qui ratione nemo dolor enim voluptatem deserunt sit omnis omnis quod ea ipsa illo quo magnam hic perferendis occaecati sed beatae deleniti labore qui esse repellendus nostrum ut impedit esse hic ad est laudantium sed.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '28', null, '0', '1', '2017-05-15', '2017-05-14 04:17:43', '2017-05-14 04:17:43');
INSERT INTO `lesson` VALUES ('807', '26', 'Dignissimos enim est quis ut id ut aut quia quis soluta rem.', 'Sit quibusdam quis excepturi quisquam ex fugit quisquam est at rerum qui inventore ipsa aliquid numquam odit quo autem placeat expedita et qui autem eaque qui rem vel enim quisquam et et reiciendis est illo quo vitae sed natus impedit unde dolor et sunt id cum distinctio reprehenderit maxime in cupiditate est qui quo soluta perspiciatis fugit quidem hic molestias ad qui hic voluptatibus consequuntur doloribus qui modi illum veniam perspiciatis cumque excepturi animi in totam sit qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-14', '2017-05-14 04:17:43', '2017-05-14 04:17:43');
INSERT INTO `lesson` VALUES ('808', '26', 'Id voluptatibus sit commodi nihil dolorem ut placeat id.', 'Est voluptatem unde minima sit est facere aut animi eos veritatis ut soluta eligendi et quis quidem accusamus molestiae adipisci sunt perspiciatis ut ut qui totam adipisci id facere odio temporibus dolore blanditiis laudantium et ducimus non a aut perferendis est dolor vero optio sapiente est maxime inventore voluptatem dolore consequatur aliquam velit eum molestiae non voluptate blanditiis repudiandae odit dolores est sunt dolor sint dignissimos dolor quia voluptatem enim et ut officia aut est reiciendis est facere necessitatibus odio rerum earum provident adipisci et culpa molestiae sint molestiae vitae velit perspiciatis officia voluptates rerum aut alias voluptatem vero ex aliquid facilis similique exercitationem labore ipsam consectetur doloremque culpa adipisci consequuntur placeat et nihil porro dolores quibusdam similique quo numquam dignissimos incidunt ullam et hic ut similique maxime quia praesentium aliquam mollitia ipsum libero.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-14', '2017-05-14 04:17:43', '2017-05-14 04:17:43');
INSERT INTO `lesson` VALUES ('809', '12', 'Id omnis voluptatibus molestiae et.', 'Consequatur aut ipsa voluptatem iusto ducimus ea maiores cumque velit et et voluptatum qui deserunt quia iste odit sed aut voluptatem perferendis neque natus velit aut dicta asperiores nobis odio nihil debitis est natus omnis quo aperiam amet dolores et voluptate quia dolores corporis cupiditate officiis dolorem officiis ullam beatae neque et numquam aliquam aut iste et autem earum sunt vitae repellendus amet in asperiores non eveniet corrupti sint aut esse.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '24', null, '0', '1', '2017-05-14', '2017-05-14 04:17:43', '2017-05-14 04:17:43');
INSERT INTO `lesson` VALUES ('810', '24', 'Placeat nihil sint aut nostrum dolorem cupiditate hic voluptas repudiandae.', 'Ex assumenda ea sunt excepturi iusto beatae rerum ut non quae consequuntur non voluptas et non ut at minima tempora ratione quis laudantium porro repellat suscipit nobis deserunt ipsa ut voluptatem quod at soluta non sint magni ea quaerat praesentium magnam natus dolor assumenda aut voluptas atque cum eum odit dolores quo nisi quis sit hic iste asperiores voluptatum mollitia fugit voluptas iure quidem impedit aut eaque ducimus repudiandae officiis error delectus aut rem autem accusantium facilis repellat ut omnis sunt exercitationem nulla eius sint doloremque quia unde accusantium dolores consequatur modi ad quia iste ex deleniti vel iure nesciunt consectetur aliquam deserunt quis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '22', null, '0', '1', '2017-05-15', '2017-05-14 04:17:43', '2017-05-14 04:17:43');
INSERT INTO `lesson` VALUES ('811', '15', 'Est nihil expedita labore quam eos facilis commodi molestiae voluptatibus sequi.', 'Numquam repellat enim alias esse omnis unde dignissimos quia reprehenderit quisquam dolor sit deserunt sit non porro et quo quos consequuntur occaecati nam aut culpa soluta unde velit vel dicta quisquam sint modi reiciendis possimus quis vel ipsa aliquid cumque qui id repellendus eos ipsam sit facilis velit consequatur animi alias aut amet incidunt quasi totam fugiat adipisci est explicabo nobis esse in dolores est exercitationem et ex tempore commodi expedita quas dolorem cupiditate est eligendi tempore et dolores sit sed voluptas consequatur eveniet et corporis saepe alias provident eum accusantium veniam recusandae dolorum id delectus nisi sint consequatur laudantium voluptatem odit nemo.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-19', '2017-05-14 04:17:43', '2017-05-14 04:17:43');
INSERT INTO `lesson` VALUES ('812', '24', 'Odit quisquam enim quo dolor id accusantium et aut inventore qui.', 'Harum nihil repellat quod cumque voluptatum nulla et illum adipisci doloremque quisquam delectus velit qui recusandae saepe repellat facere iste consequuntur itaque quibusdam iusto et repellat dolores nisi eligendi sunt non alias aperiam alias saepe magnam qui quia tempora velit ipsum ad quis labore provident aspernatur quis tempora deleniti inventore laboriosam ipsam dignissimos repellat minima omnis beatae est reiciendis quia et dignissimos sit voluptatem a iste iusto asperiores laudantium sint autem cum amet maiores quas id doloremque dolorum quia sapiente ut aut sint natus iure veritatis consequatur in repudiandae commodi iusto adipisci nulla quia esse dolore velit provident non aut praesentium ut blanditiis natus et libero eligendi tempora nulla rem et qui et dolores ipsum explicabo mollitia rerum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-17', '2017-05-14 04:17:43', '2017-05-14 04:17:43');
INSERT INTO `lesson` VALUES ('813', '26', 'Esse cumque itaque commodi dolor quisquam.', 'Et doloremque aperiam repellat consequatur magnam tempore qui autem ipsam sit consectetur voluptates velit architecto sit voluptatem laudantium maxime quasi sunt ratione et optio blanditiis in accusantium neque officiis est tempore modi vel et vitae doloremque dolor fugit dolorem sequi et et earum incidunt id cumque dolor sint a velit omnis et optio quos et aperiam distinctio architecto molestias dolorum asperiores officiis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-16', '2017-05-14 04:17:43', '2017-05-14 04:17:43');
INSERT INTO `lesson` VALUES ('814', '22', 'Ut consectetur id voluptates natus quia consequatur.', 'Amet aut reprehenderit voluptas dolore dolore vitae doloribus quo dolorem sint libero animi itaque sunt non praesentium reprehenderit qui molestiae vel quia reiciendis nostrum id voluptatem ea quas quisquam vel nobis cupiditate voluptatum aliquam sed et voluptatem nam eveniet autem voluptates fuga repellat eligendi qui sed deserunt pariatur sint suscipit culpa totam est atque non autem similique dolor est quo ea nobis in voluptas incidunt id eos accusamus eum voluptatem velit possimus quos et suscipit reiciendis est optio rerum consequatur modi omnis ratione maxime maxime blanditiis similique est dolorem quia at necessitatibus et molestias unde assumenda et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-15', '2017-05-14 04:17:43', '2017-05-14 04:17:43');
