INSERT INTO `lesson` VALUES ('816', '14', 'Aliquam nam nihil architecto qui dolore qui quo veritatis est.', 'Reiciendis reiciendis consequatur aut minus odit ut nihil nostrum sed perspiciatis sapiente expedita necessitatibus saepe voluptatibus vitae officia dicta laudantium laboriosam explicabo quaerat omnis excepturi dolores eum et nisi voluptas maxime libero consequuntur nobis voluptatem itaque perferendis commodi nihil ut vel et eius consectetur dignissimos maiores debitis mollitia dolorem quo voluptatem dolores dolores suscipit consectetur vero aut pariatur illum magni voluptas dolore fugit optio et itaque ea eum similique illum perferendis odit blanditiis vitae earum veniam fugit facilis blanditiis non incidunt eveniet rerum alias voluptate quae consequatur ut molestiae voluptatem consectetur nostrum quia et dolor corrupti minima inventore dolor modi quaerat debitis odio quo aut ea sint ut et voluptatibus et cum reprehenderit temporibus est dolorem sapiente recusandae et cumque suscipit sequi qui qui hic cumque enim odio excepturi aut ut voluptatibus optio sit culpa temporibus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-18', '2017-05-14 04:17:44', '2017-05-14 04:17:44');
