INSERT INTO `lesson` VALUES ('818', '5', 'Sit culpa consequuntur maxime dolorum omnis occaecati necessitatibus.', 'Eveniet aut in voluptas quo sunt quos voluptas eius ut tempore quae qui illo unde aspernatur voluptas maiores provident aspernatur ut et aut eum iste voluptatem aliquam neque asperiores delectus assumenda quis odit exercitationem minima odio quo voluptatem nobis deserunt quae repellat vero non et voluptatem nemo voluptatem dolorem in quia enim aperiam consequatur quis dolorum molestias et illo eos voluptatum odio nihil eos expedita id molestias dolorem dicta fugit voluptas fugiat sit reprehenderit dolorem quia laborum rem et neque voluptatum labore libero veniam quibusdam id sint doloribus non iusto itaque quod amet optio sunt sit est id quos rerum non recusandae quas sapiente explicabo error possimus sed qui beatae et odio nisi modi rerum voluptatem non ut excepturi eveniet voluptatum dolor adipisci ea officiis autem et quaerat quo et alias est rerum est quas impedit omnis fuga sed.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-19', '2017-05-14 04:17:44', '2017-05-14 04:17:44');
