INSERT INTO `lesson` VALUES ('820', '24', 'Saepe alias veniam recusandae et aperiam dolore temporibus voluptatibus.', 'Accusantium quis quia vel sint a incidunt vel molestiae odio aut doloribus in minima ut aperiam minima corporis molestiae quod quam molestias velit mollitia nemo a nostrum et fugit sit non iusto deleniti quia ducimus ab qui similique ex vero nulla voluptatum dolore placeat distinctio et dignissimos minima et aut nostrum architecto possimus alias facilis autem ipsa nesciunt nihil facere omnis repudiandae vel qui corporis quaerat eveniet architecto voluptatem soluta rem ducimus et maiores eum adipisci sit provident veniam odio expedita aliquid eum assumenda porro maiores vel placeat excepturi impedit quo corporis deserunt ipsa aut eveniet excepturi delectus veritatis aperiam vel deleniti et commodi sit sunt ratione aut laboriosam aperiam illo distinctio voluptatibus dignissimos voluptas et eveniet modi voluptatem minima et et sequi et veniam maiores itaque quos quia harum ut exercitationem est et nulla non qui molestias est ipsa.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-15', '2017-05-14 04:17:44', '2017-05-14 04:17:44');
INSERT INTO `lesson` VALUES ('821', '1', 'Labore id voluptas sunt numquam quae dolorum mollitia.', 'Quod sit voluptas blanditiis nemo consequuntur dolorum et error distinctio nostrum voluptatem doloribus alias magni distinctio sint repellat hic corrupti molestiae veritatis architecto ea omnis ducimus molestiae quia odio voluptatem praesentium eaque ad necessitatibus recusandae distinctio expedita ea dolore non voluptas blanditiis quos hic quaerat sapiente error culpa ut est quam excepturi voluptatem quisquam maxime quos aliquid dolor voluptas voluptates sunt et dolorem ut tempore commodi qui provident repellat molestiae tempora autem esse est dolores et eum quia dolor eum magnam culpa amet nulla laboriosam eum perferendis sed officiis totam aut eligendi enim aperiam accusantium quo odit magni quia perspiciatis sapiente aut illo error ipsam omnis quia libero consequatur cumque numquam soluta non doloremque nostrum autem nihil minima est et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '30', null, '0', '1', '2017-05-19', '2017-05-14 04:17:44', '2017-05-14 04:17:44');
