INSERT INTO `lesson` VALUES ('824', '5', 'Et corporis quam sit doloribus aut aut animi qui.', 'Hic provident consequatur dignissimos ut nesciunt consectetur vel cupiditate reiciendis numquam quos saepe non atque eaque aperiam nemo pariatur laudantium et at est ut sit consequatur atque et consequuntur ut voluptatem odio commodi et sit neque saepe quisquam aut aliquid earum cum aut dolore cum quis aliquam sint voluptas qui quas alias ipsa cumque laudantium illo est doloremque optio illo est est fugit quis ipsam itaque odio non ducimus nobis eligendi dolorem illo ut esse ipsam eligendi vel exercitationem similique ut veniam illum quis a.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-17', '2017-05-14 04:17:44', '2017-05-14 04:17:44');
INSERT INTO `lesson` VALUES ('825', '2', 'Qui mollitia voluptatem fugiat molestiae iste fugiat consectetur.', 'Error sunt quaerat cum sit eveniet ut aut dolores rerum dignissimos consequatur recusandae qui dolorum inventore autem nisi sint magnam vitae ea veritatis et suscipit ex veritatis architecto et voluptatem quis repellendus rem molestias quia voluptas voluptas repellat ut voluptas quia rerum dolorem odio quos et ducimus in ullam sequi animi quos id et provident delectus placeat tempore voluptatem eaque dolores aliquid dolorum consequuntur est eligendi architecto aut rerum voluptas nostrum voluptatem voluptatibus et exercitationem assumenda iste eligendi sit repellendus fugit deleniti fuga excepturi tempore non facilis nam porro possimus in enim debitis aut ut delectus perspiciatis ab consequatur distinctio id in aperiam voluptatem dolorem aut corrupti voluptas quasi quaerat.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-18', '2017-05-14 04:17:44', '2017-05-14 04:17:44');
INSERT INTO `lesson` VALUES ('826', '1', 'Sed numquam in sint nulla distinctio asperiores deleniti enim est.', 'Saepe tenetur molestias cum voluptates pariatur rerum dolor cumque aut iusto perferendis ea doloribus voluptatibus et voluptas impedit impedit qui eveniet fuga ipsum omnis aut hic consequatur sed quisquam sit aspernatur atque omnis et temporibus ut molestiae et repellendus impedit velit beatae velit impedit labore dolores quis voluptatum vitae hic reprehenderit dolores enim voluptatem non et quo cumque porro adipisci non et commodi libero odit aut eos voluptate perferendis eos magnam voluptatibus qui dolore a beatae autem quam qui ullam tempore quisquam iusto dolorum omnis adipisci libero velit itaque asperiores excepturi aut labore enim nostrum rerum beatae id praesentium ut et fugiat unde quibusdam ducimus recusandae qui possimus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-18', '2017-05-14 04:17:44', '2017-05-14 04:17:44');
INSERT INTO `lesson` VALUES ('827', '28', 'Dolore saepe quo quae ad quia sapiente eos.', 'Corporis quis nihil magni cumque nobis odio officiis rerum aut consequatur odio aut facere impedit repellat earum et voluptatibus architecto quisquam eum sint animi nesciunt repellat quia possimus mollitia ut consequatur magnam natus veniam suscipit eveniet quod sapiente laborum aut recusandae maxime voluptatibus vel porro cumque doloremque neque iure est enim sunt laborum voluptas deserunt quidem iste repudiandae illum tempora error perspiciatis blanditiis quo aut quasi recusandae ipsa id totam dicta ipsum nihil nisi labore amet.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-19', '2017-05-14 04:17:44', '2017-05-14 04:17:44');
