INSERT INTO `lesson` VALUES ('829', '26', 'Sed rem dolorum dolores et at voluptatem.', 'Nihil rerum non mollitia rerum voluptas corrupti repudiandae unde explicabo quibusdam a soluta id totam dolores molestiae exercitationem et iure vitae fuga nobis doloremque dolorem amet repellendus error saepe qui quia id libero non illum reprehenderit sint voluptas pariatur quidem perferendis qui rerum dolorum et rem iste numquam velit provident laborum quae sequi quo id qui ut quis quis ut doloribus voluptas illum quidem unde rem dolores nam voluptatum dolorem eos veniam asperiores distinctio autem molestias ducimus ut in repellat quaerat facere autem molestiae aut dolorem nemo consequatur saepe nihil qui et illo natus ex eveniet et aut officia voluptatem hic adipisci et voluptatum sint non consequuntur vero quis aut voluptatem modi.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-15', '2017-05-14 04:17:44', '2017-05-14 04:17:44');
INSERT INTO `lesson` VALUES ('830', '16', 'Asperiores odit doloremque commodi qui placeat asperiores.', 'Excepturi aut similique commodi vel est asperiores quas maiores placeat asperiores suscipit quasi autem est deserunt voluptates temporibus itaque laborum commodi dicta voluptatem consequatur et et qui molestiae et porro magni animi officia sed temporibus tempore consequatur dolore voluptas inventore et sed ut et quo non doloribus perferendis et omnis exercitationem dolores dolorem suscipit illo est at optio harum dolor accusantium laudantium quis et ex qui temporibus atque quos quae minus dolorem alias sed saepe dolorem dolor facere nesciunt iste soluta veritatis consectetur odit earum officiis illum cupiditate nesciunt ut recusandae laboriosam debitis quae.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '31', null, '0', '1', '2017-05-16', '2017-05-14 04:17:44', '2017-05-14 04:17:44');
INSERT INTO `lesson` VALUES ('831', '16', 'Quae sint voluptatem doloribus ducimus eligendi molestiae voluptates ut ut ratione et.', 'Quo aut est voluptas quos accusantium iure quam dolorum est eos pariatur voluptatem tenetur corrupti minima laudantium eos ducimus esse atque non occaecati omnis autem nihil sunt fugit quibusdam non vero harum et vel in nihil est voluptates sit non est et qui voluptatibus maxime necessitatibus cumque rerum dolorum voluptatem perspiciatis quia aut rerum consequatur laboriosam accusamus est vel saepe sit odit nihil dolorem nisi minus quas eos qui culpa accusantium sunt id totam facere vel harum possimus facere dolorem vitae eum blanditiis voluptas ut nostrum est maiores eum modi totam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-18', '2017-05-14 04:17:44', '2017-05-14 04:17:44');
INSERT INTO `lesson` VALUES ('832', '28', 'Libero autem omnis itaque laborum illum quia quasi quo harum omnis.', 'Qui quis ut error voluptatem qui voluptatem rerum aspernatur consequuntur omnis ut voluptatem quaerat fugit neque enim dolor saepe sit qui blanditiis rerum sit natus assumenda dolorem repellendus dolor deleniti ut non enim minima dolores sed assumenda cumque ut autem quidem numquam aliquid sed exercitationem fugiat quo nemo ut unde est provident necessitatibus sed aut quis velit ipsa est voluptas voluptas veritatis quod quis aut ea et voluptatem excepturi ut fuga id nobis deleniti eveniet saepe adipisci impedit perspiciatis consectetur ex tenetur ipsum autem et eveniet sed nesciunt ab modi deleniti.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-16', '2017-05-14 04:17:44', '2017-05-14 04:17:44');
