INSERT INTO `lesson` VALUES ('834', '1', 'Nobis delectus cupiditate laudantium optio eveniet modi incidunt quisquam et reiciendis culpa.', 'Vero deleniti sed sit rerum voluptas aliquid quia voluptatibus ea ea corrupti cumque culpa dolores atque tempore incidunt id in sint voluptate doloremque ducimus voluptatum qui exercitationem numquam nisi consectetur possimus asperiores aut esse voluptas nostrum dolore tempore quaerat necessitatibus inventore facere voluptates voluptate perspiciatis doloremque cupiditate dolore inventore nostrum eveniet odio officia autem voluptatem sapiente quasi et optio hic corrupti porro aut nam sequi et delectus aperiam voluptatem repudiandae in debitis exercitationem ad modi in vero veniam totam veritatis ut sit et quidem temporibus maxime ut neque non voluptas a dolor deleniti impedit et voluptatem temporibus sequi iusto earum et aut incidunt corrupti doloremque sequi.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-16', '2017-05-14 04:17:44', '2017-05-14 04:17:44');
