INSERT INTO `lesson` VALUES ('836', '11', 'Quo inventore libero quo repellat eos assumenda aut.', 'Aperiam maxime voluptas reprehenderit voluptas et sint eveniet et adipisci totam optio omnis modi asperiores et eum sint porro consequatur nostrum sint ut praesentium qui qui laboriosam aut et pariatur quisquam voluptatem vel nemo doloribus ut nobis ex ratione repellendus officiis voluptate inventore voluptas maxime culpa accusamus et ducimus quas corrupti molestiae enim provident reprehenderit magni amet qui officiis quaerat itaque corrupti qui animi est at corporis aut fuga odio molestiae minus et et fuga velit modi distinctio voluptas praesentium dolorum nisi ut id quidem illum quo quos sunt cumque in dolorem cum est consequatur nulla odit quis quia similique dolor ea ea ut est nisi optio eaque ea qui voluptatibus sit inventore qui eligendi id mollitia ex saepe quia id at sed saepe dolores nobis sapiente dolore voluptas et ullam ipsum ipsa est modi.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-17', '2017-05-14 04:17:45', '2017-05-14 04:17:45');
INSERT INTO `lesson` VALUES ('837', '20', 'Similique quis deserunt recusandae iure nesciunt omnis quae.', 'Provident reprehenderit et ut quibusdam exercitationem nesciunt aspernatur sint ut architecto labore illum dolores sed dolorum sapiente id eum hic quidem accusamus ullam est voluptatem eaque voluptas debitis omnis quo amet itaque nobis eius soluta ut omnis quis soluta quisquam et illo tempora nam explicabo harum cupiditate ea molestiae voluptas sit voluptatem error distinctio neque ea fugiat nesciunt ratione molestiae nemo fugit ipsum est sit laborum beatae omnis rem expedita at quo veritatis dolores quisquam placeat dolores quia quos aliquid et exercitationem officia nostrum dolor et et eius a id ducimus ducimus suscipit molestiae quo est reprehenderit cumque harum optio aliquam similique ea dolorum qui fugit nisi consectetur at et voluptas occaecati unde officia rerum numquam non sit libero sed sed quibusdam autem saepe enim sed consectetur itaque laborum quidem dolore est vitae harum et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-17', '2017-05-14 04:17:45', '2017-05-14 04:17:45');
INSERT INTO `lesson` VALUES ('838', '5', 'Rerum quia qui sunt voluptatum ex ab quasi ut cumque aut.', 'Quo laudantium tempora a nihil quisquam sed soluta occaecati autem nemo occaecati sit non ut accusantium corporis veniam ipsam quis dolorem quod neque et ut et ut sequi est sapiente sit et et accusamus culpa rem voluptatibus accusamus aut inventore fugit laborum quaerat aperiam eum aut possimus in voluptates alias vel dolores in ipsa quia illum odio consequuntur iure voluptas officia ea est non odit quibusdam quo dolores autem pariatur nostrum odio dolore qui porro ea tempora sequi vero consequatur nobis in quis minus totam nihil vero beatae sit consequatur voluptatem officiis non corrupti ut aut odit expedita cupiditate placeat aut quia accusamus temporibus quasi nobis molestiae commodi voluptas eaque ipsa.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-14', '2017-05-14 04:17:45', '2017-05-14 04:17:45');
INSERT INTO `lesson` VALUES ('839', '8', 'Qui vel ut sint animi voluptatibus itaque.', 'Suscipit nulla perspiciatis rerum quisquam porro voluptatum dolores saepe placeat distinctio odit pariatur minus consequuntur ab id voluptas cum in non odio et omnis est qui optio est saepe exercitationem labore qui ut culpa voluptatem possimus et eum laudantium quasi sit quos adipisci quasi iure porro suscipit sit eligendi est rerum itaque voluptate voluptatem voluptas optio ea vitae a repellendus ut ut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-14', '2017-05-14 04:17:45', '2017-05-14 04:17:45');
INSERT INTO `lesson` VALUES ('840', '12', 'Quo eum natus qui deserunt et vitae praesentium cumque.', 'Iusto placeat veritatis perspiciatis vel omnis et aliquid quas accusantium explicabo eum dolor itaque inventore quo temporibus accusantium at et et et mollitia atque et et autem totam officiis beatae est blanditiis nostrum eligendi dolor amet quos quod facilis voluptatem rerum dicta velit laudantium qui rerum voluptas dolores sint nostrum quam suscipit vero sed ipsum occaecati eum est minima libero explicabo animi sed totam earum rerum iusto nostrum aliquam rerum tenetur ipsum vero totam ut eum sapiente et rem eum aut ipsa est sit consequatur autem accusamus quasi quaerat consequuntur sint maxime nobis molestiae.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-14', '2017-05-14 04:17:45', '2017-05-14 04:17:45');
INSERT INTO `lesson` VALUES ('841', '9', 'Maiores quam qui modi illo consectetur pariatur rem omnis.', 'Est quia beatae vel et at quis eveniet rem ab et sed fuga reiciendis similique qui aut sed dolor nobis aliquid enim placeat atque aperiam et dignissimos voluptas vel molestiae ut laboriosam atque molestiae consequuntur minus sit reprehenderit nulla eius ut ut a qui labore architecto totam cum ut consequatur quia soluta qui et earum illo quibusdam id consequatur consequatur qui et odit beatae sunt repudiandae est soluta officiis ipsam iste id eaque placeat voluptatem ad non ratione et omnis nesciunt sed facilis minima quaerat deserunt provident neque ullam est iste sint error autem et ut est dignissimos eius et quo repellat incidunt eaque rem et cupiditate voluptas alias non consequatur animi aut ipsa est explicabo dicta debitis ut enim est nulla magnam est laborum laborum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-17', '2017-05-14 04:17:45', '2017-05-14 04:17:45');
INSERT INTO `lesson` VALUES ('842', '11', 'Facere voluptas ea autem cupiditate et adipisci eos aperiam.', 'Reprehenderit impedit temporibus quos odio quis consequatur ex totam natus perferendis eaque esse neque consequatur ipsam eveniet ut non deserunt sed ut iure voluptatibus possimus nostrum sed autem enim inventore temporibus voluptate sapiente debitis sapiente aliquid sed ipsa et doloremque ut iste praesentium beatae minima aut autem et non sunt ea consequatur velit et aut aliquid in est voluptate consequatur similique voluptates sint corrupti alias non est voluptas et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '22', null, '0', '1', '2017-05-14', '2017-05-14 04:17:45', '2017-05-14 04:17:45');
INSERT INTO `lesson` VALUES ('843', '19', 'Commodi dolorem est illo neque magnam quae corporis quibusdam vero aliquam.', 'Et consequuntur id sit dolore aut delectus et est eos dolorem consectetur natus odio illo qui deserunt recusandae placeat voluptatem officia perspiciatis dolorem dolore perspiciatis odio soluta atque aut esse enim iste odio quia officia est mollitia praesentium ducimus unde illo sequi quo nostrum distinctio minus placeat sint odio autem eligendi veniam quod esse pariatur enim labore sunt voluptatum cum nobis ex fuga deserunt recusandae quisquam consequuntur aut aut ipsam eius sit ut nostrum ex qui et ipsa quos quidem debitis amet rerum voluptas molestias consequatur officiis fugit numquam accusantium voluptatum omnis iusto quo velit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '30', null, '0', '1', '2017-05-14', '2017-05-14 04:17:45', '2017-05-14 04:17:45');
INSERT INTO `lesson` VALUES ('844', '10', 'Neque ea saepe repellat consequatur qui.', 'Est ex perferendis molestiae ducimus animi tempora a alias incidunt sapiente consequuntur quia sed enim quos molestias mollitia consequatur saepe mollitia aliquid libero eius quos et eum occaecati eaque aliquid expedita laboriosam libero rerum facere labore tenetur tempora sequi illo excepturi vel reiciendis provident excepturi explicabo rem et beatae sed ut esse necessitatibus assumenda ut repudiandae qui temporibus accusantium ut sit eum ullam provident qui ut consequuntur porro qui sequi voluptas qui deserunt et temporibus reiciendis consequatur at harum ullam non asperiores saepe non labore dignissimos officiis vitae rerum assumenda eos omnis dolor qui at officia voluptatibus optio quia hic omnis minus praesentium ea qui eaque deserunt distinctio facere eos ipsam corrupti aliquam itaque.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '23', null, '0', '1', '2017-05-16', '2017-05-14 04:17:45', '2017-05-14 04:17:45');
INSERT INTO `lesson` VALUES ('845', '17', 'Quaerat eum sed placeat minima ut sunt dolorem.', 'Ducimus mollitia et facilis officiis natus sed sunt non officia consequatur et nulla perspiciatis ut nihil ad dolores dolore sed enim et voluptatem perspiciatis explicabo voluptatem voluptates error doloribus alias dicta voluptatem ducimus eaque ipsa fugit ut ab sequi corrupti quasi enim minus consequatur voluptatem ut exercitationem vel blanditiis atque magni architecto porro molestiae pariatur sint eligendi eaque debitis dolore voluptas molestiae eligendi ex quas quas quos provident ducimus libero temporibus vitae aut et qui et accusantium quis repellendus distinctio accusamus voluptas harum nam libero mollitia architecto qui reprehenderit beatae cum occaecati dolorem eligendi ullam quis dolores deleniti tempore facilis delectus sit minima numquam consequatur eligendi quos possimus est magni consequatur quo ut recusandae aut qui impedit ea facere voluptatem distinctio earum necessitatibus molestiae quia dicta asperiores minus illo aut omnis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-14', '2017-05-14 04:17:45', '2017-05-14 04:17:45');
INSERT INTO `lesson` VALUES ('846', '11', 'Voluptatum et nesciunt velit est voluptates assumenda a impedit qui harum.', 'Magnam a est quis laborum quisquam placeat molestiae odio molestias cum qui iste esse est cum sunt et ad deleniti repellendus ducimus ad quos aut fugit dicta maiores dolorem iusto accusantium id dolores qui nisi cupiditate odit voluptas maiores nemo sint qui perspiciatis praesentium et ut fuga non et ducimus mollitia sunt rerum quia error impedit nesciunt natus repellat totam quasi in possimus sint debitis sunt nobis est sed maiores quia dignissimos labore dolorum sit hic voluptas et aperiam doloribus corrupti rerum qui itaque laborum explicabo aliquam voluptatem adipisci reprehenderit quam voluptas qui deleniti velit incidunt quam est qui quae id quia et rem quae corporis doloribus voluptatibus culpa tempora.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-18', '2017-05-14 04:17:45', '2017-05-14 04:17:45');
INSERT INTO `lesson` VALUES ('847', '17', 'Voluptas sapiente cum odio temporibus eveniet unde impedit.', 'Impedit numquam earum sunt dolorem excepturi cupiditate vitae harum fugit rerum et ad dolores quas iusto exercitationem aut rem aut doloremque sint repudiandae est rerum praesentium voluptatem atque voluptatem repellat qui doloremque rem qui voluptatem repellendus eveniet voluptates maxime iure aut est omnis fugit rerum voluptatem dolorem optio assumenda est deserunt maiores nobis aut laboriosam aut omnis sunt natus qui corrupti necessitatibus quos laborum quia optio dignissimos nihil ut id quia.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '47', null, '0', '1', '2017-05-16', '2017-05-14 04:17:45', '2017-05-14 04:17:45');
INSERT INTO `lesson` VALUES ('848', '10', 'Voluptatum assumenda dolorem autem dignissimos nostrum voluptas harum.', 'Cum maiores sunt ut magni expedita sit laborum et vel nesciunt animi cumque fugiat rerum provident eos totam exercitationem quis repellendus repellat rerum aliquid saepe repellat et voluptatibus earum sit pariatur dolores natus officia minus deserunt nesciunt fugit aperiam reprehenderit consectetur et impedit iusto nihil occaecati assumenda dolore et voluptatum quibusdam voluptate corrupti recusandae natus quo natus culpa voluptas illo autem nostrum maxime et quia eveniet eum laboriosam id et itaque voluptas mollitia officia quia eligendi asperiores temporibus non explicabo quia consectetur aut harum architecto nihil minus rerum consectetur mollitia.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-17', '2017-05-14 04:17:45', '2017-05-14 04:17:45');
INSERT INTO `lesson` VALUES ('849', '14', 'Velit molestiae similique at sed sunt quia omnis ipsum.', 'Architecto tempora error enim expedita aut animi qui a ut dolor laborum dolor voluptates id et natus aut cumque omnis quae eos consectetur non vel ipsa laboriosam sed voluptates deleniti et quia quisquam tenetur harum totam enim non aperiam sapiente est nihil rerum nam a itaque et placeat officiis aut dolor ex et nobis et necessitatibus officiis laborum expedita odit iure exercitationem error aspernatur illo odio consequatur tempora et unde adipisci quis sint minus earum magni dolorem qui quaerat consequatur qui nesciunt rem maiores sed laudantium placeat modi minus soluta quia aliquid non aliquid eum blanditiis aut rem corrupti corporis nam illum doloremque voluptatum officiis numquam magni porro dicta numquam voluptatem magnam quia nam unde ut nam molestiae ut omnis sequi officia et error ut voluptatem sequi ducimus corporis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-17', '2017-05-14 04:17:45', '2017-05-14 04:17:45');
INSERT INTO `lesson` VALUES ('850', '20', 'Eum et iure molestiae debitis animi aut aut qui ratione.', 'Id voluptatem quia provident aut animi blanditiis sed in reprehenderit provident fugit non dolorum sequi sed sint velit iste mollitia sit ullam occaecati perspiciatis repellendus minima distinctio fuga consequuntur maxime culpa minus aut fugit ea adipisci vel nemo in facere suscipit et quisquam aliquam eos ut similique maxime similique vero neque voluptatem doloremque ea velit aspernatur quasi voluptates molestiae qui quaerat optio iusto enim molestias aut vel et id dicta labore in culpa quia impedit et iure aut sit id quasi sed et et aut maxime excepturi voluptatum maxime natus unde recusandae quas magnam est quae enim ex est ipsa repellat magni soluta qui laborum dolores voluptate voluptatem quia earum neque harum delectus doloribus reprehenderit quia laborum rerum est adipisci.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-17', '2017-05-14 04:17:45', '2017-05-14 04:17:45');
INSERT INTO `lesson` VALUES ('851', '28', 'Quasi sit ab facilis eum optio.', 'Et et quo sunt repellat illum tempora et libero repudiandae id voluptas alias in sint culpa vero omnis incidunt qui cumque enim minus dolor explicabo ipsam rerum placeat consequatur sunt distinctio cum reprehenderit distinctio soluta inventore recusandae quasi est eos omnis repudiandae sed sit dolores assumenda non dolor et dicta enim earum omnis et ut et delectus minus eum ut aperiam saepe ipsum libero quidem voluptas ea est nisi eligendi unde maxime sint eum quia vero et repellat voluptatem quia non sit omnis porro sit dolores maiores assumenda id maiores cum delectus soluta et suscipit quas aut velit accusamus distinctio quia aut est aspernatur assumenda ut et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-15', '2017-05-14 04:17:45', '2017-05-14 04:17:45');
INSERT INTO `lesson` VALUES ('852', '27', 'Distinctio in ut ad iusto rerum numquam omnis ea excepturi.', 'Dignissimos autem voluptatum explicabo ullam quae aliquam sed quam culpa reprehenderit sit omnis nihil eos qui beatae tempore nesciunt doloribus pariatur adipisci libero quo a necessitatibus harum occaecati recusandae qui provident maiores voluptatem iste explicabo et quod quasi ipsa dolorum corrupti praesentium voluptas et et voluptas excepturi qui eligendi eligendi explicabo nesciunt provident id voluptatibus saepe amet amet aliquam iste amet minima id vel magnam doloribus quam nulla voluptas quas voluptatem dicta quos ea harum atque vitae dolorem quod rerum qui perferendis voluptas ut quidem nihil fugit atque dolor voluptatum laboriosam dolorum dolor quibusdam rerum vel consequatur neque impedit minus molestiae quo similique aut et omnis ipsam aut velit rerum numquam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-15', '2017-05-14 04:17:46', '2017-05-14 04:17:46');
INSERT INTO `lesson` VALUES ('853', '28', 'Quam repellendus et veritatis earum culpa corporis facilis ea quia.', 'Dolores consequatur assumenda adipisci praesentium eveniet et neque corrupti et sapiente sunt voluptatem commodi exercitationem impedit sint similique aut quidem sint et reiciendis adipisci sed a eos eius aut quasi et iure reiciendis sit aliquam fugiat dolores deleniti accusamus iste sunt aut ullam et consequuntur quisquam quis voluptates quia quis animi a aspernatur labore repellat eius libero ad quo incidunt rerum non est ullam quia repudiandae sit id non maiores sapiente dolore rem quia saepe officia autem et autem fugit omnis quis beatae mollitia.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-17', '2017-05-14 04:17:46', '2017-05-14 04:17:46');
INSERT INTO `lesson` VALUES ('854', '4', 'Ea reiciendis animi consequatur necessitatibus vitae ratione blanditiis.', 'Eveniet cumque quas non saepe id eos facilis eum sunt aut velit harum natus tempore aliquid voluptas illo occaecati consequuntur neque ea qui doloribus quasi qui deserunt autem rerum libero sapiente iusto impedit alias iste non aut officiis ut rerum ea dicta quia aspernatur sunt rerum quo quia laudantium delectus quam perspiciatis iusto assumenda at tempora praesentium eum molestiae distinctio dolorem qui dignissimos qui voluptatem voluptate quia neque est non vero deleniti commodi tenetur rerum dolorem sint sint iusto commodi voluptatum ipsum accusantium harum et omnis sint facilis quia exercitationem sapiente.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-16', '2017-05-14 04:17:46', '2017-05-14 04:17:46');
INSERT INTO `lesson` VALUES ('855', '9', 'Voluptatem et beatae sint facilis dolorem.', 'Incidunt est qui dolor perferendis consectetur et animi excepturi quos maiores exercitationem soluta quia repellat sunt voluptatibus voluptas officiis ut ut ut eveniet iste laboriosam maiores quas voluptatem ratione optio et totam eaque repellat et voluptas quia perspiciatis eum aut adipisci ducimus animi corporis aliquam ut perferendis quis aut adipisci rem cupiditate ut et qui et sint quos culpa pariatur aut magni et magnam veniam ipsum culpa inventore voluptatem odio consequatur labore officia tenetur et qui quasi sint sint facere corrupti debitis minima dolores fugiat deleniti vitae alias omnis fugit perspiciatis ut voluptates rerum cumque rerum sint ut inventore consectetur accusamus laudantium quaerat illum ipsam facere ullam qui ad autem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-16', '2017-05-14 04:17:46', '2017-05-14 04:17:46');
