INSERT INTO `lesson` VALUES ('858', '21', 'Id ducimus expedita exercitationem est qui.', 'Consequatur et omnis molestiae qui distinctio ratione in voluptatem qui enim quas commodi veritatis sed et commodi est necessitatibus distinctio quidem consequatur suscipit nulla aut eius odio temporibus perspiciatis est vel fugit sit earum at accusantium quia reprehenderit quae et fugiat porro minus veniam doloremque enim sint quis et iusto ab ut ea cum cupiditate dolore sit ex ut quos aspernatur quod tenetur et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-17', '2017-05-14 04:17:46', '2017-05-14 04:17:46');
INSERT INTO `lesson` VALUES ('859', '18', 'Perspiciatis similique atque officiis expedita ut dolorem omnis.', 'Laboriosam provident perferendis tenetur optio dignissimos nulla officia qui magni quaerat quidem quibusdam non necessitatibus labore nihil enim accusantium voluptatem dolores aut amet accusantium nihil ad dolores vero nostrum esse earum totam tenetur dignissimos est quos commodi ea eaque et quas porro ipsa pariatur error nisi aspernatur modi inventore quos eaque laborum ex incidunt modi amet id laboriosam et ipsam illum ratione quis qui quidem excepturi id et aut animi iure autem qui illum aut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-18', '2017-05-14 04:17:46', '2017-05-14 04:17:46');
INSERT INTO `lesson` VALUES ('860', '3', 'Esse et facilis accusamus et sed harum aut.', 'Non molestiae voluptas accusantium et consequatur labore voluptates architecto pariatur dolorum porro veniam quidem vero voluptate ut exercitationem pariatur ipsa aut iusto accusamus ducimus suscipit eligendi animi fugiat alias qui adipisci sed cupiditate mollitia alias sequi ipsum quia nulla cumque omnis nisi suscipit voluptates quod alias libero omnis necessitatibus ex et nobis consequuntur laudantium sequi corrupti molestiae et dolor labore qui enim molestiae atque necessitatibus omnis ex voluptates ullam fugit ut magni aut eaque quisquam sequi dolorem illo iste incidunt corrupti consectetur quaerat sed libero eligendi dolore blanditiis fugit quo culpa nam dolore sit aut nisi et quidem voluptas nobis voluptatum quod natus dicta voluptatum blanditiis in hic nesciunt consequatur consectetur voluptas nisi expedita molestias at culpa dolor repudiandae molestiae omnis aliquam est quo placeat magni ut odit et laudantium voluptatem fugiat accusantium.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-15', '2017-05-14 04:17:46', '2017-05-14 04:17:46');
INSERT INTO `lesson` VALUES ('861', '18', 'Perferendis veniam et et perspiciatis mollitia doloremque pariatur perferendis non velit.', 'Quasi asperiores voluptate vel ut quidem ut id dolores aut quasi natus ipsum quis quo doloribus et in debitis repellendus commodi fuga sequi est recusandae hic sed reprehenderit itaque magni tempore est omnis eligendi amet sequi dolor quia voluptatem maiores autem dolores ut et et beatae odit eveniet recusandae sunt accusantium blanditiis id dolor veritatis exercitationem facilis at et libero repellat exercitationem dolor nesciunt et iste quae ipsa sint voluptatem sint debitis doloribus maxime aut laboriosam et recusandae voluptatem rerum rerum sapiente ad ea molestiae recusandae quisquam ut quas quod sed deleniti incidunt culpa qui est numquam cupiditate maiores sint fuga sed officia qui enim sapiente.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-15', '2017-05-14 04:17:46', '2017-05-14 04:17:46');
INSERT INTO `lesson` VALUES ('862', '18', 'Recusandae neque illum quo quidem adipisci aliquam sint nihil.', 'Minima fugit ratione ipsa et porro nam omnis velit sint quae aspernatur qui esse repellat eveniet suscipit quas vitae consequuntur quia nesciunt atque laudantium ducimus quis consectetur quo dolor magnam beatae quis ut quos suscipit voluptate libero vitae voluptatem sed sapiente ut aliquam cum aut nisi mollitia voluptatum facere et deleniti sapiente animi est sit tempore at qui sed numquam veritatis placeat esse repudiandae et aliquid ut et incidunt ut magnam illum accusantium quis delectus ullam debitis doloribus quas voluptatem est deleniti rerum reiciendis doloribus repudiandae mollitia excepturi quo vel nemo quisquam dicta aut sint rerum sequi eos rerum quo occaecati earum aperiam voluptas architecto facere dolor distinctio consequatur quasi ut quia est aut saepe possimus quas dolor sit suscipit molestias dolor veritatis voluptates et dolorum cumque soluta ut consectetur illo sapiente ipsam dolorem beatae eius est.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '45', null, '0', '1', '2017-05-19', '2017-05-14 04:17:46', '2017-05-14 04:17:46');
INSERT INTO `lesson` VALUES ('863', '26', 'Atque eum eos adipisci qui fugiat suscipit aut est.', 'Dolores porro rem itaque officiis facilis molestiae id eum eligendi rerum rerum nisi aut ut cum ut dolor adipisci architecto sit sint et nesciunt voluptas error qui autem at sed sit numquam saepe rem et quam qui velit corrupti excepturi vero autem animi nisi architecto neque modi et aliquid praesentium delectus delectus vel optio voluptatum dolorem quo ea totam repudiandae saepe ipsa quia repudiandae dicta omnis quo debitis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-16', '2017-05-14 04:17:46', '2017-05-14 04:17:46');
INSERT INTO `lesson` VALUES ('864', '19', 'Cum molestiae voluptates quis ut impedit quaerat quia.', 'Dolorem molestias expedita nemo assumenda et quos et fuga neque possimus nemo cupiditate sint eos amet est vero delectus ut quia eligendi optio nihil qui odio quis quaerat repudiandae rerum natus ratione eaque exercitationem aperiam cumque minima voluptatem nihil ratione a similique rerum dolore possimus est soluta dolorum dolorum sed est asperiores quo est est maiores tempore numquam assumenda consequatur nihil deleniti in corporis sed dolorem id et sit est veniam voluptates quia temporibus officiis officiis aperiam ut eos.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '49', null, '0', '1', '2017-05-15', '2017-05-14 04:17:46', '2017-05-14 04:17:46');
INSERT INTO `lesson` VALUES ('865', '24', 'Qui maiores quibusdam impedit sunt sunt et.', 'Provident molestiae voluptatem commodi ipsum autem esse maxime iste quia necessitatibus in culpa dolorum aspernatur corrupti eum eligendi nulla velit et cum nemo est facere in aspernatur omnis est nisi alias nemo nesciunt assumenda in necessitatibus vel rerum id vero aliquam quisquam dolorem qui doloremque quos praesentium consequatur pariatur aspernatur autem libero atque quam tempore reprehenderit voluptas laborum officia ut neque et optio ipsam non vero.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-18', '2017-05-14 04:17:46', '2017-05-14 04:17:46');
INSERT INTO `lesson` VALUES ('866', '5', 'Voluptatem consectetur commodi accusantium ut placeat et non ea nihil non.', 'Ratione quia voluptas quidem blanditiis et odit a qui ullam repudiandae nisi praesentium sint neque sequi nobis aut quis sed in et ea aperiam ipsum doloribus dolore animi aut incidunt id qui ex quo repudiandae in mollitia ratione dolor fugit voluptatem corporis excepturi sint non consequatur libero itaque quo at voluptatibus libero quasi necessitatibus impedit dolorem ea exercitationem harum praesentium iure et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-15', '2017-05-14 04:17:46', '2017-05-14 04:17:46');
INSERT INTO `lesson` VALUES ('867', '2', 'Et vero tenetur dicta ipsum excepturi repellat sit.', 'Voluptas et saepe illo ut aliquid alias in qui rem aspernatur provident quasi saepe recusandae illo aut voluptatem esse et officiis inventore explicabo ea delectus quia porro voluptatem et natus doloribus qui minima distinctio nemo et ut dolores sint laborum possimus doloremque tenetur fugit iste laudantium modi placeat perspiciatis quia velit corrupti nam ipsa est quo facilis voluptatem laborum harum fugiat quis nesciunt ea consequatur est nihil pariatur et ratione deleniti est rerum velit mollitia facere voluptatem accusantium adipisci magnam dicta ducimus molestiae eius.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-18', '2017-05-14 04:17:46', '2017-05-14 04:17:46');
INSERT INTO `lesson` VALUES ('868', '5', 'Deleniti officia vel est voluptatem impedit fugiat omnis.', 'Sapiente voluptatem dolorum nobis optio dolorum et voluptatibus cupiditate laboriosam accusamus porro ut blanditiis iste reiciendis adipisci eos nam aut laborum omnis incidunt ducimus veniam corporis et facere qui rerum itaque labore aperiam nesciunt facere consectetur fugiat qui dignissimos sed alias voluptas autem enim pariatur dolorem omnis corrupti et qui quia nostrum molestiae minima et et non modi reprehenderit quidem in nobis reprehenderit error eligendi consectetur aut voluptatem aut nesciunt adipisci autem et nesciunt at temporibus est.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '36', null, '0', '1', '2017-05-14', '2017-05-14 04:17:46', '2017-05-14 04:17:46');
INSERT INTO `lesson` VALUES ('869', '6', 'Accusantium voluptas rerum pariatur rerum debitis et quo.', 'Illo distinctio ut laboriosam quasi error aut sint porro id facere corrupti tempora tempora et temporibus temporibus nam repudiandae est expedita nostrum et veritatis voluptatibus explicabo aliquid molestias quisquam quia aliquam dolorum dolorem alias possimus quibusdam maiores rem sapiente tenetur consequatur et ratione expedita dolorum similique sunt odit et enim autem quod quis magni excepturi commodi est dolor maxime ad voluptatem laboriosam expedita eaque et consequuntur a enim consequuntur suscipit quis non libero earum fuga consequuntur illo tempora ut dolorum sequi id itaque est suscipit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '24', null, '0', '1', '2017-05-17', '2017-05-14 04:17:46', '2017-05-14 04:17:46');
INSERT INTO `lesson` VALUES ('870', '6', 'Debitis ea iusto dolore dolor hic sit sed.', 'Officia ipsam et et consequuntur quia aperiam quaerat est fuga sequi accusamus eum quae est repudiandae animi voluptate in atque nihil a et eum cum voluptatem ipsum in dolores sed et et porro laborum ut aperiam rerum beatae ut beatae nisi dolorem est earum fuga natus a voluptas et ad alias corporis est enim voluptate pariatur quia et sed deserunt non voluptatum est laboriosam est corporis non voluptatem magni libero.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-15', '2017-05-14 04:17:46', '2017-05-14 04:17:46');
INSERT INTO `lesson` VALUES ('871', '15', 'Doloribus quia quo ex in est.', 'Omnis maiores aut consequatur consequatur minus ut officia voluptatem officiis laudantium omnis consequuntur quibusdam consequatur omnis labore ut distinctio fugiat soluta eius fugit unde dolorem explicabo incidunt reiciendis pariatur suscipit et dolores in magnam ut laborum sit suscipit aliquam atque ut itaque illo velit nihil eveniet cum non eum ratione deleniti assumenda quaerat voluptatem recusandae necessitatibus modi in quis eos qui a iure vel voluptatem aperiam distinctio ad sunt sunt exercitationem asperiores velit officia qui voluptatem rerum quibusdam doloremque culpa et ad culpa laudantium eligendi aut sequi et ex veritatis sit eos velit quo animi ipsam qui et id odit itaque soluta natus dolorum non a impedit eius dolore dicta.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-17', '2017-05-14 04:17:46', '2017-05-14 04:17:46');
INSERT INTO `lesson` VALUES ('872', '19', 'Ad est ut expedita aut qui dignissimos omnis sint dolores repellendus.', 'Et et labore labore vitae nihil dolor qui nisi eos et eum quibusdam dolor cum ut doloremque est et nesciunt et incidunt blanditiis inventore aut in repellat architecto inventore tempore et ut qui similique cum voluptates sint ducimus magni omnis dolorem ab ut atque est nisi est voluptatem aspernatur doloremque est culpa at omnis tenetur dolores sunt ducimus mollitia cum libero sunt ipsam nam doloremque enim delectus dolor perspiciatis et qui modi ipsa consectetur placeat ullam autem reprehenderit cumque veniam ratione et tempora blanditiis rem consequatur et eum quidem laudantium occaecati ea dolores cumque aut nobis dolores aperiam maiores porro illo reprehenderit mollitia et quibusdam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '27', null, '0', '1', '2017-05-19', '2017-05-14 04:17:46', '2017-05-14 04:17:46');
INSERT INTO `lesson` VALUES ('873', '4', 'Dolor ut praesentium perferendis explicabo molestiae dolorum id vel voluptatem consequuntur.', 'Nobis inventore dolorem quae officia impedit ut rerum unde consequatur distinctio labore quia non quia ullam et quasi quasi consequatur nemo consequatur soluta et voluptates ut sint et commodi debitis eaque voluptatem rerum esse et qui cupiditate iusto est voluptatem ut et perferendis repudiandae totam mollitia voluptatem minus vel nulla est eveniet omnis repudiandae optio exercitationem alias delectus molestiae enim esse et necessitatibus nemo optio aut voluptatum quia voluptas atque veniam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-18', '2017-05-14 04:17:47', '2017-05-14 04:17:47');
INSERT INTO `lesson` VALUES ('874', '12', 'Non dolorum officiis non consectetur iusto minima provident ipsam.', 'Officia ab deserunt sequi sint possimus rerum natus tempore in ipsam et quia dolorum modi sint rem et repellendus similique veritatis et deleniti hic velit quos doloremque repudiandae tenetur et suscipit incidunt velit aut voluptates amet enim quasi fuga culpa voluptate ea porro dicta voluptas rerum a ut aliquid dolor et aperiam sit vitae quo provident culpa mollitia provident ab nam omnis at pariatur error.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-15', '2017-05-14 04:17:47', '2017-05-14 04:17:47');
INSERT INTO `lesson` VALUES ('875', '16', 'Possimus officiis laborum in ab repudiandae quae non.', 'A perferendis dolor debitis esse id ipsa sunt inventore ut nihil aut aut sint eos aliquid tempore voluptatem iure reprehenderit maxime quia magnam repellat voluptatem velit blanditiis voluptatem beatae adipisci laudantium perferendis perferendis suscipit sequi rerum illum modi quis corrupti nam reprehenderit laboriosam quidem aperiam beatae ipsa assumenda quia sed quia ex velit eius quia voluptas est veniam dolorum mollitia eveniet aut ratione delectus numquam aliquid debitis eius mollitia aliquid quidem nihil voluptatibus similique voluptas dolor tempore nam vel at quidem officiis nihil veniam eos et magnam ipsa repellat laboriosam error aliquid voluptatem sit vel perferendis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '47', null, '0', '1', '2017-05-16', '2017-05-14 04:17:47', '2017-05-14 04:17:47');
INSERT INTO `lesson` VALUES ('876', '24', 'Saepe consequatur culpa error corrupti sunt repudiandae quo cumque quis.', 'Eum at voluptatem molestiae fugiat nam laborum ab et optio voluptatum et quo corrupti dignissimos dolorem suscipit voluptas quo hic voluptatibus fugiat dolorem asperiores autem sint aut asperiores eos qui et sint tenetur velit cum consequatur voluptatem dicta ducimus aperiam dolor est sed sunt natus libero autem non aliquid labore et sapiente et quia eius ratione id beatae quo officia voluptas totam aliquid sunt ratione voluptatem qui facere.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '45', null, '0', '1', '2017-05-14', '2017-05-14 04:17:47', '2017-05-14 04:17:47');
INSERT INTO `lesson` VALUES ('877', '12', 'Quia eveniet ratione iusto non placeat.', 'Non nesciunt commodi voluptatem odio consequatur facere est aut magnam sapiente est autem praesentium earum quod voluptatem cumque dolorem consequuntur aut voluptatem ut perspiciatis maiores consequatur sit mollitia maiores nihil corrupti cum eum est non rerum laborum consequatur est ut nam debitis quaerat sunt aut placeat exercitationem sit eligendi assumenda possimus illum voluptas aperiam id voluptas voluptatibus cum distinctio quisquam iusto ad ullam illo qui optio nesciunt quidem qui voluptas recusandae qui nemo qui in sequi esse eos possimus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '27', null, '0', '1', '2017-05-14', '2017-05-14 04:17:47', '2017-05-14 04:17:47');
INSERT INTO `lesson` VALUES ('878', '26', 'Doloribus sunt quisquam porro dolor omnis neque possimus non magnam ea.', 'Nihil a veniam accusamus praesentium reiciendis id temporibus qui cum quia veritatis qui dolores sed earum cum aliquam repudiandae dignissimos ut dolore nihil laborum nihil pariatur ullam sapiente qui eaque amet et consequuntur molestias non dolorem provident rerum quam aut quam amet error voluptas ab ratione soluta architecto maiores aperiam enim deserunt harum consequatur aut ut ad ut id iste excepturi voluptas dolorum quod et vel autem magni similique modi sunt veniam ea tenetur quia voluptas totam omnis laborum nulla nulla.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-18', '2017-05-14 04:17:47', '2017-05-14 04:17:47');
INSERT INTO `lesson` VALUES ('879', '23', 'Quia dicta ipsum voluptatum omnis asperiores.', 'Illum perspiciatis tempore et dolorem eos suscipit ratione omnis ipsa nam beatae vel corporis laboriosam qui tenetur blanditiis et itaque placeat ullam vitae expedita laborum molestiae minima ex eos molestias et facilis quasi rerum omnis aut placeat dolor aut repudiandae voluptatem voluptatem est hic ratione impedit iste eum molestias blanditiis provident quam impedit eum neque hic ut vel adipisci dolorem delectus enim iusto atque voluptatem enim repellat qui atque qui perferendis sit repellat quisquam rerum sed sit placeat cum est est doloribus explicabo nostrum illum nobis est provident et necessitatibus non sed facere sed maiores.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-19', '2017-05-14 04:17:47', '2017-05-14 04:17:47');
INSERT INTO `lesson` VALUES ('880', '3', 'Vitae et cupiditate corporis perferendis quos non fugiat.', 'Fuga deleniti architecto nesciunt velit velit et est necessitatibus sunt non recusandae ut beatae sed numquam delectus qui sed eos porro unde modi earum quae veritatis quia adipisci deserunt quam sed veniam ut et a modi aut pariatur sit placeat aperiam reiciendis dolorum deleniti est reprehenderit quod nihil dicta nam et voluptatem quibusdam earum culpa ea quis dolorum voluptatibus vero quasi maxime voluptas consequatur laboriosam voluptatem omnis aperiam praesentium excepturi dolorem rerum sunt eaque ipsa aliquid aut iusto earum eos autem laborum incidunt quia voluptatem atque unde sit consequatur nesciunt qui exercitationem beatae et ipsum adipisci dolores sed enim accusantium est et non qui molestiae repellendus quia et ullam recusandae quae vel aperiam officia velit quia delectus suscipit laudantium officia aperiam eum natus eligendi libero expedita quae illo inventore autem blanditiis qui cupiditate modi et saepe.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '30', null, '0', '1', '2017-05-19', '2017-05-14 04:17:47', '2017-05-14 04:17:47');
INSERT INTO `lesson` VALUES ('881', '15', 'Dolorem aut dolore quis facere vitae reprehenderit voluptatem quaerat culpa deleniti dolorem.', 'Distinctio dolorem eveniet qui molestiae nulla praesentium consequatur nobis magni iure aut sed rerum qui id itaque numquam ipsum quae veniam nihil quia ut ut omnis deleniti a cupiditate rerum sunt doloribus reiciendis magni quia esse explicabo et inventore harum et qui rerum est aperiam ratione architecto rerum optio beatae minima ipsum voluptates aut est dicta eligendi quas et ducimus ab in ut et fuga et sed voluptas neque dolorem quod assumenda molestias quis quia nulla exercitationem corrupti nemo.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '22', null, '0', '1', '2017-05-19', '2017-05-14 04:17:47', '2017-05-14 04:17:47');
INSERT INTO `lesson` VALUES ('882', '19', 'Sed reiciendis quia enim placeat consequatur.', 'Odit architecto nam at quia voluptas odio recusandae aut voluptates dolorum sapiente temporibus harum consequatur et eaque eos iste nemo totam similique sed libero et voluptatum assumenda quis fugit nisi quaerat non cum ut occaecati ut voluptatem quasi consequatur et velit soluta incidunt molestiae et quia magni fugit dolorum et reprehenderit sunt animi ipsa commodi consequatur reprehenderit vitae fugit perferendis distinctio et consequatur maxime rerum aliquam repellendus id fuga ipsa ipsa reiciendis officia omnis est nobis quia voluptatem ad pariatur.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-16', '2017-05-14 04:17:47', '2017-05-14 04:17:47');
INSERT INTO `lesson` VALUES ('883', '23', 'Sed quo consequuntur quo dolorem nemo sed.', 'Ullam eum amet necessitatibus explicabo in dolore fugiat et eveniet inventore voluptatem et laboriosam nulla est necessitatibus est est est quas similique totam similique aperiam aut eveniet consectetur aut dolorum esse ipsum dolor voluptas deserunt non explicabo odit ea voluptas est placeat blanditiis distinctio dolor omnis asperiores beatae ratione accusantium ut deserunt hic qui odio in optio molestiae rerum nemo libero aliquid eveniet ut aut pariatur dolor laborum quidem nostrum sit quisquam facere mollitia facere occaecati pariatur id et et quia aut et quia eius quia officiis et sit laudantium voluptates consequuntur unde non quod ab et nisi mollitia maxime labore expedita iure et quia et quidem suscipit minima assumenda in voluptates ut neque repellendus blanditiis provident est et dolores ea ut enim at neque sequi temporibus ut doloremque et et et repudiandae est blanditiis accusamus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '27', null, '0', '1', '2017-05-19', '2017-05-14 04:17:47', '2017-05-14 04:17:47');
INSERT INTO `lesson` VALUES ('884', '18', 'Consequatur ut sapiente voluptates sed voluptas odio.', 'Et itaque qui deserunt sed facere aut qui provident et odit eaque sapiente dolores molestiae necessitatibus fugiat mollitia qui iusto optio nostrum earum et nam dolorem consectetur aut esse dolores est nesciunt voluptatem quis consequatur reprehenderit est nam mollitia reprehenderit ipsum nihil velit sit praesentium ut quibusdam voluptatem similique ea eum vero voluptatem est deserunt dolorem est animi doloremque eum praesentium quisquam sunt omnis ut nostrum doloribus aliquid officiis quia sit cum dolore voluptates rerum consequatur exercitationem facilis vero eveniet et similique pariatur iusto voluptatum neque aperiam nihil maxime cupiditate et aspernatur ut veniam omnis accusamus inventore molestiae et expedita molestias dolorem quaerat dolorem et est reprehenderit dolores inventore et quo quas iste modi expedita voluptas consequatur eius consequatur mollitia quaerat quis quaerat est et optio impedit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '30', null, '0', '1', '2017-05-14', '2017-05-14 04:17:47', '2017-05-14 04:17:47');
INSERT INTO `lesson` VALUES ('885', '19', 'Libero velit suscipit officia est aut sequi provident culpa et est qui.', 'Modi ab culpa vero corrupti maiores iste enim odit exercitationem sed unde accusantium suscipit aut distinctio sint corrupti soluta quae modi qui adipisci quia dolorem omnis earum est voluptas est sint nisi facere aut et id placeat molestiae molestiae eos laudantium quisquam culpa recusandae sapiente quae officiis illum assumenda voluptatibus facilis ratione necessitatibus sed facilis atque quasi autem non nihil et quod quibusdam enim deserunt porro nesciunt reiciendis distinctio similique porro voluptatem eaque voluptates est distinctio nesciunt sit totam minima praesentium dolore ut ipsum nobis commodi doloremque odit unde mollitia explicabo rerum commodi accusantium reiciendis quia voluptates et accusantium aperiam necessitatibus explicabo non expedita sed non ipsa repellendus id perferendis distinctio dolores fugit velit velit est iusto laborum esse quibusdam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-17', '2017-05-14 04:17:47', '2017-05-14 04:17:47');
INSERT INTO `lesson` VALUES ('886', '3', 'Quia sunt ab voluptatum voluptatem animi quo est.', 'Animi quibusdam maiores aut tempora et corporis aliquam repellendus explicabo laboriosam et perferendis quidem officia aperiam ut voluptatem sit sint quisquam accusantium molestiae sapiente ipsam magnam voluptas harum voluptatibus et esse est rerum ullam repellat doloremque perferendis accusantium est dicta quaerat reiciendis distinctio recusandae numquam quod et maxime quo repudiandae quaerat eos quos est nostrum et iste ipsum asperiores quia ipsam accusamus at aut perspiciatis recusandae maxime assumenda nesciunt fugiat pariatur eos eius tempore rerum et id non est odit officiis esse aut repellendus mollitia hic cumque ullam dignissimos sit qui illum laborum rerum eum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-19', '2017-05-14 04:17:47', '2017-05-14 04:17:47');
INSERT INTO `lesson` VALUES ('887', '1', 'In occaecati quae illo quod assumenda deleniti provident.', 'Aut provident corporis consequatur consequuntur velit recusandae iste eum possimus aliquam quae quod quo numquam iste in eius ullam quisquam perspiciatis magni sapiente quo omnis illo quo est expedita nobis quis quod aut id ipsam tenetur adipisci consequatur qui ratione animi rem nostrum rerum voluptatem rerum est omnis explicabo in corporis quam aspernatur eligendi pariatur ea voluptatem deleniti repudiandae libero dolorum eos.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-17', '2017-05-14 04:17:47', '2017-05-14 04:17:47');
INSERT INTO `lesson` VALUES ('888', '20', 'Omnis quibusdam exercitationem aut iusto delectus voluptas debitis placeat amet odio eos.', 'Omnis saepe eaque rem doloremque excepturi rem qui odio sed laudantium dicta quasi quam omnis omnis sed et sint magnam architecto eos ut non quia voluptatem mollitia occaecati dolor non et dolores officia ea ea veniam accusamus ipsum ipsum aut inventore magni ipsa architecto sit veniam esse voluptas asperiores laboriosam qui impedit quos rem autem dignissimos aperiam voluptas ex et ut est nemo molestias numquam error natus velit et ipsa ea id sed voluptates quam quos eum itaque soluta magnam voluptatem ut quo sit perferendis dicta fugiat impedit molestiae ad qui numquam hic modi ut veritatis distinctio architecto aliquam temporibus iure modi asperiores enim non eos maxime quae rerum voluptas tempora voluptas qui nesciunt sint cumque qui ex aut atque est rerum repellat fuga sed temporibus accusamus tenetur ut excepturi.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-18', '2017-05-14 04:17:47', '2017-05-14 04:17:47');
INSERT INTO `lesson` VALUES ('889', '5', 'Omnis amet facere voluptatem quam.', 'Explicabo consectetur dolorum blanditiis id voluptas sit quia aut minus accusamus nostrum iure molestiae nemo nostrum aut totam sed totam ut voluptatibus id consequatur quidem consequuntur ut dolor dolores cumque sequi ut in commodi ipsam doloribus repudiandae labore ad et autem consectetur sapiente corporis quas aut ullam est laboriosam et ut itaque in rerum dicta illum voluptas aut consequatur consequuntur et qui non laboriosam voluptas rerum qui ex ullam aliquam voluptatem nisi aut ipsam iusto.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '39', null, '0', '1', '2017-05-14', '2017-05-14 04:17:47', '2017-05-14 04:17:47');
INSERT INTO `lesson` VALUES ('890', '25', 'Est eligendi ullam doloribus laboriosam consequatur id mollitia minima voluptatem repellendus et.', 'Et a voluptatum tenetur vero ea dolores quo veniam odio ea aliquid incidunt debitis reprehenderit eius qui qui consequuntur magni perspiciatis animi qui consequuntur quisquam aut at in perferendis sed expedita reprehenderit tempora quaerat omnis voluptatem earum nisi dolore delectus minus eos est vel qui qui aspernatur voluptatem velit sit sit doloribus eius tenetur quis perspiciatis sint voluptatem voluptates consequatur et quidem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-15', '2017-05-14 04:17:47', '2017-05-14 04:17:47');
INSERT INTO `lesson` VALUES ('891', '21', 'Sed sit quis et qui eaque.', 'Autem animi voluptatum et enim culpa asperiores autem nihil veniam facilis optio rerum magnam sunt in vel velit optio laborum officia quis atque itaque ullam provident quod blanditiis amet in sed vel aut eum qui dignissimos error doloremque possimus dicta a necessitatibus quis dolorem ut officiis consequatur laudantium dolor occaecati placeat qui quia quae aperiam porro quis eum aut unde excepturi accusantium maiores explicabo et dolorem aut sapiente quas sed consequatur quaerat accusantium consequuntur et itaque dolores hic pariatur in saepe error praesentium qui recusandae temporibus eveniet magnam omnis aut blanditiis rerum dolores et qui quasi praesentium ab accusamus quasi culpa laboriosam ipsum pariatur fuga sed eius voluptate omnis aliquid dolor hic est sit officiis reiciendis ut ipsam rerum dolorem dolor vel aut alias cum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-15', '2017-05-14 04:17:47', '2017-05-14 04:17:47');
INSERT INTO `lesson` VALUES ('892', '27', 'Autem sequi totam sint cum doloribus facilis atque qui omnis.', 'Vero impedit culpa eveniet neque repellat quos ut quo voluptatem eaque sit ex odit non aspernatur quam dolorum et non et dolor quibusdam at ea harum et omnis repudiandae nulla enim ut est perferendis velit nulla id voluptate sit aut minima ipsum ad voluptatum debitis quia vitae nemo ipsum doloremque quae qui quam aut nihil dolor nostrum laboriosam enim eos rerum aut omnis dolore eaque expedita nostrum qui voluptatem enim qui fugiat placeat nostrum sit velit qui pariatur nostrum eveniet eligendi fugit dicta sed nemo eveniet adipisci debitis beatae et in sequi ut sed commodi qui nobis quia et natus vel magnam optio dignissimos nihil dolor ut nemo et sint consequatur aut ipsum et iusto est fugit qui dignissimos neque sint non ut aut non qui et in rerum in inventore a nam consequuntur omnis quisquam est sint dolor aspernatur.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '27', null, '0', '1', '2017-05-19', '2017-05-14 04:17:48', '2017-05-14 04:17:48');
INSERT INTO `lesson` VALUES ('893', '13', 'Vero quae corrupti ut occaecati neque quas et quo iusto.', 'Vel illum qui id qui facilis veniam sunt nulla ut placeat quia omnis pariatur a nobis enim fugiat et vel sed odit voluptatem accusantium quidem voluptate minus provident sunt deleniti est autem autem animi et earum nostrum cum aliquam dolor cumque voluptas dignissimos dolore enim quia facere harum ipsa iusto vero iure omnis aut soluta aut eius earum consequatur et sunt expedita itaque voluptatem aut earum natus laboriosam dignissimos rerum illum aperiam eum ipsum officia veritatis consequatur accusamus nisi magnam nostrum laudantium aperiam sit alias voluptatem molestiae rerum temporibus nobis accusamus ut molestiae est fuga ad omnis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-18', '2017-05-14 04:17:48', '2017-05-14 04:17:48');
INSERT INTO `lesson` VALUES ('894', '22', 'Cumque reiciendis quae autem dolorum et rerum consequuntur corrupti.', 'Alias quia non ut adipisci perferendis ea repellendus voluptas et voluptas voluptatem corrupti omnis rem fuga enim possimus optio in saepe corporis at enim sunt nihil natus corporis quod dolores enim quaerat quis eum laboriosam neque iure non architecto architecto delectus dolor enim sunt facilis officia et aspernatur modi error culpa aut et id laborum animi debitis corrupti harum molestiae provident odio voluptatum sit delectus odio aperiam ipsum deserunt et nesciunt porro est assumenda facilis ut voluptas ratione quo doloribus vero ut et illo eum nihil quo sed quam nulla labore omnis aut sed commodi rerum et iure iure vel cum maiores corrupti sed neque iusto quis voluptatum esse quod quo est in ex et qui impedit saepe exercitationem enim mollitia praesentium nemo asperiores commodi omnis nihil laborum esse sit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '39', null, '0', '1', '2017-05-14', '2017-05-14 04:17:48', '2017-05-14 04:17:48');
INSERT INTO `lesson` VALUES ('895', '24', 'Minus et omnis molestias reiciendis quia aliquam.', 'Sint possimus id saepe mollitia voluptatem quae eos ipsa consequatur qui totam at ea at quaerat quibusdam perspiciatis labore inventore quae cum reiciendis temporibus aut laudantium omnis qui quos numquam qui vel odit magni laboriosam est consequatur perferendis aut sint qui voluptates optio ad quia rem quia est excepturi eum assumenda iure rem incidunt inventore ut voluptate sint ut eum dolorum voluptatum quia et ut harum aut qui molestiae sit ut repellendus voluptatum eos numquam animi praesentium sequi consequatur ducimus aliquid dolorum assumenda placeat et asperiores dolorem eum nemo autem ullam nobis recusandae nihil provident ut quo amet ipsum quibusdam voluptatem dolorem dolorem repellat voluptas voluptatibus minima vero repudiandae ipsam culpa nesciunt reiciendis corrupti assumenda ut laboriosam enim necessitatibus neque et excepturi delectus itaque aut placeat commodi consequatur eos id rerum dolorum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-16', '2017-05-14 04:17:48', '2017-05-14 04:17:48');
INSERT INTO `lesson` VALUES ('896', '4', 'Quia consequuntur voluptate omnis tenetur aperiam sequi et fugiat pariatur.', 'Molestias eius nulla consequatur id quia nihil delectus qui doloremque ut libero voluptatem deleniti reprehenderit rem dolorem autem laborum ipsam sequi ipsum eum rerum dolorem vero autem molestias suscipit maiores et distinctio iusto inventore aut veniam labore vitae blanditiis odio numquam alias voluptas quod quos aut maiores aliquid a sequi voluptas qui quam iure sit est quisquam consequatur ad reprehenderit culpa beatae eos cum omnis omnis unde laborum velit ipsum qui fuga omnis rerum sed aliquid quaerat aspernatur excepturi amet nulla fugit consequatur placeat est quasi corrupti rem sunt error.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '20', null, '0', '1', '2017-05-16', '2017-05-14 04:17:48', '2017-05-14 04:17:48');
INSERT INTO `lesson` VALUES ('897', '23', 'Ut blanditiis est tempore qui iure.', 'Est ipsum rerum rerum quos adipisci voluptates laboriosam distinctio consequatur corporis voluptatem recusandae sint vitae et ad velit deserunt et non et quidem praesentium nemo incidunt voluptatum voluptatum velit officiis quos sit accusamus magni ipsam ut repudiandae nam voluptatem architecto qui architecto est ut autem maxime tempore quam quia neque aliquid perferendis laudantium omnis quidem qui dolores enim aut expedita aliquam ab cum cupiditate.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-17', '2017-05-14 04:17:48', '2017-05-14 04:17:48');
INSERT INTO `lesson` VALUES ('898', '17', 'Cupiditate voluptatum eligendi dicta fugiat reiciendis eveniet aut ab culpa sed.', 'Qui quae dolore sit voluptas adipisci velit provident quia voluptatibus sint autem eos ut laborum aut esse recusandae aliquid tempore consequuntur non doloremque temporibus eveniet ut doloribus aut officiis est vitae eaque minus qui temporibus et quo laborum vel animi impedit corrupti nobis quia exercitationem ut sed sequi dolorum et ut dignissimos illum dolorem occaecati non occaecati recusandae praesentium mollitia voluptas laborum harum nobis temporibus nemo rem quo occaecati velit nam in sapiente recusandae id et temporibus et maxime maxime ex ut perspiciatis sint quod a dignissimos error porro similique autem dolore modi qui quia eius neque sapiente dolores praesentium dolores non distinctio vero quia et laboriosam consequatur ratione nesciunt alias fuga voluptatum laudantium repudiandae et rem error voluptas temporibus distinctio.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-15', '2017-05-14 04:17:48', '2017-05-14 04:17:48');
INSERT INTO `lesson` VALUES ('899', '1', 'Aperiam eius ut ut ullam rerum.', 'Dolores sint cupiditate est harum et et quo est non minima qui hic delectus quidem est itaque suscipit voluptas incidunt error excepturi vel ipsam ad voluptatem enim minima expedita earum labore eum cum deleniti aliquam vel accusantium quis hic possimus consectetur laboriosam debitis placeat qui doloribus necessitatibus quo libero fuga voluptatem sint et temporibus delectus earum sunt non omnis ut reprehenderit recusandae aut inventore.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-14', '2017-05-14 04:17:48', '2017-05-14 04:17:48');
INSERT INTO `lesson` VALUES ('900', '1', 'Laborum dicta et officia sunt dolore magnam soluta non optio maiores.', 'Cumque ut non repellat placeat veniam consequatur natus molestias atque quibusdam quae qui in ullam sed iure odit quisquam sequi excepturi tempore repudiandae et repellat et occaecati cum ut consectetur et consequuntur recusandae odit libero nihil odio accusantium non cupiditate asperiores harum dolorem aut nam at quia quia veniam ullam adipisci expedita sunt eos labore accusamus ea quia hic rerum et odit quia hic natus magnam enim est ea aspernatur sit ullam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-18', '2017-05-14 04:17:48', '2017-05-14 04:17:48');
INSERT INTO `lesson` VALUES ('901', '26', 'Aut consectetur debitis est molestias est molestiae et.', 'Corporis libero aut sit amet quos quod vitae non ipsum dolores ut voluptas ipsa adipisci aperiam nostrum praesentium totam non aut et rerum cum assumenda nostrum sunt est sint consequatur et nulla ea quas et et est quisquam facere rerum magnam nam voluptatem qui velit fuga rerum cum ut et incidunt quis et similique deserunt porro adipisci quo omnis voluptates assumenda deserunt praesentium.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-19', '2017-05-14 04:17:48', '2017-05-14 04:17:48');
INSERT INTO `lesson` VALUES ('902', '7', 'Maiores accusantium inventore placeat soluta veritatis laudantium.', 'Itaque qui quis ullam facere qui dolore consequatur suscipit reprehenderit nihil et quo placeat tempora modi eum neque non necessitatibus quisquam et ad ipsam voluptatibus quidem deserunt enim dolores inventore eum quia qui mollitia et repellendus libero voluptatem velit voluptates molestiae cupiditate tenetur consequuntur quia molestiae praesentium nam debitis minima est quia maxime pariatur hic facilis alias consequatur fugiat dolores dignissimos itaque nisi dicta consectetur id.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-18', '2017-05-14 04:17:48', '2017-05-14 04:17:48');
INSERT INTO `lesson` VALUES ('903', '30', 'In natus cumque aut dolores veniam soluta sit eius non veritatis.', 'Adipisci ea soluta quam quisquam numquam aut unde rerum voluptates omnis ut ea minus cum voluptate consectetur quisquam nisi vel aut blanditiis rerum laudantium laborum nostrum modi quas atque ipsum beatae ab sapiente totam consequatur ut consequatur quam fuga maxime assumenda nobis adipisci minus quia laborum adipisci voluptatem et nulla tempore autem assumenda eaque hic ut consequatur eum autem laboriosam quibusdam a molestiae eius nihil rerum soluta nihil et asperiores sed magni iusto dolor aut aspernatur modi recusandae ex perspiciatis vel maxime corporis sint consectetur deserunt necessitatibus molestiae rerum architecto.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '28', null, '0', '1', '2017-05-17', '2017-05-14 04:17:48', '2017-05-14 04:17:48');
INSERT INTO `lesson` VALUES ('904', '11', 'Ducimus iusto et sit sunt aut aut quas saepe.', 'Vitae velit enim illum repellendus assumenda laudantium et hic blanditiis omnis voluptatem ullam animi voluptate aut iste soluta ab aspernatur molestiae ut qui ad aut facilis reiciendis amet iusto ut eos ad autem illum debitis corrupti nostrum quam nobis et id iure nihil et sequi dolor unde laudantium tempora eum eum quisquam at ut voluptate et molestias qui animi perspiciatis illum molestias ullam quos sequi aut eius iste quas quia quia ex impedit delectus veritatis fugiat rem qui cupiditate facere repudiandae libero nesciunt et praesentium in voluptas ex porro temporibus dolores nesciunt labore blanditiis odit corporis minus rerum amet rerum id beatae qui distinctio sunt temporibus quod ratione natus reprehenderit quae quis sequi iusto ea provident quia explicabo.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-16', '2017-05-14 04:17:48', '2017-05-14 04:17:48');
INSERT INTO `lesson` VALUES ('905', '10', 'Officia voluptatem facere eligendi quis beatae ea.', 'Eveniet sed nobis debitis iusto rem cupiditate autem nesciunt voluptas ipsa qui iure velit quia necessitatibus sequi saepe neque dolorem harum cupiditate ad beatae voluptatem omnis a exercitationem quo temporibus facilis dignissimos fuga et rerum fugit itaque culpa alias atque soluta ducimus et voluptatem eaque quae rerum accusamus dolores magnam rem et veritatis laboriosam dolor omnis officiis neque recusandae sit laborum nostrum fugit rerum iure numquam omnis atque iure aut esse tempore aut eum est qui consequatur qui quo molestiae et culpa saepe enim consequatur reiciendis et deleniti sunt voluptatum vel fugit non earum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-16', '2017-05-14 04:17:48', '2017-05-14 04:17:48');
INSERT INTO `lesson` VALUES ('906', '17', 'Quia omnis et dolores soluta sint sed.', 'Architecto quaerat et in unde aspernatur quis similique expedita ut fugit voluptatibus harum aliquid tempora praesentium blanditiis et consequatur ut quisquam quos ea quae ut quisquam quaerat omnis quasi pariatur aspernatur dignissimos minima exercitationem similique deleniti maxime sed a non non non consequatur similique labore natus dignissimos voluptatem et mollitia ipsa enim unde quia eos sed vitae ea natus aut repellat.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-19', '2017-05-14 04:17:48', '2017-05-14 04:17:48');
INSERT INTO `lesson` VALUES ('907', '14', 'Aspernatur molestiae qui fugiat magnam quis voluptatibus mollitia illum.', 'Pariatur enim doloribus error voluptatem dolore sit dolores qui eum dolor pariatur est accusantium nihil pariatur quaerat necessitatibus ut voluptatem non quis in ipsa ut maxime esse fugit dignissimos dignissimos doloremque quae quia laborum vel voluptatem fugit consequatur sint ipsa aut iste pariatur sit saepe aliquid quaerat tempora et labore nostrum sed officia velit velit doloribus est et eum possimus sed ut dolor consequatur placeat ullam vel id molestiae asperiores nisi beatae ducimus corporis praesentium quas et omnis ipsa aut dolor aliquid cumque suscipit non aut velit laudantium ex sint dolorem nobis aspernatur reprehenderit fuga doloremque dolorem quia sed laborum fugiat minus in quia nihil omnis cupiditate omnis esse nam accusantium.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-15', '2017-05-14 04:17:48', '2017-05-14 04:17:48');
INSERT INTO `lesson` VALUES ('908', '10', 'Modi explicabo neque quis omnis a quo neque qui illo necessitatibus.', 'Quia maxime quia at at aut est nobis consequatur quos ut non et quis magni accusantium qui quo repellendus omnis quia modi sunt est quasi dolores dolorem placeat natus ut atque cumque voluptatem maxime dolore nihil dolores neque id ut eligendi ab sed eos quia veritatis autem sint nihil corrupti rerum est odio omnis fugit voluptas vel nulla quo harum voluptatem ullam debitis sed cumque quas et architecto consequuntur ipsum recusandae dolorem consequatur deleniti officia quia sit deserunt officiis sit aut qui voluptatem iste vel possimus repellendus in.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-16', '2017-05-14 04:17:48', '2017-05-14 04:17:48');
INSERT INTO `lesson` VALUES ('909', '4', 'Quo velit incidunt autem atque eos sunt accusamus omnis.', 'Ut repellendus quasi dolor deserunt dolores eius dicta quod voluptatem necessitatibus quo molestias ipsam eligendi iste earum quo voluptatum assumenda vitae ut quo ea aut quia fugiat voluptas voluptatem nemo veritatis minima aut at quia numquam ullam corporis laudantium amet error voluptatem harum odit assumenda et ut qui autem impedit possimus ratione quaerat nemo sunt et optio quis cupiditate in aut expedita cupiditate odit cupiditate atque voluptas harum quisquam enim quisquam nulla laboriosam culpa et iusto non culpa voluptates odit asperiores sed modi eos sit nam est maiores.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-14', '2017-05-14 04:17:48', '2017-05-14 04:17:48');
INSERT INTO `lesson` VALUES ('910', '14', 'Qui labore ea occaecati perferendis unde fuga quia eos.', 'Ullam iste deleniti facere quia veniam aut eveniet sit pariatur amet quae fugit cumque debitis quidem ratione eveniet doloribus sunt dolor quia culpa odio rerum aut quae doloribus facilis deserunt vero ullam et dolor eum dolores aut necessitatibus atque ipsam facere sit explicabo repellendus laborum ea ipsam sit sit odio sunt amet eveniet et nihil aliquam dolores dolores sint rerum aliquam laudantium animi doloremque est consequatur sapiente aut officiis tempora quis quia sunt adipisci sit id adipisci.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-17', '2017-05-14 04:17:48', '2017-05-14 04:17:48');
INSERT INTO `lesson` VALUES ('911', '2', 'Ducimus porro molestiae laborum vero in quisquam ut molestiae nihil.', 'Adipisci vel aut eum dolores harum quia aut et omnis amet neque odio tempore voluptatem doloremque voluptatem nulla dolorem ut aut aut fuga unde dolore deleniti harum magni incidunt aspernatur quia est aut rerum quibusdam quibusdam reiciendis ea qui sunt velit voluptate et minus voluptatem non dolorem autem qui tenetur qui rem cumque fuga pariatur velit repellat dolores autem in non autem sint sint et quasi laborum repellendus et quaerat occaecati dolorem voluptatem numquam ipsa optio voluptatem nesciunt autem quis quis velit animi ipsa mollitia a mollitia consequatur magnam vitae nulla sed ut dignissimos tempora numquam vitae velit tempora error minus aliquam qui asperiores quo ut et eos corrupti consectetur eum ab ratione nihil quis aut numquam cumque aut et a et consequatur est eum asperiores facilis nemo quas temporibus consequuntur minus quidem aperiam culpa dicta.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-15', '2017-05-14 04:17:48', '2017-05-14 04:17:48');
INSERT INTO `lesson` VALUES ('912', '23', 'Perspiciatis fugiat eligendi optio porro voluptates nostrum adipisci est.', 'Nostrum adipisci architecto laudantium qui molestiae facilis eligendi ratione quia facilis cumque officia repellat esse recusandae aperiam qui dolorem iste aut et et omnis quidem ipsum quasi rerum incidunt fuga non cupiditate harum illum dolor perspiciatis vel tempora ea accusamus quia possimus omnis sed repellat possimus est quia nesciunt fuga ex est quidem voluptate commodi consectetur nesciunt sed iste et magni dolor cum soluta dolor qui dolores quae animi voluptatem voluptates eaque aperiam illum rerum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '47', null, '0', '1', '2017-05-14', '2017-05-14 04:17:48', '2017-05-14 04:17:48');
INSERT INTO `lesson` VALUES ('913', '3', 'Laboriosam nihil repudiandae nulla ut quia voluptatum omnis ipsum est.', 'Molestias deserunt consequuntur porro nobis eum modi consequatur aut aut tempora et praesentium quia voluptates nisi distinctio voluptatem est dolor omnis ullam dolorem magni praesentium aliquam impedit soluta et magnam eos ducimus sit molestiae corrupti laudantium qui aspernatur tempore molestiae quia ut est et est dolor laboriosam id consequatur velit libero similique aperiam eos rerum reiciendis maxime ipsam sint rerum hic dolore tempore quia molestiae ad a minima impedit ea quo fugiat ab earum culpa dolor perferendis a id quo cupiditate nemo possimus asperiores tenetur cumque aliquid ipsa molestiae sed rerum consectetur est.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '42', null, '0', '1', '2017-05-14', '2017-05-14 04:17:48', '2017-05-14 04:17:48');
INSERT INTO `lesson` VALUES ('914', '14', 'At aperiam eligendi natus et ullam et sunt ab rem.', 'Asperiores possimus laudantium quia exercitationem illo quidem impedit quia vel qui numquam possimus id excepturi ratione non atque repudiandae atque quaerat tempore autem odio est adipisci occaecati numquam doloribus maxime quia laboriosam odit excepturi ipsam et voluptates modi quis excepturi necessitatibus omnis totam voluptatibus id quia eaque consequuntur quidem adipisci repudiandae rerum a omnis ut aut omnis et similique aut aliquid veritatis voluptatibus ut nemo est fugit magnam doloribus corporis voluptas id possimus est dicta modi repellat tempore in iste eum incidunt cumque aliquid autem voluptatem aliquid culpa ipsum numquam voluptatem minima repellendus optio.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '31', null, '0', '1', '2017-05-18', '2017-05-14 04:17:49', '2017-05-14 04:17:49');
INSERT INTO `lesson` VALUES ('915', '14', 'Reprehenderit aut laborum fugiat necessitatibus nobis qui laborum iure.', 'Est consequuntur et ipsam iure velit itaque autem quisquam ex incidunt velit at modi magni recusandae ad eligendi dolorum sunt dolorem cumque distinctio laboriosam voluptates quibusdam illum aut odit consequatur non deleniti sit voluptatum molestiae laboriosam et eos illum itaque non amet perspiciatis nulla consequatur temporibus sunt laborum consectetur et ullam repellendus ea quibusdam quae quisquam est id aut ea alias quasi magnam fugit numquam quis non nam placeat ut repudiandae omnis consequuntur alias aliquam iste quia rerum alias consequatur voluptatibus et in ut deleniti voluptas qui iste sunt blanditiis cupiditate molestiae occaecati est omnis reiciendis ut perferendis vero voluptatem deleniti debitis error eveniet ratione est magnam iusto unde distinctio et sed deserunt praesentium commodi dolore et amet.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '45', null, '0', '1', '2017-05-16', '2017-05-14 04:17:49', '2017-05-14 04:17:49');
INSERT INTO `lesson` VALUES ('916', '22', 'Fuga voluptatum distinctio ipsam quo itaque.', 'Sit sint distinctio autem qui aut sequi porro sit enim qui sint temporibus debitis excepturi aut iste quisquam doloribus nobis dignissimos esse quidem aliquam aliquam hic nesciunt est voluptate minus non inventore et ut error dolorem sit veritatis et culpa dolorem voluptatibus qui qui labore minima ut molestiae enim similique amet expedita doloribus doloribus tenetur itaque omnis vero ab quis eius vero ea aut itaque sunt ratione delectus est illum illum est dolor sed eos non dolor neque molestiae nihil accusamus quo distinctio vel et pariatur sunt possimus voluptatibus eligendi quis similique unde vel consequatur dolore sed eaque sunt odit repudiandae animi repellat magni dolorem maiores quo ut repellendus vitae et deleniti et at sit itaque ut nesciunt praesentium ut minus maxime et sunt suscipit fugiat aut rem dignissimos.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-14', '2017-05-14 04:17:49', '2017-05-14 04:17:49');
INSERT INTO `lesson` VALUES ('917', '23', 'Placeat expedita delectus dolorem qui dolores et.', 'Voluptatem rerum error sint cupiditate quibusdam cupiditate hic et omnis omnis consequatur quos sit officia consequatur rerum placeat est nostrum rerum et ut nihil amet excepturi rerum blanditiis facere totam id sit molestiae voluptate dicta culpa sit eaque cumque odit ab quia aut debitis qui totam perferendis non ut qui eius sit laboriosam ea illum eaque vero corporis aperiam exercitationem accusantium veniam alias.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-15', '2017-05-14 04:17:49', '2017-05-14 04:17:49');
INSERT INTO `lesson` VALUES ('918', '2', 'Necessitatibus fugiat suscipit ipsum eveniet omnis.', 'Impedit autem totam modi totam porro ducimus ut quas eos incidunt odit vitae minus optio libero voluptates qui ipsum vel architecto et dolorem vitae consequatur itaque dolorem illo sunt et eos temporibus ut qui vitae odit ullam et quidem quam sit quas id distinctio occaecati optio molestias id saepe odit beatae aut at delectus officiis repudiandae voluptatem sed molestiae eum quos quae aut placeat sunt maiores consequatur consequatur.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-17', '2017-05-14 04:17:49', '2017-05-14 04:17:49');
INSERT INTO `lesson` VALUES ('919', '1', 'Cum qui autem eaque consequuntur recusandae autem commodi incidunt.', 'Non voluptatum dolorum assumenda nostrum quam occaecati ut est qui omnis corrupti voluptas fugit aut ad sapiente eaque officia ad rem eum porro exercitationem reprehenderit architecto et eligendi harum enim omnis unde sint quasi quidem sint laudantium molestiae nulla rem doloremque ea esse repudiandae ea architecto est nihil modi atque ad beatae atque pariatur minus magni vel hic id delectus nihil consequatur maxime libero.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-14', '2017-05-14 04:17:49', '2017-05-14 04:17:49');
INSERT INTO `lesson` VALUES ('920', '28', 'Ut provident est possimus voluptatem et ratione alias et sit.', 'Voluptas neque et beatae perspiciatis dolor ut deleniti culpa minus cupiditate quis possimus praesentium quidem recusandae dolores quia ut iste ratione voluptatem odio aut expedita corporis in placeat quas voluptatum nobis quas laudantium necessitatibus accusantium eaque consectetur porro esse tempora voluptatum vel dolorum laboriosam neque corrupti labore ex est voluptatem illo sint rerum similique voluptas cumque esse voluptatem consectetur consequatur error dolor magni ut neque quia maxime accusamus ea vel et rerum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '47', null, '0', '1', '2017-05-18', '2017-05-14 04:17:49', '2017-05-14 04:17:49');
INSERT INTO `lesson` VALUES ('921', '26', 'In quisquam facere consequatur quia molestiae explicabo ea eaque reiciendis magnam.', 'Animi quia nisi voluptas et ut dolores vitae quae qui occaecati consequatur quam nisi sit quam optio odio et eum nulla rerum a perspiciatis aut quasi ipsam sed ullam ea numquam officiis repudiandae dolorem est eaque temporibus mollitia autem a optio reiciendis dolor quia neque velit tenetur reprehenderit voluptatem consectetur excepturi minus ut est nesciunt dolorum et magnam aut eius quisquam est dolorem sit ut voluptas doloribus deserunt rem dolores error.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '28', null, '0', '1', '2017-05-19', '2017-05-14 04:17:49', '2017-05-14 04:17:49');
INSERT INTO `lesson` VALUES ('922', '7', 'Sint nemo voluptas debitis maxime.', 'Rerum voluptatum cum aut qui vel nemo nihil doloremque explicabo ut eius ut adipisci deleniti cumque dolor delectus enim minus optio recusandae sequi eos nostrum quia cupiditate eos corporis explicabo illo facilis rerum ea architecto odio voluptate expedita occaecati consequuntur commodi voluptatem non voluptas magni voluptatem dolor voluptatem distinctio laborum et molestiae et qui consectetur ut officia ut aperiam voluptatum voluptatem ea error illum numquam quod repudiandae fugiat a earum voluptatibus dicta dolores provident ut maiores vel esse porro dolorum dicta vel quaerat esse omnis est ut expedita voluptas qui et suscipit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '42', null, '0', '1', '2017-05-19', '2017-05-14 04:17:49', '2017-05-14 04:17:49');
INSERT INTO `lesson` VALUES ('923', '22', 'Soluta id quos aut cumque eum nulla.', 'Quidem eius ad soluta quasi aliquam commodi quia repellat repudiandae iure sapiente sequi laborum iusto eaque exercitationem voluptas soluta laboriosam illo laboriosam asperiores et accusantium distinctio repellendus quia illo optio perferendis cumque omnis sed et veritatis et saepe omnis nisi sunt possimus eveniet at inventore aut porro tempora ullam dolorem officia cumque magnam quasi nesciunt quos itaque ad et nisi perspiciatis ea ea qui consequuntur sit et officia totam tempore temporibus tempore laboriosam consectetur aut occaecati quia explicabo quasi dolores vitae ad exercitationem vel error corrupti dolore nihil aut molestias iusto illo explicabo repellat facilis minima necessitatibus ut blanditiis nulla doloribus et perspiciatis excepturi tempora sint est qui ut illum placeat neque nisi odio deleniti voluptatem dolore distinctio recusandae.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '28', null, '0', '1', '2017-05-14', '2017-05-14 04:17:49', '2017-05-14 04:17:49');
INSERT INTO `lesson` VALUES ('924', '13', 'Dolorum quibusdam dignissimos odio accusamus eaque.', 'Mollitia cupiditate eaque voluptatem esse iure natus adipisci officiis commodi id molestiae voluptas non inventore culpa dignissimos quaerat qui qui quisquam cupiditate in illo quia quos omnis rerum maiores illum voluptates voluptas tenetur quo voluptas nesciunt quia esse aut tempore officiis ut impedit ratione voluptatum aperiam tenetur consequatur quaerat eum similique qui sit sit temporibus asperiores maxime voluptates provident praesentium voluptatem quam occaecati accusamus nihil nulla dolorem quia.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '23', null, '0', '1', '2017-05-15', '2017-05-14 04:17:49', '2017-05-14 04:17:49');
INSERT INTO `lesson` VALUES ('925', '25', 'Doloribus nesciunt culpa quia adipisci nostrum.', 'Dicta ipsam dignissimos ut optio consequatur dolore mollitia quos adipisci labore natus eos consequuntur exercitationem tenetur harum numquam nobis excepturi molestiae eum quis sit quo vitae quo voluptas qui enim quidem deserunt quidem reiciendis aliquam quae consequatur et et non earum minima fuga doloremque asperiores sunt aliquam nihil non vero sed aliquam ut in consectetur amet recusandae adipisci maiores deleniti et est necessitatibus rerum qui at amet deserunt placeat cupiditate quis neque quis praesentium voluptatem iste dicta eos sint rem culpa eaque voluptatem temporibus distinctio aut provident similique accusantium consequatur veritatis consequatur molestiae.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-14', '2017-05-14 04:17:49', '2017-05-14 04:17:49');
INSERT INTO `lesson` VALUES ('926', '13', 'Odit iure corrupti sed quod sed quia.', 'Quidem voluptatum officia in reiciendis molestiae quis maxime corporis ut voluptas cum deserunt non commodi maxime in in dolorem molestiae aliquam qui sunt asperiores sapiente quisquam quibusdam ad accusantium sunt nam laboriosam rerum sit consequatur ut cumque sit aspernatur quos quia dolor quibusdam soluta et sed corrupti ea voluptatem sunt velit qui eos quam deserunt ea fuga sit rerum saepe corporis est tempore similique perferendis et itaque mollitia natus fugit totam saepe in odit ut recusandae dolorum itaque consectetur et quo quo et quasi voluptate beatae ut velit consectetur laborum eveniet error odio suscipit ut consequuntur quidem quo possimus enim quia ea qui ex error ut aut ad rerum sunt animi nemo laboriosam rerum adipisci est nihil pariatur enim soluta sit neque ipsum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '31', null, '0', '1', '2017-05-19', '2017-05-14 04:17:49', '2017-05-14 04:17:49');
INSERT INTO `lesson` VALUES ('927', '7', 'Quo cum aut possimus beatae.', 'Eius similique et minus fugit deleniti eius dolor eaque sit aut et animi minus voluptates qui et et qui in eos harum magni delectus consequatur expedita dolorem et blanditiis quasi minima itaque voluptas optio necessitatibus quae est qui aspernatur temporibus repellat eius nulla quas possimus similique laboriosam mollitia repellat quod voluptatem pariatur excepturi quas aspernatur reiciendis nisi distinctio ipsum occaecati consequatur et tempora ducimus excepturi explicabo odit ipsum est incidunt consequatur ducimus sit et beatae sed illum nulla minus magnam cupiditate ab fugiat asperiores tempore quo placeat et labore cumque et corporis qui voluptates ad minima provident non optio pariatur quis itaque aut quam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '22', null, '0', '1', '2017-05-16', '2017-05-14 04:17:49', '2017-05-14 04:17:49');
INSERT INTO `lesson` VALUES ('928', '4', 'Dolores illum atque dolorem vel non possimus.', 'Sapiente aliquam iusto sit officia voluptatibus ab et blanditiis laboriosam non quidem voluptate tempora autem quasi ex cumque et voluptatibus ut id consectetur temporibus quasi dolorem quia recusandae ut consequatur pariatur vel eum distinctio qui voluptatem in est dolor asperiores adipisci quas at et quo omnis sit maxime doloribus nobis inventore animi amet sit dolores vel maxime itaque voluptas aperiam est ab et perspiciatis voluptas quidem ducimus soluta qui in quia dignissimos fugit qui fugit maxime amet sequi est provident eaque enim vel quia odio beatae dolores beatae id ex qui quaerat ex animi sunt incidunt excepturi ducimus at cumque error at ipsum laborum eaque suscipit qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-17', '2017-05-14 04:17:49', '2017-05-14 04:17:49');
INSERT INTO `lesson` VALUES ('929', '19', 'Quia qui est magni sed voluptate et.', 'Vitae dolores expedita et facilis voluptatum ducimus est et id blanditiis exercitationem voluptatum sunt eos aut accusamus aut et quis ducimus repellendus beatae numquam ex consequatur enim omnis facere qui sequi consectetur voluptatem ratione sunt deleniti dolores nemo illo aut porro quod eos laboriosam rerum similique expedita itaque id laboriosam excepturi praesentium quisquam veniam modi fugit nostrum dolorem eligendi dolore in eligendi quidem dolor labore natus ducimus ad sed atque et ex dolorem eligendi autem eos voluptatem architecto qui magnam dolorem sunt doloribus voluptas perferendis sit aut sunt ut repellendus laboriosam culpa tempora officia esse.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-14', '2017-05-14 04:17:49', '2017-05-14 04:17:49');
INSERT INTO `lesson` VALUES ('930', '16', 'Quos quia id asperiores quidem in rerum commodi nisi at.', 'Aut quod amet explicabo odio corporis qui totam quam ut id dolorum est perspiciatis veritatis ut omnis et numquam aperiam facere et aliquam et quia laborum est debitis optio totam dolorem magni asperiores quae nisi est pariatur cupiditate incidunt possimus unde excepturi et qui voluptas omnis error et sed at ut dolore vero natus reprehenderit impedit veritatis est dolorem nemo quis ut quae magnam non ipsam enim voluptatem deserunt a numquam dolorem nihil perferendis rem possimus enim provident explicabo sunt odio at incidunt quam laborum provident pariatur corrupti dolores aspernatur ut et molestias minima reiciendis in nam enim est quam tempora rerum expedita voluptatem vel accusamus dolores nihil ratione asperiores tenetur modi et soluta in perferendis illum corrupti quo fuga veniam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-16', '2017-05-14 04:17:49', '2017-05-14 04:17:49');
INSERT INTO `lesson` VALUES ('931', '24', 'Enim et earum voluptatum corrupti porro quis repellat.', 'Hic vitae voluptas ipsum velit aspernatur veritatis repellat eum et necessitatibus omnis et aperiam sint minus aliquid ut possimus quaerat sit aut consequatur nihil nisi atque voluptatem iste deserunt architecto aperiam eum tempore praesentium nam et et magni debitis corrupti nostrum excepturi ipsa distinctio maxime et officiis fuga natus ut mollitia rerum vero debitis veritatis aliquid aut doloremque sed ad et eligendi saepe fuga harum dolorum perferendis quia ab totam et magni officia ut aspernatur et tempore voluptatem laborum in tempora magni tenetur fuga qui praesentium explicabo culpa consequatur quia rerum aut sint ab autem esse voluptates quis labore et porro aut facere dolorem esse dolore et similique aut consectetur exercitationem voluptas aut mollitia perspiciatis in eum cumque.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '47', null, '0', '1', '2017-05-14', '2017-05-14 04:17:49', '2017-05-14 04:17:49');
INSERT INTO `lesson` VALUES ('932', '21', 'Omnis in sit distinctio sequi numquam eos culpa soluta.', 'Qui dolor quia et molestias sunt enim aspernatur labore ducimus dolorem cumque id saepe ullam saepe voluptate aperiam vel sed consectetur occaecati aut veritatis cum saepe repudiandae laborum sint et saepe omnis quod unde esse necessitatibus fuga sapiente voluptate rerum inventore aperiam et quia dolorum aut vel error voluptas recusandae placeat non commodi cum alias ipsa explicabo et rerum impedit sint quidem earum et eveniet quo qui quas eaque eos officia et odio est sint totam nihil eveniet esse fugit pariatur quia voluptas ducimus quam sequi sed ut tempora ea pariatur voluptatum dolores doloremque itaque doloribus quasi ad sequi possimus non ipsum dolor voluptatem est quibusdam id qui modi vel eaque laboriosam qui occaecati quo ipsum dolore sed aliquid.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '27', null, '0', '1', '2017-05-17', '2017-05-14 04:17:49', '2017-05-14 04:17:49');
INSERT INTO `lesson` VALUES ('933', '11', 'Debitis blanditiis sint quos debitis.', 'Odit itaque ea ratione quia labore quae et consectetur eum non architecto voluptas voluptatem cupiditate veniam atque sint soluta ad quaerat temporibus cum est quae adipisci odit aut qui qui et ipsa fugit qui ut in commodi fugiat repellat molestiae laborum aliquid expedita qui ipsa ut aut sit aspernatur laborum et consequatur expedita et suscipit earum aperiam exercitationem nihil quod qui ut quis et dolore temporibus autem voluptas et possimus fuga perferendis nulla sint molestias nihil sed sed fugit distinctio iure quia non eveniet qui aut quaerat laudantium voluptatem quos voluptatem et beatae alias sapiente delectus doloremque exercitationem tempora mollitia ea ea dolor doloribus debitis saepe officiis sed id.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-16', '2017-05-14 04:17:49', '2017-05-14 04:17:49');
INSERT INTO `lesson` VALUES ('934', '6', 'Animi doloribus qui expedita eveniet quis dolorum nobis occaecati.', 'Aut eos pariatur odit rerum quis officiis ut deleniti exercitationem dolores aliquid velit ut similique hic blanditiis nisi sed ut et saepe sint officia saepe quo expedita asperiores praesentium aut quas iusto sunt dolore soluta eos quas sed optio autem repudiandae sit maxime quas quia minus quas totam ratione optio aut inventore distinctio tenetur temporibus et autem distinctio nemo enim odio officiis error velit amet dolores et at cumque quia dignissimos facere quia voluptas dolor doloremque occaecati itaque at eligendi reprehenderit quisquam excepturi aspernatur repellendus eos laborum debitis et quia error fuga alias quis quia omnis ut a iusto dolor dolores aspernatur dolorum fugiat commodi quibusdam soluta sapiente illum illum quo corporis possimus numquam dolor excepturi fugiat consequatur quis inventore rerum et molestias voluptatibus veniam tenetur dicta illum dolorem minus dolor quos.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '36', null, '0', '1', '2017-05-18', '2017-05-14 04:17:49', '2017-05-14 04:17:49');
INSERT INTO `lesson` VALUES ('935', '11', 'Ipsam aut facere doloribus beatae quo et eum.', 'Ea eveniet laboriosam sit tenetur voluptate in aut sapiente exercitationem voluptatem ut voluptas ad ipsam recusandae neque quis vel autem nesciunt velit dolor corporis ut mollitia iusto sit aspernatur perspiciatis voluptas aspernatur incidunt nisi laborum et enim magnam est est iusto mollitia et qui voluptatibus est aspernatur tenetur nisi harum libero quos ducimus id sint possimus et iusto eius autem aut minima quam aut dolore voluptatem optio delectus nemo veritatis cupiditate id sit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '27', null, '0', '1', '2017-05-16', '2017-05-14 04:17:49', '2017-05-14 04:17:49');
INSERT INTO `lesson` VALUES ('936', '2', 'Cum perferendis velit quia occaecati.', 'Sunt nostrum dolorem error pariatur ut ipsa id id tenetur aut asperiores maxime qui et minima debitis quibusdam eveniet odio ipsa laudantium omnis dolorem nisi quas exercitationem velit doloribus reiciendis molestias eaque qui possimus maiores id et quasi cumque saepe ea nihil illo magni sapiente dolore consectetur rerum et porro quo est molestiae quis deserunt iusto enim doloribus molestias est porro molestiae sapiente aut eius deserunt consequuntur qui perspiciatis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '33', null, '0', '1', '2017-05-17', '2017-05-14 04:17:50', '2017-05-14 04:17:50');
INSERT INTO `lesson` VALUES ('937', '4', 'Quam sed et officiis maxime suscipit ducimus dignissimos.', 'Aperiam qui suscipit minima placeat dolorem velit libero voluptas natus dolorem veniam vel quas et similique delectus expedita voluptatem ut qui quo sapiente reiciendis totam ratione neque rerum est quis aperiam aliquam ut vel hic quod illum ipsa eveniet excepturi praesentium ex autem est itaque voluptatibus qui distinctio dolores minus nesciunt eius dignissimos ut voluptatum nostrum exercitationem provident pariatur aut facilis vitae in sapiente ducimus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '39', null, '0', '1', '2017-05-19', '2017-05-14 04:17:50', '2017-05-14 04:17:50');
INSERT INTO `lesson` VALUES ('938', '3', 'Quo quos maiores animi iure.', 'Unde iusto excepturi exercitationem natus iusto ea unde eveniet illo neque eum est fuga nulla aspernatur dolorum officia vel voluptatibus est cum architecto odio sed culpa nam velit dolor vitae totam impedit corrupti occaecati et dolorum reprehenderit deleniti sed veniam natus dolorum ipsam est sit totam ut quia iure libero inventore nam expedita dolorem et delectus placeat placeat dolorem et dicta voluptas ut qui ab rerum dolorem quia sint libero officia in.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '47', null, '0', '1', '2017-05-14', '2017-05-14 04:17:50', '2017-05-14 04:17:50');
INSERT INTO `lesson` VALUES ('939', '3', 'Consequatur officiis aspernatur et dolore esse.', 'Et rerum asperiores adipisci dolores voluptatem corporis vel et exercitationem a quisquam voluptatibus et qui ea beatae aperiam molestiae alias labore voluptate consequatur laborum fugit doloremque id porro incidunt qui voluptatem natus ut autem sapiente aut tempora quod et dolorum consequuntur ad et laboriosam voluptatum ratione cumque fugit expedita dolor impedit illo quia autem ut commodi molestias cupiditate voluptatum hic cupiditate et quibusdam ut nostrum numquam consequatur nihil doloribus quo vero sunt accusantium vel qui natus officia aliquam quae quam dignissimos adipisci eos quasi et saepe et ut sit saepe et est ex quod eos ex dolor ipsa necessitatibus corrupti explicabo et tenetur illum quisquam aut veritatis assumenda sunt dignissimos aspernatur earum et aut alias animi aut veritatis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-17', '2017-05-14 04:17:50', '2017-05-14 04:17:50');
INSERT INTO `lesson` VALUES ('940', '28', 'Nemo enim ex tempore pariatur in.', 'Et qui aut ea non cupiditate natus officiis maxime ut minus aliquid pariatur earum enim officiis ratione itaque voluptate est quis aperiam quis dolor voluptatum odit earum quam laboriosam laboriosam veritatis eos cum cumque sed consequatur aspernatur eius praesentium dicta nihil facilis labore eos est corrupti excepturi praesentium sapiente sapiente ex provident eius consequuntur aut sed quo laudantium odio doloremque maiores suscipit minima qui nihil ut facere ut beatae suscipit fugiat est qui culpa inventore vel et quidem ut assumenda eveniet repudiandae quis et quas et quasi officiis odio enim provident in velit non voluptatem est facere quae omnis quidem et quisquam qui quo voluptatem praesentium rem ea minus est nesciunt ex facilis fuga adipisci et ab et perferendis adipisci et odio explicabo aut eius aut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-18', '2017-05-14 04:17:50', '2017-05-14 04:17:50');
INSERT INTO `lesson` VALUES ('941', '24', 'Voluptatem nisi vero consequatur provident magnam soluta et.', 'Tenetur nostrum molestiae nostrum repudiandae consequatur illum eos illo quia error qui aut est rerum consequuntur aut nesciunt excepturi sed qui vitae placeat molestiae dolor ut omnis est repellendus et tempore error illum quia pariatur sed et cupiditate necessitatibus in qui voluptates provident eaque aut harum eos officia quo et in ratione dolorem odio et ex consequuntur nam harum beatae et ipsum eligendi rerum autem sint sunt sit nam id nobis ut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-15', '2017-05-14 04:17:50', '2017-05-14 04:17:50');
INSERT INTO `lesson` VALUES ('942', '24', 'Fuga dignissimos non est cumque corrupti id dolores.', 'Officia sint qui esse mollitia ad consequatur sequi consequuntur eum voluptate id dolor magnam consectetur voluptas suscipit eum ad facilis praesentium magni totam ullam voluptas provident repudiandae quia soluta quidem et libero dignissimos placeat amet sed ut aperiam sed laudantium dolorem est et dolore consequatur quia inventore sed et molestiae officia perspiciatis dolorem porro repellat non ipsa ipsa alias deserunt quod suscipit praesentium tempora eaque non possimus et voluptatum sunt aut qui placeat quas recusandae soluta in perspiciatis saepe nostrum numquam aut unde architecto ratione quam nemo quisquam eligendi atque iste vel est voluptas harum adipisci hic.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '31', null, '0', '1', '2017-05-17', '2017-05-14 04:17:50', '2017-05-14 04:17:50');
INSERT INTO `lesson` VALUES ('943', '7', 'Sequi magni est repellat sapiente consequatur.', 'Quibusdam ratione iusto quis ut occaecati magni delectus maxime reprehenderit non placeat corporis veritatis ipsam vel in velit beatae id voluptatem totam omnis quis pariatur nam unde harum voluptas expedita veniam cumque cumque nemo perspiciatis corrupti expedita laboriosam tempore voluptates eos neque nemo praesentium dignissimos id voluptas rerum praesentium quisquam fugit quis amet ad illo aut tempora ratione sit a omnis vero.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '25', null, '0', '1', '2017-05-17', '2017-05-14 04:17:50', '2017-05-14 04:17:50');
INSERT INTO `lesson` VALUES ('944', '28', 'Et delectus excepturi et ut deserunt aut sit voluptatum.', 'Impedit dolorum temporibus tenetur consectetur fugit dolorum tempore qui delectus voluptatem sed porro qui eveniet qui assumenda tempore non accusamus voluptas atque qui omnis rerum natus quod minima est quis omnis et aliquid voluptatem quia aut voluptas molestiae maiores dolorem in maxime dolore quaerat nemo rerum velit laboriosam quas sint autem et repudiandae omnis maxime delectus distinctio ut et nemo distinctio similique vel ullam iusto tenetur sed sapiente dolorum qui architecto qui nam sed et molestiae vel porro vel recusandae voluptatibus et id neque quasi alias tempore suscipit atque quia est illo in laudantium quaerat cupiditate eaque soluta est blanditiis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-18', '2017-05-14 04:17:50', '2017-05-14 04:17:50');
INSERT INTO `lesson` VALUES ('945', '29', 'Magni veniam eveniet et ipsam impedit unde vero ullam nisi sed.', 'Quidem aut et quae qui sed enim aut quia recusandae quia et voluptatem impedit rem voluptas repudiandae ipsam nulla quia et maxime nisi sed laborum sapiente iste tempore consequatur dolor soluta velit vel delectus suscipit aut beatae omnis aut accusantium vel voluptatibus qui et enim deleniti aut est voluptas quam provident est molestiae eum ipsum esse aut molestiae animi placeat soluta voluptatem harum sapiente iste ratione nisi minima debitis debitis porro asperiores ut earum dolores debitis odit distinctio et aliquam minima qui voluptates quod quasi omnis quaerat.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-14', '2017-05-14 04:17:50', '2017-05-14 04:17:50');
INSERT INTO `lesson` VALUES ('946', '9', 'Quis excepturi iste enim ea perspiciatis.', 'Modi iusto dolores temporibus tempore temporibus velit repudiandae sequi nisi sapiente aut placeat laudantium eligendi magni et consectetur officiis earum alias error dignissimos voluptatem in aut molestias et non ut consequatur iusto laborum architecto sequi corrupti adipisci et et et libero debitis sit animi est quibusdam officia eaque unde odit vitae sapiente commodi ipsam asperiores et facilis impedit et necessitatibus reprehenderit maxime omnis est velit tenetur odio quae cupiditate nihil id cupiditate et distinctio architecto et officiis iste quo quos animi animi rem velit ut adipisci maxime omnis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-18', '2017-05-14 04:17:50', '2017-05-14 04:17:50');
INSERT INTO `lesson` VALUES ('947', '13', 'Qui deserunt et et laudantium et.', 'Amet architecto ut ea voluptates earum omnis fugit recusandae dicta est rerum sint ipsa consequatur consequatur sequi laudantium sit aperiam est sed quam architecto est delectus earum totam ipsam quos eius eveniet fugiat est sit voluptate sit est omnis consectetur a numquam sunt tenetur voluptatem laboriosam iste cumque quas accusantium atque assumenda qui quo consequatur dolorem nulla et veniam occaecati reiciendis libero quis et ut facere consequuntur quia aliquam eaque nesciunt dolor optio at consequatur distinctio ipsam voluptatem fugit voluptate quia sapiente dolor et soluta occaecati dolor laudantium nihil natus ex dignissimos culpa sunt vel mollitia illum tenetur recusandae sit asperiores facilis enim deserunt optio et incidunt cum non beatae enim tempore perferendis nesciunt earum consequuntur praesentium sint ipsum nam dolor perferendis ut rerum fugiat dolorem asperiores dignissimos molestiae aut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-16', '2017-05-14 04:17:50', '2017-05-14 04:17:50');
INSERT INTO `lesson` VALUES ('948', '19', 'Dolorem dolorum non unde rem voluptatem ab.', 'Et quis eius cum veritatis cupiditate odit eius aut commodi et debitis sed et ratione aperiam vero ea sed voluptas odio error sunt voluptas incidunt corrupti aspernatur laborum a tenetur corporis dolor est rem porro ex pariatur hic repellat sint ipsum ea nihil laboriosam facere velit dicta repellat similique veniam omnis amet similique neque id enim odit nostrum odit unde officia aliquid et ut et nihil.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-15', '2017-05-14 04:17:50', '2017-05-14 04:17:50');
INSERT INTO `lesson` VALUES ('949', '28', 'Ut fugit qui accusamus laborum qui vero.', 'Dolores reprehenderit nemo eligendi culpa doloribus adipisci delectus deserunt qui sunt architecto accusamus et a asperiores dicta dolores nihil atque fugit natus quos et laborum iste ad qui quia omnis ea labore non voluptatem eligendi voluptate aut facilis doloremque quo nesciunt itaque nemo repudiandae et rerum dolorem fugiat sed reiciendis facere et suscipit quo accusamus dolor veniam similique ut quia delectus quisquam nemo itaque et iure explicabo beatae natus quam in esse et ipsum facere in doloribus quia veniam sint eos ipsa eos ut distinctio nihil iusto qui sapiente vel aut porro exercitationem assumenda omnis enim beatae eum cumque iste numquam itaque cum quia.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '31', null, '0', '1', '2017-05-15', '2017-05-14 04:17:50', '2017-05-14 04:17:50');
INSERT INTO `lesson` VALUES ('950', '22', 'Possimus ex esse dolorem temporibus ut perferendis qui voluptas.', 'Itaque quo consequatur non quisquam ipsum sequi saepe quam et consequatur similique quia saepe repudiandae eligendi accusantium dolores at voluptas optio aliquid ut sed fugiat velit commodi illo iure itaque doloremque laudantium corporis saepe cupiditate architecto labore et ut pariatur placeat eius aut harum officiis veniam ipsam sed corrupti optio at tempora aut eius eius velit fugit dolorem totam aut odio ducimus iure impedit vero ad assumenda ut quo id incidunt vel aspernatur recusandae molestiae atque vel natus id sint esse qui beatae reprehenderit velit qui sit a corporis in nemo nemo est animi provident illo est sed qui consequatur quisquam ipsum quo tenetur occaecati minima nulla nostrum perferendis sed corporis sed consectetur optio in quam eos earum voluptatibus voluptatibus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-17', '2017-05-14 04:17:50', '2017-05-14 04:17:50');
INSERT INTO `lesson` VALUES ('951', '27', 'Ipsa est voluptas libero fugiat hic aliquid nulla.', 'Dignissimos qui quae molestias saepe non et adipisci aliquid dolores perspiciatis voluptatibus qui aut quo consequatur quod asperiores repellendus consequatur numquam eos consequuntur veniam eum atque sit aut labore velit repellendus doloremque voluptatem accusantium suscipit aspernatur aperiam quibusdam tempore excepturi est veritatis enim nostrum quidem ut delectus maiores id quis sunt commodi aut sit similique vel libero ipsa ut quo earum aut fugit tempore et et expedita ab sint rerum dolore ex dolor ut in aut a et a unde delectus illum odit minima atque culpa saepe sapiente quasi odio distinctio aliquam nobis ea quo repellat sed et nulla ad veritatis a quis modi cumque vero iure reprehenderit sunt beatae molestias quia non rerum mollitia ex hic ut omnis eum provident magni et vel.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-16', '2017-05-14 04:17:50', '2017-05-14 04:17:50');
INSERT INTO `lesson` VALUES ('952', '2', 'Exercitationem veritatis est assumenda rerum et facilis libero.', 'Iure fuga natus reiciendis ad qui iure ut hic similique architecto est iusto nihil quae ea officiis dolor iste saepe esse atque voluptates nesciunt aut ex quis sed cupiditate nihil voluptatem sed vel eius officia autem repellat perspiciatis labore autem iste aliquid eos quos blanditiis numquam culpa quam recusandae sed dolorum voluptate et repudiandae itaque sit libero similique odit qui ad consectetur commodi et aut dolores quae rerum laborum sit modi aut dolorum eius reiciendis voluptate consequatur quia et doloremque aut quia et nobis laboriosam nesciunt autem in veniam saepe voluptatem voluptate voluptatum molestiae dolorem neque omnis numquam eaque facilis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-17', '2017-05-14 04:17:50', '2017-05-14 04:17:50');
INSERT INTO `lesson` VALUES ('953', '7', 'Eos delectus nulla quia commodi doloribus quam commodi vitae distinctio.', 'Voluptatem quisquam optio quod quisquam asperiores quia at soluta sapiente voluptatibus odit blanditiis alias ducimus corrupti molestiae repellendus sit optio alias perspiciatis velit nihil praesentium sunt incidunt culpa animi sed eum nostrum occaecati debitis accusantium impedit sint culpa ipsam occaecati officia qui nobis aut sed dolor ab velit non aut esse autem nemo molestias qui esse rem est quis numquam quo vel nemo ullam voluptatum ratione deserunt ex iste at corporis voluptatem doloremque sapiente nostrum aperiam iusto eligendi error nostrum veniam dolorem atque officia itaque vel dolorem illo quo voluptates accusamus velit perferendis commodi quia.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-14', '2017-05-14 04:17:50', '2017-05-14 04:17:50');
INSERT INTO `lesson` VALUES ('954', '6', 'Aut voluptatem laudantium earum tenetur nobis.', 'Voluptas rem est laboriosam molestias et incidunt sunt architecto iure nemo voluptatibus ex necessitatibus ea harum odio illum sint ad maiores iure officia nemo sit sed sint aut aut facere qui in maiores odit natus non rerum hic veritatis sit labore rerum reprehenderit consectetur voluptatem odit officiis dolorem iure laborum dolorum assumenda minima laudantium repellendus quis in voluptate itaque culpa voluptatem sit ea quis minima sint eum ipsa neque magni aliquam omnis voluptatem eos voluptate quasi minima consequatur reprehenderit ex voluptatem amet consectetur quas qui accusantium nostrum porro enim ex non quia qui veniam aut sit voluptatum libero occaecati omnis officia inventore exercitationem explicabo qui molestiae dolor amet eos et quam praesentium dolorem et sed temporibus distinctio nihil occaecati laboriosam assumenda est consequatur.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-16', '2017-05-14 04:17:50', '2017-05-14 04:17:50');
INSERT INTO `lesson` VALUES ('955', '6', 'Reiciendis voluptatum est ea ab hic suscipit quia explicabo ad dignissimos.', 'Aut itaque ut qui omnis autem perferendis qui ex amet culpa eligendi amet voluptatum ipsam possimus fuga amet qui cum quibusdam incidunt consequuntur ea et quo aut velit delectus explicabo autem et mollitia et qui numquam quaerat nam adipisci quia illo iusto quod autem aliquid modi eos atque recusandae qui porro non dolorem saepe perspiciatis alias reiciendis tempora delectus alias minus necessitatibus velit laborum et facere accusantium ipsa impedit assumenda ut doloribus est dicta sit facere dolor et molestiae recusandae inventore cumque eaque dolor dolor est accusamus dolore in voluptas dolores et omnis est exercitationem exercitationem delectus vitae assumenda ut dolor voluptatem quos voluptate autem ut sunt libero reprehenderit amet sit minus ex quas vel ipsa est fugiat debitis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '45', null, '0', '1', '2017-05-14', '2017-05-14 04:17:50', '2017-05-14 04:17:50');
INSERT INTO `lesson` VALUES ('956', '19', 'Fugiat veritatis fuga quo esse.', 'Corrupti enim quo reiciendis dolor deleniti autem eos quam et consequatur facilis non voluptates vel quasi ullam natus eius sapiente dignissimos minima autem molestias nam beatae dolores voluptates exercitationem quia necessitatibus cupiditate dolor eos exercitationem hic debitis ut a fugit placeat error dolore dolorem recusandae aliquid impedit qui officiis culpa ad ea ab quia sed quo optio perferendis vel voluptatum delectus praesentium consectetur quas adipisci omnis placeat esse officiis minima quia nihil rerum rerum in minima expedita consequuntur non autem dolores sint aut et rerum voluptates est voluptatem similique sint voluptatem nostrum ipsam tenetur est qui omnis alias voluptas eveniet eos fuga tempora molestiae debitis nam quis qui amet illo.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '36', null, '0', '1', '2017-05-18', '2017-05-14 04:17:50', '2017-05-14 04:17:50');
INSERT INTO `lesson` VALUES ('957', '9', 'Est ullam dolor vel reprehenderit voluptatem earum quo.', 'Culpa et non reprehenderit facere natus omnis enim quam ut totam ullam est quod ut ad a id dolore est quia iste omnis iure ea veniam et quia excepturi officiis et aut debitis unde qui id sapiente sit velit non officia voluptas vitae inventore laudantium est voluptatem saepe beatae cupiditate consequatur explicabo ea dolor commodi pariatur expedita enim perferendis ipsa cum at exercitationem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '31', null, '0', '1', '2017-05-19', '2017-05-14 04:17:50', '2017-05-14 04:17:50');
INSERT INTO `lesson` VALUES ('958', '16', 'Temporibus quae pariatur aliquam distinctio nam adipisci officiis quis unde quia.', 'Ut quaerat eveniet vitae illum aut quis qui architecto occaecati quia non voluptatibus voluptatem dolor dolorum possimus placeat ut omnis dolores eligendi neque asperiores est debitis sint deserunt laudantium odit quibusdam rem labore sed voluptatem ut ut autem ipsum explicabo tempore amet aut quae voluptatem harum voluptas et tenetur nobis voluptatem omnis odit nemo soluta veritatis aliquid occaecati alias aut cum tempore ipsa aperiam recusandae tenetur consequuntur perspiciatis labore quas rerum aperiam quod aspernatur omnis nisi magnam nulla ullam saepe libero praesentium corrupti facere laudantium qui quibusdam laudantium sapiente dolorem nulla deserunt veritatis ex eum molestias earum officia harum quis ex est.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-15', '2017-05-14 04:17:51', '2017-05-14 04:17:51');
INSERT INTO `lesson` VALUES ('959', '11', 'Voluptatum necessitatibus consectetur in ratione magnam quasi et quasi.', 'Non minus architecto est praesentium aut voluptas sapiente ut aut odio facilis sint rem est animi minima omnis quia soluta fugit ea ad vitae illo omnis aut excepturi incidunt quia ut autem doloremque libero quo iusto ut minus dolore est quibusdam rerum non commodi eligendi sed minima est dolorum ut mollitia dignissimos aut ipsa maiores consequatur facilis id molestiae ullam odit quam mollitia velit enim reiciendis quidem asperiores rerum consequatur et ut aliquid excepturi consequuntur et eaque nulla doloribus itaque suscipit sit esse nemo expedita non quas cumque error laborum eos voluptatem praesentium porro qui rerum eum eos molestiae cum voluptatem nisi voluptatem voluptatem velit nihil incidunt ad autem natus unde rerum ratione repellat perferendis modi totam quia natus explicabo ut odit nostrum ducimus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-17', '2017-05-14 04:17:51', '2017-05-14 04:17:51');
INSERT INTO `lesson` VALUES ('960', '4', 'Perferendis est maxime atque ab error fuga ut aut illo.', 'Qui ea consectetur occaecati qui neque et et et voluptatem sit fuga in et quibusdam consectetur consequatur omnis voluptas inventore voluptatum aut et sit quia nostrum neque inventore inventore fugit quae commodi maiores velit possimus recusandae dolorem iusto accusamus odio rerum quae et ea eos voluptas aut qui maxime voluptas accusamus pariatur aliquam voluptatem sunt id cupiditate expedita repudiandae quia quas dolores reprehenderit voluptatibus incidunt vero animi doloribus ut qui sed consequatur provident eum sed ullam nam voluptas natus nisi facilis temporibus nemo mollitia non deleniti minus inventore rerum delectus minus rem numquam ducimus officiis praesentium ea error et eveniet eum quia doloremque animi qui nihil.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '50', null, '0', '1', '2017-05-18', '2017-05-14 04:17:51', '2017-05-14 04:17:51');
INSERT INTO `lesson` VALUES ('961', '1', 'Corporis porro aut reiciendis dolorem molestiae qui consequatur nihil odit occaecati.', 'In ullam earum quaerat illum ex nam quia reprehenderit impedit molestiae aut ullam molestiae ut eos veniam harum est occaecati voluptatem ullam repellat et aliquam quis ut in ullam vel qui nisi omnis amet saepe aspernatur hic pariatur numquam qui quibusdam perspiciatis aut magnam et non voluptatibus eum natus et deleniti minima repellendus fugiat odit et omnis odio repudiandae sed quisquam nihil exercitationem eum officia accusamus ea rerum sequi ratione consequatur fugit et ut porro et ea rem minima repellendus vitae et ipsa nisi magnam quisquam perferendis voluptatem animi qui magnam quaerat non est at et alias fuga recusandae quis consequuntur excepturi veritatis non et optio sed inventore eaque natus voluptatem dolorem fugiat reiciendis at nemo maiores magnam magnam necessitatibus ipsa cupiditate at vero ex vel sit ea hic fuga dolor fugiat fuga hic et sit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '31', null, '0', '1', '2017-05-18', '2017-05-14 04:17:51', '2017-05-14 04:17:51');
INSERT INTO `lesson` VALUES ('962', '20', 'Doloribus corrupti minima delectus consequuntur ut debitis culpa quibusdam dolores et ex.', 'Est maxime similique ea rerum voluptatem numquam et quo eaque in nihil consequuntur dolorem rerum quia soluta eius sequi maxime temporibus nam expedita sed assumenda sed enim dolorem iste amet dicta totam aut iusto non quaerat voluptatem vel id quis adipisci sed doloremque perferendis impedit exercitationem rerum explicabo et occaecati aut quo voluptas deleniti alias magni sunt quia in molestiae et dolor maiores ipsam architecto aut dolor consequuntur consequuntur dignissimos dolores exercitationem neque omnis doloribus placeat reprehenderit est sed et rem temporibus consectetur a rem quia sunt reiciendis sed beatae porro vel dolores sed enim autem est quos ratione nihil quis voluptatibus sit et aliquam doloremque consequatur perspiciatis nihil et voluptate ab doloribus qui modi saepe est eos mollitia et provident deserunt error minima dolorem ea autem fuga tempora quia temporibus dolor modi architecto aut eos quasi.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '35', null, '0', '1', '2017-05-17', '2017-05-14 04:17:51', '2017-05-14 04:17:51');
INSERT INTO `lesson` VALUES ('963', '5', 'Provident eaque est quaerat sed et possimus nobis animi.', 'Aut impedit rerum occaecati itaque alias et in et assumenda eius nobis sit ut sapiente beatae rerum alias ratione quas ut totam sint in impedit sed dolor facilis voluptas id illo molestiae labore rem cum ut culpa inventore dolorem dolorum et nobis odit dolore aut qui aut et aut sapiente nihil quia facilis tempore culpa unde nihil rerum laudantium soluta facere porro officiis modi sit quis est et quia itaque qui quo ut commodi.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '22', null, '0', '1', '2017-05-17', '2017-05-14 04:17:51', '2017-05-14 04:17:51');
INSERT INTO `lesson` VALUES ('964', '2', 'Earum repudiandae hic ipsam voluptas nesciunt dolor similique ut voluptas et.', 'Harum neque qui incidunt dolor veniam aut maxime rem voluptatem magni velit dolores eum ea occaecati debitis sint nobis ducimus ad dolores qui eius aliquam quidem id deleniti incidunt iste et et delectus adipisci eaque harum quas voluptates voluptas accusamus corporis dolore doloremque in assumenda culpa quos ullam ut nihil non non voluptate ipsam quaerat voluptates velit sunt nam rerum at doloremque aliquam doloribus deleniti ut vitae aut qui aliquam sit iure tempore qui aut repellat et tempora veritatis labore quis tenetur voluptatum officiis quae in laborum consequuntur quasi est molestiae ex blanditiis cumque fugiat omnis ea veniam quibusdam totam molestias placeat cumque cumque consequuntur aut quia ea magni.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '42', null, '0', '1', '2017-05-15', '2017-05-14 04:17:51', '2017-05-14 04:17:51');
INSERT INTO `lesson` VALUES ('965', '19', 'Nesciunt iusto asperiores voluptatibus officia vitae.', 'Qui eaque nesciunt deserunt et in eum iste et voluptas occaecati id adipisci voluptatem rerum facilis voluptates expedita temporibus eligendi culpa ut perferendis earum eum cupiditate nihil qui qui non mollitia et sed aliquam sit et esse doloribus iste aut blanditiis aut quis sit ea dolorem qui ea aut et sed ea sequi nemo ad adipisci nisi error delectus et voluptas est consectetur voluptatem et qui et sit distinctio qui rem repellat et quasi impedit itaque officiis accusamus qui occaecati ex omnis incidunt et necessitatibus est vel officia et ut eius minus minus aperiam et nihil cum sit voluptatem qui nobis laudantium qui enim doloremque autem aut vel voluptates saepe consequatur et dignissimos quaerat distinctio ea quibusdam et.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '39', null, '0', '1', '2017-05-15', '2017-05-14 04:17:51', '2017-05-14 04:17:51');
INSERT INTO `lesson` VALUES ('966', '5', 'Tempora et similique illo ullam et molestiae ex cum.', 'Quis perferendis quis sunt ea consequatur in voluptatibus magnam magnam qui sequi in ea quos consequatur laborum ex ab error dolor et placeat rem est dignissimos ut occaecati alias consectetur fugit aliquam quibusdam cum aliquid dolor recusandae aut illum qui consectetur ab id aut porro fugiat voluptate aut iusto pariatur saepe dolore qui nisi sequi nostrum repudiandae cum eligendi quae aut dolore non nihil quia aut laboriosam iste molestias est consequuntur laudantium maiores aperiam dignissimos quidem asperiores qui eveniet vero voluptatum nulla facere non et facere hic labore magnam porro ab dolor nulla adipisci officiis voluptates fuga aliquid sed et laudantium rerum omnis nihil sunt aut sit et velit minima totam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-19', '2017-05-14 04:17:51', '2017-05-14 04:17:51');
INSERT INTO `lesson` VALUES ('967', '14', 'Doloribus consequatur enim est possimus est.', 'Ut dolorem ipsa corporis molestiae modi voluptate quisquam eaque quia laborum quisquam qui quis officia eaque et et labore corporis quisquam vel temporibus iure enim earum fuga voluptatem iure magnam omnis voluptatibus sequi necessitatibus sint incidunt ea quis voluptatem minus consectetur blanditiis asperiores aliquam id corporis vel excepturi debitis debitis repellendus ut quae mollitia tempore fuga quidem aspernatur voluptatem in vero rem in commodi recusandae exercitationem explicabo cupiditate mollitia nobis iure aliquid nihil eos impedit soluta aperiam autem accusantium sint ex fugiat delectus aut laborum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '22', null, '0', '1', '2017-05-16', '2017-05-14 04:17:51', '2017-05-14 04:17:51');
INSERT INTO `lesson` VALUES ('968', '8', 'Magnam reiciendis sunt eos explicabo inventore labore ipsum.', 'Veniam non et nihil velit ullam ex libero qui quo eum necessitatibus pariatur vitae consequatur voluptatem dolore ut incidunt voluptas itaque ut voluptatem eius suscipit ut minus atque molestiae eligendi qui alias minus debitis maxime sequi error officia cupiditate voluptatem eum voluptatem culpa voluptates omnis eos ipsam dolor nesciunt autem pariatur ullam laboriosam unde distinctio ipsam velit distinctio rerum est autem sit modi et officia et et amet dolor laudantium maiores consequatur illum quas praesentium rem cumque ratione veritatis ratione natus error illum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-14', '2017-05-14 04:17:51', '2017-05-14 04:17:51');
INSERT INTO `lesson` VALUES ('969', '26', 'Totam sint quibusdam maiores suscipit quasi cum odio natus earum.', 'Ut dolorem nihil ut vel voluptatibus consequuntur suscipit temporibus voluptates omnis quae beatae sed et ducimus dignissimos blanditiis et rerum quis optio quis dolorum ut voluptatem amet nostrum quia esse eum atque id dolor nostrum inventore fuga nobis quas delectus officia nesciunt velit dolor neque sed assumenda quas doloribus repudiandae dolorem placeat eaque autem doloribus sint atque commodi harum et a tempora aut aut in et repudiandae rerum sed velit ut deleniti aperiam neque veritatis voluptates ut omnis porro nihil nostrum sequi voluptatem minima quas aut blanditiis repellat dolores rerum excepturi ex voluptatem qui eaque quia sed distinctio laudantium accusamus quo expedita rerum unde laboriosam molestiae libero et debitis quam corporis aut vero quia optio quo libero consequatur quia eos omnis unde aperiam ut nihil eum similique iure ut laudantium.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-19', '2017-05-14 04:17:51', '2017-05-14 04:17:51');
INSERT INTO `lesson` VALUES ('970', '11', 'Qui quia reiciendis fugiat fuga aliquam qui commodi illo vel.', 'Velit voluptas accusantium autem sed fuga quis ullam distinctio est non ab necessitatibus dolorum repudiandae reiciendis dolores et doloremque voluptatem vel aut sint est neque doloribus voluptas sint numquam nostrum voluptatem aspernatur aspernatur in non totam cumque voluptas necessitatibus ea quidem voluptates reiciendis porro consequatur et magni eum enim fugit quas sint numquam reiciendis distinctio ab ut velit ipsa sed omnis est animi inventore minus hic voluptas nostrum id ducimus qui autem natus tenetur minus vitae qui et rerum et in harum placeat dolore impedit ut quis dolorem magni animi unde rerum sunt eum adipisci sunt quod quis ut eveniet ut modi earum provident sequi perspiciatis doloribus et iusto incidunt quas nemo eum vitae ipsam.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-16', '2017-05-14 04:17:51', '2017-05-14 04:17:51');
INSERT INTO `lesson` VALUES ('971', '1', 'Molestias et et inventore ipsam consequuntur nisi dolore.', 'Neque quae aspernatur pariatur sit ipsa quod laboriosam placeat eum ullam minus optio necessitatibus sunt eius asperiores ut nesciunt quis excepturi atque autem qui omnis omnis numquam est est quam et asperiores a eum totam vero perspiciatis sed distinctio quia et earum alias quos nulla deserunt aperiam tenetur itaque dignissimos impedit et eveniet quae est neque porro quibusdam dolores minima pariatur maxime labore occaecati ipsam id rerum molestiae aut voluptatem veritatis perspiciatis perferendis quas debitis totam est eos qui deleniti doloremque quae ullam sit ut eveniet iure aut cupiditate est dolorem esse consequuntur libero aliquam at qui ut repellat ut eius atque sint maiores autem numquam maxime esse qui laudantium vitae velit dolor voluptatem error ut non dignissimos ullam in quam aut nam tempore voluptatibus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-16', '2017-05-14 04:17:51', '2017-05-14 04:17:51');
INSERT INTO `lesson` VALUES ('972', '23', 'Alias dolores voluptas soluta consequuntur sint illum voluptas iusto.', 'Earum et voluptates accusantium non ad enim rerum incidunt ad occaecati odit dolorem ipsam laborum nulla nam voluptates doloribus aliquid provident saepe totam temporibus est molestiae quod laudantium maiores praesentium deleniti tempora aut nesciunt sed rerum architecto molestias qui laboriosam eius totam mollitia sed dolorem quae placeat et repellendus harum est sunt doloremque molestiae qui vel magni eveniet est vero quibusdam commodi earum officia quasi atque voluptas iure nobis perspiciatis eaque distinctio officiis natus quibusdam laborum odit voluptatem ad quia qui nulla veritatis voluptas sit possimus reprehenderit repudiandae quia magni eius doloremque maxime et est rerum et nisi culpa omnis aut ipsum quia et nam temporibus id sit at quo sed ducimus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '37', null, '0', '1', '2017-05-17', '2017-05-14 04:17:51', '2017-05-14 04:17:51');
INSERT INTO `lesson` VALUES ('973', '23', 'Animi esse voluptas qui aut suscipit laboriosam.', 'Consequuntur accusamus autem quam nihil doloribus nemo rerum neque necessitatibus et nemo quia est natus eos doloribus voluptatem rerum laudantium iusto placeat et cumque adipisci aperiam aspernatur enim excepturi dolores sunt in animi excepturi natus non eum commodi vel dolor sunt sed quam optio aliquid officia deserunt similique dolorem dolorem eveniet in quo est distinctio voluptas necessitatibus doloribus beatae molestiae possimus est minima ducimus dolores pariatur ut ut qui reprehenderit quisquam sequi sint non totam beatae et omnis qui expedita dolores qui iste voluptas est repellendus ipsa omnis aut impedit velit dolor nihil vel ut adipisci delectus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-19', '2017-05-14 04:17:51', '2017-05-14 04:17:51');
INSERT INTO `lesson` VALUES ('974', '14', 'Et in sint omnis eos sint beatae.', 'Impedit unde dolores est distinctio asperiores dolorum vero iure quod perferendis sunt culpa molestiae ad repudiandae eos autem quam facilis et et est dolore enim nobis saepe odit qui ut est dolore repellat repellendus eveniet similique officia et numquam ut illo excepturi velit voluptatem ad odit commodi in aut quos nihil magni in aut quidem expedita sed et deserunt laborum non qui sit aut quis accusantium aut eligendi consectetur corrupti et nobis qui aliquid pariatur ullam id labore eius vitae ex nemo deleniti et quia aut exercitationem odit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-15', '2017-05-14 04:17:51', '2017-05-14 04:17:51');
INSERT INTO `lesson` VALUES ('975', '11', 'Ut distinctio nostrum aspernatur adipisci atque.', 'Inventore dignissimos neque pariatur est beatae quia illum quo qui dolorem rerum qui autem reprehenderit dolores non ab a aspernatur voluptas labore perspiciatis doloremque sint tempore eum enim porro in beatae rem soluta corporis aut nesciunt temporibus quae ut architecto sit neque et laudantium quidem nam consequatur quia velit sit quis blanditiis repudiandae optio error eum occaecati deleniti sed beatae hic hic omnis similique assumenda ut sit beatae libero dolorum dolores aut reiciendis iusto sit soluta sed mollitia non optio recusandae in quas voluptate ut fugiat dolorem vel accusamus est voluptatibus sed illum earum et dolores eius commodi et nihil illum corrupti quasi ipsum delectus dolore maxime eos perferendis.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-18', '2017-05-14 04:17:51', '2017-05-14 04:17:51');
INSERT INTO `lesson` VALUES ('976', '4', 'Aut voluptas enim omnis unde quia itaque.', 'Fuga pariatur qui exercitationem voluptas aperiam magnam rerum doloremque cum voluptas voluptates molestiae sit amet nisi nobis quia minus mollitia dolor architecto et dicta tempora enim aspernatur voluptatem nam eligendi odio dolores voluptate sunt perferendis et et voluptatibus tempora quibusdam quo et facilis voluptatem maiores id vitae dolorum suscipit fugit qui numquam quas quasi at quidem id qui aut ea rem quis odio veritatis recusandae hic necessitatibus sunt eos voluptate cupiditate velit veniam ducimus minima voluptas repellat voluptatum sed optio voluptas aut minima laboriosam architecto exercitationem culpa ea repellat dicta ea ex pariatur eius est non et porro tempore laborum repudiandae modi libero minus aut earum et dicta ut eos dolorem laboriosam consectetur culpa necessitatibus adipisci voluptate accusantium ab esse soluta odio illum perspiciatis in animi.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '30', null, '0', '1', '2017-05-19', '2017-05-14 04:17:51', '2017-05-14 04:17:51');
INSERT INTO `lesson` VALUES ('977', '13', 'Qui sunt consequuntur praesentium assumenda inventore necessitatibus deserunt et doloremque sunt.', 'In et quo quo qui suscipit amet adipisci aut et laborum quo velit molestias id ex numquam reprehenderit ut enim inventore mollitia eum minima non mollitia qui aut voluptatum mollitia excepturi et quis libero quia nemo id aperiam illo eum est minus sint debitis tempora minus voluptas provident occaecati nobis aliquid voluptas consectetur non sit omnis magni odio et corrupti non tempore sed est consectetur asperiores a asperiores eligendi rerum nostrum sint id officia sit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '39', null, '0', '1', '2017-05-17', '2017-05-14 04:17:51', '2017-05-14 04:17:51');
INSERT INTO `lesson` VALUES ('978', '3', 'Consequatur aut earum non qui amet placeat impedit nihil dolor.', 'Incidunt voluptatibus eum possimus aut dolorem dolorem nam ut cupiditate debitis consequuntur ex porro in aut molestiae ipsam similique assumenda deserunt rerum ipsam expedita consequatur voluptatem quis qui mollitia at excepturi voluptas voluptas sit quo ut blanditiis nihil odit aut similique deleniti aut est ut cumque enim optio eum ea optio quos voluptas perferendis nihil distinctio cum qui illum delectus sint ut delectus quae consequuntur nostrum qui perspiciatis velit dolores rerum minima enim delectus nobis velit pariatur modi minus veritatis aliquam consectetur eum est animi facilis doloremque ea dolorem autem voluptatem laborum quia vel aut nihil dolores rerum aut distinctio error earum nisi perspiciatis voluptatibus nam quis autem iste esse sunt pariatur molestiae qui at cupiditate perspiciatis earum consequatur et officia et sit optio sunt occaecati et et libero ipsum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-19', '2017-05-14 04:17:51', '2017-05-14 04:17:51');
INSERT INTO `lesson` VALUES ('979', '18', 'Veritatis et illum et consequatur voluptatum.', 'Saepe itaque illo animi eum deleniti ab qui cum qui nihil debitis expedita animi distinctio facilis necessitatibus expedita assumenda quia et et cum et velit voluptatem et voluptatem aut illum labore corrupti quia quod nesciunt aut in ratione nihil aut iure adipisci ea sed dolorum dolores maiores earum asperiores provident consequuntur aliquam quam quis dolores eum corrupti aut qui tempore rerum unde laborum ut accusamus ea vero sit quaerat molestiae soluta quaerat aut ab quaerat ut earum nostrum distinctio atque voluptatem et vel quam repellat a sunt voluptatem soluta itaque maiores qui illum eos suscipit reiciendis repudiandae at fugit et rem hic eum expedita sed est ut optio nulla ea.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '26', null, '0', '1', '2017-05-16', '2017-05-14 04:17:51', '2017-05-14 04:17:51');
INSERT INTO `lesson` VALUES ('980', '9', 'Distinctio dolores alias tempora odio qui ad nostrum totam voluptas dolores.', 'Quod recusandae dicta voluptatem vel id aut et ipsam doloribus autem eum est voluptatem quas non dignissimos dicta eum commodi voluptatibus vel officia tempora alias dolorem rerum fugit voluptatem officiis eum iste et autem qui unde voluptate quidem maxime magnam nostrum officia est quis velit esse impedit occaecati earum dolore ad aperiam ut dolores dolorem ipsam quia cumque autem cumque at atque ducimus rem sit labore temporibus vitae in consequuntur excepturi sunt et expedita consectetur quod autem earum recusandae saepe aut ea ut sit et esse nihil quis dignissimos aut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '36', null, '0', '1', '2017-05-19', '2017-05-14 04:17:51', '2017-05-14 04:17:51');
INSERT INTO `lesson` VALUES ('981', '2', 'Saepe autem quia qui blanditiis amet rerum ea.', 'Soluta sequi aut similique dolorum porro laboriosam dicta ut tempora tempora aperiam exercitationem qui officia neque voluptas odio molestiae eius adipisci est id nisi quidem voluptatem dicta dignissimos eius voluptas in deserunt eligendi possimus qui quas eum ipsum rerum doloremque distinctio explicabo atque porro occaecati quam sapiente maxime sunt commodi asperiores perspiciatis amet inventore quae et dolore veniam eos reiciendis expedita est minus voluptate ab impedit tenetur facilis ut sit et rerum cupiditate nostrum est a dolor architecto sit omnis omnis ratione.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '30', null, '0', '1', '2017-05-18', '2017-05-14 04:17:52', '2017-05-14 04:17:52');
INSERT INTO `lesson` VALUES ('982', '23', 'Et architecto facere et sed tempore placeat omnis ut est cum.', 'Nihil enim vitae occaecati eaque possimus velit possimus qui ipsa consequatur doloremque distinctio animi dolores velit et suscipit officiis vero aut doloribus dolorem accusamus alias veritatis perspiciatis unde excepturi occaecati quas molestiae excepturi consequatur neque velit mollitia id perspiciatis voluptas et laboriosam in itaque soluta maxime ratione repudiandae deleniti praesentium eligendi totam unde repellat sint minus blanditiis voluptatem voluptas quibusdam doloribus nisi reiciendis sit non saepe officiis asperiores nesciunt aut beatae sit perspiciatis quae dignissimos recusandae vel voluptates tenetur eaque quis ut nam possimus sunt natus ut fugiat quasi soluta perspiciatis amet aut illo molestiae non ut dolorem et ratione velit voluptatem enim similique nostrum quibusdam impedit alias impedit totam iste non quis maxime odit nobis rerum in qui vero doloremque quibusdam quidem et aut et praesentium consectetur saepe et qui aut ipsam nulla maxime neque perferendis tempore quia maxime.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-16', '2017-05-14 04:17:52', '2017-05-14 04:17:52');
INSERT INTO `lesson` VALUES ('983', '11', 'Nisi rerum quibusdam eligendi non accusamus.', 'Perspiciatis quam officia minima iure consectetur porro ut consequatur dignissimos eius qui qui exercitationem corporis saepe animi sunt quam ea et aliquam aut adipisci corrupti libero a quis aut error omnis odit a distinctio consequuntur est deserunt totam dolorem dolor non id corporis sunt cumque odio assumenda iusto aperiam sed doloremque ducimus labore quis nemo aut repudiandae nostrum dolore aut culpa ratione quas porro eum numquam fugit occaecati et doloribus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-17', '2017-05-14 04:17:52', '2017-05-14 04:17:52');
INSERT INTO `lesson` VALUES ('984', '25', 'Enim qui iusto perferendis voluptatibus explicabo nostrum.', 'Dicta optio quas qui ex voluptate qui ducimus ut quos consequuntur optio accusantium itaque ipsum itaque aut ratione quam odio et et ut odio repudiandae similique natus eligendi beatae vel pariatur rem sapiente quasi atque quos recusandae et sunt sit quae voluptatem quisquam qui magnam possimus et velit sit et aliquam sint dolor rerum quod reprehenderit voluptas qui ipsum qui repellat cum magni qui saepe pariatur necessitatibus exercitationem quia est dolore expedita quod non et quis voluptatibus veniam unde repellat aperiam perferendis maxime occaecati eum praesentium quis provident delectus sed magnam maiores ullam ut eum aliquam quos quo quo natus iure possimus quia natus ex ex quo distinctio recusandae eum itaque sint dolores.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-15', '2017-05-14 04:17:52', '2017-05-14 04:17:52');
INSERT INTO `lesson` VALUES ('985', '11', 'Est dolor asperiores impedit quia doloribus voluptatem autem.', 'Cupiditate repellendus et beatae deleniti fuga quis assumenda necessitatibus aspernatur laboriosam asperiores dolore praesentium consectetur velit quas recusandae adipisci enim ab aut magni debitis aut tempore non vel est est soluta nulla quisquam sit ea ea aut quos fugit nesciunt repellat non vel nesciunt et odio error esse est mollitia minima ipsam eveniet nihil natus harum totam delectus et odio fugit nam illo quo nulla sit aut atque consequuntur.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '30', null, '0', '1', '2017-05-15', '2017-05-14 04:17:52', '2017-05-14 04:17:52');
INSERT INTO `lesson` VALUES ('986', '14', 'Culpa temporibus quas ut ea nisi voluptas soluta accusantium.', 'Et rerum iure sed eius velit quo beatae placeat ex aperiam a modi est ut aut odit aspernatur in sunt consequatur impedit aut nisi omnis occaecati dolore repudiandae ut dicta esse vitae maxime eaque consequatur consequatur quibusdam nobis eligendi explicabo laborum maxime sint quos odio vero ad qui molestias voluptas excepturi adipisci et eius nam quia quis ratione ratione omnis provident et temporibus quis sapiente debitis repellat et voluptatem delectus est provident quo et nulla dicta quasi quibusdam eaque perferendis sit tempora libero alias quam odit dignissimos dolore nostrum odio voluptas aspernatur assumenda porro nemo sint qui consequatur excepturi error aut beatae maxime impedit veniam quia dignissimos alias amet nesciunt magnam alias dolore repudiandae magni.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '40', null, '0', '1', '2017-05-17', '2017-05-14 04:17:52', '2017-05-14 04:17:52');
INSERT INTO `lesson` VALUES ('987', '27', 'Vitae commodi facere suscipit culpa quo explicabo hic dolor voluptas.', 'Odit aut exercitationem ab consequatur magnam repudiandae at esse velit aliquid sunt culpa et adipisci sunt et fugit porro sequi quo rem qui incidunt dolorem aperiam velit ratione temporibus ullam voluptatem adipisci occaecati incidunt sed quisquam fuga asperiores nostrum magni ex dolorem totam qui earum debitis libero maiores nulla sunt atque minima illo dolores id mollitia natus occaecati non et doloremque et quam sint incidunt.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '41', null, '0', '1', '2017-05-19', '2017-05-14 04:17:52', '2017-05-14 04:17:52');
INSERT INTO `lesson` VALUES ('988', '25', 'Repudiandae alias quis error dolorem.', 'Voluptas deleniti qui qui dicta ullam dolor numquam delectus rerum quod tempore rerum enim reiciendis voluptatem nostrum est quo cumque ut est non impedit maxime vero sed tempora omnis unde illo dignissimos maiores sit aut non eaque dolore et autem sed in suscipit quas sequi non facilis tempore error accusamus vitae possimus aspernatur aut consectetur ut quibusdam voluptas similique eligendi expedita ab rerum non quia velit cumque deserunt minus perferendis vel beatae incidunt esse incidunt porro inventore tempora animi quam possimus voluptas optio quas aut quibusdam cumque consequatur porro quia amet doloremque ipsum voluptas et ut dolore dignissimos non fuga et velit molestiae omnis provident atque dolores ex dolore voluptatibus sequi expedita qui.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '24', null, '0', '1', '2017-05-19', '2017-05-14 04:17:52', '2017-05-14 04:17:52');
INSERT INTO `lesson` VALUES ('989', '21', 'Saepe soluta ratione corporis et qui reprehenderit atque.', 'Cum labore laborum libero natus nemo expedita quam nobis voluptas aperiam sed quis quo debitis ab labore modi consectetur soluta ex aut officia cumque enim iste quae at dicta ut eum impedit laborum commodi assumenda repellendus est corporis beatae est ducimus error consequatur quos at quas qui quis saepe esse laudantium omnis veritatis quia assumenda laboriosam officia sunt sed rem velit officiis fuga tempore debitis quia molestias et itaque dolore similique hic voluptates neque nesciunt ea esse aut repellat perferendis maxime eveniet quos iste minus ut quidem itaque reprehenderit magnam animi eos eligendi dolores magnam ad molestias est ea sint et neque provident praesentium magnam quo hic animi provident nulla harum blanditiis tenetur rerum.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '22', null, '0', '1', '2017-05-14', '2017-05-14 04:17:52', '2017-05-14 04:17:52');
INSERT INTO `lesson` VALUES ('990', '20', 'Voluptatem esse veniam eos omnis dolorem qui voluptatum.', 'Esse est explicabo aut incidunt pariatur rerum qui harum ut maxime beatae aspernatur consequatur error consequatur neque adipisci temporibus laudantium odit facilis inventore ad ad voluptatem ab sit qui eveniet qui qui quos repudiandae sit inventore vitae eligendi fuga magni voluptatem reprehenderit quas hic eligendi earum aut dignissimos ut quasi aut voluptas facere id et et quod et et eligendi ipsa in in aperiam maiores natus et eaque sit.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-17', '2017-05-14 04:17:52', '2017-05-14 04:17:52');
INSERT INTO `lesson` VALUES ('991', '19', 'Dolore iusto corrupti perferendis voluptas accusamus.', 'Reprehenderit ipsa sed ea ducimus est rem impedit dolores incidunt quos vel qui est sed rerum dolorum ut voluptatem minus iste voluptas qui et in qui reiciendis eaque laborum et quia consectetur quia earum et eligendi vero sed omnis numquam nobis quos dolorem nemo rerum tempora temporibus delectus quibusdam reprehenderit animi distinctio quia ut sit maxime et est molestiae ut provident et exercitationem nisi voluptas veritatis harum beatae at consequatur sunt qui velit quas neque dolore et fugit adipisci laboriosam tempora earum et maxime possimus quam nemo ut officia consequatur non ut qui voluptatibus non itaque vitae enim commodi ducimus molestiae neque aut sit sed eaque labore rerum voluptate amet ut quo cum hic quas sequi non consequatur sed qui suscipit ex ullam error labore.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '29', null, '0', '1', '2017-05-17', '2017-05-14 04:17:52', '2017-05-14 04:17:52');
INSERT INTO `lesson` VALUES ('992', '8', 'Eum sint sunt vel autem aperiam tempora esse ea.', 'Perferendis possimus quaerat dolorem ratione eveniet et rerum ex esse consequatur eveniet et accusantium officiis qui odit nemo ut eaque non similique modi dolor inventore aut sint qui et quod cum sit voluptatibus repellat qui consectetur consequatur nemo ea voluptatibus qui unde est voluptatum non veniam et accusantium cum soluta ullam soluta et quis et eos quis natus repellendus sed ut aspernatur quia aut tenetur nemo fugit et cumque consequatur ea voluptatibus aut assumenda enim ad dolore aut vero est adipisci eligendi in quo aut accusantium voluptatibus qui eum exercitationem quisquam at ut adipisci nihil eos iusto esse ut provident blanditiis aliquam laudantium voluptas beatae recusandae sint cum aut explicabo maiores et blanditiis est dolorum dolorem consequatur qui repudiandae voluptatem consectetur assumenda praesentium velit animi porro molestias sint neque tempore harum porro quia necessitatibus aut necessitatibus.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '21', null, '0', '1', '2017-05-19', '2017-05-14 04:17:52', '2017-05-14 04:17:52');
INSERT INTO `lesson` VALUES ('993', '19', 'Omnis eos ducimus aut facilis illum voluptatum dicta quia.', 'Error et eligendi nobis enim quis maxime voluptatem temporibus id suscipit nihil itaque ut est accusantium vitae rerum officiis voluptas repellat non quia facilis et ab omnis odit voluptas occaecati voluptas aut ut quibusdam perferendis voluptas reiciendis laboriosam asperiores magni voluptatum ipsam incidunt quae pariatur blanditiis hic esse cupiditate distinctio porro dignissimos rerum itaque itaque molestiae incidunt sed nihil qui nihil quod voluptatem sed culpa facere et magnam corporis et fugiat vitae a at eaque excepturi maiores amet qui quo deleniti id qui voluptas repellat eligendi est minima qui exercitationem ipsam repudiandae natus consequatur.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '44', null, '0', '1', '2017-05-18', '2017-05-14 04:17:52', '2017-05-14 04:17:52');
INSERT INTO `lesson` VALUES ('994', '27', 'Delectus illum exercitationem sed omnis eius tempore aut.', 'Beatae qui ut et rerum illum aut provident velit enim ea tenetur ut quis adipisci rerum adipisci sed occaecati quis eum consequatur accusantium accusamus harum ut natus enim itaque earum neque quia quia aut non vitae voluptates aperiam eum et aperiam atque rerum recusandae saepe architecto sed omnis quia suscipit debitis corrupti aliquid explicabo corporis aut occaecati consequatur est quae tenetur quo nam reprehenderit deleniti sapiente accusamus ut nostrum quibusdam explicabo distinctio aliquam beatae cum animi ullam exercitationem qui ut omnis eveniet magnam incidunt voluptas iusto dicta aut quia placeat fuga et qui ad tenetur et harum distinctio et ab voluptatem eos at asperiores quia minima dolores architecto id voluptatem dolores fugiat.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '23', null, '0', '1', '2017-05-14', '2017-05-14 04:17:52', '2017-05-14 04:17:52');
INSERT INTO `lesson` VALUES ('995', '20', 'At explicabo autem aspernatur assumenda delectus debitis.', 'Assumenda eius commodi hic et sunt velit voluptatem non culpa pariatur est quisquam at fugit iusto accusantium corrupti sed similique quasi facere neque illo eius et eaque hic consequuntur explicabo optio enim rerum asperiores odio totam voluptates sint illum quis dolore necessitatibus fugit dolorum ea est et aspernatur perferendis beatae aliquid atque omnis perspiciatis et nihil at ipsam aperiam vero sed.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '32', null, '0', '1', '2017-05-14', '2017-05-14 04:17:52', '2017-05-14 04:17:52');
INSERT INTO `lesson` VALUES ('996', '12', 'Voluptatem excepturi vero enim nam quia.', 'Corporis ipsa mollitia facilis aliquid aliquam assumenda totam sit ratione animi aut qui fugit ut beatae qui voluptas qui enim atque nam rerum itaque voluptate voluptatum reprehenderit officia autem maiores provident eveniet tempore qui necessitatibus et praesentium qui nisi hic et sit quod itaque vitae assumenda repudiandae asperiores iusto sit laboriosam fugit enim sit et voluptate quia eum necessitatibus aut et ea adipisci doloribus sed quaerat enim doloribus mollitia aut commodi quasi omnis quisquam expedita et et earum ut maxime ullam ut a quia ut facere commodi et velit atque consequatur distinctio perspiciatis neque non quidem officiis velit cupiditate ut similique qui maxime non eveniet molestiae ab a qui eligendi commodi vitae et est sunt occaecati sit voluptatem distinctio quaerat esse sed magnam illo doloribus rerum ut rem aliquid magnam quaerat.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '43', null, '0', '1', '2017-05-17', '2017-05-14 04:17:52', '2017-05-14 04:17:52');
INSERT INTO `lesson` VALUES ('997', '29', 'Rerum dignissimos nobis magni iste dolorem autem.', 'Eos vero expedita ut expedita ipsam officiis molestias voluptatibus autem saepe veniam aperiam amet asperiores iste non aut commodi corrupti autem libero placeat est nobis nemo magnam quos et ipsa illum quibusdam sunt cumque doloribus est et ut doloremque sed qui quas explicabo dicta aut dignissimos beatae facere nam dolor rerum quis fugit voluptatum est aut repudiandae itaque at numquam voluptates aut illum magni vitae et saepe quia rerum sequi minus cumque explicabo est adipisci vel temporibus dolorum omnis provident quisquam aliquam quia aut magnam aliquam assumenda aliquam atque saepe veritatis in ad aliquam quod ipsum iste veritatis accusantium molestias quae nostrum dolores consequatur ut consequatur nulla sapiente a incidunt minima nihil est perspiciatis veniam velit esse earum quisquam doloremque iusto eligendi architecto repellendus veniam velit rem sed totam maxime nisi qui nihil ut.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '48', null, '0', '1', '2017-05-16', '2017-05-14 04:17:52', '2017-05-14 04:17:52');
INSERT INTO `lesson` VALUES ('998', '27', 'Voluptatum illo voluptates natus nemo omnis placeat consectetur voluptatem velit aut.', 'Ducimus quia enim quisquam praesentium animi accusamus est rerum sit non sunt in nam esse eius et voluptatum molestiae et omnis eos quo nihil quibusdam velit minus rerum nobis placeat dolor sit tempora voluptates voluptas et et nihil sint enim quo aliquam esse iure eius quo deleniti repellendus maiores esse vero voluptatem rem et ut sit et quaerat dolorem distinctio ipsam nesciunt aut ducimus voluptate dolorem veritatis non repellat corporis dolorem est iste molestiae debitis cumque veritatis perspiciatis aut est pariatur autem perspiciatis facere ea et quae qui eum nobis iusto pariatur dolores voluptatem consequatur est id nulla ab aut id est qui ex sit accusantium illo ipsam omnis deserunt iusto cupiditate consequatur itaque vitae voluptatem qui aut corporis est omnis dolor.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '38', null, '0', '1', '2017-05-19', '2017-05-14 04:17:52', '2017-05-14 04:17:52');
INSERT INTO `lesson` VALUES ('999', '7', 'Excepturi corporis ex et ab ut enim alias.', 'Deleniti repudiandae enim iste nobis repellendus iure et est impedit rerum repudiandae et accusamus et magnam ut ut asperiores sunt odio corrupti dolore recusandae sint fuga minus consectetur error quaerat consequatur nihil consequatur quibusdam perspiciatis optio ut quis voluptatem sed error itaque natus repellat nostrum rerum modi veritatis id laudantium suscipit error rerum et consequatur reiciendis eius eaque molestiae accusantium laboriosam laborum consequatur aliquid ut dolor voluptas omnis et possimus autem facere quam qui rerum neque repellat dolorum ut voluptas velit alias in magnam sunt quod esse illo quibusdam animi aliquam dignissimos soluta ab accusamus sit iure dolores est odio dolor quia officiis sint recusandae adipisci velit consequatur sequi et dignissimos sint qui quis impedit quidem incidunt sint sint veniam quo deleniti pariatur et dignissimos ullam et non et repellendus autem.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '46', null, '0', '1', '2017-05-14', '2017-05-14 04:17:52', '2017-05-14 04:17:52');
INSERT INTO `lesson` VALUES ('1000', '27', 'Beatae quisquam aut veniam modi aut perferendis ducimus vel quae facere.', 'Dolorem hic non quae hic id velit eius quia deleniti deserunt voluptatem dolorem et est cum a et qui voluptatem dolorem laborum similique qui consectetur similique repudiandae et tempore qui laudantium ea ea et ut earum ab soluta hic veritatis sint quaerat sit voluptatem molestias repudiandae vitae asperiores quae perferendis praesentium et omnis quis ad atque voluptates rerum officiis quisquam magni recusandae voluptatibus officia qui eveniet amet earum consequatur quia earum et et sit repellat culpa ex ratione aut placeat quis neque quis voluptas dolor voluptatum nostrum eveniet nam nihil nam perspiciatis tenetur excepturi fuga sint aut odit consequatur aperiam tenetur quis eveniet molestiae dolore ratione quia voluptates voluptatem rerum nesciunt et nostrum labore ea hic.', 'https://www.youtube.com/watch?v=zwoTa2AyLNI', '34', null, '0', '1', '2017-05-18', '2017-05-14 04:17:52', '2017-05-14 04:17:52');
